INSERT INTO `assignments` VALUES (1,92,'published','MBA Consulting',NULL,'BUSL 626','Integrating Project Capstone',33,2016,'winter/spring','<p>Groups of 5 MBA student-consultants,will solve a business challenge currently facing your business <u><strong>over an intensive  2.5-week period!</strong></u></p>','group','2017-04-03','2017-04-21',500,NULL,'<p>Each student group will <u><strong>complete 500 hours of work</strong></u> in order to provide recommendations on the problem/opportunity that your firm is facing and report back to your company in a <u><strong>15-minute presentation with accompanying detailed strategic brief.</strong></u></p>',1,NULL,'2017-02-13 18:18:01','2017-03-20 22:28:41','<p>Groups of 5 MBA student-consultants,will solve a business challenge currently facing your business <u><strong>over an intensive  2.5-week period!</strong></u> The challenge can be anything related to business, such as: </p><ul><li><strong>new market entry</strong></li><li><strong>value chain analysis</strong></li><li><strong>marketing strategy</strong></li><li><strong>operations management solutions</strong></li><li><strong>leveraging new technologies for change</strong></li><li><strong>expansion strategy</strong></li></ul>',4,'MBA',1,NULL,'local','2017-07-12 16:09:06'),(2,83,'published','International Expansion Consulting',NULL,'','',NULL,2016,'fall','<p>Teams of 5 or 6 student-consultants will submit a <u><strong>10-page strategic plan report</strong></u> that includes industry and competitive analyses, capabilities and competencies of the industry partner, the strategic fit of their recommendations, and <u><strong>how they will benefit the growth of the firm</strong></u>, specifically as it relates to their global position and marketplace.</p>','individual','2017-02-07','2017-02-10',NULL,NULL,'<p>Teams of 5 or 6 student-consultants will submit a <u><strong>10-page strategic plan report</strong></u> that includes industry and competitive analyses, capabilities and competencies of the industry partner, the strategic fit of their recommendations, and <u><strong>how they will benefit the growth of the firm</strong></u>, specifically as it relates to their global position and marketplace. Teams will also present their findings in a <u><strong>15-minute presentation to the entire class and industry partner</strong></u>. </p>',1,NULL,'2017-02-13 18:23:50','2017-03-08 23:48:31','<p>A team of 5 to 6 student-consultants will take <u><strong>your product/service that you are targeting (or might want to target) for international markets</strong></u> and make a strategic plan for it. Over the semester, this team will research and assess the international market(s) that you want, while assessing the internal capabilities of your firm and the <u><strong>strategic alignment of their recommendations</strong></u>.  </p>',1,'',1,NULL,NULL,NULL),(3,95,'published','Corporate Challenge',NULL,'','',NULL,2016,'fall','<p>Each team of students will provide actionable recommendations that they <u><strong>present to your management team in 10-minute presentations</strong></u>.</p>','individual','2016-11-24','2017-04-03',NULL,NULL,'<p>Each team of students will provide actionable recommendations that they <u><strong>present to your management team in 10-minute presentations</strong></u>.</p>',1,NULL,'2017-02-13 18:28:05','2017-03-08 23:44:05','<p>Teams of MBA and undergraduate business students, each paired with a faculty advisor, will spend 20 hours analyzing your unique business opportunity/challenge and provide actionable recommendations. Areas of expertise could be:</p><ul><li>Marketing Strategy</li><li>New Market Entry</li><li>HR Strategy</li><li>Internationalization Plan</li><li>Operations Management Solutions</li><li>Technical Integrations to improve systems</li><li>or whatever else you deem important</li></ul>',1,'',1,NULL,NULL,NULL),(4,61,'published','Service Provider Audit & Consultancy',NULL,'','',NULL,2016,'fall','<p>Each group of student-consultants will <u><strong>spend +100 hours working</strong></u> <u><strong>on</strong></u> <u><strong>your organization</strong></u>. At the end of which, each group will showcase their servicescape recommendations to you in a <u><strong>15-minute presentation, which will be accompanied by a +10-page document detailing their research and reasonings</strong></u>. </p>','individual','2017-01-20','2017-03-31',NULL,NULL,'<p>Each group of student-consultants will <u><strong>spend +100 hours working</strong></u> <u><strong>on</strong></u> <u><strong>your organization</strong></u>. At the end of which, each group will showcase their servicescape recommendations to you in a <u><strong>15-minute presentation, which will be accompanied by a +10-page document detailing their research and reasonings</strong></u>. </p>',1,NULL,'2017-02-13 18:35:38','2017-03-08 23:44:55','<p>Six groups of student-consultants will <u><strong>analyze your specific service landscape and provide recommendations about how your organization can improve its service</strong></u> <u><strong>experience</strong></u>, while maximizing the value for the customer, business, and employee. Past examples include, but are not limited to:</p><ul><li><strong>teams assess the servicescape of individual retail outlets of a national chain to find differences between locations</strong></li><li><strong>teams designed the servicescape of a new restaurant and recommendations were incorporated into the final build</strong></li><li><strong>teams recommended how to change the service experience of a marketing company to be more aligned with clients</strong></li></ul>',1,'',1,NULL,NULL,NULL),(5,101,'published','MBA Strategic Analysis, Audit, & Consultancy',NULL,'','',NULL,2016,'fall','<p>Each group member will contribute <u><strong>+40 hours of work to your organization</strong></u>, which will culminate in a <u><strong>20-minute presentation</strong></u>, with an accompanying <u><strong>2-page executive summary</strong></u>, which outlines strategic recommendations and an implementation plan that is actionable.</p>','individual','2017-01-30','2017-03-07',NULL,NULL,'<p>Each group member will contribute <u><strong>+40 hours of work to your organization</strong></u>, which will culminate in a <u><strong>20-minute presentation</strong></u>, with an accompanying <u><strong>2-page executive summary</strong></u>, which outlines strategic recommendations and an implementation plan that is actionable.</p>',1,NULL,'2017-02-13 19:20:52','2017-03-08 23:48:05','<p>A group of 2-4 MBA-consultants, becoming Bloomberg certified, will solve a problem or opportunity that your organization is currently facing. The student-consultants will <u><strong>research industry trends, competitors, best practices,</strong></u> etc., to provide context and actionable recommendations. Past projects have included:</p><ul><li><strong>Find the cause of employee turnover</strong></li><li><strong>Integrating technology into operations</strong></li><li><strong>Company positioning in a new market</strong></li><li><strong>Product positioning in an existing market</strong></li><li><strong>Customer acquisition &amp; sales strategy</strong></li></ul>',1,'',1,NULL,NULL,NULL),(6,23,'published','Strategic Consultancy',NULL,'','',NULL,2016,'fall','<p>After spending <u><strong>2.5 months of work dedicated to your organization</strong></u>, the group of student consultants will present <u><strong>a 15-minute presentation on their strategic recommendations</strong></u> that will help your organization propel forward. </p>','individual','2017-01-15','2017-03-28',NULL,NULL,'<p>After spending <u><strong>2.5 months of work dedicated to your organization</strong></u>, the group of student consultants will present <u><strong>a 15-minute presentation on their strategic recommendations</strong></u> that will help your organization propel forward. </p>',1,NULL,'2017-02-13 19:24:52','2017-03-08 23:45:43','<p>A group of student-consultants will research, analyze, and <u><strong>provide actionable recommendations to a strategic challenge or opportunity that is specific to your organization</strong></u>. This could include, but is not limited to, initiatives related to:</p><ul><li>new product launch</li><li>geographic expansion</li><li>exploiting new channels</li><li>strategic partnerships</li><li>digital media strategy</li><li>leveraging technology</li></ul>',1,'',1,NULL,NULL,NULL),(7,2,'published','Growth Strategy & Consultancy',NULL,'ENTR 6625','Managing Venture Growth and Transitions',25,2016,'winter/spring','<p>The group of student-consultants will submit a <u><strong>written plan, specific to your company&#x27;s growth opportunities</strong></u>, which will be accompanied by a <u><strong>15-minute presentation</strong></u>.</p>','individual','2017-01-23','2017-04-03',20,NULL,'<p>The group of student-consultants will submit a <u><strong>written plan, specific to your company&#x27;s growth opportunities</strong></u>, which will be accompanied by a <u><strong>15-minute presentation</strong></u>.</p>',1,NULL,'2017-02-13 19:28:15','2017-03-12 20:37:29','<p>A group of 5 student-consultants, working over the entire semester, will <u><strong>provide strategic recommendations and an implementation plan specific to help you grow your business</strong></u>. This could include:</p><ul><li><strong>Your market is shifting and you&#x27;ll need to shift in these ways to continue to satisfy your customers</strong></li><li><strong>Stay the course on your primary market, however look into these specific new markets for expansion</strong></li><li><strong>Your market is dead, sell as soon as possible.  </strong></li></ul>',1,'Graduate',1,NULL,NULL,NULL),(8,60,'published','International Market Entry Plan',NULL,'','',NULL,2016,'fall','<p>The group of <u><strong>student-consultants will spend over 3 months and 300 hours working</strong></u> on a strategic plan specifically for your firm to expand to a country (or countries) of your choosing.</p>','individual','2017-01-09','2017-04-17',NULL,NULL,'<p>The group of <u><strong>student-consultants will spend over 3 months and 300 hours working</strong></u> on a strategic plan specifically for your firm to expand to a country (or countries) of your choosing. At the end of all of this work, the student-consultants will <u><strong>submit a strategic market entry plan</strong></u>, which will be accompanied by a <u><strong>20-minute presentation</strong></u> where they will detail their objectives and highlight their proposed requirements to execute that plan. </p>',1,NULL,'2017-02-13 19:31:29','2017-02-16 23:17:08','<p><u><strong>Your firm would like to expand one or more of its products to another country</strong></u> and you need a preliminary research on how you should enter that particular country.  A group of student-consultants will research, analyze, and then create:</p><ul><li>Industry analysis</li><li>Marketing plan</li><li>Operations Plan including HR, Logistics, and Inventory planning</li></ul>',1,'',1,NULL,NULL,NULL),(9,11,'published','Small/Medium Business Consulting Project',NULL,'','',NULL,2016,'fall','<p>A group of 5-7 student consultants will assist a local small business by addressing a real-life<u><strong> business problem of the owner&#x27;s choosing</strong></u>. </p>','individual','2017-02-01','2017-04-30',NULL,NULL,'<p>The deliverable is a report and presentation with actionable recommendations, based on industry best practices. </p>',1,NULL,'2017-02-13 19:36:35','2017-02-16 23:17:20','<p>A group of 5-7 student consultants will assist a local small business by addressing a real-life<u><strong> business problem of the owner&#x27;s choosing</strong></u>.  Examples include, but are not limited to: </p><ul><li><strong>How to reach a specific target market </strong></li><li><strong>Increasing revenue for a product/service </strong></li><li><strong>Identifying potential partnerships         </strong></li><li><strong>Identifying and cutting unnecessary costs</strong></li><li><strong>Identifying technology to adopt</strong></li><li><strong>Reducing employee turnover </strong></li></ul>',1,'',1,NULL,NULL,NULL),(10,84,'published','Fieldwork / Internship',NULL,'','Global Poverty & Practice Minor',NULL,2017,'fall','<p>A particularly talented, bright, and dedicated student will engage with you on a global poverty initiative that you are doing, <u><strong>providing assistance on a specific project or ongoing direct service activity</strong></u>. </p>','individual','2017-01-01','2017-08-31',NULL,NULL,'<p>The deliverable is dependent on the scope of the work. <u><strong>At</strong></u> <u><strong>minimum, your organization will get 240 hours of work in the field, plus 3 months of research on the poverty or equality</strong></u> issues that you are working on. </p>',1,NULL,'2017-02-13 19:41:12','2017-06-13 21:09:50','<p>A particularly talented, bright, and dedicated student will engage with you on a global poverty initiative that you are doing, <u><strong>providing assistance on a specific project or ongoing direct service activity</strong></u>. Starting in January - April semester, the student will research the area and the problem that your organization (NGO, company, government agency) is trying to solve, either domestically or internationally. After which, they student will do a minimum of 240 hours of work over a minimum of 6 weeks.</p>',1,'Varied',1,NULL,'anywhere',NULL),(11,9,'published','Management Consulting',NULL,'','',NULL,2016,'fall','<p>Are you looking to enter a new market or better define your value proposition to a secondary market or are you looking to overhaul your web presence and strategy? <u><strong>Students spend 25 hours over the semester</strong></u> working on a specific consulting job that you need done.</p>','individual','2016-09-01','2016-12-31',NULL,NULL,'<p>Students will submit a report and do a presentation to you with their consulting recommendations.</p>',1,NULL,'2017-02-13 19:48:47','2017-05-17 18:02:20','<p>Are you looking to enter a new market or better define your value proposition to a secondary market or are you looking to overhaul your web presence and strategy? <u><strong>Students spend 25 hours over the semester</strong></u> working on a specific consulting job that you need done.  Only high-achieving students will be chosen to be consultants and most students come from France and Germany, so if there&#x27;s any interest in expanding to Western Europe, this is your chance!</p>',1,'',1,NULL,'anywhere',NULL),(12,73,'published','Start up Business Model Testing',NULL,'','',NULL,2016,'fall','<p>Teams of students are required to test critical assumptions in your startup&#x27;s business model by <u><strong>conducting a minimum of 25 customer discovery interviews</strong></u>, and recommend a repeatable, scalable, and sustainable business model.</p>','individual','2017-01-01','2017-03-31',NULL,NULL,'<p>Student groups will <u><strong>present their findings to you</strong></u> at the end of March. </p>',1,NULL,'2017-02-13 19:53:05','2017-03-08 23:45:08','<p>Teams of students are required to test critical assumptions in your startup&#x27;s business model by <u><strong>conducting a minimum of 25 customer discovery interviews</strong></u>, and recommend a repeatable, scalable, and sustainable business model.</p>',1,'',1,NULL,NULL,NULL),(13,83,'published','Consulting Project',NULL,'','',NULL,2016,'fall','<p>A group of 4 student-consultants, in their final year of their business degree, will work for <u><strong>3 months on your strategic problem / opportunity!</strong></u> At the end of which they will submit a <u><strong>strategic plan that is accompanied by a 15-minute presentation</strong></u>.</p>','individual','2017-02-06','2017-04-28',NULL,NULL,'<p>A group of 4 student-consultants, in their final year of their business degree, will work for <u><strong>3 months on your strategic problem / opportunity!</strong></u> At the end of which they will submit a <u><strong>strategic plan that is accompanied by a 15-minute presentation</strong></u>.</p>',1,NULL,'2017-02-13 20:10:39','2017-02-16 23:17:53','<p><u><strong>Your firm has a complex challenge that it would like outside research and consultation on to provide a different perspective</strong></u>. This could include:</p><ul><li>a B2B company wanting to know how to leverage social media both internally and externally to increase value</li><li>how can your company leverage new technologies and information to create efficiencies or new revenue streams</li><li>how can your company attract and retain next generation talent, which is increasingly in high demand</li><li>or anything else related to your business,<strong><u> as long as it is complex and multifaceted</u></strong>.</li></ul>',1,'',1,NULL,NULL,NULL),(14,18,'published','Consulting Project',NULL,'','',NULL,2016,'fall','<p>The student-consultants will interview you,<u><strong>identify a challenge that you are facing, and then work to design a solution specific to you</strong></u></p>','individual','2017-01-25','2017-04-12',NULL,NULL,'<p>Each group of student-consultants will submit a <u><strong>6 to 10-page final report</strong></u>, which will be accompanied by a <u><strong>20-minute presentation</strong></u>.</p>',1,NULL,'2017-02-13 20:14:50','2017-02-16 23:18:01','<p>This consulting project could be done by up to four students in one group. The student-consultants will interview you,<u><strong>identify a challenge that you are facing, and then work to design a solution specific to you</strong></u>. Detailed recommendations will be accompanied by key limitations and the next steps that you need to do to take action!</p>',1,'',1,NULL,NULL,NULL),(15,10,'published','SFU Corporate Consulting Capstone',NULL,'BUS 478','Strategic Consulting',NULL,2016,'fall','<p>Six groups of 4th-year business student-consultants, specializing in corporate strategy, will diligently <u><strong>work over the entire semester on a problem or opportunity that is specific to your organization</strong></u>.</p>','individual','2017-01-01','2017-04-30',NULL,NULL,'<p><u><strong>After ~1000 hours of work from the student-consultants</strong></u>, each group will submit a <u><strong>10-page</strong></u> <u><strong>report</strong></u> detailing their analyses and recommendations. Each strategic report will be accompanied by a <u><strong>10-minute presentation</strong></u>. </p>',1,NULL,'2017-02-13 20:18:18','2017-04-28 04:24:06','<p>Six groups of 4th-year business student-consultants, specializing in corporate strategy, will diligently <u><strong>work over the entire semester on a problem or opportunity that is specific to your organization</strong></u>. Past projects have included, but are not limited to;</p><ul><li><strong>Digital strategies for a newspaper and large consumer-based business</strong></li><li><strong>Market entry strategies into Latin America/Europe for a tech company and B2C company</strong></li><li><strong>Innovation strategy for a tech company</strong></li></ul>',1,'',1,NULL,NULL,NULL),(16,10,'published','Client Consulting Project',NULL,'','',NULL,2016,'fall','<p>Could your organization benefit by having a group of third-year business student consultants work on a well-defined business challenge or opportunity over the course of an entire semester? </p>','individual','2017-01-03','2017-04-07',NULL,NULL,'<p>The student groups present their actionable findings and recommendations in a <strong>10-15 page written report (plus appendices) and PowerPoint presentation</strong> to the entire class and their industry partners at the end of the term. Proprietary company information remains confidential at all times. Past participants in this class have ranged from small companies with only founders to larger companies with over 500 employees!</p>',1,NULL,'2017-02-13 20:21:32','2017-06-12 23:29:22','<p>Could your organization benefit by having a group of third-year business student consultants work on a well-defined business challenge or opportunity over the course of an entire semester? </p><p></p><p>Backed by their knowledgeable instructor, the students will use their business education to address your unique needs -- all while gaining real-world experience and learning what it&#x27;s like to work with an innovative company. The students will put together a comprehensive report that can encompass various aspects of marketing, sales, operations, data analytics, HR, and more. Potential scopes for this project can include, but are not limited to;</p><ul><li><strong>identifying and evaluating potential customer profiles and/or market segments,</strong></li><li><strong>developing marketing strategies and competitive analyses,</strong></li><li><strong>researching potential partners and channels,</strong></li><li><strong>surveying potential customers, and</strong></li><li><strong>any other related ideas you may think of (will need to be approved by the instructor).</strong></li></ul>',1,'',1,NULL,'anywhere',NULL),(17,2,'published','Consulting Project',NULL,'ENT-4400','',NULL,2016,'winter/spring','<p>Groups of 3-5 <u><strong>student-consultants will work with your early stage venture on a short-term project that is important to you</strong></u>.</p>','individual','2017-01-04','2017-04-15',NULL,NULL,'<p>There are 3 deliverables:\n1 ) <strong>Project Plan</strong>: Students will conduct research to develop a semester plan for the project.\n2) <strong>Status Report</strong>: Students will conduct primary research and customer discovery that inform the detailed steps to complete the project\n3) <strong>Final Delivery</strong> of what was outlined and reconfirmed in the status report.</p>',1,NULL,'2017-02-17 02:25:36','2017-03-15 16:56:02','<p>Groups of 3-5 <u><strong>student-consultants will work with your early stage venture on a short-term project that is important to you</strong></u>. The students will conduct research on the challenge or opportunity that you put forward. This could include surveying potential customers and evaluating their market potential, developing value propositions and use cases for specific market segments, analyzing  value chain, developing a competitive matrix, validating business models, and/or creating materials for investor presentations. </p>',1,'',1,NULL,NULL,NULL),(18,86,'published','Start-Up Consulting Project',NULL,'ENT 419a','Entrepreneurship Capstone:',NULL,2016,'winter/spring','<p><u><strong>Your small business or start-up is facing a challenge/opportunity</strong></u> and you require consultation by a group of students to help create value.</p>','group','2017-01-06','2017-04-21',0,NULL,'<p>A group of 4-5 student consultants will commit <strong><u>3 months of work</u></strong> to help your firm produce value in one of the bullets listed above - <strong><u>a total of 500 hours of work</u></strong>. Each group will provide a 15-minute presentation, as well as a report with actionable recommendations that can be implemented. <strong><u>Students are judged on whether or not they produce value for you and your firm!</u></strong></p>',6,NULL,'2017-02-17 02:41:55','2017-02-17 02:49:59','<p><u><strong>Your small business or start-up is facing a challenge/opportunity</strong></u> and you require consultation by a group of students to help create value. </p><p></p><p>Potential Project Scopes Include: </p><ul><li>a complete business plan</li><li>a new market entry strategy</li><li>a marketing plan</li><li>a new product prototype using 3D technology</li><li>a detailed competitor and environmental analysis</li><li>an operations management or value chain analysis</li></ul>',4,'MBA',1,NULL,NULL,NULL),(19,86,'published','Start-Up Consulting Project',NULL,'ENT 419b','Entrepreneurship Capstone:',NULL,2016,'winter/spring','<p><u><strong>Your small business or start-up has a challenge/opportunity</strong></u> and you require consultation by a group of students (half business, half creative designers) to help create value.</p>','individual','2017-01-01','2017-04-15',500,NULL,'<p>A group of 4-5 student consultants will commit <strong><u>3 months of work</u></strong> to help your firm produce value in one of the bullets listed above - <strong><u>a total of 500 hours of work</u></strong>. Each group will provide a 15-minute presentation, as well as a report and the creative designs that can be used immediately. <strong><u>Students are judged on whether or not they produce value for you and your firm!</u></strong></p>',5,NULL,'2017-02-17 02:45:35','2017-02-17 02:52:14','<p><u><strong>Your small business or start-up has a challenge/opportunity</strong></u> and you require consultation by a group of students (half business, half creative designers) to help create value. This could be:</p><ul><li>a social media campaign including the creative assets to use</li><li>a (re)design of your website including the wireframes </li><li>a rebranding or brand development including logos</li><li>Promotional materials and sales collateral </li></ul>',1,'MBA',1,NULL,NULL,NULL),(20,11,'published','Customer Journey & Touchpoint Mapping',NULL,'RMG 908','Issues & Innovations in Retail Management',0,2016,'winter/spring','<p>Up to 3 groups of student-consultants, <u><strong>specialized in retail management, will each create a customer touchpoint map for your retail company</strong></u>.</p>','individual','2017-02-01','2017-03-30',80,NULL,'<p>Each group will submit:</p><ul><li><strong>Customer Touchpoint Map (graphic)</strong></li><li><strong>4 to 10-page document with details around the findings of the customer journey with strategic recommendations </strong></li><li><strong>Presentation of the Findings</strong></li></ul>',4,NULL,'2017-02-17 02:47:02','2017-03-31 20:00:18','<p>Up to 3 groups of student-consultants, <u><strong>specialized in retail management, will each create a customer touchpoint map for your retail company</strong></u>. This mapping is a process of identifying each interaction or contact point throughout the customer&#x27;s journey. This includes:</p><ul><li><strong>Social Media, Advertising, and anything prior to them entering the store</strong></li><li><strong>In-store display, Service, etc</strong></li><li><strong>After-purchase service, etc.</strong></li></ul>',1,'Graduate',1,NULL,NULL,NULL),(21,76,'draft','Media Production',NULL,'GMCS 546','New Media & Information Management',0,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-02-17 02:47:02','2017-02-17 02:47:03',NULL,NULL,'Graduate',0,NULL,NULL,'2017-08-28 23:33:33'),(22,76,'draft','Media Production',NULL,'GMCS 546','New Media & Information Management',0,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-02-17 02:47:09','2017-02-17 02:47:09',NULL,NULL,'Graduate',0,NULL,NULL,'2017-08-28 23:33:39'),(23,76,'draft','Media Production',NULL,'GMCS 546','New Media & Information Management',0,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-02-17 02:47:17','2017-02-17 02:47:17',NULL,NULL,'Graduate',0,NULL,NULL,'2017-08-28 23:33:45'),(24,76,'draft','Media Production',NULL,'GMCS 546','New Media & Information Management',0,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-02-17 02:47:21','2017-02-17 02:47:21',NULL,NULL,'Graduate',0,NULL,NULL,'2017-08-28 23:33:53'),(25,76,'draft','Media Production',NULL,'GMCS 546','New Media & Information Management',0,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-02-17 02:47:38','2017-02-17 02:47:38',NULL,NULL,'Graduate',0,NULL,NULL,'2017-08-28 23:34:00'),(26,76,'published','Media Production',NULL,'GMCS 546','New Media & Information Management',0,2016,'winter/spring','<p><u><strong>Creative students will serve as your &quot;agency&quot; and work for you for six weeks</strong></u> to produce digital and/or traditional media deliverables you can use.</p>','individual','2017-01-15','2017-03-15',80,NULL,'<p>The deliverables depend on your needs and students&#x27; skill sets. Final products may include: </p><p>- outdoor billboards or street art or kiosks </p><p>- web advertisement \n- audio commercial (online of on-air)                 </p><p>- print advertisement or brochures  \n- social media banners, skins, art, etc                  </p><p>- public relations collateral \n- augmented reality collateral / media               </p>',4,NULL,'2017-02-17 02:49:07','2017-02-17 03:14:45','<p>Whether it&#x27;s web-based or print, audio or video, outdoor or public relations, students will <u><strong>deliver media that speaks to your goals and objectives</strong></u>. </p>',1,'Graduate',1,NULL,NULL,NULL),(27,116,'review','Industry Research Project',NULL,'MK 450','Digital Marketing',30,2017,'fall','<p>Co-create a digital marketing challenge that is unique to your organization that students can complete.</p>','group','2016-12-07','2016-12-16',400,NULL,'<p>Students will submit an<u><strong> executive summary</strong></u> and accompanying documents on the research and analytical work that has been performed. Students will also hold a <u><strong>7-minute presentation</strong></u> on their findings with a 10-15 minute Q&amp;A period. As an industry partner, you should expect details on how a <u><strong>digital marketing strategy</strong></u> can help your new product launch, brand repositioning, etc.</p>',6,NULL,'2017-02-17 02:53:34','2017-02-17 02:57:48','<p>With the professor, co-create a digital marketing challenge that is unique to your organization that students can complete.  The project could be related to ongoing marketing initiatives,<u><strong>(eg a brand campaign, web design, optimizing your website for search engine performance or a brand repositioning for the purpose of market expansion, new target markets, etc.</strong></u>) Students can do industry research on your competitors, potential customers and your strengths, competencies, and weaknesses, which informs their <u><strong>strategic digital marketing recommendations for you.</strong></u>\n</p>',5,'4th Year',0,NULL,NULL,NULL),(28,86,'draft','Business Consulting Project',NULL,'MGMT 419','Senior Capstone:',NULL,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-02-17 03:00:14','2017-02-17 03:00:15',NULL,NULL,'MBA',0,NULL,NULL,'2017-08-28 23:34:42'),(29,86,'draft','Business Consulting Project',NULL,'MGMT 419','Senior Capstone:',NULL,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-02-17 03:00:26','2017-02-17 03:00:26',NULL,NULL,'MBA',0,NULL,NULL,'2017-08-28 23:34:49'),(30,86,'draft','Business Consulting Project',NULL,'MGMT 419','Senior Capstone',60,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-02-17 03:00:40','2017-02-17 03:00:40',NULL,NULL,'MBA',0,NULL,NULL,'2017-08-28 23:34:55'),(31,86,'draft','Business Consulting Project',NULL,'MGMT 419','Senior Capstone',60,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-02-17 03:00:49','2017-02-17 03:00:49',NULL,NULL,'MBA',0,NULL,NULL,'2017-08-28 23:35:01'),(32,86,'draft','Business Consulting Project',NULL,'MGMT 419','Senior Capstone',60,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-02-17 03:00:53','2017-02-17 03:00:53',NULL,NULL,'MBA',0,NULL,NULL,'2017-08-28 23:35:06'),(33,86,'draft','Business Consulting Project',NULL,'MGMT 419','Senior Capstone',60,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-02-17 03:00:55','2017-02-17 03:00:55',NULL,NULL,'MBA',0,NULL,NULL,'2017-08-28 23:35:12'),(34,86,'draft','Business Consulting Project',NULL,'MGMT 419','Senior Capstone',60,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-02-17 03:00:59','2017-02-17 03:00:59',NULL,NULL,'MBA',0,NULL,NULL,'2017-08-28 23:35:19'),(35,86,'published','Change Process Consultation',NULL,'MBA 770','Leading Change:',NULL,2016,'winter/spring','<p><u><strong>Your firm is about to embark upon a change initiative and you require consultation</strong></u></p>','individual','2017-01-01','2017-04-15',100,NULL,'<p>Each of the 5 groups will do <strong><u>3 months of work</u></strong> to help your firm best manage the change you&#x27;re going through - <strong><u>a total of 1000 hours of work</u></strong>. Each group will provide a 10-minute presentation, as well as a prototype of the change</p>',8,NULL,'2017-02-17 03:01:16','2017-02-17 03:09:38','<p><u><strong>Your firm is about to embark upon a change initiative and you require consultation around:</strong></u></p><ul><li>a merger or acquisition</li><li>restructuring </li><li>leadership challenge</li><li>new product or service launch</li><li>implementation of a new technology system</li><li>redesign of an internal system or process</li><li>re-imagine your mission, vision, and purpose</li><li>developing and using learning communities</li></ul>',1,'MBA',1,NULL,NULL,NULL),(36,86,'published','Business Consulting Project',NULL,'MGMT 419','Business Consulting Project',60,2016,'winter/spring','<p><strong>Your firm has a complex challenge that it would like outside research and consultation on to provide different perspectives</strong>. </p>','group','2017-02-10','2017-04-14',NULL,NULL,'<p>This is a massive, multi-faceted project. Each of the 5 groups will be in charge of a facet of the project (answering important questions that you co-create with the professor) and do <strong><u>3 months of work</u></strong> to help your firm find creative, tangible, and implementable solutions - <strong><u>a total of 1000 hours of work</u></strong>. Each group will provide a 15-minute presentation, as well as a report answer your questions, which together will formulate your strategy moving forward.</p>',4,NULL,'2017-02-17 03:01:50','2017-02-17 03:16:56','<p>Your firm has a complex challenge that it would like outside research and consultation on to provide different perspectives. This could include:</p><ul><li>a B2B company wanting to know how to leverage social media both internally and externally to increase value</li><li>how can your company leverage new technologies and information to create efficiencies or new revenue streams</li><li>how can your company attract and retain next generation talent, which is increasingly in high demand</li><li>or anything else related to your business, <strong><u>as long as it is complex and multifaceted</u></strong>.</li></ul>',4,'MBA',1,NULL,NULL,NULL),(37,93,'published','Market Research Consultancy',NULL,'ugba 161','Marketing Research',30,2016,'winter/spring','<p>A group of <u><strong>student-consultants</strong></u> <u><strong>will conduct market research for your organization in order to make a decision with data-driven insights</strong></u>.</p>','group','2017-02-06','2017-05-01',70,NULL,'<p>After <u><strong>spending almost 3 months  and over 350 hours working</strong></u> to help you with data-driven decisions about your market, the student-consultants will submit a report on the data analysis and findings which will be accompanied by a<u><strong>detailed presentation outlining their recommendations</strong></u>.</p>',6,NULL,'2017-02-17 03:03:21','2017-03-15 16:49:37','<p>A group of <u><strong>student-consultants</strong></u> <u><strong>will conduct market research for your organization in order to make a decision with data-driven insights</strong></u>. Past projects have included, but are not limited to:</p><ul><li><strong>Identifying prominent segments in your customer base that brought about higher returns</strong></li><li><strong>Discovering what customers associate with and wanted from a firm&#x27;s products</strong></li><li><strong>Identifying new competitive positions that differentiated a product from competing offering</strong></li></ul>',5,'1st year',1,NULL,NULL,NULL),(38,71,'published','Risk Assessment',NULL,'BUS','Accounting Information System',NULL,2016,'fall','<p>Student-consultants will submit a <u><strong>15-page document which includes process maps</strong></u> for easy understanding.</p>','individual','2016-10-01','2016-12-01',NULL,NULL,'<p>Student-consultants will submit a <u><strong>15-page document which includes process maps</strong></u> for easy understanding.</p>',1,NULL,'2017-02-17 03:06:29','2017-03-08 23:49:44','<p>Students will <u><strong>assess the risk and control systems of a business process of your choosing</strong></u>. This can be, for example, completing a sale - from taking the customer order, to delivering merchandise, to collecting cash; or, purchasing supplies or assets, or paying employees, or even hiring employees. They will assess this process from who is involved to what documentation is created, and <u><strong>what controls are in place to mitigate the process risks</strong></u>. </p>',1,'',1,NULL,NULL,NULL),(39,13,'published','Retail Initiatives & Best Practices',NULL,'MKTG 4P28','Retail Management: ',NULL,2016,'winter/spring','<p>Groups of student-consultants will audit your company and provide best practices.</p><p></p>','group','2017-01-09','2017-04-05',100,NULL,'<p>Student-consultants complete an <u><strong>8-page audit</strong></u> comprised of a needs assessment and then details regarding your chosen retail initiative. In addition to the audit, students will select an<u><strong><em>Excellence in Retail Awards</em></strong></u> <u><strong>winner and provide you with best practices around your initiative</strong></u>. Finally, the group will do a <u><strong>video presentation</strong></u> of their findings.</p>',5,NULL,'2017-02-17 03:16:26','2017-02-17 03:27:36','<p>Groups of student-consultants will audit your company and provide best practices. Some examples include:</p><ul><li>Loss Prevention</li><li>Omni-Channel</li><li>Talent Development </li><li>In-store Merchandising</li><li>Health, Safety, Wellness</li><li>Philanthropic Leadership</li><li>E-Commerce Experience</li><li>Environmental Leadership</li><li>In-store Experience &amp; Design</li><li>Marketing Communications</li><li>Supply Chain Management</li></ul>',5,'4th year',1,NULL,NULL,NULL),(40,13,'published','Consumer/Client Behaviour Analysis',NULL,'mktg 4p31','Consumer Behaviour',30,2017,'winter/spring','','individual','2017-01-20','2017-02-14',300,NULL,'<p>After spending <u><strong>+250 hours on your organization and conducting ~20 consumer interviews</strong></u>, each group of student-consultants will submit an <u><strong>8-page document with an accompanying presentation</strong></u> that details their research and recommendations that can be implemented immediately by your organization.</p>',6,NULL,'2017-02-17 03:18:50','2017-02-17 03:35:38','<p>Groups of 5 student-consultants will<u><strong> solve a consumer/client behaviour question that your organization is facing</strong></u> by conducting research and applying state-of-the-art consumer behaviour theory. Past examples have included: </p><ul><li><strong>Organization wanted to know why there was a drop off in attendance for annual fundraiser</strong> </li><li><strong>Retail store wanted to know why customers were only staying in the front half of the store</strong> </li><li><strong>Retail store wanted &quot;secret shoppers&quot; to find out why a certain product was under-performing</strong></li></ul>',1,'4th year',1,NULL,NULL,NULL),(41,13,'draft','IT Security Consultancy',NULL,'MBA B 5P15','Information Assurance',20,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-02-17 03:23:46','2017-02-17 03:23:46',NULL,NULL,'4th Year',0,NULL,NULL,'2017-08-28 23:36:00'),(42,13,'review','IT Security Consultancy',NULL,'MBA B 5P15','Information Assurance',20,2016,'winter/spring','<p>Groups of 4-5 student consultants educated in information security and contingency planning, will spend a month creating or reviewing your organizational policies around information security and make recommendations for improvement. </p>','individual','2016-09-05','2017-04-27',100,NULL,'<p>Student-consultants review and provide a report on improvements or create the information security policies and contingency plans that your organization needs.</p>',10,NULL,'2017-02-17 03:23:51','2017-03-01 00:02:16','<p>Groups of 4-5 student consultants educated in state-of-the-art information security and contingency planning, will spend a month creating or reviewing your organizational policies around information security and make recommendations for improvement. Potential project scopes can include but are not limited to:</p><ul><li><strong>Defining Security goals</strong></li><li><strong>Run Tests</strong></li><li><strong>Analysis of Information Technology threats</strong></li><li><strong>Recommendations for Data Back ups</strong></li><li><strong>Develop/update internet use policies</strong></li><li><strong>Develop/Update Disaster Recovery Plan</strong></li><li><strong>Conduct Risk Assessment</strong></li><li><strong>Identify alternative independent defenses</strong></li><li><strong>ISO 17000 compliance</strong></li><li><strong>Evaluating or designing contingency plans</strong></li></ul>',1,'4th Year',0,NULL,NULL,NULL),(43,13,'draft','IT Security Consultancy',NULL,'MBA B 5P15','Information Assurance',20,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-02-17 03:24:09','2017-02-17 03:24:09',NULL,NULL,'4th Year',0,NULL,NULL,'2017-08-28 23:36:06'),(44,13,'draft','IT Security Consultancy',NULL,'MBA B 5P15','Information Assurance',20,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-02-17 03:25:25','2017-02-17 03:25:25',NULL,NULL,'4th Year',0,NULL,NULL,'2017-08-28 23:36:12'),(45,13,'draft','IT Security Consultancy',NULL,'MBA B 5P15','Information Assurance',20,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-02-17 03:25:26','2017-02-17 03:25:26',NULL,NULL,'4th Year',0,NULL,NULL,'2017-08-28 23:36:18'),(46,13,'published','IT Security Consultancy',NULL,'MBA B 5P15','Information Assurance',45,2016,'winter/spring','<p>Groups of 4-5 student consultants educated in state-of-the-art information security and contingency planning, will spend a month creating or reviewing your organizational policies around information security and make recommendations for improvement. </p>','group','2017-01-12','2017-04-21',NULL,NULL,'<p>Student-consultants review and provide a report on improvements or create the information security policies and contingency plans that your organization needs.</p>',6,NULL,'2017-02-17 03:30:46','2017-02-17 03:35:24','<p>Groups of 4-5 student consultants educated in state-of-the-art information security and contingency planning, will spend a month creating or reviewing your organizational policies around information security and make recommendations for improvement. Potential project scopes can include but are not limited to:</p><ul><li><strong>Defining Security goals</strong></li><li><strong>Run Tests</strong></li><li><strong>Analysis of Information Technology threats</strong></li><li><strong>Recommendations for Data Back ups</strong></li><li><strong>Develop/update internet use policies</strong></li><li><strong>Develop/Update Disaster Recovery Plan</strong></li><li><strong>Conduct Risk Assessment</strong></li><li><strong>Identify alternative independent defenses</strong></li><li><strong>ISO 17000 compliance</strong></li><li><strong>Evaluating or designing contingency plans</strong></li></ul>',4,'4th Year',1,NULL,NULL,NULL),(47,23,'published','Marketing Consultancy',NULL,'CC','Consulting Club',0,2016,'winter/spring','<p><u><strong>provide actionable recommendations to a marketing challenge or opportunity that is specific to your organization.</strong></u></p>','group','2017-01-15','2017-03-28',80,NULL,'<p>After spending <u><strong>2.5 months of work dedicated to your organization</strong></u>, the group of student consultants will present <u><strong>a 15-minute presentation on their strategic marketing recommendations</strong></u> that will help your organization propel forward. </p>',4,NULL,'2017-02-17 03:31:14','2017-02-17 03:39:11','<ul><li><strong>new product launch</strong></li><li><strong>brand campaign</strong></li><li><strong>competitive analysis?</strong></li><li><strong>brand repositioning</strong></li><li><strong>digital media strategy</strong></li><li><strong>market segmentation</strong></li></ul>',4,'4th year',1,NULL,NULL,NULL),(48,23,'published','Financial Analysis Consultancy',NULL,'CC','Consulting Club',NULL,2016,'fall','<p>After spending <u><strong>2.5 months of work dedicated to your organization</strong></u>, the group of student consultants will present <u><strong>a 15-minute presentation on their strategic financial recommendations</strong></u> that will help your organization propel forward. </p>','individual','2017-01-15','2017-03-28',NULL,NULL,'<p>After spending <u><strong>2.5 months of work dedicated to your organization</strong></u>, the group of student consultants will present <u><strong>a 15-minute presentation on their strategic financial recommendations</strong></u> that will help your organization propel forward. </p>',1,NULL,'2017-02-17 03:34:34','2017-03-08 23:46:17','<p>A group of student-consultants will research, analyze, and <u><strong>provide actionable recommendations to a financial challenge or opportunity that is specific to your organization</strong></u>. This could include, but is not limited to, finance initiatives related to:</p><p></p><ul><li>funding alternatives                </li><li>pricing</li><li>operating expense control</li><li>asset management</li><li>Risk management</li><li>Comparative analyses</li></ul>',1,'4th Year',1,NULL,NULL,NULL),(49,111,'published','New Product/Service Marketing Plan',NULL,'MKTG 495','Marketing Management',0,2017,'winter/spring','<p>Two groups of five student-consultants will assist your firm in developing a <u><strong>marketing plan for a new product or service launch</strong></u>.</p>','group','2017-01-08','2017-04-21',80,NULL,'<p>Each group of student-consultants will spend <u><strong>+100 hours working on your product/service launch</strong></u>, delivering the following:</p><ol><li>Marketing Objectives</li><li>Situational Analysis</li><li>Marketing Strategies</li><li>Implementation Plan to ensure the success of the product/service launch</li></ol>',6,NULL,'2017-02-17 03:36:04','2017-02-17 03:43:29','<ul><li>Development of a Marketing Plan</li><li>Plan for Launch of New Product/Service</li><li>Identifying target markets</li></ul>',4,'4th year',1,NULL,NULL,NULL),(50,14,'published','Strategic Analysis & Business Plan',NULL,'MBA 504','Business Strategy Integration',30,2017,'fall','<p><u><strong>Two groups of MBA</strong></u> <u><strong>student-consultants</strong></u> will do a thorough job at helping you with the building blocks that you can use for your next business plan for a specific product or service, or your entire company.</p>','group','2017-09-05','2017-12-20',50,NULL,'<p>The final deliverable and student submission will be in a 2-page executive summary with a 20-slide presentation.</p>',5,NULL,'2017-02-17 03:37:48','2017-05-18 03:25:48','<p><u><strong>Two groups of MBA</strong></u> <u><strong>student-consultants</strong></u> will help you with your next business plan for a specific product or service, or your entire company. These student-consultants can help you develop comprehensive <u><strong>customer and competitive analyses</strong></u> that can lead to an improvement to your existing business model. Alternatively, they can design a new one to tailor to your business needs and innovation plans. </p><p></p><p>Project scopes can include, but not limited to:</p><ul><li>A strategic marketing plan for the launch of a new product or service</li><li>A growth and strategy plan that plans for expansion</li><li>Comprehensive market analyses for new or existing markets</li></ul><p>Students will present their findings at the end of the term. Proprietary company information remains confidential at all times through an NDA.</p>',1,'MBA',1,NULL,'anywhere',NULL),(51,14,'published','Project Planning',NULL,'BAIT 510','Project Management & Business Solutions',NULL,2016,'winter/spring','<p>A group of <u><strong>3-5 MBA</strong></u> <u><strong>student-consultants will develop a thorough Project Management Plan for a project of your choosing</strong></u>.</p>','group','2017-03-06','2017-04-30',0,NULL,'<p>During the 5-week course, the student group will <u><strong>complete ~100 hours of work</strong></u> in order to provide the right plan for your project, including risk assessment and mitigation. This work will be presented in a <u><strong>10+ page document</strong></u>, accompanied by a <u><strong>10 minute presentation.</strong></u></p>',10,NULL,'2017-02-17 03:39:07','2017-05-17 21:55:17','<p>A group of <u><strong>3-5 MBA</strong></u> <u><strong>student-consultants will develop a thorough Project Management Plan for a project of your choosing</strong></u>. The plan will describe the work breakdown structure, budget estimates, optimal schedule, as well as risk management plan. Examples of projects have included, but are not limited to:</p><ul><li><strong>Development of a new website</strong></li><li><strong>Implementation of a new software or system</strong></li><li><strong>Business process change</strong></li><li><strong>Office relocation</strong></li><li><strong>Rebranding project or implementation of new logo</strong></li><li><strong>New product/service launch </strong></li><li><strong>Evaluation of new technology or suppliers</strong></li></ul>',4,'MBA',1,NULL,'anywhere',NULL),(52,14,'draft','Strategic Analysis & Business Plan',NULL,'BA - 504','Business Strategy Integration',NULL,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-02-17 03:39:36','2017-02-17 03:39:36',NULL,NULL,'4th Year',0,NULL,NULL,'2017-08-28 23:37:12'),(53,14,'draft','Strategic Analysis & Business Plan',NULL,'BA - 504','Business Strategy Integration',NULL,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-02-17 03:39:37','2017-02-17 03:39:37',NULL,NULL,'4th Year',0,NULL,NULL,'2017-08-28 23:37:22'),(54,72,'published','Business Modelling',NULL,'ADM 4315','Strategic Entrepreneurship:',NULL,2016,'fall','<p><u><strong>An entire class of student-consultants will study a problem with your current business model</strong></u> that you propose and, in groups, recommend a solution in the form of a revised business model. </p>','group','2016-09-16','2016-12-09',NULL,NULL,'<p>Student-consultants submit a <u><strong>report on the recommended updates to the business model</strong></u>, as well as <u><strong>present to the company</strong></u>.</p>',1,NULL,'2017-02-17 03:39:47','2017-02-17 03:42:50','<p><u><strong>An entire class of student-consultants will study a problem with your current business model</strong></u> that you propose and, in groups, recommend a solution in the form of a revised business model. Specifically, they will address the components of the business model canvas: value propositions, customer segments, key partners, key activities, key resources, customer relationships, channels, cost structure, and revenue streams.</p>',30,'3rd Year',1,NULL,NULL,NULL),(55,20,'published','15-Month Consultancy',NULL,'MGT Capstone','Technology Management:',NULL,2016,'winter/spring','<p>Individual student-consultants spend 15 months exploring <u><strong>innovative ideas for improvement or solving a significant problem</strong></u> in your organization that integrates technology and management.</p>','individual','2017-01-09','2017-04-28',NULL,NULL,'<p>his 15-month consultancy is split into two sections. The first, 3 months long, the primary deliverable is a <strong><u>project plan</u> </strong>for the integration of management and technical issues facing your organization. The second, up to 12 months long, the primary deliverable is solving the agreed upon issues by making a <u><strong>significant technical contribution that provides economic value to your organization.</strong></u></p>',20,NULL,'2017-02-17 03:45:57','2017-02-17 03:49:39','<p>Individual student-consultants spend 15 months exploring <u><strong>innovative ideas for improvement or solving a significant problem</strong></u> in your organization that integrates technology and management. Past tech-management solutions include:</p><ul><li><strong>Bringing a new technology to market</strong></li><li><strong>Bringing existing technology to a new market segment</strong></li><li><strong>Research and analysis and road mapping for new technology</strong></li><li><strong>Identifying and integrating new technology into the business process</strong></li><li><strong>Developing the business case for new technology</strong></li></ul>',1,'4th Year',1,NULL,NULL,NULL),(56,67,'published','Industry Research Project',NULL,'Comm 1034','Professional Communications',30,2016,'fall','<p>Have up to four groups of student-consultants research a well-defined issue or opportunity in your business. </p>','group','2017-02-15','2017-03-30',30,NULL,'<p>Receive up to three short student reports and video presentations with actionable recommendations, based on industry best practices. All proprietary company information remains confidential at all times.</p>',12,NULL,'2017-02-17 03:46:22','2017-08-28 23:38:47','<p>Have up to four groups of student-consultants research a well-defined issue or opportunity in your business. The student groups spend approximately 4-6 weeks conducting research to address your issue/opportunity and then provide actionable recommendations. Project scopes can include, but are not limited to;</p><ul><li><strong>improving digital or social media strategies</strong></li><li><strong>reaching a specific market segment</strong></li><li><strong>increasing revenue for a product/service</strong></li><li><strong>identifying potential partnerships</strong></li><li><strong>identifying and cutting unnecessary costs</strong></li><li><strong>identifying technology and digital tools to adopt</strong></li><li><strong>reducing employee turnover, etc.</strong></li></ul>',5,'4th year',1,NULL,NULL,NULL),(57,23,'published','Marketing Consultancy',NULL,'MKT 405','Marketing Projects in Industry',0,2016,'winter/spring','<p><u><strong>provide actionable recommendations to a marketing challenge or opportunity that is specific to your organization</strong></u>.</p>','group','2017-01-15','2017-04-10',80,NULL,'<p>After spending <u><strong>3 months of work dedicated to your organization</strong></u>, the group of student consultants will submit <u><strong>a 10-page report, accompanied by a 15-minute presentation on their strategic marketing recommendations</strong></u> that will help your organization propel forward. </p>',4,NULL,'2017-02-17 03:48:58','2017-04-12 21:12:53','<p>A group of student-consultants will research, analyze, and <u><strong>provide actionable recommendations to a marketing challenge or opportunity that is specific to your organization</strong></u>. This could include, but is not limited to, marketing initiatives related to:</p><ul><li><strong>new product launch</strong></li><li><strong>brand campaign</strong></li><li><strong>competitive analysis?</strong></li><li><strong>brand repositioning</strong></li><li><strong>digital media strategy</strong></li><li><strong>market segmentation</strong></li></ul>',4,'4th year',1,NULL,'anywhere',NULL),(59,23,'published','Communications Work Placement',NULL,'CMNS 498','Communications Practicum',12,2016,'summer','<p>A third- or fourth-year communications student will work with your organization for 240 hours of work experience, full time for 6-8 weeks or part time over a longer period.</p>','individual','2017-05-02','2017-06-30',NULL,NULL,'<p>The students&#x27; deliverable will be up to the hosting organization to define, but must be meaningful, communications-related work.</p>',10,NULL,'2017-02-17 03:49:14','2017-08-28 22:18:22','<p>A third- or fourth-year communications student will work with your organization for 240 hours of work experience, full time for 6-8 weeks or part time over a longer period. Communication degree students are able to tackle a number of tasks for your organization including research, writing, social networking, public and media relations, event planning and management, and strategic communications plans.</p>',1,'3rd & 4th Year',0,NULL,'anywhere',NULL),(60,31,'published','Corporate Innovation Project',NULL,'MEI - 808','Master\'s in Entrepreneurship & Innovation',NULL,2016,'winter/spring','<p>Master&#x27;s student(s), trained in innovation, business, and project management, <u><strong>will work with you to solve a major problem/opportunity</strong></u> from within your organization. This 10-month engagement starts with students doing massive research on what <u><strong>you</strong></u> want to be solved and then present you with options. Once <u><strong>you</strong></u> have decided which option to choose, the student(s) will create a plan (if it&#x27;s a marketing opportunity, it&#x27;s a marketing plan). Once <u><strong>you</strong></u> are okay with the plan, the student will implement what <u><strong>you</strong></u> want.  </p>','individual','2016-10-28','2017-08-15',100,NULL,'<p>Finding and recruiting top talent that fits best with your organization <u><strong>will give you a distinct competitive advantage.</strong></u> Students are highly motivated and thirsty for opportunities to prove themselves in your industry. You&#x27;ll gain an unparalleled opportunity to evaluate future talent -- learning what they can bring to the table and what skills they need <u><strong>before</strong></u> you hire them to <u><strong>reduce onboarding costs and time</strong></u>.</p>',8,NULL,'2017-02-17 03:51:55','2017-06-08 17:02:05','<p>There are 3 stages to this project:     </p><p>1. Students will submit alternatives to solve the problem    </p><p>2. Students will submit a plan to attack the problem     </p><p>3. Students will work to implement the plan.</p>',1,'4th Year',1,NULL,'anywhere',NULL),(63,86,'published','Location Optimization MBA Consultancy',NULL,'mba 710','Understanding World-Class Clusters',30,2016,'winter/spring','<p>research  and conduct location mapping to assist you with identifying optimal  locations given spatial variation in rents, facilities, R&amp;D  institutions</p>','group','2017-01-09','2017-04-14',200,NULL,'<p>Each of the 5 groups will do <u>3 months of work</u> to help your firm find the right location - <u>a total of 1000 hours of work</u>. Each group will provide:</p><ul><li>Location Mapping Report  </li><li>Recommendations on optimal locations (and the reasoning behind them) </li><li>A 5-minute presentation </li></ul>',6,NULL,'2017-02-17 03:53:33','2017-02-17 04:17:11','<p>Five groups of MBA student-consultants  will research and conduct location mapping to assist you with  identifying optimal locations given spatial variation in rents,  facilities, R&amp;D institutions, etc.</p>',6,'MBA',1,NULL,NULL,NULL),(65,83,'published','Feasibility Analysis & Business Plan',NULL,'BUS 385','Entrepreneurship & Venture Creation:',25,2016,'fall','<p>A group of student-consultants will research, conduct, write, and present a feasibility analysis for your new product or business. After the feasibility is done, students will research, write, and present, a business plan for the new product or business idea. </p>','group','2016-10-03','2016-10-28',NULL,NULL,'<p>There are 3 deliverables:\n   1.  Feasibility Analysis\n   2.  Business Plan\n   3.  Presentation</p>',1,NULL,'2017-02-17 03:55:14','2017-02-17 03:57:52','<p>A group of student-consultants will research, conduct, write, and present a feasibility analysis for your new product or business. After the feasibility is done, students will research, write, and present, a business plan for the new product or business idea. </p>',5,'4th Year',1,NULL,NULL,NULL),(70,10,'published','Financial Risk Management',NULL,'BUS419','Advanced Derivative Securities',NULL,2016,'fall','<p>The student groups will submit a 2-page written report at the end of the term. Proprietary company information remains confidential at all times.</p>','individual','2017-01-01','2017-04-30',NULL,NULL,'<p>The student groups will submit a 2-page written report at the end of the term. Proprietary company information remains confidential at all times.</p>',1,NULL,'2017-02-17 03:58:18','2017-03-06 17:56:57','<p>Groups of 3-6 student-consultants will research and analyze the environment your organization currently operates in to identify any risk that you may be exposed to, and provide recommendations to improve your strategies to mitigate those risks. Project goals can include, but are not limited to:\n<strong>identifying appropriate ways to mitigate your risk</strong></p><ul><li><strong>identifying appropriate ways to mitigate your risk</strong></li><li><strong>developing instruments and resources to hedge your risks</strong></li><li><strong>identifying appropriate valuation tools</strong></li><li><strong>evaluating different instruments you have considered</strong></li></ul>',1,'4th Year University',1,NULL,NULL,NULL),(77,23,'draft','Marketing Consultancy',NULL,'BMKT 405','Marketing Projects in Industry',0,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-02-17 03:59:10','2017-02-17 03:59:11',NULL,NULL,'4th year',0,NULL,NULL,'2017-08-28 23:39:16'),(78,84,'published','Improving Website Design through A/B Testing',NULL,'MBA 260','Customer Insights',0,2016,'winter/spring','<p>A group of <u><strong>MBA</strong></u> <u><strong>student-consultants</strong></u> <u><strong>will use customer</strong></u> <u><strong>insights  and</strong></u> <u><strong>user experience models to improve your website and then A/B test</strong></u> using 3rd party platforms (Optimizely and Unbounce) to quantify the improvements.</p>','individual','2017-02-01','2017-05-01',80,NULL,'<p>After <u><strong>spending 3 months working</strong></u> to improve your website, the student-consultants will submit a 1-page report on the analytical findings which will lead to <u><strong>the most optimal website for your firm</strong></u>.</p>',6,NULL,'2017-02-17 04:01:28','2017-03-08 23:59:19','<p>A group of <u><strong>MBA</strong></u> <u><strong>student-consultants</strong></u> <u><strong>will use customer</strong></u> <u><strong>insights  and</strong></u> <u><strong>user experience models to improve your website and then A/B test</strong></u> using 3rd party platforms (Optimizely and Unbounce) to quantify the improvements. Past projects have:</p><ul><li>Increased click-through rates of landing pages and marketing materials</li><li>Increased sign-up rates of new customers/users</li><li>Increased sales</li></ul>',1,'MBA',1,NULL,NULL,NULL),(79,90,'published','Consumer Behavior Strategies',NULL,'mktg 307','Consumer Behavior',40,2016,'winter/spring','<p>Up to <u><strong>5 groups of student-consultants will answer the most daunting consumer behaviors</strong></u> that are currently puzzling your marketing team. </p>','group','2017-02-01','2017-05-03',100,NULL,'<p>After spending <u><strong>+500 hours working on your consumer behavior puzzles</strong></u>, the student groups will submit a <u><strong>10-page document</strong></u> that details the reasons behind the behaviors and then marketing strategies to overcome them.</p>',10,NULL,'2017-02-17 04:01:29','2017-04-12 20:15:15','<p>Up to <u><strong>5 groups of student-consultants will answer the most daunting consumer behaviors</strong></u> that are currently puzzling your marketing team.  They will then <u><strong>create marketing strategies around how you can resolve them in order to increase revenues</strong></u>. Past examples have included, but are not limited to:</p><ul><li>Why don&#x27;t my customers shop online on Tuesday afternoons for anything purple?</li><li>Why does a rainy day in one state increase my customers for that day, while decreasing in another state?</li></ul>',5,'3rd year',1,NULL,NULL,NULL),(80,68,'published','Consulting Capstone',NULL,'AGBU 460','Advanced Agricultural Business Management:',NULL,2016,'fall','<p>Students work as <u><strong>professional consultants with an agricultural or food company</strong></u> that is facing a specific challenge.</p>','group','2016-09-16','2016-12-16',0,NULL,'<p>Students submit a <u><strong>final report that addresses the challenge that the industry partner</strong></u> has and incorporates their economics, marketing, management, operations and logistics, and accounting skills that they learned from previous classes. Students will also complete a <u><strong>short presentation and Q&amp;A of their findings</strong></u> to the industry partner.</p>',4,NULL,'2017-02-17 04:05:06','2017-02-17 04:18:16','<p>Students work as <u><strong>professional consultants with an agricultural or food company</strong></u> that is facing a specific challenge.  Are you entering a new market, developing a new product, repositioning and going organic, or reinventing the family farm to include agritourism? Whatever the case may be, <u><strong>students will spend a minimum of 3 hours per week throughout the entire semester</strong></u> working with your company to help you address your unique needs.</p>',4,'4th Year',1,NULL,NULL,NULL),(81,68,'draft','Consulting Capstone ',NULL,'AGBU 460','Advanced Agricultural Business Management:',NULL,2016,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-02-17 04:08:33','2017-02-17 04:08:33',NULL,NULL,'3rd Year',0,NULL,NULL,'2017-08-28 23:40:22'),(82,2,'published','Industry Research Project',NULL,'MKTG 4560','Digital Marketing',0,2016,'winter/spring','<p>Students will do industry research on your competitors, potential customers and your strengths, competencies, and weaknesses, which informs their <u><strong>strategic digital marketing recommendations for you.</strong></u></p>','group','2017-01-14','2017-03-30',80,NULL,'<p>Students will submit a <u><strong>3-page executive summary</strong></u> and accompanying documents on the research and analytical work that has been performed. Students will also hold a <u><strong>7-minute presentation</strong></u> on their findings with a 10-15 minute Q&amp;A period. As an industry partner, you should expect details on how a <u><strong>digital marketing strategy</strong></u> can help your new product launch, brand repositioning, etc.</p>',4,NULL,'2017-02-17 04:16:49','2017-06-15 16:40:13','<p>Could you benefit by having a group of 4th-year student consultants research a marketing challenge that is unique to your organization? Students will do industry research on your competitors, potential customers and your strengths, competencies, and weaknesses, which informs their <u><strong>strategic digital marketing recommendations for you.</strong></u> The project scope could include, but is not limited to, be related to ongoing marketing initiatives such as;</p><ul><li><strong>new product launch</strong></li><li><strong>brand campaign</strong></li><li><strong>segment analysis</strong></li><li><strong>brand repositioning for the purpose of market expansion</strong></li><li><strong>Competitive analysis</strong></li><li><strong>new target markets, etc.</strong></li></ul>',4,'4th year',1,NULL,'anywhere',NULL),(84,2,'draft','Industry Research Project',NULL,'MKTG 4560','Digital Marketing',0,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-02-17 04:17:59','2017-02-17 04:17:59',NULL,NULL,'4th year',0,NULL,NULL,'2017-06-15 23:57:08'),(85,2,'draft','Industry Research Project',NULL,'MKTG 4560','Digital Marketing',0,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-02-17 04:19:08','2017-02-17 04:19:08',NULL,NULL,'4th year',0,NULL,NULL,'2017-06-15 23:57:50'),(86,2,'draft','Industry Research Project',NULL,'MKTG 4560','Digital Marketing',0,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-02-17 04:19:10','2017-02-17 04:19:10',NULL,NULL,'4th year',0,NULL,NULL,'2017-06-15 23:58:02'),(87,95,'published','Branding & Content Production',NULL,'ADVG 420','Agency Workshop & Production House',0,2016,'winter/spring','<p>After spending an <u><strong>entire 3 months working for your organization, these ~20 students will produce branding or content collateral that you can start to use immediately</strong></u>.</p>','individual','2017-01-05','2017-04-27',80,NULL,'<p>The deliverable is dependent on what your organization&#x27;s needs are - but it will be <u><strong>actual branding and/or content collateral that you can use</strong></u>, immediately. </p>',1,NULL,'2017-02-17 04:22:41','2017-02-17 04:30:04','<ul><li>Website for a Hospital in Haiti</li><li>Branding for a Dance School</li><li>Writing and Social Media for an intern program for NYC High School students</li><li>Social media and Sales Materials for a Non-profit</li></ul>',1,'4th year',1,NULL,NULL,NULL),(88,66,'published','Emotional Intelligence Challenge',NULL,'EXMN - 658','Leading with Emotional Intelligence',NULL,2016,'winter/spring','<p>Are you wanting to <u><strong>integrate Emotional Intelligence into your business, strategically</strong></u>? For instance: better bargaining during union negotations; better stress management for your employees; enhance decision making during a crisis; or develop interpersonal skills of your IT staff who are being groomed for leadership roles. Three groups of <u><strong>students will analyze your challenge at hand and present 2-3 actionable recommendations</strong></u> that you can use. </p>','group','2016-09-20','2016-10-06',100,NULL,'<p>These MBA students average about 8 years of experience behind them and submit a <u><strong>6-page paper that apply the EI model, constructs, and practices</strong></u>. They follow that up with a <u><strong>10-minute online presentation of their recommendations</strong></u>.</p>',8,NULL,'2017-02-17 04:22:45','2017-02-17 04:29:56','<p>Better bargaining during union negotations; better stress management for your employees; enhance decision making during a crisis; or develop interpersonal skills of your IT staff who are being groomed for leadership roles. Three groups of <u><strong>students will analyze your challenge at hand and present 2-3 actionable recommendations</strong></u> that you can use. </p>',1,'4th Year ',1,NULL,NULL,NULL),(89,22,'published','Primary Research Online Surveying',NULL,'Mark 210','Marketing Research',50,2016,'winter/spring','<p>Do you have have a decision to make, and lack the customer-data you need? A team of five business students conduct market research to help solve your real-life business problem.</p>','group','2017-01-01','2017-04-30',50,NULL,'<p>Students will deliver fresh, actionable insight from extensive data analysis. They will also produce a concise summary report highlighting the main findings, with options and recommendations, in addition to an electronic copy of the raw data, complete with student analysis. You’ll be able to see exactly how the data was analyzed, and why your student-team reached their conclusions. You’ll even be able to conduct further analysis as you wish.</p>',12,NULL,'2017-02-17 04:25:33','2017-02-19 22:17:06','<p>Do you have have a decision to make, and lack the customer-data you need? A team of five business students conduct market research to help solve your real-life business problem. Students design an online survey, you send a link to your customers, and the student team analyzes the results. They then develop options for solving your problem, and make recommendations.</p><p></p><p><strong>Potential project scopes include, but are not limited to</strong>: </p><ul><li>improving customer acquisition/retention</li><li>identifying market expansion opportunities</li><li>market segmentation analysis</li><li>receiving feedback on a new or existing product/service, etc.</li></ul>',5,'2nd year',1,NULL,NULL,NULL),(90,66,'published','MBA Leadership Challenge',NULL,'BUS A 507','Foundations of Strategic Leadership',NULL,2016,'winter/spring','<p>A class of MBA students will tackle a leadership issue or challenge that your company is currently facing.  Based on information on your organization and your goals that you&#x27;ve shared with them, students will act as consultants, analyzing the situation and delivering a presentation and report recommending strategies to address it. </p>','group','2017-02-10','2017-02-24',NULL,NULL,'<p>Students will spend 40-50 hours total on your leadership project. At the end of the challenge, they deliver a 5-7 minute presentation on their analysis and recommendations in addition to a ten page written report.</p>',1,NULL,'2017-02-17 04:28:57','2017-02-17 04:35:09','<p>A class of MBA students will tackle a leadership issue or challenge that your company is currently facing.  Based on information on your organization and your goals that you&#x27;ve shared with them, students will act as consultants, analyzing the situation and delivering a presentation and report recommending strategies to address it. The entire class will focus on your leadership challenge, but broken into groups of ten students to ensure you get diverse perspectives on the topic. Project scopes can include, but are not limited to:</p><ul><li><strong>How do we sustain our not-for-profit organization itself (operationally) and our Board of Directors?</strong></li><li><strong>How can we exercise our leadership to unify the multi-generations in our workplace?</strong></li><li><strong>How can we market our small company in a changing environment?</strong></li><li><strong>How can we create a cohesive leadership team after a merger?</strong></li><li><strong>How do we ensure quality during a period of high growth?</strong></li></ul>',30,'MBA',1,NULL,NULL,NULL),(91,101,'published','Social Media Data Analytics & Market Research Project',NULL,'CS 695','Social Media Analytics',0,2016,'winter/spring','<p>Student-consultants will conduct <u><strong>market research, as well as topic, trend, sentiment, and influencer analyses</strong></u> to provide insights to your organization.</p>','group','2017-02-01','2017-05-01',80,NULL,'<p>Each group will contribute <u><strong>+100 hours of work to your organization</strong></u>, which will culminate in a <u><strong>20-minute presentation</strong></u>, with an accompanying <u><strong>10-page report</strong></u>, which outlines how consumer insights can be gained from social media in order to benefit your organization.</p>',4,NULL,'2017-02-17 04:35:03','2017-02-24 00:55:22','<p>A group of 3 to 5 student-consultants, specialized in data analytics, will analyze a social media data set in a business context that is specific to your organization. The student-consultants will conduct <u><strong>market research, as well as topic, trend, sentiment, and influencer analyses</strong></u> to provide insights to your organization. Projects could include, but are not limited to:</p><ul><li><strong>Analyse tweets relating to your industry to identify customer trends</strong></li><li><strong>Identify prospective customers or demographics via social media postings</strong></li><li><strong>Identify major influencers on social media who could become advocates for your brand</strong></li></ul>',4,'Graduate',1,NULL,NULL,NULL),(92,23,'published','International Business Consulting Project','92','BADM - 324','International Field School',NULL,2016,'winter/spring','<p>Is your organization interested in international expansion opportunities? A small group of student-consultants will assist your company by conducting research to understand the local context of expansion into Eastern Europe from Canada, or Canada from Eastern Europe. Projects scopes may include, but are not limited to:</p><ul><li><strong>Market entry/expansion </strong></li><li><strong>Understanding foreign business, culture &amp; customs</strong></li><li><strong>Marketing your product/service internationally</strong></li><li><strong>Environmental scan</strong></li></ul>','group','2017-01-02','2017-05-15',100,NULL,'<p>The student team will submit a short <strong>5-page assignment or video</strong> (your choosing) detailing their findings and recommendations</p>',5,NULL,'2017-02-17 04:35:29','2017-04-12 21:15:01','<p>Is your organization interested in international expansion opportunities? A small group of student-consultants will assist your company by conducting research to understand the local context of expansion into Eastern Europe from Canada, or Canada from Eastern Europe. Projects scopes may include, but are not limited to:</p><ul><li><strong>Market entry/expansion </strong></li><li><strong>Understanding foreign business, culture &amp; customs</strong></li><li><strong>Marketing your product/service internationally</strong></li><li><strong>Environmental scan</strong></li></ul>',5,'3rd Year',1,NULL,'anywhere',NULL),(93,23,'published','Business Plan Consultancy',NULL,'CCC','Consulting Club',NULL,2016,'winter/spring','<p>A group of student-consultants will research, analyze, and <u><strong>provide a new or updated business plan that is specific to your organization</strong></u>. </p>','group','2017-01-13','2017-03-28',NULL,NULL,'<p>After spending <u><strong>2.5 months of work dedicated to your organization</strong></u>, the group of student consultants will <u><strong>submit a full business plan</strong></u> for your organization, accompanied by <u><strong>a 15-minute presentation</strong></u>. </p>',1,NULL,'2017-02-17 04:42:44','2017-03-08 23:46:34','<p>A group of student-consultants will research, analyze, and <u><strong>provide a new or updated business plan that is specific to your organization</strong></u>. </p>',4,'3rd & 4th Year ',1,NULL,NULL,NULL),(94,23,'draft','Business Plan Consultancy',NULL,'CCC','Consulting Club',NULL,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-02-17 04:42:48','2017-02-17 04:42:48',NULL,NULL,'3rd & 4th Year ',0,NULL,NULL,'2017-08-28 23:41:13'),(97,71,'draft','Strategic Consulting',NULL,'STGY - 5900','Corporate & Business Strategy',NULL,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-02-17 04:45:12','2017-02-17 04:45:13',NULL,NULL,'4th Year',0,NULL,NULL,'2017-08-28 23:42:06'),(98,71,'published','Strategic Consulting',NULL,'STGY - 5900','Corporate & Business Strategy',0,2016,'winter/spring','<p>A group of <u><strong>student-consultants will provide you with an assessment of opportunities</strong></u> and threats in your environment. </p>','group','2016-09-05','2016-12-15',100,NULL,'<p>Student-consultants will use the external and internal analyses to develop strategic alternatives and recommendations for your organization.  They will submit a <u><strong>very detailed+40 page document with a 2-page Executive Summary</strong></u> and present their findings in a <u><strong>15-minute presentation</strong></u> to their class. </p>',6,NULL,'2017-02-17 04:45:27','2017-07-20 16:55:27','<p>A group of <u><strong>student-consultants will provide you with an assessment of opportunities</strong></u> and threats in your environment. This includes analyses of disruptive technologies, socio-cultural trends, economic trends, as well as clients, potential customers, competition, and suppliers. They will continue to do an internal analysis of the different divisions and, where possible,<u><strong>compare that to comparable companies or direct competitors</strong></u>. </p>',1,'4th Year',1,NULL,'anywhere',NULL),(99,100,'published','New Website Construction',NULL,'SCIT 151','Web Development',20,2016,'winter/spring','<p>Up to 5 individual students will each create well-designed, accessible web pages that validate and conform to web standards for your organization.</p>','individual','2017-03-01','2017-05-26',80,NULL,'<p>Each student will deliver a minimum of a <u><strong>5-page website tailored to your organization</strong></u>.</p>',4,NULL,'2017-02-17 04:46:53','2017-04-09 23:58:33','<p>Up to 5 individual students will each create well-designed, accessible web pages that validate and conform to web standards for your organization. They will enhance the web pages with interactive features, organize the content of the website and publish the pages to a web server. <u><strong>Take the best ideas and designs from each to upgrade your current website!!!</strong></u></p>',1,'1st year',1,NULL,'local',NULL),(100,20,'published','Business Consulting Projects','Business','BCP','BCIT School of Business:',35,2016,'winter/spring','<p>This 20-week in-class industry student project (not co-op), has <u><strong>students conducting substantial marketing research</strong></u> (this includes secondary, qualitative, and quantitive research)</p>','group','2017-01-01','2017-06-30',500,NULL,'<p>Before beginning any work on the client’s behalf, the <u><strong>students will prepare a detailed proposal outlining their marketing research plan, the nature of the deliverables, and a timeline</strong></u>. Any anticipated expenses will also be detailed, with students working within whatever budget the client makes available to them. Final deliverables for the project include a <u><strong>marketing research report, marketing or business plan with actionable recommendations, and an in-person presentation</strong></u> of the research findings and the plan itself. </p>',50,NULL,'2017-02-17 04:51:46','2017-05-11 23:00:28','<p>This 20-week in-class industry student project (not co-op), has <u><strong>students conducting substantial marketing research</strong></u> (this includes secondary, qualitative, and quantitive research). The students then use the results to guide the development of a <u><strong>detailed marketing or business plan</strong></u> as required by you, the client. All student teams are mentored by faculty advisors throughout the entire process. Whether you&#x27;re a small business, startup, non-profit or small/medium enterprise, our highly sought-after BCIT students can help you meet your organizational goals.</p>',5,'Capstone',1,NULL,'anywhere',NULL),(101,75,'published','Digital Marketing Plan',NULL,'MKTG 4207','Digital Marketing',0,2016,'winter/spring','<p><u><strong>co-create a marketing challenge that is unique to your organization</strong></u> that the students can complete (eg. a new product launch, a brand campaign, or a brand repositions for expansion, new target markets, etc.).</p>','individual','2017-01-15','2017-03-28',80,NULL,'<p>The students will submit a <u><strong>Digital Marketing Report</strong></u> specifically addressing your unique challege. They will also do a <u><strong>formal presentation of their findings and results</strong></u>.</p>',15,NULL,'2017-02-17 04:58:46','2017-02-17 05:03:02','<p>With the professor, <u><strong>co-create a marketing challenge that is unique to your organization</strong></u> that the students can complete (eg. a new product launch, a brand campaign, or a brand repositions for expansion, new target markets, etc.).  <u><strong>Students will do industry research on your competition, potential customers, and evaluate your business</strong></u> in order to create their strategic digital marketing recommendations.</p>',1,'4th year',1,NULL,NULL,NULL),(102,22,'published','B2B Client Marketing Plan',NULL,'MARK 465','Business to Business Marketing',0,2016,'winter/spring','<p>Camosun student consultants in groups will work with organizations that operate in B2B marketplaces to develop a comprehensive marketing plan for a clearly defined business objective.</p>','group','2017-01-15','2017-04-15',80,NULL,'<p>By the end of the semester, the students will have developed a <strong>full strategic B2B marketing plan (report format) and will present their findings in a final presentation</strong>. Throughout the semester, the students will analyze the dynamic business environment and B2B marketing trends to determine how this information may influence and be applied in B2B marketing planning and decision-making. They will also evaluate organizational buying behavior with particular emphasis on globalization, ethics and social responsibility expectations of modern business to ensure ethical and sustainable practices. Proprietary company information remains private at all times.</p>',5,NULL,'2017-02-17 04:59:01','2017-03-28 17:31:44','<p>Are you in need of a strategic marketing plan? As part of their course, Camosun student consultants in groups of ?-? will work with organizations that operate in B2B marketplaces to develop a comprehensive marketing plan for a clearly defined business objective.  Potential <strong>scopes for this project can include</strong> but are not limited to:</p><ul><li><strong>customer acquisition/retention,</strong></li><li><strong>increasing brand awareness, and</strong></li><li><strong>meeting the needs of a specific customer segment, etc. </strong></li><li><strong>promoting a new product/service launch,</strong></li><li><strong>increasing revenue for an existing product/service,</strong></li><li><strong>increasing market share</strong></li></ul>',5,'4th year',1,NULL,NULL,NULL),(103,63,'draft','Data Analytics Bootcamp Capstone',NULL,'boshybcore','Level Data Analytics',NULL,2016,'winter/spring','<p>Individual student consultants spend approximately 5-6 weeks working with your company to thoroughly analyze data sets using a variety of analysis methods. </p>','individual','2017-01-01','2017-02-28',NULL,NULL,'<p>Students will complete the data analysis and present their findings in final a presentation (virtual or in-person). They will clearly identify the challenges the organization is facing, uncover the root cause of the identified challenges, propose viable solution(s), and recommend the best course of action as well as justify the position through metrics. Students will also provide tangible copies of their work as it pertains to their individual project. All proprietary company information remains confidential at all times.</p>',35,NULL,'2017-02-17 05:02:10','2017-08-28 23:48:08','<p>Individual student consultants spend approximately 5-6 weeks working with your company to thoroughly analyze data sets using a variety of analysis methods. The results can provide in-depth insights into the operations of your business, a detailed perspective of your customers, and solutions to complex problems. Students are trained in and can leverage industry standards for analysis using SQL, Excel, R, PPT, and Tableau.  Project content is flexible and meant to move your data problems forward. Projects can include, but are not limited to;</p><ul><li><strong>analyzing e-commerce data to understand buyers and buying habits across several selling platforms,</strong></li><li><strong>identifying KPIs and gaining better insights from Google Analytics,</strong></li><li><strong>understanding profitability, retention, referrals, and attrition rates for your customers,</strong></li><li><strong>creating comprehensive dashboards to enhance your data visualization for customers, teams, and executives,</strong></li><li><strong>optimizing product design based on data results,</strong></li><li><strong>determining which internal investments make the most sense over time,</strong></li><li><strong>writing scripts for data queries to provide quick and easy access to business insights, and</strong></li><li><strong>designing lead scoring systems to understand opportunities worth pursuing and developing predictive sales model, etc.</strong></li></ul>',1,'Graduate',1,NULL,NULL,NULL),(104,85,'published','Data Consultancy & App Development',NULL,'BUS MGT 7257','Data Analytics & Visualization:',NULL,2016,'winter/spring','<p>Up to 3 groups of student-consultants will spend an entire semester working towards providing your company with guidance on a particular decision using the data you provide <u><strong>by building an application (either external dashboard or as an Excel Add-in) specific to your data</strong></u>.</p>','group','2017-01-15','2017-03-01',NULL,NULL,'<p>Each group of student-consultants will submit a <u><strong>YouTube Video of a 60-second synopsis of the application plus a 10-minute walkthrough</strong></u></p>',5,NULL,'2017-02-17 05:10:42','2017-03-08 23:48:20','<p>Up to 3 groups of student-consultants will spend an entire semester working towards providing your company with guidance on a particular decision using the data you provide <u><strong>by building an application (either external dashboard or as an Excel Add-in) specific to your data</strong></u>. The application can:</p><ul><li>provide a specific solution (through optimization or simulation of the data)</li><li>enhance data navigation or visualization (through dynamic tables, live feeds, graphics, etc)</li><li><u><strong>or a combination of the two</strong></u></li></ul>',4,'4th Year',1,NULL,NULL,NULL),(105,66,'published','Startup Marketing Plan',NULL,'ENMN 330','Marketing',0,2016,'winter/spring','<p>A group of student-consultants will use an iterative process to research, analyze, and then <u><strong>develop your workable marketing plan, specific to your goals,</strong></u> <u><strong>objectives,</strong></u> <u><strong>and budget,</strong></u></p>','group','2017-01-20','2017-04-20',80,NULL,'<p>The group will submit a <strong>comprehensive marketing plan (report format)</strong>, accompanied by a <strong><u>15-minute presentation.</u></strong></p>',20,NULL,'2017-02-17 05:12:09','2017-02-17 05:18:20','<p>A group of student-consultants will use an iterative process to research, analyze, and then <u><strong>develop your workable marketing plan, specific to your goals,</strong></u> <u><strong>objectives,</strong></u> <u><strong>and budget,</strong></u> You provide feedback and engage with the students over the semester while they fully develop your marketing plan, combining strategic decision making with the creativity of entrepreneurial and design thinking. In addition to more traditional competitive analyses and marketing mix strategies they will also map customer journeys and develop customer personas to better focus your marketing plan.</p><p></p><p>As a startup you may not have the resources to fully develop your first marketing plan. Let these students, specialized in this area, do your first plan for you!  If you already have a basic one, let them push it to the next level! Project scopes can include, but are not limited to:</p><ul><li><strong>identifying potential customer profiles</strong></li><li><strong>market segmentation analysis</strong></li><li><strong>creative promotional strategies</strong></li><li><strong>competitive analyses</strong></li><li><strong>researching potential partners and channels</strong></li><li><strong>pricing strategies, etc.</strong></li></ul>',4,'3rd year',1,NULL,NULL,NULL),(108,66,'published','Startup Marketing Plan',NULL,'ENMN 330','Marketing',0,2016,'winter/spring','<p>A group of student-consultants will use an iterative process to research, analyze, and then <u><strong>develop your workable marketing plan, specific to your goals,</strong></u> <u><strong>objectives,</strong></u> <u><strong>and budget,</strong></u></p>','group','2017-02-27','2017-04-30',NULL,NULL,'<p>The group will submit a <strong>comprehensive marketing plan (report format)</strong>, accompanied by a <strong><u>15-minute presentation.</u></strong></p>',4,NULL,'2017-02-17 05:13:58','2017-03-15 21:17:49','<p>A group of student-consultants will use an iterative process to research, analyze, and then <u><strong>develop your workable marketing plan, specific to your goals,</strong></u> <u><strong>objectives,</strong></u> <u><strong>and budget,</strong></u> You provide feedback and engage with the students over the semester while they fully develop your marketing plan, combining strategic decision making with the creativity of entrepreneurial and design thinking. In addition to more traditional competitive analyses and marketing mix strategies they will also map customer journeys and develop customer personas to better focus your marketing plan.</p><p></p><p>As a startup you may not have the resources to fully develop your first marketing plan. Let these students, specialized in this area, do your first plan for you!  If you already have a basic one, let them push it to the next level! Project scopes can include, but are not limited to:</p><ul><li><strong>identifying potential customer profiles</strong></li><li><strong>market segmentation analysis</strong></li><li><strong>creative promotional strategies</strong></li><li><strong>competitive analyses</strong></li><li><strong>researching potential partners and channels</strong></li><li><strong>pricing strategies, etc.</strong></li></ul>',4,'3rd year',1,NULL,NULL,NULL),(109,86,'published','International Expansion Consultancy',NULL,'MBA 750','Building Global Connections',40,2017,'winter/spring','<p> Groups of student-consultants will tap into the resources of various agencies (consulates, Mass. Export Center, etc.) in the Boston area that could help your company in its internationalization efforts. </p>','group','2017-01-01','2017-04-29',200,NULL,'<p>Each of the 5 groups will do <strong><u>3 months of work</u></strong> to help your firm internationalize - <strong><u>a total of 1000 hours of work</u></strong>. Each group will provide a 10-minute presentation, as well as a detailed project report that includes:</p><ul><li><strong>Political analysis</strong></li><li><strong>Cultural analysis</strong></li><li><strong>Economic analysis</strong></li><li><strong>Trade Agreements analysis</strong></li><li><strong>Competitive Landscape</strong></li><li><strong>Risk and Impact assessment</strong></li></ul>',1,NULL,'2017-02-17 05:15:03','2017-03-08 23:59:03','<p><strong><u>Your firm would like to expand into another country</u></strong> and you need preliminary research on how you should expand into that particular country.  Groups of student-consultants will tap into the resources of various agencies (consulates, Mass. Export Center, etc.) in the Boston area that could help your company in its internationalization efforts. Based on their research, as well as lessons learned from your competitors, the students will offer recommendations for a <strong><u>successful international business venture in that country</u></strong>.</p>',5,'MBA',1,NULL,NULL,NULL),(110,23,'published','Communications Strategy',NULL,'CMNS 360','Strategic Communications',0,2016,'winter/spring','<p><u><strong>Student Consultants will create communication pieces, develop corporate/organizational identities, and develop and present complex strategic communications plans for your organization.</strong></u></p>','group','2017-01-15','2017-04-10',80,NULL,'<p>After spending <u><strong>3 months of work dedicated to your organization</strong></u>, the group of student consultants will submit <u><strong>a 10-page report, accompanied by a 3-minute elevator pitch on their strategic communications</strong></u> that will help your organization propel forward. </p>',4,NULL,'2017-02-17 05:18:21','2017-03-15 16:51:12','<p>Up to 5 student-consultants will research your organization and then <u><strong>create communication pieces, develop corporate/organizational identities, and develop and present complex strategic communications plans for your organization.</strong></u> This could include, but is not limited to, communications pieces in:</p><ul><li><strong>Public Relations</strong></li><li><strong>Media Relations</strong></li><li><strong>Government Relations</strong></li><li><strong>Corporate Advertising</strong></li><li><strong>Public Branding</strong></li><li><strong>Social Media Presence</strong></li></ul>',4,'3rd year',1,NULL,NULL,NULL),(111,28,'published','Data Mining Project',NULL,'BUSI 3013','Business Intelligence:',NULL,2016,'winter/spring','<p>Over the entire semester, a group of <u><strong>student-consultants trained in data mining will provide you with insights and knowledge</strong></u> that is useful for solving a business problem specific to your organization. </p>','group','2017-01-20','2017-04-15',NULL,NULL,'<p>The group of 5 student-consultants, <strong><u>spending a total of 150 hours on your project</u></strong>, will submit a <strong><u>+10 page report</u></strong> on their findings.</p>',1,NULL,'2017-02-17 05:20:21','2017-02-17 05:24:04','<p>Over the entire semester, a group of <u><strong>student-consultants trained in data mining will provide you with insights and knowledge</strong></u> that is useful for solving a business problem specific to your organization. Past projects have included:</p><ul><li>Determine the relationship between online stock analyst sentiment versus the actual change in stock price</li><li>Determine the predictors to NHL player productivity using the publicly available dataset on NHL players</li><li>Determine the predictors to economic performance for a city, year over year</li><li>Determine the relationship between on-air advertising time and the number of days and volume of purchasing</li></ul>',6,'4th Year',1,NULL,NULL,NULL),(112,59,'published','Promotional Plan + Materials',NULL,'MARK 3340','Promotional Strategy',0,2016,'winter/spring','<p>Create a promotional plan for your company which will be <u><strong>accompanied by samples of promotional materials in different media - script, print ad, PR, sponsorship, </strong></u>etc.</p>','group','2017-01-03','2017-04-15',80,NULL,'<p>The deliverables will laid out in 3 steps, where the final 2 are dependent on what is decided in the first:</p><ol><li>Background document including promotional plan objectives, creative theme, and key messaging</li><li>Broadcast script and print samples, as well as any other interactive and sales promotion</li><li>Public relations materials, plus experiential/event or sponsorship materials and personal selling/ direct response  promotions samples.</li></ol>',6,NULL,'2017-02-17 05:27:37','2017-02-19 21:42:39','<p>A group of 5 to 6 student-consultants will work for an entire semester on creating a promotional plan for your company which will be <u><strong>accompanied by samples of promotional materials in different media - script, print ad, PR, sponsorship, </strong></u>etc. Your promotional project can be linked to anything you are currently doing in your marketing strategy or something new: New Target Market; New Product; Special Marketing Sale; the possibilities are endless!</p>',5,'3rd year',1,NULL,NULL,NULL),(113,10,'published','Financial Data Analysis',NULL,'ECON 818','Econometrics',NULL,2016,'winter/spring','<p>Individual student-consultants spend <u><strong>2-3 months working with you to thoroughly analyze data sets</strong></u> using a variety of analytic methods. </p>','group','2017-01-09','2017-04-28',NULL,NULL,'<p>The <u><strong>student-consultant</strong></u> <u><strong>will spend ~50 hours working</strong></u> to complete the data analysis and then <u><strong>present their findings in a final presentation (virtual or in-person)</strong></u>. They will clearly identify the challenges of your organization, uncover the root cause of the challenge, propose viable solutions, and recommend the best course of action, which is justified through metrics. Students will also <u><strong>provide tangible copies of their work as it pertains to the project</strong></u>. All proprietary information remains confidential at all times.</p>',6,NULL,'2017-02-17 05:27:56','2017-06-12 23:25:07','<p>Individual student-consultants spend <u><strong>2-3 months working with you to thoroughly analyze data sets</strong></u> using a variety of analytic methods. The results of which can provide in-depth insights into the history of your business, the growth of your product and customers, as well as into its future by forecasting. Project content is flexible and has included in the past:</p><ul><li><strong>understanding buyers and buyer habits over time to develop predictive sales models</strong></li><li><strong>understanding profitability, retention, referrals, and attrition rates of your customers over time</strong></li><li><strong>developing and testing asset pricing models or estimating a Profit Function</strong></li></ul>',6,'Graduate ',1,NULL,NULL,NULL),(114,73,'published','New Toy Marketing Plan',NULL,'BU - 352','Marketing I',NULL,2016,'winter/spring','<p><u><strong>After coming up with an idea for a brand new toy, a group of students will prepare a marketing plan</strong></u> that describes: the overall market; a competitive analysis; an environmental analysis; target market; product specifications; a position statement; a marketing mix; as well as anticipated results over a 3-year timeframe, including market share and financial analysis. </p>','individual','2016-09-05','2016-11-07',100,NULL,'<p>Student groups will submit a <u><strong>max 20-page document</strong></u> that outlines the new toy idea and its corresponding marketing plan.</p>',5,NULL,'2017-02-17 05:28:34','2017-03-08 23:51:33','<p>Finding and recruiting top talent that fits best with your organization <u><strong>will give you a distinct competitive advantage.</strong></u> Students are highly motivated and thirsty for opportunities to prove themselves in your industry. You&#x27;ll gain an unparalleled opportunity to evaluate future talent -- learning what they can bring to the table and what skills they need <u><strong>before</strong></u> you hire them to <u><strong>reduce onboarding costs and time</strong></u>.</p><p><u><strong>After coming up with an idea for a brand new toy, a group of students will prepare a marketing plan</strong></u> that describes: the overall market; a competitive analysis; an environmental analysis; target market; product specifications; a position statement; a marketing mix; as well as anticipated results over a 3-year timeframe, including market share and financial analysis. </p><p></p><p>Student groups will submit a <u><strong>max 20-page document</strong></u> that outlines the new toy idea and its corresponding marketing plan.</p>',1,'3rd Year',1,NULL,NULL,NULL),(115,73,'published','New Product Marketing Plan',NULL,'BU - 352','Marketing I',50,2016,'summer','<p>After coming up with an idea for a brand new product for your company, a group of students will prepare a marketing plan to bring this to market.</p>','group','2017-05-09','2017-07-18',25,NULL,'<p>Student groups will submit a <u><strong>max 20-page document</strong></u> that outlines the new product idea and its corresponding marketing plan. </p>',18,NULL,'2017-02-17 05:28:47','2017-06-05 23:02:28','<p>After coming up with an idea for a brand new product for your business, a group of students will prepare a marketing plan that describes: the overall market; a competitive analysis; an environmental analysis; target market; product specifications; a positioning statement; and a marketing mix. They will also forecast anticipated results over a 3-year timeframe, including market share and financial analysis.</p><p></p><p></p>',5,'3rd Year',1,NULL,'anywhere',NULL),(116,105,'published','Innovative Product Redesign',NULL,'BUS 280','Innovation & Design Thinking',0,2016,'winter/spring','<p><u><strong>Student-consultants will compete against each other to develop the most innovative redesign of one of your products</strong></u>.</p>','group','2017-01-13','2017-03-17',80,NULL,'<p>After spending <u><strong>+two months and +600 hours working on your product redesign</strong></u>, each group will submit a <u><strong>working prototype of a product that is ready to market, with an accompanied 5-page document</strong></u>.</p>',5,NULL,'2017-02-17 05:32:30','2017-02-17 05:36:24','<p>After significant market research, groups of <u><strong>student-consultants will compete against each other to develop the most innovative redesign of one of your products</strong></u>. Past projects have included, but are not limited to:</p><ul><li>redesigned a hunting tree stand that allowed disabled persons accessibility</li><li>prototyped models for a modular daycare company</li><li>redesigned parking lot infrastructure and flow </li></ul>',5,'2nd year',1,NULL,NULL,NULL),(117,99,'published','Consumer Insights & Analysis',NULL,'ibm 330','Market Research',50,2016,'winter/spring','<p>For <u><strong>ten weeks</strong></u>, a group of student-consultants will provide you with new consumer insights and recommendations that you can use to propel your organization into the future. </p>','group','2017-01-10','2017-03-09',50,NULL,'<p>After the group spends <u><strong>over 150 hours working on this</strong></u> with your company, the student-consultants will deliver a <u><strong>15-minute presentation with the results</strong></u> <u><strong>from</strong></u> <u><strong>the survey and recommendations specific to your firm</strong></u>.</p>',1,NULL,'2017-02-17 05:36:11','2017-03-08 23:47:40','<p>For <u><strong>ten weeks</strong></u>, a group of student-consultants will provide you with new consumer insights and recommendations that you can use to propel your organization into the future. <u><strong>The student-consultants will start by conducting secondary data-based research about your industry and customers</strong></u>. From that work, they will determine research questions and a survey. Once they get your approval on the survey itself, they will <u><strong>administer the survey to a large number of students, then analyze the data and present key findings</strong></u>.</p>',5,'3rd Year',1,NULL,NULL,NULL),(118,98,'published','Web Analytics',NULL,'UIS 5320','Strategies & Technologies on the Internet:',NULL,2016,'winter/spring','<p>A group of student-consultants will not just perform web analytics for your organization&#x27;s website(s), but, they will include:</p><ul><li>Client business overview, which includes an investigation into the purpose of your website(s)</li><li>Analyze website analytics and review web metrics</li><li>Create a goal analysis and build KPIs </li><li>Implement a Dashboard and recommendations on its future use</li></ul>','group','2017-01-05','2017-03-24',NULL,NULL,'<p>the student-consultants will deliver a +<u><strong>10-page document that details the analysis and recommendations, with accompanying KPI Dashboard. </strong></u></p>',5,NULL,'2017-02-17 05:41:36','2017-03-08 23:46:51','<p>A group of student-consultants will not just perform web analytics for your organization&#x27;s website(s), but, they will include:</p><ul><li>Client business overview, which includes an investigation into the purpose of your website(s)</li><li>Analyze website analytics and review web metrics</li><li>Create a goal analysis and build KPIs </li><li>Implement a Dashboard and recommendations on its future use</li></ul>',3,'4th Year',1,NULL,NULL,NULL),(119,102,'published','Strategic Marketing Roadmap',NULL,'MKT 320','Marketing Strategy',0,2016,'winter/spring','<p>Student-consultants will <u><strong>analyze your current situation in the market and recommend solutions to a problem or opportunity posed by you or they will provide a strategic plan to improve your marketing initiatives</strong></u>.</p>','group','2017-01-26','2017-05-25',80,NULL,'<p>After 4 <u><strong>months of work on your strategic marketing roadmap</strong></u>, the group of student-consultants will submit:</p><ol><li>A detailed report of their analysis and recommendations</li><li>A 20-minute presentation that summarizes their findings </li><li>Any peripheral materials that the firm wanted (multimedia/social media content, crowdfunding websites, mock-ups, logo designs, etc)</li></ol>',5,NULL,'2017-02-17 05:44:10','2017-04-12 20:09:59','<p>A group of junior student-consultants will <u><strong>analyze your current situation in the market and recommend solutions to a problem or opportunity posed by you or they will provide a strategic plan to improve your marketing initiatives</strong></u>. Past projects have included:</p><ul><li>Brand Management of company</li><li>New product line and its market acquisition plan</li><li>Target segmentation determination and branding of a company </li></ul>',5,'3rd year',1,NULL,NULL,NULL),(120,14,'published','B2C Client Marketing Plan',NULL,'COMM - 468','Marketing Applications',NULL,2016,'winter/spring','<p>Are you in need of a strategic marketing plan? As part of a course, 4th year UBC student consultants in groups of 5-6 will work with local organizations that operate in B2C marketplaces to develop a comprehensive marketing plan for a clearly defined business objective.  Potential <strong>scopes for this project can include</strong> but are not limited to;</p><ul><li><strong>promoting a new product/service launch,</strong></li><li><strong>increasing revenue for an existing product/service,</strong></li><li><strong>increasing market share,</strong></li><li><strong>customer acquisition/retention,</strong></li><li><strong>increasing brand awareness, and</strong></li><li><strong>meeting the needs of a specific customer segment, etc. </strong></li></ul>','group','2017-01-02','2017-04-13',100,NULL,'<p>The <strong>students dedicate approximately 300 hours to research, analyze and create their plan</strong> all while being coached by their instructor. The final deliverable is a <strong>full marketing plan and presentation with actionable recommendations</strong> based on a clear, well-defined goal, including an analysis of all four marketing mix elements: <strong>product, price, distribution and promotion</strong></p>',12,NULL,'2017-02-17 05:44:35','2017-03-08 23:43:01','<p>The <strong>students dedicate approximately 300 hours to research, analyze and create their plan</strong> all while being coached by their instructor. The final deliverable is a <strong>full marketing plan and presentation with actionable recommendations</strong> based on a clear, well-defined goal, including an analysis of all four marketing mix elements: <strong>product, price, distribution and promotion</strong></p>',4,'4th Year',1,NULL,NULL,NULL),(121,59,'published','Community Impact Event',NULL,'HOSP 2465','Event Management',0,2016,'winter/spring','<p><u><strong>Collaborate with your organization to execute an event that addresses a community issue that is important to you</strong></u>.</p>','group','2017-01-15','2017-03-28',80,NULL,'',7,NULL,'2017-02-17 05:47:46','2017-05-26 23:45:49','<p>Groups of six students, focused on event planning, will <u><strong>collaborate with your organization to execute an event that addresses a community issue that is important to you</strong></u>. The &quot;event&quot; can be an internal initiative to your organization or external to include stakeholders but must occur during the duration of the semester. Past themes have included, but are not limited to:</p><ul><li><strong>Environmental initiatives like energy conservation, water conservation, tree planting, or food security</strong></li><li><strong>Social change and social innovation event to increase awareness of the community issue</strong></li><li><strong>Creating economic impact for a nonprofit through a social enterprising event</strong></li></ul>',4,'2nd year',1,NULL,'anywhere',NULL),(122,59,'draft','Community Impact Event',NULL,'HOSP 2465','Event Management',0,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-02-17 05:48:01','2017-02-17 05:48:01',NULL,NULL,'2nd year',0,NULL,NULL,'2017-08-28 23:45:19'),(123,13,'published','Data Consultancy',NULL,'MBA B 5P13','Database Systems:',NULL,2016,'fall','<p>Is your database outdated? Are you still using Excel? You could be using more sophisticated technology that could actually help you with your data! Or maybe you want to use your existing data in new ways or for the first time ever.</p>','group','2016-10-03','2016-12-09',NULL,NULL,'<p>Student-consultants create <u><strong>a business plan around their new use of data or databases plus a functioning prototype</strong></u>.</p>',5,NULL,'2017-02-17 05:51:03','2017-03-08 23:49:01','<p>Is your database outdated? Are you still using Excel? You could be using more sophisticated technology that could actually help you with your data! Or maybe you want to use your existing data in new ways or for the first time ever. <u><strong>A group of student-consultants will devise a business plan about how you can maximize your data by using a database</strong></u>.  Past projects included: reorganizing data to map customer geographic information to find new areas with low penetration; and, data modeling from an excel file to a functional database.</p>',4,'MBA',1,NULL,NULL,NULL),(124,77,'published','Data Analytics Capstone',NULL,'BIT M 415','Data Analytics for Business:',37,2017,'fall','<p>Do you have a challenge or opportunity facing your business that data analytics would help with? Do you want to know more about your website analytics, where you should be spending more money or time, or which customers convert better?</p>','group','2016-09-30','2016-12-09',NULL,NULL,'<p>After analyzing your data sets using a variety of methods, students will submit a 10-page document with their proposed solutions and do a 5-minute presentation.</p>',5,NULL,'2017-02-17 08:03:44','2017-02-17 08:06:41','<p>Do you have a challenge or opportunity facing your business that data analytics would help with? Do you want to know more about your website analytics, where you should be spending more money or time, or which customers convert better? Have you read or seen Moneyball and want to use that same logic to help your team win? If any of these are true, this project is for you! </p>',4,'3rd Year',1,NULL,NULL,NULL),(125,67,'published','Data-Driven Decision Making Consultancy',NULL,'BUS 4045','Capstone Data Project:',NULL,2016,'winter/spring','<p>A group of five student-consultants, specialized in data-driven decision-making, will help your organization by designing and then implementing analytical research to support your decision-making. </p>','group','2016-12-07','2017-04-17',64,NULL,'<p>After the group of student-consultants spend <u><strong>+320 hours of work for your company</strong></u>, they will submit a <u><strong>4 to</strong></u> <u><strong>10-pagereport on the data findings</strong></u> and their recommendations on how to proceed.</p>',14,NULL,'2017-02-17 08:12:22','2017-05-11 22:59:35','<p>A group of five student-consultants, specialized in data-driven decision-making, will help your organization by designing and then implementing analytical research to support your decision-making. Past project scopes have included, but are not limited to:</p><ul><li><strong>Using CRM data understand purchasing behaviour</strong></li><li><strong>Using CRM data to help automate sales functions</strong></li><li><strong>Finding software solutions to manage problems</strong></li><li><strong>Upgrading the platform of an e-commerce business</strong></li><li><strong>Using google analytics to adjust website user-flow</strong></li><li><strong>Using 3rd-party data to determine market opportunities</strong></li></ul>',5,'3rd Year',1,NULL,NULL,NULL),(126,77,'published','Consulting Field Study',NULL,'BITM 691','Field Study in IT Management',NULL,2017,'fall','<p>Do you have a challenge or opportunity facing your business that data analytics would help with? </p>','individual','2016-09-16','2017-05-12',500,NULL,'<p>After analyzing your data sets using a variety of methods, students will submit a 20-page document with their proposed solutions and do a 20-minute presentation.</p>',3,NULL,'2017-02-17 08:21:22','2017-05-11 23:04:53','<p>Do you have a challenge or opportunity facing your business that data analytics would help with? Do you want to know more about your website analytics, where you should be spending more money or time, which customers convert better? Have you read/seen Moneyball and want to use that same logic to help your team win? If so, this project is for you! A group of <u><strong>students spend 40 hours per week for 2 semesters</strong></u> working on this!</p>',1,'4th Year',1,NULL,NULL,NULL),(127,10,'published','Personnel Selection Plan',NULL,'BUS 481','Recruitment & Selection',34,2016,'winter/spring','<p>Is your selection programming stale or non-existent? Do you want to know what the predictors are to the Knowledge, Skills, and Abilities (KSAOs) required to do a specific job at your company so that <u><strong>you can ask the right questions when you are interviewing</strong></u> potential candidates? </p>','group','2017-02-21','2017-04-07',NULL,NULL,'<p>The student groups will <u><strong>submit a 15-page written report that details the selection programming changes and the strategy behind them</strong></u> at the end of the term. The top three project submissions will rated by the instructor and supplied to the company. Proprietary company information remains confidential at all times. </p>',1,NULL,'2017-02-17 08:28:46','2017-06-12 23:29:37','<p>Is your selection programming stale or non-existent? Do you want to know what the predictors are to the Knowledge, Skills, and Abilities (KSAOs) required to do a specific job at your company so that <u><strong>you can ask the right questions when you are interviewing</strong></u> potential candidates? Supported by the instructor, several groups of student-consultants, armed with the state of the art in recruitment and selection, will report back to you on how <u><strong>your selection programming can be improved</strong></u>. </p>',6,'4th Year',1,NULL,NULL,NULL),(128,10,'published','Systems Improvement Consulancy',NULL,'BUS 482','Performance Management',NULL,2016,'winter/spring','<p>Is your performance management system out of date <u><strong>or non-existent</strong></u>? Several groups of student-consultants, armed with the state of the art in performance management and backed by their knowledgeable professor, will report back to you on how <u><strong>your performance management system can be improved or started</strong></u>. </p>','individual','2017-02-21','2017-04-07',NULL,NULL,'<p>The student groups will <u><strong>submit a 15-page written report that details the recommendations for improving/starting your performance management system, including a detailed explanation of how the recommendations will improve your organization</strong></u> at the end of the term. The top three project submissions will rated by the instructor and supplied to the company. Proprietary company information remains confidential at all times.</p>',1,NULL,'2017-02-17 08:34:16','2017-04-04 23:45:43','<p>Is your performance management system out of date <u><strong>or non-existent</strong></u>? Several groups of student-consultants, armed with the state of the art in performance management and backed by their knowledgeable professor, will report back to you on how <u><strong>your performance management system can be improved or started</strong></u>. </p>',1,'4th Year',1,NULL,NULL,NULL),(129,10,'published','HR Audit & Recommendations',NULL,'BUS 484','Employment Systems',NULL,2016,'winter/spring','<p>A group of 4 student-consultants will <u><strong>audit, analyze, research, and then provide actionable recommendations</strong></u> on a specific employment system that you feel could use some upgrading:</p>','group','2017-01-19','2017-04-20',100,NULL,'<p>Each group of student-consultants will spend <u><strong>+100 hours working on your company</strong></u> to provide actionable recommendations of the employment system of your choice. If the recommendations include changes to strategy, policy, or practices, <u><strong>the +10 page document they submit will include how they will be implemented and maintained</strong></u>. </p>',5,NULL,'2017-02-17 08:38:37','2017-06-12 23:29:08','<p>A group of 4 student-consultants will <u><strong>audit, analyze, research, and then provide actionable recommendations</strong></u> on a specific employment system that you feel could use some upgrading: Past examples have included:</p><ul><li><strong>Attendance Management</strong></li><li><strong>Training &amp; Development Programs</strong></li><li><strong>Health &amp; Safety Processes</strong></li><li><strong>Employee Retention</strong></li><li><strong>Use of Contingent Workers</strong></li><li><strong>Union-Management Relations</strong></li></ul>',5,'4th Year',1,NULL,NULL,NULL),(130,101,'published','Master\'s Industry Case Analysis',NULL,'MAN 750','Human Resources Management',28,2016,'winter/spring','<p>A group of Master&#x27;s level student-consultants will spend the term analyzing a Human Resources issue of your choosing. Students will research and review your current systems and recommend changes, providing new strategies and processes to improve your operations.</p>','group','2017-02-15','2017-05-05',40,NULL,'<p>The students will contribute <u><strong>+40 hours of work to your organization</strong></u>, which will culminate in a <u><strong>20-minute presentation</strong></u>, with an accompanying <u><strong>3 to 5-page analysis</strong></u>, which outlines strategic recommendations and an actionable implementation plan.</p>',6,NULL,'2017-02-17 08:45:46','2017-04-12 20:10:23','<p>A group of Master&#x27;s level student-consultants will spend the term analyzing a Human Resources issue of your choosing. Students will research and review your current systems and recommend changes, providing new strategies and processes to improve your operations. Project examples include (but are not limited to):</p><ul><li><strong>Evaluating your recruitment process to suggest new approaches and improve selection criteria</strong></li><li><strong>Reviewing your onboarding process to identify areas to reduce cost</strong></li><li><strong>Reviewing and improving training &amp; development programs</strong></li><li><strong>Recommending new compensation strategies</strong></li></ul>',4,'Masters ',1,NULL,NULL,NULL),(131,95,'published','HR Management Consulting Project',NULL,'MGMT E 480','Practicum in Management:',10,2016,'winter/spring','<p>A group of student-consultants will <strong>solve a human capital or management problem</strong> that is specific to your organization. </p>','group','2017-03-15','2017-04-21',80,NULL,'<p>After each student-consultant spends <u><strong>+80 hours working on providing solutions for your organization</strong></u>, the team will present their findings in a <u><strong>30-minute presentation, which will be accompanied by a detailed report</strong></u>.</p>',2,NULL,'2017-02-17 08:51:23','2017-05-01 20:17:35','<p>A group of <u><strong>student-consultants will solve a human capital or management problem that is specific to your organization</strong></u>. Past examples have included:</p><ul><li>Creating a mentoring program to guide more minorities to the upper echelons of the company</li><li>Upgrading hiring/recruitment strategy to be inclusive of new methods and ways to reach talent</li><li>Creating practices around employee creativity to increase engagement and decrease turnover</li></ul>',5,'3rd',1,NULL,NULL,NULL),(132,23,'published','Human Resources Consultancy',NULL,'CCC HR ','Consulting Club',17,2016,'winter/spring','<p>A group of student-consultants will research, analyze, and <u><strong>provide actionable recommendations to an HR challenge or opportunity that is specific to your organization</strong></u></p>','group','2017-01-15','2017-03-28',60,NULL,'<p>After spending <u><strong>2.5 months of work dedicated to your organization</strong></u>, the group of student-consultants will present <u><strong>a 15-minute presentation on their strategic HR recommendations</strong></u> that will help your organization propel forward. </p>',2,NULL,'2017-02-17 09:01:38','2017-02-17 09:05:17','<p>A group of student-consultants will research, analyze, and <u><strong>provide actionable recommendations to an HR challenge or opportunity that is specific to your organization</strong></u>. This could include, but is not limited to, HR initiatives related to:</p><ul><li>Recruitment processes and strategy</li><li>Decreasing on-boarding costs </li><li>Training &amp; development or compensation planning</li><li>Acquisition transitions and building culture</li></ul>',6,'2nd, 3rd, and 4th Year',1,NULL,NULL,NULL),(133,28,'published','HR Audit',NULL,'4098 WA ','Human Resource Planning:',33,2016,'winter/spring','<p>Over the entire semester, an <strong><u>entire class of students will research, assess, and make recommendations regarding a human resource planning issue</u></strong> that is specific to your company.  </p>','individual','2017-01-15','2017-04-15',500,NULL,'<p>The exact deliverables are dependent upon the type of information received.  In total 5 groups of students, <strong><u>spending a total of 1000 hours on your project</u></strong>, will each submit a +10 page report including a full analysis of internal and external environment, financial requirements &amp; constraints, feasible alternatives and an implementation plan, as well as, any HR Tools, as appropriate.  </p>',1,NULL,'2017-02-17 09:08:30','2017-05-11 23:06:13','<p>Over the entire semester, an <strong><u>entire class of students will research, assess, and make recommendations regarding a human resource planning issue</u></strong> that is specific to your company. </p><p></p><p><strong>This can be in any of the following areas:</strong></p><ul><li>Forecasting HR &amp; Staffing needs</li><li>Restructuring</li><li>Outsourcing</li><li>Recruitment &amp; Selection</li><li>Succession Planning</li><li>New Job Opportunities</li></ul>',1,'4th Year',1,NULL,NULL,NULL),(134,73,'published','New Hiring Selection System Design',NULL,'BU 408','Recruitment & Selection:',28,2016,'fall','<p>Is your hiring process due for a tune up with the latest and greatest HR innovations that are being taught in business school?</p>','individual','2016-09-16','2016-12-02',NULL,NULL,'<p>Student groups will submit a hiring selection system in an actionable document that explains the different processes so that you can start using it right away.</p>',4,NULL,'2017-02-17 09:15:18','2017-03-08 23:49:20','<p>Is your hiring process due for a tune up with the latest and greatest HR innovations that are being taught in business school? Over the entire semester, groups of students design a recruitment and selection system for a position that you are hiring for. Basically you give them the information and they invent a new system of recruiting and selecting that is tailored to your organization! </p>',1,'4th Year',1,NULL,NULL,NULL),(135,67,'published','Millennials in the Workplace',NULL,'','',35,2016,'fall','<p>Five groups of students will divide into the different divisions of a company (sales, operations, finance, etc) and provide a detailed professional presentation on how Millennials will impact that division</p>','group','2016-10-07','2016-11-25',NULL,NULL,'<p>Student groups will each present a <u><strong>15-minute professional presentation</strong></u>.</p>',3,NULL,'2017-02-17 16:27:19','2017-03-08 23:51:10','<p>Five groups of students will divide into the different divisions of a company (sales, operations, finance, etc) and provide a detailed professional presentation on how Millennials will impact that division. <u><strong>Groups will do extensive research and suggest how you can take advantage of this massive shift in human resources.</strong></u> </p>',5,'2nd Year',1,NULL,NULL,NULL),(136,89,'published','Training Analysis',NULL,'COM 413','Advanced Organizational Communication',NULL,2016,'winter/spring','<p>In groups of 4 or 5, student-consultants will analyze existing training materials from organizations and then <u><strong>create and develop a new training program to propose to your organization based on state-of-the-art communication and training concepts</strong></u>.</p>','group','2017-01-16','2017-03-01',NULL,NULL,'<p>After spending <u><strong>~150 hours dedicated to your organization</strong></u>, each group of student-consultants will submit:</p><ul><li><strong>Sample visual report of the newly designed training deliverable </strong></li><li><strong>Video presentation that gives better insights to the reasons behind the changes</strong></li></ul>',5,NULL,'2017-02-17 16:52:06','2017-02-17 16:54:52','<p>In groups of 4 or 5, student-consultants will analyze existing training materials from organizations and then <u><strong>create and develop a new training program to propose to your organization based on state-of-the-art communication and training concepts</strong></u>. Past examples have included, but are not limited to:</p><ul><li><strong>new hire training</strong></li><li><strong>diversity training</strong></li><li><strong>conflict management, etc.</strong></li></ul>',5,'4th Year',1,NULL,NULL,NULL),(137,59,'published','B2B Sales Management Plan',NULL,'MARK 4410','Sales Management',NULL,2016,'winter/spring','<p>A group of four to six Sales Management student consultants will conduct an analysis and provide actionable recommendations for improving or scaling up your organization&#x27;s existing sales force plan.  </p>','group','2017-01-20','2017-03-24',NULL,NULL,'<p>Students will work to develop a professional sales management plan (less than 25 pages) that could include a two<strong>-</strong>year sales plan, budgets, forecasts, recruiting plans, as well as their approach to co-ordinating with other departments such as marketing. Students will also present a 7 to 10-minute summary of their plan which will be followed by a Q&amp;A period.</p>',6,NULL,'2017-02-17 17:07:17','2017-02-17 17:10:53','<p>A group of four to six Sales Management student consultants will conduct an analysis and provide actionable recommendations for improving or scaling up your organization&#x27;s existing sales force plan.  Potential project scopes can include, but are not limited to;</p><ul><li><strong>audit of existing sales strategy</strong></li><li><strong>how to scale up to reach your sales targets</strong></li><li><strong>workforce planning for your sales team</strong></li><li><strong>researching and identifying the right sales tools</strong></li><li><strong>developing competitive sales compensation packages, etc.</strong></li></ul>',4,'3rd Year',1,NULL,NULL,NULL),(138,22,'published','Sales Sponsorship Project',NULL,'MARK 235','Creative Selling',29,2016,'winter/spring','<p>Do you have an event coming up in Spring or Summer that requires sponsorship prizes and money? Would 15 groups of competent sales students, mentored by their instructor, help you exceed your goals?</p>','group','2017-01-09','2017-04-30',NULL,NULL,'<p>Students will submit their prospecting document, their sales planning document, and their sales aid that you will be able to use for future sales efforts. Plus, <u><strong>the actual sponsorship money or prize!</strong></u></p>',3,NULL,'2017-02-17 17:17:41','2017-04-18 00:23:42','<p>Do you have an event coming up in Spring or Summer that requires sponsorship prizes and money? Would 15 groups of competent sales students, mentored by their instructor, help you exceed your goals? <u><strong>This is a sales army</strong></u>, who not only try to achieve a sale for you, but they put together a prospecting document, planning document, and a sales aid. Students will be out in the community sometime in late March but the event can take place anytime after that until the end of Summer.   </p>',4,'3rd Year',1,NULL,NULL,NULL),(139,11,'published','Sales Consulting',NULL,'ENT 577','Entrepreneurial Selling',NULL,2016,'winter/spring','<p>Groups of student sales consultants will work with a start-up company with 10 to 25 employees that need assistance in expanding its sales execution strategies and actions.</p>','group','2017-02-10','2017-03-24',NULL,NULL,'<p>Groups will submit a <strong><u>5-7 page Executive Summary</u></strong> supported by <strong><u>detailed appendices of up to 10 pages</u></strong>.</p>',10,NULL,'2017-02-17 17:27:34','2017-03-08 23:47:18','<p>Groups of student sales consultants will work with a start-up company with 10 to 25 employees that need assistance in expanding its sales execution strategies and actions. The team will perform internal and external research to quickly understand the business, the products and services, and the competitive landscape. The goal is to deliver sales strategies and actionable sales deliverables to senior management that will enhance ways to target, contact, qualify, develop and close sales, including related follow-up activities. Potential project scopes include, but are not limited to: </p><ul><li><strong>Sales strategy planning</strong></li><li><strong>Defining your target market/market opportunity</strong></li><li><strong>Evaluating/recommending outreach strategies</strong></li><li><strong>Developing sales-worth value props and stories</strong></li><li><strong>Identifying top customer profiles</strong></li><li><strong>Sales target/goal-setting</strong></li><li><strong>How to measure/monitor your success</strong></li><li><strong>Stakeholder interviews (channel partners, suppliers, customers)</strong></li></ul>',4,'4th Year',1,NULL,NULL,NULL),(140,11,'published','Elevator Pitch',NULL,'ENT 526','Entrepreneurship Behaviour & Strategy',NULL,2016,'fall','<p>Students research your company, your industry, your competitors, your social media, and give you an elevator pitch of who they believe you are and what your value proposition is. </p>','individual','2016-10-08','2016-12-02',NULL,NULL,'<p>Students will submit a 90-second video of them pitching your company. </p>',12,NULL,'2017-02-17 17:47:21','2017-02-17 22:42:20','<p>Students research your company, your industry, your competitors, your social media, and give you an elevator pitch of who they believe you are and what your value proposition is. Find <u><strong>insights into how students perceive your messaging, while finding talent</strong></u> for potential future co-ops and internships with students that know all about you!</p><p></p><p>Looking for sales people? Watch how they pitch your company and its products/services.</p>',1,'4th Year',1,NULL,NULL,NULL),(141,74,'published','Customer Service Excellence',NULL,'BMFS 207','Consumer Behaviour:',NULL,2016,'fall','<p>A group of students will provide an <u><strong>outsider&#x27;s perspective to your current customer service</strong></u>. Through interviews and the information you provide, the student consultants will assess what you do and then <u><strong>compare it to best practices they learn in class</strong></u>, as well as to what your competitors are doing. </p>','group','2016-09-15','2016-12-01',NULL,NULL,'<p>Groups of students will submit their <u><strong>written recommendations</strong></u>, as well as <u><strong>formally present their project</strong></u> to the industry partner (in person or virtually).</p>',4,NULL,'2017-02-17 19:04:23','2017-03-08 23:49:57','<p>A group of students will provide an <u><strong>outsider&#x27;s perspective to your current customer service</strong></u>. Through interviews and the information you provide, the student consultants will assess what you do and then <u><strong>compare it to best practices they learn in class</strong></u>, as well as to what your competitors are doing.  They will then provide a base of possible recommendations on how you can improve.</p>',4,'',1,NULL,NULL,NULL),(142,14,'published','Supply Chain Management Project',NULL,'COMM 449','Supply Chain Management',NULL,2016,'winter/spring','<p>Groups of 4-5 student-consultants will work with organizations to develop a strategy for obtaining one or more supplies and/or evaluate suppliers to support the corporate strategy.</p>','individual','2017-01-16','2017-04-10',NULL,NULL,'<p>Final deliverable includes 10 page report that provides any assumptions and justification for recommendations.</p>',6,NULL,'2017-02-17 19:09:58','2017-03-08 23:43:49','<p>Groups of 4-5 student-consultants will work with organizations to develop a strategy for obtaining one or more supplies and/or evaluate suppliers to support the corporate strategy. Students will identify any supply chain challenges and recommend opportunities for improvement. Potential project scopes include, but are not limited to:</p><ul><li><strong>cleaning up and analyzing procurement data to support the projects listed below:</strong></li><li><strong>developing plans for optimizing and managing routine and critical spend items</strong></li><li><strong>evaluating the implications of sourcing from another country</strong></li><li><strong>developing total cost comparisons of supply alternatives where price is not the most significant consideration (service, quality or other factors could be more important than price)</strong></li><li><strong>proposing ways to manage suppliers to reduce costs</strong></li></ul>',1,'4th Year',1,NULL,NULL,NULL),(143,11,'published','Technology Solution Consultancy',NULL,'ITM 90','Graduation Capstone Project',NULL,2016,'winter/spring','<p>Over two semesters, a group of 4th-year student-consultants will assess your business processes in order to identify an issue or opportunity for improvement using technology.</p>','individual','2017-01-16','2017-08-15',NULL,NULL,'<p>Students provide a report with their analysis of gaps/opportunities in your organization, including recommendations to address them. They redesign the business process, propose a system solution, develop an RFP/I document, compare vendor solutions to provide a recommendation, and submit the implementation plan for their solution.</p>',15,NULL,'2017-02-17 22:45:13','2017-03-27 17:46:23','<p>Over two semesters, a group of 4th-year student-consultants will assess your business processes in order to identify an issue or opportunity for improvement using technology. They will then identify an IT solution tailored to your company after evaluating vendors (via RFP) to recommend the most appropriate solution. Finally, they will identify risks associated with implementation and the change management processes needed. Project scopes can include, but are not limited to;</p><ul><li><strong>sales/marketing gaps indicating a need for CRM solutions</strong></li><li><strong>website performance issues</strong></li><li><strong>accounts payable issues with ordering/payment </strong></li><li><strong>recruitment process hiring of employees</strong></li><li><strong>sales and order fulfillment</strong></li><li><strong>client acquisition process, etc.</strong></li></ul>',1,'4th Year ',1,NULL,NULL,NULL),(144,14,'published','Supply Chain Management Project',NULL,'COMM 449','Supply Chain Management',NULL,2016,'fall','<p>Groups of 4-5 student-consultants will work with organizations to develop a strategy for obtaining one or more supplies and/or evaluate suppliers to support the corporate strategy.</p>','group','2016-09-09','2016-12-08',NULL,NULL,'<p>Final deliverable includes 10 page report that provides any assumptions and justification for recommendations.</p>',6,NULL,'2017-02-18 17:18:07','2017-02-18 17:22:14','<p>Groups of 4-5 student-consultants will work with organizations to develop a strategy for obtaining one or more supplies and/or evaluate suppliers to support the corporate strategy. Students will identify any supply chain challenges and recommend opportunities for improvement. Potential project scopes include, but are not limited to:</p><ul><li><strong>cleaning up and analyzing procurement data to support the projects listed below:</strong></li><li><strong>developing plans for optimizing and managing routine and critical spend items</strong></li><li><strong>evaluating the implications of sourcing from another country</strong></li><li><strong>developing total cost comparisons of supply alternatives where price is not the most significant consideration (service, quality or other factors could be more important than price)</strong></li><li><strong>proposing ways to manage suppliers to reduce costs</strong></li></ul>',5,'4th Year',1,NULL,NULL,NULL),(145,87,'published','Consumer Research Consultancy',NULL,'HBA 4548 ','Consumer Insights',36,2016,'winter/spring','<p><strong>Ten</strong> groups of student-consultants, working over an entire semester, will synthesize information and data, both existing (provided by you) and collected themselves, in order to <strong><u>generate actionable consumer insights relevant to your organization</u></strong>. </p>','group','2017-01-09','2017-04-03',NULL,NULL,'<p>Each group does an <u><strong>oral presentation of ~15-20 minutes</strong></u>, which is accompanied by a <u><strong>final report</strong></u> detailing their insights, the methods used to generate the data they are based on, and the actions recommended based on the implications of those insights.</p>',1,NULL,'2017-02-18 18:02:01','2017-03-08 23:44:25','<p><strong>Ten</strong> groups of student-consultants, working over an entire semester, will synthesize information and data, both existing (provided by you) and collected themselves, in order to <strong><u>generate actionable consumer insights relevant to your organization</u></strong>. This could include:</p><ul><li><strong>understanding what triggers consumer actions in order to acquire new customers</strong></li><li><strong>understanding why consumers care about your company to increase brand loyalty</strong></li><li><strong>understanding what desires and motivations your customers have to increase retention, etc. </strong></li></ul>',4,'4th Year',1,NULL,NULL,NULL),(146,87,'published','Creative Brief & Execution',NULL,'HBA 4431','Advertising',42,2016,'winter/spring','<p>Students will consult with your organization on your advertising needs to develop a creative brief and executions for your exclusive use.</p>','group','2017-01-25','2017-04-03',NULL,NULL,'<p>Each group does an <u><strong>oral presentation (15-20 minutes)</strong></u>, which is accompanied by a <u><strong>presentation deck.</strong></u> Any additional details as determined by the industry partner and student group can also be included separately.</p>',8,NULL,'2017-02-18 18:08:28','2017-07-06 19:41:00','<p>A group of student-consultants, acting as advertising account managers, will co-draft a creative brief for your organization and will generate at least 3 creative executions with an analysis and justification for the creative choices they made. They will also outline how their messages work together to provide an integrated marketing message.</p>',5,'4th Year',1,NULL,'anywhere',NULL),(147,66,'published',' International Business Operations & Supply Chain ',NULL,'MGM 569','International Business Operations & Supply Chain Management',50,2017,'winter/spring','<p>A group of graduate-level international business students will spend the semester working on a specific operational issue that you&#x27;ve been experiencing</p>','group','2017-04-07','2017-06-16',100,NULL,'<p>Students will spend an entire semester working with your organization. At the end of which, the will <u><strong>present an 8-page document</strong></u> detailing the operational issue, the main root of the cause, and potential recommendations to solve it. The group will <u><strong>present this data to your organization in a</strong></u> <u><strong>30-minute</strong></u> <u><strong>presentation that includes Q&amp;A period for clarifications</strong></u>.</p>',4,NULL,'2017-02-19 20:04:40','2017-08-03 22:53:23','<p>A group of graduate-level international business students will spend the semester working on a specific operational issue that you&#x27;ve been experiencing. <u><strong>Students will conduct a full analysis of the operation, define the precise root causes of the problem/issues and possible recommendations</strong></u>. Past projects have included:     </p><ul><li>Inventory Control Issues</li><li>Quality Control Issues</li><li>LEAN applications and improvements</li><li>Sourcing Globally or Outsourcing Issues</li></ul>',5,'MBA ',1,NULL,'local',NULL),(148,31,'published','Management Consulting Project',NULL,'MBA S 891','MBA Management Consulting',NULL,2016,'summer','<p>One or two MBA students at the Smith School of Business at Queen&#x27;s will spend six months on a consulting challenge of your choosing.</p>','individual','2017-05-02','2017-10-31',100,NULL,'<p>Each individual student will dedicate a minimum of 100 hours to the project. Students will provide your organization with a management consulting report of 10+ pages at the conclusion of the project, detailing their research, analyses and actionable recommendations.</p>',20,NULL,'2017-02-19 21:07:14','2017-03-28 18:20:32','<p>One or two MBA students at the Smith School of Business at Queen&#x27;s will spend six months on a consulting challenge of your choosing. They will conduct research, analyse the issue, and provide recommendations to address it. Students will be mentored during the project by a project course advisor. Sample projects include:    </p><ul><li><strong>Developing a five-year growth strategy</strong></li><li><strong>Create and implement a new systematic framework </strong></li><li><strong>Investigate and recommend a product or service expansion opportunity</strong></li><li><strong>Develop financial feasibility models</strong></li><li><strong>Create marketing plans or strategies</strong></li></ul>',1,'MBA',1,NULL,NULL,NULL),(149,71,'published','Marketing Strategy Consulting',NULL,'MKTG 5200','Marketing Strategy',NULL,2016,'winter/spring','<p>Are you in need of a strategic marketing plan? Student consultants will work with a local industry partner to identify and define a significant strategic marketing problem or opportunity unique to each participating organization.</p>','individual','2017-02-28','2017-04-25',NULL,NULL,'<p>After 3<u><strong> months of work on your strategic marketing roadmap</strong></u>, the group of student-consultants will submit:</p><ol><li><strong>5,000-word consulting report </strong></li><li><strong>Optional in-person presentation</strong> </li></ol>',4,NULL,'2017-02-19 21:14:30','2017-08-16 16:14:16','<p>Are you in need of a strategic marketing plan? Student consultants will work with a local industry partner to identify and define a significant strategic marketing problem or opportunity unique to each participating organization. The student teams will carry out extensive research to prepare analysis and recommendations for how the client should proceed. </p><p></p><p>Potential <strong>scopes for this project can include</strong> but are not limited to; </p><ul><li><strong>promoting a new product/service launch,</strong></li><li><strong>increasing revenue for an existing product/service,</strong></li><li><strong>increasing market share,</strong></li><li><strong>customer acquisition/retention,</strong></li><li><strong>increasing brand awareness, and</strong></li><li><strong>meeting the needs of a specific customer segment, etc.</strong> </li></ul>',1,'MBA',1,NULL,'anywhere',NULL),(150,2,'published','Entrepreneurship Consulting Project',NULL,'ENT 4400','Applied Entrepreneurship Field Study',60,2016,'summer','<p>Groups of 4-5 <strong>student-consultants from the Schulich Master of Management program will work with your organization (on-going business, a start-up, a non-profit or community organization) on a short-term project that is important to you</strong>. </p>','group','2017-05-08','2017-07-28',NULL,NULL,'<p>There are 3 deliverables: \n1 ) <strong>Project Plan</strong>: Students will develop a Statement of Work and project plan for the semester. \n2) <strong>Status Report</strong>: Students will conduct research, update you and get your input so that they can successfully deliver their final research-based recommendations. \n3) <strong>Final Delivery</strong> of the student project as outlined and agreed to in the status report.</p>',10,NULL,'2017-02-19 21:21:06','2017-06-09 23:20:45','<p>Groups of 4-5 <strong>student-consultants from the Schulich Master of Management program will work with your organization (on-going business, a start-up, a non-profit or community organization) on a short-term project that is important to you</strong>. </p><p></p><p>The students will apply their knowledge and research to the real-world management challenge or opportunity that you put forward. This could include, but is not limited to:</p><ul><li>surveying potential customers and evaluating their market potential</li><li>developing value propositions and use cases for specific market segments</li><li>analyzing  value chain</li><li>developing a competitive matrix</li><li>validating business models</li><li>creating materials for investor presentations. </li></ul>',4,'Masters ',1,NULL,NULL,NULL),(151,10,'published','MBA International Expansion',NULL,'BUS 710','Managing Global Enterprises',49,2016,'winter/spring','<p>A group of MBA students will work with your organization to assess whether your organization should increase business, expand operations or acquire assets in another country.</p>','group','2017-03-16','2017-04-30',20,NULL,'<p>Students will provide a report of up to 20 pages evaluating the foreign direct investment opportunity and providing a recommendation as to whether it is a good opportunity for your company.</p>',10,NULL,'2017-02-19 21:35:14','2017-04-06 20:35:26','<p>A group of MBA students will work with your organization to assess whether your organization should increase business, expand operations or acquire assets in another country.  Students will conduct research and analysis to select a country, assess risk, and recommend whether you should make an investment there. </p><p></p><p><strong>Past examples have included:</strong></p><ul><li>Evaluating and recommending suppliers and channel partners in another country</li><li>Evaluating whether you should open a location in another country</li><li>Evaluating whether you should market your product/services in another country</li><li>Evaluating whether you should expand to another country (ie China or India)</li></ul>',4,'Graudate',1,NULL,'local',NULL),(152,59,'published','Strategic Marketing Plan',NULL,'MARK 4483','Marketing Practicum',NULL,2016,'summer','<p>A group of 2-4 student-consultants will prepare a strategic marketing plan (researching, analyzing, and providing actionable recommendations) addressing a marketing challenge / opportunity your organization faces</p>','group','2017-05-16','2017-08-08',NULL,NULL,'<p>After defining the scope of the project (options above), the students will create a <u><strong>+10-page document outlining your strategic marketing plan</strong></u>, which will be accompanied by <u><strong>samples of marketing materials that you can implement immediately</strong></u>. </p>',1,NULL,'2017-02-19 21:44:24','2017-03-30 21:50:46','<p>A group of 2-4 student-consultants will prepare a strategic marketing plan (researching, analyzing, and providing actionable recommendations) addressing a marketing challenge / opportunity your organization faces.  They will conduct research, analyze the issue, and provide actionable recommendations. Project scopes can include, but are not limited to: </p><ul><li><strong>Company Marketing Plan</strong></li><li><strong>New Product Marketing Plan</strong></li><li><strong>Event Marketing Plan</strong></li><li><strong>Digital Marketing Strategy</strong></li><li><strong>Feasibility Study</strong></li><li><strong>Market Segmentation </strong></li><li><strong>Marketing Audit &amp; Recommendations</strong></li><li><strong>Market Intelligence Studies</strong></li><li><strong>Online Opportunities &amp; Content</strong></li><li><strong>Market Research Study</strong></li><li><strong>Branding </strong></li></ul><p>These students are part of a course called &#x27;Marketing Practicum&#x27;, where they have the opportunity to apply the knowledge they learned over their marketing education to a real business situation. Over 200 projects have been done under the banner of this course, and many firms have benefited from the directed study of senior students and the marketing consultancy provided.</p><p></p>',3,'2nd year of a 2 year program',1,NULL,NULL,NULL),(153,98,'published','Big Data Business Analytics',NULL,'IS 5325','Capstone for Business Analytics',NULL,2016,'winter/spring','<p>Working in groups, graduate students in the Business Analytics program will carry out an analytics project from initial requirements analysis to final implementation by analyzing big data using machine learning algorithms and/or statistical models.</p>','group','2017-06-20','2017-09-06',NULL,NULL,'<p>Students will conduct an identification of problems, data sets, data pre-processing, building data mining/statistical models, and validation. They will provide a formal presentation of results at the end of the quarter and provide a 15+ page document along with their presentation slides.</p>',4,NULL,'2017-02-19 22:06:23','2017-08-03 23:12:03','<p>Working in groups, graduate students in the Business Analytics program will carry out an analytics project from initial requirements analysis to final implementation by analyzing big data using machine learning algorithms and/or statistical models. </p><p></p><p><strong>Past project examples include:</strong></p><ul><li>Data analysis with Alaskan Airlines </li><li>Data analysis of King County (WA) real estate transactions</li><li>Home loan analysis using Freddie Mac data</li><li>Marketing analysis for Hawkeye Channel</li><li>Salary analysis for Payscale</li></ul>',4,'Graduate',1,NULL,'anywhere',NULL),(154,117,'published','Data Mining and Analytics ',NULL,'Computing 30072','Computing Practice and Theory',40,2016,'summer','<p>Working in groups, students will mine data and apply statistical analysis to a business problem you are facing, with an emphasis on marketing. They will use tools such as R, Excel, Python and Tableau. </p>','group','2017-04-17','2017-06-16',NULL,NULL,'<p>Students will provide a 1-3 page document summarizing their findings and analysis. They will also deliver their results as a presentation (virtual or in person).</p>',5,NULL,'2017-02-19 22:28:55','2017-06-21 19:58:45','<p>Working in groups, students will mine data and apply statistical analysis to a business problem you are facing, with an emphasis on marketing. They will use tools such as R, Excel, Python and Tableau. </p><p></p><p><strong>Project examples include, but are not limited to:</strong></p><ul><li>Mining social media sites to identify key demographics for marketing campaigns </li><li>Analyzing your own customer data to create a profile of the highest-value customers</li><li>Creating a web page to gather information on consumer behavior for analysis</li><li>Creating data visualizations from available market research, sales or customer data</li></ul>',5,'3rd & 4th Year',1,NULL,NULL,NULL),(155,89,'published','Marketing Consultancy',NULL,'BUS 454','Marketing Projects',NULL,2016,'winter/spring','<p>A group of students acting as outside consultants for your organization work closely with you to identify an issue or challenge you are facing, with a marketing or market research focus.</p>','group','2017-04-03','2017-06-30',NULL,NULL,'<p>Students deliver a presentation of their results at the end of the quarter. They also provide a ten page report detailing their findings, analyses and recommendations. \n</p><p>Students&#x27; tactical recommendations will include advertising and social media strategies, messaging, pricing, and distribution strategies.</p>',4,NULL,'2017-02-19 22:40:32','2017-08-03 22:55:28','<p>A group of students acting as outside consultants for your organization work closely with you to identify an issue or challenge you are facing, with a marketing or market research focus. Students will research and analyze the issue, and develop strategies and recommendations that you could implement to address it. </p><p></p><p><strong>Project examples include, but are not limited to:</strong></p><ul><li>Conducting industry analysis to identify new target markets, messaging, and communication strategies</li><li>Using customer analysis to develop a new social media campaign</li><li>Planning of a promotional event for the college-aged market, based on trend analysis</li><li>Doing competitive analysis of the industry in the development of a comprehensive marketing plan for a startup</li><li>Conducting focus groups and interviews to develop communication strategies for non-profits</li></ul>',1,'4th Year',1,NULL,NULL,NULL),(156,118,'published','Document Creation',NULL,'GRPH 355','Advanced Document Design',NULL,2016,'winter/spring','<p>A small group of third-year students will work on designing a complex document for your company, such as a book, magazine, annual report or training manual.</p>','group','2017-03-20','2017-05-31',NULL,NULL,'<p>1-3 page document</p>',1,NULL,'2017-02-19 22:49:01','2017-04-10 18:36:15','<p>A small group of third-year students will work on designing a complex document for your company, such as a book, magazine, annual report or training manual.</p><p></p><p><strong>Project examples include, but are not limited to: </strong></p><ul><li>Designing a catalogue for a flower shop, including photos and descriptions </li><li>Designing a template for an annual report for a large corporation </li><li>Creating the layout for a business textbook</li></ul>',3,'3rd Year',1,NULL,NULL,NULL),(157,67,'published','Project Management',NULL,'MGMT 4035','Project Management',NULL,2016,'summer','<p>You would like to get something done over a 3-month period starting in May and ending in August (flexible), and you need a project manager to help you do it</p>','individual','2017-05-05','2017-08-25',80,NULL,'<p>Each student project manager will <u><strong>devote at least 80 hours to your project</strong></u>, specifically the student will:</p><ul><li>Create a Project Charter</li><li>Create a Project Plan, including a Project Budget</li><li>Prepare Status Reports</li><li>Set up Project Management Tools to increase Virtual Collaboration effectiveness</li></ul>',18,NULL,'2017-02-19 22:57:32','2017-03-28 18:22:00','<p>You would like to get something done over a 3-month period starting in May and ending in August (flexible), and you need a project manager to help you do it. </p><p></p><p><strong>Successful projects in the past have included</strong>:</p><ul><li>Improve the volume and quality of a database, and how it&#x27;s used</li><li>Social Media Marketing Campaign with content plan for a year</li><li>A new product launch</li><li>Creating an annual event or attending an upcoming one (tradeshows, conferences) </li><li>Stakeholder mapping </li><li>Development of a new website</li></ul>',1,'4th Year',1,NULL,NULL,NULL),(158,119,'published','Strategy Consulting Practicum',NULL,'BUS 6025','Masters of Social & Sustainable Management',543,2016,'winter/spring','<p>A team of graduate students will work with your social enterprise to develop a project for a practicum. Students will work on strategies and recommendations around a business problem, challenge or opportunity of your choosing. </p>','group','2017-04-02','2017-05-31',100,NULL,'<p>Students will provide a 10+ page report detailing their analyses, strategy and actionable recommendations and deliver a presentation to your senior leadership.</p>',5,NULL,'2017-02-19 23:23:14','2017-06-05 22:53:56','<p>A team of graduate students will work with your social enterprise to develop a project for a practicum. Students will work on strategies and recommendations around a business problem, challenge or opportunity of your choosing. </p><p></p><p><strong>Project examples include, but are not limited to:</strong></p><ul><li>Developing a branding strategy</li><li>Examining the viability of a new line of business</li><li>Developing a new income stream for a social enterprise</li><li>Designing an informational portal for doctors in developing countries</li><li>Putting together a talent development plan for human resources</li><li>Creating a marketing plan</li></ul>',5,'Graduate',1,NULL,'local',NULL),(160,124,'review','Consulting Project',NULL,'BUS 585','Business Consulting',30,2017,'winter/spring','<p>One or two MBA students at the Gastown School of Business will spend six months on a consulting challenge of your choosing. </p>','individual','2017-02-15','2017-04-18',150,NULL,'<p>Each individual student will dedicate a minimum of 100 hours to the project. Students will provide your organization with a management consulting report of 10+ pages at the conclusion of the project, detailing their research, analyses and actionable recommendations.</p>',10,NULL,'2017-02-21 23:35:01','2017-03-27 14:51:54','<p>One or two MBA students at the Smith School of Business at Queen&#x27;s will spend six months on a consulting challenge of your choosing. They will conduct research, analyse the issue, and provide recommendations to address it. Students will be mentored during the project by a project course advisor. Sample projects include:</p><ul><li><strong>Developing a five-year growth strategy</strong></li><li><strong>Create and implement a new systematic framework </strong></li><li><strong>Investigate and recommend a product or service expansion opportunity</strong></li><li><strong>Develop financial feasibility models</strong></li><li><strong>Create marketing plans or strategies</strong></li></ul>',1,'MBA',0,NULL,'local',NULL),(161,124,'published','New Product/Service Marketing Plan',NULL,'MKTG 301','Intro to Marketing',80,2017,'summer','<p>A group of students will put together a marketing strategy for a new product or service you are launching, with an emphasis on digital marketing, SEO and social media.</p>','group','2017-08-01','2017-12-16',400,NULL,'<p>Students will provide a 10+ page document outlining their recommendations, and deliver a short presentation virtually or in-person.</p>',10,NULL,'2017-02-21 23:36:20','2017-08-25 17:20:13','<p>A group of students will put together a marketing strategy for a new product or service you are launching, with an emphasis on digital marketing, SEO and social media. </p><ul><li>Marketing plan for new product launch for a retail store</li><li>Strategy to differentiate a new lower-priced product from main offering</li></ul><p></p>',4,'3rd year',0,NULL,'local',NULL),(162,124,'review','International Business',NULL,'INB 234','International Business Strategy',50,2016,'summer','<p>A group of graduate-level international business students will spend the semester working on a specific operational issue that you&#x27;ve been experiencing. </p>','group','2017-03-06','2017-08-16',200,NULL,'<p>Students will spend an entire semester working with your organization. At the end of which, the will <u><strong>present an 8-page document</strong></u> detailing the operational issue, the main root of the cause, and potential recommendations to solve it. The group will <u><strong>present this data to your organization in a</strong></u> <u><strong>30-minute</strong></u> <u><strong>presentation that includes Q&amp;A period for clarifications</strong></u>.</p>',20,NULL,'2017-02-21 23:40:30','2017-03-07 01:08:50','<p>A group of graduate-level international business students will spend the semester working on a specific operational issue that you&#x27;ve been experiencing. <u><strong>Students will conduct a full analysis of the operation, define the precise root causes of the problem/issues and possible recommendations</strong></u>. Past projects have included: </p><ul><li>Inventory Control Issues</li><li>Quality Control Issues</li><li>LEAN applications and improvements</li><li>Sourcing Globally or Outsourcing Issues</li></ul>',4,'4th year',1,NULL,NULL,NULL),(164,67,'published','Project Management','Business','MGMT 3011','Real Life Project Management',50,2016,'summer','<p>Do you have a project that needs to be coordinated between May-August 2017? A George Brown project management student can manage this for you!</p>','individual','2017-05-01','2017-08-31',100,NULL,'<p> Each student project manager will <u><strong>devote at least 100 hours to your project</strong></u>, specifically the student will:</p><ul><li>Create a Project Charter</li><li>Create a Project Plan, including a Project Budget</li><li>Prepare Status Reports</li><li>Set up Project Management Tools to increase Virtual Collaboration effectiveness</li></ul>',6,NULL,'2017-02-23 22:06:20','2017-06-05 22:39:19','<p>1-2 George Brown Project Management students will spend the May-August period doing at least 100 hours of project management work on a project of your choosing. This includes project planning and preparation, and coordinating work effort.</p><p></p><p> <strong>Successful projects in the past have included</strong>:</p><ul><li>Improve the volume and quality of a database, and how it&#x27;s used</li><li>Social Media Marketing Campaign with content plan for a year</li><li>A new product launch</li><li>Creating an annual event or attending an upcoming one (tradeshows, conferences) </li><li>Stakeholder mapping</li><li>Development of a new website</li></ul><p></p>',1,'3rd year',1,NULL,NULL,NULL),(165,11,'published','Category Review',NULL,'RMG 806','Retail Perspectives on Category Management',50,2016,'winter/spring','<p>A group of student-consultants, <u><strong>specialized in category management, will be responsible for conducting a comprehensive review and data analysis of a category of your choice</strong></u>. </p>','group','2017-02-01','2017-04-30',100,NULL,'<p>Each group will submit unbiased findings of the data analysis and strategic recommendations to the buyer in the forms of:</p><ul><li><strong>Category Review - </strong>a 4-10 page report</li><li><strong>Category Analysis - </strong>an excel file with the data analyzed</li><li><strong>Company Presentation - </strong>a 30-minute presentation of the findings with Q&amp;A time</li></ul>',10,NULL,'2017-02-23 22:59:20','2017-03-31 19:59:16','<p> Each group of student-consultants, <u><strong>specialized in category management, will be responsible for conducting a comprehensive review and data analysis of a category of your choice</strong></u>. The category review includes an analysis of the category, subcategories, brands, and/or items based on consumer, market, retailer and supplier perspectives. Final reports will generate insights, identify opportunities and provide actionable recommendations linked to insights in the following areas:</p><ul><li><strong>Category growth or decline</strong></li><li><strong>Category Size</strong></li><li><strong>Competitive Intensity</strong></li><li><strong>Products at risk of being delisted</strong></li><li><strong>Market trends affecting category</strong></li><li><strong>Category demand/capacity</strong></li></ul>',5,'Graduate',1,NULL,NULL,NULL),(166,63,'draft','Northeastern Level Data Analytics Bootcamp Capstone Projects',NULL,'LEVEL','Data Analytics',51,2016,'Summer','<p>Individual student consultants spend approximately 5-6 weeks working with your company to thoroughly analyze data sets using a variety of analysis methods according to your needs. </p>','individual','2017-04-27','2017-07-28',40,NULL,'<p>Students will complete the data analysis and present their findings in final a presentation (virtual or in-person.) They will clearly identify the challenges the organization is facing relevant to the data, uncover the root cause of the identified challenges, propose viable solution(s), and recommend the best course of action as well as justify the position through metrics. Students will also provide tangible copies of their work as it pertains to their individual project. All proprietary company information remains confidential at all times per an NDA.</p>',45,NULL,'2017-02-24 00:46:53','2017-05-04 17:53:05','<p>Students are locations in Boston (MA), San Francisco Bay Area (CA), Charlotte (NC), Seattle (WA), Toronto (CAN) and projects can be executed remotely or in-person. </p><p></p><p>The next few project kick offs are 4/27, 5/25, 6/14, 6/22.</p><p></p><p>Individual student consultants spend approximately 5-6 weeks working with your company to thoroughly analyze data sets using a variety of analysis methods according to your needs. The results can provide in-depth insights into the operations of your business, a detailed perspective of your customers, and solutions to complex problems. Students are trained in and can leverage industry standards for analysis using SQL, Excel, R, PPT, and Tableau.  Project content is flexible and meant to move your data problems forward. </p><p></p><p><strong>Projects can include, but are not limited to;</strong></p><ul><li>analyzing e-commerce data to understand buyers and buying habits across several selling platforms,</li><li>understanding profitability, retention, referrals, and attrition rates for your customers,</li><li>creating comprehensive dashboards to enhance your data visualization for customers, teams, and executives,</li><li>optimizing product design based on data results,</li><li>determining which internal investments make the most sense over time,</li><li>and designing lead scoring systems to understand opportunities worth pursuing and developing predictive sales model, etc.</li></ul>',1,'Graduate',0,NULL,'anywhere',NULL),(167,11,'published','Case Study',NULL,'ENT 500','New Venture Startup',100,2016,'winter/spring','<p> Live case 1: Marketing Strategy, Social Media Strategy &amp; Competitive Strategy </p>','individual','2017-02-01','2017-03-31',20,NULL,'<p> Each group will submit a detailed report with actionable recommendations that i can implement. </p>',1,NULL,'2017-02-24 19:33:02','2017-03-08 23:59:36','<p> Live case 1: Marketing Strategy, Social Media Strategy &amp; Competitive Strategy </p>',1,'4th year',1,NULL,NULL,NULL),(168,127,'published','Web/Mobile App Development','IT','IT 355','Agile Development Methods',24,2016,'fall','<p>A team of senior Information Technology students will design and build a data-driven app for your organization. </p>','group','2017-09-25','2017-12-15',120,NULL,'<p>Students will present you with their work every two weeks for review and feedback during the fall quarter (mid-September through mid-December). They&#x27;ll provide you with their completed app by the end of this period.</p>',6,NULL,'2017-02-24 22:25:54','2017-08-01 21:45:19','<p>Using Agile (Scrum) project management methodologies, students will integrate client and server-side technologies in this project.</p><p></p><p>Past projects have included the websites below:</p><ul><li>The Kent Food Bank (<u>kentfoodbank.org</u>) includes an online application form, and administrative tools that allow the site owner to update hours and the &quot;top 10&quot; needs list.</li><li>The Aviation website (<u>aviation.greenrivertech.net</u>) allows students to practice their aviation vocabulary.</li><li>The ESOL website (<u>esol.greenrivertech.net</u>) allows students to create and review flashcards, and lets instructors provide feedback.</li><li>ITConnect (<u>itconnect.greenrivertech.net</u>) is a website that allows an admin to post IT internships, and lets students view them.</li><li>Emotions Count (<u>emotions-count.greenrivertech.net</u>) allows elementary school students to check in regarding their emotional health, so that teachers and advisors can be alerted if there&#x27;s a concern.</li></ul>',4,'4th Year',0,NULL,'anywhere',NULL),(169,90,'published','Building an Interactive Web Site',NULL,'CMPT 241','Web Programming',24,2016,'fall','<p>Students will work in small groups to build a multi-page website for your company, using HTML, CSS, PHP and JavaScript.</p>','group','2017-03-31','2017-05-12',100,NULL,'<p>Students are asked to deliver a proposal on their site at the midpoint of the project, and will submit a sitemap and layout design for each page they are going to build. At the end of the semester, each group will present their site to the class and provide the source code to the company.</p>',5,NULL,'2017-02-27 18:11:11','2017-05-11 23:08:48','<p>Students will work in small groups to build a multi-page website for your company, using HTML, CSS, PHP and JavaScript. The website should involve server-side communication, whether storing information submitted on the website in a database, or sending information from a database/file to the website.   </p><p></p><p><strong>Project examples include, but are not limited to:</strong></p><ul><li>Online interactive gaming site</li><li>Online shopping site with user login/sign up and checkout</li><li>Website for a car rental business</li><li>Website for hotels/restaurants with reservation </li><li>A simplified Yelp that searches restaurants in a given area with built-in maps that allows users to leave reviews</li></ul><p></p>',3,'3rd Year',1,NULL,'anywhere',NULL),(170,105,'published','Online Brand Citizenship Campaign',NULL,'SIG 5410','Technologies for Design Change',24,2016,'winter/spring','<p>Your organization is looking to <u><strong>increase its community engagement by motivating your audiences online to participate in a campaign for social or environmental good that is important to you</strong></u>. </p>','individual','2017-01-15','2017-02-28',0,NULL,'<p>The group of student-consultants will <u><strong>spend over a month designing a campaign tailored to your specifications</strong></u>. At the end of which, they will present their findings to you, which will be accompanied by a design brief with all of the potential collateral. Industry partners are free to engage students (or their ideas) after the class has ended, but are under no obligation to do so.</p>',1,NULL,'2017-02-28 00:03:00','2017-03-08 23:48:13','<p>Your organization is looking to <u><strong>increase its community engagement by motivating your audiences online to participate in a campaign for social or environmental good that is important to you</strong></u>. A group of student-consultants will design potential interactions and calls to action that don&#x27;t just involve &quot;buying something&quot; that you could use to generate awareness about the social change you want to see. An example of this would be REIs &quot;<u>opt outside</u>&quot; or General Assembly&#x27;s &quot;<u>pledge for the future</u>&quot;. Mainly Social Media tactics will be used, however real-life touch points are welcomed.</p>',1,'4th Year',1,NULL,NULL,NULL),(171,136,'published','Data Analysis',NULL,'Stat 2120 ','Statistics ',32,2016,'winter/spring','<p>Up to two groups of student-consultants, <u><strong>spending +24 hours each, will analyze your data and provide actionable results.</strong></u> T</p>','group','2017-01-20','2017-04-21',40,NULL,'<p>Each group of student-consultants will produce a <u><strong>2-page brief</strong></u>, which culminates with the actionable results of their analyses. The report is accompanied by a <u><strong>20-minute presentation</strong></u>. </p>',1,NULL,'2017-02-28 00:33:39','2017-03-08 23:41:41','<p>Up to two groups of student-consultants, <u><strong>spending +24 hours each, will analyze your data and provide actionable results.</strong></u> These results can provide in-depth insights into the operations of your business, a detailed perspective of your customers, and solutions to complex problems. </p><p></p><p><strong>Past projects have included, but are not limited to: </strong></p><ul><li>understanding profitability, retention, referrals, and attrition rates for your customers</li><li>failure analysis to improve efficiencies</li><li>Project and process use evaluation </li></ul>',3,'3rd Year',1,NULL,NULL,NULL),(172,126,'published','Consulting Project','Communications','BUSN 179','Effective Business Communication',16,2017,'winter/spring','<p>A group of 4-5 student consultants will assist a local business by addressing a real-life<u><strong> business problem of the owner&#x27;s choosing</strong></u>. </p><p></p><p></p>','group','2017-04-03','2017-06-08',25,NULL,'<ul><li>15 minute live, in-class presentation to company representative</li><li>8 page Final Report with recommendations</li></ul>',6,NULL,'2017-02-28 02:41:27','2017-03-30 21:55:36','<p>A group of 4-5 student consultants will assist a local  business by addressing a real-life<u><strong> business problem of the owner&#x27;s choosing</strong></u>.  Examples include, but are not limited to: </p><ul><li><strong>How to reach a specific target market </strong></li><li><strong>Increasing revenue for a product/service </strong></li><li><strong>Identifying potential partnerships    </strong></li><li><strong>Identifying and cutting unnecessary costs</strong></li><li><strong>Identifying technology to adopt</strong></li><li><strong>Reducing employee turnover </strong></li></ul>',4,'3rd/4th year',1,NULL,NULL,NULL),(173,124,'published','SEO Analysis',NULL,'MKTG 201','Intro to Digital Marketing',50,2016,'summer','<p>Analyse a company&#x27;s website and provide recommendations to improve its ranking in major search engines.</p>','group','2017-09-06','2017-12-13',20,NULL,'<p>5 page report and short presentation</p>',5,NULL,'2017-02-28 05:37:45','2017-06-05 23:20:20','<p>Analyze a company&#x27;s website and provide recommendations to improve its ranking in major search engines. </p>',3,'2nd year',0,NULL,'anywhere',NULL),(174,63,'draft','Data Analytics Bootcamp Capstone',NULL,'BOSHYBCORE','Level Data Analytics',24,2016,'other','<p>Individual student consultants spend approximately 5-6 weeks working with your company to thoroughly analyze data sets using a variety of analysis methods.</p>','individual','2017-04-04','2017-08-31',50,NULL,'<p>Students will complete the data analysis and present their findings in final a presentation (virtual or in-person). They will clearly identify the challenges the organization is facing, uncover the root cause of the identified challenges, propose viable solution(s), and recommend the best course of action as well as justify the position through metrics. Students will also provide tangible copies of their work as it pertains to their individual project. All proprietary company information remains confidential at all times.</p>',20,NULL,'2017-02-28 17:12:20','2017-05-04 17:51:15','<p>This cohort is now full, but registration is still open for 2017 here: https://riipen.io/assignments/166/details</p><p></p><p>Individual student consultants spend approximately 5-6 weeks working with your company to thoroughly analyze data sets using a variety of analysis methods. The results can provide in-depth insights into the operations of your business, a detailed perspective of your customers, and solutions to complex problems. Students are trained in and can leverage industry standards for analysis using <strong>SQL, Excel, R, PPT, and Tableau</strong>.  Project content is flexible and meant to move your data problems forward.</p><p></p><p>There are multiple Level Data Analytics bootcamps running at different times in the year in Boston, Silicon Valley, Toronto, and Charlotte. </p><p></p><p><strong>Projects can include, but are not limited to;</strong></p><ul><li>analyzing e-commerce data to understand buyers and buying habits across several selling platforms,</li><li>identifying KPIs and gaining better insights from Google Analytics,</li><li>understanding profitability, retention, referrals, and attrition rates for your customers,</li><li>creating comprehensive dashboards to enhance your data visualization for customers, teams, and executives,</li><li>optimizing product design based on data results,</li><li>determining which internal investments make the most sense over time,</li><li>writing scripts for data queries to provide quick and easy access to business insights, and</li><li>designing lead scoring systems to understand opportunities worth pursuing and developing predictive sales model, etc</li></ul>',1,'Graduate',1,NULL,'anywhere',NULL),(175,128,'draft','Final Project for Hardware/Software Codesign',NULL,'CECS461/CECS561','Hardware/Software Codesign',25,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-02-28 17:20:40','2017-02-28 17:20:41',NULL,NULL,'senior and graduate',0,NULL,NULL,NULL),(176,143,'published','Search Engine in The Wild',NULL,'CSc 849','Search Engines',15,2017,'winter/spring','<p>Collaborate with SFSU students and develop a robust, open-source search engine for your organization website!</p>','group','2017-03-27','2017-05-08',25,NULL,'<ul><li>A report describing the complete project life-cycle.</li><li>A class presentation with demo, if possible.</li></ul>',1,NULL,'2017-03-02 01:19:27','2017-04-12 20:15:45','<p>Over the course of Summer, SFSU students will deploy, test, and tune the search engine installation on your organization&#x27;s internal or external website. This will provide search functionality for your organization&#x27;s textual data! Improve your SEO and help your users get better search results. </p><p></p><p>The top 5 search engine results are most likely to be chosen by users - take advantage of consumer habits and help guide them to what you want to talk about. </p><p></p><p>Some benefits to increasing your organization&#x27;s textual data include:</p><ul><li>Increased traffic to your website</li><li>Increased site usability</li><li>Better brand awareness</li><li>Creating a more cost-effective environment to help get users to the content they&#x27;re searching for</li></ul>',2,'Masters in Science',1,NULL,'local',NULL),(177,98,'published','Strategy Consulting',NULL,'BRMB 5270','Business Strategy',27,2016,'summer','<p>Students will evaluate how an organization provides unique value and its business strategy using Porter&#x27;s Five Forces model. Students will have to identify possible barriers to the strategy changes they are recommending.</p>','group','2017-06-28','2017-08-08',25,NULL,'<ul><li>A 25 page strategy and change capacity evaluation</li><li>A 45 minute presentation of results and recommendations</li></ul>',5,NULL,'2017-03-02 13:33:44','2017-08-03 22:49:05','<p>A group of 6 student consultants will work with an organization to determine its unique value and come up with a compelling and actionable business strategy. Students will identify barriers and risks to strategy changes they are recommending.</p><p></p><ul><li>Examine what the organization produces and why clients value it</li><li>Assess opportunities to open new markets or better served an existing market</li><li>Evaluate organization capabilities to execute a strategy change</li><li>Work with client to develop an action plan to implement proposed changes</li></ul>',6,'Bridge MBA',1,NULL,'local',NULL),(179,74,'published','Organization Project Plan','Business','BUS 5003','Project Management',50,2017,'summer','<p>A group of student-consultants will develop a thorough Project Management Plan for a project of your choosing. </p>','group','2017-05-01','2017-08-31',80,NULL,'<p>The student group will submit a <u><strong>written project plan</strong></u>, as well as <u><strong>formally present their project</strong></u> to the industry partner (in person or virtually). </p>',10,NULL,'2017-03-03 00:04:51','2017-06-05 22:57:03','<p>A group of student-consultants will develop a thorough Project Management Plan for a project of your choosing.   Using Project Management Theory, students will put together a thorough breakdown of a future project for your organization, including project requirements, schedule and responsibilities.  </p><p></p><p>Examples of projects have included, but are not limited to:</p><ul><li><strong>Development of a new website</strong></li><li><strong>Implementation of a new software or system</strong></li><li><strong>Business process change</strong></li><li><strong>Office relocation</strong></li><li><strong>Rebranding project or implementation of new logo</strong></li><li><strong>New product/service launch </strong></li><li><strong>Evaluation of new technology or suppliers</strong></li></ul>',6,'Graduate certificate program',1,NULL,'local',NULL),(180,154,'published','Conflict Prevention Plan',NULL,'COM 1110','Interpersonal Communication',21,2016,'winter/spring','<p>Students will help to identify, explain and recommend solutions to address workplace conflicts. </p>','group','2017-04-26','2017-05-10',3,NULL,'<p><strong>Students will deliver a 10-12 minute presentation including 3 parts:</strong></p><ul><li>Analysis of the background for the conflict (parties involved, the reason the conflict occurred)</li><li>Discuss the parties involved, each of their conflict styles and conflict management strategies, &amp; </li><li>Present possible solutions based on multiple conflict styles.</li></ul>',4,NULL,'2017-03-06 05:50:54','2017-06-05 22:58:18','<p>In groups of 4, student-consultants will work for 12+ hours with your organization to provide resolutions for potential/current conflict scenarios. This could involve opportunities to actively prevent conflict from arising in your organization. </p><p></p><p>Students will analyze the background of the conflict and put together a presentation to explain the roots of the issue and recommend multiple strategies to address it (i.e. a collaborating solution, a competing solution, a compromising solution). </p><p></p><p>Examples could include, but are not limited to:</p><ul><li>Increasing open communication patterns inside your organization</li><li>Instigating a plan to optimize diversity </li><li>Interpersonal conflicts between staff</li><li>A clash in management styles between two managers who need to work together</li><li>A dispute about the best usage of budget resources</li></ul>',4,'1st-4th year',1,NULL,'local',NULL),(181,156,'published','Consulting Project','Business','BUA 449','Strategic Management',100,2017,'winter/spring','<p>Your firm has a complex challenge that it would like outside research and consultation on to provide a different perspective. </p>','group','2017-02-01','2017-05-31',100,NULL,'<p>A group of 4 student-consultants, in their final year of their business degree, will work for <u><strong>3 months on your strategic problem / opportunity!</strong></u> At the end of which they will submit a <u><strong>strategic plan that is accompanied by a 15-minute presentation</strong></u>. </p>',10,NULL,'2017-03-06 19:46:54','2017-03-06 19:55:54','<p> <u><strong>Your firm has a complex challenge that it would like outside research and consultation on to provide a different perspective</strong></u>.  This could include:</p><ul><li>a B2B company wanting to know how to leverage social media both internally and externally to increase value</li><li>how can your company leverage new technologies and information to create efficiencies or new revenue streams</li><li>how can your company attract and retain next generation talent, which is increasingly in high demand</li><li>or anything else related to your business,<strong><u> as long as it is complex and multifaceted</u></strong>.</li></ul>',4,'4th year',1,NULL,NULL,NULL),(182,20,'published','Technology Consulting: High-Tech Professional Program ',NULL,'BCIT','High-Tech Professional Program ',40,2016,'winter/spring','<p>A group of student technology consultants will come to your place of business and help you work through a specific technology challenge or help you take advantage of existing/new technology available to achieve your goals.</p>','group','2017-03-22','2017-05-30',200,NULL,'<p>Final report with a list of all work that was done and any changes that were made, including an instructions manual for how to use technology in the future.</p>',6,NULL,'2017-03-06 22:37:11','2017-04-06 20:34:11','<p>A group of student technology consultants will come to your place of business and help you work through a specific technology challenge or help you take advantage of existing/new technology available to achieve your goals. Some potential project scopes can include, but are not limited to:</p><ul><li>Troubleshooting your existing technology (CRM software, email clients, wireless networking, printer, etc)</li><li>Writing operation and best practice manuals for using your technology</li><li>Exploring the full potential of your technology</li><li>Identifying and implementing new technology</li><li>Technology integration</li><li>Network setup/connecting wireless devices</li></ul><p>Examples of technology questions you might have include:</p><ul><li>Can I get my email/CRM to do this?</li><li>I keep getting this error, why?</li><li>Can I connect these two devices to do this?</li><li>How do I integrate these two tools so that I can do this?</li><li>Can you fix these problems that I am having with this technology?</li><li>Is there some sort of technology out there that can do this?</li></ul>',1,'3rd year',1,NULL,NULL,NULL),(183,159,'published','PHP/MySQL Web Application Development',NULL,'IT031','Data-driven Web Application Development',15,2017,'fall','<p>Students will use PHP to build a functioning web application for your business.</p>','group','2017-09-05','2017-12-05',40,NULL,'<p>The deliverable is the functioning web site and a presentation.</p>',4,NULL,'2017-03-07 18:00:15','2017-08-18 22:47:43','<p>Students can build a functional web application for your business, which requires data entry, saving to a database, and retrieving data from a MySQL database. Students may use add-ins like Google Maps for extra functionality.</p><p></p><p>Possible projects include, but are not limited to:</p><ul><li>Designing a web-based survey that collects and saves data, displaying results in a graphical way</li><li>Membership pages where users can sign up and their data is saved to a membership database</li><li>Creating a simple ecommerce page</li></ul><p></p>',4,'Mixed',0,NULL,'anywhere',NULL),(184,124,'draft','a',NULL,'a','a',1,2016,'fall','<p>adfsdasfd</p>','individual','2017-03-08','2017-03-08',22,NULL,NULL,1,NULL,'2017-03-08 16:14:55','2017-03-08 16:15:16','<p>afdsdsf</p>',1,'1',0,NULL,NULL,'2017-07-10 20:33:12'),(185,167,'draft','test',NULL,'tes','tes',1,2016,'fall','<p>test</p>','individual','2017-03-08','2017-03-08',2,NULL,'<p>test</p>',1,NULL,'2017-03-08 19:23:47','2017-03-08 19:24:22','<p>test</p>',1,'3rd year',0,NULL,'local','2017-08-28 23:54:34'),(188,170,'published','Big Data and Cloud Based Application Development',NULL,'ISM 6930','Big Data for Business Applications',50,2016,'fall','<p>Take your software to the next level with big data and cloud-based application development.</p>','group','2017-09-01','2017-12-01',80,NULL,'<ul><li>Youtube submission of project</li><li>Code uploaded to GitHub </li></ul>',1,NULL,'2017-03-09 17:14:34','2017-08-29 16:13:57','<p>In groups of 5-6, masters students will spend 80+ hours each dedicated to creating the infrastructure for your organization&#x27;s e-commerce website. When the back-end of your website is logically designed this promotes efficient workflow for your internal and external development team. It also positively trickles down to the general user experience of the site.  </p><p></p><p>Some example projects include, but are not limited to:</p><ul><li>Designing/constructing an optimized search tool to categorize information at large-scale</li><li>Creating an information system for cloud-based storage within an online retail store</li><li>Bringing a library catalogue online</li></ul><p>Topics for this project may vary greatly, but the students&#x27; capabilities include implementation of any of the following:</p><ul><li>Implement a system capable of storing huge data sets within any NoSQL database. Eg. in an e-commerce website, create a database with different products to be searched upon – an online store, or any other idea. </li><li>Implement search functionality using Lucene/ Elastic Search/ Solr search indexing over the DB. The search results can also be cached. </li><li>Implement web server in Node.js or any other server to handle request/response. </li><li>Design web page with a search box and Search button. Input search string and hit Search button. </li><li>Display results on the page. You can also try storing images and display in the search result. The system can also be implemented over AWS or Azure or IBM Bluemix Cloud platform.</li></ul>',5,'masters students',1,NULL,'anywhere',NULL),(189,150,'published','Master\'s Strategy Consulting',NULL,'OPRE 6367','Capstone Course',35,2016,'fall','<p>Students will provide unbiased assessments and recommendations regarding opportunities and challenges currently affecting your business.</p>','group','2017-08-01','2017-11-30',50,NULL,'<p>Final project deliverables include professional level presentations of:</p><ul><li>Objective situational assessments</li><li>Identification and evaluation of alternatives</li><li>Development of performance measures</li><li>Recommended strategies and actions supported with financial analysis</li></ul><p>Your organization will receive:</p><ul><li>A 30-45 minute presentation on analysis, findings, and recommendations</li><li>A hard copy of the final project report (length of document depends upon scope of the project)</li><li>Direct interaction with UT Dallas students/future professionals for employment opportunities</li></ul>',15,NULL,'2017-03-09 19:01:43','2017-08-03 22:41:32','<p>A group of five Master&#x27;s level student-consultants will work 50+ hours to provide business consulting and strategy guidance to your business.</p><p></p><p>These graduate students have diverse backgrounds including engineering, information systems, science and business, and can offer unbiased assessments and recommendations for your company in many areas.<br/></p><p>Possible areas of focus could include, but are not limited to:</p><ul><li>Market research</li><li>Supply chain management/process improvement</li><li>Technology solutions</li><li>Market entrance/expansion</li><li>Data analytics</li><li>Development and use of KPIs/KLIs</li><li>Category management</li><li>Commercialization of social media</li><li>Sales and marketing strategy</li></ul>',5,'MBA, MS',1,NULL,'anywhere',NULL),(190,111,'published','Content Creation',NULL,'COMSTRAT 381','Media Strategy',15,2016,'summer','<p>Working in groups, students will create content for your blog or website to help build and define your organization&#x27;s brand.</p>','group','2017-05-08','2017-06-30',30,NULL,'<p>Students will deliver a 1-3 page document of the content they&#x27;ve created for you. Length will vary depending on the topic.</p>',2,NULL,'2017-03-10 00:17:49','2017-08-03 22:57:50','<p>Working in groups, students will create content for your blog or website to help build and define your organization&#x27;s brand. Students will identify your organization&#x27;s profile, and key messaging to develop content that can be used as part of an integrated marketing campaign.</p><p></p><p>Examples can include but are not limited to:</p><ul><li>Writing a blog post around a spotlighted employee</li><li>Creating a profile of an individual served by your business or non-profit organization</li><li>Writing a short blog post supporting one of your organization&#x27;s key value propositions</li></ul><p></p><p></p>',8,'4th year of 4 year degree',1,NULL,'anywhere',NULL),(191,73,'published','Managing Disruption',NULL,'MB499','The Role of Disruption in Business',38,2016,'summer','<p>Analysis of an organization&#x27;s competitive and technological context to forecast potential disruptive factors that will impact the organization&#x27;s goals in the future.</p>','group','2017-06-01','2017-07-20',40,NULL,'<p>Students will provide a 10+ page describing their analysis and recommendations. They will deliver a presentation to the class, and provide a YouTube video to your organization highlighting their key findings.  </p>',7,NULL,'2017-03-10 01:10:16','2017-06-05 22:57:55','<p><strong>Organizational Disruption: Analysis and Risk Mitigation</strong></p><p></p><p>Working in groups of 5, fourth-year business students will perform an analysis of an organization&#x27;s competitive and technological context to forecast potential disruptive factors that will impact the organization&#x27;s goals in the future. Risk mitigation strategies will be developed. </p><p></p><p>Student&#x27;s reports will focus on one product or service of your organization and address the following four items:</p><p>1) Perform an environmental scan of an organization</p><p>2) Identify five disruptive factors that may materially disrupt the organization&#x27;s ability to achieve their organizational goals in the coming years. Ensure that these factors are reasonable and evidence-based. </p><p>3) Using reasonable, evidence-based rationale, assess the likelihood of the occurrence of each disruptive factor. </p><p>4) Suggest a risk mitigation strategy for each of the five disruptive factors.</p>',6,'4th year',1,NULL,'local',NULL),(192,179,'published','Industry Research Project','Communications','Comm 1034','Professional Communications',30,2016,'winter/spring','<p>Have up to four groups of student-consultants research a well-defined issue or opportunity in your business.  </p>','group','2017-03-01','2017-03-31',20,NULL,'<p> Receive up to three short student reports and video presentations with actionable recommendations, based on industry best practices. All proprietary company information remains confidential at all times. </p>',12,NULL,'2017-03-10 19:57:58','2017-03-10 19:59:06','<p>Have up to four groups of student-consultants research a well-defined issue or opportunity in your business. The student groups spend approximately 4-6 weeks conducting research to address your issue/opportunity and then provide actionable recommendations. Project scopes can include, but are not limited to;</p><ul><li><strong>improving digital or social media strategies</strong></li><li><strong>reaching a specific market segment</strong></li><li><strong>increasing revenue for a product/service</strong></li><li><strong>identifying potential partnerships</strong></li><li><strong>identifying and cutting unnecessary costs</strong></li><li><strong>identifying technology and digital tools to adopt</strong></li><li><strong>reducing employee turnover, etc.</strong></li></ul>',4,'1st year',1,NULL,'local',NULL),(193,99,'published','Market Research Consultancy',NULL,'IBM 409 and IBM 499','Marketing Research Practicum',12,2016,'fall','<p>Under the leadership of their professors, undergraduate student-consultants will conduct data-based market research for your organization, to guide marketing decisions.</p>','group','2018-01-04','2018-03-16',100,NULL,'<p><strong>Project deliverables can include, but are not limited to:</strong></p><ul><li>Final report and plan outlining key findings/recommendations</li><li>Presentation slide with 20+ pages</li></ul>',1,NULL,'2017-03-10 20:32:58','2017-08-03 22:46:34','<p>In this unique project, industry leaders turned professors will engage with your organization to create the scope for one of your business opportunities. By translating the practical context of your project the professor will work with 4th year student-consultants over the course of the semester to provide future marketing opportunities relevant to your organization based from primary data-based research. The professor themselves will be the contact point for your organization to communicate the business goals you would like university undergraduates to focus on. Under the leadership of their professors, students teams will work over 1,280+ hours, to research and determine target markets or a marketing mix -- product, pricing, promotion, and distribution.</p><p></p><p>Student teams can do secondary data-based research about the industry and customers, determine research questions and objectives, conduct focus-group interviews, create and administer surveys to prospective customers, and analyze data returned. At the conclusion of the project, they will present key findings and make actionable recommendations for the client firm.</p><p></p><p><strong>Project examples include, but are not limited to:</strong></p><ul><li>Conducting research on the industry and surveying potential customers to develop a pricing strategy</li><li>Conducting location analysis and customer surveys to identify where to expand your business</li><li>Investigating the competitive landscape for a new product or service, including focus groups with customers, to identify key messaging for promotion</li></ul><p>Please note: all students in this class have been selected through a vigorous application process within the university. Your organization will be working with Cal Poly Pomona&#x27;s highest-caliber students in the undergraduate Marketing faculty!</p>',4,'4th year of 4 year degree',0,NULL,'anywhere',NULL),(194,181,'published','Corporate Social Responsibility Plan',NULL,'MGMT 5615','Corporate Social Responsibility',10,2016,'fall','<p>Student teams will work with a corporation, non-profit or local municipality interested in implementing Corporate Social Responsibility policies.</p>','group','2017-08-29','2017-12-08',20,NULL,'<p>The final project deliverables are:</p><ul><li>20-page Corporate Social Responsibility Plan</li><li>presentation to the organization&#x27;s stakeholders</li></ul>',5,NULL,'2017-03-11 15:17:25','2017-06-13 18:39:54','<p>In teams of 2, MBA student-consultants will work with your organization during the 14 week Fall 2017 semester to develop a Corporate Social Responsibility  (CSR) Plan. A CSR plan can improve your public image, increase media coverage, boost employee engagement and attract potential investors (among many other benefits.) </p><p></p><p>Team up with a pair of MBA students while they work 20+ hours researching and developing a plan that fits your organization. Create a positive work environment and make a social impact at the same time.</p><p></p><p>Areas of focus can include, but are not limited to:</p><ul><li>Sustainability</li><li>Community Involvement and Development</li><li>Human Rights</li><li>Labor Practices</li><li>Environment</li><li>Fair Operating Practices</li><li>Consumer Issues</li></ul>',2,'MBA',0,NULL,'anywhere',NULL),(196,186,'published','Sustainability Plan',NULL,'ENVR E599a','Consulting with Clients for Sustainability Solutions',15,2016,'fall','<p>Students act as outside consultants to develop and present a plan to reduce operational costs and environmental impact, as well as fostering sustainable behavior. </p>','individual','2017-09-01','2017-12-08',70,NULL,'<p>The final project deliverables are:</p><ul><li>20+ page Sustainability Action Plan</li><li>Presentation to the stakeholders</li></ul><p></p>',5,NULL,'2017-03-12 20:05:03','2017-06-07 21:04:04','<p>A Master&#x27;s student will address a client’s specific requirements using a consulting methodology, developing and presenting a professional, actionable plan.</p><p></p><p>The student will aim to create a plan which reduces operational costs and environmental impacts, in addition to fostering sustainable behaviour. </p><p></p><p>Recommended Initiatives which are unique to the client may include, but are not limited to:</p><ul><li>Developing a plan to reduce energy use including lighting, heating and AC</li><li>Developing a water conservation initiative for your businesses&#x27; operations</li><li>Recycling and waste management program</li><li>Paper use reduction initiative</li><li>Green office program, including cleaning supplies and sustainable practices</li><li>Green IT program</li><li>Sustainability education</li><li>Sustainability reporting</li><li>Sustainability branding</li></ul>',1,'Masters of Liberal Arts, Sustainability',0,NULL,'anywhere',NULL),(197,11,'published','Entrepreneurship Behaviour & Strategy: Elevator Pitch',NULL,'ENT 526','Entrepreneurship Behaviour & Strategy',30,2016,'winter/spring','<p> Familiarize yourself with KnowQuest and create 3 artifacts: Lean Canvas, Business Model Canvas, Elevator Pitch </p>','individual','2017-03-01','2017-03-24',20,NULL,'<p>In order to obtain the bonus mark you will create 3 artifacts:</p><p>1) Lean Canvas 2)Business Model Canvas 3) Elevator Pitch</p>',1,NULL,'2017-03-12 20:08:59','2017-03-12 20:49:08','<p>Familiarize yourself with KnowQuest and create 3 artifacts: Lean Canvas, Business Model Canvas, Elevator Pitch </p><p> </p><p>What is KnowQuest? (You will hear about Knowquest during the semester from your instructor)</p><p>In order for you to obtain your 5% bonus marks you will do the following:</p><ol><li>Go to Riipen (www.riipen.com), register and create a profile;</li><li>Locate ENT 526 course;</li><li>Find the link to KnowQuest (www.knowquest)</li><li>Read the project description;</li><li>Familiarize yourself with KnowQuest; (Your Instructor will also give you information about the platform throughout the course);</li></ol><p>The course lead for this project is Mana Majedian, email; mana.majedian@ryerson.ca, you can directly all questions and issues to her.</p><p>Due at the end of the course, scan and email to Ms. Majedian directly.</p>',1,'4th year',1,NULL,'local',NULL),(198,2,'published','Growth Strategy & Consultancy',NULL,'ENTR 6625','Managing Venture Growth and Transitions',14,2016,'summer','<p> Students will work in teams of ~4 on a growth challenge faced by a business, producing a 12-15 page report and 15 minute presentation showing analysis and recommending options at the end. </p>','group','2017-05-02','2017-07-28',20,NULL,'<p> The group of student-consultants will submit a <strong><u>written plan, specific to your company&#x27;s growth opportunities</u></strong>, which will be accompanied by a <strong><u>15-minute presentation</u></strong>. </p>',5,NULL,'2017-03-12 20:35:27','2017-06-15 18:39:14','<p> A group of 4-6 student-consultants, working over the entire semester, will <strong><u>provide strategic recommendations and an implementation plan specific to helping you grow your business</u></strong>. This could include:</p><ul><li>Plan for pursuing a new market opportunity </li><li>Strategies for adapting to disruption in the market </li><li>Creation of a new organizational structure to manage growth priorities </li><li>Plan for establishing a growth-supportive organizational culture</li><li>Research and analysis of infrastructure investment options</li></ul>',4,'Graduate Students',1,NULL,'anywhere',NULL),(199,2,'published','Organizational Consulting Project',NULL,'ORGS 5100','Organizational Behaviour',32,2016,'summer','<p>Groups of 4-6 MBA student-consultants will tackle a leadership issue or management challenge faced by the industry partner. </p>','group','2017-05-03','2017-07-19',15,NULL,'<p>Working over the entire semester, teams will provide strategic recommendations and an implementation plan specific to the issue facing your business in the form of a 10-15 page written report and a 15 minute presentation.</p>',6,NULL,'2017-03-12 20:44:38','2017-06-05 23:03:28','<p>Groups of 4-6 MBA student-consultants will tackle a leadership issue or management challenge that your company is currently facing. Based on information on your organization and goals that you&#x27;ve shared with them, students will act as consultants, analyzing the situation and delivering a presentation and report recommending strategies to address it. Working over the entire semester, teams will provide strategic recommendations and an implementation plan specific to the issue facing your business.</p><p></p><p>Sample student projects include, but are not limited to:</p><ul><li>redesign an internal system or process including: hiring, socialization, compensation, motivation, team management, learning, training </li><li>develop a plan to re-imagine your mission, vision, and purpose and roll it out to employees</li><li>manage a significant organizational change or restructuring </li><li>integrate cultures in a merger or acquisition </li><li>reduce employee turnover or absenteeism or increase workplace safety </li><li>diagnose your organizational structure and its fit with your organization&#x27;s strategy</li><li>help you scope and develop an onboarding plan for new staff</li><li>help you develop a plan to increase diversity and the positive effects of diversity in your organization</li></ul>',5,'Graduate',1,NULL,'local',NULL),(200,187,'published','Internal/External Communication Plan',NULL,'COMM 160IC','Internal/External Communications Plan',80,2016,'winter/spring','<p>Students will work in groups to identify ways your external or intercultural communication strategy could be improved in order to better connect with a diverse population.</p>','group','2017-05-01','2017-06-05',15,NULL,'<p>Students will deliver a report and a presentation describing the findings from their research and their actionable recommendations.</p>',8,NULL,'2017-03-12 21:47:51','2017-06-05 22:58:52','<p>Students will work in groups to identify ways your external or internal communications strategy could be enhanced in order to better connect with a diverse population.</p><p></p><p>Students can assist your organization in areas such as: </p><ul><li>Revamping marketing communications  to attract a wider audience</li><li>Reviewing your branding strategy and messaging under the lens of intercultural communications</li><li>Improving your content strategy to appeal to a larger population</li><li>Rewriting your recruiting material to attract diverse candidates of all ages</li><li>Improving internal communications to reflect all audiences within the company</li></ul>',5,'3rd year',1,NULL,'anywhere',NULL),(201,66,'review','Export Opportunities',NULL,'MGMT 561','Global Political Economy and International Economics',60,2016,'summer','<p>Students will identify key global trade agreements that include Canada and explore opportunities for Canadian exports under those agreements </p>','group','2017-05-01','2017-08-23',25,NULL,'<p>Students will provide a five page report summarizing their findings and actionable recommendations.</p>',10,NULL,'2017-03-13 19:05:34','2017-08-03 22:54:46','<p>Students will identify key global trade agreements that include Canada and explore opportunities for Canadian exports under those agreements.</p><p></p><p>Project examples could include, but are not limited to:</p><ul><li>Identifying export markets for a product that is currently sold only domestically</li><li>Out of a range of products, identifying which is best for export and to which country or countries</li><li>Evaluating whether the companies you current target for export of a particular product are optimal under trade conditions</li><li>(For a government body or policy institute) Reviewing trade agreements to identify export markets that should be promoted to industry</li></ul>',5,'Master\'s',0,NULL,'anywhere',NULL),(202,22,'published','Marketing Plan (Summer 2017)',NULL,'MARK 220','Integrated Marketing Communications',30,2016,'summer','<p>Use an effective Integrated Marketing Communication plan that is in line with your organizations overall marketing strategy. </p><p></p>','group','2017-05-01','2017-06-30',20,NULL,'<p>A marketing plan for your organization that integrates:</p><p></p><p>          1. Different media types</p><p>          2. Varying strategies and ways of implementation</p><p></p>',4,NULL,'2017-03-13 22:12:24','2017-04-25 23:35:41','<p>A group of students will develop an effective integrated marketing communication (IMC) plan within the framework of your organization&#x27;s total marketing strategy.  </p><p></p><p>The students will examine advertising, direct response communications, online interactive communications, sales promotion, public relations, and event marketing, with the objective of ensuring that the appropriate message and media are selected. They&#x27;ll provide you with a plan that integrates the best mix for your objectives and audience.</p><p></p><p>Some examples could include:</p><ul><li>Determining whether you should be devoting more effort towards Facebook advertising over having an active Twitter account. </li><li>Researching the most effective strategy to gain/maintain high customer retention. </li><li>Developing the right voice/copy to resonate with your target market. </li></ul>',3,'2nd year',1,NULL,'local',NULL),(203,190,'published','Business Analytics & Consulting Capstone',NULL,'ITM-6899','Capstone (B)',6,2016,'summer','<p>Graduate Business Analytics students will review a business problem of your choosing and provide actionable recommendations to address it.</p>','group','2017-06-19','2017-09-03',200,NULL,'<ul><li>10 page document with data analysis and recommendations</li><li>15 minute presentation</li></ul>',2,NULL,'2017-03-13 22:40:34','2017-08-03 23:10:00','<p>Working in groups of 3-4, graduate students in the Master of Science in Business Analytics program will tackle a business problem of your choosing.</p><p></p><p>Students will provide structure to the business problem, analyze the issue, and provide you with their insights into the issue presented. The program emphasizes technical skills, and students will be experienced in big data analytics, business intelligence, and data modelling.</p><p></p><p>Example projects include, but are not limited to:</p><ul><li>Market segmentation and identifying new target markets</li><li>Analyzing Market Baskets to identify interesting purchase patterns</li><li>Website analytics, analysis of web logs to optimize web design and online sales</li><li>Identify Key Performance Indicators and design business intelligence dashboards to help decision making</li><li>Predicting customer behavior, employee turnover or loan risk</li></ul>',4,'Master\'s',1,NULL,'regional',NULL),(204,9,'published','Data Analysis',NULL,'EC203','Empirical Economics I',50,2016,'fall','<p>Using real company data, students will spot trends and relationships inside any large data sets. Students will submit their recommendations and conclusions to decision-makers of the company.</p>','individual','2017-09-22','2017-12-08',25,NULL,'<p>The final project will include (as part of a 5-10 page document):</p><ul><li>A brief summary of important and insightful information discovered from the available data</li><li>Tables and graphs of important statistics and relationships</li><li>A brief summary of conclusions and any recommendations based on the data and information obtained </li></ul>',10,NULL,'2017-03-14 22:10:57','2017-08-31 23:12:49','<p>Using real data from your organization, students will identify trends and relationships inside large data sets, create presentation-style graphs and tables, and submit their recommendations and conclusions to decision-makers of the company. The primary tool for data analysis will be the program Stata.</p><p></p><p><strong>Groups of students will use your data to:</strong></p><ul><li>analyze your data to spot trends and relationships among variables</li><li>create tables and graphs of summary statistics of key variables</li><li>create a summary of conclusions in a document that quickly and efficiently conveys information the company may find interesting or important</li><li>test whether different products or groups of individuals have different outcomes or preferences, and whether these differences are large enough to benefit from different strategies</li></ul><p><strong>Possible project examples include, but are not limited to:</strong></p><ul><li>analysis of sales data to determine the relationship between your products&#x27; or services&#x27; price and volume of sales</li><li>identifying patterns in sales or usage based on seasonality</li><li>creating a summary of key customer demographic statistics</li><li>summarizing results of a customer survey to identify which characteristics are associated with different preferences</li></ul><p></p>',1,'Sophomore-Juniors (typically)',1,NULL,'anywhere',NULL),(205,89,'published','Professional Training',NULL,'Senior Project','Advanced Organizational Communication',20,2017,'summer','<p>As a senior capstone project, students will review your existing training materials, create a needs assessment, develop new training materials, and design and conduct a training seminar. </p>','group','2017-05-01','2017-08-31',80,NULL,'<ul><li>Needs assessment</li><li>Project proposal</li><li>Training materials</li><li>Delivery of a training session</li></ul>',5,NULL,'2017-03-14 22:51:10','2017-08-03 22:56:14','<p>Working individually or in groups, senior students will work to revamp a training module for your organization, with your guidance and input. Students will conduct a needs assessment and provide you with a training proposal describing the training session they&#x27;d like to create, and the reasons why.</p><p></p><p>Once your organization has approved their proposal, students will work to create all needed training materials, and design a training seminar. At the end of the project, students will conduct the seminar for the desired audience, and evaluate the outcomes.</p><p></p><p>Possible areas for these students to address include, but are not limited to:</p><ul><li>New hire onboarding</li><li>Intercultural communication</li><li>Conflict management</li></ul>',1,'4th year',1,NULL,'local',NULL),(206,197,'published','Advertising Strategy',NULL,'MRKT 35040','Advertising & Promotion',30,2016,'fall','<p>The student will create advertising elements for your organization, that can be used in creative campaigns for television ads, billboards, magazine, or other mediums.</p>','individual','2017-08-14','2017-11-30',40,NULL,'<p>The student will deliver a specific advertising element depending on the client&#x27;s goals and desired advertising medium. He/she will also provide a 5+ page paper describing the rationale behind their creative strategy.</p><p></p>',3,NULL,'2017-03-15 17:04:55','2017-08-21 18:49:43','<p>The student will create advertising elements for your organization, that can be used in creative campaigns for television ads, billboards, magazine, or other mediums. </p><p></p><p>Based on your stated advertising goals (eg. rebranding, increasing exposure, entering a new region), the student will employ creative strategy to plan, prepare, and place the messages of integrated brand promotion.</p><p></p><p>The student&#x27;s project scope will vary depending on the organization&#x27;s goals and budget, but could include any of the below elements:</p><ul><li>Creating a media plan</li><li>Writing copy for creative print ads (and creating print ads)</li><li>Creating graphics or copy for social media campaigns</li><li>Creating video clips for use in a TV ad or YouTube spot</li><li>Mocking up a billboard or other large-scale advertisement (creating out-of-home ads)</li><li>Creating a social media plan</li><li>Creating a finished TV spot</li><li>Creating a finished radio spot</li></ul><p> </p>',1,'3rd, 4th year students',0,NULL,'anywhere',NULL),(207,124,'review','Victoria Onboarding',NULL,'VIC 101','Onboarding ',1,2016,'winter/spring','<p>Training Victoria on project page creation.</p>','group','2017-03-01','2017-03-31',100,NULL,'<p>report</p>',1,NULL,'2017-03-16 17:40:34','2017-03-16 17:54:52','<p> Training Victoria on project page creation. </p><p></p><p>Project examples include, but are not limited to:</p><p>-</p><p>-</p><p>-</p>',5,'Postgraduate',0,NULL,'anywhere',NULL),(208,84,'published','Design & Prototyping ',NULL,'ME178','Designing for the Human Body',30,2017,'summer','<p>Teams of engineering students will work to help you create or enhance a product or process of your choice over the span of four months.</p>','group','2017-08-21','2017-12-15',80,NULL,'<p>Project deliverables will occur throughout the semester and include:</p><ul><li>Report identifying customer needs, with 20 potential ideas for a solution</li><li>Report identifying the various specs for the product and reasonable targets based on the priority of the customer needs and existing solutions</li><li>Assessment of various ideas to identify a single idea using the specs as a guide. This will also include a CAD prototype of the selected idea.</li><li>Initial physical prototype through 3D printing or other manufacturing (machine shop). </li><li>Testing of initial prototype to confirm how close the prototype matches with target specs.</li><li>Adjustments in design (CAD) and secondary prototype iteration (multiple iterations are encouraged, but will likely be limited due to semester time constraints). </li><li>Final report will be a written report, with a video of the prototype being used as intended.  </li></ul>',10,NULL,'2017-03-16 18:21:04','2017-08-02 17:50:39','<p>As prices in advanced technology lower and the competitive advantage increases there is a growing demand for devices/products that appeal to a wider demographic. Team up with a group of students for a semester-long project and develop your product/service to become more accessible and desirable. </p><p></p><p>This project will enable students to bridge an understanding of how their unique skillset can practically be introduced to an expanding industry (ie. prosthetics, biometrics). Students will research the market size and potential, current options, and current needs/limitations. Ideally, students will also perform interviews with potential customers as part of their design process.</p><p></p><p>Some examples include, but are not limited to:</p><ul><li>Products optimized toward accessibility (ie.kettles, remote controls, vehicles, etc.)</li><li>Improving biometrics for gymnasiums, restricted access areas or other forms secure technology</li><li>Better ways to control/use traffic technology (ie. walk buttons, escalators, etc.)</li><li>Wearable technology </li></ul>',3,'3rd year, 4th year, Masters',0,NULL,'anywhere',NULL),(209,159,'published','Marketing Plan',NULL,'MKT 203','Marketing Analysis and Management ',60,2016,'fall','<p>A group of students will analyze your industry and target market, review your marketing strategy, and develop a new marketing plan for you.</p>','group','2017-09-01','2017-12-20',30,NULL,'<p>Students will provide a 10+ page report summarizing their findings and their actionable recommendations.</p>',2,NULL,'2017-03-16 18:22:48','2017-08-14 20:58:47','<p>Working in groups of 5, graduate students will conduct market research and analysis, review your existing marketing strategies, and develop a new marketing plan for you.</p><p></p><p>Students can develop a general marketing plan for your business, or focus on a more specific area. Project examples could include, but are not limited to:</p><ul><li>A competitive analysis of your industry in your geographic region</li><li>A marketing strategy for a new product launched within an existing business</li><li>Promotional strategy for an upcoming event</li><li>Review and recommendations of your branding and messaging</li><li>Distribution strategy for existing products</li></ul>',5,'Graduate students',1,NULL,'anywhere',NULL),(210,200,'draft','Advertising Campaign and Media Plan',NULL,'--','Campaigns Course',24,2016,'summer','<p>A group of 6 student-consultants, acting as advertising campaign managers, will co-draft a creative brief for your organization and conduct primary research to generate a full campaign and media plan. </p>','group','2017-05-15','2017-08-16',40,NULL,'<p>Each group does an <u><strong>oral presentation (15-20 minutes)</strong></u>, which is accompanied by a <u><strong>presentation deck.</strong></u> Any additional details as determined by the industry partner and student group can also be included separately. Each organization will receive a research report and media plan.</p>',4,NULL,'2017-03-16 20:41:07','2017-03-17 00:10:23','<p>A group of 6 student-consultants, acting as advertising campaign managers, will co-draft a creative brief for your organization, conduct primary research to generate a full campaign and media plan. <strong><u>They will also outline how their messages work together to provide an integrated marketing message</u></strong>. Examples project scopes could include, but are not limited to:</p><p></p><p>- Advertising and media plan to attract new customer segments</p><p>- Building adoption in new markets</p><p>- Increasing market share for a specific product or services</p><p>- Campaign for new product or service launch</p><p></p><p></p>',6,'4th Year',0,NULL,'regional',NULL),(211,185,'draft','Cost Accounting Project Intern',NULL,'ACCT 3331','Cost Accounting and Accounting II',20,2016,'fall','<p>The students will use their accounting skills and put on a cross-sector collaborative event that will generate revenue that will provide wish list items to an area non-profit organization from a sponsoring for-profit business.  </p>','group','2017-08-21','2017-11-29',20,NULL,'<p>Detailed Review and video promoting the day and the participating organizations</p><p></p>',4,NULL,'2017-03-16 22:43:04','2017-03-16 23:31:26','<p>The students will  create an on-campus event that will include a service drive and monetary donations that will will benefit both the nonprofit and the for-profit.   The goal is for the students to use their managerial accounting skills and develop a strategy that will promote both non-profit and the for-profit partners.  </p><p>  </p><p>· Accumulate accurate data about the cost of raw materials, work-in-process, finished goods, labor, overhead, and other related manufacturing costs for the project. </p><p>· Monitor cost standards for the project, such as how many hours of direct labor or direct materials and report the variances for the project.</p><p>· Prepares and administrates the master budget for the project and then compares master budget projections with actual performance. </p><p>· Determine the breakeven point for the project and determine the amount of donations necessary to complete the goals of the project</p><p>· Utilize Volume Based Costing to estimate  and apply overhead to the Day of HOPE Project</p><p>· Attend the Day of HOPE and ensure the project is properly staffed and runs smoothly</p><p>· Complete an analysis of Day of HOPE</p><p></p><p></p><p>The students  will aslso help gain social media exposure for both the nonprofit and the for-profit partner</p>',20,'3rd year',0,NULL,'local',NULL),(212,10,'published',' Secondary Research Business Recommendations',NULL,'BUS 360 ','Business Communications',30,2016,'summer','<p>Are you faced with a business problem that could use insights from a group of student-consultants? </p>','group','2017-05-01','2017-08-11',50,NULL,'<p>The student groups will present their initial recommendations, from which they will incorporate feedback from the industry partner, and then present their findings and submit a final short written report at the end of the term. Proprietary company information remains confidential at all times.</p>',1,NULL,'2017-03-17 16:59:27','2017-05-02 18:35:13','<p>Are you faced with a business problem that could use insights from a group of student-consultants? Groups of 4-5 students will work over a 10 week period to do extensive secondary research and prepare recommendations to solve a particular problem your organization is facing. Example project scopes include, but are not limited to:</p><ul><li>Maintaining your unique culture as you grow</li><li>Impact of increasing wages</li><li>Evaluating the need for a new mobile app</li><li>Recommendations to improve customer service ratings</li><li>Reducing employee turnover</li><li>Strategies for lobbying government</li><li>Understanding the impact of new legislation</li><li>Challenges around growth and expansion</li></ul>',1,'3rd  year',1,NULL,'local',NULL),(213,200,'draft','Operations Management Project',NULL,'--','Operations Management',60,2017,'fall','<p>Groups of 4-5 student-consultants will work with organizations to analyze an operations problem and provide recommendations </p>','group','2017-08-28','2017-10-30',40,NULL,'<p>Final deliverable includes 10 page report that outlines the students&#x27; analysis of the issues and recommendations. Students will also pitch their recommendations in a short presentation.</p>',5,NULL,'2017-03-17 17:48:47','2017-03-17 18:02:11','<p>Groups of 4-5 student-consultants will work with organizations to analyze and existing operations issue. Students will analyze the problem and write a detailed report about their findings. Students will then develop a strategy and present their recommendations. Potential project scopes include, but are not limited to:</p><ul><li><strong>Issues concerning capacity/ plant utilization</strong></li><li><strong>Issues concerning supply chain management</strong></li><li><strong>Issues concerning scheduling and forecasting</strong></li><li><strong>Project management plan for an upcoming project</strong></li><li><strong>Proposing ways to manage suppliers to reduce costs</strong></li></ul>',1,'MBA',0,NULL,'anywhere',NULL),(214,9,'review','Digital Media Research',NULL,'EM-777','Masters Collaboratory Project',25,2018,'winter/spring','<p>Students will work to design and implement a practical project that includes research design, data collection, analysis, evaluation, presentation, and recommendation.  </p>','group','2018-01-15','2018-05-18',30,NULL,'<p>The final project deliverables are;</p><ul><li>10 page document including media recommendations</li><li>20 minute presentation including budget</li><li>Media campaign and audience recommendations</li></ul>',4,NULL,'2017-03-17 18:47:02','2017-05-29 17:58:45','<p>Over the Spring 2018 semester, collaborate with a group of graduate students while they spend 30+ hours each conducting media-related research for your organization. Using investigation, analysis, critical thinking, and communicating with your team they will address a unique opportunity that you have presented. The class will work to create a strategic communication plan that will outline and organize the data and present findings in a persuasive, eloquent, coherent manner. A special focus will be made toward the sensitivity to ethical issues associated with social and behavioural research.</p><p></p><p>Media research has grown to be utilized for long range product and market planning. It assesses the current media mediums being used, the technologies involved, similarities and differences between it and other media vehicles, costs associated and the overall effectiveness it provides the organization. </p><p></p><p>Examples project scopes include:</p><ul><li>Determining how your customers interact with your current media platforms</li><li>A plan to connect and communicate with your target demographic using ethically associated interactions. </li><li>Mass media analysis to create a social media calendar customized to your organization. </li></ul>',1,'Graduate students',0,NULL,'regional',NULL),(215,203,'published','Content Management System',NULL,'IT-394','Software Projects for Community Clients I',30,2017,'fall','<p>Students will help you manage/collaborate your online content by designing and implementing a Content Management System (CMS) for your needs. Clients are limited to 501c3 Non-Profits.</p>','group','2017-09-18','2017-12-25',25,NULL,'<p>By the end of the project, your organization will have a fully functioning content management website. </p><p></p><p>Listed below is a breakdown of the project deliverables:</p><ul><li>Team charter</li><li>Product vision board</li><li>Product backlog</li><li>Sprint backlogs</li><li>User stories and acceptance criteria</li><li>Test plans and test results (expected and actual)</li><li>Training documents as PowerPoint presentations</li><li>Plugin and module lists</li><li>Status reports</li><li>Meeting minutes</li><li>Task lists &amp; timesheets</li></ul>',3,NULL,'2017-03-17 18:47:27','2017-07-26 21:05:08','<p>A group of students will work with your organization to recommend and implement a content management system (CMS) that best fits your needs. They’ll also provide training and reference materials so your team can keep the site updated and organized.</p><p></p><p>Using Agile project management technology and knowledge gained from their computing and digital media courses, the student-consultants will help you get your CMS website up and running. </p><p></p><p>Some examples may be, but are not limited to:</p><ul><li>Marketing your product/service website http://www.westtownbikes.org</li><li>Kickstarting your non-profit’s fundraising efforts http://goodnewspartners.org</li></ul><p>Students may use:</p><ul><li>Drupal 7 &amp; 8</li><li>Wordpress</li><li>Squarespace</li><li>Weebly</li><li>Wix</li></ul><p></p>',5,'3rd year',0,NULL,'anywhere',NULL),(216,59,'published','Sales Support Tools & Prospecting ',NULL,'MARK 2150',' Personal Selling ',36,2016,'summer','<p>Could your organization benefit by increasing your pipeline or qualified sales prospects and enhancing your internal sales resources? This semester professional sales students will be helping organizations do just this.</p>','group','2017-05-31','2017-08-11',60,NULL,'<p><strong>Deliverables Include:</strong></p><p></p><p>Internal Sales Resource that highlights</p><p></p><p>· Product Description and Specs</p><p>· Target Market</p><p>· Competition</p><p>· How Your Company  Differentiates Itself From Competitors</p><p>· Prospecting Resources</p><p>· Discovery Questions</p><p>· Demonstration Details/Examples</p><p>· Common Objections and How to Overcome Them</p><p></p><p>List of 25+ prospects that fit your ideal customer profile</p>',24,NULL,'2017-03-17 21:40:18','2017-07-18 19:00:08','<p>Could your organization benefit from increasing the <strong>number of qualified sales prospects</strong> in your pipeline and enhancing your <strong>internal sales</strong> resources and related systems?</p><p></p><p>A group of 3-5 professional sales students will work with local B2B organizations to develop internal sales resources and if deemed appropriate, qualify leads.</p><p></p><p>Students will research and learn about your industry, products/ services and target markets. Following this exploration, they will begin to compile all the relevant information into an internal sales resource that your sales team and future sales recruits can reference for improved sales performance and consistency within your organization.</p><p></p><p>As part of this exercise, student’s will work with you to understand who your ideal customer profiles are so that they can build a list of at least 25 prospects. If you deem appropriate students may qualify those prospects for your sales team to follow up with.</p>',4,'2nd Year of 2 Year Marketing/Business Diploma ',1,NULL,'local',NULL),(217,80,'published','Market Research & Marketing Recommendations',NULL,'C2C - 1','C2Careers Bootcamp',24,2016,'winter/spring','<p>A group of 3 or 4 University Grads want to help with your organization&#x27;s marketing research! Identify a marketing issue or challenge within your organization and these groups will work to solve the problem and elevate your marketing position. </p>','group','2017-05-09','2017-05-26',40,NULL,'<p><strong>Deliverables</strong></p><p> </p><ul><li>15 minute presentation</li><li>10+ page marketing report</li></ul><p>The groups will have 15 minutes to answer your questions and supply additional detail to their findings, analyses and recommendations.</p>',1,NULL,'2017-03-17 21:56:19','2017-05-03 18:12:15','<p>A group of 3 or 4 University Grads want to help with your organization&#x27;s marketing research! Identify a marketing issue or challenge within your organization and these groups will work to solve the problem and elevate your marketing position. </p><p></p><p>In this project grads will conduct research and analyze the issue to develop strategies and recommendations for your organization&#x27;s next steps. </p><p></p><p> </p><p><strong>Project examples include, but are not limited to:</strong></p><ul><li>Industry analysis to identify new target markets, messaging, and communication strategies.</li><li>Customer analysis to develop a new social media campaign.</li><li>Using focus groups and interviews to develop communication strategies.</li><li>Data and metrics to back up assumptions and develop business cases </li><li>Social media tactics and campaigns and how they contribute to broader social media or marketing strategies and client business or marketing objectives.</li></ul><p></p><p></p><p></p><p></p><p></p>',4,'University Graduates ',1,NULL,'local',NULL),(218,80,'published','Conflict Management',NULL,'C2C-2','C2Careers Bootcamp',24,2016,'summer','<p>Is your organization constantly looking for ways to better your interpersonal relationships as well as relationships with external resources? </p>','group','2017-05-09','2017-05-26',40,NULL,'<p><strong>Deliverables</strong></p><ul><li>15 minute presentation</li><li>10+ page conflict resolution report</li></ul><p>They will have 15 minutes to answer your questions and provide more detail about their findings, analyses and recommendations.</p>',1,NULL,'2017-03-17 22:10:11','2017-05-03 18:14:59','<p>A group of 3 or 4 University Grads work closely with you to analyze a conflict scenario you&#x27;ve provided relating to your organization. Using negotiation theory, strategies, and styles they will analyze the background and provide multiple suggestions to address the conflict. </p><p></p><p> <strong>Project examples include, but are not limited to: </strong></p><ul><li>Interpersonal conflicts between staff</li><li>A client who is key, but upsets staff regularly </li><li>A high-performer who bullies his / her team to get work done</li><li>A clash in management styles between two managers who need to work together</li></ul>',3,'University Graduates',1,NULL,'local',NULL),(219,80,'published','Human Resources Challenge',NULL,'C2C-3','C2Careers Bootcamp',24,2016,'summer','<p>Get help with accelerating your employee potential by identifying and managing human capital. </p>','group','2017-05-09','2017-05-26',40,NULL,'<p><strong>Deliverables:</strong></p><ul><li>15 minute presentation. </li><li>10+ page human resources report</li></ul><p>They will have 15 minutes to answer your questions and provide additional detail to their findings, analyses and recommendations. </p>',1,NULL,'2017-03-17 22:20:39','2017-05-03 18:12:45','<p>A group of 3 or 4 University Grads, acting as outside consultants for your organization, work closely with you to solve a human capital or management problem that is specific to your organization. </p><p></p><p>They will use tools and techniques discussed throughout the course to provide feedback to identify where human capital can significantly enhance organizational success and help identify gaps in the current human capital systems of your organization. </p><p></p><p><strong>Project examples include, but are not limited to: </strong></p><ul><li>Create a mentoring program to guide more minorities to the upper echelons of the company</li><li>Create a reverse-mentoring program where new hires work with senior leaders</li><li>Develop a succession plan for organizations who are soon to lose senior staff to retirement</li><li>Upgrade hiring/recruitment strategies that apply new methods and ways to reach talent</li><li>Create practices around employee creativity to increase engagement and decrease turnover</li></ul>',3,'University Graduates',1,NULL,'local',NULL),(220,80,'published','Document Design',NULL,'C2C-4','C2Careers Bootcamp',24,2016,'winter/spring','<p>Get an assist on creating or redesigning outdated internal or external documents and promotional materials. </p>','group','2017-05-09','2017-05-26',40,NULL,'<p><strong>Deliverables</strong></p><ul><li>15 minute presentation.</li><li>10+ page creative report</li></ul><p>They will have 15 minutes to answer your questions and provide additional detail to their findings, analyses and recommendations.</p>',1,NULL,'2017-03-17 22:26:21','2017-05-03 18:15:42','<p>A group of 3 or 4 University Grads acting as outside consultants for your organization will work closely with you to design a complex document for your organization, such as a book, magazine, annual report or training manual. </p><p></p><p>Students will focus on the look and voice of your organization to help align the brand both internally and externally. Keeping in mind the convergence of technology, language, and culture which documents represent they will create a final product made for the target demographic that is unique to the material it is produced for.</p><p></p><p><strong>Project examples include, but are not limited to: </strong></p><ul><li>Designing a catalogue for business, including photos and descriptions </li><li>Designing a template for an annual report for a large corporation </li><li>Creating the layout for a textbook</li></ul>',3,'University Graduates',1,NULL,'local',NULL),(221,80,'published','Corporate Social Responsibility (CSR) Plan',NULL,'C2C-5','C2Careers Bootcamp',24,2016,'summer','<p>Having a great Corporate Social Responsibility (CSR) Plan can benefit your organization in more ways than one. </p>','group','2017-05-09','2017-05-26',40,NULL,'<p><strong>Deliverables</strong></p><ul><li>15 minute presentation</li><li>10+ page corporate social report</li></ul><p>They will have 15 minutes to answer your questions and provide more detail about their findings, analyses and recommendations.</p>',1,NULL,'2017-03-17 22:31:34','2017-05-03 18:17:40','<p>Corporate social responsibility can improve your organization&#x27;s public image, increase media coverage, and boost employee engagement among other things. </p><p></p><p>Team up with a group of 3 or 4 University Grads acting as outside consultants for your organization  to develop a Corporate Social Responsibility (CSR) Plan. They will use the skills they have been honing in-class to determine an effective way to implement your organization&#x27;s CSR plan as well as provide further insight into communicating the intent both internally and externally. </p><p></p><p><strong>Project examples include, but are not limited to: </strong></p><ul><li>Community Involvement and Development</li><li>Human Rights</li><li>Labor Practices</li><li>Environment</li><li>Fair Operating Practices</li><li>Consumer Issues</li><li>Social Change</li></ul>',3,'University Graduates',1,NULL,'local',NULL),(222,80,'published','Communications and Public Relations',NULL,'C2C-6','C2Careers Bootcamp',24,2016,'summer','<p>Create a system to easily communicate the goals behind your organizations advertising and promotional materials. </p>','group','2017-05-09','2017-05-26',40,NULL,'<p><strong>Deliverables</strong></p><ul><li>15 minute presentation</li><li>10+ page strategic communications plan</li></ul><p>They will have 15 minutes to answer your questions and provide more detail about their findings, analyses and recommendations.</p>',1,NULL,'2017-03-17 22:39:03','2017-05-03 18:17:52','<p>A group of 3 or 4 University Grads acting as outside consultants for your organization will work closely with you to develop a strategic communications plan for your organization. </p><p></p><p>Using skills and tools developed in-class students will work to diagnose and provide a recommended execution as well as provide next steps to help your organization understand the roadmap to effective strategic communication. </p><p></p><p><strong>Project examples include, but are not limited to: </strong></p><ul><li>Research and analysis of existing plan</li><li>Strategy for public and media relations</li><li>Event planning and management for target audience(s)</li><li>Strategic digital communications and social media marketing</li></ul>',3,'University Graduates',1,NULL,'local',NULL),(223,80,'published','Environmental Sustainability Plan',NULL,'C2C-7','C2Careers Bootcamp',24,2016,'summer','<p>Increase productivity and reduce costs by developing an Environmental Sustainability Plan. </p>','group','2017-05-09','2017-05-26',40,NULL,'<p><strong>Deliverables</strong></p><ul><li>15 minute presentation</li><li>10+ page environmental/sustainability action plan</li></ul><p>They will have 15 minutes to answer your questions and provide more detail about their findings, analyses and recommendations.</p>',1,NULL,'2017-03-17 22:45:22','2017-05-03 18:15:22','<p>A group of 3 or 4 University Grads will work closely with you to address your organization&#x27;s footprint using consulting methodology. They will seek to develop an actionable plan that reduces operational costs and environmental impact. </p><p></p><p>Developing a solid Environmental Sustainability Plan will improve brand image and increase your organization&#x27;s competitive advantage. Post-graduate students will use the tools and skills learned throughout this course to create the most impactful solution for your organization. </p><p></p><p><strong>Project examples include, but are not limited to: </strong></p><ul><li>Energy use including lighting, heating and AC</li><li>Water conservation</li><li>Recycling and waste management</li><li>Paper use reduction</li><li>Green office including cleaning supplies and practices</li><li>Green IT</li><li>Sustainability education, reporting, branding, etc.</li></ul>',3,'University Graduate',1,NULL,'local',NULL),(224,204,'draft','Test Assignment',NULL,'RISE-101','Intro to Service-Learning',10,2016,'winter/spring','<p>The will need to...</p>','individual','2017-04-03','2017-06-15',10,NULL,'<p>asdf</p>',1,NULL,'2017-03-17 23:51:54','2017-03-17 23:55:07','<p>Serving</p>',1,'1st',0,NULL,NULL,NULL),(225,13,'draft','IT Security Consultancy',NULL,'MBA B 5P15','Information Assurance',20,2016,'winter/spring','<p>Groups of 4-5 student consultants educated in information security and contingency planning, will spend a month creating or reviewing your organizational policies around information security and make recommendations for improvement. </p>','individual','2016-09-05','2017-04-27',100,NULL,'<p>Student-consultants review and provide a report on improvements or create the information security policies and contingency plans that your organization needs.</p>',1,NULL,'2017-03-20 18:13:12','2017-03-20 18:13:12','<p>Groups of 4-5 student consultants educated in state-of-the-art information security and contingency planning, will spend a month creating or reviewing your organizational policies around information security and make recommendations for improvement. Potential project scopes can include but are not limited to:</p><ul><li><strong>Defining Security goals</strong></li><li><strong>Run Tests</strong></li><li><strong>Analysis of Information Technology threats</strong></li><li><strong>Recommendations for Data Back ups</strong></li><li><strong>Develop/update internet use policies</strong></li><li><strong>Develop/Update Disaster Recovery Plan</strong></li><li><strong>Conduct Risk Assessment</strong></li><li><strong>Identify alternative independent defenses</strong></li><li><strong>ISO 17000 compliance</strong></li><li><strong>Evaluating or designing contingency plans</strong></li></ul>',1,'4th Year',0,NULL,NULL,NULL),(226,13,'draft','Data Consultancy',NULL,'MBA B 5P13','Database Systems:',37,2017,'summer','<p>Is your database outdated? Are you still using Excel? You could be using more sophisticated technology that could actually help you with your data! Or maybe you want to use your existing data in new ways or for the first time ever.</p>','group','2016-10-03','2016-12-09',NULL,NULL,'<p>Student-consultants create <u><strong>a business plan around their new use of data or databases plus a functioning prototype</strong></u>.</p>',1,NULL,'2017-03-20 18:16:54','2017-03-20 18:19:53','<p>Is your database outdated? Are you still using Excel? You could be using more sophisticated technology that could actually help you with your data! Or maybe you want to use your existing data in new ways or for the first time ever. <u><strong>A group of student-consultants will devise a business plan about how you can maximize your data by using a database</strong></u>.  Past projects included: reorganizing data to map customer geographic information to find new areas with low penetration; and, data modeling from an excel file to a functional database.</p>',4,'MBA',0,NULL,NULL,NULL),(227,22,'draft','Marketing Plan',NULL,'MARK 220','Integrated Marketing Communications',30,2016,'summer','<p>Students will work in groups to develop an effective Integrated Marketing Communication plan for your organization, in line with your overall marketing strategy.</p>','group','2017-05-01','2017-06-30',20,NULL,'<p>Students will provide you with a marketing plan for your business that integrates different media types and strategies.</p>',1,NULL,'2017-03-20 18:25:33','2017-03-20 18:25:33','<p>A group of students will develop an effective integrated marketing communication (IMC) plan within the framework of your organization&#x27;s total marketing strategy.  </p><p></p><p>The students will examine advertising, direct response communications, online interactive communications, sales promotion, public relations, and event marketing, with the objective of ensuring that the appropriate message and media are selected. They&#x27;ll provide you with a plan that integrates the best mix for your objectives and audience.</p>',3,'2nd year',0,NULL,NULL,NULL),(228,143,'published','Analysis & Strategy for Business in China',NULL,'IBUS 592','Doing Business in China',40,2017,'fall','<p>Undergraduate student-consultants will analyze your company&#x27;s strategy to do business in, expand into, or grow your business in China.</p>','group','2017-08-23','2017-12-07',25,NULL,'<ul><li>15-page comprehensive report outlining the students research, findings, and implications for you organization</li><li>30-minute presentation followed by Q&amp;A period</li></ul>',8,NULL,'2017-03-20 18:37:28','2017-08-24 17:39:26','<p>Starting this September, a group of 5 business students will dedicate 150 hours over the course of the semester conducting a strategic analysis and providing recommendations on how you can expand into or grow your current operations in the Chinese market.</p><p></p><p>Their research and analysis will help you to develop expansion strategies and give you unique insights and outside perspectives on your business.</p><p></p><p><strong>Possible project examples include, but are not limited to:</strong></p><ul><li>Market Research &amp; Strategic Marketing Plan</li><li>Expansion Strategy into China</li><li>Operations Management within the Chinese Market</li><li>Project Management within the Chinese Market</li></ul><p>A multinational Chinese company would still be an appropriate fit for this project. Students would conduct an international strategic analysis.</p>',5,'3rd & 4th years',0,NULL,'anywhere',NULL),(229,217,'published','Web Design Campaign',NULL,'MMC6936','Web Design Capstone',12,2016,'summer','<p>Give your organization a new look - students work to build you a responsive website and create branding material to use in marketing campaigns. </p>','group','2017-05-08','2017-08-04',50,NULL,'<p><strong>Student teams will develop research, branding and web tools for a client. Deliverables will include:</strong></p><p> </p><ul><li>Situation Analysis</li><li>Logo Design Proposal</li><li>Branding Guide</li><li>Communication Designs (ex. letterhead, business cards, etc.)</li><li>Fully Functioning Responsive Website</li><li>Campaign Book</li></ul><p></p><p>The student teams will pitch their campaign ideas to the client at the end of the semester. The client can then select a winner and opt to utilize that design work.</p>',1,NULL,'2017-03-20 20:25:06','2017-06-05 23:04:51','<p>In this project students will provide a fully functioning responsive website for your organization. Through research and client feedback channels they will construct a new home for your organization online. </p><p></p><p>Students will also redesign an existing logo or create a new logo, develop branding materials and provide research to the client.</p><p> </p><p><strong>Project examples include, but are not limited to:</strong></p><ul><li>Nonprofit website</li><li>Website for startup companies</li><li>Website for service business</li><li>Website for hotels/restaurants with reservation </li></ul>',1,'Master\'s',1,NULL,'anywhere',NULL),(232,92,'published','MBA Consulting',NULL,'BUSL 626','Integrating Project Capstone',104,2016,'summer','<p>Groups of 5 MBA student-consultants,will solve a business challenge currently facing your business <u><strong>over an intensive  2.5-week period!</strong></u></p>','group','2017-07-17','2017-08-18',120,NULL,'<p>Each student group will <u><strong>complete 600 hours of work</strong></u> in order to provide recommendations on the problem/opportunity that your firm is facing and report back to your company in a <u><strong>15-minute presentation with accompanying detailed strategic brief.</strong></u></p>',24,NULL,'2017-03-20 20:51:10','2017-08-17 02:32:22','<p>Groups of 5 MBA student-consultants,will solve a business challenge currently facing your business <u><strong>over an intensive  2.5-week period!</strong></u> The challenge can be anything related to business, such as: </p><ul><li><strong>new market entry</strong></li><li><strong>value chain analysis</strong></li><li><strong>marketing strategy</strong></li><li><strong>operations management solutions</strong></li><li><strong>leveraging new technologies for change</strong></li><li><strong>expansion strategy</strong></li></ul>',5,'MBA',1,NULL,'regional',NULL),(233,20,'published','Business Consulting Project',NULL,'MKGT 4418','Marketing Management',75,2018,'winter/spring','<p>Senior Diploma students will conduct extensive marketing research and create a tailored strategic plan addressing unique business and marketing challenges or opportunities your organization is facing.</p>','group','2018-01-01','2018-05-31',100,NULL,'<p>The project deliverables will include:</p><ul><li>A comprehensive written report outlining marketing strategies or a business plan.</li><li>A 45-minute oral presentation detailing the student&#x27;s recommendations and implementation plan. </li></ul>',24,NULL,'2017-03-21 19:42:04','2017-07-18 22:11:35','<p>This 16-week project will give your organization the opportunity to get a third party&#x27;s opinion on how to expand or adjust internal marketing/business practices to remain competitive in your chosen domain. </p><p></p><p>A group of 2-3 student-consultants will work with your organization to solve a marketing challenge or opportunity within your organization. They will spend 350+ hours conducting extensive market research in order to prepare a marketing/business plan that will equip you and your organization with the proper tools to build your business. </p><p></p><p><strong>Projects will include, but are not limited to:  </strong></p><ul><li>Primary and secondary marketing research to better understand shifts and trends in the business environment, target markets, etc.</li><li>Leveraging online marketing communications to improve your targeting and messaging.</li><li>Developing a business plan for a startup or early stage business looking to grow their firm.</li></ul>',2,'2nd year (Professional Diploma)',0,NULL,'anywhere',NULL),(234,225,'published','Product Management in Practice Project',NULL,'KIEI-932','Product Management for Technology Companies',63,2016,'winter/spring','<p>Is your organization facing a current business/marketing challenge? Get MBA students to find your resolution. </p>','group','2017-03-28','2017-06-02',20,NULL,'<ul><li>A document outlining final conclusions and future recommendations.</li><li>30-minute final presentation to your organization. </li></ul>',5,NULL,'2017-03-21 21:11:48','2017-03-30 20:54:52','<p>In small groups students completing their MBAs will work to solve a challenge that your organization has provided. These challenges may relate to marketing your product/service, opportunity/market assessment, product discovery, product planning, roadmap design, or product portfolio management.</p><p></p><p>It always helps to have fresh eyes on a problem. Let MBA students put their skills to work by using their product management frameworks and tools to help your business flourish. Students will provide actionable insights into how you can manage your product</p><p></p><p>Examples of projects like this may include, but are not limited to:</p><ul><li>Understanding the current landscape of your product/service and it’s viability in the marketplace. </li><li>Shaping your product/service to better-suit current/future demand. </li><li>Constructing a granular idea of your product/service’s future growth.</li></ul>',1,'MBA',1,NULL,'anywhere',NULL),(235,2,'review','Marketing Consultancy',NULL,'MKTG','Master of Marketing - Experiential Learning',20,2018,'fall','<p>Graduate students in the Master of Marketing program will identify and implement a solution to your marketing challenge.</p>','group','2018-09-01','2019-04-19',100,NULL,'<p>Project deliverables with vary for each company project depending on your needs.</p>',10,NULL,'2017-03-21 22:54:28','2017-03-22 21:05:03','<p>Over two semesters, a group of six graduate students in Schulich&#x27;s Master of Marketing program will work on a marketing project to help your business. Student teams will develop a solution for a marketing problem you face, and then implement their approved solution for your company.</p><p></p><p>Sample projects include, but are not limited to:</p><ul><li>finding a Customer Relationship Management platform that fits your needs, and implementing this for your marketing team</li><li>developing a plan to increase conversions on your website and implementing user experience improvements to achieve this</li><li>designing and launching a social media campaign for a product to boost sales</li></ul><p></p><p></p>',6,'Graduate',0,NULL,'local',NULL),(236,22,'published','Market Research - Online Surveying (Summer 2017)',NULL,'Mark 210','Marketing Research',50,2016,'summer','<p>A team of five business students conduct market research to help solve your real-life business problem.</p>','group','2017-07-01','2017-08-31',250,NULL,'<p>Students will deliver fresh, actionable insight from extensive data analysis. They will also produce a concise summary report highlighting the main findings, with options and recommendations, in addition to an electronic copy of the raw data, complete with student analysis. You’ll be able to see exactly how the data was analyzed, and why your student-team reached their conclusions. You’ll even be able to conduct further analysis as you wish.</p>',4,NULL,'2017-03-21 22:56:10','2017-04-25 23:35:15','<p>Do you have have a decision to make, and lack the customer-data you need? A team of five business students conduct market research to help solve your real-life business problem. </p><p></p><p>Students design an online survey, you send a link to your customers, and the student team analyzes the results. They then develop options for solving your problem, and make recommendations.</p><p></p><p><strong>Potential project scopes include, but are not limited to</strong>: </p><ul><li>improving customer acquisition/retention</li><li>identifying market expansion opportunities</li><li>market segmentation analysis</li><li>receiving feedback on a new or existing product/service, etc.</li></ul>',5,'2nd year',1,NULL,'local',NULL),(237,216,'draft','Consulting RFI Response - Info Tech for Supply Chain Mgmt',NULL,'SCMT465','Information Technology for Supply Chain Management',120,2018,'winter/spring','','individual',NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-03-21 23:44:12','2017-04-05 17:57:27','',1,'4th Year (Senior)',0,NULL,NULL,NULL),(238,59,'published','Financial Analysis & Report',NULL,'ACCT 4850','Accounting Theory',18,2016,'summer','<p>Ever wondered if your organization&#x27;s disclosure of public information has positive or negative effects?</p>','group','2017-05-08','2017-08-14',30,NULL,'<p>The final project deliverables  for this assignment are: </p><ul><li>A digital presentation analyzing the movement of the company&#x27;s share price with financial reports/information releases during the year.</li><li>Recommendations provided to the Company on disclosure improvements for their financial reports and information on their website. (1-2 page pages summarizing recommendations referencing a report)</li></ul><p></p><p></p>',3,NULL,'2017-03-22 15:40:54','2017-08-16 18:47:07','<p>A group of students are looking to hone their research and financial analysis skills. Get information pertinent to your organization and how you could be making changes to better your organization. </p><p></p><p>The students will analyze the share price of a company to observe and analyze how financial statements, MD&amp;A and information effects movements in share price throughout the year. The students will also compare the financial reports to other companies&#x27; reports in the industry and provide recommendations to the company of where improvements can be made in their disclosure documents. </p><p></p><p>Some benefits of this project include:</p><ul><li>Acquiring knowledge for potential investors</li><li>Gaining a better understanding of information flow to the public</li></ul><p></p>',3,'4th year',0,NULL,'anywhere',NULL),(239,76,'review','Media Production: Summer 2017',NULL,'GMCS 546','New Media & Information Management',40,2016,'summer','<p>Student creatives simulate &quot;agency life&quot; by working to a produce digital/traditional media deliverables for your organization. </p>','individual','2017-05-01','2017-08-26',80,NULL,'<p>The deliverables are subject to change depending on the needs of your organization.</p><p></p>',6,NULL,'2017-03-22 17:24:35','2017-03-22 18:24:45','<p>Media production is valuable to every organization. Among other things it boosts conversion and sales, it educates the public on your products/services and it builds consumer trust. </p><p></p><p>Whether it&#x27;s web-based or print, audio or video, outdoor or public relations, students will deliver media that speaks to your goals and objectives. </p><p></p><p>Some examples include, but are not limited to:</p><ul><li>outdoor billboards or street art or kiosks </li><li>web advertisement  - audio commercial (online of on-air)                 </li><li>print advertisement or brochures   - social media banners, skins, art, etc                  </li><li>public relations collateral  - augmented reality collateral / media          </li></ul>',1,'Graduate',0,NULL,'local',NULL),(240,207,'review','Brand Audit',NULL,'--','Product and Brand Management',60,2016,'fall','<p>A group of students will analyze your brand&#x27;s current situation and goals, and develop a strategy to get you where you want to be.</p>','group','2017-09-01','2017-12-20',30,NULL,'<p>Students will provide a 8-10 page report summarizing their findings and their actionable recommendations.</p>',5,NULL,'2017-03-22 18:26:05','2017-03-22 18:43:50','<p>Working in groups of 5, fourth year undergraduate students will conduct analysis on brand category, customer, company, and competitors. Students will also perform a brand audit, and, finally, they will provide recommendations on how to reach your brand goals. </p><p></p><p>Project examples could include, but are not limited to:</p><ul><li>Analysis, audit, and marketing plan for an entire brand</li><li>Analysis, audit, and marketing plan for a branded product line/service line</li><li>Analysis, audit, and marketing plan for a specific product/service</li></ul>',5,'Undergraduate Students',0,NULL,'anywhere',NULL),(241,59,'published','Promotional Plan + Materials (Summer 2017)',NULL,'MARK 3340','Promotional Strategy',35,2017,'summer','<p>Create an integrated promotional plan for your organization including promotional materials. </p>','group','2017-05-15','2017-07-31',60,NULL,'<p>The deliverables will laid out in 3 steps, where the final 2 are dependent on what is decided in the first:</p><ol><li>Background document including promotional plan objectives, creative theme, and key messaging</li><li>Paid Search and email promotions including research on relevant keywords. </li><li>Creation of a minimum four planned promotional tools including creative samples based on the marketing foundation of the background document.  The tools can include Interactive communications, sales promotion, public relations materials, plus experiential/event or sponsorship materials and personal selling/ direct response  promotions samples.</li></ol>',6,NULL,'2017-03-22 20:52:16','2017-06-05 23:01:21','<p>Having a good marketing strategy gives your organization brand exposure, consumer loyalty, and positive consumer association among other things. In this assignment a group of 5 to 6 student-consultants will work for an entire semester on creating a promotional plan for your company which will be accompanied by samples of promotional materials in different media - script, print ad, PR, sponsorship, etc. </p><p></p><p>Your promotional project can be linked to anything you are currently doing in your marketing strategy or something new. This project can help you address a marketing challenge.</p><p></p><p>Some examples of this could include:</p><ul><li>Reaching a new target market</li><li>Marketing a new product</li><li>Promoting a special marketing sale</li></ul>',5,'3rd year',1,NULL,'local',NULL),(242,38,'published','Integrated Marketing Communications Plan ',NULL,'Mark 2400','Integrated Marketing Communications',40,2016,'summer','<p>Give your organization the opportunity to focus on the promotional elements of your marketing strategy</p>','group','2017-06-14','2017-08-15',20,NULL,'<p><strong>Deliverables for the project could include:</strong></p><ul><li>Overview of target market and rationale</li><li>Social media strategy</li><li>UnBounce and Google Adword analysis</li><li>Media recommendations - including website names, magazine titles, newspaper titles, etc. </li><li>Example of potential web banner ad</li><li>Budget of proposed activities</li><li>Posting online or web video ad (optional)</li><li>YouTube strategy (optional)</li><li>Event sponsorship recommendations coupled with catchy PR story</li><li>Additional creative marketing ideas. </li></ul>',16,NULL,'2017-03-22 22:46:53','2017-06-20 17:37:55','<p><strong>Integrated Marketing Communications</strong> plan can help your organization execute and deliver on your marketing strategy. A  group of students will work to enforce your organization&#x27;s current brand awareness by:</p><ul><li>Preparing media recommendations</li><li>Developing a budget</li><li>Set the timing for the ad campaign</li></ul><p>Through the course of the assignment students will:</p><ul><li>Build an Unbounce landing page for campaign</li><li>Design a Google Adwords campaign to promote landing page</li><li>Survey potential customers and talk with focus groups</li><li>Identify and evaluate potential customer profiles and markets</li><li>Develop an IMC campaign for specific market segments</li></ul><p></p>',5,'2nd year',1,NULL,'local',NULL),(243,13,'review','Data Consultancy',NULL,'MBA B 5P13','Database Systems',50,2016,'summer','<p>Is your database outdated? Are you still using Excel? You could be using technology that could actually help you with your data! Or maybe you want to use your existing data in new ways or for the first time ever.</p>','group','2017-05-01','2017-06-30',20,NULL,'<ul><li>Business plan outlining new use of data/databases</li><li>Functioning prototype</li></ul>',1,NULL,'2017-03-23 21:08:33','2017-06-05 22:56:31','<p>Is your database outdated? Are you still using Excel? You could be using more sophisticated technology that could actually help you with your data! Or maybe you want to use your existing data in new ways or for the first time ever. </p><p></p><p>A group of student-consultants will devise a business plan about how you can maximize your data by using a database.  </p><p></p><p><strong>Past projects included:</strong></p><ul><li>reorganizing data to map customer geographic information </li><li>reorganizing data to find new areas with low penetration</li><li>data modeling from an excel file to a functional database.</li></ul>',4,'MBA',0,NULL,'local',NULL),(244,86,'published','MBA Change Process Consultation',NULL,'MBA 770','Leading Change:',11,2016,'summer','<p>If you are about to embark on a change initiative within your organization allow yourself an external resource to act as a consult for you and your team. MBA students looking to hone their strategy and business fundamentals will evaluate the wider societal impacts of the business change as a whole. </p>','individual','2017-05-22','2017-07-31',100,NULL,'<ul><li>10 minute presentation detailing the project</li><li>Prototype of the changes made</li></ul><p>Each of the 5 groups will do <strong><u>3 months of work</u></strong> to help your firm best manage the change you&#x27;re going through - <strong><u>a total of 1000 hours of work</u></strong>. </p>',1,NULL,'2017-03-23 21:47:48','2017-06-05 22:59:17','<p>If you are about to embark on a change initiative within your organization allow yourself an external resource to act as a consult for you and your team. MBA students looking to hone their strategy and business fundamentals will evaluate the wider societal impacts of the business change as a whole. </p><p></p><p><strong>Some examples include:</strong></p><ul><li>a merger or acquisition</li><li>restructuring </li><li>leadership challenge</li><li>new product or service launch</li><li>implementation of a new technology system</li><li>redesign of an internal system or process</li><li>re-imagine your mission, vision, and purpose</li><li>developing and using learning communities</li></ul>',1,'MBA',1,NULL,'anywhere',NULL),(246,233,'published','Software Development Project',NULL,'CS253','Software Development',20,2016,'fall','<p>Could your organization benefit from a student-team of software developers enhancing or creating computer applications for you?</p>','group','2017-08-28','2017-12-08',60,NULL,'<p>The deliverables are specific to the individual scope of the project. Each organization can expect:</p><ul><li>requirements and design of the system</li><li>working system that is demo-able (though may still have bugs)</li><li>documentation (user and technical) relevant to the project</li><li>methodological artifacts </li></ul><p></p>',2,NULL,'2017-03-23 22:45:43','2017-07-27 01:48:17','<p>Second and Third year computer science students will work the duration of the Fall semester with your organization to develop a software system from ideation to a running system. Each student will work 60+ hours on developing a project of your choice. Better software can decrease long-term costs, quicken on-boarding time for new staff, increase your competitive advantage or increase your company value (amongst other things.) </p><p></p><p>Some example projects include:</p><ul><li>Developing web applications for the front-end </li><li>Developing mobile apps in Android OS or Apple iOS</li><li>Enhancing your existing applications with new features</li><li>Integrating your existing applications with other/new applications</li></ul><p>These student-engineers will create valuable software solutions for your organization that specifically fit your needs.</p>',4,'2nd to 3rd year',0,NULL,'local',NULL),(247,11,'published','Pop-up Retail Case Study',NULL,'RMG800','Independent Project',4,2016,'summer','<p>Share knowledge and learn from your experiences as a pop-up retailer.</p>','group','2017-06-14','2017-08-31',75,NULL,'<p>What your organization will get out of this collaboration:</p><ul><li>A 4-10 page document outline findings/recommendations for pop-up best practices</li><li>Presentation of findings</li></ul>',6,NULL,'2017-03-23 23:11:46','2017-06-05 22:51:55','<p>A group of 4th year and Master&#x27;s student-consultants will conduct a thorough case study that considers popup retailers experiences while in operation. The objective is to investigate best practices by conducting:</p><ul><li>interviews </li><li>on-site audits and analysis</li><li>customer surveys. </li></ul><p>Specifically, the case studies will provide insights into how the strategic aspects related to social environment, service interface, retail atmosphere, assortment, price, customer experiences in alternate channels, and retail brand contribute to consumer experience and success of popup retail operations.</p>',1,'4th year, MScM, and MBA',0,NULL,'local',NULL),(248,59,'published','Multimedia Web Development',NULL,'CSIS 1280','Multimedia Web Development',50,2016,'fall','<p>Students design and build a working website for your organization.</p>','individual','2017-09-04','2017-12-25',60,NULL,'<p>A workable website</p>',5,NULL,'2017-03-23 23:38:46','2017-08-24 16:40:59','<p>Develop a better online presence with a new website for your organization. Using HTML, DHTML and XML students will work to create a website that satisfies your needs - better your market expansion, increase brand awareness, and have a maintainable way to communicate to your market. </p><p></p><p>Have a dynamic page layout that adapts to your users needs. Students will work with you to discern your goals and work to create a final product that you&#x27;ll be proud of. </p><p></p><p>Some examples could include:</p><ul><li>Product/service website</li><li>Not-for-profit informational website</li><li>A portfolio website for your personal business</li></ul>',1,'3rd year',1,NULL,'local',NULL),(249,234,'published','Design Sprints',NULL,'MKTG-4580','Collaborative Innovation',35,2016,'winter/spring','<p> This course is designed to develop students’ skills as problem solvers through learning how engage others (e.g., collaboration) in developing novel solutions.  </p>','group','2017-03-27','2017-06-05',20,NULL,'<p>After 2 weeks of work on your design sprint, the group of student-designers will </p><p>- pitch their ideas and demonstrate their prototypes in a 5-minute presentation</p><p>- submit a 2-page proposal of the idea/prototype with support from consumer insights</p><p></p>',3,NULL,'2017-03-24 20:36:49','2017-04-12 20:16:11','<p> Groups of MS Marketing student-designers will capture consumer insights to develop innovative solutions over an intensive 2-week period. Below are some examples of projects, as thought starters.   But, we are completely open to exploring any real-world marketing project ideas with you. </p><p></p><p>· Developing a New Product/Service </p><p>· Mapping a Customer Experience Journey (e.g., for a particular target market)</p><p>· Co-creating a Community (online and/or offline)</p><p>· Launching a New Business</p><p>· Launching a New Product/Service</p>',4,'MS Marketing',1,NULL,'local',NULL),(250,172,'review','Software Product for your Organization',NULL,'COMP 4393','Senior Design Project',10,2017,'fall','<p>Students will design, develop and test a software-based solution for your organization. </p><p></p>','group','2017-09-01','2017-12-10',100,NULL,'<ul><li>A final report containing the students&#x27; analysis, design, and testing, as well as instructions for operating the network system and drone</li><li>The final code created</li></ul>',3,NULL,'2017-03-24 21:28:19','2017-07-05 00:39:53','<p>4th year student-engineers will devote 100+ hours each to set up a network system in a building and provide you a final report with instructions on maintaining the system (not wiring, but setting up the servers, printers, switches, access points etc.). In groups of 2 they will create a drone that will manage the network system is programmed to complete tasks related to your organization’s preference. These students will:</p><ul><li>Set up your network system (includes servers, printers, switches, access points, etc.)</li><li>Document their work in a final, written report for later reference</li></ul><p></p><p></p>',2,'4th year',0,NULL,'anywhere',NULL),(251,234,'published','Competitive Analysis',NULL,'CiBiC Project','Consumer Insights and Business Innovation Center',1,2016,'winter/spring','<p>This assignment will focus on a student’s ability to collect secondary data related to specific industries and competitive environments and report general findings.</p>','individual','2017-03-27','2017-04-07',30,NULL,'<p>3-5 page document including an </p><ul><li>Overview of the industry and environmental factors impacting the industry (e.g., technological, social, ecological, economic, political. legal) </li><li>Specific information regarding the competitor companies in the designated area (e.g., positioning, messaging, online presence)</li><li>Details of the report to be finalized with client before the project begins</li></ul>',1,NULL,'2017-03-24 21:33:33','2017-04-12 20:15:02','<p>MS Marketing student-researchers will conduct a competitive industry analysis. The projects can be related to local or national industries, such as:</p><p></p><p>- Quick Service Restaurants in Denver, CO</p><p>- Window Installers in the Denver, CO</p><p>- DIY Retailers in the U.S.</p>',1,'MS Marketing',1,NULL,'local',NULL),(252,92,'published','Project Planning',NULL,'MBA K731','Project Management',50,2016,'winter/spring','<p>A group of 5 MBA student-consultants, will develop a thorough project plan for a project of your choosing.</p>','group','2017-02-01','2017-04-12',100,NULL,'<p> The student group will <u><strong>complete ~125 hours of work</strong></u> in order to provide the right plan for your project, including risk assessments and mitigations. This work will be presented in a <u><strong>+10-page document</strong></u>, accompanied by a <u><strong>15-minute presentation.</strong></u> </p>',10,NULL,'2017-03-24 23:48:31','2017-03-26 18:55:19','<p> A group of <u><strong>5 MBA</strong></u> <u><strong>student-consultants, will develop a thorough project plan for a project of your choosing</strong></u>. The plan will describe the work of the project scope, the resources needed, the optimal schedule, project budget, as well as risk management plan. Examples of projects have included, but are not limited to: </p><ul><li><strong>Small construction project (i.e. renovation or small build)</strong></li><li><strong>Development of a new website</strong></li><li><strong>Implementation of a new software or system</strong></li><li><strong>Business process change</strong></li></ul>',5,'MBA',1,NULL,'regional',NULL),(253,239,'published','Marketing Research',NULL,'MKTG390 ','Market Research',50,2016,'winter/spring','<p>A group of student-consultants will provide you with new consumer insights and recommendations that you can use to propel your organization into the future. </p>','group','2017-04-13','2017-06-15',50,NULL,'<p><strong>Outcomes:</strong></p><ul><li>150+ hours of student work</li><li>A 15-minute presentation with the results from the survey</li><li>Recommendations generated from the findings</li></ul>',20,NULL,'2017-03-25 00:53:52','2017-06-05 22:53:06','<p>For 10 weeks, a group of student-consultants will provide your organization with new consumer insights and recommendations that will propel your strategy forward. </p><p></p><p>By conducting secondary data-based research about your industry/consumers they will work to construct a survey to administer then analyze the key findings present in the survey data. </p><p></p><p>This project will provide value to your organization a number of ways including:</p><ul><li>Improving your product/service</li><li>Measures customer satisfaction</li><li>Provides actionable insight to create a better customer experience</li><li>Delivers tangible data that can be used to make better business decisions</li></ul>',5,'3rd Year',1,NULL,'anywhere',NULL),(259,240,'review','Data Analysis and Trend Identification',NULL,'CS133','Introduction to computation and data science ',20,2017,'winter/spring','<p>A team of 3 students in a data analysis class will look at your organizations date set to identify trends and patters using Python and R.</p>','group','2018-03-15','2018-05-17',30,NULL,'<p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to determine that trends that the organization would like information about. </p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on analyzing the data. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome - Report and Presentation: Students will submit a 3-4 page detailed report on the outcomes of the project. Teams will also present for 20 minutes in class. Organization representative(s) are invited to attend these presentations.</p>',1,NULL,'2017-03-25 22:02:24','2017-07-24 23:54:57','<p>Starting in March 2018 a group of 3 students will spend approximately 30 hours over the course of a semester analyzing a small data set. </p><p></p><p>During an initial consultation with the students you will discuss  the types of trends you are interested in. They will examine the data to inform you of trends and patterns using R and Python and provide you a report of their findings. </p><p></p><p><strong>Previous examples of the students work include but are not limited to: </strong></p><ul><li>Analyzing online data bases with information on music and weather </li><li>The students downloaded a music data base looking at the author name, date, album and tired to analyze patterns between the data</li><li>The students looked at a public weather data base and found patters and trends in the month to month weather behaviou</li></ul>',3,'1st year students',0,NULL,'local',NULL),(275,NULL,'draft','Case Study in Organizational Behavior',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-03-27 16:10:57','2017-03-27 16:10:57',NULL,NULL,NULL,0,NULL,NULL,'2017-08-28 23:43:04'),(276,NULL,'draft','Case Study in Organizational Behavior',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-03-27 16:11:02','2017-03-27 16:11:02',NULL,NULL,NULL,0,NULL,NULL,'2017-08-28 23:43:13'),(277,NULL,'draft','Case Study in Organizational Behavior',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-03-27 16:11:19','2017-03-27 16:11:19',NULL,NULL,NULL,0,NULL,NULL,'2017-08-28 23:43:23'),(278,NULL,'draft','Case Study in Organizational Behavior',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-03-27 16:11:28','2017-03-27 16:11:28',NULL,NULL,NULL,0,NULL,NULL,'2017-08-28 23:43:31'),(279,NULL,'draft','Case Study in Organizational Behavior',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-03-27 16:11:32','2017-03-27 16:11:32',NULL,NULL,NULL,0,NULL,NULL,'2017-08-28 23:43:38'),(280,NULL,'draft','Case Study in Organizational Behavior',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-03-27 16:11:49','2017-03-27 16:11:49',NULL,NULL,NULL,0,NULL,NULL,'2017-08-28 23:43:45'),(281,NULL,'draft','Case Study in Organizational Behavior',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-03-27 16:11:49','2017-03-27 16:11:49',NULL,NULL,NULL,0,NULL,NULL,'2017-08-28 23:43:52'),(282,NULL,'draft','Case Study in Organizational Behavior',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-03-27 16:12:12','2017-03-27 16:12:12',NULL,NULL,NULL,0,NULL,NULL,'2017-08-28 23:44:01'),(283,242,'draft','End of Semester Project',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-03-27 18:36:43','2017-03-27 18:36:43',NULL,NULL,NULL,0,NULL,NULL,'2017-08-28 23:45:07'),(284,242,'draft','End of Semester Project',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-03-27 18:36:48','2017-03-27 18:36:48',NULL,NULL,NULL,0,NULL,NULL,'2017-08-31 21:35:00'),(285,242,'draft','Python Project',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-03-27 18:37:49','2017-03-27 18:37:49',NULL,NULL,NULL,0,NULL,NULL,'2017-08-28 23:44:37'),(286,242,'draft','Python Project',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-03-27 18:38:03','2017-03-27 18:38:03',NULL,NULL,NULL,0,NULL,NULL,'2017-08-28 23:54:44'),(287,242,'draft','Python Project',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-03-27 18:38:13','2017-03-27 18:38:13',NULL,NULL,NULL,0,NULL,NULL,'2017-08-28 23:54:53'),(288,242,'draft','Python Project',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-03-27 18:38:24','2017-03-27 18:38:24',NULL,NULL,NULL,0,NULL,NULL,'2017-08-28 23:55:04'),(289,242,'draft','Python Project',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-03-27 18:38:25','2017-03-27 18:38:25',NULL,NULL,NULL,0,NULL,NULL,'2017-08-28 23:55:15'),(290,75,'published','Operations Project Plan','Business','PROJ 3201','Project Management',30,2017,'fall','<p>A group of student-consultants will develop a thorough Project Management Plan for a project of your choosing. </p>','group','2017-09-04','2017-12-21',80,NULL,'<p>The student group will submit a <u><strong>written project plan</strong></u>, as well as <u><strong>formally present their project</strong></u> to the industry partner (in person or virtually). </p>',6,NULL,'2017-03-27 20:50:24','2017-04-10 18:39:50','<p>A group of student-consultants, specialized in Supply Chain and Operations Management, will develop a thorough Project Management plan for a project of your choosing.   Using Project Management theory, students will put together a thorough breakdown of a future project for your organization, including project requirements, schedule and responsibilities.  </p><p></p><p>Each student devotes 30 hours of work over the semester working on improving your organization&#x27;s processes. Trained in LEAN systems, students act as a fresh set of eyes to your existing operations - whether its a specific workstation, the CRM system you use or putting on an event. They will research and analyze data in order to provide you with recommendations on how you can improve and provide an implementation plan going forward.  </p><p></p><p>Students are skilled in supply chain mapping and use of SAP&#x27;s operations planning software.</p><p></p><p>Examples of projects that the students could tackle have included, but are not limited to:</p><ul><li><strong>Rollout of a change in the manufacturing process</strong></li><li><strong>Switching to a new distribution centre</strong></li><li><strong>New product/service launch </strong></li><li><strong>Switching to a new supplier or technology</strong></li></ul>',5,'3rd year',0,NULL,'regional',NULL),(291,11,'published','Technology Solution Consultancy',NULL,'ITM 90A/B','Graduation Project',250,2016,'fall','<p>Over two semesters, a group of 4th-year student-consultants will assess your business processes in order to identify an issue or opportunity for improvement using technology.</p>','group','2017-09-05','2018-04-27',200,NULL,'<p>Students provide a report with their analysis of gaps/opportunities in your organization, including recommendations to address them. They redesign the business process, propose a system solution, develop an RFP/I document, compare vendor solutions to provide a recommendation, and submit the implementation plan for their solution.</p>',25,NULL,'2017-03-27 21:42:02','2017-08-22 16:37:42','<p>Official project kickoff: September 5, 2017 </p><p>Team selection starts from May 2017</p><p></p><p>Over two semesters, a group of 4th-year student-consultants will assess your business processes in order to identify an issue or opportunity for improvement using technology. </p><p></p><p>After identifying where an IT solution is needed, students will research and compare different solutions and vendors. They will go through an RFP process on your behalf, compare responses, and recommend the best solution. </p><p></p><p>Finally, the student group will identify any risks associated with the implementation and detail the change management processes needed. </p><p></p><p>Project scope can include, but is not limited to:</p><ul><li><strong>Sales/marketing gaps indicating a need for CRM solutions</strong></li><li><strong>Large volume of sales transactions data requiring a better system for tracking</strong></li><li><strong>Website performance issues indicating a need for a new hosting solution</strong></li><li><strong>Issues with orders or payments that show a need for a new procurement software</strong></li><li><strong>Inventory control issues that could be addressed by a new order management program</strong></li></ul>',5,'4th Year ',1,NULL,'regional',NULL),(292,242,'published','Applications of Python',NULL,'CS 116','Scripting II with Python',20,2017,'fall','<p>Students will use Python II to provide your organization with data mining and analysis. </p>','group','2017-10-01','2017-12-14',135,NULL,'<p>The final deliverable will be a working Python-based program that is well documented and performs a useful service.</p><p></p><p> All code and documentation will be delivered.</p>',1,NULL,'2017-03-27 23:05:03','2017-05-04 22:20:59','<p>In groups of 4-5, 1st year students will work together to create one or more real-world applications for your organization. Examples include:</p><ul><li>Mining data from spreadsheets or text files</li><li>File format conversions</li><li>Screen-scraping and analyzing/consolidating data from specific websites </li><li>Text analysis from multiple files</li><li>Data cleaning of ASCII/csv files</li></ul><p>These applications could practically be used to generate strong customer analytics or extensive industry data, among other opportunities. </p>',5,'1st year',0,NULL,'anywhere',NULL),(293,201,'published','Creating an E-Commerce Website',NULL,'INFS-3121/6121','Visual Basic - II',25,2016,'fall','<p>Four to five different groups of students will design and develop a website to sell a product of your choice. Buyers will be able to use the website to see the products, click on them for details, add products to a cart, log in and check out. Students will use VB.NET/ASP.NET and SQL Server to complete this project.</p>','group','2017-10-21','2017-12-16',20,NULL,'<p>There are three stages of the project that the students will complete:</p><p>1. A cataloged database of your products</p><p>2. The coding for the back end of the application for populating the catalog in the database with the product info and pictures </p><p>3. A fully designed and developed website (front end)</p>',1,NULL,'2017-03-27 23:58:39','2017-07-04 23:49:01','<p>Each individual group consisting of 4 students (4-5 different groups) will work to develop an e-commerce website to sell a product of your choice. They will create a product catalog and build a product database. They will also write the back end application for populating the catalog in the database with the product info and pictures.</p><p></p><p><strong>Examples include but are not limited to:</strong></p><ul><li>Building an e-commerce website to sell clothing, furniture, general goods, jewelry, etc</li></ul>',4,'Third, Fourth, and Graduate Level Students',0,NULL,'anywhere',NULL),(294,202,'published','Branding/Marketing Strategy',NULL,'MAR 3802','Marketing Management',8,2016,'summer','<p>Students will research your organization’s primary persona and design a branding strategy with a campaign launching test.</p>','group','2017-05-19','2017-06-20',50,NULL,'<p><strong>The final project deliverables are a:</strong></p><ul><li>10-page marketing plan</li><li>5-minute presentation explaining market testing of the plan</li><li>Plan implementation recommendations</li></ul>',1,NULL,'2017-03-28 13:09:17','2017-05-29 18:47:11','<p>Over a 5 week period, 4th year student-consultants working in groups of three will solve a branding or segment development challenge currently facing your organization! Great branding increases customer recognition and loyalty, competitive edge, enhanced reliability as well as a greater ease at new production introduction. </p><p></p><p>The challenge can be related to a range of marketing or branding activities, including (but not limited to):</p><ul><li>Developing a customer profile</li><li>Creating a new branding strategy or a way to reposition your existing brand</li><li>Conducting market testing on the efficiency of a particular campaign or marketing channel</li><li>Developing a new marketing plan</li></ul>',3,'4th Year',1,NULL,'anywhere',NULL),(295,244,'published','Growth & Trend Analysis ',NULL,'FINC 335','Corporate Finance',30,2017,'fall','<p>This Fall, senior finance students will give you fresh insights into your potential growth opportunities by providing a thorough assessment of your financial condition with respect to the competitive landscape you operate in. </p>','individual','2017-09-01','2017-11-30',60,NULL,'<p>The project will be presented through a final report (4-10 pages) outlining:</p><ul><li>Major strengths and weaknesses of your organization</li><li>Limits of the ratio analysis</li><li>Relationship (if any) between the financial statements and your organization&#x27;s stock prices</li><li>Comparison between the growth to date and competitive landscape</li><li>Recommendations for future growth of your organization, including suggestions to potential investors in your organization</li></ul>',3,NULL,'2017-03-28 17:14:36','2017-08-02 23:33:19','<p>Beginning in September, 3rd &amp; 4th years student-consultants will calculate your organization&#x27;s growth-to-date and assess your sustainable growth potential and opportunities. Through research and analysis, the students will provide a detailed comparison of how your organization&#x27;s growth stands to the competitive landscape. </p><p></p><p>Your growth analysis can include, but is not limited to:</p><ul><li><strong>Trend Analysis</strong>: Calculation of financial ratios and growth of your organization using its three most recent years of financial statements</li><li><strong>Competitive Analysis</strong>: Calculation of financial ratios and growth of the industry and your competitors</li><li><strong>Growth Opportunities&#x27; Assessment</strong>: Calculation of your organization&#x27;s sustainable growth rate for the upcoming fiscal years</li></ul>',1,'3rd & 4th years',0,NULL,'anywhere',NULL),(296,244,'review','Measure Your Growth (Fall 2017)',NULL,'FINC 335','Corporate Finance',30,2017,'winter/spring','<p>Get insight into the potential growth and development of your organization.</p>','individual','2017-04-11','2017-04-30',60,NULL,'<p>4-10 document outlining:</p><ul><li>Limits of analysis</li><li>Relationship between the financial statements and your organization&#x27;s stock prices</li><li>Recommendations to the organization and investors. </li></ul><p></p>',1,NULL,'2017-03-28 17:54:01','2017-03-28 17:54:11','<p>Work with 3rd and 4th year university student-consultants to calculate your company&#x27;s growth-to-date as well it&#x27;s it&#x27;s growth opportunity. Through research and analysis students will provide a detailed comparison of how your organization&#x27;s growth compares to the competitive landscape. </p><p></p><p>The students will:</p><ul><li>Conduct trend analysis - calculate financial ratios and growth of your organization using its three most recent years of financial statements</li><li>Do the same calculations for the industry and compare your organization&#x27;s ratios/growth to its industry</li><li>Calculate your organization&#x27;s sustainable growth rate for the upcoming. </li></ul><p></p>',1,'3rd year, 4th year',0,NULL,'local',NULL),(297,228,'published','Document Design',NULL,'MC 323','Digital Publishing Design',12,2016,'summer','<p>Student-designers will work to create a professionally designed digital newsletter for your organization. </p><p></p>','individual','2017-05-15','2017-05-26',10,NULL,'<ul><li>Newsletter tying together news, photos and announcements provided by the client, OR</li><li>Set of customized slides, OR</li><li>Whitepaper (content provided by the client), with custom layout, design and branding</li><li>PDF and ISSUU digital formats</li><li>Edited versions of photos and stories, if requested</li></ul>',7,NULL,'2017-03-28 19:32:27','2017-08-29 18:55:43','<p>Individual student-designers, over 10 hours, will apply their graphic design and layout skills to customizing a document or slide set of your choosing.</p><p></p><p>Students will use InDesign to create these documents and digital platform, including issuu to download and share. </p><p></p><p>Example projects could include:</p><ul><li>A monthly newsletter for internal or external distribution</li><li>A set of slides, branded for your company, that can be used for any presentation</li><li>A 2-4 page white-paper, customized with your logo, branding and a new layout</li></ul>',1,'3rd year',1,NULL,'anywhere',NULL),(298,252,'published','Credit Assessment Project',NULL,'BFIN 425','Commercial Bank Management',7,2016,'fall','<p>Could your organization benefit from additional assessment toward the creditworthiness of current or prospective customers?</p>','group','2017-09-01','2017-12-16',20,NULL,'<p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to devise the project scope and prepare a detailed plan for completion of the project. You will be provided a copy of the plan.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks. You will be provided a preliminary report and asked to make comments.</p><p></p><p><strong>Phase 3</strong> - Outcome - Report and Presentation (if requested): Students will submit a detailed report on the outcomes of the project (length dependent on project). The students will also present their findings to you if requested. </p>',3,NULL,'2017-03-29 14:47:14','2017-09-01 00:07:36','<p>Does your business rely on assessing credit for current and potential customers? In pairs, 4th year students from Elizabeth City State University will spend 20+ hours conducting research and analysis to create prospective client lists and determine how your current clients stack up. Understanding credit worth is crucial to ensuring that your business continues to grow and remain viable. When taking on individual credit loans your company is placed in a vulnerable position to trust your clients. Having accurate information to assess is fundamental to making the right partnerships. Let students help you gather and analyze the data necessary to make informed decisions. </p><p></p><p><strong>Past project examples include, but are not limited to:</strong></p><ul><li>Cell phone provider assessing payment plans for potential clients.</li><li>Vehicle manufacturer determining appropriate leasing plan. </li><li>Credit Card company verifying prospective clients.</li></ul>',2,'4th year',1,NULL,'anywhere',NULL),(299,95,'draft','Homework 03',NULL,'EENG212','Electric Circuits I',28,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-03-29 16:18:10','2017-03-29 17:27:02',NULL,NULL,'Sophomore/Juniors',0,NULL,NULL,'2017-08-28 23:44:48'),(300,9,'draft','Strategies for Bringing Technologies to Market',NULL,'HM801','Bench to Bedside',30,2016,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-03-29 18:52:37','2017-03-29 18:52:37',NULL,NULL,'MBA',0,NULL,NULL,NULL),(301,200,'published','Employee Engagement Survey Design',NULL,'  ','Employee Engagement Survey',10,2017,'summer','<p>PhD students will design an employee engagement survey to provide internal strength and development to your organization.</p>','group','2017-06-01','2017-07-31',40,NULL,'<p>The final project deliverables will be negotiated in detail with the participating organization.</p><p></p><p><strong>Examples include:</strong></p><ul><li>Raw data (only if all &quot;identifying&quot; information is able to removed)</li><li>A 20-minute recorded &quot;webinar&quot; presenting the process/findings.</li><li>A 10 slide presentation &quot;deck&quot; of highlights / take-aways.</li></ul>',2,NULL,'2017-03-29 19:27:27','2017-05-24 21:56:50','<p>In pairs, students will take 40+ hours to design a CUSTOM employee engagement survey for your organization. They will manage the data collection process, analyze the results, and report back consolidated, high-level results. A report summarizing high-level trends, and providing a number of key take-aways / action items will be created for the company that can be presented to various organizational stakeholders.</p><p></p><p><strong>Examples include:</strong></p><ul><li>Increase work satisfaction</li><li>Higher productivity amongst employees</li><li>Better retention and recruitment</li></ul>',2,'PhD students',1,NULL,'anywhere',NULL),(302,256,'draft','Final Project ',NULL,'BA480','International Business',22,2016,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-03-30 14:29:01','2017-03-30 14:29:01',NULL,NULL,'3rd, 4th yr',0,NULL,NULL,NULL),(303,2,'published','Business Analytics Capstone Research Project',NULL,'MBAN 6090 ','Master of Business Analytics (MBAN)',31,2017,'summer','<p>Students will work with your organizations on a substantial business analytics project of your choosing. Their work will combine technical data analytics skills with business consulting.</p>','individual','2017-05-08','2017-08-31',300,NULL,'<p>The final deliverable will be determined by the individual organization, with input from the student. It should include substantive data analysis work.</p>',10,NULL,'2017-03-30 18:19:22','2017-06-05 23:02:52','<p>An individual student will work with your organization on a substantial business analytics project of your choosing. Students will conduct data analysis, using SAS, Python, VBA, Hadoop and machine learning where needed. They can create predictive models and data visualizations to find the business insights you&#x27;re looking for. In addition to technical skills, students have a business consulting background with which to approach their work and can provide insights and recommendations as outside consultants.</p>',1,'Master\'s',1,NULL,'local',NULL),(304,264,'published','Big Data Business Analytics',NULL,'MBAD 6211','Advanced Business Analytics',60,2018,'winter/spring','<p>Graduate students in the Business Analytics program will carry out an analytics project from initial requirements analysis to final implementation by analyzing big data using machine learning algorithms and/or statistical models.</p>','group','2018-04-02','2018-05-11',20,NULL,'<p>Students will conduct an identification of problems, building data mining/statistical models, and validation. They will provide all results to their company partner.</p>',1,NULL,'2017-03-30 18:35:13','2017-04-18 16:24:55','<p>During an intensive, one day challenge, graduate students in the MBA or Data Science and Business Analytics programs will carry out an analytics project on your company&#x27;s data, by analyzing big data using machine learning algorithms and/or statistical models. </p><p></p><p><strong>Project examples include:</strong></p><ul><li>Data analysis with Alaskan Airlines </li><li>Data analysis of King County (WA) real estate transactions</li><li>Home loan analysis using Freddie Mac data</li><li>Marketing analysis for Hawkeye Channel</li><li>Salary analysis for Payscale</li></ul>',4,'MBA',0,NULL,'anywhere',NULL),(305,124,'draft','dsfa',NULL,'ds','dcas',32,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-03-30 21:10:59','2017-03-30 21:11:00',NULL,NULL,'sd',0,NULL,NULL,'2017-07-10 20:32:38'),(306,143,'draft','New Product Marketing Plan',NULL,'BU - 352','Marketing I',50,2016,'summer','<p>After coming up with an idea for a brand new product for your company, a group of students will prepare a marketing plan to bring this to market.</p>','group','2017-05-09','2017-07-18',25,NULL,'<p>Student groups will submit a <u><strong>max 20-page document</strong></u> that outlines the new product idea and its corresponding marketing plan. </p>',1,NULL,'2017-03-31 01:02:28','2017-03-31 01:02:28','<p>After coming up with an idea for a brand new product for your business, a group of students will prepare a marketing plan that describes: the overall market; a competitive analysis; an environmental analysis; target market; product specifications; a positioning statement; and a marketing mix. They will also forecast anticipated results over a 3-year timeframe, including market share and financial analysis.</p><p></p><p></p>',5,'3rd Year',0,NULL,NULL,NULL),(307,143,'draft','Technology Solution Consultancy',NULL,'ITM 90','Graduation Capstone Project',NULL,2016,'winter/spring','<p>Over two semesters, a group of 4th-year student-consultants will assess your business processes in order to identify an issue or opportunity for improvement using technology.</p>','individual','2017-01-16','2017-08-15',NULL,NULL,'<p>Students provide a report with their analysis of gaps/opportunities in your organization, including recommendations to address them. They redesign the business process, propose a system solution, develop an RFP/I document, compare vendor solutions to provide a recommendation, and submit the implementation plan for their solution.</p>',1,NULL,'2017-03-31 01:34:18','2017-03-31 01:34:18','<p>Over two semesters, a group of 4th-year student-consultants will assess your business processes in order to identify an issue or opportunity for improvement using technology. They will then identify an IT solution tailored to your company after evaluating vendors (via RFP) to recommend the most appropriate solution. Finally, they will identify risks associated with implementation and the change management processes needed. Project scopes can include, but are not limited to;</p><ul><li><strong>sales/marketing gaps indicating a need for CRM solutions</strong></li><li><strong>website performance issues</strong></li><li><strong>accounts payable issues with ordering/payment </strong></li><li><strong>recruitment process hiring of employees</strong></li><li><strong>sales and order fulfillment</strong></li><li><strong>client acquisition process, etc.</strong></li></ul>',1,'4th Year ',0,NULL,NULL,NULL),(308,265,'review','Earth Science',NULL,'GIS315','Remote Sensing & GIS',20,2016,'fall','<p>This assignment is focus on earth observation study through satellite data. </p>','individual','2017-04-01','2017-06-30',30,NULL,'<p>Students must be submit 15-20 pages report and give 20 mints presentation.</p>',5,NULL,'2017-03-31 07:33:37','2017-04-04 15:58:37','<p>Students works such as land use/cover change detection, risk assessment. </p>',1,'MS',0,NULL,'anywhere',NULL),(309,288,'published','MBA Company & Competitive Analysis',NULL,'231A','MBA Financial Statement Analysis and Forecasting',140,2016,'fall','<p>MBA student-consultants will work with your company to conduct a thorough analysis of your financial health and the competitive ecosystem in your industry to offer insights and recommendations of improvement. </p>','group','2017-10-01','2017-12-04',20,NULL,'<p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to devise the project scope and prepare a detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome - Report and Presentation: Students will submit a detailed report on the outcomes of the project. Teams will also present this in the last class. Organization representative(s) are invited to attend these presentations.</p><ul><li>10-page comprehensive report + appendices thoroughly detailing the group findings</li><li>20-minute presentation followed by Q&amp;A</li></ul>',5,NULL,'2017-03-31 17:05:54','2017-08-10 23:35:48','<p>MBA student-consultants will research your company, your industry, and your competitors in order to conduct a thorough analysis of your organizations health compared to industry averages. </p><p></p><p><strong>Project examples include, but are not limited to;</strong></p><ul><li><strong>Industry Analysis - </strong>Defining the industry, identifying main competitors, analyzing industry characteristics (level of competition, barriers of entry, monopoly, etc.).</li><li><strong>Strategy - </strong>Identifying and discussing company strategies, in comparison with your main competitors. Assessing the company&#x27;s current competitive advantage</li><li><strong>Profitability and Risk Analysis  - </strong>Computing different ratios from the financial statements you provide to explain trends of your organization vs. your competitors.</li><li><strong>Assess earnings quality  - </strong>Analyzing source(s) of earnings: specific item(s) and/or factors (internal and/or external to your organization and your competitors) affecting your organization&#x27;s current profitability.</li></ul><p>NDAs can be signed by student teams on a case-by-case basis with organizations. There is also no requirement for exact financial data to be provided, estimates and falsified numbers will work for the purpose of the project.</p>',5,'MBA',0,NULL,'anywhere',NULL),(310,90,'published','Consumer Behavior Strategies ',NULL,'MKTG 307','Consumer Behavior',30,2016,'fall','<p>Student-consultants will work to solve your organization&#x27;s most pressing consumer behaviour questions. </p>','group','2017-09-07','2017-12-04',100,NULL,'<ul><li>500+ hours of student effort</li><li>10-page document detailing consumer behaviour research and marketing solutions</li><li>Final presentation (attendance optional) </li></ul>',6,NULL,'2017-03-31 17:17:24','2017-08-01 14:26:17','<p>Give your marketing team an added opportunity to benefit from research into your organization’s consumer behaviours. </p><p></p><p>A team of 5 student-consultants will work 500+ hours to create marketing strategies that will seek to answer one of your marketing problems. Solutions could involve discovering the most effective promotional activities for your consumers, to understand why, when, how, what and other factors that influence their buying decisions, to influence design for the best possible product for your consumer’s needs, etc. </p><p></p><p>Some examples include:</p><ul><li>Why don&#x27;t my customers shop online on Tuesday afternoons for anything purple?</li><li>Why does a rainy day in one state increase my customers for that day, while decreasing in another state?</li></ul>',5,'3rd year',0,NULL,'local',NULL),(311,75,'review','Digital Marketing Plan',NULL,'MKTG 4207','Digital Marketing',1,2016,'fall','<p>Present a marketing opportunity unique to your organization to challenge 4th year students. </p>','individual','2017-09-01','2017-12-16',80,NULL,'<ul><li>Digital marketing report addressing unique challenges of organization&#x27;s opportunity</li><li>Presentation outlining research, findings and recommendations. </li></ul>',1,NULL,'2017-03-31 18:53:09','2017-03-31 19:05:30','<p>4th year students will spend 80+ hours conducting industry research in your organizations competitive landscape. They will evaluate your competition, potential customers, and your organization goals to create a strategic digital marketing plan. </p><p></p><p>A good digital marketing strategy can help your organization connect with more consumers, generate higher conversion rates, it enables real-time customer service, and can deliver higher ROI from your marketing campaigns. Get Durham College students to help with your digital marketing plan now.</p><p></p><p>Example projects include:</p><ul><li>new product launch</li><li>a brand campaign</li><li>or a brand repositions for expansion </li><li>new target markets</li></ul><p></p>',1,'4th year',0,NULL,'local',NULL),(312,11,'draft','Dcxzd',NULL,'SF','sxcS',321,2017,'fall','<p>dfasa</p><p></p>','individual','2017-03-15','2017-03-17',23,NULL,'<p>dsfas</p>',1,NULL,'2017-03-31 21:12:33','2017-03-31 21:22:29','<p>dasfad</p>',1,'dxzdf',0,NULL,NULL,'2017-06-16 18:34:32'),(314,225,'review','Decision-Making with Analytics',NULL,'KMCI 940-5','Data Analytics Decisions',50,2017,'winter/spring','<p>This assignment will allow students to shed light on an important and real business decision through analysis of quantitative data and knowledge of the business context.</p>','group','2018-02-12','2018-03-15',20,NULL,'<p>Project deliverables include:</p><p>1. 10+ page presentation deck</p><p>2. 20-30 minute presentation to industry partner</p>',4,NULL,'2017-04-03 15:07:35','2017-06-20 17:16:19','<p>Students must be able to use raw or aggregated data to help a company make a well-defined business problem.</p><p></p><p>For instance, students could use customer-level data to build a predictive model to identifying customers most likely to churn, leading to the creation of strategies to enhance retention.</p><p></p><p>Students could assess prospective customer data to test hypotheses about what kinds of marketing activities best yield new customers. </p><p></p><p>Students could assess operational data to predict performance and inform decision-making.</p><p></p><p>Alternatively, students could review existing data at a company and help that company develop an analytics strategy to answer specified business questions.</p><p></p><p></p>',5,'MBA',0,NULL,'anywhere',NULL),(315,116,'published','Business Compliance Consulting',NULL,'MBE 600','Capstone: Ethics and Compliance',10,2016,'summer','<p>This is a flexible project, where students can complete an ethics and compliance related initiative for your organization, focused on one of any number of areas (eg. charitable giving program, corporate sustainability, code of conduct, disaster recovery plan).</p>','group','2017-07-10','2017-09-30',45,NULL,'<ul><li>8- to 10-page final report</li><li>15 to 20 minute presentation</li></ul>',4,NULL,'2017-04-03 15:08:07','2017-08-03 23:15:16','<p>Masters students studying business ethics and compliance will work in teams of two for 90+ hours to assist your company in the implementation of a program that will improve your business&#x27;s operations.</p><p></p><p>Students can contribute to an existing initiative or create a plan from scratch for a new program. </p><p></p><p>Examples of this include implementing:</p><ul><li>Philanthropic policy</li><li>Corporate Social Responsibility - &quot;Green&quot; initiatives</li><li>Risk Management Programs, such as a disaster recovery plan</li><li>Programs that ensure compliance with regulations or laws that apply to your business</li><li>Code of Conduct policy/procedures</li><li>Governance procedures (Board and executive responsibilities)</li></ul><p>Past project examples the students have completed are described below. Future projects can include new areas!</p><p></p><p><em>ABC Corporation (ABC) is deeply involved in the support of charitable organizations both locally and globally in the U.S., and receive hundreds of requests for cash, in kind support, and medical equipment every year. A large number of these requests come from customers and local organizations and are received by ABC sales personnel and other employees. Currently, ABC has a program for global donations through an independent foundation outside of the U.S. and a North American donations program through a broad market program, but did not have a program to address compliant charitable giving regionally, especially in the areas where employees work and live. Risks were identified and it was determined to mitigate these risks, a localized program was necessary. This particular project created value by minimizing non-compliant and illegal activities by putting a compliant process and program in place that mitigates risks and takes the decision making out of the hands of the sales force and executives, thus maximizing effectiveness, and sets clear expectations for requestors. The project proved to be effective and efficient for ABC.</em></p><p></p><p><em>__________</em></p><p></p><p><em>An IT Company located in Hawaii was in need of a Code of Conduct. A code of conduct can produce value from both the perspective of decreasing net costs, as well as to help to generate net revenues. Decreasing net costs are mainly found in cost avoidance associated with risk mitigation. A code of conduct seeks to minimize employee misconduct which can result in lost productivity, external claims, litigation, and reputational damages to the firm. In terms of generating new revenues, a code of conduct offers an opportunity for a firm to positively differentiate themselves in the marketplace. While the mere existence of a code of conduct demonstrates certain commitments of the firm towards ethical conduct, ideally the code should translate into actual behaviors that are positive and in line with the company’s mission and values. Such an alignment, particularly for firms who are looking to outperform their competition, offers a way to create a competitive advantage for the firm that can directly impact the bottom line.</em></p><p><br/><em>__________</em></p><p></p><p><em>A large regional bank with several branch operations located in southern New England requested enhancements to its already existing business continuity and disaster recovery plan. A solid business continuity and disaster recovery plan is an essential part of a company’s information technology program. The project involved determining the main geographical and environmental risks and analyzing the severity of these risks present in the bank’s footprint. The same risks were then analyzed for other cities and states in the U.S. to determine possible locations and backup recovery centers.</em></p><p></p><p></p>',2,'Master of Science in Business Ethics and Compliance',1,NULL,'anywhere',NULL),(316,73,'published','Recruiting and Selecting a New Hire',NULL,'BU 408','Recruitment & Selection',28,2016,'summer','<p>Filling a position? Students will develop a targeted recruitment process and selection framework for a particular role that your organization is looking for.</p>','group','2017-05-09','2017-08-31',30,NULL,'<p>Student groups will submit a hiring selection system in an actionable document that explains the different processes so that you can start using it right away.</p>',5,NULL,'2017-04-03 20:19:09','2017-08-03 23:08:40','<p>Is your organization hiring for a particular key role? Students who are fully up to date on the latest in HR processes and innovation will develop a recruitment plan for you and a selection system to help you attract and identify the best possible candidates.</p><p></p><p>Share with the students your criteria for the role and some background information about the company, and they will take it from there.</p>',5,'4th Year',1,NULL,'anywhere',NULL),(317,274,'draft','Comprehensive Financial Life Plan for Family Owned Business',NULL,'MYMC2017','Personal Finance',6,2016,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-04-04 00:54:37','2017-04-04 00:54:37',NULL,NULL,'4th Year',0,NULL,NULL,NULL),(318,276,'draft','Test',NULL,'ADM-17531','Plan d\'affaires',24,2016,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-04-04 15:43:18','2017-04-04 15:43:18',NULL,NULL,'2nd College',0,NULL,NULL,'2017-09-01 13:58:31'),(319,200,'published','Integrated Marketing Communications Consultancy',NULL,'MMC 4410','Integrated Communications Campaigns',24,2016,'fall','<p>Develop a marketing communications plan for your organization - receive a plan book with creative details inside. </p>','group','2017-08-21','2017-12-01',90,NULL,'<p>A complete campaign plan book containing (1 per 5-6 person team):</p><p></p><ul><li>Title Page </li><li>Table of Contents</li><li>Executive Summary</li><li>Introduction</li><li>Problem Statement: FROM THE CLIENT BRIEF</li><ol><li>Situation Analysis (Secondary Research)</li><li>Problems and Opportunities (SWOT)</li></ol><li>Primary Research (qualitative and quantitative): FROM THE RESEARCH BRIEF</li><ol><li>All methodologies</li><li>Describe composition of  participants (age, ethnicity, city of residence, psychographic       information)</li><li>Include discussion guide or  questionnaire </li><li>Findings</li></ol><li>Creative Recommendations: FROM THE CREATIVE BRIEF </li><ol><li>Must include the creative brief and all creative tactics or executions</li><li>Outline Campaign Objectives and Creative Strategy </li><li>Include Creative Tactics (Creative Work) with brief explanation of media channel and execution</li></ol><li>Media Plan with all its sections (social media, online advertising, offline marketing, etc.)</li><li>Public Relations plan </li><li>Administrative Implementation Section:</li><ol><li>Budget - All projected campaign costs to be included here, including agency fees.</li><li>Implementation Schedule - Flowchart</li><li>Human Resource Considerations</li></ol><li>Evaluation Section: How will campaign success be measured</li><li>Limitations</li><li>Bibliography</li><li>Appendix: all documents used in the development of the campaign, for example, include the full discussion guide or questionnaire</li><li>Brief Student Bio (one paragraph on each team member with photo)</li></ul><p> </p><p></p>',2,NULL,'2017-04-04 16:28:41','2017-06-07 19:31:24','<p>In groups of 5-6, marketing communications students will spend 90+ hours to researching, analyzing and creating a tailored communications plan addressing a specific challenge or opportunity your organization is facing. With your guidance, areas of focus for this project will include but are not limited to;</p><p></p><ul><li>primary/secondary market research, </li><li>campaign creative theme and brief,</li><li>media planning (social media, online advertising, offline marketing, etc.),</li><li>public relations strategy, and</li><li>administrative/implementation strategy.</li></ul><p></p><p>This project could be a good fit if you&#x27;re looking to better communicate and engage to Millennials and Gen Z, you&#x27;re thinking of introducing a new product/service, or you&#x27;re interested in re-branding/positioning, etc.</p><p></p>',24,'Seniors',1,NULL,'anywhere',NULL),(320,276,'review','Digital Newsletter Design',NULL,'MC 323','Digital Publishing Design',12,2017,'summer','<p>Student-designers will work to create a professionally designed digital newsletter for your organization. </p><p></p>','individual','2017-05-15','2017-05-22',10,NULL,'<ul><li>Four-page newsletter tying together news, photos and announcements provided by the client</li><li>PDF and ISSUU digital formats</li><li>Edited versions of photos and stories, if requested</li></ul>',1,NULL,'2017-04-04 17:08:04','2017-06-05 19:24:58','<p>Individual student-designers, over 10 hours, will take multi-textual materials provided by your organization and design the elements into a visually stimulating digital newsletter for printing or online consumption. </p><p></p><p>Students will use InDesign to create these documents and digital platform, including issuu to download and share. </p><p></p><p>Example projects could include:</p><ul><li>Marketing material targeting a new campaign within your organization</li><li>Internal documents that help staff understand their workflow</li><li>A monthly newsletter that is distributed to user base</li></ul>',1,'3rd year',0,NULL,'local',NULL),(321,276,'draft','Media Production',NULL,'GMCS 546','New Media & Information Management',0,2016,'winter/spring','<p><u><strong>Creative students will serve as your &quot;agency&quot; and work for you for six weeks</strong></u> to produce digital and/or traditional media deliverables you can use.</p>','individual','2017-01-15','2017-03-15',80,NULL,'<p>The deliverables depend on your needs and students&#x27; skill sets. Final products may include: </p><p>- outdoor billboards or street art or kiosks </p><p>- web advertisement \n- audio commercial (online of on-air)                 </p><p>- print advertisement or brochures  \n- social media banners, skins, art, etc                  </p><p>- public relations collateral \n- augmented reality collateral / media               </p>',1,NULL,'2017-04-04 17:13:00','2017-04-04 17:13:00','<p>Whether it&#x27;s web-based or print, audio or video, outdoor or public relations, students will <u><strong>deliver media that speaks to your goals and objectives</strong></u>. </p>',1,'Graduate',0,NULL,NULL,NULL),(322,250,'published','Project Management Plan ',NULL,'MGT 4389','Team Leadership',80,2016,'fall','<p>Could your organization benefit from multiple teams of student-project managers assisting in planning and executing a special project?</p>','group','2017-08-28','2017-11-27',100,NULL,'<ul><li>An executive summary (One-Page Memo) including the Scope, Findings and Observations, Recommendations, Action Items, and Feedback &amp; Metrics.</li><li>A 10 - 15 minute presentation including Q&amp;A summary of the process and project.</li><li>A 10 - 15 page narrative of the project process including details of paths followed and changes made during the course of the project.</li><li>A 1 - 2 page summary of lessons learned, as it relates to the specific project.</li></ul>',4,NULL,'2017-04-04 17:34:13','2017-08-11 21:48:50','<p>Over 13 weeks, three to four individual teams of 4th year business students will work to address a project management challenge of your organization&#x27;s choosing.</p><p></p><p>Students will conduct risk analysis, budgeting, scheduling and planning for any major project your organization needs to implement in the coming year.</p><p></p><p>The project may be focused on any of the items shown below, or any other aspect related to project management:</p><ul><li>New product research</li><li>Product analysis - performance</li><li>Product improvement</li><li>Customer analysis</li><li>Marketing approaches</li></ul><p></p>',5,'4th year',1,NULL,'local',NULL),(323,61,'published','Client Marketing Plan',NULL,'MKTG 3000','Strategic Marketing Decision Making',40,2017,'winter/spring','<p>The <strong>students will research, analyze and create their plan</strong> all while being coached by their instructor. </p>','individual','2017-01-17','2017-03-29',80,NULL,'<p>The final deliverable is a <strong>comprehensive</strong> <strong>marketing plan and presentation with actionable recommendations</strong> based on a clear, well-defined goal.</p>',10,NULL,'2017-04-04 18:37:27','2017-04-04 19:09:41','<p>Are you in need of a strategic marketing plan? Three groups of student-consultants will each spend two months developing a marketing plan unique to your organization. Whatever it is, these student-consultants work to <u><strong>solve your marketing problem by researching you, your industry, and your market</strong></u>. Project scopes can include, but are not limited to;</p><ul><li><strong>promoting a new product/service launch,</strong></li><li><strong>expanding your product line</strong></li><li><strong>improving website conversions</strong></li><li><strong>increasing revenue for an existing product/service,</strong></li><li><strong>increasing market share,</strong></li><li><strong>customer acquisition/retention,</strong></li><li><strong>increasing brand awareness, and</strong></li><li><strong>meeting the needs of a specific customer segment, etc. </strong></li></ul>',1,'3rd Year',1,NULL,'local',NULL),(324,61,'published','Service Provider Audit & Consultancy',NULL,'ENTR 4130','Entrepreneurial Management for Service Organizations:',40,2016,'winter/spring','<p>Student-consultants will <u><strong>analyze your specific service landscape and provide recommendations about how your organization can improve its service</strong></u> <u><strong>experience.</strong></u></p>','group','2017-01-13','2017-03-24',85,NULL,'<p>Each group of student-consultants will <u><strong>spend +100 hours working</strong></u> <u><strong>on</strong></u> <u><strong>your organization</strong></u>. At the end of which, each group will showcase their servicescape recommendations to you in a <u><strong>15-minute presentation, which will be accompanied by a +10-page document detailing their research and reasonings</strong></u>. </p>',22,NULL,'2017-04-04 18:47:39','2017-04-04 19:09:11','<p>Six groups of student-consultants will <u><strong>analyze your specific service landscape and provide recommendations about how your organization can improve its service</strong></u> <u><strong>experience</strong></u>, while maximizing the value for the customer, business, and employee. Past examples include, but are not limited to:</p><ul><li><strong>teams assess the servicescape of individual retail outlets of a national chain to find differences between locations</strong></li><li><strong>teams designed the servicescape of a new restaurant and recommendations were incorporated into the final build</strong></li><li><strong>teams recommended how to change the service experience of a marketing company to be more aligned with clients </strong></li></ul>',4,'4th Year',1,NULL,'regional',NULL),(325,61,'published','Client Marketing Plan ',NULL,'MRKT 3000','Strategic Marketing Decision Making:',25,2016,'fall','<p>Three groups of student-consultants will each spend 2 months developing a marketing plan unique to your organization to <u><strong>solve your marketing problem by researching you, your industry, and your market</strong></u>. </p>','individual','2016-09-06','2016-12-08',90,NULL,'<p>Students will submit a <u><strong>detailed and comprehensive marketing plan</strong></u> for your organizations.</p>',15,NULL,'2017-04-04 18:52:49','2017-04-04 19:12:28','<ul><li>New points of market entry</li><li>Social media</li><li>Calendar</li></ul><p></p>',1,'3rd Year',1,NULL,'anywhere',NULL),(326,61,'published','Client Marketing Plan Capstone',NULL,'MRKT 4331','BBA in Marketing Management:',55,2016,'fall','<p>Individual students will act as a consultant, spending 15-20 hours per week for 8-10 weeks, developing a marketing plan unique to your organization.</p>','individual','2016-09-07','2016-12-15',100,NULL,'<p>Students will submit a <u><strong>5-page report</strong></u> identifying their recommendations and subsequent implementation plan with a fully costed budget and forecasted incremental revenue expected. They will also do a <u><strong>45-minute presentation of their findings</strong></u> to you, in person. Students are graded on the feasibility and realistic nature of their recommendations, as well as<u><strong> the potential value they create for your organization</strong></u>.</p>',8,NULL,'2017-04-04 19:03:57','2017-04-04 19:10:19','<p>Are you expanding your product line? Opening a new location? Or do you just want to improve your website conversations? Whatever it is, a student-consultant works to <u><strong>solve your marketing problem by researching you, your industry, and your market</strong></u>. </p>',1,'4th Year',1,NULL,'regional',NULL),(327,174,'published','Senior Student Design Project in Bioengineering at UCSD',NULL,'BENG 187','Capstone Design Project',50,2016,'other','<p>A multidisciplinary group of Bioengineer senior students will address an engineering design need for a sponsor&#x27;s medical problem/process.</p>','group','2017-09-01','2018-05-20',20,NULL,'<p>Quarter 1, Spring 2017: selection of project (NOW!)</p><p>Quarter 2, Fall 2017: research and design of project question and solutions including limitations, medical standards, ethics considerations, manufacturability, environmental considerations, costs. </p><p>Quarter 3, Winter 2017/2018: implementation of design solution, build prototype or enhance process</p><p>Quarter 4, Spring 2018: final report, presentation and poster at UCSD, website </p>',15,NULL,'2017-04-04 19:46:54','2017-04-28 21:08:31','<p>In order to provide a real-world design experience in an educational environment, the UCSD Bioengineering capstone design course solicits projects from industry, research, and the community. Teams of 3-4 students are given an open-ended design problem, and at the end of the design period, deliver a solution of a bioengineering problem to the sponsor. Project topics can be interdisciplinary and have included medical device (mechanical) engineering, electrical engineering, chemical engineering, and computer control. Teams are usually consisting of students from interdisciplinary programs: Bioengineering, Biotechnology, Biosystems, and Bioinformatics. High levels of student motivation and creativity have lead to award winning design solutions that have been adapted by the sponsoring companies as part of their products or manufacturing processes. </p><p>Examples: </p><ul><li>Development of Methods for Increased Purity and Specificity of Antibodies for Clinical <br/> Diagnostic Reagents. (<strong>Beckman Coulter</strong>) </li><li>Development of Small Scale Bioreactors. (<strong>Histogen</strong>) </li><li>Acoustic Characterization of Microspheres for Gene Delivery. (<strong>Targeson) </strong></li><li>Development of a Non-invasive Venous Pressure Sensor with Piezoelectric Transduction. (<strong>UC San Diego School of Medicine</strong>) </li><li>Skin Interface for a Biointegrated Prosthetic. (<strong>BioMedical Strategies</strong>) </li><li>Development of a dissolvable tailless ureteral stent for kidney stone surgery. (<strong>Surgery Dept/Urology Divis</strong>ion) </li><li>Design of a Nitrous Mask (<strong>La Jolla Shores Dental) </strong></li><li>A Simulation Model of Large Volume (&gt; 2ml) Subcutaneous Injections in Tissues <br/> (<strong>Halozyme Therapeutics</strong>) </li><li>Development of Non-contact Biopotential Sensors. (<strong>Cognionics, Inc.) </strong></li><li>Simulation of flow dynamics of differently shaped particles from needles. (<strong>SKS Ocular</strong>) </li><li>Cold Therapy Pad Analysis and Design. (<strong>BREG</strong>) </li><li>Hybrid Control of a Quadcopter using an EEG-Based Brain Computer Interface and Eye <br/> Gaze. (<strong>Qusp</strong>) </li><li>Development of a Home Health Diagnostic Tool. (Drug Delivery Experts, <strong>Rhodes &amp; Associates LLC</strong>) </li></ul>',4,'4th year Undergraduate in Bioengineering',0,NULL,'local',NULL),(328,92,'published','Online Business Strategy',NULL,'MBA K724','e-Business Strategies',25,2017,'summer','<p>MBA students will analyze your industry and organization, review your digital strategy, and recommend areas to improve your online strategy.</p>','group','2017-05-08','2017-07-27',100,NULL,'<ul><li>20 page report summarizing the analysis and recommendations</li><li>20 minute presentation of findings</li></ul>',6,NULL,'2017-04-05 02:46:38','2017-05-17 23:18:02','<p>MBA students will analyze your industry and organization, review your digital strategy, and recommend areas to improve your online strategy.  </p><p></p><p>If your business relies on your website for conversions, has an eCommerce component or has any substantial online presence, you could benefit from fresh insights into your online strategy by students who have specialized education in this field.</p><p></p><p><strong>The student&#x27;s project scope can include:</strong></p><ul><li>analyzing the organization and its industry</li><li>analyzing the organization&#x27;s digital strategy</li><li>making recommendations for digital strategy (including web, mobile, social, marketing, etc.)</li><li>making recommendations for user experience and usability </li><li>web traffic analysis (if the organization can provide google analytics data)</li></ul>',4,'2nd year MBA',1,NULL,'local',NULL),(329,216,'published','Strategic/Technical Consulting',NULL,'BUAD 693','Capstone Project (Full-Time MBA)',62,2016,'fall','<p>Working in teams of 5-6, post-graduate students-consultants will address a significant challenge, problem, or business opportunity your organization is facing.</p>','group','2017-08-28','2017-12-08',180,NULL,'<ul><li>10-12 page report and other deliverables as needed, e.g. electronic tools, process maps, training documents, marketing materials</li><li>1 hour presentation (including Q&amp;A)</li></ul>',10,NULL,'2017-04-05 15:30:56','2017-08-03 22:43:20','<p>4-5 student-consultants will work 180+ hours to answer the big questions that truly matter to your organization. In the past students have successfully completed process improvement projects; customer discovery and product-market fit assessments for evolving products/services; market/segment attractiveness evaluations for existing products/services; big data projects to identify &quot;so what&quot; insights and create actionable recommendations; and strategy projects that develop and evaluate one or more options according to short/long-term client criteria. </p><p></p><p>Here are a few examples of past projects:  </p><ul><li>evaluating new markets for potential entry </li><li>analyzing invoicing delays, delinquent payers, and contract terms to identify opportunities to reduce working capital costs </li><li>applying design thinking principles to develop ideas to double same-store sales while reducing store size by half </li><li>developing actionable customer profiles and a multi-pronged marketing strategy including digital media </li><li>analyzing spend across plants to identify patterns, categories, and opportunities to reduce costs </li><li>creating processes and tools to support capacity analysis and effective workforce planning.  </li></ul>',5,'Post-graduate; ~5 years work experience',1,NULL,'anywhere',NULL),(331,8,'draft','Data Mining and Analytics ',NULL,'Computing 30072','Computing Practice and Theory',40,2016,'summer','<p>Working in groups, students will mine data and apply statistical analysis to a business problem you are facing, with an emphasis on marketing. They will use tools such as R, Excel, Python and Tableau. </p>','group','2017-04-17','2017-06-16',NULL,NULL,'<p>Students will provide a 1-3 page document summarizing their findings and analysis. They will also deliver their results as a presentation (virtual or in person).</p>',1,NULL,'2017-04-06 17:00:32','2017-04-06 17:00:32','<p>Working in groups, students will mine data and apply statistical analysis to a business problem you are facing, with an emphasis on marketing. They will use tools such as R, Excel, Python and Tableau. </p><p></p><p><strong>Project examples include, but are not limited to:</strong></p><ul><li>Mining social media sites to identify key demographics for marketing campaigns </li><li>Analyzing your own customer data to create a profile of the highest-value customers</li><li>Creating a web page to gather information on consumer behavior for analysis</li><li>Creating data visualizations from available market research, sales or customer data</li></ul>',5,'3rd & 4th Year',0,NULL,NULL,NULL),(332,159,'review','VB.NET/SQL Server Desktop Application Development',NULL,'IT031','Visual Basic Applications for Business',15,2018,'winter/spring','<p>Students will design a desktop application to gather informational data from users, save that data to a SQL Server database and have the application retrieve that data for further use.</p>','group','2018-01-29','2018-05-09',40,NULL,'<p>The deliverable is the functioning application and a presentation.</p>',4,NULL,'2017-04-06 20:15:25','2017-06-01 21:49:03','<p>Students have designed various applications that requires data entry, saving data to a database and retrieving data from a database and displaying that data.  Some students have integrated add-ons such as Google Maps with their application for extra functionality.</p><p></p><p>Project examples include but are not limited to:</p><ul><li>Having students design a data analysis application</li></ul>',4,'Junior and Senior',0,NULL,'anywhere',NULL),(334,190,'published','Master\'s Level Business Analysis Project',NULL,'ITM 6899','Capstone Project (B)',12,2017,'summer','<p>Get a team of masters students in business analytics to research and solve one of your organization&#x27;s challenges. </p>','group','2017-06-15','2017-09-15',40,NULL,'<ul><li>20-page report to clearly document the findings, conclusions and recommendations drawn from the data; </li><li>20-30 minute presentation that effectively communicate&#x27;s the results and findings of the analysis </li></ul>',4,NULL,'2017-04-07 04:46:41','2017-08-03 23:09:43','<p>Do you have a challenge or opportunity facing your business that data or business analytics would help with? Do you want to know more about your website analytics, where you should be spending more money or time, or which customers convert better? </p><p></p><p>In groups of 3-4, student-analysts will spend 40+ hours each on research and development towards a solution to one of your organization’s challenges. Over a 3 month period they will conduct a capstone project that will seek to create comprehensive, data-driven recommendations to benefit your organization. There are many diverse opportunities within the scope of this project.</p><p></p><p><strong>Some examples include: </strong></p><ul><li>Evaluate the effectiveness of a marketing campaign</li><li>Understand how users interact with the product to optimize product design</li><li>Predict whether a customer will become a VIP customer</li><li>How a political campaign can use data to rally voters</li></ul>',4,'Masters Students',1,NULL,'anywhere',NULL),(335,NULL,'draft','Social Media Marketing Plan Presentation',NULL,'MKT/443','Social Media Marketing',15,2017,'other',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-04-07 18:10:03','2017-04-12 18:15:27',NULL,NULL,'Junior/Senior Digital Marketing Major',0,NULL,NULL,NULL),(336,59,'published','International Marketing Analysis & Reporting',NULL,'MARK 3300','International Marketing',33,2017,'summer','<p>The project would provide the students with the experience of working on an international marketing project outside of the USA.  </p>','group','2017-05-22','2017-08-10',60,NULL,'<p>The clients will receive a complete marketing plan with recommendations. </p><p></p><p></p>',10,NULL,'2017-04-07 18:14:29','2017-08-03 22:58:59','<p>Before entering your organization into the international landscape it is important to have an understanding of how to successfully market your product/service. Higher level student-consultants in groups of 4 will spend 40+ hours conducting preliminary research and analysis to develop a marketing report detailing a plan for your organization to go global (beyond the USA). </p><p></p><p>Some areas that these students can help you to understand are:</p><ul><li>How to reach your target market in country of choice</li><li>Most effective marketing techniques for area of choice</li><li>Analysis of the effectiveness of entering market of choice. </li><li>Generate an approach for identifying and analyzing the key cultural and environmental characteristics of any nation or global region</li></ul><p>The expectation is that the students would execute all the required marketing functions (for example: market research, market analysis,  promotion, pricing and distribution). A global marketing strategy can help your organization improve product/service effectiveness, give a strong competitive edge, or heighten customer awareness. Take this opportunity to analyze how you could benefit from expanding internationally.</p>',4,'Senior',1,NULL,'anywhere',NULL),(337,276,'draft','Communications and Public Relations',NULL,'C2C-6','C2Careers Bootcamp',24,2016,'summer','<p>Create a system to easily communicate the goals behind your organizations advertising and promotional materials. </p>','group','2017-05-09','2017-05-26',40,NULL,'<p><strong>Deliverables</strong></p><ul><li>15 minute presentation</li><li>10+ page strategic communications plan</li></ul><p>They will have 15 minutes to answer your questions and provide more detail about their findings, analyses and recommendations.</p>',1,NULL,'2017-04-07 19:03:19','2017-04-07 19:03:19','<p>A group of 3 or 4 University Grads acting as outside consultants for your organization will work closely with you to develop a strategic communications plan for your organization. </p><p></p><p>Using skills and tools developed in-class students will work to diagnose and provide a recommended execution as well as provide next steps to help your organization understand the roadmap to effective strategic communication. </p><p></p><p><strong>Project examples include, but are not limited to: </strong></p><ul><li>Research and analysis of existing plan</li><li>Strategy for public and media relations</li><li>Event planning and management for target audience(s)</li><li>Strategic digital communications and social media marketing</li></ul>',3,'University Graduates',0,NULL,NULL,NULL),(338,276,'published','Urban Design Plan',NULL,'DSN 21242','Materials II',15,2016,'fall','<p>This assignment will focus on students ability to develop a collaborative urban design intervention with local organizations and citizens.</p>','group','2017-10-02','2017-11-13',60,NULL,'<p>1. Report and documentation of codesign process</p><p>2, Conceptual drawings (plans, elevations and 3d sketches) as needed</p><p>3. Report and documentation of available and gathered information</p><p>4. Presentation file</p>',2,NULL,'2017-04-07 19:25:37','2017-05-23 18:47:41','<p> This assignment will focus on students ability to develop a collaborative urban design intervention with local organizations, co-design temporary street furniture, select context-appropriate materials and finishes, present resulting concepts for feedback.</p>',2,'2',0,NULL,'local',NULL),(339,276,'published','Surveying and Intervention in existing buildings',NULL,'ARC21780','Insertion dans le milieu bâti',30,2016,'fall','<p>Conception d&#x27;un projet axé sur la rénovation et l&#x27;insertion d&#x27;un bâtiment dans un contexte urbain existant.</p>','individual','2017-09-15','2017-12-15',20,NULL,'<p>Pre Design</p><p>Site Evaluation</p><p>Existing building survey</p><p>Zoning Evaluation</p><p>Design Proposal</p><p>Rendering</p><p>Graphic Communication</p><p></p>',2,NULL,'2017-04-07 19:28:27','2017-05-23 18:46:27','<p>Site Evaluation</p><p>Zoning Evaluation</p><p>Pre design</p><p>Design proposal </p><p>Site and building survey</p><p>Construction detail </p><p>Rendering</p><p>3D simulation</p><p></p><p></p>',1,'3rd year (5th semester)',0,NULL,'local',NULL),(340,276,'published','Risk Analysis | Analyse du risque en entreprise',NULL,'10237','Contrôle interne et vérification',28,2016,'fall','<p>Risk analysis of an existing business process and development of internal controls. | Analyse du risque dans un processus d&#x27;affaires et les contrôles internes à mettre en place pour les contrer.</p>','group','2017-10-02','2017-10-27',20,NULL,'<p>A 10-page report including a process map of the business area students have been asked to analyse. Including the existing process, and the internal controls to put in place to mitigate risk.</p><p></p><p>-</p><p></p><p>Un rapport de 10 pages incluant un shéma du processus analysé et les contrôles internes à mettre en place pour contrer les risques. Le shéma doit être présenté clairement pour permettre une compréhension rapide du processus.  </p><p></p>',3,NULL,'2017-04-07 19:34:57','2017-07-05 19:05:42','<p>Students will <strong>assess the risk and control systems of a business process of your choosing</strong>. </p><p></p><p>This can be, for example, completing a sale - from taking the customer order, to delivering merchandise, to collecting cash; or, purchasing supplies or assets, or paying employees, or even hiring employees. </p><p></p><p>They will assess this process and identify <strong>what controls are in place to mitigate risk in the process.</strong></p><p></p><p>The students will submit a 10-page document which includes a process map of the business process in question.</p><p></p><p>--------------------------</p><p></p><p>Les étudiants vont <strong>analyser le risque dans un processus d&#x27;affaires et les contrôles internes à mettre en place pour les contrer.  </strong></p><p></p><p>Les étudiants devront soumettre un document de 10 pages qui devra inclure notamment un shéma du processus en place. </p><p></p><p>Le processus pourrait être: La vente, la livraison, le paiement d&#x27;un employé, l&#x27;embauche d&#x27;un employé, etc. </p><p></p>',1,'third year | troisième ',0,NULL,'regional',NULL),(341,276,'review','Petite voiturette autonome',NULL,'22669 ing','Projet',8,2016,'fall','<p>Ce cours pratique vise l&#x27;atteinte des compétences professionnelles relatives à la réalisation d&#x27;un projet mécanique.</p>','group','2017-09-04','2018-04-26',120,NULL,'<p>Construire une petite voiturette électrique et autonome pour des trajet sur les terrains de la Cité.</p>',1,NULL,'2017-04-07 19:38:39','2017-04-12 16:17:19','<p>Conception, design et fabrication.</p>',4,'3rd years',0,NULL,'anywhere',NULL),(342,276,'review','How to manage a golf course profitably',NULL,'1111','Golf course management',20,2016,'fall','<p>Ensure profitability of a golf course.</p>','individual','2017-04-07','2017-04-21',100,NULL,'<p>20 page operation&#x27;s guide including a financial statement</p><p>30 minute presentation</p>',10,NULL,'2017-04-07 19:44:54','2017-04-12 16:15:05','<p>Provide sound management skills for existing or emerging golf courses.</p>',1,'1st year',0,NULL,'regional',NULL),(343,276,'review','Controler 2 afficheurs 7 segments ',NULL,'ELE22240','ELECTRONIQUE 1',20,2016,'fall','<p>Contrôler 2 afficheurs 7 segments:</p><ul><li>1 compteurs à décade (74ls90)</li><li>1 décodeur 7 segments (74ls47)</li></ul>','group','2017-09-01','2017-12-22',5,NULL,'<ul><li>document de 5 pages avec une vidéo montrant le fonctionnement du circuit</li></ul><p></p>',1,NULL,'2017-04-07 19:45:17','2017-04-12 16:15:54','<ul><li>Réaliser la conception du circuit électrique</li><li>comprendre le fonctionnement des différents circuits intégrés à l&#x27;aide des «datasheet» des manufacturiers</li><li>Faire le montage du circuit sur «breadboard»</li><li>Faire le «troubleshooting» du circuit</li></ul><p></p>',10,'Deuxième année',0,NULL,'anywhere',NULL),(344,276,'review','Réutilisation des sous-produits d\'opérations arboricoles',NULL,'FOR22314-010-A2017','Arboriculture',20,2016,'fall','<p>Développer un plan pour réutiliser les sous-produits, bois et copeaux, provenant des opérations d&#x27;entreprises en arboriculture.</p>','individual','2017-09-01','2017-12-22',28,NULL,'<ul><li>Document de 10 pages incluant l&#x27;analyse du marché</li><li>Présentation de 15 minutes qui démontre le processus et les gains économiques</li></ul>',3,NULL,'2017-04-07 19:46:39','2017-04-12 16:13:27','<ul><li>Processus de transformation des sous-produits afin d&#x27;en faire la vente au public</li><li>Réutilisation des sous-produits en les intégrants dans les services existant ou en créant de nouveaux services</li><li>Utilisation des sous produits par l&#x27;entreprise</li><li> Développer un plan solide et écologique améliorera l&#x27;image et augmentera l&#x27;avantage concurrentiel de l&#x27;entreprise.  </li></ul><p></p>',1,'3 ième année collégiale',0,NULL,'local',NULL),(345,NULL,'review','LA RELÈVE',NULL,'20895PTV','Vidéo légère II',15,2017,'fall','<p>Production de reportages sur des thématiques et sujets pertinents se rapportant à des découvertes sociales et culturelles de l’Ontario. </p><p></p>','group','2017-09-04','2017-12-15',40,NULL,'<p>Dossier de recherche et de production. </p><p>Reportage-portrait video de 3 minutes. </p><p></p>',1,NULL,'2017-04-07 19:52:46','2017-04-21 19:59:02','<p> </p><p> <strong>REPORTAGES-PORTRAITS</strong> </p><p> Les participants sont responsables :</p><p> (<strong>1</strong>) du choix du sujet et l’angle abordé dans le reportage, </p><p>(<strong>2</strong>) de la recherche  et de l’organisation du  tournage,</p><p> (<strong>3</strong>) de la  réalisation du tournage, </p><p>(<strong>4</strong>) du montage et des étapes de post-production.   </p><p></p><p>-Un projet de production de reportage socioculturel multiplateforme sur des découvertes sociales et culturelles.  </p><p>-Les segments seront conçus par les étudiantes et étudiants de deuxième année du Programme de Production télévisuelle HD.  Ils seront diffuses sur les plateformes web et partagés sur les médias sociaux de La Cité;</p><p>- Fournir une formation aux étudiants sous forme d’atelier de 2-3 heures maximum en salle de classe à La Cité;</p><p>- Élaborer un échéancier de production en collaboration avec le superviseur du projet;</p><p>-Procurer  un  soutien  au  niveau  de  la  production  des  reportages  en  fournissant  aux étudiants les attentes souhaitées au niveau de la réalisation, du look, du contenu, de la ligne éditoriale, de la durée, etc;</p><p>-Assurer un suivi tout au long de la production des reportages de la manière suivante: </p><p>(<strong>1</strong>) approbation des dix (10) sujets et de l’angle des reportages qui seront présentés par les étudiants, (<strong>2</strong>) acheminement de commentaires par courriel sur la version 1 et la version 2 des reportages qui auront préalablement été révisés par le superviseur du projet,  </p><p>(<strong>3</strong>) visite  de  formation du superviseur pendant une session  de montage;</p><p> </p><p><strong>PROMOTION ET VISIBILITÉ</strong></p><p><strong>COMMUNIQUÉ</strong> <strong>DE</strong> <strong>PRESSE.</strong> Annoncer la diffusion des capsules et le lancement du projet;</p><p>-<strong>BUMPER</strong> <strong>ET</strong> <strong>SUPER.</strong> Création d’un bumper et d’un super spécifiques pré-intégrés aux contenus et au début de chaque reportage. Ils serviront à identifier leur réalisation fait en collaboration avec La Cité;</p><p><strong>MÉDIAS SOCIAUX</strong>. Promotion sur les réseaux sociaux (Facebook, YouTube, Instagram, Twitter, Snaptchat) des reportages produits par les étudiants de La Cité, en ciblant les organismes partenaires de La Cité;</p><p><strong>CONCOURS </strong> <strong>FACEBOOK</strong>. Organisation  d’un concours via la page Facebook pour choisir le meilleur des dix (10) reportages produits par les étudiants. Les votes seront fait par  le  public;  </p><p><strong>FACEBOOK </strong>10 publications, une pour chaque reportage;</p><p><strong>INSTAGRAM et SNAPCHAT</strong> Promotion du concours;</p><p><strong>YOUTUBE</strong>. Diffusion des 10 reportages sur la chaîne YouTube;  </p><p></p>',2,'2e année collégiale',0,NULL,'anywhere',NULL),(346,NULL,'draft','Marketing Inventions',NULL,'ENTP 311','Entrepreneurial Thinking and Behavior',30,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-04-07 20:49:51','2017-04-07 20:49:52',NULL,NULL,'Four year undergraduate',0,NULL,NULL,NULL),(347,59,'published','Business Marketing Plan',NULL,'MARK 3490','Business Marketing',35,2017,'summer','<p>Could your organization use a B2B marketing or sales strategy for a new product or service?</p>','group','2017-05-22','2017-08-31',40,NULL,'<p>A marketing and sales plan for the client with recommendations for action.</p>',10,NULL,'2017-04-07 22:37:36','2017-06-20 17:38:38','<p>Upper-level student-consultants will work in teams of 4 for 40+ hours researching, analyzing and developing a marketing or sales strategy catered to your organization’s new product/service rollout. This will help set strategic focus, set priorities in the roadmap for further development, develop internal accountability, and help to create a concrete set of metrics to measure your success. </p><p></p><p>Some project examples could include, but are not limited to:</p><ul><li>Reviewing a current product/service that is underperforming</li><li>Researching/highlighting potential prospects for new product/service</li><li>Develop a plan to properly scale rollout/growth for new product/service</li></ul>',4,'Upper Level - they have taken several Marketing courses in advance of this one.',1,NULL,'anywhere',NULL),(348,NULL,'draft','Marketing Inventions',NULL,'ENTP311','Entrepreneurial Thinking and Behavior',30,2016,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-04-07 22:58:52','2017-04-07 22:58:52',NULL,NULL,'four year undergraduate',0,NULL,NULL,NULL),(349,NULL,'draft','market inventions',NULL,'ENTP311','ENTP',30,2016,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-04-07 23:04:04','2017-04-07 23:04:04',NULL,NULL,'four year undergraduate',0,NULL,NULL,NULL),(350,296,'draft','Organizational behavior in hospitality  ',NULL,'HFT 3224','  Hospitality Management & Leadership Fundamentals',45,2017,'fall','<p>I do not have one for now</p>','group','2017-09-04','2017-12-01',20,NULL,NULL,1,NULL,'2017-04-08 18:12:43','2017-04-08 18:13:38','<p>N/A for now</p>',5,'3rd year undergraduate ',0,NULL,NULL,'2017-06-19 15:27:46'),(351,297,'published','Cyber-Security Plan',NULL,'EXT550','Externship',6,2017,'summer','<p>Could your organization benefit from increased training and implementation on your cybersecurity? </p>','individual','2017-05-22','2017-08-18',6,NULL,'<p>The final project deliverables depending upont the need of the organization. Examples would be:</p><ul><li>10-15 page report for analysis projects</li><li>Cyber-security awareness PPT presentation</li><li>Live or recorded cyber-security awareness sessions</li></ul>',3,NULL,'2017-04-10 13:06:32','2017-08-03 22:59:14','<p>Individual student-consultants will assist your organization with cyber-security awareness and policies. Increased cyber-security can improve your compliance, protect your company data, or fight against fight against viruses, worms, Malware, etc. </p><p></p><p>Student projects could include:</p><ul><li>Assist with reviewing and creating cybersecurity policies</li><li>Design &amp; deliver cybersecurity awareness training</li><li>Research &amp; deliver a risk assessment for the organization</li><li>Review technology architecture of an organization and deliver a report on how to improve</li><li>Vulnerability analysis report</li></ul>',1,'Masters',1,NULL,'anywhere',NULL),(352,28,'published','Organizational Consulting Project',NULL,'BUSI 5038 AA/AB/AC','Organizational Behaviour',30,2016,'summer','<p>Groups of 4-6 MBA student-consultants will tackle a leadership issue or management challenge faced by the industry partner. </p>','group','2017-07-01','2017-08-16',15,NULL,'<p>Working over the entire semester, teams will provide strategic recommendations and an implementation plan specific to the issue facing your business in the form of a 10-15 page written report and a 15 minute presentation.</p>',3,NULL,'2017-04-10 17:12:46','2017-06-15 19:13:29','<p>A class of MBA student-consultants will tackle a leadership issue or management challenge that your company is currently facing. Based on information on your organization and goals that you&#x27;ve shared with them, students will act as consultants, analyzing the situation and delivering a presentation and report recommending strategies to address it. Working over the entire semester, teams will provide strategic recommendations and an implementation plan specific to the issue facing your business.</p><p></p><p>Sample student projects include, but are not limited to:</p><ul><li>redesign an internal system or process including: socialization, motivation, team management, conflict resolution, leadership</li><li>develop a plan to re-imagine your mission, vision, and purpose and roll it out to employees</li><li>integrate cultures in a merger or acquisition </li><li>diagnose your organizational structure and its fit with your organization&#x27;s strategy</li><li>help you develop a plan to increase diversity and the positive effects of diversity in your organization</li></ul>',5,'Graduate',1,NULL,'anywhere',NULL),(353,10,'published','MBA Project Management  Planning',NULL,'BUS 570','Project Management ',31,2016,'summer','<p>MBA student teams will develop a comprehensive plan for a project that your organization wishes to undertake using PMI principles. </p>','group','2017-05-05','2017-07-09',80,NULL,'<p>Week-by-week students will also submit deliverables to be reviewed by the company to receive feedback.  The schedule is as Follows:</p><ul><li>Week May 15th:  Project Charter</li><li>Week of May 22nd: Work Breakdown Schedule</li><li>Week of May 29th: Network Diagram</li><li>Week of June 5th: Schedule and Cost Estimate</li><li>Week of June 12th: Stakeholder plan, communication plan</li><li>Week of June 26th: Risk Management Plan</li></ul><p></p><p>A report of about 20 pages containing a detailed project plan. </p>',3,NULL,'2017-04-11 00:26:27','2017-06-05 18:23:25','<p>In groups of 4 MBA student-consultants will work together for 80+ hours to create a project management plan for your organization. The plan will include a project charter, work breakdown structure, network diagram, risk management plan and communication plan. </p><p></p><p>Examples of projects have included, but are not limited to:</p><ul><li>Development of a new website</li><li>Implementation of a new software or system</li><li>Business process change</li><li>Office relocation</li><li>Rebranding project or implementation of new logo</li><li>New product/service launch </li><li>Evaluation of new technology or suppliers</li></ul>',4,'MBA',1,NULL,'local',NULL),(354,89,'published','Social Media Strategy and Plan',NULL,'BUS 459','Social Media\'s Role in Integrated Marketing Communications',20,2017,'fall','<p>Using industry best practices, a group of student consultants will collaborate with your business to help you improve your social media strategy and plan so that it contributes to your company goals.</p>','group','2017-09-14','2017-12-01',40,NULL,'<p>The students will conduct a 20-minute presentation on their research findings of the target market, as well as the social media plan and content suggestions. </p><p></p><p>The students will develop the content for the social media sites but will not be in charge of posting the content.</p><p></p>',5,NULL,'2017-04-11 16:08:46','2017-07-26 23:41:28','<p>Would you like an analysis of the strengths and weaknesses of your organization’s external communications strategy? Individual groups of 5 Cal Poly students will be conducting market research to identify strategies your company can leverage to improve your online presence and better communicate with your audience(s).</p><p></p><p>The students will be working exclusively on this project for the whole semester.</p><p></p><p><strong>Project examples include, but are not limited to:</strong></p><ul><li>Recommending  the best types of social media content and themes you can develop and use for your social media platforms.</li><li>Defining the appropriate social media channels and improving the way you currently use them.</li><li>Developing content for the target market to persuade them to engage with your company and reach your goals of awareness/sales/increasing consumer base, etc.</li><li>Conducting extensive research to determine your company&#x27;s target market (or better understand them), as well as research into other relevant issues, opportunities and aspects of your business.</li></ul>',5,'Senior ',0,NULL,'anywhere',NULL),(355,325,'review','Social Media Take Over ',NULL,'BUS 117','Advertising',80,2016,'fall','<p>For this assignment advertising students will design and post 8 pieces of social media content. The students will look a 8 different types of ad&#x27;s focusing on your businesses goals. The students will then use google analytics to track and measure the success of the social media post. </p>','group','2017-09-25','2017-12-12',160,NULL,'<p>The final project deliverables will be </p><p></p><p>A presentation of the students findings after looking at the analytics</p><p>8 social media content pieces</p>',15,NULL,'2017-04-11 16:25:48','2017-04-26 21:12:39','<p>A group of 8 students will analyse your social media efforts and create 8 pieces of social media content which will be posted to your companies Facebook. The students will then measure the success of their ad&#x27;s using Facebook analytics.   </p><p></p><p>Examples of what students have done in the past include: </p><p></p><p>-</p>',8,'1st-4th year',0,NULL,'anywhere',NULL),(356,326,'published','Public Relations Plan',NULL,'PREL 4316','Public Relations Campaigns',24,2017,'fall','<p>Students will create a strategic public relations plan for your organization that solves a communication challenge or marketing goal.</p>','group','2017-08-22','2017-12-07',60,NULL,'<ul><li>Comprehensive written communication plan</li><li>Presentation (PowerPoint) detailing the highlights of the plan</li><li>Supporting documents or content (examples includes press releases, media pitch, fact sheet, story angles, media lists, social media plan, etc.)</li></ul>',2,NULL,'2017-04-11 17:22:23','2017-08-18 20:49:27','<p>Fourth year student-consultants will spend 60+ hours working with your organization on a communications or public relations challenge. Simulating an agency, students will go through the strategic planning process to create a public relations plan including situation analysis, research and insights, target audience identification, strategy, execution/ideas, timeline and budgets. Upon completion, the organization will have a full communication plan with ideas for execution (no advertising). Teams also may draft media materials and other documents during the process including press releases, social media content, creative content, media pitches, etc.</p><p></p><p>Examples of project scopes include, but are not limited to:</p><ul><li>Strategic PR plan to launch a new product or promote an existing product/service</li><li>Plan to raise visibility and attract new members for a nonprofit organization</li><li>Creative approach and plan for publicizing a business to consumers</li></ul>',5,'4th year/seniors',1,NULL,'anywhere',NULL),(357,177,'review','Training and Development',NULL,'COMS  452','Training and Development',45,2016,'fall','<p>This assignment will focus on student’s ability to assess an organization’s need for training and development in communication soft skills.</p>','group','2017-10-23','2017-12-08',30,NULL,'<p>Final product deliverables include:</p><ul><li>Complete Training Module.</li><li>1 hour of training time.</li><li>Survey construction and analysis of training outcomes.</li></ul>',10,NULL,'2017-04-11 19:19:39','2017-07-20 22:50:04','<p>In groups of 5, students will interview employee&#x27;s from your organization to gain a better understanding of the organization and then discuss and document opportunities in the onboarding process. Students will then present their ideas and recommendations of how to improve your current onboarding processes based on their on findings</p><p></p><p><strong>Potential project examples include, but are not limited to: </strong></p><ul><li>Conducting a needs assessment to indicate the needed desires for training.</li><li>Developing a training module with content, exercises for a 1-2 hour training for employees in soft skills.</li><li>Conduct a post assessment survey.</li></ul>',5,'Junior and Senior',0,NULL,'local',NULL),(358,170,'draft','ECommerce Website',NULL,'ISM 6930','Information Security and Risk Management',NULL,2016,'summer',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-04-11 19:23:28','2017-04-11 19:23:29',NULL,NULL,'masters students',0,NULL,NULL,NULL),(359,178,'published','Marketing Research Report',NULL,'MKTG 3401','Marketing Research',40,2017,'fall','<p>A group of students will work with your organization to research a key management decision problem, including data collection and analysis.</p>','group','2017-09-12','2017-12-05',60,NULL,'<ul><li> 40+ slide Market Research Slidedeck containing exploratory, secondary, and survey methodology and research findings</li><li>20 minute Market Research Presentation</li><li>Data file with collected survey responses</li></ul>',8,NULL,'2017-04-12 19:01:11','2017-05-17 14:59:52','<p>In a group of 5, students will work with your organization to explore a key management decision problem you currently face.  They&#x27;ll conduct market research to help inform your decision-making and find data-based insights.</p><p></p><p>If your organization&#x27;s target market includes students or millennials, students can provide you with key insights into their demographic to inform your marketing strategy. Depending on your goals for the project, their work could even include conducting a primary research survey among their peers.</p><p></p><p>Student work can include, but is not limited to:</p><ul><li>identifying research questions core to the management decision problem</li><li>collection of secondary data relevant to the management problem</li><li>conducting focus groups or other exploratory research studies</li><li>design and administration of an original survey instrument</li><li>conducting analysis and interpretation of the collected data</li><li>a final marketing research report and presentation</li></ul>',5,'3rd-5th year',0,NULL,'anywhere',NULL),(360,458,'published','Operations Management',NULL,'MGMT 34500','Operations Management',50,2016,'fall','<p>3rd year student-consultants will analyze your operations and provide recommendations for your organization to help identify challenges or opportunities that are available through the implementation of efficiencies. </p>','group','2017-08-30','2017-12-15',15,NULL,'<p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to devise the project scope and prepare a  detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome - Report and Presentation: Students will submit a detailed report on the outcomes of the project. Teams will also give a 15-20 minute presentations on their findings, in the last class. Organization representative(s) are invited to attend these presentations.</p><p></p>',4,NULL,'2017-04-12 20:30:31','2017-07-19 17:09:28','<p>Student-consultants will develop a tailored plan related to your unique organizational challenge or the identification of a new opportunity. They will observe a process within your organization and then provide recommendations for how your company infrastructure/systems can shift to provide optimal efficiency. </p><p></p><p><strong>Some examples of this could include, but are not limited to:</strong></p><ul><li>Examining a common practice and determining whether you are reaching maximum efficiency.</li><li>Providing suggestions for lean improvement.</li><li>Designing a rewards system to increase performance or motivation.</li></ul><p>Students may use lean improvement, pareto charts analysis, constraint management, demand forecasting, and more for their analysis. </p>',6,'3rd year',0,NULL,'anywhere',NULL),(361,10,'review','Recommendations for international challenges ',NULL,'BUS 435','Management of International Firms',15,2016,'summer','<p>A group of 3 students will have a meeting with senior or middle managers in you organization in order to  identify and discuss problems and concerns with in your organization regarding.....  The students will analyze these concerns and make a recommendation.</p>','individual',NULL,NULL,NULL,NULL,'',2,NULL,'2017-04-12 21:33:46','2017-04-12 21:39:41','<p>The students will be analyzing challenges and areas of concerns in any of </p><p></p><p><strong>1) cross-cultural management </strong></p><p><strong>2) product localization</strong></p><p><strong>4) headquarters-subsidiary relationship</strong></p><p><strong>5) knowledge management </strong></p><p><strong>6) managing partners or suppliers</strong></p><p><strong>7) stakeholder relationship (governments, communities, etc.).</strong></p>',1,'4th year ',0,NULL,'anywhere',NULL),(362,10,'published','International Operations Plan',NULL,'BUS 435','Management of International Firms',12,2016,'summer','<p>Improve your company’s international management and operations. Collaborate with SFU business students to find better solutions. </p>','group','2017-05-19','2017-08-23',100,NULL,'<ul><li>2-page problem identification report (midway through project)</li><li>30 minute presentation on their recommendations</li><li>Final 15-page report </li></ul><p></p><p></p>',3,NULL,'2017-04-12 21:51:30','2017-07-19 17:23:07','<p>In groups of 3 or 4, student-consultants will work 60+ hours each devising a strategic plan to help your organization better it’s international operation. Improved international management skills will help increase efficiency in managing across international units, enhance your global and local competitiveness, lower cultural problems and ethical issues. It will also improve relationships with customers, suppliers, and governments. Throughout the project students will practically apply the theory learned throughout the course to research and analyze an opportunity present in one of your international offices.</p><p></p><p>Some examples could include, but are not limited to:</p><ul><li>Help translating your company culture and message to international offices.</li><li>Establishing workplace etiquette - professional communication plans that instill the workplace norms unique to the country</li><li>Problem between headquarters and subsidiaries</li><li>Managing workers of different cultural backgrounds</li><li>Adjusting products modifications to fit regulating cultural differences</li><li>Government relations and regulation</li><li>Supplier relations</li><li>Customer partners</li><li>Competitive landscape</li><li>Communication issues and virtual teams</li><li>Managing global alliance</li></ul><p></p>',3,'3rd/4th year',1,NULL,'local',NULL),(364,124,'published','Ethics of Logic',NULL,'POL 210','Political Philosophy',120,2017,'winter/spring','<p>Could your business benefit from ethical problem solving? </p>','individual','2017-08-14','2017-12-01',200,NULL,'<p>10-page comparison essay analyzing the works of one of 5 books covered in class and how it relates to your current joint-project. This will include logical analysis on solving for your opportunity. </p>',24,NULL,'2017-04-17 00:36:05','2017-08-14 14:51:57','<p>Get student-philosophers to approach a business opportunity or workplace issue by dissecting the ethics of logic behind the decision-making. </p>',1,'2nd,3rd,4th year',0,NULL,'anywhere',NULL),(365,10,'published','Project Management with Execution',NULL,'BUS	361	','Project Management',60,2017,'summer','<p>Could your organization benefit from using a student group to help manage a 12-week project being implemented in your workplace?</p>','group','2017-05-08','2017-07-31',200,NULL,'<p><strong>Project Deliverables </strong></p><p></p><p><strong>Phase 1 </strong>– Project	Plan: Students will meet with organization representative(s) to devise the project scope and prepare detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan.  Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome Report and Presentation: Students will submit detailed report on the outcomes of the project. Teams will also present this in the last class. Organization representative(s) are invited to attend these presentations.</p>',12,NULL,'2017-04-17 17:39:13','2017-06-05 18:23:36','<p>In groups of	5, students from various disciplines	will work together and manage a business project for you. For the first 6 weeks students will plan and prepare the project for implementation and the last 6 weeks is devoted to executing the plan. They will work with your organization to help improve the project implementation process and ensure that the project is completed in an efficient manner. This will increase your productivity, onboarding, and adoption within your organization. </p><p></p><p></p><p><strong>Successful past projects have included, but are not limited to</strong>:</p><ul><li>Social Media Marketing Campaign with content plan for a year</li><li>Developing a marketing plan for a company, a new product or an event </li><li>Communications plan for an upcoming event (social media, PR, mailchimp, etc.)</li><li>Improve the volume and quality of a database, and how it&#x27;s used</li><li>Promotion for opening a new location or running an event </li><li>Creating an annual event or attending an upcoming one (trade shows, conferences) </li><li>Website or mobile app development</li></ul><p></p>',5,'Varied',1,NULL,'local',NULL),(366,190,'review','Business Analytics & Consulting',NULL,'ITM-6899','Capstone',12,2016,'fall','<p>Graduate Business Analytics students will review a business problem of your choosing and provide actionable recommendations to address it.</p>','group','2017-09-04','2017-12-31',25,NULL,'<ul><li>10 page document with data analysis and recommendations</li><li>15 minute presentation</li></ul>',6,NULL,'2017-04-17 21:27:21','2017-04-17 21:27:43','<p>Working in groups of 3-4, graduate students in the Master of Science in Business Analytics program will tackle a business problem of your choosing.</p><p></p><p>Students will provide structure to the business problem, analyze the issue, and provide you with their insights into the issue presented. The program emphasizes technical skills, and students will be experienced in big data analytics, business intelligence, and data modelling.</p><p></p><p>Example projects include, but are not limited to:</p><ul><li>Market segmentation and identifying new target markets</li><li>Analyzing Market Baskets to identify interesting purchase patterns</li><li>Website analytics, analysis of web logs to optimize web design and online sales</li><li>Identify Key Performance Indicators and design business intelligence dashboards to help decision making</li><li>Predicting customer behavior, employee turnover or loan risk</li></ul>',4,'MSBA',0,NULL,'regional',NULL),(367,150,'published','Accounting Internship',NULL,'ACCT 6V98','Accounting MSc Internship',30,2018,'summer','<p>Students in the MSc accounting program will work with your organization on an applied accounting challenge of your choosing, ranging from inventory control to holistic financial analysis.</p>','individual','2018-05-15','2018-08-15',100,NULL,'<p>The students will submit a report, the length and content of which will vary depending on your chosen project scope.</p>',10,NULL,'2017-04-17 23:18:52','2017-05-29 18:46:08','<p>1-2 students in the MSc Accounting program at UT Dallas will work on an applied accounting project of your choosing for your organization. Projects can vary based on your company&#x27;s needs. Examples may include but are not limited to the following:</p><ul><li>Analyze and raise potential questions before your company faces real investors.</li><li>Analyze and create financial projections on a forecast basis.</li><li>Develop a pitch for investors that is backed up by financial analysis based on your expressed investment goals.</li><li>Determine how financial statements (balance sheet, income statement, cash flow statement) reconcile with the business model and strategy.</li><li>Determine important economic resources of your business that do not appear on your financials.</li><li>ACS 740 Income tax expense models.</li></ul>',1,'MSc',0,NULL,'local',NULL),(368,217,'published','Web Design Campaign',NULL,'MMC 6936','Web Design Capstone',12,2017,'fall','<p>Give your organization a new look - students work to build you a responsive website and create branding material to use in marketing campaigns. </p>','group','2017-08-21','2017-12-04',50,NULL,'<p><strong>Student teams will develop research, branding and web tools for a client. Deliverables will include:</strong></p><p> </p><ul><li>Situation Analysis</li><li>Logo Design Proposal</li><li>Branding Guide</li><li>Communication Designs (ex. letterhead, business cards, etc.)</li><li>Fully Functioning Responsive Website</li><li>Campaign Book</li></ul><p></p><p>The student teams will pitch their campaign ideas to the client at the end of the semester. The client can then select a winner and opt to utilize that design work.</p>',1,NULL,'2017-04-18 20:22:25','2017-08-17 23:00:53','<p>In this project a class of (12) Master&#x27;s level students will work a combined total of 600 hours to provide a fully functioning responsive website for your organization. Through research and client feedback channels they will construct a new home for your organization online. </p><p></p><p>Students will also redesign an existing logo or create a new logo, develop branding materials and provide research to the client.</p><p> </p><p><strong>Project examples include, but are not limited to:</strong></p><ul><li>Nonprofit website</li><li>Website for startup companies</li><li>Website for service business</li><li>Website for hotels/restaurants with reservation </li></ul>',1,'Master\'s',1,NULL,'anywhere',NULL),(369,59,'review','Technology Solution Consultancy',NULL,'ITM 90','Graduation Capstone Project',NULL,2016,'winter/spring','<p>Over two semesters, a group of 4th-year student-consultants will assess your business processes in order to identify an issue or opportunity for improvement using technology.</p>','individual','2017-01-16','2017-08-15',NULL,NULL,'<p>Students provide a report with their analysis of gaps/opportunities in your organization, including recommendations to address them. They redesign the business process, propose a system solution, develop an RFP/I document, compare vendor solutions to provide a recommendation, and submit the implementation plan for their solution.</p>',1,NULL,'2017-04-18 23:00:02','2017-04-18 23:03:33','<p>Over two semesters, a group of 4th-year student-consultants will assess your business processes in order to identify an issue or opportunity for improvement using technology. They will then identify an IT solution tailored to your company after evaluating vendors (via RFP) to recommend the most appropriate solution. Finally, they will identify risks associated with implementation and the change management processes needed. Project scopes can include, but are not limited to;</p><ul><li><strong>sales/marketing gaps indicating a need for CRM solutions</strong></li><li><strong>website performance issues</strong></li><li><strong>accounts payable issues with ordering/payment </strong></li><li><strong>recruitment process hiring of employees</strong></li><li><strong>sales and order fulfillment</strong></li><li><strong>client acquisition process, etc.</strong></li></ul>',1,'4th Year ',0,NULL,'anywhere',NULL),(371,276,'review','Ouverture d\'une entreprise en esthétique',NULL,'17648','Journée cliente II',15,2018,'summer','<p>Établir une stratégie pour le lancement d&#x27;une entreprise en esthétique.  Sujets: marketing, vente, consultation et soins.</p>','individual','2018-05-07','2018-06-15',12,NULL,'<p>Les livrables à la fin du projet sont:</p><p>1. préparer un document de 5 pages</p><p>2. présentation orale de 20 minutes</p><p>3. recommandations de publicité sur des réseaux de médias sociaux</p>',3,NULL,'2017-04-19 23:39:21','2017-04-20 00:40:20','<p>L&#x27;étudiant doit établir un plan pour faire la promotion de leur entreprise. L&#x27;étudiant doit apprendre à faire les portes ouvertes, la consignation des produits, les affiches et les soins.</p>',1,'collégiale',0,NULL,'local',NULL),(372,2,'published','Strategic Marketing Plan',NULL,'MKTG 6650S','Strategic Market Planning',30,2017,'summer','<p>Students will identify opportunities for four different companies, with complementary product or service offerings, to collaborate on a new offering.</p>','group','2017-06-08','2017-07-12',0,NULL,'<p>Students will present their strategy in class on July 12th to all four companies. They will provide a copy of their slides and a report describing the proposal in depth.</p>',4,NULL,'2017-04-19 23:40:22','2017-08-03 22:47:23','<p>Looking to expand your current market?  Would you also like to look at <strong>new marketing and product ideas</strong>, <strong>or new partnerships?</strong></p><p></p><p>MBA Students in an advanced marketing class at the Schulich School of Business are divided into 4 teams.  Each team will work with a different company in two ways:</p><p></p><p><strong>1. Identifying New Market Segments and Opportunities</strong><br/><br/>The team (6 – 8 people in total) will meet with your company at least once between June 8th and June 18th, 2017 to learn about your company and any challenges you may be facing.  Based in part on the briefing, as well as direction from faculty, the team will conduct research to identify market trends that can be leveraged to your advantage and, accordingly, make recommendations about new ways to grow your business.</p><p></p><p><strong>2. This second part is the most exciting for many companies. </strong><br/><br/>The four companies taking part are not ones that have worked together before. The teams will identify where your companies have synergies, and propose innovative collaboration strategies with the aim of expanding your current businesses through new product or service creation or interesting ways of approaching new market segments. </p><p></p><p>A previous project example brought together a major retailer, a commercial baker and a packaging company; the result was a new product being sold in retail locations across the country.  </p><p></p><p>On another occasion, a large glass manufacturer, a company that changes glass colour with electric charges, a plastics moulding company and a science-driven crop company were brought together – and three different ways were found for these companies to work together… including the creation of a light-weight material that can replace steel in multiple applications.</p><p></p><p>Each of the four teams may propose different collaborations with different combinations of clients, so the possibilities are endless.  In every class though, the companies all get at least one good, new idea for growth. </p><p></p><p>On the evening of Wednesday, July 12th, 2017 a senior member from each company will attend the class to hear the presentations and participate in a faculty-led exercise to help each of the companies determine their best path forward. </p><p></p><p></p><p></p>',6,'2nd year MBA',1,NULL,'local',NULL),(373,2,'published','Marketing Strategy Consulting',NULL,'MKTG 5200','Market Management',40,2017,'summer','<p>Graduate students at Schulich will tackle a marketing problem or challenge your organization is facing, and provide recommendations to address it.</p>','group','2017-06-01','2017-07-06',150,NULL,'<p>Students will provide a report describing the findings from their research, detailing their insights into your company and industry as a whole. They&#x27;ll provide actionable recommendations to address the issue or challenge that you provided.</p>',7,NULL,'2017-04-20 00:39:08','2017-05-09 16:23:49','<p> Graduate students at the Schulich School of Business will consult with your company to learn about your business and a key marketing challenge or problem that you face.  Students will use social media and other sources to determine whether or not there are additional consumer centric challenges that also need to be addressed </p><p></p><p>The team assigned to your company will conduct research to gain insights on changes within the competitive landscape and identify key trends affecting your industry.</p><p></p><p>They will analyse the data and assess its implications for your organisation to provide you with a strategy to address your marketing challenge at the conclusion of the project.</p><p></p><p>Project examples include, but are not limited to:</p><ul><li>Identifying additional audiences  you could target to help grow your business</li><li>Enhancing brand perception amongst key customer groups</li><li>Creation of signature customer experiences to enhance engagement</li></ul>',5,'Graduate',1,NULL,'regional',NULL),(374,2,'published','Interactive Marketing Strategy',NULL,'MKTG 6650 ','Strategic Market Planning',40,2017,'summer','<p>Students act as consultants for your organization in an interactive strategy session to tackle a marketing challenge.</p>','individual','2017-06-21','2017-07-05',6,NULL,'<p> Students will provide their recommendations live, during the interactive, in-class session on July 5th. Notes from the working session will be shared with the participating company.  </p>',1,NULL,'2017-04-20 01:09:26','2017-08-03 22:59:52','<p>This is an opportunity to have a full class of Schulich School of Business MBA students analyze a business problem you are facing and develop solutions to address the problem, while growing your business and helping to improve profitability.</p><p></p><p>You would provide the students with a written brief on your company, industry marketing challenge no later than June 21st. They would do some preliminary research in preparation for an in-depth exploration of the challenge at hand, which will take place on Wednesday, July 5th.  </p><p></p><p>The class will be guided by an instructor with 30 years’ marketing and business strategy development experience, with clients in a variety of industries in multiple sectors and countries.  You would work with the instructor ahead of time to ensure the right information is given to the students to enable them to give you strong recommendations.  </p><p></p><p>On July 5th you will have the opportunity to recap the problem at the beginning of the session and can to add more to the challenge at this time, if you wish.  The experience is designed so that you can ask questions, provide input and get feedback in real time.</p><p></p><p>Possible topics include, but are not limited to:</p><ul><li>Recommending a marketing communications approach for start-up</li><li>Providing a strategy to reposition your brand to increase growth</li><li>Identifying new product mixes and/or customer segments</li><li>Improving employee engagement to improve customer retention</li></ul>',1,'Graduate',1,NULL,'local',NULL),(376,10,'published','International Management ',NULL,'BUS 430','Cross Cultural Management ',15,2016,'summer','<p>Could you benefit from addressing an organizational challenge related to cross-cultural management present in your company’s international operations?</p>','group','2017-05-30','2017-08-23',420,NULL,'<ul><li>Problem Identification Proposal halfway through project (July 15)</li><li>30-minute final presentation on findings and recommendations</li><li>5-10 page report </li></ul><p></p>',4,NULL,'2017-04-20 23:16:44','2017-06-05 18:24:20','<p>In groups of 4, students will work 35+ hours each developing a strategic plan to help your organization manage it&#x27;s cross-cultural/international operations.</p><p></p><p>Students will practically apply the theory learned throughout the course to research and analyze an opportunity in international management or international expansion. This project is perfect if your organization is considering expanding internationally or has an international management challenge related, but not limited to: </p><ul><li>International Expansion Plans</li><li>Help translating your company culture and message to international offices.</li><li>Managing workers of different cultural backgrounds</li><li>Adjusting products modifications to fit regulating cultural differences </li><li>Government relations</li><li>Supplier relations</li><li>Channel partners</li><li>Competitive landscape </li><li>Sourcing/supplier </li><li>Intellectual property challenges </li></ul><p></p>',3,'3rd/4th year',1,NULL,'anywhere',NULL),(377,86,'published','Flash Consulting',NULL,'International student visit - University of Suffolk','International student visit - University of Suffolk',5,2017,'summer','<p>A visiting team of MBA students from the University of Suffolk in England will tackle a challenge or issue in a live case study for a Boston-based business.</p>','group','2017-05-01','2017-05-26',20,NULL,'<p>Students will provide a final report detailing their findings and actionable recommendations.</p>',1,NULL,'2017-04-21 02:56:33','2017-05-08 17:54:50','<p>A group of 4-5 MBA students from the University of Suffolk in England, under supervision of Boston&#x27;s Suffolk University, will act as outside consultants for a business problem or challenge of your choosing, as a live case study. Students are usually seasoned business professionals, and can offer a fresh perspective in addition to experienced insights.</p><p></p><p>The visiting students will learn about your company through interviews with a stakeholder, conduct research and put together preliminary findings in advance of an on site visit and tour of your premises in the final week of May. This visit will round out their analysis, and allow the students to provide a report of their findings and recommendations within 30 days following the site visit.</p><p></p><p>In previous years, the students provided a local company with a strategy for expanding into China. </p><p></p><p>Other examples could include:</p><ul><li>A go to market strategy for a new product</li><li>A competitive analysis to identify new marketing opportunities</li><li>An assessment of your branding and messaging strategy and recommendations to improve it</li></ul><p></p>',5,'MBA',1,NULL,'local',NULL),(378,86,'review','Executive MBA Site Visit',NULL,'International student site visit','International student site visit',30,2017,'summer','<p>Global Executive MBA students, visiting Suffolk University, will visit your company to learn about your business and brand strategy.</p>','group','2017-06-12','2017-08-09',5,NULL,'<p>Site visit with international EMBA students.</p>',6,NULL,'2017-04-21 03:11:02','2017-08-03 23:00:05','<p> A group of executive MBA students, from programs around the world (including Aix en Provence, Germany, Brazil, Chile, Ireland), are visiting Suffolk on an experiential learning exchange.</p><p></p><p>Students are excited to connect with a local brand, tour your operations, and learn about your company.</p><p></p><p>This is a short engagement and an opportunity to expand your brand to international EMBA students and enhance your recruitment. In addition, you&#x27;ll be connected directly to Suffolk&#x27;s executive office for future opportunities.</p><p></p><p>Further details will be provided to any interested companies by the program coordinator. Particular topics of interest for the students are in the areas of data analytics, crisis management, and financial analysis.</p>',4,'EMBA',0,NULL,'local',NULL),(379,174,'review','Engineering Prototype for Companies',NULL,'ECE 196','Engineering Hands-on Group Project',26,2017,'winter/spring','<p>Group of students with diverse engineering skills would like to partner with company/industry to create prototype.</p>','group','2017-05-08','2017-09-08',160,NULL,'<p>Final Prototype, and supporting documentation</p>',5,NULL,'2017-04-21 16:32:52','2017-05-08 21:51:06','<p>Students with a broad background and extensive experience in electrical engineering, computer science and mechanical engineering will build a prototype for your company. </p><p></p><p>Past project examples include:</p><ul><li>Wearable Devices</li><li>Optical Particle Counter / LED Tower</li><li>Induction Heating Coil Design for Consumer Appliance</li><li>Solar Systems &amp; Generators</li><li>Sensor Integration and Testing</li><li>Computer-to-computer high speed communication and management systems</li></ul><p>See pib.ucsd.edu for more examples of projects that students have built.</p>',4,'3rd and 4th year undergraduate',0,NULL,'anywhere',NULL),(381,271,'published','MBA Marketing Consultancy',NULL,'MBA MKT ','Marketing Management',10,2017,'fall','<p>A group of MBA students acting as outside consultants for your organization will work closely with you to identify an issue or challenge you are facing, with a marketing or market research focus, and develop recommendations. </p>','group','2017-09-11','2017-12-15',40,NULL,'<p>Students will provide a ten page report detailing their findings, analyses and recommendations.  They will also deliver a presentation of their results at the end of the quarter. </p>',3,NULL,'2017-04-21 18:30:51','2017-06-20 17:35:14','<p>A group of students-consultants will work closely with you to identify an issue or challenge you are facing, with a marketing or market research focus. Students will research and analyze the issue, and develop strategies and actionable recommendations that you could implement to address it. </p><p></p><p><strong>Project examples include, but are not limited to:</strong></p><ul><li>Conducting industry analyses to identify new target markets, messaging, and communication strategies</li><li>Using customer analysis to develop a new social media campaign</li><li>Planning a promotional event for the college-aged market, based on trend analysis</li><li>Doing competitive analysis of your industry in the development of a comprehensive marketing plan for a startup</li><li>Conducting focus groups and interviews to develop communication strategies for non-profits&#x27;</li></ul><p>Students&#x27; tactical recommendations will include advertising and social media strategies, messaging, pricing, and distribution strategies.</p>',3,'MBA',0,NULL,'anywhere',NULL),(382,95,'published','Branding & Content Production',NULL,'ADVG 420','Agency Workshop & Production House',30,2017,'fall','<p>Students will act as an outside creative agency for your company, spending three months developing branding and content collateral for your advertising needs.</p>','group','2017-09-04','2017-11-30',80,NULL,'<p>The deliverable is dependent on what your organization&#x27;s needs are, and the expectations set in your initial meeting with students. At the conclusion of the project, they will provide <u><strong>actual branding and/or content collateral that you can use</strong></u>, immediately. </p>',2,NULL,'2017-04-21 20:06:40','2017-06-22 19:42:33','<p>Students will act as an outside creative agency for your company, spending three months developing branding and content collateral for your advertising needs. They will meet with you to learn about your company and advertising goals, then develop materials that you can use to promote your business.</p><p></p><p><strong>Project examples include, but are not limited to:</strong></p><ul><li>Branding strategy for a dance school</li><li>Writing and social media for an intern program for NYC High School students</li><li>Social media and sales materials for a non-profit</li><li>Search ad + search engine optimization for an online retailer</li></ul>',20,'4th year',0,NULL,'local',NULL),(383,351,'published','News Story Creation',NULL,'INF 240','Digital News Reporting',9,2017,'fall','<p>A Digital Media student will create an unbiased news story for your company. As an online, print, audio or video story, you’ll be able to use it for PR and other opportunities.</p>','individual','2017-08-21','2017-12-06',15,NULL,'<p>You’ll receive a written, interactive, audio or video news story that would appeal to the Hays, Kansas community for consideration on the school&#x27;s Tiger Media Network (TMN) broadcast and online outlets.</p><p></p><p>You’ll receive fresh insights and creative angles on the story, and have the authority to republish or share the pieces. The student will also be free to share the story with TMN, their instructor and the department.</p>',30,NULL,'2017-04-21 21:01:49','2017-08-09 18:38:37','<p>If your team doesn’t have time or expertise to write up a media piece or research a specific topic, this is your chance to make it happen.</p><p></p><p>A student will research and create a media piece on a topic of your choice. We encourage you to suggest a current social issue related to government, the economy, employment, the environment, or another relevant and timely news issue that your organization deals with.</p><p></p><p>The student may develop your story:</p><ul><li>As a slideshow, which would include interviews or other audio on your topic of choosing and include at least 12 photos with descriptions</li><li>As an in-depth written piece</li><li>As a digital graphic</li><li>As an audio or video story 45 to 120 seconds in length</li></ul><p></p>',3,'Mostly Seniors',0,NULL,'anywhere',NULL),(384,66,'review','International Expansion Plan',NULL,'ENMN 331',' Doing Business in a Global Economy ',15,2017,'summer','<p>Are you a Canadian based company interested in expanding internationally? </p>','group','2017-06-11','2017-07-19',120,NULL,'<p>The students will be submitting a report outlining the recommendations for moving into a new international market</p>',1,NULL,'2017-04-21 21:26:46','2017-05-11 23:07:10','<p>In groups of 4, student-consultants will work with your organization to assess its potential for international business. They will recommend and analyze a country for entry, and present you with a plan to develop and describe the strategy &amp; tactics to do business in that country. </p><p>There students will:</p><ul><li>Make a plan for expansion based on your company’s motives for entering foreign markets – to protect markets, and increase profits and sales</li><li>Examine the “How” of business internationalization using uppsala Model of incremental internationalization and its limitation in the new global era</li><li>Analyze the phenomenon of “Born Global” and of the rapid internationalization enabled by the Internet</li></ul><p></p>',4,'Mature',0,NULL,'anywhere',NULL),(385,190,'review','Master\'s Level Business Analysis Capstone Project',NULL,'ITM 6899','Capstone Project',12,2017,'fall','<p>Get a team of masters students in business analytics to research and solve one of your organization&#x27;s challenges. </p>','group','2017-09-18','2017-12-15',160,NULL,'<ul><li>20-page report to clearly document the findings, conclusions and recommendations drawn from the data; </li><li>20-30 minute presentation that effectively communicate&#x27;s the results and findings of the analysis </li></ul>',4,NULL,'2017-04-21 21:58:47','2017-05-03 17:43:24','<p>Do you have a challenge or opportunity facing your business that data or business analytics would help with? Do you want to know more about your website analytics, where you should be spending more money or time, or which customers convert better? </p><p></p><p>In groups of 3-4, student-analysts will spend 40+ hours each on research and development towards a solution to one of your organization’s challenges. Over a 3 month period they will conduct a capstone project that will seek to create comprehensive, data-driven recommendations to benefit your organization. There are many diverse opportunities within the scope of this project.</p><p></p><p><strong>Some examples include: </strong></p><ul><li>Evaluate the effectiveness of a marketing campaign</li><li>Understand how users interact with the product to optimize product design</li><li>Predict whether a customer will become a VIP customer</li><li>How a political campaign can use data to rally voters</li></ul>',4,'Masters Students',0,NULL,'anywhere',NULL),(386,276,'draft','Plan stratégique en formation',NULL,'ABC 123','X',50,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-04-24 17:02:13','2017-04-24 17:04:30',NULL,NULL,'x',0,NULL,NULL,NULL),(387,356,'published','Investors Acquisition Plan',NULL,'B3000','Introduction to Financial Accounting',50,2017,'fall','<p>A group of MBA student consultants will help your organization become more attractive to potential investors and/or grant opportunities.</p>','group','2017-11-08','2017-12-08',100,NULL,'<p>Students will provide you with:</p><ul><li>Prospectuses that summarize the strategy and projections</li><li>A PowerPoint presentation of their investor pitch</li></ul><p>You may also receive a video of the pitch.</p>',2,NULL,'2017-04-25 18:54:45','2017-07-27 14:13:35','<p>Is your young, private company interested in raising outside financing, and weighing different strategies going forward? Booth MBA students will find ways to help your company access capital.</p><p></p><p>A group of student consultants will review and analyze your financial statements, present 3-year projections of revenue/expenses and/or Cap table, and make other recommendations.</p><p></p><p>Here’s what the project will look like:</p><ul><li>Students will provide a list of important economic assets/liabilities that do not show up on the financial statements, evaluate how you recognize revenues and expenses, and <strong>ensure your statements provide the best possible summary of your performance.</strong> </li><li>The group will then identify your company’s key challenges (if any) based on the information in financial statements, and <strong>determine whether your company has flexibility to access financial markets</strong> (debt/equity). They will perform this review with consideration to possible investor questions.</li><li>Next, students will <strong>propose a viable strategy</strong> to go forward and determine whether this strategy will require outside or internal financing. They will <strong>develop 3 year ahead projections</strong> (BS, IS, Cash Flow Statement) and prepare “prospectuses&quot; based on the strategy and projections for investors. These will specify the share of the company you are offering, or the amount of debt you are raising and the interest.</li></ul>',6,'MBA',0,NULL,'anywhere',NULL),(388,10,'published','Strategic Marketing Issue',NULL,'BUS 446','Marketing Strategy',35,2017,'summer','<p>Students will perform strategic marketing analyses on your marketing problem to explore and identify opportunities and make recommendations.</p>','group','2017-05-24','2017-08-02',120,NULL,'<p>The student groups will <u><strong>submit a written report detailing their strategic marketing analysis.</strong></u> Proprietary company information remains confidential at all times. </p>',8,NULL,'2017-04-25 19:50:35','2017-05-31 18:31:51','<p>A group of 3-4 students will prepare a comprehensive strategic marketing plan (Situational Analysis, Segmenting, Targeting, Positioning, 4Ps, Outcomes) to address your marketing. They will conduct comprehensive  research, analyze the issue, and provide actionable recommendations.  Project scope can include, but are not limited to: </p><ul><li><strong>New Product Marketing Plan</strong></li><li><strong>Positioning Strategy</strong></li><li><strong>Aligning Marketing Program </strong></li><li><strong>Market Segmentation &amp; Targeting</strong></li><li><strong>Marketing Audit &amp; Recommendations</strong></li><li><strong>Competitor or Consumer Analysis</strong></li></ul>',4,'4th Year',1,NULL,'anywhere',NULL),(389,10,'published','B2B Demand Estimation, Market Scanning & Competitive Analysis',NULL,'BUS 444','B2B Marketing',35,2017,'summer','<p>Student-consultants will carry out extensive market research for a company that has a B2B product.</p>','group','2017-05-24','2017-08-01',250,NULL,'<p>Thorough market research report looking at both micro and macro trends in the new market and providing detailed recommendations on how to sell into that market successfully.</p><p></p><p><strong><u>Phase 1</u></strong></p><p>Project Plan: Students will meet with organization and conduct industry research to develop a semester plan for the project.</p><p></p><p><strong><u>Phase 2</u></strong></p><p>Status Report: Students conduct primary research and customer discovery to develop a status report and detailed steps for completion of the project.</p><p></p><p><strong><u>Phase 3</u></strong></p><p>Delivery of what was outlined and reconfirmed in the status report.</p>',9,NULL,'2017-04-25 21:05:07','2017-06-20 17:06:22','<p>A group of 3-4 student-consultants will carry out extensive market research for a company that has a B2B product (existing or pre-commercialization stage). <br/>The research will focus on macro and micro market forces such as demographics, legislation, competitor and customer analysis, needs analysis of primary customer as well as derived demand of secondary customers. <br/>A forecast of unit sales will be provided along with a go / no go assessment.<br/>Examples of project scopes can include, but are not limited to:</p><ul><li><strong>Expansion to new country or territory</strong></li><li><strong>New application of existing product or technology</strong></li><li><strong>Feasibility study for new product</strong></li><li><strong>Adoption of new product to existing customer base</strong></li><li><strong>Licensing new product </strong></li><li><strong>Market Intelligence Studies</strong></li><li><strong>Market Research Study</strong></li></ul>',3,'4th Year',1,NULL,'anywhere',NULL),(390,175,'published','Organizational Consulting',NULL,'BUS 5263','Organizational Behavior',30,2017,'summer','<p>MBA students will review your internal operations to consult with you on an organizational challenge of your choosing.</p>','group','2017-06-05','2017-07-08',250,NULL,'<ul><li>10 page memo detailing the problem and solutions.</li><li>15 minute slide show presentation </li></ul>',5,NULL,'2017-04-26 03:04:41','2017-08-03 21:26:57','<p>In teams of 3-5, MBA students will spend one month developing a plan to solve an organizational challenge within your company. They will use organizational behaviour concepts and theories learned throughout the curriculum to diagnose the problem then identify 1 or more organizational development interventions to use. With these tools they will construct an action plan that seeks to improve your company. The action plan will include:</p><ul><li>A theory-based solution</li><li>Best practices</li><li>Implementation timeline</li><li>Tools to evaluate the results </li></ul><p>Examples include, but are not limited to:</p><ul><li>solving a problem with turnover to improve your employee retention</li><li>devising a rewards system to increase performance or motivation </li><li>improving the workplace culture of your business</li><li>improving the creativity or innovation of work groups</li></ul>',5,'1st and 2nd year MBA',1,NULL,'local',NULL),(391,358,'published','Consulting Finance Project',NULL,'FIN 293A','Consulting Field Project at Brandeis International Business School - Master of Science in Finance (MSF)',5,2017,'summer','<p>Could your organization benefit from an assessment of the market competition your company faces as well as a financial and strategic analysis of functional areas in your company?</p>','group','2017-05-22','2017-08-22',300,NULL,'<ul><li>Report detailing a practical, methodical implementation plan to execute the recommendations</li><li>An independent, highly detailed analysis of your organization and its environment </li><li>Each group will present findings at the mid-way point and at the conclusion of the project or as needed by the client</li></ul>',2,NULL,'2017-04-26 20:33:19','2017-05-30 15:31:21','<p>Brandeis International Business School students in groups of 5-6 will work for an agreed upon period of time (generally 6-10 weeks) to analyze your main financial decision-making framework and operational issues. They will use industry, market, competition and technological developments to determine what makes your business successful, what financial issues you may encounter in the future, and what you could do to make your business even more financially stable and successful. </p><p></p><p>The objective is to assess strategic financial alternatives for your business and make concrete recommendations for implementation in order to maintain your business’ competitiveness on course for long-term success.  </p><p></p><p><em>Please note: the project can begin anytime after May 22, 2017 and must end on or before August 22, 2017. However, the project must be at least 6 weeks in duration.</em></p><p> </p><p><strong>Benefits of Participating:</strong></p><ul><li>An Independent, highly detailed analysis of your organization and its environment led by some of the leading researchers in the field. Clients will certainly appreciate the in-depth analysis and objective financial and strategic assessment of operations geared for long term success.</li><li>Practical recommendations. The final deliverable is a report with specific recommendations and a practical, methodical implementation plan to execute the recommendations.</li><li>Creative Exchange. Senior management will often find that insights and perspectives from the students, or even just their questions, stimulate healthy internal debate.</li><li>Meaningful Partnership in Business Education. We hope that you will participate because of your commitment to supporting the business educational system.</li></ul><p></p>',5,'Graduate ',1,NULL,'anywhere',NULL),(392,359,'published','Simulation Modelling and Virtual Testing using Differential Equations',NULL,'MATH 314','Numerical Analysis 3 (Numerical Solution of Ordinary Differential Equations)',10,2017,'fall','<p>This assignment focuses on the students writing software to simulate a mathematical model involving ordinary differential equations.</p>','group','2017-09-11','2017-12-01',50,NULL,'<ul><li>10-page document describing problem and solution</li><li>20-minute presentation on problem and results</li><li>Working software/model/simulation(s)</li></ul>',3,NULL,'2017-04-26 23:26:04','2017-07-18 19:40:19','<p>Groups of upper-year undergraduates in mathematics, computer science, or physics can simulate a mathematical model of your choice consisting of ordinary differential equations.</p><p></p><p>Project Examples can include mathematical models for:</p><ul><li>Fuel cell research</li><li>Natural Resources</li><li>Animations and graphics</li><li>Aerospace</li><li>Biotechnology</li><li>Chemical Engineering</li><li>Pharmaceuticals</li><li>Mining and oil extraction</li></ul><p>Benefits to your organization includes time saved in running experiments and simulations as well as receiving first-hand student expertise. Your goal may be to improve the efficiency of your simulation, use it in optimization or design, or simply to have a simulation at all.</p>',3,'3rd year',0,NULL,'anywhere',NULL),(393,360,'published','Mechanical Engineering - Prototype and Design Implementation Project',NULL,'30625','Advanced Design Project',35,2017,'fall','<p>Could your organization benefit from Senior Mechanical &amp; Electronics Engineering students designing and prototyping equipment based on your business needs?</p>','group','2017-09-01','2018-04-30',160,NULL,'<ul><li>Full-functioning prototype</li><li>35-minute presentation judged by local industry partner</li><li>100-page report detailing the engineering, analysis-concept relationship, prototyping and testing</li></ul><p></p><p></p>',5,NULL,'2017-04-27 01:28:17','2017-06-27 18:34:06','<p>In groups of 2-3, Senior students in Mechanical Engineering will spend 160+ hours working with your organization to develop and create a prototype for a design idea of your choice. The project will include analysis of the concept, design consulting, prototyping, prototype testing and manufacturing of a functional model. </p><p></p><p>In the first semester they will start to develop concepts and go through the evaluation process. During the second semester they will perform engineering FE analysis of the project and finally the students will make a functioning prototype of the project and test the functionality of the device. </p><p></p><p>Examples of what the students have done include , but are not limited to:</p><ul><li>Designing a material testing device, </li><li>Designing an army shelter using drones to construct the shelter, </li><li>Aerodynamics designing a thin wall shell for under sea</li><li>Developing an artificial hand </li><li>Developing a measurement device that measures water hammer of steam pipes </li></ul><p></p><p>The students participants are proficient in :</p><ul><li>Data Analysis</li><li>Thermal And Aerodynamic Applications</li><li>Testing and Calibration</li><li>Developing platforms and products that work on land and water</li><li>UAV design used for military purposes</li><li>Probability and predictive analysis</li></ul><p></p>',3,'Seniors of Mechanical Engineering Dept.',0,NULL,'anywhere',NULL),(394,361,'review','International Advertising',NULL,'COM 6400','International Advertising Plan',25,2017,'summer','<p>Students will work to develop an international advertising plan and implementation strategy for your organization.</p>','group','2017-05-15','2017-06-23',120,NULL,'<p>Project deliverables for this assignment are:</p><ul><li>10 page document</li><li>1 creative brief</li><li>15 minutes presentation</li></ul>',5,NULL,'2017-04-27 15:41:18','2017-06-12 20:05:20','<p>When bringing a new marketing campaign global it is important to have an understanding of how to successfully communicate your product/service. In groups of 3, seniors and graduates students will work together to research and develop an international advertising plan for your organization. Through cultivating and analyzing data they will provide your organization with a creative brief and a marketing plan.</p><p></p><p>Some areas that these students can help your organization gain insight are:</p><ul><li>How to reach your target market in country of choice</li><li>Most effective marketing techniques for area of choice</li><li>Analysis of the effectiveness of entering market of choice.</li><li>Generate an approach for identifying and analyzing the key cultural and environmental characteristics of any nation or global region</li></ul><p></p>',3,'Senior and Graduate',0,NULL,'anywhere',NULL),(395,234,'review','Business Consulting',NULL,'INFO4400','Business Analytics Capstone',30,2017,'summer','<p>Receive recommendations on how to solve your business challenges through analytic-driven solutions. </p>','individual','2017-06-05','2018-03-15',200,NULL,'<ul><li>Business report with data analysis and recommendations</li><li>Presentation to the appropriate target audience</li><li>Any other documentation (software instructions, coding, etc.) as required by the problem</li></ul>',5,NULL,'2017-04-27 21:56:42','2017-05-15 23:41:22','<p>As individuals, graduate students in their final terms of MS Business Analytics will spend 200+ hours with your organization to address, analyze, and solve a data-driven business problem you are facing. Having data to validate your initial opinions or hypothesis allows your strategy to be calculated from an informed decision-making process. This gives you actionable insights that will more successfully increase the growth of your company. </p><p>Some previous project examples include, but are not limited to:</p><ul><li>supply chain optimization </li><li>scheduling optimization </li><li>customer segmentation </li><li>employee performance </li><li>market analysis </li><li>financial forecasting </li><li>predictive modeling </li><li>product analysis </li><li>sports analytics</li><li>donor base analysis</li><li>predictive law enforcement </li><li>valuation models</li></ul>',1,'Students are in the final quarter of the MS in Business Analytics',1,NULL,'anywhere',NULL),(396,275,'published','Project Management Plan',NULL,'CPMGT/305','Project Management Capstone',15,2017,'other','<p>Develop a presentation for final senior management review that includes Project Plan and Project Implementation/Execution Plan.</p>','group','2017-06-06','2017-07-10',320,NULL,'<p>The final project deliverables are:</p><ul><li>Project Plan</li><li>Project Implementation/Execution Plan</li><li>Executive Summary Presentation (12-slides)</li></ul>',1,NULL,'2017-04-28 19:15:03','2017-08-03 23:00:25','<p><strong>4th year Student Consultant teams, will work with you to develop a thorough project and implementation plan, for a project of your choosing.  This comprehensive plan will include: </strong></p><p><strong> </strong></p><ul><li><strong>Project Scope and Benefits:</strong> </li></ul><p>Description of the scope of the project, its objectives, and the specific measurable impact it will have on your business or organizational results. This section includes the schedule and budget.</p><ul><li><strong>Project Implementation Plan:</strong> </li></ul><p>Incorporating a Human Resource Plan, Procurement Plan, Quality Assurance Plan, Communications Plan, and risk analysis that includes how you might mitigate the identified risks.</p><ul><li><strong>Project Closure Process: </strong></li></ul><p>The recommended project closure process , including how you will be able include recognition and rewards and how the team will identify its learning for future projects.</p><ul><li><strong>The Sales Pitch:</strong> </li></ul><p>To use to sell the project to the customer, project committee, or management.  It will clearly define the project focus, identify its benefits, and detail the impact it will make on the business. </p>',4,'4th year Bachelors Student',1,NULL,'anywhere',NULL),(397,124,'review','Psychological Effects of Brands on Purchasing Behaviour',NULL,'PSY101','Psychological Principles of Marketing',25,1,'fall','<p>This assignment will focus on student&#x27;s ability to understand psychological principles such as social proof and confirmation bias when purchasing items.</p>','individual','2017-04-28','2017-06-29',25,NULL,'<p>Deliverables:</p><p></p><ul><li>Create a project that outlines how different users are effected by unconscious bias and social proof</li></ul>',1,NULL,'2017-04-28 21:28:34','2017-08-03 22:49:26','<p>A student may:</p><p></p><ul><li>Create an analytical report for the organization on better practices in marketing to a certain group of users online</li></ul>',1,'1st Year Psychology',0,NULL,'anywhere',NULL),(398,59,'published','Information Systems Analysis & Recommendations',NULL,'CSIS 2200','Systems Analysis and Design',50,3,'summer','<p>A student group will evaluate the problems/limitations of your company&#x27;s current information system or it&#x27;s subcomponents and generate some opportunities for improvement. </p>','group','2017-06-05','2017-08-09',80,NULL,'<ul><li>A report outlining analysis of the system, current problems/limitations and future recommendations</li><li>Implementation plan for system upgrade with potential risks associated, as well as the change management processes needed for success</li></ul>',4,NULL,'2017-04-28 22:05:58','2017-08-03 23:03:28','<p>Over the course of one semester, student in a group will evaluate an information system (or its sub-component) in your organization that needs an upgrade. Students will review the system in place, document current problems or limitations, and identify opportunities for improvement. They will then identify system upgrade solutions tailored to your organization after evaluating three alternative vendors to recommend the most appropriate solution. Students will prepare system upgrade implementation plans, providing a description of the major system implementation tasks. Finally, they will identify risks associated with implementation and the change management processes needed.</p><p></p><p>Project areas can include, but are not limited to:</p><ul><li>Components of transactions processing systems that provide operational support (e.g. order processing, payroll processing, etc)</li><li>Components of customer relationship management systems that accumulate and track customer activities, including purchasing trends, product defects, customer inquiries/support, etc</li><li>Components of business intelligence systems that identify, extract, and analyze data for various operational needs and decision-making purposes</li><li>Components of knowledge management systems that organize and integrate knowledge and then redistribute or share it with individuals of your organization</li><li>Components of collaboration and communication systems that your organization uses to facilitate collaboration and communication across the organization, etc.</li></ul><p>Please note that the business process(es) the system supports (or intended to support) should be properly identified. </p>',3,'2nd year',1,NULL,'anywhere',NULL),(399,346,'review','Personalized Health Monitoring Kit',NULL,'EE443','Pattern Recognition',20,17,'fall','<p>Students will develop a patient-specific heart monitoring wireless kit to identify and report Patient&#x27;s ECG signal morphological abnormalities.</p>','group','2017-06-01','2018-05-31',400,NULL,'<p>The final deliverable outcomes of this project include:</p><ul><li>A wireless KIT with body-area sensors and wireless connectivity </li><li>MATLAB-based signal processing package</li><li>Patient-specific abnormality detection algorithm </li><li>Online and offline signal visualization module</li><li>Real-field test and report</li><li>Web-based interface</li></ul><p></p>',1,NULL,'2017-04-29 20:01:59','2017-05-26 23:49:00','<p>An individual student group consisting of 2 people will <strong>develop electronic devices</strong> for the health industry using embedded systems and programming. It will help in remote sensing of patient&#x27;s health and also inform the patient in case of an anomaly. For example the way FitBit helps people track their daily walking/running. The product once developed, will be able to gauge the vital signs of a patient along with their vital signs. The students will be using technology currently being used in making drones, unmanned vehicles and devices for people with special needs.</p><p></p><p><strong>Data modelling</strong> and computer programming (MATLAB) will be used to make <strong>optimized algorithms</strong> which can save time and money for manufacturer and user. Students will also be responsible for <strong>exhaustive</strong> testing and will prior knowledge of business tools for <strong>data analysis</strong> and reporting. A unified, easy to use <strong>web portal</strong> will be developed that will contain all information including monitor data for later analysis and bookkeeping for users and service provider and for soft control of the entire system.</p>',2,'First Year, Second Year and Graduate Students',0,NULL,'anywhere',NULL),(400,367,'published','Senior Software Eng. Project',NULL,'BACS 487 and 488','Systems Analysis and Design and Senior Project',32,2017,'fall','<p>Could your organization benefit by having software applications written by bright and hardworking CIS and Software Engineering students at the University of Northern Colorado?</p>','group','2017-08-21','2018-05-11',300,NULL,'<p>Typical deliverables by the end of BACS 488 are:</p><ul><li>A specifications document</li><li>Front-end and back-end design documents (UML diagrams, database schemes, etc.)</li><li>Working application plus hardware system, if applicable</li><li>Test documents (component, system and user test plans and outcomes)</li><li>User manuals and guides</li></ul>',7,NULL,'2017-04-30 18:50:54','2017-06-20 18:14:37','<p>In teams of 3-4, student-engineers will work all aspects of designing, developing, and maintenance of a fully-functional software system (can include hardware elements).</p><p></p><p>Past project examples include, but are not limited to:</p><ul><li>Web applications and database back-end systems for service based businesses</li><li>Design and development of Windows desktop applications that suits the operational needs of privately owned small businesses</li><li>An inventory management web application catered specifically to manufacturing businesses</li><li>Remote access control mobile applications</li></ul>',3,'Senior',0,NULL,'anywhere',NULL),(401,355,'review','Marketing Plan and Communication Strategies',NULL,'MKT 271','Principles of Marketing ',20,1,'fall','<p>Students will conduct an environmental scan to identify an external challenge or opportunity that may be affecting your business. </p>','group','2017-09-04','2017-10-16',160,NULL,'<p>You’ll receive a written report explaining the IMC plan and recommendations, as well as a findings presentation with the opportunity to ask questions.</p><p></p>',5,NULL,'2017-05-02 04:50:37','2017-07-07 20:07:18','<p>1st and 2nd year students will address a marketing challenge or opportunity related to marketing environment. The group of four will develop communication strategies for market segmentation, and present you with their recommendations.</p><p></p><p>You’ll receive a report with the results of an environment scan (focusing on market segmentation) as well as communication strategies that will help your organization improve its marketing moving forward.</p><p></p><p><strong>Possible projects include but are not limited to:</strong></p><ul><li>Conducting an environmental scan by initiating customer discovery interviews</li><li>Coordinating product ideation for an existing marketing challenge</li><li>Creating an Integrated Marketing Communication (IMC) campaign plan</li><li>Producing an Event Plan for an upcoming event</li></ul>',4,'1st or 2nd year ',0,NULL,'local',NULL),(402,150,'published','Business Consulting',NULL,'OPRE 6398','Operations Research Analytics',35,23,'fall','<p>Individual student consultants spend approximately up to 10 weeks working with your company in analyzing data sets using a variety of analysis methods according to your needs. The results can provide in-depth insights into the operations of your business, a detailed perspective of your customers, and solutions to complex problems. Students can leverage industry standards for analysis using various tools such as SQL, Excel, SAS, PPT, and Tableau.  Project content is flexible and meant to move your data problems forward.</p>','group','2017-08-15','2017-11-30',225,NULL,'<ul><li>Written project report of findings with supporting analytics and model.  </li><li>Management presentation either in person or web/video conferencing.</li></ul>',3,NULL,'2017-05-02 13:20:54','2017-08-03 23:19:45','<p>In groups of 5, student-consultants will work 45+ hours assisting your company by providing analytical research and recommendations tailored to one of your company’s data opportunities or challenges. They will employ analytic and statistical software such as Tableau, SAS, Micro-strategy, Power BI or other methods to inform their decision-making process.  </p><p></p><p>Some examples include, but are not limited to: </p><p></p><ul><li>Analyzing e-commerce data to understand buyers and buying habits across several selling platforms, </li><li>Understanding profitability, retention, referrals, and attrition rates for your customers</li><li>Creating comprehensive dashboards to enhance your data visualization for customers, teams, and executives, </li><li>Prescriptive analytics using customer segmentation</li><li>Customer relationship management (CRM), personalization </li><li>Online recommendation systems </li><li>Web mining</li><li>Product assortment, and designing lead scoring systems to understand opportunities worth pursuing and developing predictive sales model, etc.</li></ul><p></p><p>Students will complete the data analysis and present their findings in final a presentation (virtual or in-person.) They will clearly identify the challenges the organization is facing relevant to the data, uncover the root cause of the identified challenges, propose viable solution(s), and recommend the best course of action as well as justify the position through metrics. Students will also provide tangible copies of their work as it pertains to their individual project.</p>',5,'Senior and post grad MS/MBA',1,NULL,'anywhere',NULL),(403,150,'published','Supply Chain, Logistics, and Channel Optimization',NULL,'OPRE 6367','GRAD SCHOOL CAPSTONE',30,25,'fall','<p>Your organization could benefit from optimizing your management strategies. Get help with market analysis, entrance, expansion, new products, channel optimization, price/revenue and more.</p>','group','2017-08-15','2017-11-30',300,NULL,'<p>At project completion, you’ll receive:</p><ul><li>Project report with findings supported by analytics</li><li>Management presentation (either in person or via web/video)</li></ul>',4,NULL,'2017-05-02 13:38:45','2017-08-03 23:20:13','<p>A group of Master of Science and MBA students will spent 300+ hours helping you with an unusual or challenging project that pertains to your goals. Projects can include a wide range of supply chain and sales channel optimization-related topics.</p><p></p><p>This capstone project provides an opportunity for students to hone the skills they have learned throughout their degree and apply them to unique issues currently affecting your organization.</p><p></p><p><strong>Project scope can include, but is not limited to:</strong></p><ul><li>Process improvement</li><li>Channel strategies</li><li>Customer data analytics/segmentation</li><li>New product/market introductions</li><li>Logistics and competitive positioning</li><li>Integration of e-commerce platforms</li></ul>',5,'Post Grad MS/MBA students',1,NULL,'anywhere',NULL),(404,346,'published','Business Practice Analysis',NULL,'BBA 486','Current Topics in Management',35,2017,'fall','<p>Students will propose one new idea to improve your business practices based on current trends in management.</p>','group','2017-09-04','2017-10-09',320,NULL,'<p>The final project will include:</p><ul><li>A written 1-2 page prospectus</li><li>A 20 minute presentation</li></ul><p>You’ll receive a detailed implementation plan as a recorded presentation for future reference. </p><p></p><p>Your company will own all intellectual property associated with the assignment, and are able to implement this strategy following project completion.</p>',6,NULL,'2017-05-02 16:04:21','2017-07-26 23:54:02','<p>Project ideas could include but are not limited to:</p><ul><li>A proposal for a new market entry opportunity</li><li>A new strategy for increasing sales</li><li>A new human resource management practice to improve workplace cohesion</li><li>A new marketing technique using social media or popular culture</li><li>Any number of ideas to take advantage of any current trend in the business world</li></ul><p>A group of 4 students will analyze your organization in areas such as:</p><ul><li>Globalization</li><li>Gamification</li><li>Social media</li><li>Neuromarketing</li><li>...and/or new business models. </li></ul><p>Students will focus on the aspects of creativity, viability of idea, inclusion of course concepts, and firm reception.</p>',4,'Fourth Year',0,NULL,'anywhere',NULL),(407,374,'published','Public Relations Plan',NULL,'COMM 426','Conflict Management',50,2017,'fall','<p>Individual groups consisting of 3-5 students will conduct research, draft a report, and offer a conflict resolution or public relations strategy to your organization.</p>','group','2017-08-31','2017-12-05',100,NULL,'<ul><li>The students will prepare a 15 - 20 page report including models showing conflict analysis findings and proposed intervention strategies</li><li>The students will conduct an in person or video presentation analyzing their findings</li></ul>',1,NULL,'2017-05-04 22:34:29','2017-06-27 18:11:26','<p>An individual group of 3-5 fourth year students will help your organization to resolve a dispute or public relations issue. Students will conduct an analysis of a dispute and complete a report showcasing their findings and provide appropriate recommendations to constructively move forward on the issue.</p><p></p><p>Students will ensure the key messaging, perception, and social influence are portrayed appropriately by their problem solving strategy. They will seek a strategy that takes into account the divergent perspectives and will craft an approach for your organization to move forward.</p><p></p><p>Students are experienced in the areas of communications and conflict resolution. Any issue that involves various stakeholders with different points of view would provide a suitable topic for students. </p><p></p><p>Possible project ideas may include but are not limited to:</p><ul><li>Handling a Public Relations issue between a business and the community</li><li>Dealing with a dispute or disagreement involving internal or external stakeholders</li><li>Creating a strategy to mediate a conflict between two or more parties</li><li>Developing a plan to improve customer interactions between a company and its customer-base</li></ul><p></p>',5,'Primarily Fourth Year',0,NULL,'anywhere',NULL),(409,143,'published','IT Project Management with Execution',NULL,'ISYS 663	','Information Technology Project Management',37,2017,'summer','<p>Could your organization benefit from using a student group to help document and manage a 4-week IT project being implemented in your workplace?</p>','group','2017-06-05','2017-07-07',250,NULL,'<p><strong>Project Deliverables </strong></p><p></p><p><strong>Phase 1 </strong>– Project	Plan: Students will meet with organization representative(s) to devise the project scope and prepare detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan.  Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome Report and Presentation: Students will submit detailed report on the outcomes of the project. Teams will also present this in the last class. Organization representative(s) are invited to attend these presentations.</p>',1,NULL,'2017-05-05 20:31:22','2017-07-14 21:55:27','<p>In groups of 4-5, students from various disciplines will work together to document and manage an Information Technology project for you. </p><p></p><p>For the first 2 weeks students will plan and prepare the project for implementation; the last 2 weeks is devoted to executing the plan. </p><p></p><p>They will work with your organization to help improve the project implementation process and ensure that the project is completed in an efficient manner. This will increase your productivity, onboarding efficiency, and technology adoption within your organization.  </p><p></p><p><strong>Successful past projects have included, but are not limited to</strong>:</p><ul><li>Research and document the feasibility study of an new technology</li><li>Conduct user experience research to identify new technology opportunities / business models</li><li>Develop wireframe and prototypes for mobile apps  </li><li>Develop / test / maintain websites or mobile apps  </li><li>Improve the volume and quality of a database, and how it&#x27;s used</li><li>Document and analyze the past IT projects and create lesson learned report</li><li>Create scope / time / cost / risk  management plans for an IT project </li></ul>',5,'Varied',1,NULL,'anywhere',NULL),(410,23,'published','Social Media & Communications Audit + Recommendations',NULL,'CMNS 498','Communications Practicum',12,2017,'summer','<p>A case study analysis of the external communications strategy of your business, with recommendations for improvement, revised key messages, and a social media plan.</p>','individual','2017-06-05','2017-08-07',20,NULL,'<p>Students will submit a 4-page report including an executive summary, a report on current messaging and key constituents, and recommendations for improvement.</p>',5,NULL,'2017-05-07 21:52:23','2017-07-31 19:58:27','<p>Would you like an analysis of the strengths and weaknesses of your organization’s external communications strategy? Individual upper-level students will produce  a case study analysis of your business’s key messages, with recommendations for areas of improvement and revised key messages, as well as a social media plan.</p><p></p><p>The social media plan will outline how to either build on what you’re currently doing, or improve your current plans, including suggestions for frequency of posting for each social media platform, and hashtags you should be working with.</p>',1,'4th year',1,NULL,'regional',NULL),(411,363,'published','Engineering Project: Test/Integration',NULL,'WWA 003','Electrical Engineering Internship ',1,2016,'summer','<p>For 8-10 weeks, individual engineering intern will work with you to assist in the design and testing of new product concepts.</p>','individual','2017-06-30','2017-08-31',160,NULL,'<p>The student will provide a 1-3 page document summarizing findings and analysis. The student will also deliver results as a presentation (virtual or in person).</p>',1,NULL,'2017-05-08 17:27:19','2017-06-26 21:39:59','<p>For 8-10 weeks, an individual engineering student will work 160+ hours with you to assist in the design and testing of new product concepts.</p><p>This engineer student will assist with development, integrating, and testing of software/hardware applications. The student will use tools such as NX9.0 and Python. </p><p></p><p><strong>Project examples include, but are not limited to:</strong></p><ul><li>Design and test new product concepts including processors, RF networking, signal processing and power electronics</li><li>Develop, integrate, and test software/hardware applications</li><li>Code, simulate, integrate and validate software for real-time embedded control systems</li><li>Develop simulation and interfacing methodology for software testing</li><li>Work closely with multiple teams of developers supporting R &amp; D programs</li></ul>',5,'3rd Year',1,NULL,'local',NULL),(412,363,'published','Consumer Insights and Analysis',NULL,'WWA 001','Data Analysis Internship',1,2016,'summer','<p>For 8-10 weeks, an individual student-consultant will work with you to provide your organization with new consumer insights and recommendations that will propel your strategy forward.</p>','individual','2017-07-03','2017-08-31',240,NULL,'<p>240+ hours commitment to project</p><p>Final presentation (virtual or in-person) to present including:</p><ul><li>Identifying your organization&#x27;s challenge</li><li>Uncover root cause of challenge</li><li>Proposal of viable solutions</li><li>Recommended best course of action (justified through data)</li></ul>',1,NULL,'2017-05-08 17:33:58','2017-07-05 20:23:06','<p>By conducting secondary data-based research about your industry/consumers, the individual post-grad student will work to construct a survey to administer then analyze the key findings present in the survey data.</p><p></p><p>This project will provide value to your organization a number of ways including:</p><ul><li>Improving your product/service</li><li>Measures customer satisfaction</li><li>Provides actionable insight to create a better customer experience</li><li>Delivers tangible data that can be used to make better business decisions</li></ul>',6,'Post-grad',1,NULL,'anywhere',NULL),(413,345,'review',' International Business Operations & Supply Chain ',NULL,'MGM 569','International Business Operations & Supply Chain Management',50,2017,'winter/spring','<p>A group of graduate-level international business students will spend the semester working on a specific operational issue that you&#x27;ve been experiencing</p>','group','2017-04-07','2017-06-16',250,NULL,'<p>Students will spend an entire semester working with your organization. At the end of which, the will <u><strong>present an 8-page document</strong></u> detailing the operational issue, the main root of the cause, and potential recommendations to solve it. The group will <u><strong>present this data to your organization in a</strong></u> <u><strong>30-minute</strong></u> <u><strong>presentation that includes Q&amp;A period for clarifications</strong></u>.</p>',2,NULL,'2017-05-08 21:22:14','2017-05-11 22:52:08','<p>A group of graduate-level international business students will spend the semester working on a specific operational issue that you&#x27;ve been experiencing. <u><strong>Students will conduct a full analysis of the operation, define the precise root causes of the problem/issues and possible recommendations</strong></u>. Past projects have included:     </p><ul><li>Inventory Control Issues</li><li>Quality Control Issues</li><li>LEAN applications and improvements</li><li>Sourcing Globally or Outsourcing Issues</li></ul>',5,'MBA ',0,NULL,'anywhere',NULL),(414,345,'draft','Supply Chain Management Project',NULL,'COMM 449','Supply Chain Management',40,2016,'fall','<p>Groups of 4-5 student-consultants will work with organizations to develop a strategy for obtaining one or more supplies and/or evaluate suppliers to support the corporate strategy.</p>','group','2016-09-09','2016-12-08',1,NULL,'<p>Final deliverable includes 10 page report that provides any assumptions and justification for recommendations.</p>',1,NULL,'2017-05-08 21:22:48','2017-05-08 21:24:26','<p>Groups of 4-5 student-consultants will work with organizations to develop a strategy for obtaining one or more supplies and/or evaluate suppliers to support the corporate strategy. Students will identify any supply chain challenges and recommend opportunities for improvement. Potential project scopes include, but are not limited to:</p><ul><li><strong>cleaning up and analyzing procurement data to support the projects listed below:</strong></li><li><strong>developing plans for optimizing and managing routine and critical spend items</strong></li><li><strong>evaluating the implications of sourcing from another country</strong></li><li><strong>developing total cost comparisons of supply alternatives where price is not the most significant consideration (service, quality or other factors could be more important than price)</strong></li><li><strong>proposing ways to manage suppliers to reduce costs</strong></li></ul>',5,'4th Year',0,NULL,NULL,NULL),(415,18,'published','Operational Analytics Consultancy',NULL,'OM468/686','Quantitative Management Consulting',30,2018,'winter/spring','<p>A team of MBA and 4th year undergraduate student-consultants develop a data-based solution for an analytical problem your organization is facing.</p>','group','2018-01-11','2018-04-12',100,NULL,'<p>Manditory delivarables include:</p><ul><li>Project proposal/bid</li><li>Progress update presentation</li><li>Project completion presentation</li></ul><p>Further deliverables are determined between the student-consultants and your organization during the proposal phase. Additional deliverables typically include:</p><ul><li>Excel model</li><li>Documentation</li><li>Source code</li><li>Other findings as requested and agreed upon.</li></ul><p></p><p></p>',8,NULL,'2017-05-08 22:31:52','2017-08-30 16:00:10','<p>Beginning in January, a group of 3 to 4 Student-consultants will spend around 400 hours working as a consulting team for your organization. Based on the information you provide, including organizational goals, the group will provide insight and recommendations to solve your analytical problem.</p><p></p><p><strong>Previous consulting projects include but are not limited to:</strong></p><ul><li>Optimizing fire code inspection sites to maximize loss prevention.</li><li>Modelling electricity pricing.</li><li>Forecasting municipal growth.</li><li>Analyzing feasibility of using 3rd party contractors for disabled adult transit system.</li><li>Forecasting equipment repair orders.</li><li>Identifying optimal warehouse locations in a supply chain.</li><li>Studying factors affecting women running in municipal elections around the province.</li></ul>',4,'4th year & Master\'s',0,NULL,'anywhere',NULL),(416,73,'published','Operations Management',NULL,'BU385','OPERATIONS MANAGEMENT I',15,2017,'winter/spring','<p>A group of students will use quantitative analysis to solve operation management problems your company has been experiencing.</p>','group','2017-06-15','2017-07-07',25,NULL,'<ul><li>Final report - your organization will receive a copy</li><li>Final presentation - your organization is encouraged to attend</li></ul>',6,NULL,'2017-05-09 15:59:38','2017-08-03 22:47:59','<p>A group of students taking a course in operations management will use <u>quantitative analysis</u> to help solve a problem unique to your organization. Students will use data provided by your organization and apply operations management theory and tools to analyze the problem and recommend solutions. A final report and presentation will give you a summary of their research and provide valuable insights that you can use going forward. Students are expected to devote 25 hours to this assignment.</p><p></p><p>Some examples include:</p><ul><li>Developing a demand forecast</li><li>Determining appropriate staffing levels to support future needs</li><li>Addressing any quality related problems in the supply chain</li><li>Supply chain management issues</li><li>Product design and reliability assurance</li><li>Location optimization for a warehouse or other facility</li></ul><p></p>',2,'3rd year',1,NULL,'regional',NULL),(417,363,'published','Investor Analysis and Proposal',NULL,'WWA 002','Accounting Internship',1,2018,'summer','<p>For 8-10 weeks, an individual MBA student-consultant will work on a <strong><u>finance or accounting or related project</u></strong> for your organization or support one of your teams in the accounting function.</p>','individual','2017-07-21','2017-08-31',240,NULL,'<p>A report summarizing analysis and key findings based upon research done through the course of the project. </p><p>Project is local to the Toronto area</p>',1,NULL,'2017-05-09 17:11:26','2017-07-12 00:10:50','<p>For 8-10 weeks, an individual MBA student-consultant will work on a finance or accounting or related project for your organization or support one of your teams in the accounting function. Project could be analysis based or working with a startup in helping to build financial statements or investor information. <br/></p><p>Benefits from this project could include:</p><ul><li>Develop financial statements/projections that show a credible business strategy</li><li>Insight into the financial health of your organization</li><li>Better understanding of your perceived financial risk</li><li>Better use of employee stock option plans</li><li>Appropriately defining the valuation of your business</li></ul>',1,'MBA',1,NULL,'local',NULL),(418,58,'draft','Business and Sustainability',NULL,'COM 361','Business and Sustainability',250,2016,'fall','<p>A </p>','group','2016-09-15','2016-12-01',20,NULL,'<p>Groups of students will submit their <u><strong>written recommendations</strong></u>, as well as <u><strong>formally present their project</strong></u> to the industry partner (in person or virtually).</p>',1,NULL,'2017-05-09 18:05:44','2017-05-10 20:30:30','<p>A group of students will provide an <u><strong>outsider&#x27;s perspective to your current customer service</strong></u>. Through interviews and the information you provide, the student consultants will assess what you do and then <u><strong>compare it to best practices they learn in class</strong></u>, as well as to what your competitors are doing.  They will then provide a base of possible recommendations on how you can improve.</p>',4,'3rd Year',0,NULL,NULL,NULL),(419,363,'published','Software Development Project',NULL,'WWA 004','Software Development Internship',1,2016,'summer','<p>Individual student will spend <strong><u>2-3 months </u></strong>working with you to assist in the software development, software platform enhancing or creating computer applications.</p>','individual','2017-06-22','2017-08-24',240,NULL,'<p>The deliverable are specific to the individual scope of the project. Each organization can expect:</p><ul><li>Requirements and design of the system</li><li>Working system that is demo-able (though may still have bugs)</li><li>Documentation (user and technical) relevant to the project</li><li>Methodological artifacts </li></ul>',1,NULL,'2017-05-09 22:56:32','2017-06-26 21:39:43','<p>2nd year computer science student will work 2-3 months with your organization to develop a software system from idealization to a running system. This student will work 200+ hours on developing a project of your choice. Better software can decrease long-term costs, quicken on-boarding time for new staff, increase your competitive advantage or increase your company value (amongst other things.) </p><p></p><p><strong>Some example projects include:</strong></p><ul><li>Design, modify, develop, write and implement software programming applications</li><li>Develop and deliver integration tools for internal users or external clients.</li><li>Maintain system stability and performance</li><li>Troubleshoot production issues, participate in continual improvement</li><li>Work with product support team to address customer reported issues.</li></ul><p>While practicing their learned tools and methodologies, the student-engineer will create valuable software solutions for your organization. </p>',4,'2nd year',1,NULL,'anywhere',NULL),(421,274,'published','Market Analysis for Expansion Opportunities',NULL,'FINA/INTB 4397','Financial Crises and Global Business',32,2017,'summer','<p>A group of students will work with your firm to determine whether you should increase business, expand operations, or acquire assets in another country.</p>','group','2017-06-12','2017-07-03',6,NULL,'<p> </p><p>Each unique team will submit a <strong><u>5-page opportunities and risks analysis report</u></strong> that includes an assessment of the economic conditions and financial markets in the country or region of interest. These recommendations <strong><u>will benefit the growth of your organization</u></strong>, specifically as it relates to your global position and marketplace.</p><p></p><p>Teams will also present their findings in a <strong><u>15-minute presentation to the entire class and you </u></strong>(if available). The team has the option to recommend social media to publicize the research.</p><p></p>',6,NULL,'2017-05-11 03:51:11','2017-08-03 21:27:50','<p> </p><p>Teams of Finance majors will work with your firm to assess whether you should increase business, expand operations, or acquire assets in another country or region. Teams of 5 to 6 student-consultants will conduct <strong><u>research and analysis for your selected country, assess financial risks, and recommend whether you should make an investment there.</u></strong></p><p></p><p>Teams will analyze a specific country or region, <strong><u>identifying risks and opportunities</u></strong>. Through creating a strategic plan for financial risks analysis, and then researching and assessing your international market of interest, students will consider the firm&#x27;s <strong><u>strategic alignment</u></strong> to <strong><u>provide robust recommendations</u></strong>.  </p><p></p><p>Some of the possible regions and countries are:</p><ul><li>Africa and the Middle East</li><li>Asia (China, Japan, S. Korea)</li><li>Europe (Germany, France, United Kingdom)</li><li>Central America and Caribbean (Cuba) </li><li>North America (Mexico, Canada)</li><li>South America  (Argentina, Brazil) </li><li>Other regions of the United States</li></ul>',5,'Juniors and Seniors mostly Finance majors',1,NULL,'anywhere',NULL),(422,48,'published','Attracting Talent and Talent Management Strategy',NULL,'MBA 718','Organizational Behavior',15,2017,'summer','<p>Students will consult with your company to provide a two-year talent management plan for your organization, with strategies to attract, retain and develop talent. </p>','group','2017-06-16','2017-08-16',50,NULL,'<p>Students will prepare a report and present their findings at the end of the project, detailing their talent management plan customized for your organization, including the deliverables above.</p>',1,NULL,'2017-05-11 15:08:33','2017-08-03 21:27:25','<p>Pace MBA students will act as outside consultants for your organization, learning about your goals and current challenges around your company&#x27;s talent pool.</p><p></p><p>They will work over a 10-week session to develop a comprehensive talent management plan that describes how you can attract, retain and develop high potential employees within your organization.</p><p></p><p><strong>Students will include the following in their talent management strategies:</strong></p><ul><li>Develop programs and strategies to <strong>source and attract high potential talent</strong> (e.g., develop a framework to identify prospects who will be successful at your company) </li><li>Develop programs and strategies to <strong>reduce the risk of losing key employees</strong> to competitors (e.g., develop strategies to keep workers engaged)</li><li>Analyze national <strong>labor force issues</strong> expected to impact talent management throughout the next decade (e.g., explicate the current and future talent challenges faced by your organization)</li><li>Identify the type of <strong>organizational culture </strong>that is needed to attract, develop, and retain high potential employees (e.g., develop a common corporate culture of talent appreciation across)</li><li>Develop programs and strategies to facilitate <strong>continuous learning</strong> and prepare key talent for future strategic and leadership roles (e.g., recommend training and development practices that will create strategic thinkers and corporate leaders)</li></ul><p></p>',5,'MBA',1,NULL,'regional',NULL),(423,172,'published','Wireless Network Site Survey',NULL,'COMP 4393','Senior Design Project',2,2017,'fall','<p>Students will visit your site to assess your current wireless implementation system and suggest recommendations for improvement.  </p>','group','2017-10-02','2017-12-01',60,NULL,'<p>The final project deliverables are: </p><ul><li>A final report with suggestions for improvement </li><li>15 minutes presentation</li><li>Memos detailing the specific suggestions</li></ul><p></p><p></p>',2,NULL,'2017-05-11 16:04:33','2017-08-08 16:43:22','<p>Wireless network efficiency is crucial for successful and efficient business practices. Two senior level students will visit your work site to assess your wireless network efficiency and analyze the system for:</p><ul><li>inefficiencies </li><li>configuration problems</li><li>frequency problems</li><li>security problems and more</li></ul><p>The findings will be delivered through a presentation and comprehensive report highlighting the structural strengths, risks, and strategies for improvement.</p>',2,'Senior ( 4th year) ',0,NULL,'local',NULL),(426,124,'review','A marketing research project based on predictive data set',NULL,'MKT01','Intro to Marketing',NULL,NULL,'fall','<p>The project will enable students to learn predictive data sets and web search engines whilst researching for a prospective clientele.</p>','group','2017-05-27','2017-09-22',32,NULL,'<p>1. A comprehensive 12 page report(indexes separate) citing the learnings and recommendtions</p><p>2.A 30 min presentation using powerpoint .</p>',1,NULL,'2017-05-11 17:22:56','2017-05-11 17:28:47','<p>Predictive data modeling and analysis.</p><p>Web search engine analysis</p><p>Product placement</p><p>Branding in diff demographies</p><p></p>',5,'MBA',0,NULL,'regional',NULL),(427,379,'published','Global Marketing Plan',NULL,'BUAD 337A','Global Marketing',50,2017,'fall','<p>Students will work with you to prepare a global marketing plan for your selected country.</p><p></p><p></p>','group','2017-10-04','2017-11-29',20,NULL,'<p>The final project deliverables are:</p><ul><li>30-40 page global marketing plan with recommendations</li><li>30 minute presentation by each team (20 mins presenting, 10 mins Q&amp;A)</li></ul>',2,NULL,'2017-05-11 17:49:48','2017-08-30 18:39:55','<p>Groups of five students will develop a marketing strategy for you if you are looking to go global for the first time, you are already global and looking to expand into a new market, or you are looking to restructure your global marketing strategies.</p><p></p><p>Examples of what students can work on include, but are not limited to:</p><ul><li>Examining the marketing problems and opportunities in a selected country and its culture</li><li>Identifying and examining the selected country&#x27;s environment by focusing on cultural, economic, financial, technological, political and legal differences in that culture</li><li>Developing ways to localize or adapt your product/service, promotional strategies, and programs due to the country&#x27;s cultural differences</li><li>Analyzing customers, competitors, and product markets in your selected country and how to apply this analysis to developing your marketing strategies </li></ul>',5,'Third and Fourth Year',1,NULL,'anywhere',NULL),(428,100,'draft','Risk Assessment',NULL,'CS 151','Introduction to Cybersecurity',25,2017,'fall','<p>do stuff</p>','individual','2017-05-12','2017-05-31',20,NULL,'<p>a web page</p>',5,NULL,'2017-05-11 21:43:24','2017-05-11 21:56:36','<p>text</p>',1,'2nd year college',0,NULL,'local',NULL),(429,22,'published','International Expansion',NULL,'BUS 460','International Trade and Finance course',20,NULL,'fall','<p>Camosun students in the International Trade and Finance course will work together with students from our partner university in Germany – Institute of Applied Sciences in Ingolstadt – on an applied export project during the fall 2017 semester. </p>','individual','2017-09-05','2017-12-15',NULL,NULL,'<ul><li>Final Report for the company summarizing the findings and recommendations for the companies expansion</li><li>A presentation of the companies expansion plan</li></ul>',1,NULL,'2017-05-12 00:18:03','2017-06-01 17:42:45','<p>Groups of students from Germany and Canada will work together to investigate export opportunities for each company in another country. Your organization will benefit from this assignment if you are looking to expand globally in the long-term.</p><p></p><p>Students will conduct export research in both Canada and Germany and will report back to the company. However, export research can also be done in an alternative market. Your organization will receive research for exporting from Canada to a country of choice, as well as to Germany for future use.</p><p></p><p>Any local BC or simply a Canadian organization can receive project examples like the following:: </p><ul><li>Research available support for Canadian export companies at the federal, provincial and local government level with the following agencies: </li><ul><li>Export Development Canada, Business Development Bank, Trade Commissioner Office</li><li>Provincial Ministry of International Trade, Small Business BC</li><li>Greater Victoria Development Agency</li></ul><li>Conduct a scan of the competitive environment in Germany</li><li>Look for trade shows, conferences or other networking opportunities in the German market</li><li>Complete specific market research tasks provided by our Canadian partner company</li><li>Prepare a final report for the company</li><li>Present the results to both companies during a joint presentation with the German students </li></ul><p>If you are interested in a German expansion in the long-run, Canada has recently negotiated a Comprehensive Economic and Trade Agreement with the European Union expected to be ratified soon. The agreement provides new and expanded market opportunities for Canadian companies in the European market. </p>',1,'4th year',0,NULL,'regional',NULL),(430,159,'published','Consumer Research Consultancy',NULL,'MKT 247 ','Consumer Insights',20,2016,'fall','<p>Students will generate actionable consumer insights relevant to your organization. </p>','group','2017-09-04','2017-12-04',50,NULL,'<p>Each group does an <u><strong>oral presentation of ~15-20 minutes</strong></u>, which is accompanied by a <u><strong>final report</strong></u> detailing their insights, the methods used to generate the data they are based on, and the actions recommended based on the implications of those insights.</p><p></p><ul><li>Final report and presentation</li><li>Recommendations and insights as per research and analysis conducted</li><li>Implications of the insights</li></ul>',1,NULL,'2017-05-12 16:06:54','2017-07-06 18:58:33','<p>Groups of 4 student-consultants each, working over an entire semester, will synthesize information and data, both existing (provided by you) and collected themselves, in order to <strong><u>generate actionable consumer insights relevant to your organization</u></strong>. </p><p></p><p>This could include:</p><ul><li><strong>understanding what triggers consumer actions in order to acquire new customers</strong></li><li><strong>understanding why consumers care about your company to increase brand loyalty</strong></li><li><strong>understanding what desires and motivations your customers have to increase retention, etc. </strong></li></ul>',4,'Graduate',1,NULL,'anywhere',NULL),(432,380,'published','Retail Strategy Plan',NULL,'MKTG 3740','Retailing',14,2017,'summer','<p>Are you a small chain retail organization that could benefit from a competitive landscape analysis and internal business research?</p>','individual','2017-06-05','2017-07-16',20,NULL,'<p>10 page business report with a current business analysis and short and long term strategy recommendations.</p>',4,NULL,'2017-05-12 21:12:30','2017-08-03 21:25:58','<p>Individually, student-analysts will spend 20+ hours researching and examining your competitive landscape, as well as conducting analyses of your organization to come up with a compelling and actionable business strategy.</p><p></p><p>The students will seek to:</p><ul><li>Examine what your organization produces and why clients value it</li><li>Conduct a SWOT analysis to evaluate organizational capabilities and the organization’s micro and macro environments</li><li>Assess opportunities to open new markets or better serve an existing market</li><li>Provide positioning strategies for target markets  </li></ul><p>Based on the above areas of analysis, students will include short and/or long term strategy recommendations in their report.</p>',1,'Junior',1,NULL,'anywhere',NULL),(433,2,'published','Operations Research & Analysis',NULL,'OMIS 4000','Models & Applications in Operational Research',30,2017,'fall','<p>Students will apply operations research tools to recommend improvements to your business operations, with the aim of increasing efficiency.</p>','group','2017-09-14','2017-12-07',25,NULL,'<p>The final project deliverables are:</p><ul><li>A 10-page report (provided by Nov 30)</li><li>A 15 minute presentation (10 minute summary and 5 minutes of questions), which industry partners can attend by Skype, if preferred (approximately Dec 7, date to be confirmed)</li></ul>',4,NULL,'2017-05-15 18:14:46','2017-08-31 16:34:23','<p>Working in groups of 3-4, undergraduate business students in their 4th year will apply quantitative tools and applied methodologies to analyze and research your business with the goal of improving operational processes.</p><p></p><p>Students can apply their knowledge to virtually any area within your business&#x27;s operations. They will use various tools from operations research to identify areas where your processes can be improved or your operations streamlined. This outside perspective can provide insights that will allow your business to increase operational efficiency, improve the quality and consistency of your business&#x27;s products or services, and decrease risk in your operations.</p><p></p><p><strong>Possible areas of focus include, but are not limited to:</strong></p><ul><li>Transportation and Routing </li><li>Inventory Management</li><li>Aggregate Planning</li><li>Asset Allocation</li><li>Employee Scheduling </li><li>Targeted Advertising</li><li>Energy Management</li></ul>',4,'4th year undergraduate business students',0,NULL,'anywhere',NULL),(434,124,'draft','Dean Dunlap',NULL,'Officia ut voluptatum quam dolores tempore eaque omnis sint laudantium dolores','Keelie Parrish',3,2019,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-05-15 18:15:51','2017-05-15 18:15:24',NULL,NULL,'1992',0,NULL,NULL,NULL),(435,374,'published','Entry / Expansion Strategy for China Market',NULL,'BUSI788C','Doing Business in China: Opportunities in China\'s Service Sector',18,2017,'fall','<p>If your firm is considering entering China or expanding in China, we can help you do feasibility study and design an entry / expansion strategy. </p><p></p>','group','2017-10-03','2018-03-09',40,NULL,'<ul><li>A 7 to 8 single-spaced page strategic business report containing the feasibility study and recommendations for your firm or product</li><li>A 20-minute presentation detailing the analysis, findings, and recommendations. </li></ul>',5,NULL,'2017-05-15 18:16:38','2017-06-12 19:50:42','<p>If your firm is considering entering China or expanding in China, student analysts can help you conduct a feasibility study and design an entry / expansion strategy. Students will work in teams of four to write a business plan for selling a product or running a company in China, including recommendations in areas such as:</p><ul><li>Location - where to offer the product</li><li>Business model - online versus physical</li><li>Target customers</li><li>Marketing and pricing strategies</li><li>Potential partnerships with local companies</li><li>Government relations</li><li>Operations  - HR, logistics, sourcing, etc.</li><li>Other areas that are important for the success of the specific business involved.</li></ul><p>As a part of the course, students will be in China for 9 days visiting about 15 companies there. They will try to visit at least one company that is similar to your firm or in the same industry as your firm. This will enable students to gain first-hand knowledge about the possible competition your firm may face in China. </p><p></p>',4,'MBA and Executive MBA',0,NULL,'anywhere',NULL),(436,61,'published','Business Consulting with Recommendation Plan',NULL,'CMNS 3000','Advanced Professional Business Communications',25,2017,'fall','<p>3rd year students will work with your organization to identify a workplace problem or opportunity.  Once approved for investigation a full recommendation report will be provided. </p><p></p>','individual','2017-09-18','2017-12-08',30,NULL,'<p>The final project deliverables are:</p><p></p><p>1) Detailed Proposal (memo format) identifying a workplace problem or opportunity requesting permission to investigate the issue. </p><p></p><p>2) A 15 to 20-page Recommendations Report including audience analysis, credible research to support high-level recommendations, a budget, a plan of action and a conclusion.</p>',10,NULL,'2017-05-15 18:38:03','2017-06-28 18:24:30','<p>An individual student will act as an internal communications specialist and consultant for your organization, to identify and summarize a challenge focusing on a workplace problem or opportunity. </p><p></p><p>Students will provide a &quot;memo proposal&quot; outlining their understanding of the organization&#x27;s challenge or opportunity. Once the challenge or opportunity has been agreed on, the student will put together a full report that includes a problem statement, audience analysis, evidence-based recommendations showing the use of credible data sources to support high-level recommendations, a budget, a plan of action and a conclusion. The company will then be able to implement this plan if they desire. </p><p></p><p><strong>Topics that the students could explore include but are not limited to: </strong></p><ul><li>Social media</li><li>Communications </li><li>The purchase of a new software system</li><li>Improving office morale</li><li>Theft prevention at a large store</li></ul><p></p><p></p>',1,'Third Year',0,NULL,'regional',NULL),(437,59,'published','Promotional Plan & Materials',NULL,'MARK 3340','Promotional Strategy',20,2017,'fall','<p>Student-consultants will work on creating a promotional plan for your company which will be accompanied by samples of promotional materials in different media (e.g. script, print ad, PR, sponsorship).</p>','group','2017-09-05','2017-12-20',50,NULL,'<p>The deliverables will laid out in 3 steps, where the final 2 are dependent on what is decided in the first:</p><ol><li>Background document including promotional plan objectives, creative theme, and key messaging</li><li>Broadcast script and print samples, as well as any other interactive and sales promotion</li><li>Public relations materials, plus experiential/event or sponsorship materials and personal selling/ direct response  promotions samples.</li></ol>',6,NULL,'2017-05-16 16:36:32','2017-08-11 15:39:33','<p>A group of 5 to 6 student-consultants will work for an entire semester on creating a promotional plan for your company which will be <u><strong>accompanied by samples of promotional materials in different media - script, print ad, PR, sponsorship, </strong></u>etc. Your promotional project can be linked to anything you are currently doing in your marketing strategy or something new: New Target Market; New Product; Special Marketing Sale; the possibilities are endless!</p>',5,'Upper year students',0,NULL,'anywhere',NULL),(438,59,'published','Strategic Marketing Plan',NULL,'MARK 4483','Marketing Practicum',18,2016,'fall','<p>A group of 2-4 student-consultants will prepare a strategic marketing plan including: researching, analyzing, and providing actionable recommendations to address a marketing challenge/opportunity.</p>','group','2017-09-05','2017-12-20',50,NULL,'<p>After defining the scope of the project (options above), the students will create a <u><strong>+10-page document outlining your strategic marketing plan</strong></u>, which will be accompanied by <u><strong>samples of marketing materials that you can implement immediately</strong></u>. </p>',6,NULL,'2017-05-16 16:50:16','2017-07-12 23:28:22','<p>A group of 2-4 student-consultants will prepare a strategic marketing plan (researching, analyzing, and providing actionable recommendations) addressing a marketing challenge / opportunity your organization faces.  They will conduct research, analyze the issue, and provide actionable recommendations. Project scopes can include, but are not limited to: </p><ul><li><strong>Company Marketing Plan</strong></li><li><strong>New Product Marketing Plan</strong></li><li><strong>Event Marketing Plan</strong></li><li><strong>Digital Marketing Strategy</strong></li><li><strong>Feasibility Study</strong></li><li><strong>Market Segmentation </strong></li><li><strong>Marketing Audit &amp; Recommendations</strong></li><li><strong>Market Intelligence Studies</strong></li><li><strong>Online Opportunities &amp; Content</strong></li><li><strong>Market Research Study</strong></li><li><strong>Branding </strong></li></ul><p>These students are part of a course called &#x27;Marketing Practicum&#x27;, where they have the opportunity to apply the knowledge they learned over their marketing education to a real business situation. Over 200 projects have been done under the banner of this course, and many firms have benefited from the directed study of senior students and the marketing consultancy provided.</p><p></p>',3,'Upper year students',0,NULL,'anywhere',NULL),(439,271,'published','Marketing Consultancy',NULL,'MKT ','Principles of Marketing',35,2017,'fall','<p>A group of students acting as outside consultants for your organization work closely with you to identify an issue or challenge you are facing, and develop a marketing strategy to overcome it.</p>','group','2017-09-11','2017-12-15',40,NULL,'<p>Students deliver a presentation of their results at the end of the quarter. They also provide a ten page report detailing their findings, analyses and recommendations.  </p><p></p>',7,NULL,'2017-05-16 23:48:50','2017-08-14 20:17:54','<p>A group of students acting as outside consultants for your organization will work closely with you to identify an issue or challenge you are facing. Students will research and analyze the issue, and develop strategies and recommendations that you could implement to address it. </p><p></p><p><strong>Project examples include, but are not limited to:</strong></p><ul><li>Developing a marketing strategy for product positioning and product promotion</li><li>Conducting industry analyses to identify new target markets, messaging, and communication strategies</li><li>Using customer analysis to develop a new social media campaign</li><li>Doing a competitive analysis of your industry to develop a comprehensive marketing plan for a startup or small organization</li></ul><p>Students&#x27; tactical recommendations will include product positioning, advertising and social media strategies, messaging, pricing, and distribution strategies.</p>',5,'Undergraduate',0,NULL,'anywhere',NULL),(440,337,'published','Market Research and Analysis',NULL,'BUS3595','Business Research Methods ',20,2017,'fall','<p>Student-consultants will evaluate a challenge, problem or opportunity within your organization by conducting business research and analysis.</p>','group','2017-09-14','2017-11-17',20,NULL,'<ul><li>Key analysis, findings and recommendations</li><li>Plan outlining critical path for implementation </li><li>Written report including presentation slides [20+ pages]</li></ul>',4,NULL,'2017-05-17 16:26:31','2017-07-18 21:59:54','<p>Over a period of 20+ hours each, student-consultants in a group of 3 will evaluate a challenge, problem or opportunity within your organization and then determine the validity, risk, potential benefit and best path forward related to this opportunity. They will collect secondary data about your industry and customers, create and administer surveys to prospective customers (if applicable), and then make conclusions based on the data collected.</p><p></p><p>Project examples include, but are not limited to:</p><ul><li>Conducting research on the industry and surveying potential customers to provide recommendations for pricing strategies. </li><li>Conducting location analysis and customer surveys to identify where to expand your business as well as provide options for channel distribution.</li><li>Investigating the competitive landscape for a new product or service to identify key messaging for promotion.</li></ul><p>Your organization will better understand the landscape of the competitive environment in which you operate, thus improving the relationship between your marketing mix—product, pricing, promotion, and distribution— and the changing needs of the customers you service as they relate to the aforementioned opportunity.</p>',3,'third year students',1,NULL,'anywhere',NULL),(441,NULL,'draft','Analyze and either agree or disagree with analytical paper',NULL,'HTMT 310','Beverage Management for the Hospitality  Industry',35,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-05-17 16:52:36','2017-05-17 16:52:58',NULL,NULL,'All seniors in college',0,NULL,NULL,NULL),(442,386,'published','Web Application Development',NULL,'CSCI 330','Databases & Information Management',32,2017,'fall','<p>Students will develop a database-driven web application with an easy to use interface that will streamline communication between your business and internal/external stakeholders.</p>','group','2017-09-05','2017-11-30',40,NULL,'<ul><li>A live web site, including source code</li><li>A 4-8 page tutorial for setting up &amp; using the web site</li></ul>',3,NULL,'2017-05-18 15:21:34','2017-06-19 23:36:02','<p>Individual groups consisting of 2 students each will develop a database-driven web application with a user guide. Exhaustive research and testing will take place prior to submission. </p><p></p><p><strong>Examples of what the students could be focusing on include, but are not limited to:</strong></p><ul><li>Creating a web presence to facilitate communication between the business &amp; end users</li><li>Creating a way to search &amp; query information from a database </li><li>Creating seamless flows of information in a B2C matrix</li><li>Requirement analyses and software interface designs</li><li>Using Agile methodology to create cost effective and easy to use platforms</li></ul>',2,'2nd-4th years',0,NULL,'local',NULL),(443,NULL,'draft','Customer Value Proposition Research Paper',NULL,'BA200','Businesses and Leaders: The Positive Difference',640,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-05-18 19:46:15','2017-05-18 19:46:30',NULL,NULL,'College Sophomore',0,NULL,NULL,NULL),(444,384,'published','Small Business Information System',NULL,'BUS 308','Information Systems for Decision Making',70,2017,'fall','<p>Could your organization use help managing information (including data entry), to automate tasks and provide useful reports for decision making?</p>','group','2017-08-23','2017-12-03',24,NULL,'<ul><li>A &quot;user friendly&quot; macro-enabled Excel workbook, that allows you to manage a set of information related to your operation, on an ongoing basis, for a particular purpose.</li><li>A slide deck showcasing the features of your system!</li></ul>',20,NULL,'2017-05-19 04:25:18','2017-06-27 18:35:52','<p>A group of 2-4 Business students will spend 100 hours total developing Excel Spreadsheet/Visual Basic-based information systems over a 16 week semester to manage information and provide useful reports. Information management systems provide a resource for more efficient decision making and capture new knowledge for future use.</p><p></p><p>In the past, projects have focused on: </p><ul><li>Employee scheduling </li><li>Inventory Analysis</li><li>Sales Analysis</li><li>Customer Service Analysis</li><li>Event Planning</li><li>Employee Performance Analysis</li><li>Production Materials Analysis</li><li>Client/customer Management</li></ul>',4,'Junior (3rd)',0,NULL,'anywhere',NULL),(446,408,'published','Technical and Professional Copywriting',NULL,'WRIT 3562W','Technical and Professional Writing',24,2017,'fall','<p>Students will work with you for 12 weeks to develop a portfolio of technical and professional writing based on your needs.</p>','group','2017-09-25','2017-12-13',96,NULL,'<ul><li>Teams will produce portfolios of technical and professional writing. Examples of past portfolio contents: web site content, user instructions, promotional copy for products, user guides, procedures.  We will work with you to determine which materials will meet your needs while also supporting our program&#x27;s student learning outcomes. </li><li>A presentation (attend in person or virtually)</li></ul>',1,NULL,'2017-05-20 15:08:50','2017-09-01 00:18:17','<p>Using an Agile Writing project management framework designed specifically for writing teams, groups of 3rd and 4th-year students will develop portfolios of written materials designed to help meet specific objectives that you, as client, identify. The Agile Writing framework is designed to keep client and writers focused on highest-priority tasks, which helps to maximize productivity. </p><p></p><p>The complexities of organizations and the complexities of technical and professional writing demand a spirit of collaboration and cooperation, so the project requires frequent communication between client and student writers. </p><p></p><p>Initial writing from students will be brief and rough so clients can see how students are interpreting client objectives, and students can receive clarifying direction. Subsequent drafts will be longer, more elaborate, more polished, and will similarly require feedback. </p><p></p><p><strong>Project examples include, but are not limited to:</strong></p><ul><li>Examining your website and making suggestions for improvement in content strategy and usability</li><li>Revising existing technical or professional content (e.g., product/service descriptions, spec sheets, manuals, instructions).</li><li>Analytical report that results in recommendations for a course of action, analysis of a problem or solution, or a feasibility report.</li><li>New technical/professional content development or revision of existing materials. </li><li>Simple proofreading, or more substantive editing for style and clarity. </li><li>Document formatting (applying styles to headings, subheadings, and body content to facilitating content management and formatting). </li></ul>',6,'Third and Fourth Year',1,NULL,'local',NULL),(447,2,'published','International Expansion Plan',NULL,'IME 1','Integrated Management Experience',50,2017,'fall','<p>Students will explore business opportunities into foreign markets.  Different expansion options will be analyzed and a recommendation will be provided along with an action plan.</p>','group','2017-10-10','2018-03-30',35,NULL,'<ul><li>A 50-slide powerpoint deck</li><li>A live presentation</li></ul>',8,NULL,'2017-05-21 00:50:23','2017-08-03 21:33:47','<p>A group consisting of 6 MBA student-consultants will work with your business on developing answers to three key questions over 6 months:</p><p>1.  Why should your business explore growth opportunities in foreign markets?</p><p>2.  Which foreign market in particular should it focus upon?</p><p>3.  How should it enter the chosen foreign market?</p><p></p><p><strong>Examples may include but are not limited to:</strong></p><ul><li>Foreign market analysis</li><li>Launching a new product into a foreign market</li><li>Expanding your business into a foreign market</li></ul>',6,'Graduate Students (MBA)',0,NULL,'anywhere',NULL),(448,59,'published','Financial Analysis & Report',NULL,'ACCT 4850','Accounting Theory',25,2016,'fall','<p>Senior student-consultants will analyze your company&#x27;s financial condition in relation to the industry and give recommendations on where improvements can be made.</p>','group','2017-09-11','2017-11-10',30,NULL,'<ul><li>A digital presentation analyzing the movement of your company&#x27;s share price with regards to financial reports/information releases during the year.</li><li>Recommendations pertaining to disclosure improvements for your financial reports and information on the website. (1-2 page pages summarizing recommendations referencing a report)</li></ul><p></p>',4,NULL,'2017-05-21 02:06:52','2017-08-02 20:57:27','<p>Beginning in September, a team of three senior level student-consultants will dedicate 90 hours over an entire semester to collaborate with your organization on the following: </p><p></p><p><strong>1. Analyze your company&#x27;s share price</strong> to identify how financial statements and MD&amp;A affect movements in the share price</p><p><strong>2. Conduct a competitive analysis</strong> of your company and your competitors&#x27; financial reports in the industry</p><p><strong>3. Provide recommendations</strong> to your company regarding improvements that can be made in your disclosure documents</p><p></p><p><strong>The benefits of this project include but are not limited to:</strong></p><ul><li>Acquiring knowledge for potential investors</li><li>Gaining a better understanding of information flow to the public</li></ul>',3,'4th years',0,NULL,'anywhere',NULL),(449,NULL,'draft','Managing People and Organizations',NULL,'MGT 2618','Managing People and Organizations',140,2017,'fall','<p> MA (pre-experienced) students will analyze human resources issues such as motivation or turnover and develop solutions based on class content. </p>','group','2017-09-15','2017-11-20',20,NULL,NULL,1,NULL,'2017-05-21 19:55:10','2017-05-21 19:58:18','<p>MA (pre-experienced) students will analyze human resources issues such as motivation or turnover and develop solutions based on class content.</p>',1,'MA',0,NULL,NULL,NULL),(450,77,'published','Business Technology Consulting',NULL,'ITM691','Field study in information systems and business analytics',12,2017,'fall','<p>Groups of MBA student consultants will identify business challenges or opportunities your organization is facing, uncover their root causes, propose viable solutions and recommend the best course of action.</p>','group','2017-08-28','2018-05-04',200,NULL,'<p>30 minute presentation and 10-page report including recommended solutions based on metrics, prototypes, data models, etc.</p>',3,NULL,'2017-05-23 19:09:24','2017-06-08 21:09:03','<p>A group of 4 second-year MBA student-consultants will generate technology-based solutions for your business problems. These solutions can be related to:</p><ul><li>Developing infographics to creatively present information</li><li>Gaining better insights from Google Analytics</li><li>Designing databases to store and query information</li><li>Identifying characteristics of target populations</li><li>Designing dashboards to enhance data visualization</li></ul>',4,'MBA',0,NULL,'anywhere',NULL),(451,392,'published','Organizational Consulting Project',NULL,'BUS 439','Organizational Behavior',14,2017,'fall','<p>Teams consisting of 3-4 undergraduate student-consultants will tackle a leadership issue or management challenge faced by the industry partner. </p>','group','2017-08-28','2017-12-12',150,NULL,'<p>Working over the entire semester, teams will provide strategic recommendations specific to the issue facing your business in the form of an 8-10 page written report and a 15-20 minute presentation.</p>',4,NULL,'2017-05-23 19:21:36','2017-06-13 19:05:10','<p>Teams consisting of 3-4 undergraduate students will tackle a leadership issue or management challenge that your company is currently facing. Working over the semester, the team will analyze the situation and complete a report as well as deliver a presentation that provides strategies and recommendations to resolve the specific challenge.</p><p></p><p>Examples for this assignment may include but are not limited to the following:</p><ul><li>Diagnose your organizational structure and its fit with your organization&#x27;s strategy and/or culture</li><li>Develop a plan to re-imagine your mission, vision, and purpose and roll it out to employees</li><li>Redesign an internal system or process including: motivation, job design and satisfaction, team management, organizational learning, training</li><li>Develop an on-boarding plan for new staff</li><li>Develop a plan to increase diversity and the positive effects of diversity in your organization</li></ul>',4,'Undergraduate',0,NULL,'anywhere',NULL),(452,392,'published','MBA Organizational & Operational Analysis',NULL,'BUS 538','Business Networks and Systems Thinking',12,2017,'fall','<p>Over the course of the semester, individual teams consisting of 2-4 MBA student-consultants will undertake an internal network analysis of your organization and give recommendations to improve operational efficiency.</p>','group','2017-08-28','2017-12-12',15,NULL,'<p>Teams will provide strategic recommendations that are specific to the challenges your business is facing. The deliverable format will be a comprehensive 8-10 page written report and a 15-20 minute presentation with Q&amp;A.</p>',4,NULL,'2017-05-24 14:39:16','2017-08-04 22:22:50','<p>Your team of MBA students will analyze the informal structure and dynamics of your work environment in a semester-long project. They will map and measure the relationships and flows between people, functions,  business units, technology, and other connected information/knowledge entities that make up your organization.</p><p></p><p>As the industry partner, you provide the area of focus and your goals, and students&#x27; work will be directed accordingly. Any operational issue or organizational topic can be provided.</p><p></p><p><strong>Project examples include, but are not limited to:</strong></p><ul><li>Improve remote collaboration through analysis of communications tools and processes</li><li>Assess how innovation works and can be fostered within your organization</li><li>Manage a significant organizational change or restructuring</li><li>Manage and improve diversity</li><li>Analyze department functions related to motivation, organizational culture, work integration, team management, organizational learning</li></ul><p>The findings will be delivered through an interactive presentation and comprehensive report highlighting the structural strengths, risks, and strategies for improvement. </p>',4,'Graduate',0,NULL,'anywhere',NULL),(453,393,'published','Marketing Communications Campaign',NULL,'BUS 3620','Integrated Marketing Communications Strategy',25,2017,'fall','<p>Students will develop an integrated marketing communication campaign for your brand.</p>','group','2017-08-29','2017-11-30',10,NULL,'<p>The final project deliverables are:</p><ul><li>10 page report describing the marketing strategy, advertising ideas and rationale</li><li>Presentation slides sharing the creatives and plan highlights </li></ul><p></p>',1,NULL,'2017-05-24 16:30:52','2017-08-29 16:03:44','<p>In groups of 5, marketing communications students will research, analyze and create a tailored communications plan addressing a specific challenge or opportunity your organization is facing. With your guidance, areas of focus for this project include but are not limited to:</p><ul><li>Marketing campaigns to new customer segments</li><li>Reaching an existing segment through a new channel (e.g online advertising)</li><li>Communicating the differences between competitors (competitive analysis)</li><li>Identifying new channels and media outlets for improved communications</li><li>Outlining advertising objectives and strategies</li><li>Creating marketing resources, etc.</li></ul><p>This assignment may be most helpful for a new brand or a brand in transition/rebrand looking for some ideas.</p>',4,'3rd and 4th year',1,NULL,'local',NULL),(454,59,'published','International Expansion Project',NULL,'BUSN 3100','Global Business Environment',35,2017,'fall','<p>Students will analyze the business and economic environment of a country for the purpose of your company&#x27;s expansion or product and service implementation.</p>','group','2017-09-12','2017-12-07',20,NULL,'<ul><li>10-15 page report</li><li>10 minute presentation</li></ul>',1,NULL,'2017-05-24 17:42:03','2017-08-04 22:45:47','<p>Student groups of 4-5 will analyze a political, economic, and cultural environment including trade agreements and risks associated with the country. Based on their research, they will create a strategy and give recommendations on how your organization can penetrate the market.</p><p></p><p>The students insights and research will help you to develop or improve an international expansion or international sales strategy. Your goals and needs will direct the focus of the students&#x27; research, so they provide you with practical, actionable recommendations.</p><p></p><p>Possible project examples include but are not limited to:</p><ul><li>Product expansion into a new foreign market</li><li>Service expansion into a new foreign market</li><li>Company expansion into a new foreign market</li></ul><p></p>',4,'Post-Graduate & 3rd year',0,NULL,'local',NULL),(455,403,'review','Using in house data to solve marketing problems',NULL,'MKTG 444','Marketing Research',20,2017,'fall','','individual',NULL,NULL,NULL,NULL,'',1,NULL,'2017-05-24 18:37:13','2017-05-25 00:43:22','',1,'Junior-Senior',0,NULL,'anywhere',NULL),(456,143,'published','Embedded System Design',NULL,'ENGR 478','Design with Microprocessors',50,2017,'fall','<p>In individual groups consisting of 3-4 junior or senior level computer/electrical engineering students, teams will work to develop a real-time embedded computer system to solve real-world problems.</p><p></p><p></p><p></p><p></p>','group','2017-08-23','2017-12-12',30,NULL,'<p>Each project group will deliver a:</p><ul><li>Final project presentation with a live demonstration of the project</li><li>Final project submission that includes a final report of the project and all the source code</li></ul><p></p><p></p>',3,NULL,'2017-05-24 21:01:35','2017-08-02 17:50:10','<p>In individual groups consisting of 3-4 junior or senior level computer/electrical engineering students, teams will work to develop a real-time embedded computer system to solve real-world problems.</p><p></p><p>This system will be the intellectual property of your organization when completed.</p><p></p><p>Examples of possible projects that the students can work on can be but are not limited to:</p><ul><li>Real-time embedded system applications</li><li>Portable and wearable devices</li><li>Sensing and control mechanisms</li><li>Embedded programming on ARM Cortex-M4 microcontroller</li></ul><p></p>',3,'3rd and 4th year',0,NULL,'anywhere',NULL),(457,NULL,'draft','Strategy Term Project',NULL,'MAN 489','Administrative Policy',55,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-05-25 14:40:18','2017-05-25 14:39:53',NULL,NULL,'Undergraduate - Senior Year',0,NULL,NULL,NULL),(458,406,'published','Multicultural Marketing Plan',NULL,'MKT 3750','Multicultural Marketing',32,2017,'fall','<p>Students will create a marketing plan for a specific multicultural market(s). They will look at the current situation, conduct research, develop ideas, and provide recommendations. </p>','group','2017-08-21','2017-12-06',20,NULL,'<p>As an industry partner you will receive:</p><p></p><p>1.  A report detailing your custom multicultural marketing plan</p><p>2. A 15-20 minute presentation </p><p>3. Recommendations that are brought to life with creative deliverables</p>',1,NULL,'2017-05-25 16:28:34','2017-08-29 18:22:40','<p>Working in groups of 5, MSU Denver students will conduct market research, perform a competitive analysis and develop a strategic marketing plan for your organization.</p><p></p><p>Students will be looking at your overall marketing strategy, but with a particular focus on multicultural markets. This can be in your existing region, or looking towards expansion into a new region. </p><p></p><p><strong>Project examples can include, but are not limited to:</strong></p><ul><li>Developing a strategy to target a new multicultural market</li><li>Identifying new ways to market your organization to a specific multicultural segment within your existing customer base</li><li>Coming up with new product or service offerings that would appeal to different multicultural markets</li></ul>',5,'sophomores, juniors',1,NULL,'anywhere',NULL),(459,406,'published','Brand Plan and Recommendations',NULL,'MKT 4100','Brand Management',20,2017,'fall','<p>Students will analyze your brand and offer recommendations for improvement.</p>','group','2017-08-21','2017-12-06',20,NULL,'<p>The final project deliverables are:</p><ul><li>A written report</li><li>A 15-20 minute presentation</li><li>Brand ideas brought to life with creative mockups</li></ul>',1,NULL,'2017-05-25 16:38:36','2017-08-16 16:56:09','<p>A group of four student-consultants will research your current brand situation, generate recommendations for improvement, and develop an action plan with sample creative deliverables.</p><p></p><p>Possible projects include, but are not limited to:</p><ul><li>Conducting an environmental scan by initiating customer discovery interviews</li><li>Product ideation for the existing marketing challenge</li><li>Integrated Marketing Communication campaign plan</li><li>Event Plan for an upcoming event</li></ul><p>As millennials, these students can provide valuable insights from a generation that will soon make up over 50% of the workforce and who currently hold $200 Billion in buying power. The power of a strong brand is undeniable, especially in the Digital Age.</p>',4,'Juniors and Seniors',1,NULL,'anywhere',NULL),(460,407,'published','Information System Development Project',NULL,'CPSC 430','Information Systems Development Practices',17,2017,'fall','<p>A project team works will work with your company to develop an information system.  Students will gather requirements from you and then build an information system to these specifications.</p>','group','2017-09-01','2018-04-27',140,NULL,'<p>An information system available for you to use.</p>',1,NULL,'2017-05-25 20:05:10','2017-08-30 18:13:26','<p>A project team of 6 - 10 students will work with you to determine the requirements for an information system you need and then build it.  This is an eight month long project, where building the system involves working in 2 - 3 week sprints. The final product will be an implementable information system you can use.</p><p></p><p>Possible projects may include but are not limited to systems development to support business functions such as inventory, scheduling, transaction processing, customer relations management, business intelligence etc.  Some of the project tasks would involve:</p><ul><li>Requirements gathering</li><li>Prototyping features</li><li>Coding based on client feedback to prototype</li><li>Testing (unit, system, integration, user acceptance)</li><li>Delivering updated software</li></ul>',6,'Fourth Year',0,NULL,'anywhere',NULL),(461,NULL,'review','Investing in a portfolio',NULL,'BUS412','Security Analysis',15,2018,'winter/spring','<p>They will analyze stocks, bond mf in order to invest in a portfolio to make money.</p>','group','2018-05-04','2018-05-25',10,NULL,'<ul><li>Paper 5-10 pages</li><li>Oral presentation 3-5 minutes</li></ul>',3,NULL,'2017-05-26 17:16:36','2017-05-26 17:57:12','<ul><li>Developing optimal portfolios of investments</li></ul><p></p><p></p>',4,'undergrad seniors',0,NULL,'anywhere',NULL),(462,227,'published','Strategy Consulting',NULL,'CAPS520','Pre-Masters Strategy Course',15,2017,'summer','<p>Students will spend the semester acting as consultants to help your organization address a challenge or opportunity your organization is facing.</p>','group','2017-06-30','2017-07-18',50,NULL,'<p>Final project deliverables:</p><ul><li>Maximum 10 page report for the organization (not including exhibits)</li><li>20 minute presentation followed by Q&amp;A</li></ul>',1,NULL,'2017-05-27 00:58:51','2017-08-03 23:12:37','<p>15 Pre-MBA &amp; Pre-Masters of Engineering students will work in teams to tackle a problem or improve on an opportunity for your organization.  They can focus on a specific need for your organization over a semesters worth of work. </p><p></p><p><strong>Students are ready to work with you on topics such as:</strong></p><ul><li>Outreach to customers - ways to engage customers</li><li>Improve an aspect of the business model such as operations </li><li>Analysis of data to support the organization</li><li>Expansion of product to a new market</li><li>+Engineering opportunities</li></ul>',5,'Pre-MBA & Pre-Masters of Engineering ',1,NULL,'anywhere',NULL),(463,332,'published','Organizational Behaviour Consulting',NULL,'HRM 821 (C21)','Organizational Behaviour Consulting',60,2017,'fall','<p>Student-consultants will develop an action plan that addresses a leadership or management challenge currently faced by your organization.  This will be an entire class, all divided into groups of 5. </p>','group','2017-10-16','2017-11-19',30,NULL,'<p>The final project deliverable is a 10-page written report detailing the problem, recommended solutions, and action plan.</p>',1,NULL,'2017-05-28 16:04:38','2017-08-29 15:24:20','<p>Based on information you share and provide, student-consultants will develop an action plan that addresses a leadership or management challenge currently faced by your organization.  Over a 5 week period, the students will diagnose the problem and develop a strategy to help you address it.</p><p></p><p><strong>Sample student projects include, but are not limited to:</strong></p><ul><li>Designing/redesigning an internal system or process related to socialization, motivation, team management, conflict resolution, leadership, change management, talent management, etc.</li><li>Developing a plan to re-imagine your mission, vision, and purpose and roll it out to employees</li><li>Strategy for integrating cultures in a merger or acquisition</li><li>Diagnosing your organizational structure and its fit with your organization’s strategy</li><li>Developing a plan to increase diversity and outlining the positive effects of diversity in your organization</li><li>Developing a plan to address employee turnover / improve employee retention</li></ul>',5,'Continuing Education',1,NULL,'anywhere',NULL),(464,22,'review','Sales Sponsorship Project',NULL,'MARK 235','Creative Selling',30,NULL,'fall','<p>Do you have an event coming up in December or early in the new year that requires sponsorship prizes and money? Would 15 groups of competent sales students, mentored by their instructor, help you exceed your goals? <u><strong>This is a sales army</strong></u>, who not only try to achieve a sale for you, but they put together a prospecting document, planning document, and a sales aid.  </p>','group','2017-09-01','2017-12-20',40,NULL,'<p>Students submit their prospecting document, their sales planning document, and a sales aid that will help you with future sales. Plus, <u><strong>the actual sponsorship money or prize!</strong></u></p>',1,NULL,'2017-05-29 06:01:24','2017-05-29 06:09:16','<p>Do you have an event coming up in December or early in the new year that requires sponsorship prizes and money? Would 15 groups of competent sales students, mentored by their instructor, help you exceed your goals? <u><strong>This is a sales army</strong></u>, who not only try to achieve a sale for you, but they put together a prospecting document, planning document, and a sales aid.  </p>',4,'Varied',0,NULL,'anywhere',NULL),(465,10,'published','Client Consulting Project',NULL,'BUS 338','Foundations of Innovation',45,2017,'fall','<p>Undergraduate student-consultants will develop a tailored strategy addressing challenges or opportunities related to commercializing products, developing new markets, market research, marketing communications, business model validation and more.</p>','group','2017-09-04','2017-12-07',100,NULL,'<p>Deliverables include a <strong><u>written report</u></strong> (up to 15) pages and a <strong><u>PowerPoint presentation</u></strong>. Student group present their findings at the end of term and submit a report. Many groups meet with the company for follow-up.</p>',9,NULL,'2017-05-29 07:38:13','2017-08-17 17:50:03','<p>Starting this September, a group of four senior business students will spend approximately 400 hours cumulatively over the course of the semester collaborating with your organization to address your unique business needs.</p><p></p><p><strong>Projects areas of focus can include, but are not limited to:</strong></p><ul><li>Surveying potential customers and talking with focus groups</li><li>Identifying and evaluating potential customer profiles and markets</li><li>Developing value propositions and use cases for specific market segments</li><li>Conducting value chain analysis and auditing partner profiles</li><li>Developing a competitive matrix</li><li>Validating business models</li><li>Developing marketing materials and collateral for investor presentations</li><li>Etc.</li></ul><p></p><p>The student groups present their findings in a ‘consulting plan’ to their class at the end of term. Proprietary company information remains confidential at all times. BUS 338 is a key business course at SFU and over 50 companies have participated to-date.</p>',4,'3rd year',1,NULL,'anywhere',NULL),(466,NULL,'review','Capstone Project',NULL,'CPSC 44000','Software Engineering',25,2017,'fall','<p>The students work in teams to create an original application that serves a customer&#x27;s needs. The students gather requirements, build prototypes, and refine the prototypes iteratively.</p>','group','2017-09-11','2017-12-08',20,NULL,'<p>The final deliverables are a</p><ul><li>Software application</li><li>Database</li><li>Instruction manual</li><li>Design document</li></ul>',1,NULL,'2017-05-29 18:16:22','2017-05-29 21:43:40','<p>Students of teams of three to four can create a database-driven application or website that will enable you to manage whatever your organization needs to manage easily and flexibly. Students will design and implement the database and associated queries, create the graphical front-end, and tie the front-end and back-end together so that you can easily access your data.</p>',3,'Senior',0,NULL,'anywhere',NULL),(467,119,'draft','Strategy Consulting Practicum',NULL,'BUS 6025','Masters of Social & Sustainable Management',543,2016,'winter/spring','<p>A team of graduate students will work with your social enterprise to develop a project for a practicum. Students will work on strategies and recommendations around a business problem, challenge or opportunity of your choosing. </p>','group','2017-04-02','2017-05-31',100,NULL,'<p>Students will provide a 10+ page report detailing their analyses, strategy and actionable recommendations and deliver a presentation to your senior leadership.</p>',1,NULL,'2017-05-29 18:22:20','2017-05-29 18:22:20','<p>A team of graduate students will work with your social enterprise to develop a project for a practicum. Students will work on strategies and recommendations around a business problem, challenge or opportunity of your choosing. </p><p></p><p><strong>Project examples include, but are not limited to:</strong></p><ul><li>Developing a branding strategy</li><li>Examining the viability of a new line of business</li><li>Developing a new income stream for a social enterprise</li><li>Designing an informational portal for doctors in developing countries</li><li>Putting together a talent development plan for human resources</li><li>Creating a marketing plan</li></ul>',5,'Graduate',0,NULL,NULL,NULL),(468,411,'published','Legal or Policy Analysis',NULL,'BLR 235 or BLR 235WI','Business Law',25,2017,'fall','<p>Is there a legal topic of interest to you and your business? A second year business law student will research applicable laws and present you with a report on how they may potentially affect you.</p>','individual','2017-09-05','2017-11-15',20,NULL,'<p>The final project deliverable is a 7-10 page report giving an overview of the applicable law. The report can’t be used in lieu of legal advice. However, the report can be useful to a business person in conjunction with specific legal advice from appropriately certified legal advisers.</p>',1,NULL,'2017-05-30 12:10:14','2017-08-03 22:36:21','<p>A student-consultant will research and solve (or report on) a legal question or issue of your choice. The topic can be related to any area of business law, including but not limited to the following:</p><ul><li>How trade laws could impact your business&#x27;s exports</li><li>Employment law and its impact on your employment of contract workers</li><li>The intellectual property rights on your technology</li><li>How antitrust laws may impact your future business decisions</li><li>Improving your contracts with customers through analysis of contract law</li><li>Any specific statute or regulation, such as the Foreign Corrupt Trade Practices Act or Freedom of Information Act</li></ul><p>The students are able to look at laws pertaining to any specific state. This project is open to business across the United States.</p>',1,'2nd year',0,NULL,'anywhere',NULL),(469,410,'review','International Business Research',NULL,'BUS 315','International Business',40,NULL,'fall','<p>A team of students will conduct a comprehensive analysis of your international company, including your business model and environment, potential markets, and industry priorities.</p>','group','2017-09-15','2017-12-01',50,NULL,'<p>You can expect the following deliverables:</p><ul><li>A 2 page report on the final results</li><li>A 5-minute presentation for the same</li><li>A detailed analysis of various stages of the project</li></ul>',2,NULL,'2017-05-30 18:10:41','2017-07-07 19:42:48','<p>The students will recommend areas in which you could make improvements or take different approaches. They will also use their knowledge to focus on your organization&#x27;s culture, how it affects work, and creates conflicts of interest between departments. </p><p>As an example, the students will provide your business with:</p><ul><li>Current market analysis</li><li>Analysis of company culture and pressure points</li><li>Bottlenecks in current flow of information/tasks</li><li>Competition assessment in a given demographic</li></ul><p>The team will also evaluate how they evolve as a unit as time progresses.</p><p></p>',3,'3rd Year',0,NULL,'anywhere',NULL),(471,276,'draft','Mission de compilation - États financiers NCECF',NULL,'COM19753','Comptabilité Intermédiaire III',28,2017,'fall','<p>Les étudiants vont préparer les états financiers d&#x27;une entreprise de services, selon les Normes comptables pour les entreprises à capital fermé (NCECF)</p>','group','2017-09-18','2017-12-01',30,NULL,NULL,1,NULL,'2017-05-30 19:06:31','2017-05-30 19:44:52','<p>En groupe de 2, les étudiants devront réaliser une mission de compilation à partir des données fournies par le client (balance de vérification, états financiers de l&#x27;année précédente, etc.). L&#x27;équipe devra remettre au client des états financiers complets incluant:</p><ul><li>Bilan</li><li>État des résultats</li><li>État des bénéfices non répartis</li><li>Écritures de régularisation</li></ul><p>Au terme de ce travail, les étudiants devront remettre ces états financiers au directeur responsable du dossier pour évaluation. </p>',2,'Collège 3ième année',0,NULL,NULL,NULL),(472,332,'published','Employee Handbook',NULL,'HRM 923','Compensation Management',50,2017,'fall','<p>It&#x27;s important for organizations of any size to have a clear and consistent way to communicate compensation structure to employees. Human Resources Management students will identify what information needs to be communicated, and put together an employee handbook accordingly.</p>','group','2017-09-01','2017-12-15',50,NULL,'<p> Students will provide the following deliverables to the organization they partner with:</p><ul><li>Needs assessment</li><li>Project proposal</li><li>Training materials</li><li>Delivery of a training session</li></ul>',1,NULL,'2017-05-31 17:08:47','2017-08-30 15:08:36','<p>Working individually or in groups, students will work to create or revamp an employee handbook (with an emphasis on wages and compensation) for your organization, with your guidance and input. </p><p></p><p>Students will conduct a needs assessment and provide you with a concept employee compensation handbook proposal describing the handbook index and content they would like to create, and the reasons why.</p><p></p><p>Once your organization has approved their proposal, students will work to create all the needed elements of the employee handbook and design a handbook power point presentation. At the end of the projects students will present the power point presentation for the desired audience and evaluate the outcomes.</p><p></p><p>Possible content areas for these students to address include, but are not limited to:</p><ul><li>Employment</li><li>Employment Classifications</li><li>Hours of Work</li><li>Flex Time and Telecommuting</li><li>Performance and Salary Review</li><li>Compensation</li><li>Payroll Practices</li><li>Benefits</li></ul>',5,'Continuing Education',1,NULL,'anywhere',NULL),(473,420,'draft','Strategic Management',NULL,'MB 590 01','Strategic Management CRN: 50122 Summer 2017 MB 590 01',10,2017,'summer',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-05-31 21:31:29','2017-06-05 17:41:24',NULL,NULL,'Post Graduate',0,NULL,NULL,NULL),(474,417,'published','Marketing Research Project',NULL,'MKT 4650','Marketing Research',10,2017,'summer','<p>The students will conduct a marketing research project on a specific company. They will collect  qualitative + quantitative data, analyze the data, and create an actionable report based on the findings.</p>','group','2017-07-03','2017-08-09',25,NULL,'<p>Final project deliverable is a report that will include:</p><p></p><p>1. Summary of the qualitative research, including key findings</p><p>2. Summary of the quantitative research, including key findings</p><p>3. Recommendations to improve marketing operations of the business</p>',1,NULL,'2017-05-31 23:21:22','2017-08-03 23:13:47','<p>A group of 10 students will be working on developing and completing a marketing research project for your company. The areas or focus will including:</p><p></p><p>1. Secondary Research: data analysis of your brand, product/service, and the industry</p><p>2. Primary Qualitative Research: in-depth interviews/focus groups with consumers will be conducted and analyzed</p><p>3. Primary Quantitative Research: a digital survey will be designed and distributed to consumers/users/stakeholders (total 100), data will be collected and analyzed using SPSS software</p><p>4. A final report with the research results and recommendations to improve your business&#x27;s marketing operations will be produced. </p>',10,'Juniors and Seniors',1,NULL,'anywhere',NULL),(475,405,'draft','1',NULL,'1','1',1,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-06-01 18:26:54','2017-06-01 18:31:03',NULL,NULL,'1',0,NULL,NULL,NULL),(476,405,'draft','data analysis and parallel computing',NULL,'CS4700','Parallel Computing',25,2017,'fall','','individual',NULL,NULL,NULL,NULL,'',1,NULL,'2017-06-01 18:30:51','2017-06-02 18:06:19','',1,'4th year',0,NULL,'anywhere',NULL),(477,124,'draft','Location Optimization MBA Consultancy',NULL,'mba 710','Understanding World-Class Clusters',30,2016,'winter/spring','<p>research  and conduct location mapping to assist you with identifying optimal  locations given spatial variation in rents, facilities, R&amp;D  institutions</p>','group','2017-01-09','2017-04-14',200,NULL,'<p>Each of the 5 groups will do <u>3 months of work</u> to help your firm find the right location - <u>a total of 1000 hours of work</u>. Each group will provide:</p><ul><li>Location Mapping Report  </li><li>Recommendations on optimal locations (and the reasoning behind them) </li><li>A 5-minute presentation </li></ul>',1,NULL,'2017-06-02 22:57:57','2017-06-02 22:57:57','<p>Five groups of MBA student-consultants  will research and conduct location mapping to assist you with  identifying optimal locations given spatial variation in rents,  facilities, R&amp;D institutions, etc.</p>',6,'MBA',0,NULL,NULL,NULL),(478,419,'published','Intercultural Graphic Design',NULL,'COMM 3325','Visual Communication and Culture',15,2017,'fall','<p>If you need promotional material for one of your international markets, or for an international market you are planning on expanding into, groups of graphic design students can create or redesign the necessary promotional materials.</p>','group','2017-11-01','2017-12-08',20,NULL,'<p>Students will meet with company for review and feedback (for approximately 4-5 weeks beginning in November) in order to produce the following: </p><ul><li>Written report making culturally-appropriate recommendations</li><li>Graphic design work (printed if company is local)</li><li>A final presentation (which you can attend if possible)</li></ul>',1,NULL,'2017-06-03 20:35:00','2017-06-22 19:00:28','<p>Groups of graphic design students will work to understand the cultural background of one of your international target markets and make recommendations on how how to best market to this group visually. The students will then create or redesign promotional materials for this market that addresses your goals and objectives.</p><p></p><p><strong>Possible project examples include, but are not limited to:</strong></p><ul><li>Advertisements or brochure for a product or service</li><li>Small informational booklet</li><li>Posters for an upcoming event</li></ul>',4,'2nd - 4th year undergraduate students',0,NULL,'anywhere',NULL),(479,422,'published','Business Consulting ',NULL,'MGMT 2607','Action Learning Projects (ALP)',139,2018,'winter/spring','<p>Students will act as consultants to collect, assimilate and analyze data within your organization to improve a business focus of your choosing.</p>','group','2018-01-15','2018-05-03',85,NULL,'<p>The final deliverables for the project are typically determined by the project focus provided by your organization. </p><p></p><p><strong>Typically final deliverables include:</strong></p><ul><li>Memorandum of work completed</li><li>(2x) Status reports providing updates throughout the course of the project</li><li>Final Presentation </li></ul>',10,NULL,'2017-06-05 13:01:42','2017-08-21 22:44:54','<p>An individual group consisting of 5 Masters level student consultants will work directly with your organization on an entry to mid-level project. Students will analyze and give their recommendations to address a significant opportunity or challenge your company is currently facing. </p><p></p><p><strong>Project ideas may include but are not limited to:</strong></p><ul><li>Marketing Strategy</li><li>Accounting and Finance Strategy</li><li>Operations Management</li><li>Project Management</li><li>Human Resources</li></ul><p></p>',5,'Master of Arts in Management Program',0,NULL,'anywhere',NULL),(480,86,'published','MBA Consulting Project',NULL,'MBA 720','Collaborate',50,2017,'fall','<p>Groups of MBA students will analyze a challenge or problem your organization faces, and develop strategies and solutions to achieve high-quality results by strengthening and leveraging your organization’s collaborative skills.</p>','group','2017-10-26','2017-12-07',20,NULL,'<p>Student groups will present their proposed ideas and solutions in an interactive poster session on the last night of class.  Each group will also provide the organization with an executive summary of their proposals.</p>',1,NULL,'2017-06-05 19:05:47','2017-06-26 16:19:33','<p>Examples of what students could work on for your organization include but are not limited to:</p><ul><li>How to increase employee diversity in high tech companies</li><li>How to break down silos and leverage multiple areas of expertise at professional service firms to provide innovative solutions</li><li>How to address an issue of concern to the community in which the organization exists</li><li>How to integrate organizational control functions (risk management, compliance, and audit)</li><li>How to collaborate with clients to turn ideas and needs into products and services </li></ul>',5,'MBA',0,NULL,'local',NULL),(481,237,'published','Event Planning',NULL,'HFT 3741','Meeting Management',45,2017,'fall','<p>A group of 4 students each will be coming together to help your organization to plan a corporate event by conducting a needs analysis and developing the event plan focusing on but not limiting to F&amp;B, registration, sponsorships and function schedule.</p>','group','2017-09-05','2017-11-16',15,NULL,'<p>Students will present a 20 slide power point including images, videos and other media for the PLANNING of the project.</p><p></p>',1,NULL,'2017-06-06 16:17:42','2017-08-28 21:44:46','<p>Talented, innovative, and creative students will prepare your next meeting or event!</p><p></p><p>Students working in groups of four will be planning a corporate meeting for your organization including (either all or single portions of assignment): </p><p></p><ul><li>Food and beverage planning</li><li>Writing the function schedule and function room set-up</li><li>Sponsorships (creating new innovative ways to fundraise)</li><li>Needs analysis for the event</li><li>Resume of Services including ancillary events</li><li>Housing and travel options</li><li>Registration</li></ul><p></p><p></p>',4,'Junior and Senior level undergraduates',1,NULL,'anywhere',NULL),(482,406,'published','Social Media Marketing Plan',NULL,'MKT 4300','Social Media Marketing',30,2017,'fall','<p>Students will analyze your current social media strategy and make recommendations on how it can be improved. This will be outlined by an implementation plan and presentation.</p>','group','2017-08-21','2017-12-08',20,NULL,'<p>The final project deliverables for this project are:</p><ul><li>A written paper including social media recommendations</li><li>A 15-20 minute presentation</li><li>Creative deliverables bringing social media ideas to life</li></ul>',1,NULL,'2017-06-06 19:05:39','2017-08-16 16:55:56','<p>A group of 5 junior and senior level students will spend 100+ hours analyzing the strengths and weaknesses of your organization’s external communications strategy.</p><p></p><p>Students will produce suggestions and recommendations surrounding your business’s key messaging, as well as a plan for implementing their ideas. A strong social media strategy can help your organization provide rich customer experiences, increase website traffic, and gain valuable customer insights.</p><p></p><p>The social media plan will outline how to either build on what you’re currently doing, or improve your current plans, including suggestions like tools for social, frequency of posting, content types, hashtags, etc. for each social media platform you are working with.</p>',5,'Juniors and Seniors',1,NULL,'anywhere',NULL),(483,2,'published','Social Media and PR Strategy Challenge',NULL,'MKTG 6226 A','Social Media for Marketing and Management',25,2017,'fall','<p>Students act as consultants for your organization in an interactive strategy session to tackle a communications and PR challenge using social media. The topic should focus on the role of communications and PR in your organization using social media.</p>','group','2017-10-14','2017-10-28',20,NULL,'<p>Students will provide their recommendations live, during the interactive, in-class session October 28th. Notes from the working session will be shared with the participating company.  </p>',2,NULL,'2017-06-06 21:41:21','2017-08-31 23:17:47','<p>This is an opportunity to have a full class of Schulich School of Business MBA students analyze a business problem you are facing and develop solutions to address the problem, while growing your business and helping to improve profitability. Two companies will present their business challenge/opportunity to be assessed and worked upon.</p><p></p><p>You would provide the students with a written brief on your company and your social media communications and PR challenge no later than October 14th. They would do some preliminary research in preparation for an in-depth exploration of the challenge at hand, which will take place on Saturday, October 28th.  </p><p></p><p>The class will be guided by an instructor with 20 years’ of digital media and digital marketing business strategy development experience, with clients and employers in a variety of industries in multiple sectors.  You would work with the instructor ahead of time to ensure the right information is given to the students to enable them to give you strong recommendations.  </p><p></p><p>On October 14th you will have the opportunity to recap the problem at the beginning of the session and can add more to the challenge at this time, if you wish.  The experience is designed so that you can ask questions, provide input and get feedback in real time.</p><p></p><p>The topic should focus on the role of communications and public relations in your organization with a focus on using social media.</p>',5,'Graduate',1,NULL,'anywhere',NULL),(484,86,'published','Start-Up & Small Business Consulting',NULL,'ENT 419A','Entrepreneurship Capstone',20,2017,'fall','<p>Student-consultants will work with your small business or start-up to provide strategic recommendations on a challenge or opportunity you are facing. </p>','group','2017-09-18','2017-12-06',100,NULL,'<p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to devise the project scope and prepare a  detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome - Report and Presentation: Students will submit a detailed report on the outcomes of the project. Teams will also present this in the last class. Organization representative(s) are invited to attend these presentations.</p>',4,NULL,'2017-06-06 23:41:31','2017-08-10 06:09:04','<p>Starting in September, a group of 4 senior students in an entrepreneurship course will tackle a challenge or opportunity facing your small business or start-up over 3 months and a total of 400 hours of work. </p><p></p><p>Your business will provide the students an area of focus and your goals for the project, and they will deliver analysis, insights and recommendations to provide value to your organization in addressing that topic.</p><p></p><p><strong>Areas of focus can include, but are not limited to:</strong></p><ul><li>Creation of a complete business plan for product or service.</li><li>Development of a new market entry strategy.</li><li>Design of a marketing plan.</li><li>Prototyping a new product using 3D technology.</li><li>Performing a detailed competitor and environmental analysis.</li><li>Conducting an operations management or value chain analysis.</li></ul><p><strong>Students are assessed on whether or not they produce value for you and your firm!</strong></p>',4,'4th year',0,NULL,'anywhere',NULL),(485,326,'published','Masters\' Big Data Analysis w/ Machine Learning',NULL,'INSY 5376','Big Data Analytics',72,2017,'fall','<p>Master&#x27;s-level student-consultants will develop a tailored strategy for your organization using data analytics and machine learning algorithms, designed to address a challenge or opportunity specific to your needs.</p>','group','2017-10-01','2017-12-01',25,NULL,'<p>The project deliverables are:</p><ul><li>A 10 to 15 page project report that gives a clear idea of the problem, the steps taken to prepare the data, the predictive models that were evaluated, and the rationale for the recommended model.</li><li>A 20 minute presentation in class.</li><li>The slides that were used in the presentation.</li></ul>',6,NULL,'2017-06-07 02:00:49','2017-07-27 00:02:27','<p>By applying data management and machine learning concepts, students will draw actionable business insights from a large dataset and solve a major challenge for your business.</p><p></p><p>A group of four Master&#x27;s-level students will work on a challenging Big Data-related business challenge. </p><p></p><p><strong>Examples of previous projects include the following:</strong></p><ul><li>Using Zillow and county data to predict the housing prices</li><li>Examining companies’ annual reports/10-K filings to cluster companies with a view to understanding how and why they are similar/dissimilar</li><li>Using Yelp data to understand the factors of customer ratings and how they impact performance</li><li>Analyzing tweets to predict the winners at the Oscars</li></ul><p>In addition, the students typically look at publicly available datasets related to a variety of problems, including fraud detection, predicting the quality of wine, predicting whether or not someone has cancer based on various criteria, predicting customer churn, understanding customer behavior from an analysis of clickstream data, and so on.</p>',4,'Master\'s',0,NULL,'anywhere',NULL),(486,2,'published','Content Marketing Strategy: Social Media',NULL,'MKTG 6226 B','Social Media for Marketing and Management',25,2017,'fall','<p>Students act as consultants for your organization in an interactive strategy session to tackle a communications and PR challenge using social media. The topic should focus on the use of content in your organization using social media.</p>','group','2017-09-30','2017-10-14',25,NULL,'<p>Students will provide their recommendations live, during the interactive, in-class session October 14th. Notes from the working session will be shared with the participating company.  </p>',2,NULL,'2017-06-07 03:46:00','2017-08-31 23:17:38','<p>This is an opportunity to have a full class of Schulich School of Business MBA students analyze a business problem you are facing and develop solutions to address the problem, while growing your business and helping to improve profitability.</p><p></p><p>You would provide the students with a written brief on your company and your content challenge no later than September 30th. They would do some preliminary research in preparation for an in-depth exploration of the challenge at hand, which will take place on Saturday, October 14th.  </p><p></p><p>The class will be guided by an instructor with 20 years’ of digital media and digital marketing business strategy development experience, with clients and employers in a variety of industries in multiple sectors.  You would work with the instructor ahead of time to ensure the right information is given to the students to enable them to give you strong recommendations.  </p><p></p><p>On October 14th you will have the opportunity to recap the problem at the beginning of the session and can add more to the challenge at this time, if you wish.  The experience is designed so that you can ask questions, provide input and get feedback in real time.</p><p></p><p>The topic should focus on the use of content in your organization using social media.</p>',5,'Graduate',1,NULL,'anywhere',NULL),(487,92,'published','Project Planning ',NULL,'MBA K731','Project Management ',60,2017,'fall','<p>A group of 5 MBA student-consultants, will develop a thorough action plan for a project of your choosing. You should have a specific project in mind and some ideas about the scope.</p>','group','2017-09-11','2017-12-15',125,NULL,'<p>This work will be presented in a 10+ page document, accompanied by a 15-minute presentation.</p>',12,NULL,'2017-06-07 18:37:17','2017-08-03 21:40:26','<p>A group of 5 MBA student-consultants will develop a thorough action plan for a project of your choosing. The plan will describe:</p><ul><li>the tasks necessary to complete the project scope</li><li>the resources needed</li><li>the optimal schedule</li><li>the budget required</li><li>a risk management plan</li><li>considerations for execution</li></ul><p>Examples of projects have included, but are not limited to:</p><ul><li>Small construction project (i.e. renovation or small build)</li><li>Development of a new website</li><li>Implementation of a new software or system</li><li>Business process change</li><li>An event or workshop</li></ul><p>Please note: the students will develop a plan for your project that is feasible for your organization to execute. The students will not be executing the project tasks themselves. For example, a project plan for a market research study will describe the steps necessary for your organization to take in order to do the market research study; the students will not be doing the market research tasks.</p>',5,'MBA',0,NULL,'local',NULL),(488,126,'review','Conceptual Design Proposal',NULL,'CENG 192A','Civil Engineering Project Development ',25,2018,'winter/spring','<p>Student-engineers will develop and submit a design proposal that will solve a civil engineering problem for your organization. </p>','group','2018-04-01','2018-06-15',5,NULL,'<p>Student-engineers will submit a Conceptual Design Report to your organization documenting:</p><p></p><ul><li><strong>Project Formulation</strong> - Clear objectives, constraints, stakeholders, and required data to be collected. </li><li><strong>Possible Design Concepts</strong>  - Summary of design possibilities with pros/cons.</li><li><strong>Most Feasible Design Concepts</strong> - The top three design concepts with selection justification. </li></ul><p></p><p>One of the three proposed preliminary design concepts will be fully developed by the group in the following academic year.  </p>',10,NULL,'2017-06-07 18:58:56','2017-08-21 15:37:05','<p>Beginning this April, student-engineers will work in groups of three to create a design proposal that solves a civil engineering problem for your organization. </p><p></p><p>Based on the information and goals you provide, students will consider all possible design options and submit the most effective options for your consideration. Accepted proposals are intended to be carried out by groups the following year.</p><p></p><p><strong>Proposal topics may include, but are not limited to:</strong></p><ul><li>Structural upgrade of an old building</li><li>Structural design of a new building</li><li>Research-based studies of structural systems.</li><li>Comparison between civil engineering systems</li><li>Study of civil infrastructure management problems</li><li>Traffic analysis</li><li>Construction planning</li></ul>',3,'3rd year',0,NULL,'regional',NULL),(489,423,'published','Strategic Company Analysis',NULL,'SRM 333','Management in Sport and Recreation',35,2017,'fall','<p>A group of four student-consultants will produce a comprehensive strategic analysis for your organization with respect to the U.S. sport and recreation industry.</p>','group','2017-09-04','2017-12-08',30,NULL,'<ul><li>Written report (4,000 words) outlining research findings, competitive analysis, and implications for your organization</li><li>12-15 min presentation with Q&amp;A </li></ul><p></p>',7,NULL,'2017-06-07 21:12:33','2017-08-02 15:46:16','<p>Starting in September, a team of 4 student-consultants will spend a total of 120 hours analyzing the internal and external environment surrounding your company. They will outline a strategic plan on how your organization can develop a competitive advantage to grow your businesses based on the factors uncovered during the research process. </p><p></p><p><strong>Examples may include, but are not limited to:</strong></p><ul><li>Identifying new channels or partners that can help grow you business.</li><li>Identifying new market segments.</li><li>Evaluating your organization&#x27;s capabilities to execute strategic change.</li><li>Competitive and external analysis of your industry and the implications on your business.</li></ul>',4,'2nd, 3rd, & 4th years',0,NULL,'anywhere',NULL),(490,430,'draft','Strategic Audit',NULL,'MGMT 4312',' Strategic Management',40,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-06-08 22:34:20','2017-06-09 16:18:23',NULL,NULL,'seniors',0,NULL,NULL,NULL),(491,61,'published','Service Provider Analysis & Consultancy',NULL,'ENTR 4130','Entrepreneurial Management for Service Organizations',40,2017,'fall','<p>Student-consultants will <strong>analyze your specific service landscape and provide recommendations about how your organization can improve its service</strong> <strong>experience.</strong></p>','group','2017-09-04','2017-12-04',25,NULL,'<p>Each group of student-consultants will <u><strong>spend +100 hours working</strong></u> <u><strong>on</strong></u> <u><strong>your organization</strong></u>. At the end of which, each group will showcase their servicescape recommendations to you in a <u><strong>15-minute presentation, which will be accompanied by a +10-page document detailing their research and reasonings</strong></u>. </p>',1,NULL,'2017-06-08 23:20:33','2017-08-16 18:23:37','<p>Six groups of four student-consultants each, will <strong>analyze your specific service landscape and provide recommendations about how your organization can improve its service</strong> <strong>experience</strong>, while maximizing the value for the customer, business, and employee. Past examples include, but are not limited to:</p><ul><li>Assessing the servicescape of individual retail outlets of a national chain to find differences between locations</li><li>Designing the servicescape of a new restaurant and recommendations were incorporated into the final build</li><li>Recommending how to change the service experience of a marketing company to be more aligned with clients </li></ul>',4,'4th Year',0,NULL,'anywhere',NULL),(492,14,'review','Data Consultancy',NULL,'','Database Systems:',NULL,2016,'fall','<p>Is your database outdated? Are you still using Excel? You could be using more sophisticated technology that could actually help you with your data! Or maybe you want to use your existing data in new ways or for the first time ever.</p>','group','2016-10-03','2016-12-09',NULL,NULL,'<p>Student-consultants create <u><strong>a business plan around their new use of data or databases plus a functioning prototype</strong></u>.</p>',1,NULL,'2017-06-09 19:25:54','2017-06-09 19:26:08','<p>Is your database outdated? Are you still using Excel? You could be using more sophisticated technology that could actually help you with your data! Or maybe you want to use your existing data in new ways or for the first time ever. <u><strong>A group of student-consultants will devise a business plan about how you can maximize your data by using a database</strong></u>.  Past projects included: reorganizing data to map customer geographic information to find new areas with low penetration; and, data modeling from an excel file to a functional database.</p>',4,'MBA',0,NULL,'anywhere',NULL),(493,421,'published','E-Commerce Marketing',NULL,'DMP','Digital Marketing Professional',8,2017,'summer','<p>This assignment involves the creation a marketing campaign and strategy for an e-commerce business. Students will address areas such as Google Analytics, SEO and content strategy.</p>','group','2017-07-31','2017-08-18',70,NULL,'<p> </p><ul><li>20 minute presentation on their findings and recommendations</li><li>40 page marketing strategy report</li><li>Social Media and content calendar</li></ul>',1,NULL,'2017-06-09 19:53:57','2017-06-26 18:05:50','<p>Professional students will be examining their clients past and present marketing strategies, identifying successes and failures and conduct data analysis to come up with effective solutions and suggestions to help achieve the primary business goal of the company. The students will:</p><ul><li>Analyze historic data to identify areas of improvement </li><li>Establish a social media strategy</li><li>Create a strategic marketing campaign </li></ul><p></p>',3,'Post Graduate',1,NULL,'local',NULL),(494,69,'published','Operations Assessment',NULL,'BUAD 427','Operations Management II: Data Driven Problem Solving',30,2017,'fall','<p>Groups of senior students will develop data-driven recommendations to solve operational issues facing your company.</p>','group','2017-08-21','2017-12-15',30,NULL,'<p>You will receive a<strong> </strong>report and presentation on the operational recommendations students have made specifically for your organization.</p>',1,NULL,'2017-06-09 21:18:46','2017-09-01 00:19:17','<p>Six groups of operations management students will use quantitative analysis to help solve a problem unique to your organization. A total of 30 students, devoting 30 hours each, will be focused on your area of interest.</p><p></p><p>Students will use data provided by your organization and apply operations management theory and tools to analyze the problem and recommend solutions. A final report and presentation will give you a summary of their research and provide valuable insights that you can use going forward. </p><p></p><p><strong>Project examples include, but are not limited to:</strong></p><ul><li>Evaluating inventory management issues and optimizing inventory</li><li>Increasing equipment productivity</li><li>Assisting in ISO or similar quality system implementation</li><li>Addressing any quality related problems in the supply chain</li><li>Addressing customer management issues</li></ul><p></p>',5,'Seniors',1,NULL,'local',NULL),(495,325,'published','Social Media Plan + Ads & Analysis',NULL,'BUS 117','Advertising ',67,2017,'fall','<p>A team of students will help you discover millennial preferences for social media advertising patterns by creating ads and analyzing the results.</p>','group','2017-09-11','2017-10-13',30,NULL,'<p>Final project deliverables are:</p><ul><li>Original ads (created specifically for your company) posted on social media platforms.</li><li>Analysis of each ad, including who it reached and measures of its success.</li><li>Recommendations for future advertising focus based on feedback and analytics.</li></ul>',8,NULL,'2017-06-09 23:05:05','2017-08-30 18:23:13','<p>Throughout the assignment, students will be given ongoing guidance and instruction on creating, maintaining, and evaluating social media campaigns that promote your business.</p><p></p><p>As a result of this project, you’ll receive:</p><ul><li>An influx of new, objective ideas and methods of sharing your messages on social media platforms.</li><li>An organized, well thought-out social media plan.</li><li>A working partnership with a team of social media marketing students (who will be entering the workforce in the next 1-2 years).</li></ul>',8,'3rd & 4th Year business students',0,NULL,'local',NULL),(496,325,'review','Electronic Marketing',NULL,'BUS118','Electronic Media ',75,2018,'winter/spring','<p>A group of students will work closely to evaluate &amp; identify advertising techniques that resonate with college students by analyzing current ads or develop new ads based on focus.</p>','group','2018-01-10','2018-02-19',25,NULL,'<p> <strong>The final project deliverables are a:</strong></p><ul><li>10-page document including media recommendations</li><li>Analysis of reaction to original ads and corresponding analytics on any  changes</li><li>Social Media Recommendations</li></ul>',1,NULL,'2017-06-09 23:20:32','2017-06-09 23:32:12','<p>Groups of 3rd/4th  Year Level student-consultants, will  test current advertising strategy currently being considered by your business over an intensive 4-week period!  The groups will provide feedback on the approach, the imagery, the wording and the reception of the ad by other millennials.  </p><p>The challenge is directly tied into the reception of the ad by college age consumers and possible realignment of the features of the ad to resonate more strongly with target audience.   </p>',8,'3rd & 4 th year business students with a marketing focus',0,NULL,'anywhere',NULL),(497,2,'draft','Entrepreneurship Consulting Project',NULL,'ENT 4400','Applied Entrepreneurship Field Study',25,2016,'fall','<p>Groups of 4-5 <strong>student-consultants from the Schulich Master of Management program will work with your organization (on-going business, a start-up, a non-profit or community organization) on a short-term project that is important to you</strong>. </p>','group','2017-05-08','2017-07-28',NULL,NULL,'<p>There are 3 deliverables: \n1 ) <strong>Project Plan</strong>: Students will develop a Statement of Work and project plan for the semester. \n2) <strong>Status Report</strong>: Students will conduct research, update you and get your input so that they can successfully deliver their final research-based recommendations. \n3) <strong>Final Delivery</strong> of the student project as outlined and agreed to in the status report.</p>',1,NULL,'2017-06-09 23:35:18','2017-06-14 18:34:07','<p>Groups of 4-5 <strong>student-consultants from the Schulich Master of Management program will work with your organization (on-going business, a start-up, a non-profit or community organization) on a short-term project that is important to you</strong>. </p><p></p><p>The students will apply their knowledge and research to the real-world management challenge or opportunity that you put forward. This could include, but is not limited to:</p><ul><li>surveying potential customers and evaluating their market potential</li><li>developing value propositions and use cases for specific market segments</li><li>analyzing  value chain</li><li>developing a competitive matrix</li><li>validating business models</li><li>creating materials for investor presentations. </li></ul>',4,'Masters',0,NULL,'anywhere',NULL),(498,23,'published','Marketing Strategy and Decision Making',NULL,'BMKT 365','Market Management',35,2017,'fall','<p>Undergraduate student teams will collaborate with an organization that is facing a current strategic marketing challenge or opportunity and will provide actionable recommendations for moving forward!</p>','group','2017-10-23','2017-12-04',40,NULL,'<p>The Student Teams will make a presentation describing their recommendations and decisions based on their analysis, detailing their insights into your company and industry as a whole. They&#x27;ll provide actionable suggestions to address the issue or challenge that you provided.</p>',2,NULL,'2017-06-10 00:22:47','2017-08-29 17:41:41','<p>Third Year BBA students at Capilano University will consult with your company to learn about your business and a key marketing challenge or opportunity as it relates to making a strategic decision.   </p><p></p><p>There will be approximately 8 teams focusing on 1 client.  Each team will be competing to provide the best recommendations as it relates to the client&#x27;s strategic marketing scope.  The teams will conduct research to gain insights on changes within the competitive landscape and identify key trends affecting your industry.</p><p></p><p>They will analyze the data and assess the implications for your organization to provide you with a comprehensive marketing strategy.</p><p></p><p><strong>Project examples include, but are not limited to:</strong></p><p></p><ul><li>Providing insight and recommending strategies related to the Marketing Mix - Product, Place, Price and Promotion. </li><li> Conduct external analysis (including customer, competitor, market and environment) as well as marketing mix performance. </li><li>SCA (sustainable competitive advantage) concept including branding strategies, global competition and competition in mature and declining industries. </li></ul>',4,'3rd Year BBA',0,NULL,'local',NULL),(499,NULL,'draft','Organizational Behavior',NULL,'MGMT 320','Organizational Behavior',30,2018,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-06-10 22:59:00','2017-06-10 22:59:01',NULL,NULL,'Undergraduate. Third-Fourth year students',0,NULL,NULL,NULL),(500,431,'published','Advertising Plan',NULL,'MCOM 447','Advertising Campaigns',20,2017,'fall','<p>Students will create a comprehensive integrated marketing communications (IMC) campaign for your organization that includes research, analysis, strategy, creative development, and media planning.</p>','group','2017-08-31','2017-12-14',50,NULL,'<ul><li>A 20-30 minute presentation of the research findings, marketing recommendations, and advertising campaign.</li><li>A comprehensive integrated marketing campaign plan for your organization.</li><li>Advertising creative samples such as out-of-home, social media, email, TV storyboard, display ads, etc.</li></ul>',2,NULL,'2017-06-11 21:00:04','2017-08-22 20:08:49','<p>Individual groups consisting of 5 undergraduate students each will develop an advertising campaign for your organization. The campaign will focus on the functional areas of advertising which includes research, media, creative design, and account management. Efforts will include:</p><ul><li>Secondary research on a business&#x27;s organizational history and brand perception, primary and secondary customer profiles, market position, primary and secondary competitors, potential markets and audience targets to determine strengths, weaknesses, opportunities, and threats facing an organization</li><li>Researching a primary target audience through interviews, surveys, focus groups, and behavioural observation to develop quantitative and qualitative insights</li><li>Development of a creative brief and creative advertising campaign </li><li>Development of public relations material, media, and a marketing strategy along with budgets and recommendations for media and services </li></ul>',5,'Senior',1,NULL,'anywhere',NULL),(501,124,'review','Research project ',NULL,'MKT 442','Marketing Research',50,NULL,'fall','<p>this is a test assignment </p>','individual','2017-06-13','2017-06-22',NULL,NULL,'<p>10 page paper </p>',1,NULL,'2017-06-13 15:53:50','2017-06-13 15:54:44','',1,'4th',0,NULL,'anywhere','2017-06-13 15:58:56'),(502,23,'published','Case Study Development',NULL,'BADM 475','Negotiations and Conflict Resolution',36,2017,'fall','<p>A team of students will research a challenge or opportunity outlined by your organization and provide you with their recommendations.</p>','group','2017-09-12','2017-10-31',20,NULL,'<p>At project completion, you’ll receive:</p><ul><li>A draft of the company&#x27;s outlined challenges and opportunities</li><li>A list of potential recommendations</li><li>A case study/report for educational applications (shared only with your permission).</li></ul>',1,NULL,'2017-06-13 16:59:22','2017-07-18 23:29:30','<p>You’ll get an objective assessment and outside look on the state of your business. </p><p>Students will:</p><ul><li>Interview decision makers (selected by you).</li><li>Discuss and document challenges, decision points and opportunities.</li><li>Develop and present proposed solutions.</li></ul>',6,'4th year',0,NULL,'anywhere',NULL),(503,10,'published','Case Study Development',NULL,'BUS 485','Negotiations and Conflict Resolution',24,2017,'fall','<p>A team of students will research a challenge or opportunity outlined by your organization and provide you with their recommendations.</p>','group','2017-09-12','2017-10-31',20,NULL,'<p>At project completion, you’ll receive:</p><ul><li>A draft of your company&#x27;s outlined challenges and opportunities.</li><li>A list of potential recommendations.</li><li>A case study/report for educational applications (shared only with your permission).</li></ul>',1,NULL,'2017-06-13 17:21:48','2017-08-04 19:43:32','<p>In groups of 6, student-consultants will work for 120+ hours with your organization to provide resolutions for potential/current conflict scenarios. This could involve opportunities to actively prevent conflict from arising in your organization.</p><p><br/>Students will analyze the background of the conflict and put together a presentation to explain the roots of the issue and recommend multiple strategies to address it (i.e. a collaborating solution, a competing solution, a compromising solution).</p><p><br/>Examples could include, but are not limited to:</p><p>Increasing open communication patterns inside your organization</p><ul><li>Increasing open communication patterns inside your organization</li><li>Instigating a plan to optimize diversity</li><li>Interpersonal conflicts between staff</li><li>A clash in management styles between two managers who need to work together</li><li>A dispute about the best usage of budget resources</li></ul>',6,'4th year',0,NULL,'anywhere',NULL),(504,23,'published','Case Study Development',NULL,'BADM 318 09','Project Management',36,2017,'fall','<p>Students will create a case study for your company and provide actionable recommendations based on your challenges and areas of opportunity. </p>','group','2017-09-08','2017-11-17',20,NULL,'<p>At project completion, you’ll receive:</p><ul><li>A documented summary of your business’ challenges and opportunities</li><li>A list of recommendations</li><li>A case study/report for educational applications</li></ul>',1,NULL,'2017-06-13 17:32:06','2017-08-04 05:00:53','<p>This project will give you an unbiased perspective on the state of your organization and tools you can use to move forward.</p><p></p><p>A team of six students will:</p><ul><li>Interview decision makers selected by your organization</li><li>Discuss and document challenges, decision points and opportunities</li><li>Develop and present proposed solutions</li></ul><p>Cases may be used as:</p><ul><li>An interactive way to analyze talent and ability during recruitment processes</li><li>Build brand awareness across different post-secondary campuses</li><li>A tool to assess insights about your organization in regards to the competitive landscape</li></ul><p></p><p>The students will then draft a case study to be used for educational purposes. You’ll have the chance to review and approve all details prior to use.</p>',6,'3rd year',0,NULL,'anywhere',NULL),(505,2,'published','Field Study: Consulting',NULL,'ENTR 4400/6400','Competitiveness of Entrpreneurial Firms',25,2016,'fall','<p>Groups of 2-3 student-consultants will work with your early stage venture on a short-term project that is important to you.</p>','group','2017-09-12','2017-12-05',70,NULL,'<p>There are 3 deliverables:</p><ul><li>1)<strong> Project Plan (week 4 of project)</strong>: Students will work with you and the instructor and conduct preliminary research to develop a plan to address your challenge</li><li>2)<strong> Status Report (week 8 of project) </strong>: Students will update you on their findings to date and confirm next steps and timing.</li><li>3) <strong>Final Delivery (week 12 of project)</strong> of recommendations based on what was outlined in the project plan and reconfirmed in the status report.</li></ul>',5,NULL,'2017-06-13 22:31:12','2017-07-20 00:43:42','<p>Groups of 2-3 student-consultants will work with your early stage venture on a short-term project that is important to you. The students will conduct research on the challenge or opportunity that you put forward. This could include, but is not limited to:</p><ul><li>Surveying potential customers and / or consumers to evaluate your firm&#x27;s market potential</li><li>Developing value propositions  for specific market segments</li><li>Analyzing  a value chain</li><li>Developing a competitive matrix</li><li>Validating business models</li></ul><p></p>',3,'BBA 4400/MBA 6400',1,NULL,'local',NULL),(506,421,'review','UX Design: Capstone Project',NULL,'UXP','UX and UI Design Professional',8,2017,'fall','<p>This assignment involves researching, designing, wireframing and producing a mid to high fidelity prototype for a website or app.</p>','group','2017-12-04','2017-12-22',70,NULL,'<p> </p><ul><li>20 minute presentation on their findings and recommendations</li><li>Case study report</li><li>Mid to high fidelity prototype</li></ul>',1,NULL,'2017-06-14 00:26:06','2017-08-22 23:00:39','<p>Professional students will endeavour to understand the company&#x27;s business goals, conduct research and consumer surveying to best understand the needs of the target audience and from this create a website or app layout and design that achieves those goals. The students will:</p><ul><li>Conduct user testing </li><li>Apply design thinking practices and methodologies</li><li>Create a mid to high fidelity prototype </li></ul><p></p>',3,'Post Graduate',0,NULL,'local',NULL),(507,421,'published','Wordpress Website Development',NULL,'WDP','Web Development Professional',8,2017,'fall','<p>This assignment involves working with UX, UI and Web Dev students for a period of 6 weeks with the end goal of building through Wordpress a website that was designed by RED students. </p>','group','2017-12-04','2017-12-22',70,NULL,'<p> </p><ul><li>20 minute presentation on both the Design and Development periods</li><li>Mid to high fidelity prototype</li><li>Completed wordpress website</li></ul>',0,NULL,'2017-06-14 00:36:30','2017-07-19 01:03:57','<p>Professional UX and UI students will endeavour to understand the company&#x27;s business goals, conduct research and consumer surveying to best understand the needs of the target audience and from this create a website layout and design that achieves those goals. They will pass the deliverables on to the Web Development students who will build the website. The students will:</p><ul><li>Create a mid to high fidelity prototype </li><li>Build the re designed site using wordpress</li></ul><p></p>',4,'Post Graduate',0,NULL,'local',NULL),(508,433,'review','Wordpress Website Design',NULL,'WDP','UX Design and Web Development Professional',16,2017,'summer','<p>This assignment involves working with UX, UI and Web Dev students for a period of 6 weeks with the end goal of building through Wordpress a website that was designed by RED students. </p>','group','2017-08-15','2017-09-22',70,NULL,'<p> </p><ul><li>20 minute presentation on both the Design and Development periods</li><li>Mid to high fidelity prototype</li><li>Completed wordpress website</li></ul>',2,NULL,'2017-06-14 00:44:25','2017-06-21 19:23:48','<p>Professional UX and UI students will endeavour to understand the company&#x27;s business goals, conduct research and consumer surveying to best understand the needs of the target audience and from this create a website layout and design that achieves those goals. They will pass the deliverables on to the Web Development students who will build the website. The students will:</p><ul><li>Create a mid to high fidelity prototype </li><li>Build the re designed site using wordpress</li></ul><p></p>',4,'Post Graduate',0,NULL,'anywhere','2017-06-27 00:42:35'),(509,433,'published','UX Design: Capstone Project',NULL,'UXP-f17','UX Design Professional',30,2017,'fall','<p>This assignment involves the full User Experience Design process. Researching, wire framing, design, and testing, producing a mid to high fidelity prototype for a website or app. </p>','group','2017-11-28','2017-12-14',70,NULL,'<ul><li>30 minute presentation on their findings and recommendations</li><li>Case study report</li><li>Mid to high fidelity prototype</li></ul>',2,NULL,'2017-06-14 00:48:11','2017-07-31 17:46:12','<p>Professional students will endeavour to understand the company&#x27;s business goals, conduct research and consumer surveying to best understand the needs of the target audience and from this create a website or app layout and design that achieves those goals. The students will:</p><ul><li>Conduct an in-person kickoff meeting with the client</li><li>Interview users so we can design a specific solution for them</li><li>Conduct user testing </li><li>Apply design thinking practices and methodologies</li><li>Create a mid to high fidelity prototype </li></ul><p></p><p><strong>Project Examples include but are not limited to:</strong></p><ul><li>Optimizing a specific part of an existing product</li><li>Creating a project from scratch</li><li>Updating and improving an existing website/app </li></ul><p>Content (Copy) needed prior to project kickoff</p><p></p>',3,'Post-Graduate',0,NULL,'local',NULL),(510,433,'published','Digital Marketing: E-Commerce Project',NULL,'DMP','Digital Marketing Professional',8,2017,'summer','<p>This assignment involves the creation a marketing campaign and strategy for an e-commerce business. Students will address areas such as Google Analytics, SEO and content strategy.</p>','group','2017-07-25','2017-08-15',70,NULL,'<p> </p><ul><li>20 minute presentation on their findings and recommendations</li><li>40 page marketing strategy report</li><li>Social Media and content calendar</li></ul>',1,NULL,'2017-06-14 00:52:52','2017-07-07 22:20:59','<p>Professional students will be examining their clients past and present marketing strategies, identifying successes and failures and conduct data analysis to come up with effective solutions and suggestions to help achieve the primary business goal of the company. The students will:</p><ul><li>Analyze historic data to identify areas of improvement </li><li>Establish a social media strategy</li><li>Create a strategic marketing campaign </li></ul><p></p>',3,'Post Graduate',1,NULL,'anywhere',NULL),(511,436,'published','Distributed computing',NULL,'CS 5123','Cloud Computing and Distributed Systems',10,2017,'fall','<p>Groups of 1-3 students will write a program that you can distribute on multiple computers. They will then analyze the efficiency of running the program on one computer versus multiple computers.</p>','group','2017-10-02','2017-10-31',20,NULL,'<p>At project completion, you’ll receive:</p><ul><li>A 5 to 10 page report on the design of the code</li><li>Experimental setup</li><li>Analysis of results</li></ul>',1,NULL,'2017-06-14 16:15:00','2017-07-13 19:58:27','<p>This project will result in cost savings for your business. Optimizing the program deployment will help reduce labor for distributed code writing and future iterations of the rollout.</p><p></p><p>The student group will:</p><ul><li>Write a functional distributed code.</li><li>Make automated scripts to deploy the code on multiple machines.</li><li>Perform exhaustive analysis and testing of the results prior to production deployment.</li></ul><p>All deliverables will include a detailed and indexed report on how the student planned and implemented the project.</p><p></p>',2,'Graduate',0,NULL,'anywhere',NULL),(512,436,'review','Penetration Testing',NULL,'CS 5243','Introduction to Computer Security',20,2018,'winter/spring','<p>Find bugs in code in stand-alone system or find exploits in a networked system. Final goal is to obtain a root shell</p>','group','2018-02-14','2018-03-14',30,NULL,'<p>Five page deliverable describing what they found</p><p>(optional) oral presentation of their findings</p>',1,NULL,'2017-06-14 16:27:03','2017-06-14 18:06:38','<p>Penetration testing</p><p>Find vulnerabilities in code</p><p>Find vulnerabilities in deployed systems/software</p>',2,'Junior, senior, and graduate',0,NULL,'anywhere',NULL),(513,421,'draft','lendified - wordpress plugin',NULL,'FED','Web dev foundation - FT',6,2017,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-06-14 17:06:10','2017-06-14 17:06:11',NULL,NULL,'1st',0,NULL,NULL,NULL),(514,84,'review','Global Poverty & Practice: Fieldwork/Internship',NULL,'GPP','Global Poverty & Practice Minor',15,2017,'other','<p>A student will work with you on a global poverty initiative that you are doing, <u><strong>providing assistance on a specific project or ongoing service activity</strong></u>.</p>','individual','2018-01-29','2018-08-24',240,NULL,'<p>The deliverable is dependent on the scope of the work. <u><strong>At</strong></u> <u><strong>minimum, your organization will get 240 hours of work from the student, plus 3 months of research on the poverty or equality</strong></u> issues that you are working on. </p>',25,NULL,'2017-06-14 17:13:48','2017-08-31 17:30:34','<p>A talented, bright, and dedicated student will engage with you on a poverty/inequality initiative that you are working on, <u><strong>providing assistance on a specific project or ongoing service activity</strong></u>. From January - April, the student will research the issue(s) that your organization (NGO, company, government agency) is working on, either domestically or internationally. After which, the student will do a minimum of 240 hours of work over a minimum of 6 weeks.</p>',1,'Varied',0,NULL,'anywhere',NULL),(515,10,'published','MBA Ethics Consultancy',NULL,'','MBA Ethics Consultancy',50,2017,'fall','<p>Students will provide a perspective on ethical (right vs. right) business decisions, by applying an ethical decision-making framework incorporating both personal and corporate values.</p>','group','2017-09-07','2017-10-02',15,NULL,'<ul><li>Full report from each team outlining the ethical decision making process, framework and core values used, and more, as well as an appropriate conclusion</li></ul>',1,NULL,'2017-06-14 17:48:30','2017-08-11 22:17:19','<p>Using an ethical decision-making framework, 10 teams of 5 MBA students will use a combination of personal values and the values of your organization, to develop a process that will allow your organization to navigate major decisions with greater clarity.</p><p></p><p>Ethical dilemmas could include, for example:</p><ul><li>A forestry company deciding whether to alter clear cutting logging practices to a more sustainable approach, not necessarily required by regulation.</li><li>A company that outsources products from a rural area signs a contract forbidding illegal labour, that unbeknownst to them is violated by their external supplier.</li></ul><p>Your organization will benefit from learning about the processes of ethical decision-making from multiple perspectives, as well as work with 50 talented MBA students with a variety of backgrounds and experiences.</p>',5,'MBA',0,NULL,'anywhere',NULL),(516,326,'draft','Capstone bioengineering design project',NULL,'BE 4350','Senior Design',35,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-06-14 20:56:41','2017-06-14 21:17:05',NULL,NULL,'Senior Year',0,NULL,NULL,NULL),(517,433,'published','Build a Mobile App using React Native',NULL,'ADP','App Developer',6,2017,'other','<p>Students will build a mobile application using React Native over 3 weeks.</p>','group','2017-09-18','2017-10-02',100,NULL,'<p>A functioning Native Mobile Application ready to deploy to the Apple App Store.</p>',1,NULL,'2017-06-14 22:36:36','2017-07-27 21:12:31','<ul><li>Working as a Junior JavaScript Developer</li></ul><p></p>',6,'post-grad',0,NULL,'anywhere',NULL),(518,89,'draft','Training Analysis',NULL,'COM 413','Advanced Organizational Communication',NULL,2016,'winter/spring','<p>In groups of 4 or 5, student-consultants will analyze existing training materials from organizations and then <u><strong>create and develop a new training program to propose to your organization based on state-of-the-art communication and training concepts</strong></u>.</p>','group','2017-01-16','2017-03-01',NULL,NULL,'<p>After spending <u><strong>~150 hours dedicated to your organization</strong></u>, each group of student-consultants will submit:</p><ul><li><strong>Sample visual report of the newly designed training deliverable </strong></li><li><strong>Video presentation that gives better insights to the reasons behind the changes</strong></li></ul>',1,NULL,'2017-06-15 02:41:02','2017-06-15 02:41:02','<p>In groups of 4 or 5, student-consultants will analyze existing training materials from organizations and then <u><strong>create and develop a new training program to propose to your organization based on state-of-the-art communication and training concepts</strong></u>. Past examples have included, but are not limited to:</p><ul><li><strong>new hire training</strong></li><li><strong>diversity training</strong></li><li><strong>conflict management, etc.</strong></li></ul>',5,'4th Year',0,NULL,NULL,NULL),(519,89,'draft','Training Analysis',NULL,'COM 413','Advanced Organizational Communication',5,2018,'winter/spring','<p>In groups of 4 or 5, student-consultants will analyze existing training materials from organizations and then <u><strong>create and develop a new training program to propose to your organization based on state-of-the-art communication and training concepts</strong></u>.</p>','group','2017-01-16','2017-03-01',NULL,NULL,'<p>After spending <u><strong>~150 hours dedicated to your organization</strong></u>, each group of student-consultants will submit:</p><ul><li><strong>Sample visual report of the newly designed training deliverable </strong></li><li><strong>Video presentation that gives better insights to the reasons behind the changes</strong></li></ul>',1,NULL,'2017-06-15 02:41:08','2017-06-15 02:41:42','<p>In groups of 4 or 5, student-consultants will analyze existing training materials from organizations and then <u><strong>create and develop a new training program to propose to your organization based on state-of-the-art communication and training concepts</strong></u>. Past examples have included, but are not limited to:</p><ul><li><strong>new hire training</strong></li><li><strong>diversity training</strong></li><li><strong>conflict management, etc.</strong></li></ul>',5,'4th Year',0,NULL,NULL,NULL),(520,89,'review','Professional Training Senior Project',NULL,'Senior Project','Advanced Organizational Communication',20,2018,'winter/spring','<p>As a senior capstone project, students will review your existing training materials, create a needs assessment, develop new training materials, and design and conduct a training seminar. </p>','individual','2017-11-01','2017-01-11',80,NULL,'<ul><li>Needs assessment</li><li>Project proposal</li><li>Training materials</li><li>Delivery of a training session</li></ul>',4,NULL,'2017-06-15 02:43:33','2017-06-15 02:44:59','<p>Working individually or in groups, senior students will work to revamp a training module for your organization, with your guidance and input. Students will conduct a needs assessment and provide you with a training proposal describing the training session they&#x27;d like to create, and the reasons why.</p><p></p><p>Once your organization has approved their proposal, students will work to create all needed training materials, and design a training seminar. At the end of the project, students will conduct the seminar for the desired audience, and evaluate the outcomes.</p><p></p><p>Possible areas for these students to address include, but are not limited to:</p><ul><li>New hire onboarding</li><li>Intercultural communication</li><li>Conflict management</li></ul>',1,'4th Year',0,NULL,'anywhere','2017-06-15 02:45:18'),(521,89,'draft','Professional Training',NULL,'Senior Project','Advanced Organizational Communication',20,2017,'summer','<p>As a senior capstone project, students will review your existing training materials, create a needs assessment, develop new training materials, and design and conduct a training seminar. </p>','group','2017-05-01','2017-08-31',80,NULL,'<ul><li>Needs assessment</li><li>Project proposal</li><li>Training materials</li><li>Delivery of a training session</li></ul>',1,NULL,'2017-06-15 02:47:07','2017-06-15 02:47:07','<p>Working individually or in groups, senior students will work to revamp a training module for your organization, with your guidance and input. Students will conduct a needs assessment and provide you with a training proposal describing the training session they&#x27;d like to create, and the reasons why.</p><p></p><p>Once your organization has approved their proposal, students will work to create all needed training materials, and design a training seminar. At the end of the project, students will conduct the seminar for the desired audience, and evaluate the outcomes.</p><p></p><p>Possible areas for these students to address include, but are not limited to:</p><ul><li>New hire onboarding</li><li>Intercultural communication</li><li>Conflict management</li></ul>',1,'4th year',0,NULL,NULL,NULL),(522,433,'published','eCommerce Digital Marketing Strategy',NULL,'DMP','Digital Marketing Professional ',10,2017,'fall','<p>Students develop a digital marketing campaign for an eCommerce based website and devise a strategy to drive more online sales.</p>','group','2017-10-10','2017-12-14',40,NULL,'<p>The Digital Marketing Strategy report should outline the campaign and digital strategy for the eCommerce organization, including the following:</p><p></p><p>Company Background</p><ul><li>Executive Summary</li><li>Purpose of website and context for brand</li><li>Website audit and social media audit</li><li>Website objectives and how to achieve them</li><li>Target audience and persona</li></ul><p>Analytics</p><ul><li>Digital Marketing Measurement Model (DMMM) for website and social media</li><li>Google Analytics implementation including goals, views and filters, and reports</li><li>Google Tag Manager implementation</li></ul><p>Search Engine Optimization</p><ul><li>Complete an SEO audit</li><li>Keyword research and justification</li><li>On-page, off-page and technical SEO </li></ul><p>Campaign</p><ul><li>Campaign idea and brief</li></ul><p>Content Marketing</p><ul><li>Create a brand filter</li><li>Develop a sample 1 month editorial calendar</li><li>Create a blogging strategy </li><li>Develop and email marketing strategy - recommend an A/B split test for email newsletter content and subject lines</li><li>Create an abandoned cart recovery email template</li><li>Create an influencer outreach strategy</li></ul><p>Social Media</p><ul><li>Audit current social media channels for growth and engagement</li><li>Provide recommendations to optimize and grow each channel</li><li>Assess the effectiveness of current social channels and provide recommendations on where to focus marketing efforts</li><li>Suggest Hootsuite search terms and streams to connect new readers and monitor conversations</li></ul><p>Advertising</p><ul><li>Determine current cost per acquisition for users for each platform</li><li>Develop social advertising campaign using relevant channels</li><li>Develop Google AdWords campaign</li><li>Create dynamic re-marketing campaigns using Google Display</li><li>Recommend an A/B split test to optimize landing pages for conversions</li></ul>',10,NULL,'2017-06-15 17:21:07','2017-07-24 19:24:29','<p>Students develop a digital marketing strategy to drive online sales and/or launch a new product for an eCommerce based business. Within the project deliverables they complete audits on the business&#x27; current website analytics, SEO and social media presence. They create a campaign idea and build out various components of a digital marketing strategy including:</p><ul><li>Google Analytics Optimization</li><li>SEO</li><li>Content </li><li>Email </li><li>Social Media </li><li>Social Advertising - Facebook, Instagram, Twitter, Linkedin</li><li>Google AdWords - Search, Display and Remarketing</li><li>Influencer and Guest Blogging</li></ul><p></p>',3,'1',0,NULL,'local',NULL),(523,23,'published','Brand Audit & Analysis ',NULL,'BMKT 316','Branding and Innovation',35,2017,'fall','<p>By the end of this project, you’ll receive a comprehensive brand audit.</p><p></p><p>Four marketing students will gather and evaluate information about your brand and your competitors’ brands. </p>','group','2017-10-13','2017-11-24',20,'This project can be roughly divided into five stages: 1. Interview with client (internal assessment of company) 2. Market research and analysis (includes Brand Inventory and Brand Exloratory) 3. Strategic and Tactical Recommendations 4. Final Recommendation 5. Presentation and Report\nReport contents include: Title page (1 page) Executive Summary (1 page) - What the report is about - What are your findings (strategy and key implementations) - What are some supporting evidence (internal and external) Table of Contents (1 page) 1. Background: Company history, brand portfolio, brand inventory 2. External Research and Analysis - In what market does the business compete - What is the market condition (Trends? Segments?Competitors?) - What does your consumer research reveal, describe consumer, demand, market potential 3. Internal Assessment and Analysis -What are the concerns from client interview - What are some issues revealed from onsite observations - What are the concerns from employee interview and assessment 4. Marketing Mix: - Product - Price - Place - Promotions 5. Brand Exploratory; Consumer Knowledge, Resonance Pyramid, Competitive Analysis 6. Strategic Recommendations - Positioning - Points of Parity/Difference, Brand Mantra 7. Tactical Recommendations (additional to support overall recommended strategy)\n \n','<p>At project completion, you’ll receive:</p><ul><li>A 15 minute presentation</li><li>A 12 page report that includes a brand summary and history, external research and analysis, internal assessment and analysis, marketing mix, Brand Exploratory, and strategic and tactical recommendations</li></ul>',3,NULL,'2017-06-15 17:26:40','2017-07-27 21:17:27','<p>This project can be divided into roughly five stages:</p><ol><li>Interview with you or a representative (to conduct an internal assessment of your company)</li><li>Market research and analysis (includes Brand Inventory and Brand Exploratory)</li><li>Strategic and tactical recommendations</li><li>Final recommendation</li><li>Presentation and report</li></ol>',4,'3rd year',0,NULL,'anywhere',NULL),(524,441,'published','Senior Engineering Capstone: Product Design',NULL,'EL 4395','Engineering Leadership - Capstone Senior Design',18,2017,'other','<p>Teams of engineering students will devote 400+ hours to help you create or enhance a product or process of your choice over the span of nine months.</p>','group','2017-08-28','2018-04-26',400,NULL,'<p>The final project deliverables are:</p><ul><li>Prototype design</li><li>An in-depth product design report</li><li>Functional test analysis</li><li>Possibly a working prototype</li></ul>',2,NULL,'2017-06-15 17:38:53','2017-06-16 23:31:48','<p>A team of engineering students will devote 1500+ hours to help you enhance a product or process over the span of nine months. These projects should be of value to your company but not be a critical production item needed for your company’s sustainability. </p><p></p><p>During the first semester, students will explore the problem at depth and propose varied solutions to the problem. This time may also include discussing needs with customers and defining the customer segmentation space, as well as weekly in-depth discussions with you. During the second semester, a prototype will be designed and you will be given an in-depth development report.</p><p></p><p>Possible project examples include but are not limited to:</p><ul><li>Improving devices</li><li>Product enhancements</li><li>Manufacturing challenges</li><li>User interface improvements</li><li>Possible new products that need exploration</li><li>Product enhancement, such as improving the interface and performance</li></ul><p>Students are proficient in:</p><ul><li>Understanding customer feedback </li><li>Customer management</li><li>Thermodynamics </li><li>Data analysis </li><li>Scalability projects</li><li>Supply chain management </li><li>Operations management </li><li>Predictive analysis</li><li>Data algorithms </li><li>Calibration and testing</li><li>Machine learning </li><li>Improvisation </li><li>Data modelling</li><li>Digital signal processing </li><li>Applied physics</li></ul><p>Past projects have included:</p><ul><li>Improving lithium-ion batteries</li><li>Scalable humidifier </li><li>Supply chain optimization </li><li>You can check out these projects in more detail here: https://tinyurl.com/yahqoy5c</li></ul>',4,'4th year - Senior Engineering Majors',0,NULL,'anywhere',NULL),(525,442,'published','Company and Competitive Analysis',NULL,'FIN 410','Securities Analysis/Portfolio Management',44,2017,'fall','<p>Individual groups of 4-5 student-consultants will work with your company to conduct a thorough analysis of your financial health and the competitive ecosystem in your industry. </p>','group','2017-08-21','2017-11-30',30,NULL,'<ul><li>12-15 page report </li><li>In-class presentation</li></ul>',1,NULL,'2017-06-15 17:45:38','2017-08-17 05:01:58','<p>Groups of 3-4 fourth year students will research your company, your industry and your competitors in order to conduct a thorough analysis of your organizations health compared to industry averages. </p><p></p><p><strong>Examples include, but are not limited to;</strong></p><p></p><p><strong>1. Industry Analysis</strong></p><p>Defining the industry, identifying main competitors, analyzing industry characteristics (level of competition, barriers of entry, monopoly, etc.).</p><ul><li>Analyze the firm&#x27;s business model, financial statements and forecasts</li></ul><p><strong>2. Strategy</strong></p><p>Identifying and discussing company strategies, in comparison with your main competitors. Assessing the company&#x27;s current competitive advantage.</p><p></p><p><strong>3. Profitability and Risk Analysis </strong></p><p>Computing different ratios from the financial statements to explain trends of the company vs. its competitors.</p><ul><li>Determine the intrinsic value of the firm</li><li>Compare the firm&#x27;s intrinsic value to current value</li><li>Compare the firm&#x27;s value to peer and industry</li><li>Identify sources of strengths and weaknesses</li></ul><p><strong>4. Assess earnings quality </strong></p><p>Analyzing source(s) of earnings: specific item(s) and/or factors (internal and/or external to the firm and the competitors) affecting current profitability.</p>',4,'4th year',1,NULL,'anywhere',NULL),(526,237,'review','MBA Leadership Challenge',NULL,'BUS A 507','Foundations of Strategic Leadership',NULL,2016,'winter/spring','<p>A class of MBA students will tackle a leadership issue or challenge that your company is currently facing.  Students will act as consultants, analyzing the situation and delivering a presentation and report recommending strategies to address it. </p>','individual','2017-02-10','2017-02-24',NULL,NULL,'<p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to devise the project scope and prepare a  detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome - Report and Presentation: Students will submit a 10 page detailed report on the outcomes of the project. Teams will also present  for 5-7 minutes in the last class. Organization representative(s) are invited to attend these presentations.</p>',1,NULL,'2017-06-15 19:21:34','2017-07-24 23:42:48','<p>Starting in February a class of MBA students will spend approximately 50 hours to help you tackle a leadership issue or challenge. </p><p></p><p>The class will be broken in 10 groups of students who will focus on different perspectives of the challenge giving you a holistic solution to the problem. </p><p></p><p>Project scopes can include, but are not limited to:</p><ul><li><strong>How do we sustain our not-for-profit organization itself (operationally) and our Board of Directors?</strong></li><li><strong>How can we exercise our leadership to unify the multi-generations in our workplace?</strong></li><li><strong>How can we market our small company in a changing environment?</strong></li><li><strong>How can we create a cohesive leadership team after a merger?</strong></li><li><strong>How do we ensure quality during a period of high growth?</strong></li></ul>',30,'MBA',0,NULL,'anywhere',NULL),(527,237,'published','Organizational Consulting',NULL,'HFT 3224','Hospitality Management and Leadership',45,2017,'fall','<p>A team of undergraduate student-consultants will tackle a genuine leadership issue or management challenge currently affecting your organization. </p>','group','2017-08-28','2017-12-12',60,NULL,'<p>At project completion, you’ll receive:</p><ul><li>A final report and presentation.</li><li>Strategic recommendations to address your company’s issue.</li></ul>',5,NULL,'2017-06-15 19:29:54','2017-08-28 21:44:29','<p>A group of 5 students will work over the semester to analyze your HR issue and provide strategies/recommendations for resolution.</p><p></p><p>Examples for this assignment may include, but are not limited to, the following:</p><ul><li>Analyze your organizational design and its fit with your organization&#x27;s strategy and/or culture</li><li>Redesign an internal system or process including motivation, job design and satisfaction, team management, organizational learning, training, etc.</li><li>Develop an onboarding plan for new staff</li><li>Develop a plan to increase diversity and note the positive effects of diversity in your organization</li></ul>',5,'Undergraduate',1,NULL,'anywhere',NULL),(528,439,'published','Innovative Product or Service Redesign',NULL,'BUS 280','Innovation & Design',10,2017,'fall','<p>Undergraduate student-consultants, in teams of five, will use the Stanford d.school <strong>Human-Centered Design Process</strong> to redesign your product/service or fix a complex business problem based on a deep consumer insight.</p>','group','2017-09-18','2017-12-06',24,NULL,'<p><strong>A presentation including:</strong></p><ul><li>Innovative end product/process, including working prototype(s)</li><li>Important discoveries in consumer insights</li></ul>',1,NULL,'2017-06-15 23:07:47','2017-08-24 00:00:09','<p>Starting this September, a small team of student-consultants, with diverse experience and backgrounds, will spend roughly 24 hours each (approximately 120 hours in total) to develop innovative approaches and ideas, to help your organization solve a challenge or capture an opportunity.</p><p></p><p>Through this 5 step process: Empathize, Define, Ideate, Prototype, and Test, student teams will develop a deep-level understanding of your user/consumer insights and create innovative, prototype solutions that will address what your consumers want and align it with your goals.</p><p></p><p><strong>Project examples can include, but are not limited to:</strong></p><ul><li>Improving user experience throughout the consumer lifecycle (e.g. online interactions, buying experience, etc.)</li><li>Optimizing logistics to increase efficiency</li><li>Creative accessibility solutions for the end user</li></ul>',5,'2nd Year',0,NULL,'anywhere',NULL),(529,439,'published','Innovative Business Solutions',NULL,'BUS 280','Innovation & Design',10,2017,'summer','<p>Two teams of five each will use the Stanford d.school <strong>Human-Centered Design Process</strong> to redesign your product/service or fix a complex business problem based on a deep consumer insight.</p>','group','2017-07-07','2017-08-18',24,NULL,'<p>A presentation including: </p><ul><li>Innovative end product/process, including working prototype(s)   </li><li>Important discoveries in consumer insights</li></ul>',1,NULL,'2017-06-15 23:10:29','2017-08-03 23:15:02','<p>Students will work in teams with diverse experience and backgrounds to ensure innovative approaches and ideas. </p><p></p><p>Through this 5 step process: Empathize, Define, Ideate, Prototype, and Test, students will develop a deep-level understanding of your user/consumer insights and create innovative, prototype solutions that will address<strong> what your consumers want and align it with your goals</strong>.</p><p></p><p><strong>Project examples can include, but are not limited to:</strong></p><ul><li>Improving user experience throughout the consumer lifecycle (e.g. online interactions, buying experience, etc.)</li><li>Optimizing logistics to increase efficiency</li><li>Creative accessibility solutions for the end user</li></ul>',5,'2nd Year',1,NULL,'anywhere',NULL),(530,2,'published','Digital Marketing',NULL,'MKTG 4560','Digital Strategy',40,2017,'fall','<p>A group of student consultants will develop a digital marketing plan unique to your organization.</p>','group','2017-09-12','2017-12-05',100,NULL,'<p>The final deliverables for this project include:</p><ul><li>A 3-page executive summary and accompanying documents on the research and analytical work that has been performed</li><li>A 7-minute presentation on their findings with a 10-15 minute Q&amp;A period</li></ul><p>As an industry partner, you can expect details on the solution and recommendations the team developed. This could be a digital marketing plan, a new strategic positioning, a communication strategy and so on, depending on the initial assignment the company handed to the students. </p>',8,NULL,'2017-06-15 23:59:19','2017-08-03 21:34:31','<p>With the professor, you will co-create a digital marketing challenge that is unique to your organization and that a student team consisting of 4 to 5 undergrad students can complete.  The project can be related to ongoing marketing initiatives, such as:  </p><ul><li>A new product launch</li><li>A brand campaign</li><li>Brand repositioning for the purpose of market expansion, new target markets, etc.</li></ul><p>Students will do industry research on your competitors and potential customers, as well as your strengths, competencies, and weaknesses. It is imperative that you provide access to as much data as you can. Based on the research, the team will develop a solution and recommendations for you. </p>',5,'3rd and 4th year undergrads',0,NULL,'local',NULL),(531,433,'published','Mobile App Design MVP',NULL,'UXFT','UX/UI Design',16,2017,'fall','<p>Students will design a mobile application applying user experience and user interface techniques over 3 weeks. At the end of this 3 week sprint, a minimum viable product will be designed.</p>','group','2017-10-23','2017-11-03',100,NULL,'<p>A clickable prototype ready to be use for development by developers. </p><p>Hand over deliverables include:</p><p>Research data</p><p>Clickable prototype</p><p>Wireframes</p><p>Visual designs (icons, branding etc.)</p><p>Information architecture</p>',10,NULL,'2017-06-16 18:36:04','2017-07-25 01:48:30','<p><strong>User Experience</strong></p><ul><li>Research ( Organizational/domain/user/competitive comparative etc.)</li><li>Planning of design sprint (information architecture, data analysis, brainstorming etc.)</li><li>Design (wireframes, prototypes etc)</li><li>Testing (user testing, iterating)</li><li>Presentation ( final presentation to community partner on the work done throughout the 3 week sprint)</li></ul><p><strong>User Interface</strong></p><ul><li>Research ( Organizational/domain/user/competitive comparative etc.)</li><li>Design inceptions, moodboards, art direction</li><li>Design Hi-fidelity mockups from wireframes</li><li>User interface elements (icons, graphics, visual elements)</li><li>Brand Identity (logo, branding etc.)</li><li>Presentation ( final presentation to community partner on the work done throughout the 3 week sprint)</li></ul>',5,'post-grad',0,NULL,'local',NULL),(532,422,'review','Wake Forest University Case Competition ',NULL,'','Case Competition',NULL,NULL,'fall','<p>Groups of students will compete to come up with the best solution for your marketing or human resources related opportunity. </p>','group','2017-09-04','2017-12-04',20,NULL,'<p>Several proposals from students about how to best move forwards with your challenge or opportunity. </p>',1,NULL,'2017-06-16 21:45:59','2017-06-16 22:25:44','<p>Groups of Wake Forest University students will compete to come up with the best solution for a human resources or marketing challenge your firm is facing. During the 3 month case competition, students will devote 20+ hours to come up with innovative strategies they will later present to you.</p>',3,'',0,NULL,'local',NULL),(533,100,'published','New Website Construction',NULL,'CIT 151','Web Development',20,2016,'fall','<p>Up to 5 individual students will each create well-designed, accessible web pages that validate and conform to web standards for your organization.</p>','individual','2017-09-05','2017-12-05',80,NULL,'<p>Each student will deliver a minimum of a <u><strong>5-page website tailored to your organization</strong></u>.</p>',6,NULL,'2017-06-17 17:15:22','2017-07-11 18:32:39','<p>The selected student will create well-designed, accessible web pages that validate and conform to web standards for your organization. They will enhance the web pages with interactive features, organize the content of the website and publish the pages to a web server. <u><strong>Take the best ideas and designs from each to upgrade your current website!!!</strong></u></p>',1,'1st year',0,NULL,'regional',NULL),(534,443,'published','Advertising Consultancy (Creative Brief)',NULL,'MGMKT 481','Advertising Management',60,2017,'fall','<p>10 teams of student-consultants will <strong><u>research your target consumer</u></strong> for a specific product or service, identify important business insights, and <strong><u>co-draft a creative brief</u></strong> for your organization.</p>','group','2017-08-21','2017-12-08',15,NULL,'<p><strong>The final project deliverables are:</strong></p><ul><li>A 2-page creative brief with in-depth, actionable and non-obvious findings regarding the target consumer</li><li>A 10-to-12 minute presentation that illustrates the research process undertaken by the given team</li></ul>',1,NULL,'2017-06-19 15:10:56','2017-08-01 18:17:35','<p>A class of 60 students will work on one organization by delivering 10 different renditions of creative briefs towards the end of semester.</p><p></p><p>Student-consultants will research your target consumer for a specific product or service to <strong><u>identify new, actionable and non-obvious insights</u></strong> about your target consumers. </p><p></p><p>Then, they will work as a team to co-draft a creative brief for your organization based on their findings.</p><p></p><p><strong>Project examples can include:</strong></p><ul><li>Secondary research on your target consumers, e.g. extracting relevant insights from data in industry reports, media, trade press, academic databases and other sources.</li><li>Primary qualitative research on target consumer (possibilities include focus groups, depth-interviews, and field observation).</li><li>Crafting a creative brief with new, actionable insights about your target consumers.</li></ul>',6,'3rd and 4th year BBA students',0,NULL,'anywhere',NULL),(535,442,'review','MBA Company & Competitive Analysis',NULL,'231A','MBA Financial Statement Analysis and Forecasting',140,2016,'fall','<p>Individual groups of 5 MBA student-consultants will work with your company to conduct a thorough analysis of your financial health and the competitive ecosystem in your industry.</p>','group','2017-10-01','2017-12-04',20,NULL,'<p>A 10-page document + appendices with the group&#x27;s thorough findings, as well as a 20 min presentation to the client.</p>',1,NULL,'2017-06-19 16:29:06','2017-06-19 16:29:19','<p>Students will research your company, your industry and your competitors in order to conduct a thorough analysis of your organizations health compared to industry averages. </p><p></p><p><strong>Project examples include, but are not limited to;</strong></p><p></p><p><strong>1. Industry Analysis</strong></p><p>Defining the industry, identifying main competitors, analyzing industry characteristics (level of competition, barriers of entry, monopoly, etc.).</p><p></p><p><strong>2. Strategy</strong></p><p>Identifying and discussing company strategies, in comparison with your main competitors. Assessing the company&#x27;s current competitive advantage</p><p></p><p><strong>3. Profitability and Risk Analysis </strong></p><p>Computing different ratios from the financial statements to explain trends of the company vs. its competitors.</p><p></p><p><strong>4. Assess earnings quality </strong></p><p>Analyzing source(s) of earnings: specific item(s) and/or factors (internal and/or external to the firm and the competitors) affecting current profitability.</p>',5,'Masters of Accounting, MBA',0,NULL,'anywhere','2017-06-19 16:41:27'),(536,418,'published','Private Business Acquisition: Strategy & Valuation',NULL,'EMBA Capstone','Acquiring Private Businesses',65,2018,'fall','<p>Students will evaluate and value business acquisition opportunities and develop approaches for increasing ROI, including growth strategies and implementation.</p>','group','2018-07-16','2018-10-31',80,NULL,'<p>  </p><ul><li>Group Assignment: A group (in-person and written) presentation that outlines the approach to valuation, the negotiation strategy, the strategy for financing the acquisition and the strategy for growing the company once acquired. The business owner would be asked to assist in evaluating the presentations.</li></ul><p></p><ul><li>Individual Assignment: every student will prepare a paper outlining what actions they would take in the first 100 days following the acquisition to take control of the firm and to begin to execute their growth strategy.</li></ul>',4,NULL,'2017-06-19 16:31:24','2017-06-28 20:22:09','<p>Students in the Executive MBA program at Rotman will work with your business to come up with a valuation for the company. They&#x27;ll review your financials and business fundamentals to provide a supported estimation of the business&#x27;s current worth.</p><p></p><p>Their analysis will also look for potential issues that could impede the company&#x27;s valuation, and strategies you can pursue to increase your valuation and grow your business. </p><p></p><p>Finally, they&#x27;ll look more broadly at the industry and competitive landscape as a whole to identify acquisition opportunities.</p><p></p><p>Potential projects include, but are not limited to:</p><ul><li>Valuation of a family-run business to prepare for a planned sale in the near future</li><li>Valuation of a privately held company to help them assess whether an acquisition offer is appropriate.</li><li>Valuation of an established private business to help guide future financial decisions and determine if a sale would be desirable.</li></ul><p></p>',5,'Executive MBAs (10+ years of work experience)',0,NULL,'anywhere',NULL),(537,14,'published','Strategic Marketing Plan for B2C Companies',NULL,'COMM - 468','Marketing Applications',40,2017,'fall','<p>A group of 4th year student-consultants will work with your B2C company to develop a comprehensive marketing plan for a clearly defined marketing objective of your choice. </p>','group','2017-09-01','2017-12-25',60,NULL,'<p>At the completion of this project, you’ll receive:</p><ul><li>A full marketing plan and presentation</li><li>Analysis of all four marketing mix elements: product, price, distribution and promotion</li><li>Original research about your customers</li><li>Creative and actionable recommendations based on a clear, well-defined goal</li></ul><p></p>',10,NULL,'2017-06-19 18:12:45','2017-08-15 17:33:00','<p>The students will dedicate approximately 300 hours to research, analyze and create their plan while being coached by their instructor. </p><p></p><p>Potential scopes for this project can include, but are not limited to, the following:</p><ul><li>Promoting a new product/service launch</li><li>Improving online communications</li><li>Increasing revenue for an existing product/service</li><li>Increasing market share/brand awareness </li><li>Improving customer acquisition/retention</li><li>Identifying new market segments and opportunities</li></ul>',5,'4th Year',1,NULL,'anywhere',NULL),(538,433,'published','Digital Marketing Mobile App - User Acquisition Strategy',NULL,'DMP','Digital Marketing Professional ',10,2017,'summer','<p>Students develop a user acquisition strategy for a newly launched mobile application and devise a strategy to drive more downloads and retain users overtime.</p>','group','2017-08-16','2017-09-05',40,NULL,'<p>The User Acquisition Strategy report should outline the campaign and digital strategy for the mobile application, including the following:</p><p></p><p>Company Background</p><ul><li>Executive Summary</li><li>Purpose of website and context for brand</li><li>Website/landing page audit</li><li>Social media audit</li><li>App analytics audit</li><li>Website objectives and how to achieve them</li><li>Business Model Canvas</li><li>Market analysis (SWOT and/or Competitor Analysis)</li></ul><p>Analytics</p><ul><li>Digital Marketing Measurement Model (DMMM) for website and social media</li><li>Google Analytics implementation including goals, views and filters, and reports</li><li>Google Tag Manager implementation</li></ul><p>Search Engine Optimization</p><ul><li>Complete an SEO audit</li><li>Keyword research and justification</li><li>On-page, off-page and technical SEO </li></ul><p>Target Persona &amp; Campaign</p><ul><li>Target audience and persona, and brand filter</li><li>Value proposition</li><li>Campaign idea</li><li>Campaign marketing and communications plan</li></ul><p>User Acquisition Strategy - Owned, Paid and Earned</p><p> <strong>Owned Tactics</strong></p><ul><li>SEO audit and recommendations</li><li>ASO audit and recommendations</li><li>Content strategy (blog, video, social media, editorial calendar)</li><li>Email marketing strategy</li></ul><p><strong> Paid Tactics</strong></p><ul><li>Paid advertising - AdWords, GDN, Social advertising, YouTube</li></ul><p><strong> Earned Tactics</strong></p><ul><li>Influencer marketing</li><li>Guest blogging</li></ul><p> </p><p>User Retention Strategy</p><ul><li>Email marketing</li><li>Push notifications</li></ul><p>Monetization Strategy (Optional based on client)</p><ul><li>Paid app downloads</li><li>In-app purchases</li><li>In-app ads</li></ul><p>Projections</p><ul><li>Traffic</li><li>Conversions</li><li>Revenues </li></ul>',2,NULL,'2017-06-19 20:18:48','2017-07-25 18:37:06','<p>Students develop a user acquisition strategy to drive app downloads and increase user engagement for a newly launched mobile app. Within the project deliverables they complete audits on the app&#x27;s current website or landing page analytics, SEO, ASO and social media presence. They create a campaign idea and build out various components of a digital marketing strategy including:</p><ul><li>Google Analytics Optimization</li><li>SEO</li><li>ASO</li><li>Content </li><li>Email </li><li>Social Media </li><li>Social Advertising - Facebook, Instagram, Twitter, Linkedin</li><li>Google AdWords - Search, Display and Remarketing</li><li>Influencer and Guest Blogging</li><li>Push Notifications</li><li>Monetization Strategies</li></ul><p></p>',3,'1',0,NULL,'local',NULL),(539,61,'review','Client Marketing Plan Capstone',NULL,'MRKT 4331','BBA in Marketing Management',22,2016,'fall','<p>Individual students will act as a consultant, spending 15-20 hours per week for 8-10 weeks, developing a marketing plan unique to your organization.</p>','individual','2017-09-13','2017-11-30',125,NULL,'<p>Students will submit a <u><strong>5-page report</strong></u> identifying their recommendations and subsequent implementation plan with a fully costed budget and forecasted incremental revenue expected. They will also do a <u><strong>45-minute presentation of their findings</strong></u> to you, in person. Students are graded on the feasibility and realistic nature of their recommendations, as well as<u><strong> the potential value they create for your organization</strong></u>.</p>',22,NULL,'2017-06-19 20:18:52','2017-08-31 19:47:27','<p>Are you expanding your product line? Opening a new location? Or do you just want to improve your website conversations? Whatever it is, a student-consultant works to <u><strong>solve your marketing problem by researching you, your industry, and your market</strong></u>. </p>',1,'4th Year',1,NULL,'anywhere',NULL),(540,433,'published','Inbound Digital Marketing Strategy B2B',NULL,'DMP','Digital Marketing Professional ',10,2017,'summer','<p>Students develop an inbound marketing strategy for a B2B focused business and devise a strategy to increase lead generation and nurture leads into customers.</p>','group','2017-09-06','2017-09-19',40,NULL,'<p>The Inbound Digital Marketing report should outline the inbound strategy for the B2B focused business, including the following:</p><p></p><p>Market Analysis &amp; Goals</p><ul><li>Business Objectives</li><li>Market &amp; Competitive Analysis</li><li>Baseline Metrics - website and social media audits</li><li>SEO Audit</li><li>Digital Marketing Measurement Model (DMMM)</li><li>Google Analytics &amp; Google Tag Manager</li></ul><p>Targeting &amp; Campaign</p><ul><li>Target Audience &amp; Buyer Persona(s) </li><ul><li>Where do they live online and what are their pain points, problems &amp; questions</li></ul><li>Quality Lead Definition</li><li>Campaign Idea</li><li>Content Creation - eBook, whitepapers, case studies, webinars, events, etc.</li></ul><p>Inbound Marketing Strategy</p><ul><li>Explain each stage of the sales funnel - Awareness, Consideration and Decision</li><ul><li>What is the content strategy at each stage</li><li>What is the promotional strategy - SEO, blogs, social media, forums, groups, events, CTAs</li><li>Lead capture - landing pages, forms, thank you pages</li><li>Lead nurturing workflow - starting conditions, timeline, content shared, email examples, CTAs</li></ul><li>Explain what happens if people enter at various stages of the funnel or if people drop out of the funnel</li></ul>',3,NULL,'2017-06-19 20:50:59','2017-07-18 22:02:56','<p>Students develop an inbound digital marketing strategy to increase lead generation for a B2B focused organization. Within the project deliverables they complete audits on the current website, SEO and social media presence. They create a campaign idea and build out various components of a digital marketing strategy including:</p><ul><li>Google Analytics Optimization</li><li>SEO</li><li>Content Strategies</li><li>Social Media Strategies</li><li>Lead Generation Strategies</li><li>Landing Pages and Forms</li><li>Email Nurturing &amp; Workflows</li></ul><p></p><p></p>',3,'1',1,NULL,'local',NULL),(541,326,'published','Public Relations: Press Kit Development',NULL,'PREL 3339','Public Relations Methods',20,2017,'fall','<p>Over a 2-month period, senior level undergraduate students will develop a <strong>Press Kit</strong> for your organization for Media Relations or Online Communications purposes.</p>','individual','2017-08-24','2017-10-20',20,NULL,'<p><strong>A Press Kit including:</strong></p><ul><li>Company/Product Fact Sheet</li><li>Executive Bios</li><li>Company Background</li><li>Press Release</li></ul>',5,NULL,'2017-06-19 20:51:09','2017-08-28 23:50:44','<p>Starting in September, a senior level undergraduate student will approach your company as Public Relations Specialists and get to know your<em> business</em>, <em>key messaging</em>, and <em>value proposition</em> in order to understand how to <strong>best</strong> <strong>position your brand</strong>. </p><p></p><p>Based on the information gathered and other relevant research, the student-consultant will write professional press kit materials for your company that can be used by your organization for <strong>Media Relations</strong> or as <strong>Marketing Collateral</strong>. The student will collaborate with you on ways to positively showcase your company in the materials.</p><p></p><p><strong>The Press Kit will include:</strong></p><ul><li>Company/Product Fact Sheet</li><li>Executive Bios</li><li>Company Background</li><li>Press Release</li></ul><p>Materials will be developed with a brand voice <u>appropriate</u> for your organization and based on the information you provide and research done by the student.</p><p></p><p>Press kit materials are ideal for sharing through various online and offline channels including social media, your corporate website, newsletters, etc.</p>',3,'3rd & 4th years',1,NULL,'anywhere',NULL),(542,433,'published','Wordpress Website Development',NULL,'UIFT','Web Development Professional',16,2017,'summer','<p>This assignment involves working with UX, UI and Web Dev students for a period of 3 weeks with the end goal of building through Wordpress a website that was designed by RED students. </p>','group','2017-09-04','2017-09-22',100,NULL,'<p>Hand over deliverables include:</p><ul><li>Research data</li><li>Clickable prototype</li><li>Wireframes</li><li>Visual designs (icons, branding etc.)</li><li>Information architecture</li><li>20 minute presentation showcasing both UX and UI processes and results</li><li>A case study that walks the reader through your design process</li></ul>',1,NULL,'2017-06-19 21:17:24','2017-07-05 21:09:10','<p><strong>User Experience</strong></p><ul><li>Research (Organizational/domain/user/competitive comparative etc.)</li><li>Planning of design sprint (information architecture, data analysis, brainstorming etc.)</li><li>Design (wireframes, prototypes etc)</li><li>Testing (user testing, iterating)</li><li>Presentation ( final presentation to community partner on the work done throughout the 3 week sprint)</li></ul><p><strong>User Interface</strong></p><ul><li>Research Research (Organizational/domain/user/competitive comparative etc.)</li><li>Design inceptions, moodboards, art direction</li><li>Design Hi-fidelity mockups from wireframes</li><li>User interface elements (icons, graphics, visual elements)</li><li>Brand Assets (logo, style guides, style tiles)</li><li>Presentation ( final presentation to community partner on the work done throughout the 3 week sprint)</li></ul>',5,'Post Graduate',1,NULL,'anywhere',NULL),(543,469,'published','Building a Prototype',NULL,'OCE','',30,2017,'fall','<p>Your company has the opportunity to work with La Cité students to develop a prototype for a new product, technology, or construction.  </p>','group','2017-09-01','2018-08-31',100,NULL,'<p>The deliverable will be determined between your organization and the students, with faculty input, and will vary depending on the project chosen.</p>',10,NULL,'2017-06-19 23:06:56','2017-08-15 17:43:06','<p><strong>Note: </strong>Start dates and group sizes are variable depending on the project requirements.</p><p></p><p>Is your organization working to develop a product or technology for which you need a prototype developed? Work with the next generation of innovators at La Cité!</p><p></p><p><strong>The Ontario Centres of Excellence provides grant funding up to $10,000 per company project. </strong>This is allocated to the college, but will be used to cover costs related to your prototyping initiative.</p><p></p><p>Collège La Cité students in the areas of Computer Engineering, Mechanical Engineering, Electrical Engineering, Architecture and Graphic Design will work in collaboration with your business to develop a prototype for a new product or technology.</p><p></p><p>Students have access to faculty supervision and La Cité facilities, but will work in line with your goals and feedback to develop the prototype. They can accelerate your time to market for these new ventures and help you to achieve greater success with these prototypes.</p><p></p><p>Past projects in this initiative have included:</p><ul><li>Developing a prototype of human resource management software</li><li>Design and construction of a concrete drying system</li><li>Designing an affordable solar power system</li><li>Development of a new system of fasteners for baseboards</li><li>Building 3D printed models</li><li>Development of a touch screen interface for a bathtub</li></ul><p>Check out one of our past success stories here, a collaboration between Ottawa Water Innovation Systems and a La Cité team: https://research.collegelacite.ca/2017/01/water-systems-innovation-project/</p><p></p><p></p><p></p>',3,'Variable',0,NULL,'regional',NULL),(544,379,'published','Communication Consultancy',NULL,'COMM 111','Foundations of Human Communication',25,2017,'fall','<p>Student-consultants will use the tools of communication analysis to evaluate and (re)design your organization&#x27;s messaging in an effort to promote the organization itself, an event, a product, etc. </p>','individual','2017-08-30','2017-12-01',20,NULL,'<p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to devise the project scope and prepare a  detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome - Report and Video: Students will submit the following:</p><ul><li>4-5 page white paper, detailing recommendations for message design or redesign </li><li>2-minute professionally edited video with their suggestions</li></ul>',1,NULL,'2017-06-20 12:46:21','2017-08-17 23:48:20','<p>Students will examine and evaluate a message designed by your organization that communicates with the public about an event, campaign, product, or initiative. Then the students will provide recommendations for designing or redesigning the message in an effort to improve its effectiveness.<br/> </p><p><strong>Some examples include, but are not limited to:</strong></p><ul><li>Audit and recommendations for improving a recent social media campaign</li><li>Review and redesign of promotional material for an event or initiative</li></ul><p></p><p>Using the tools of semiotic and rhetorical analysis, students will conduct an evaluation of your organization’s advertising/PR/other messaging and make recommendations for a redesign. </p><p></p>',1,'1st year',0,NULL,'anywhere',NULL),(545,421,'published','Inbound Digital Marketing Strategy',NULL,'DMP','Digital Marketing Professional ',10,2017,'fall','<p>Students develop an inbound marketing strategy for a B2B focused business and devise a strategy to increase lead generation and nurture leads into customers.</p>','group','2017-12-11','2017-12-21',40,NULL,'<p>The Inbound Digital Marketing report should outline the inbound strategy for the B2B focused business, including the following:</p><p></p><p>Market Analysis &amp; Goals</p><ul><li>Business Objectives</li><li>Market &amp; Competitive Analysis</li><li>Baseline Metrics - website and social media audits</li><li>SEO Audit</li><li>Digital Marketing Measurement Model (DMMM)</li><li>Google Analytics &amp; Google Tag Manager</li></ul><p>Targeting &amp; Campaign</p><ul><li>Target Audience &amp; Buyer Persona(s) </li><ul><li>Where do they live online and what are their pain points, problems &amp; questions</li></ul><li>Quality Lead Definition</li><li>Campaign Idea</li><li>Content Creation - eBook, whitepapers, case studies, webinars, events, etc.</li></ul><p>Inbound Marketing Strategy</p><ul><li>Explain each stage of the sales funnel - Awareness, Consideration and Decision</li><ul><li>What is the content strategy at each stage</li><li>What is the promotional strategy - SEO, blogs, social media, forums, groups, events, CTAs</li><li>Lead capture - landing pages, forms, thank you pages</li><li>Lead nurturing workflow - starting conditions, timeline, content shared, email examples, CTAs</li></ul><li>Explain what happens if people enter at various stages of the funnel or if people drop out of the funnel</li></ul>',0,NULL,'2017-06-20 15:15:55','2017-07-19 01:03:36','<p>Students develop an inbound digital marketing strategy to increase lead generation for a B2B focused organization. Within the project deliverables they complete audits on the current website, SEO and social media presence. They create a campaign idea and build out various components of a digital marketing strategy including:</p><ul><li>Google Analytics Optimization</li><li>SEO</li><li>Content Strategies</li><li>Social Media Strategies</li><li>Lead Generation Strategies</li><li>Landing Pages and Forms</li><li>Email Nurturing &amp; Workflows</li></ul><p></p><p></p>',3,'1',0,NULL,'anywhere',NULL),(546,421,'published','Mobile App Marketing',NULL,'DMP','Digital Marketing Professional ',10,2017,'fall','<p>Students develop a user acquisition strategy for a newly launched mobile application and devise a strategy to drive more downloads and retain users overtime.</p>','group','2017-11-20','2017-12-08',40,NULL,'<p>The User Acquisition Strategy report should outline the campaign and digital strategy for the mobile application, including the following:</p><p></p><p>Company Background</p><ul><li>Executive Summary</li><li>Purpose of website and context for brand</li><li>Website/landing page audit</li><li>Social media audit</li><li>App analytics audit</li><li>Website objectives and how to achieve them</li><li>Business Model Canvas</li><li>Market analysis (SWOT and/or Competitor Analysis)</li></ul><p>Analytics</p><ul><li>Digital Marketing Measurement Model (DMMM) for website and social media</li><li>Google Analytics implementation including goals, views and filters, and reports</li><li>Google Tag Manager implementation</li></ul><p>Search Engine Optimization</p><ul><li>Complete an SEO audit</li><li>Keyword research and justification</li><li>On-page, off-page and technical SEO </li></ul><p>Target Persona &amp; Campaign</p><ul><li>Target audience and persona, and brand filter</li><li>Value proposition</li><li>Campaign idea</li><li>Campaign marketing and communications plan</li></ul><p>User Acquisition Strategy - Owned, Paid and Earned</p><p> <strong>Owned Tactics</strong></p><ul><li>SEO audit and recommendations</li><li>ASO audit and recommendations</li><li>Content strategy (blog, video, social media, editorial calendar)</li><li>Email marketing strategy</li></ul><p><strong> Paid Tactics</strong></p><ul><li>Paid advertising - AdWords, GDN, Social advertising, YouTube</li></ul><p><strong> Earned Tactics</strong></p><ul><li>Influencer marketing</li><li>Guest blogging</li></ul><p> </p><p>User Retention Strategy</p><ul><li>Email marketing</li><li>Push notifications</li></ul><p>Monetization Strategy (Optional based on client)</p><ul><li>Paid app downloads</li><li>In-app purchases</li><li>In-app ads</li></ul><p>Projections</p><ul><li>Traffic</li><li>Conversions</li><li>Revenues </li></ul>',0,NULL,'2017-06-20 15:16:31','2017-07-19 01:04:36','<p>Students develop a user acquisition strategy to drive app downloads and increase user engagement for a newly launched mobile app. Within the project deliverables they complete audits on the app&#x27;s current website or landing page analytics, SEO, ASO and social media presence. They create a campaign idea and build out various components of a digital marketing strategy including:</p><ul><li>Google Analytics Optimization</li><li>SEO</li><li>ASO</li><li>Content </li><li>Email </li><li>Social Media </li><li>Social Advertising - Facebook, Instagram, Twitter, Linkedin</li><li>Google AdWords - Search, Display and Remarketing</li><li>Influencer and Guest Blogging</li><li>Push Notifications</li><li>Monetization Strategies</li></ul><p></p>',3,'1',0,NULL,'anywhere',NULL),(547,41,'review','Virtual Security Assessment',NULL,'VirtualClass','Virtual Security Workshop',50,2018,'other','<p> Students will work in groups of four to identify breeches in your wireless network security by unauthorized access points (APs). </p>','group','2017-12-01','2018-02-01',5,NULL,'<p><strong>Students will present the following deliverables to your organization:</strong></p><ul><li>10-minute presentation of the research findings and recommendations, including budget.</li><li>Complete report of the approach to addressing an unauthorized AP threat. </li><li>A step-by-step guide to mitigate unauthorized AP threats.</li></ul>',2,NULL,'2017-06-20 15:18:39','2017-08-16 00:16:15','<p>With quickly changing network technologies, its important to stay current on security protocol, or your organization risks leaking important data from your network.</p><p></p><p>This December, groups of four students will spend approximately 20 hours per group analyzing and investigate all of your organization&#x27;s wireless access points.  </p><p></p><p>Based on their analysis, groups will determine the legitimacy of all your network&#x27;s APs and identify any unauthorized APs.</p>',4,'4th year',0,NULL,'anywhere',NULL),(548,280,'draft','Programmatic Calendar',NULL,'2215','CS140 - Computer Programming I',24,2017,'fall','<p>Individuals will write software to increase the productivity of a business environment. </p>','individual','2017-09-18','2017-11-25',55,NULL,'<ul><li>Documentation detailing the features of the program.</li><li>Computer program that will assist with scheduling.</li><li>Tutorial that will guide the user in using the computer program.</li></ul><p></p>',1,NULL,'2017-06-20 18:56:12','2017-06-20 19:58:09','<ul><li>Building software to assist business operations.</li></ul>',1,'2 year',0,NULL,NULL,NULL),(549,421,'published','eCommerce Digital Marketing Strategy',NULL,'DMP','Digital Marketing Professional ',10,2017,'summer','<p>Students develop a digital marketing campaign for an eCommerce based website and devise a strategy to drive more online sales.</p>','group','2017-07-31','2017-08-18',40,NULL,'<p>The Digital Marketing Strategy report should outline the campaign and digital strategy for the eCommerce organization, including the following:</p><p></p><p>Company Background</p><ul><li>Executive Summary</li><li>Purpose of website and context for brand</li><li>Website audit and social media audit</li><li>Website objectives and how to achieve them</li><li>Target audience and persona</li></ul><p>Analytics</p><ul><li>Digital Marketing Measurement Model (DMMM) for website and social media</li><li>Google Analytics implementation including goals, views and filters, and reports</li><li>Google Tag Manager implementation</li></ul><p>Search Engine Optimization</p><ul><li>Complete an SEO audit</li><li>Keyword research and justification</li><li>On-page, off-page and technical SEO </li></ul><p>Campaign</p><ul><li>Campaign idea and brief</li></ul><p>Content Marketing</p><ul><li>Create a brand filter</li><li>Develop a sample 1 month editorial calendar</li><li>Create a blogging strategy </li><li>Develop and email marketing strategy - recommend an A/B split test for email newsletter content and subject lines</li><li>Create an abandoned cart recovery email template</li><li>Create an influencer outreach strategy</li></ul><p>Social Media</p><ul><li>Audit current social media channels for growth and engagement</li><li>Provide recommendations to optimize and grow each channel</li><li>Assess the effectiveness of current social channels and provide recommendations on where to focus marketing efforts</li><li>Suggest Hootsuite search terms and streams to connect new readers and monitor conversations</li></ul><p>Advertising</p><ul><li>Determine current cost per acquisition for users for each platform</li><li>Develop social advertising campaign using relevant channels</li><li>Develop Google AdWords campaign</li><li>Create dynamic re-marketing campaigns using Google Display</li><li>Recommend an A/B split test to optimize landing pages for conversions</li></ul>',1,NULL,'2017-06-20 20:16:15','2017-06-26 18:06:21','<p>Students develop a digital marketing strategy to drive online sales and/or launch a new product for an eCommerce based business. Within the project deliverables they complete audits on the business&#x27; current website analytics, SEO and social media presence. They create a campaign idea and build out various components of a digital marketing strategy including:</p><ul><li>Google Analytics Optimization</li><li>SEO</li><li>Content </li><li>Email </li><li>Social Media </li><li>Social Advertising - Facebook, Instagram, Twitter, Linkedin</li><li>Google AdWords - Search, Display and Remarketing</li><li>Influencer and Guest Blogging</li></ul><p></p>',3,'1',1,NULL,NULL,NULL),(550,421,'published','Digital Marketing Strategy',NULL,'DMP','Digital Marketing Foundation',19,2017,'summer','<p>Students develop a digital marketing campaign for an eCommerce based website and devise a strategy to drive more online sales.</p>','group','2017-07-25','2017-09-15',40,NULL,'<p>The Digital Marketing Strategy report should outline the campaign and digital strategy for the organization, including the following:</p><p></p><p><strong><u>1. Digital Audit</u></strong></p><p><strong>Objective: </strong>Draw meaningful business insights from Google Analytics data. Analyze both the content and the analytics reports of each social channel provided.</p><p><strong>What’s included:</strong></p><ul><li>Audit of current social channels and SEO</li><li>Creation of a Digital Marketing M</li><li>Measurement Model</li><li>Goal setup and monitoring of KPIs</li><li>Determine baseline metrics on Google Analytics</li><li>Assess engagement, click through rate, and conversion rate on social media</li><li>Develop strategies to hit targets</li></ul><p><strong><u>2. Search Engine Optimization</u></strong></p><p><strong>Objective:</strong> Provide a search enginge optimization plan. Analyse the websites to gage the site&#x27;s search performance and make recommendations for improving their search ranking.</p><p><strong>What’s included:</strong></p><ul><li>Create an SEO strategy featuring both on and off page SEO.</li><li>Include advanced SEO tactics backlinks and keyword theming</li><li>Conduct keyword research</li></ul><p><strong><u>3. Digital Advertising Strategy</u></strong></p><p><strong>Objective: </strong>Provide a marketing communications plan including digital advertising for an event, holiday, etc. Plan and a Google Adwords campaign, include other relevant advertising channels to meet objectives.</p><p><strong>What’s included:</strong></p><ul><li>Marketing Communications Plan</li><li>Develop digital advertising strategy for Google and social media (implementation</li><li>dependent on marketing spend)</li><li>Optimize content and landing pages for conversion</li></ul><p><strong><u>4. Content Strategy</u></strong></p><p><strong>Objective: </strong>Produce an integrated content marketing plan for a community partner, aligned with its marketing goals.</p><p><strong>What’s included:</strong></p><ul><li>Create a content marketing strategy with a 3 month content calendar</li><li>Develop a brand filter for the company</li><li>Create an email marketing strategy</li><li>Create crisis plan for social media and digital PR</li></ul><p>Please note: the above bullets are intended to provide you with a starting point. Each student is expected to put on their consultant hats and prepare a quality report that will be presented to the Community Partner. Reports should be no more than 5 pages long, excluding Appendices. Presentations should be no more than 10 minutes long, with a maximum of 12 slides. </p>',4,NULL,'2017-06-20 20:24:46','2017-07-20 19:35:23','<p>Students develop a digital marketing campaign and devise a strategy to achieve your company goals whether that be brand awareness, increase sales, website conversions etc.</p><p></p><p>They create a campaign idea and build out various components of a digital marketing strategy including:</p><ul><li>Google Analytics Optimization</li><li>SEO</li><li>Content </li><li>Email </li><li>Social Media </li><li>Social Advertising - Facebook, Instagram, Twitter, Linkedin</li><li>Google AdWords - Search, Display and Remarketing</li><li>Influencer and Guest Blogging</li></ul><p></p>',5,'1',1,NULL,'anywhere',NULL),(551,434,'published','MBA Project Management Strategy ',NULL,'MIS 5160','Project Management ',20,2017,'fall','<p>Masters students with Business and IT Management backgrounds will work with your organization to develop project and implementation plans for a project of your choosing. </p>','group','2017-09-15','2017-12-15',90,NULL,'<p><strong>Students will submit detailed project and implementation plans describing:</strong></p><ul><li>Project scope and objectives </li><li>Measurable impacts of implementing the project on your organizations</li><li>The optimal schedule and the resources required</li><li>Risk analysis results</li><li>Project budget. </li></ul><p>To complete these plans, students will communicate with organization representative(s) as needed to complete project tasks. At the end, the work of each group will be presented in a <u><strong>+10-page document</strong></u>, accompanied by a <u><strong>20-minute presentation.</strong></u>  Organization representative(s) are invited to attend presentations. </p><p></p>',3,NULL,'2017-06-21 12:53:36','2017-08-18 05:37:29','<p>In groups of 4-5, Masters students with Business and IT Management backgrounds, will work with your organization to develop project and implementation plans for a project of your choosing. </p><p></p><p><strong>Examples of project topics include, but are not limited to:</strong></p><ul><li>Improving business processes by implementing six sigma or lean strategies</li><li>Enhancing the performance of operational processes in manufacturing or healthcare systems</li><li>The feasibility study of a new technology adoption</li><li>Create scope / time / cost / risk management plans for an IT project</li><li>The role of technology adoption in the successful implementation of continuous improvement programs </li><li>Develop a new commercial website  </li><li>Implementing a small construction project </li></ul>',4,'Masters of Business',0,NULL,'anywhere',NULL),(552,59,'published','Marketing & Communications Plan',NULL,'MARK 3313','Nonprofit Marketing',35,2017,'fall','<p>A group of students will assess your strategic marketing perspective, which will influence the marketing and communications plan.</p>','group','2017-09-05','2017-11-28',20,NULL,'<p>Students will submit a max <u><strong>30-page marketing and communications plan</strong></u>, as well as do a <u><strong>15-minute presentation</strong></u> in front of their entire class.  </p>',7,NULL,'2017-06-21 17:41:37','2017-08-09 14:14:07','<p>A group of students will identify your nonprofit&#x27;s value proposition, sustainable competitive advantage, and positioning in order to <strong><u>assess your strategic marketing perspective</u></strong>, which will influence the marketing and communications plan. Feel free to have the students address a <strong><u>specific marketing challenge</u></strong> that your non-profit is facing.</p><p></p><p>This could include a social media plan, fundraising plan, special events plan, CRM strategy, marketing to volunteers, etc. Anything that will help your nonprofit!</p>',5,'Varied',0,NULL,'local',NULL),(553,421,'published','UX and UI: ReDesign Project',NULL,'UXP','UX and UI Design Professional',8,2017,'summer','<p>This assignment involves researching, designing, wireframing and producing a mid to high fidelity prototype for a website or app.</p>','group','2017-07-24','2017-08-11',70,NULL,'<p> </p><ul><li>20 minute presentation on their findings and recommendations</li><li>Case study report</li><li>Mid to high fidelity prototype</li></ul>',1,NULL,'2017-06-21 19:20:30','2017-07-07 23:04:43','<p>Professional students will endeavour to understand the company&#x27;s business goals, conduct research and consumer surveying to best understand the needs of the target audience and from this create a website or app layout and design that achieves those goals. The students will:</p><ul><li>Conduct user testing </li><li>Apply design thinking practices and methodologies</li><li>Create a mid to high fidelity prototype </li></ul><p></p>',3,'Post Graduate',1,NULL,'local',NULL),(554,421,'published','Wordpress Website Design',NULL,'UXP UIP','UX and UI Professional',8,2017,'fall','<p>This assignment involves working with UX, UI and Web Dev students for a period of 6 weeks with the end goal of building through Wordpress a website that was designed by RED students. </p>','group','2017-11-13','2017-12-01',70,NULL,'<p> </p><ul><li>20 minute presentation on both the Website Re Design </li><li>Mid to high fidelity prototype</li></ul><p></p>',1,NULL,'2017-06-21 19:24:20','2017-08-01 14:36:21','<p>Professional UX and UI students will endeavour to understand the company&#x27;s business goals, conduct research and consumer surveying to best understand the needs of the target audience and from this create a website layout and design that achieves those goals. They will pass the deliverables on to the Web Development students who will build the website. The students will:</p><ul><li>Create a mid to high fidelity prototype </li><li>Pass off the assets to Development if accepted</li></ul>',4,'Post Graduate',0,NULL,'anywhere',NULL),(555,86,'published','MBA Consulting Project',NULL,'MBA-720 Online','Collaborate',20,2017,'fall','<p>A group of MBA students will analyze a collaboration challenge your organization is currently facing and provide a detailed strategy for their recommended solution.</p>','group','2017-09-05','2017-12-05',30,NULL,'<p><strong>Phase 1 – Project Plan: </strong>Students will meet with organization representative(s) to devise the project scope and prepare a detailed plan for completion of the project.</p><p><strong>Phase 2</strong>  <strong>– Project Execution</strong>: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p><strong>Phase 3 - Outcome:</strong> Report and Presentation: Students will submit a detailed report on the outcomes of the project. Teams will also present this in the last class. Organization representative(s) are invited to attend these presentations.</p><ul><li>A 20 minute presentation</li><li>A 10-15 page executive summary</li></ul>',1,NULL,'2017-06-22 14:31:41','2017-07-27 03:02:26','<p><strong>Past project examples include but are not limited to:</strong></p><ul><li>How to increase employee diversity at your high tech company.</li><li>How to break down silos and leverage areas of expertise at your professional service firm.</li><li>How to address an issue of concern between your business and the community.</li><li>How to integrate organizational control functions (risk management, compliance, and audit.)</li><li>How to collaborate with clients to turn ideas and needs into products and services.</li></ul>',5,'MBA',0,NULL,'anywhere',NULL),(556,22,'published','Customer Research - Online Survey with Analysis',NULL,'Mark 210','Marketing Research',35,2016,'fall','<p>You have have a decision to make, and lack the customer-data you need.</p><p>A team of five business students conduct online market research to help solve your real-life business problem.</p>','group','2017-09-07','2017-11-30',50,NULL,'<p>Students will deliver fresh, actionable insight from extensive data analysis. </p><p></p><p>A concise summary report highlighting the main findings, with options and recommendations.  </p><p></p><p>An electronic copy of the raw data, complete with student analysis. </p><p></p><p>You’ll be able to see exactly how the data was analyzed, and why your student-team reached their conclusions. You’ll even be able to conduct further analysis as you wish.</p>',7,NULL,'2017-06-22 20:46:51','2017-08-09 21:41:34','<p>Your organization has decisions to make, and needs current customer data.</p><p></p><p>A team of five business students conduct market research to help solve your real-life business problem.  The process takes three to four months, as follows:</p><p></p><p>1.  Based on your needs, students design an online survey with expert oversight.</p><p>2.  You send a link to your customers.</p><p>3.  The student team analyzes the results and develops options for solving your problem.</p><p></p><p><strong>Potential project scopes include, but are not limited to</strong>: </p><ul><li>Improving customer acquisition/retention</li><li>Identifying market expansion opportunities</li><li>Market segmentation analysis</li><li>Receiving feedback on a new or existing product/service, etc.</li></ul>',5,'2nd, 3rd, and 4th year students with backgrounds in Marketing and HR',0,NULL,'anywhere',NULL),(557,86,'published','MBA Client Innovation Consulting',NULL,'MBA 730','Innovate',50,2017,'fall','<p>A class of MBA students will analyze a challenge currently affecting your organization, and develop a creative solution that leverages your business’s existing skill-set.</p>','group','2017-09-06','2017-12-20',20,NULL,'<ul><li>A 20 minute presentation</li><li>A 10 - 15 page executive summary</li></ul>',1,NULL,'2017-06-23 12:57:00','2017-08-21 22:22:57','<p>Starting in September a MBA class studying innovation will tackle the challenge your company is facing.  You’ll receive an objective look at one of your internal problems and receive recommendations for moving forward.</p><p></p><p>A shifting regulatory environment means business leaders need to take an innovative approach to problem-solving. Groups of five will work together to develop business solutions with these shifts in mind, paying special attention to information technology.</p><p></p><p><strong>Project examples could include, but are not limited to:</strong></p><ul><li>Autonomous vehicles in the auto industry</li><li>Intergrating products into smart cities </li><li>Daily fantasy sports</li></ul>',5,'MBA',1,NULL,'regional',NULL),(558,268,'published','Market Research',NULL,'BUAD 321','Market Research',5,2016,'fall','<p>Students will generate tangible consumer insights relevant to your organization&#x27;s brand through primary and secondary market research data. Primary data will focus on online surveys (but not be limited to them).</p>','group','2017-09-07','2017-12-05',20,NULL,'<p><strong>You can expect the following deliverables:</strong></p><ul><li>15-20 minute oral presentation outlining findings and analysis</li><li>Final report detailing methods used to generate the data, insights, and recommended actions based on the analysis</li></ul>',1,NULL,'2017-06-23 15:15:28','2017-08-30 00:19:34','<p>Starting this September, a team of five students will dedicate 100+ hours throughout the entire semester to synthesize information and data-both existing (provided by you) and collected themselves-and draw conclusions.</p><p></p><p><strong>Resulting customer insights could include:</strong></p><ul><li>Understanding what triggers consumer actions when switching to other brands or substitute categories.</li><li>Understanding why consumers care about your brand and how to increase brand loyalty.</li><li>Understanding what desires and motivations your customers have to increase retention, etc. </li><li>Understanding consumer perception of competing brands or substitute category brands.</li></ul>',5,'3rd & 4th year',0,NULL,'anywhere',NULL),(559,67,'published','Project Management','Business','MGMT 3011','Real Life Project Management',10,2016,'fall','<p>Do you have a project that needs to be coordinated between Sept-Dec 2017? A George Brown project management student can manage this for you!</p>','individual','2017-09-11','2017-12-15',100,NULL,'<p> Each student project manager will <u><strong>devote at least 100 hours to your project</strong></u>, specifically the student will:</p><ul><li>Create a Project Charter</li><li>Create a Project Plan, including a Project Budget</li><li>Prepare Status Reports</li><li>Set up Project Management Tools to increase Virtual Collaboration effectiveness</li></ul>',6,NULL,'2017-06-23 15:20:20','2017-08-04 15:25:03','<p>1-2 George Brown Project Management students will spend the September-December period doing at least 100 hours of project management work on a project of your choosing. This includes project planning and preparation, and coordinating work effort.</p><p></p><p> <strong>Successful projects in the past have included</strong>:</p><ul><li>Improve the volume and quality of a database, and how it&#x27;s used</li><li>Social Media Marketing Campaign with content plan for a year (note, students can work on marketing related projects but there should still be a project management focus)</li><li>A new product launch</li><li>Creating an annual event or attending an upcoming one (tradeshows, conferences) </li><li>Stakeholder mapping</li><li>Development of a new website</li></ul><p></p>',1,'3rd year',1,NULL,'local',NULL),(560,74,'review','Organization Project Plan','Business','BUS 5003','Project Management',50,2017,'fall','<p>A group of student-consultants will develop a thorough Project Management Plan for a project of your choosing. </p>','group','2017-09-05','2017-12-05',80,NULL,'<p>The student group will submit a <u><strong>written project plan</strong></u>, as well as <u><strong>formally present their project</strong></u> to the industry partner (in person or virtually). </p>',10,NULL,'2017-06-23 18:05:23','2017-06-23 18:07:31','<p>A group of student-consultants will develop a thorough Project Management Plan for a project of your choosing.   Using Project Management Theory, students will put together a thorough breakdown of a future project for your organization, including project requirements, schedule and responsibilities.  </p><p></p><p>Examples of projects have included, but are not limited to:</p><ul><li><strong>Development of a new website</strong></li><li><strong>Implementation of a new software or system</strong></li><li><strong>Business process change</strong></li><li><strong>Office relocation</strong></li><li><strong>Rebranding project or implementation of new logo</strong></li><li><strong>New product/service launch </strong></li><li><strong>Evaluation of new technology or suppliers</strong></li></ul>',6,'Graduate certificate program',0,NULL,'anywhere',NULL),(561,433,'review','Wordpress Website Development',NULL,'UIFT','Web Development Professional',16,2017,'fall','<p>This assignment involves working with UX, UI and Web Dev students for a period of 6 weeks with the end goal of building through Wordpress a website that was designed by RED students. </p>','group','2017-11-14','2017-12-01',100,NULL,'<p>Hand over deliverables include:</p><ul><li>Research data</li><li>Clickable prototype</li><li>Wireframes</li><li>Visual designs (icons, branding etc.)</li><li>Information architecture</li><li>20 minute presentation showcasing both UX and UI processes and results</li><li>A case study that walks the reader through your design process</li></ul>',1,NULL,'2017-06-23 18:35:12','2017-06-23 18:41:03','<p><strong>User Experience</strong></p><ul><li>Research (Organizational/domain/user/competitive comparative etc.)</li><li>Planning of design sprint (information architecture, data analysis, brainstorming etc.)</li><li>Design (wireframes, prototypes etc)</li><li>Testing (user testing, iterating)</li><li>Presentation ( final presentation to community partner on the work done throughout the 3 week sprint)</li></ul><p><strong>User Interface</strong></p><ul><li>Research Research (Organizational/domain/user/competitive comparative etc.)</li><li>Design inceptions, moodboards, art direction</li><li>Design Hi-fidelity mockups from wireframes</li><li>User interface elements (icons, graphics, visual elements)</li><li>Brand Assets (logo, style guides, style tiles)</li><li>Presentation ( final presentation to community partner on the work done throughout the 3 week sprint)</li></ul>',5,'Post Graduate',0,NULL,'anywhere',NULL),(562,59,'review','B2B Sales Management Plan',NULL,'MARK 4410','Sales Management',50,2016,'fall','<p>A group of four to six Sales Management student consultants will conduct an analysis and provide actionable recommendations for improving or scaling up your organization&#x27;s existing sales force plan.  </p>','group','2017-09-12','2017-12-06',50,NULL,'<p>Students will work to develop a professional sales management plan (less than 25 pages) that could include a two<strong>-</strong>year sales plan, budgets, forecasts, recruiting plans, as well as their approach to co-ordinating with other departments such as marketing. Students will also present a 7 to 10-minute summary of their plan which will be followed by a Q&amp;A period.</p>',5,NULL,'2017-06-23 20:16:15','2017-06-23 20:17:04','<p>A group of four to six Sales Management student consultants will conduct an analysis and provide actionable recommendations for improving or scaling up your organization&#x27;s existing sales force plan.  Potential project scopes can include, but are not limited to;</p><ul><li><strong>audit of existing sales strategy</strong></li><li><strong>how to scale up to reach your sales targets</strong></li><li><strong>workforce planning for your sales team</strong></li><li><strong>researching and identifying the right sales tools</strong></li><li><strong>developing competitive sales compensation packages, etc.</strong></li></ul>',4,'3rd Year',0,NULL,'anywhere',NULL),(563,86,'published','Strategic Network Development',NULL,'MBA 710','Understanding World Class Clusters',50,2016,'fall','<p>Groups of MBA students will help your company stay competitive and engaged in the Boston area.</p>','group','2017-09-14','2017-11-30',200,NULL,'<p>The project deliverables include: </p><ul><li>A 15 minute presentation</li><li>Powerpoint slides</li><li>Written report (requested)</li></ul>',2,NULL,'2017-06-23 22:20:36','2017-08-29 17:39:19','<p>Groups of MBA students will act as consultants to your organization to help you build your community relations in Boston. The students will examine the social context of your industry within the Boston area and develop a strategy based on best practices and research.</p><p>Areas of focus include, but are not limited to:</p><ul><li>Improving your company&#x27;s visibility, competitiveness, social standing, etc.</li><li>How to play a more useful role in the Boston area, particularly in leading industries like high tech and finance</li><li>Bringing your business into the Boston area</li><li>Identification and management of local stakeholders for a construction project (new or refurbishment)—residential building; office building; factory; transport infrastructure (bridges, roads); utilities (power plant, transmission line, pipeline, water main, sewage line or treatment plant)</li><li>Key innovation networks and means of access to these networks for a company from outside the area in a technologically dynamic industry—IT, health care, biotech</li><li>Investment and mentoring networks for a startup company</li><li>Customer and regulatory relations for a foreign company offering products to Boston-based small and medium entrepreneurial companies—e.g. for a European supplier of analytical software for the biotech industry, or for a Taiwanese supplier of advanced materials for the cleantech sector</li></ul>',5,'MBA',0,NULL,'regional',NULL),(564,59,'published','Sales Support Tools & Prospecting - (Sales Resource Manual)',NULL,'MARK 2150',' Personal Selling ',50,2016,'fall','<p>Could your organization benefit by improving your sales pipeline by identifying qualified sales prospects, and enhancing your internal sales processes? This semester sales students will help your B2B company build or update a Sales Resource Manual.</p>','group','2017-09-20','2017-11-29',30,NULL,'<p>Project Deliverables include:</p><p></p><p><strong>Student led portion of the Sales Resource Manual will highlight:</strong></p><ul><li>Prospecting sources</li><li>Needs discovery analysis &amp; questions</li><li>Demonstration step by step</li><li>Primary objections and how to deal with them</li><li>Suggested closing techniques</li><li>Servicing the sale suggestions</li><li>Sales journey map (from sales persons perspective)</li><li>Social selling review</li><li>List of 25 prospects (min.) that fit your ideal customer profile</li></ul><p><strong>Host company to provide the following prior to classroom meeting:</strong></p><ul><li><strong>Company Information </strong>- including history including the catalyst for starting the business, what differentiates the company in the marketplace from its competitors, organizational structure, financial goals for the next one to two years</li><li><strong>Product/Service Description</strong> - history if relevant, how has product evolved if relevant, three primary features and associated benefits, pricing strategy, current distribution channels, is it a seasonal product, other discounts.   Students will focus on one product/service line and apply concepts from the classroom to this.  Host company can adjust the final document afterwards.</li><li><strong>Competition</strong> - provide details on three primary competitors.  List three main strengths and weaknesses of their product/service that competes directly with yours.</li><li><strong>Customer Journey Map </strong>- an outline of the typical path of steps a prospect would follow when looking for a new supplier of a product or service like yours.  From initial contact to becoming a loyal customer.  What staff are involved (touch points) guiding prospects through this process.  A list of steps or a flowchart and explanations where helpful.  </li></ul><p></p>',4,NULL,'2017-06-23 22:34:00','2017-08-29 00:39:48','<p>Starting in September, up to five groups of three to five sales students will compete to analyse your existing sales resources and related systems, and update/develop a new Sales Resource Manual.  These teams will then work with you to build a list of 25 qualified sales prospects and potentially make sales calls; based on student willingness and host company approval.</p><p></p><p>After reviewing the team submissions, the winning team will be picked and prize to be provided by the professor.  </p><p></p><p></p>',4,'2nd Year (out of 2 year Marketing Diploma)',0,NULL,'local',NULL),(565,59,'review','Professional Sales',NULL,'MARK 4390','Professional Sales',50,NULL,'fall','<p>Students work with your organization from the start to finish of a full sales situation, where they will make prospecting/sales calls, build out sales systems, and more.</p>','group',NULL,NULL,NULL,NULL,'',1,NULL,'2017-06-23 23:12:58','2017-06-23 23:16:32','',3,'Varied',0,NULL,'anywhere',NULL),(566,433,'published','Wordpress Website Design ',NULL,'UXUIP-f17','Web Design & Development Professional',30,2017,'fall','<p>This assignment involves working with UX, UI and Web Dev students, who will spend 100 hours each throughout an intensive period, with the end goal of building through Wordpress a website that was designed by RED students. </p>','group','2017-11-14','2017-12-01',100,NULL,'<p>Hand over deliverables include:</p><ul><li>Research data</li><li>Clickable prototype</li><li>Wireframes</li><li>Visual designs (icons, branding etc.)</li><li>Information architecture</li><li>30 minute presentation showcasing both UX and UI processes and results</li><li>A case study that walks the reader through your design process</li></ul>',10,NULL,'2017-06-24 00:00:14','2017-08-09 22:49:38','<p><strong>Project Examples include, but are not limited to:</strong></p><p></p><p><strong>User Experience</strong></p><ul><li>Research (Organizational/domain/user/competitive comparative etc.)</li><li>Planning of design sprint (information architecture, data analysis, brainstorming etc.)</li><li>Design (wireframes, prototypes etc)</li><li>Testing (user testing, iterating)</li><li>Presentation ( final presentation to community partner on the work done throughout the 3 week sprint)</li></ul><p><strong>User Interface</strong></p><ul><li>Research Research (Organizational/domain/user/competitive comparative etc.)</li><li>Design inceptions, moodboards, art direction</li><li>Design Hi-fidelity mockups from wireframes</li><li>User interface elements (icons, graphics, visual elements)</li><li>Brand Assets (logo, style guides, style tiles)</li><li>Presentation ( final presentation to community partner on the work done throughout the 3 week sprint)</li></ul>',5,'Post Graduate',0,NULL,'local',NULL),(567,433,'published','Mobile App Design and Clickable Prototype',NULL,'UXUIP-s17','UX/UI Design',30,2017,'summer','<p>Students will design a mobile application applying user experience and user interface techniques over 3 weeks. At the end of this 3 week sprint, a minimum viable product will be designed.</p>','group','2017-07-12','2017-08-11',100,NULL,'<p>A clickable prototype ready to be use for development by developers. </p><ul><li>Hand over deliverables include:</li><li>Research data</li><li>Clickable prototype</li><li>Wireframes</li><li>Visual designs (icons, branding etc.)</li><li>Information architecture</li></ul>',2,NULL,'2017-06-24 00:17:09','2017-07-12 14:22:15','<p><strong>User Experience</strong></p><ul><li>Research ( Organizational / domain / user / competitive comparative etc.)</li><li>Planning of design sprint (information architecture, data analysis, brainstorming etc.)</li><li>Design (wireframes, prototypes etc)</li><li>Testing (user testing, iterating)</li><li>Presentation ( final presentation to community partner on the work done throughout the 3 week sprint)</li></ul><p><strong>User Interface</strong></p><ul><li>Research Research ( Organizational / domain / user / competitive comparative etc.)</li><li>Design inceptions, moodboards, art direction</li><li>Design Hi-fidelity mockups from wireframes</li><li>User interface elements (icons, graphics, visual elements)</li><li>Brand Identity (logo, branding etc.)</li><li>Presentation ( final presentation to community partner on the work done throughout the 3 week sprint)</li></ul>',5,'post-grad',1,NULL,'local',NULL),(568,433,'published','Mobile App Design Minimum Viable Product',NULL,'UXUIP-f17','UX/UI Design',16,2017,'fall','<p>Students will design a mobile application applying user experience and user interface techniques over 3 weeks. At the end of this 3 week sprint, a minimum viable product will be designed.</p>','group','2017-10-24','2017-11-10',100,NULL,'<p>A clickable prototype ready to be use for development by developers. </p><p>Hand over deliverables include:</p><p>Research data</p><p>Clickable prototype</p><p>Wireframes</p><p>Visual designs (icons, branding etc.)</p><p>Information architecture</p>',1,NULL,'2017-06-24 01:06:10','2017-07-20 19:18:23','<p><strong>User Experience</strong></p><ul><li>Research ( Organizational/domain/user/competitive comparative etc.)</li><li>Planning of design sprint (information architecture, data analysis, brainstorming etc.)</li><li>Design (wireframes, prototypes etc)</li><li>Testing (user testing, iterating)</li><li>Presentation ( final presentation to community partner on the work done throughout the 3 week sprint)</li></ul><p><strong>User Interface</strong></p><ul><li>Research Research ( Organizational/domain/user/competitive comparative etc.)</li><li>Design inceptions, moodboards, art direction</li><li>Design Hi-fidelity mockups from wireframes</li><li>User interface elements (icons, graphics, visual elements)</li><li>Brand Identity (logo, branding etc.)</li><li>Presentation ( final presentation to community partner on the work done throughout the 3 week sprint)</li></ul>',5,'post-grad',0,NULL,'anywhere',NULL),(569,200,'published','MBA Strategy Consulting',NULL,'MAN 6679','Masters of International Businss Consultancy Projects Course',40,2017,'fall','<p>Students will conduct a research, analyze their findings, and provide practical, go-forward recommendations to benefit your business.</p>','group','2017-09-04','2017-12-01',20,NULL,'<p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to devise the project scope and prepare a  detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome - Report and Presentation: Students will submit a detailed report on the outcomes of the project. Teams will also present this in the last class. Organization representative(s) are invited to attend these presentations. Deliverable details:</p><ul><li>A final report with details of research, analysis, findings, and recommendations</li><li>A final presentation to company executives (either in person or via virtual meeting)</li></ul>',6,NULL,'2017-06-24 06:59:48','2017-08-30 21:10:57','<p>Master&#x27;s level student-consultants will conduct an assessment of an area of your organization that you are looking to analyze and potentially restructure, in an effort to establish new efficiencies. </p><p></p><p>This assignment is perfect for those looking for an unbiased assessment about the state of your organization, and opportunities you can apply moving forward.</p><p></p><p><strong>Students will conduct:</strong></p><ul><li>A SWOT analysis</li><li>A competitive analysis</li><li>A country-based expansion analysis</li><li>A customer feedback/brand perception analysis</li></ul>',5,'Master\'s ',1,NULL,'anywhere',NULL),(570,433,'published','Wordpress Website Design ',NULL,'UXUIP-s17','Wordpress Website Design',30,2017,'summer','<p>This assignment involves working with UX, UI and Web Dev students for a period of 6 weeks with the end goal of building through Wordpress a website that was designed by RED students. </p>','group','2017-08-15','2017-09-01',100,NULL,'<p>Hand over deliverables include:</p><ul><li>Research data</li><li>Clickable prototype</li><li>Wireframes</li><li>Visual designs (icons, branding etc.)</li><li>Information architecture</li><li>30 minute presentation showcasing both UX and UI processes and results</li><li>A case study that walks the reader through your design process</li></ul>',2,NULL,'2017-06-24 19:59:27','2017-07-12 18:25:13','<p><strong>User Experience</strong></p><ul><li>Research (Organizational/domain/user/competitive comparative etc.)</li><li>Planning of design sprint (information architecture, data analysis, brainstorming etc.)</li><li>Design (wireframes, prototypes etc)</li><li>Testing (user testing, iterating)</li><li>Presentation ( final presentation to community partner on the work done throughout the 3 week sprint)</li></ul><p><strong>User Interface</strong></p><ul><li>Research Research (Organizational/domain/user/competitive comparative etc.)</li><li>Design inceptions, moodboards, art direction</li><li>Design Hi-fidelity mockups from wireframes</li><li>User interface elements (icons, graphics, visual elements)</li><li>Brand Assets (logo, style guides, style tiles)</li><li>Presentation ( final presentation to community partner on the work done throughout the 3 week sprint)</li></ul>',3,'Post Graduate',1,NULL,'local',NULL),(571,433,'published','UX Design: Capstone Project',NULL,'UXP-s17','UX Design Professional',30,2017,'summer','<p>This assignment involves the full User Experience Design process. Researching, wire framing, design, and testing, producing a mid to high fidelity prototype for a website or app. </p>','group','2017-09-05','2017-09-21',70,NULL,'<p> </p><ul><li>30 minute presentation on their findings and recommendations</li><li>Case study report</li><li>Mid to high fidelity prototype</li></ul>',1,NULL,'2017-06-24 20:12:35','2017-07-07 23:06:08','<p>Professional students will endeavour to understand the company&#x27;s business goals, conduct research and consumer surveying to best understand the needs of the target audience and from this create a website or app layout and design that achieves those goals. The students will:</p><ul><li>Conduct an in person kickoff meeting with the client</li><li>Interview users so we can design a specific solution for them</li><li>Conduct user testing </li><li>Apply design thinking practices and methodologies</li><li>Create a mid to high fidelity prototype </li></ul><p></p><ul><li>Optimizing a specific part of an existing product</li><li>Creating a project from scratch </li><li>Update and refresh an existing website or app </li><li>Content (Copy) needed prior to project kickoff</li></ul><p></p>',3,'Post Graduate',1,NULL,'anywhere',NULL),(572,65,'published','Food Science Research and Experimentation',NULL,'FNH425','Food Science Laboratory III',30,2017,'fall','<p>Students will spend over 200 hours on research and experimentation, to solve a specific objective set out by the food, supplement, or drink producer.</p>','group','2017-09-08','2018-04-01',200,NULL,'<ul><li>10+ page final document</li><li>Proposal report</li><li>Bi weekly update reports</li><li>Two oral presentations</li></ul>',6,NULL,'2017-06-25 01:36:18','2017-08-21 19:44:57','<p>Students will work in groups of 4 or 5 to develop a research proposal to solve a specific objective set out by the food, supplement, or drink producer. Students develop hypotheses, perform a literature review, devise an experimental plan, and then execute experiments followed by data analyses, all the while being supported with expertise from faculty supervisors and the research facilities of the school. </p><p></p><p>Prior to starting their experiments, students will develop and submit a budget that has been approved by their industry sponsor. </p><p></p><p><strong>This project will run over <em>two</em> semesters:</strong></p><ul><li>In the first semester of the course students will become acquainted with their company and faculty supervisors and submit a proposal report that is accompanied by an oral presentation.</li><li>During the second semester students will execute their experimental plans leading to a final written report and oral presentation of their results.</li></ul><p><strong>Past examples have included: </strong></p><ul><li>Different pre-treatments of the cacao bean in order to lower the amount of acetic acid (bad for chocolate) to find out which would be the fastest and least expensive</li><li>Starch gelatinization affects on the staling of bread</li><li>How fermentation temperature affects a specific grape in order to produce the highest quality of wine</li></ul>',5,'4th Year',1,NULL,'regional',NULL),(573,444,'published','Business Data Analytics and Insightful Visualization',NULL,'INFO 440','Fundamental Data Analysis and Visualization',24,2017,'fall','<p>A team of students will review and analyze your company&#x27;s data project, create goals, leverage data analytics to spot trends and relationships, and build effective, insightful visualizations.</p>','group','2017-09-05','2017-12-21',18,NULL,'<p>At project completion, you’ll receive:</p><ul><li>A 10-12 page document outlining the analysis and findings/recommendations for the business data project.</li><li>A Powerpoint or Tableau Storypoint presentation of the students’ approach, results, and actionable recommendations.</li></ul>',3,NULL,'2017-06-25 18:22:44','2017-08-29 17:17:04','<p>This project can help your business make better decisions based on data.</p><p></p><p>A group of four 3rd year student consultants will spend a semester (~14 weeks) solving a business data analytics challenge that is currently affecting your business. The group will set goals using the SMART method and orient the subsequent project based on the objectives identified. They will apply quantitative tools to analyze hidden trends and patterns towards informed decision making. They will convey findings using effective and interactive data visualization methods.</p><p></p><p></p><p>Past work examples include:</p><ul><li>Determining house sale prices in neighborhoods based on structural features.</li><li>Establishing the hospital discharge and outcome probability of patients admitted to ICUs using data mining.</li><li>Predicting determinant variables and patterns that influence auto accidents in NYC.</li><li>Structuring ad revenue pricing for online media sites based on article shares.</li><li>Strategies for maximizing value of AirBnb rentals by identifying predictive factors.</li></ul>',4,'3rd year Undergraduate',1,NULL,'regional',NULL),(574,10,'published','HR Audit & Recommendations',NULL,'BUS 484','Employment Systems',20,2016,'fall','<p>Students will <strong>audit, analyze, research, and then provide actionable recommendations</strong> on a specific employment system that you feel could use some upgrading.</p>','group','2017-09-07','2017-11-30',30,NULL,'<p>Each group of student-consultants will spend <strong><u>120 hours for your organization</u></strong> to provide actionable recommendations of the employment system of your choice. </p><p></p><p>If the recommendations include changes to strategy, policy, or practices, <strong><u>the +10 page document they submit will include how they will be implemented and maintained</u></strong>. </p>',5,NULL,'2017-06-25 20:03:05','2017-08-04 21:38:02','<p>Fourth-year business students will conduct an audit of a particular employment system of your choosing. Based on your goals and input, the students will review, analyze and provide actionable recommendations for improvement. </p><p></p><p>Students will bring an outside perspective and up-to-date knowledge on HR best practices to your business to allow you to improve employee satisfaction and efficiency, and reduce risk.</p><p></p><p>Project examples can include:</p><ul><li>Training &amp; Development Programs (excluding Recruitment)</li><li>Employee Retention</li><li>Use of Contingent Workers</li><li>Union-Management Relations</li><li>Health &amp; Safety Processes</li><li>Organizational Culture Plan</li><li>Organizational Structure Audit and Review</li><li>Attendance Management</li></ul>',4,'4th Year',0,NULL,'local',NULL),(575,10,'review','Strategic Marketing Issue',NULL,'BUS 446','Marketing Strategy',35,2017,'fall','<p>Students will perform strategic marketing analyses on your marketing problem to explore and identify opportunities and make recommendations.</p>','group','2017-09-06','2017-12-01',120,NULL,'<p>The student groups will <u><strong>submit a written report detailing their strategic marketing analysis.</strong></u> Proprietary company information remains confidential at all times. </p>',8,NULL,'2017-06-26 22:16:18','2017-06-26 22:23:02','<p>A group of 3-4 students will prepare a comprehensive strategic marketing plan (Situational Analysis, Segmenting, Targeting, Positioning, 4Ps, Outcomes) to address your marketing. They will conduct comprehensive  research, analyze the issue, and provide actionable recommendations.  Project scope can include, but are not limited to: </p><ul><li><strong>New Product Marketing Plan</strong></li><li><strong>Positioning Strategy</strong></li><li><strong>Aligning Marketing Program </strong></li><li><strong>Market Segmentation &amp; Targeting</strong></li><li><strong>Marketing Audit &amp; Recommendations</strong></li><li><strong>Competitor or Consumer Analysis</strong></li></ul>',4,'4th Year',0,NULL,'anywhere',NULL),(576,NULL,'draft','Sponsors choose the projects ',NULL,'I.E. 495','Industrial engineering  Senior design capstone project ',15,2017,'fall','<p>ABC</p>','individual',NULL,NULL,NULL,NULL,'',1,NULL,'2017-06-27 16:03:18','2017-07-14 17:22:49','',1,'Seniors',0,NULL,'anywhere',NULL),(577,461,'published','Supply Chain Optimization',NULL,'BZAN566','Systems Optimization',12,2017,'fall','<p>If you’re looking to optimize the costs of your suppliers, apply for this assignment to have a group of students create an optimization model for your business.</p>','group','2017-09-05','2017-10-31',20,NULL,'<p>You can expect the following deliverables:</p><ul><li>An Excel spreadsheet with the optimization model.</li><li>A short report explaining how the model was created and how to use it.</li></ul>',1,NULL,'2017-06-27 18:54:47','2017-08-22 21:00:25','<p>Following this project, you should be able to reliably select the suppliers with the lowest costs.</p><p></p><p>A group of four 2nd year Masters students in Business Analytics will apply their knowledge in the following areas:</p><ul><li>Quantity discount and incremental discount supply contracts.</li><li>Building an optimization model with the objective of minimizing supply costs.</li></ul>',4,'2nd year Masters students',0,NULL,'anywhere',NULL),(578,89,'draft','Professional Training',NULL,'Senior Project','Advanced Organizational Communication',20,2017,'fall','<p>As a senior capstone project, students will review your existing training materials, create a needs assessment, develop new training materials, and design and conduct a training seminar. </p>','group','2017-11-01','2018-04-10',80,NULL,'<ul><li>Needs assessment</li><li>Project proposal</li><li>Training materials</li><li>Delivery of a training session</li></ul>',1,NULL,'2017-06-27 18:56:17','2017-07-26 21:38:07','<p>Working individually or in groups, senior students will work to revamp a training module for your organization, with your guidance and input. Students will conduct a needs assessment and provide you with a training proposal describing the training session they&#x27;d like to create, and the reasons why.</p><p></p><p>Once your organization has approved their proposal, students will work to create all needed training materials, and design a training seminar. At the end of the project, students will conduct the seminar for the desired audience, and evaluate the outcomes.</p><p></p><p>Possible areas for these students to address include, but are not limited to:</p><ul><li>New hire onboarding</li><li>Intercultural communication</li><li>Conflict management</li></ul>',1,'4th year',0,NULL,'anywhere',NULL),(579,66,'published','Sustainability Challenge',NULL,'BBA-CC','BBA SOLUTIONS',5,2017,'fall','<p>This project is suited to businesses with high aspirations for sustainability and are looking for strategies to boost their social and/or environmental performance to new levels. </p>','group','2017-10-09','2017-12-08',50,NULL,'<p><strong>The final project deliverables will include:</strong></p><p></p><ul><li>A 10 - 20 page report that includes:  a 2-page Executive Summary; an Analysis of the business problem/opportunity; clear, actionable recommendations that include action and resource plans; and, a budget</li><li>A 20-minute presentation highlighting the key findings and recommendations</li></ul>',2,NULL,'2017-06-27 22:37:17','2017-07-10 17:42:11','<p>Small teams will consult with businesses over a two-month period to analyse sustainability performance and opportunities, and provide businesses with recommendations for improvement.  Depending on business needs and priorities, the broad goals of the project might include (but are not limited to) the following:</p><p></p><ul><li>Improving the environmental and/or social performance of products, services or processes;</li><li>Identifying opportunities for value co-creation and/or new markets;</li><li>Designing, implementing or improving sustainability management systems;</li><li>Improving stakeholder and community relations</li></ul><p>Preference is given to projects that are complex and multi-dimensional.</p>',5,'4th Year Business & Sustainability students',0,NULL,'anywhere',NULL),(580,66,'draft','Sustainability Challenge',NULL,'BBA-CC','BBA SOLUTIONS',5,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-06-28 15:43:14','2017-06-28 15:43:15',NULL,NULL,'4th Year Business & Sustainability students',0,NULL,NULL,'2017-06-30 17:30:00'),(581,436,'published','ERP System Analysis & Implementation ',NULL,'MSIS 5123','Introduction to Enterprise Resource Planning (ERP)',30,2017,'fall','<p>Masters students studying MIS or Industrial Engineering will study any aspect of your ERP lifecycle or any technical/business issues in enterprise integration and process mapping.</p><p></p>','group','2017-08-31','2017-12-10',30,NULL,'<p><strong>Project deliverables include:</strong></p><ul><li>10-page final report summarizing all work done over the semester </li><li>In-class presentation</li></ul>',4,NULL,'2017-06-29 17:43:55','2017-08-02 23:43:25','<p>In groups of 3, Masters students (majoring in MIS or Industrial Engineering) will analyze a practical ERP or information integration problem faced by your organization. Students can map business processes, help collect data and make potential recommendations to solve this problem or capture an opportunity. </p><p></p><p><strong>Project examples can include, but are not limited to:</strong></p><ul><li>Analysis of an aspect of your ERP lifecycle</li><li>Analysis of any technical/business issues in enterprise integration and process mapping</li><li>Analysis of issues in change management</li></ul>',3,'Masters',0,NULL,'anywhere',NULL),(582,439,'published','Marketing Consultancy & Graphic Design',NULL,'BUS 267','Marketing Special Projects',10,2017,'fall','<p>Students will work with your organization to improve your marketing strategy and/or graphic design work using the human-centered design model used at Stanford&#x27;s d.school. </p>','group','2017-09-18','2017-12-06',35,NULL,'<p><strong>The final project deliverables are:</strong></p><ul><li>Report on consumer insights gained and methods used</li><li>An electronic presentation containing prototype examples of potential solutions</li></ul>',2,NULL,'2017-06-29 20:53:43','2017-08-15 23:56:29','<p>A group of students will work with your organization to analyze your marketing strategy and design process, taking into account consumer behavior and preferences, to make recommendations for improvements.</p><p></p><p><strong>Project examples may include but are not limited to:</strong></p><ul><li>Improving company branding by creating new marketing and promotional materials.</li><li>Suggesting improvements for your current marketing strategy.</li><li>Analyzing current marketing materials and redesigning them.</li><li>Improving online communications and key messaging.</li><li>Promoting a new product/service launch</li></ul>',4,'2nd year',0,NULL,'anywhere',NULL),(583,461,'published','Budgeting for Major Expenditures',NULL,'FINC 455','Advanced Corporate Financial Management',90,2017,'fall','<p>Students will perform a capital budgeting analysis of a project to help you evaluate if a major capital expenditure is a good idea for your organization. </p>','group','2017-09-05','2017-09-29',10,NULL,'<ul><li>An Excel spreadsheet with the cash flow estimates, net present value calculations, and sensitivity analysis calculations.</li><li>A written report that discusses the strategic issues associated with the project including firm constraints (including capital constraints) and externalities. The document will provide the students recommendation, based on the analysis they&#x27;ve done.</li></ul>',1,NULL,'2017-06-29 23:58:55','2017-07-20 20:04:09','<p>In groups of 4 or 5, students will evaluate a capital budgeting project for your organization. If you are considering making a major, long-term investment in a particular area, finance students can help you make an informed business decision. </p><p></p><p>The topic the students analyze can include, but is not limited to, large projects such as:</p><ul><li>Investing in new machinery for a factory</li><li>Upgrading your office/workplace facilities</li><li>Beginning a major research and development project</li><li>Expanding your manufacturing capacity</li><li>Altering your pricing strategy</li></ul><p>The students&#x27; work will include two major components: financial analysis, and strategic analysis.</p><p></p><p>On the financial analysis side, they will estimate project cash flows and calculate net present value, internal rate of return, and payback to help you evaluate if a project is financially viable.</p><p></p><p>From a strategic perspective, they will evaluate the project&#x27;s fit with and risk to the company. They will also identify externalities that may be incompletely reflected in the cash flow estimation such as capital constraints, staffing constraints, cannibalization, and potential synergies between the project and the firm&#x27;s existing product mix. </p><p></p><p>Their final report will be provided to your business to give you new insights into the project you&#x27;re considering.</p><p></p>',4,'Seniors, majoring in finance',0,NULL,'anywhere',NULL),(584,NULL,'review','Cost of capital estimation',NULL,'FINC 455','Advanced Corporate Financial Management',90,2017,'fall','<p>Students will calculate the cost of capital for a company.</p>','group','2017-08-29','2017-09-29',10,NULL,'<p>1. An Excel spreadsheet that has all of the calculations.</p><p>2. A Word document 5 page or less report that details the important assumptions in the calculations and the conclusions. </p>',1,NULL,'2017-06-30 01:03:34','2017-06-30 01:10:02','<p>Students will calculate a cost of capital for the company that can be used in project evaluation, compensation, Economic Value Added calculations, and value-based management models. </p>',4,'Seniors. 4th year finance majors',0,NULL,'anywhere',NULL),(585,NULL,'review','Value-based management model',NULL,'FINC 455','Advanced Corporate Financial Management',90,2017,'fall','<p>Students will create an Excel-based value-based management model for the firm.</p>','group','2017-10-01','2017-11-01',15,NULL,'<p>Deliverables will be </p><p>1. An Excel model of the firm&#x27;s value. </p><p>2. An analysis of the firm&#x27;s value drivers. (Word document)</p><p>3. An estimate of the firm&#x27;s value (if it isn&#x27;t publicly traded)</p><p>4. Recommendations for the highest value focus for the firm</p>',1,NULL,'2017-06-30 01:13:13','2017-06-30 01:20:54','<p>In groups of 4, these senior finance majors will construct a value-based management model. This model will incorporate a free cash flow valuation of the firm plus a parametric description of the firm&#x27;s value drivers. Such a model can be used by management to identify the activities that add the most value to the firm.</p>',4,'4th year senior finance majors',0,NULL,'anywhere',NULL),(586,449,'published','Business Consulting & Strategy',NULL,'BADM 199','Business in Action',25,2017,'fall','<p>Advanced undergraduate business students will work throughout the semester to address a challenge or opportunity your organization is currently facing.</p>','group','2017-08-29','2017-12-14',80,NULL,'<p>The final deliverable will be a 30 minute presentation with actionable recommendations about your organization&#x27;s problem based on the research that the team has conducted throughout the semester.</p><p></p><p>You may also receive related deliverables as needed (summary of data &amp; insights in report format, etc.)</p>',5,NULL,'2017-06-30 14:35:21','2017-08-09 16:10:30','<p>Starting at the end of August, a group of student-consultants will dedicate approximately 400 hours, to working alongside your organization in evaluating, researching, and analyzing the implications of a specific challenge or opportunity our business is facing. </p><p></p><p>Every organization encounters significant challenges and opportunities throughout their life cycle. This project is an effective platform to get an unbiased perspective on the state of your business.</p><p></p><p>Working in teams of 5-6, the students can work on a variety of projects. Most importantly, they will address a real challenge where you’d like support. Students can work on projects related to topics such as:</p><ul><li>Strategic planning</li><li>Marketing research and analysis</li><li>Competitive analysis</li><li>Consumer analysis</li><li>Social media analysis</li><li>Financial analysis and forecasting</li><li>Logistics and supply chain</li><li>Organizational growth issues</li><li>Organizational design</li><li>Organizational culture</li></ul>',5,'2nd & 3rd years',0,NULL,'regional',NULL),(587,66,'review','Emotional Intelligence Challenge',NULL,'EXMN - 658','Leading with Emotional Intelligence',0,2016,'fall','<p><strong><u>Are you wanting to integrate Emotional Intelligence into your business, strategically? </u></strong></p><p></p><p>Students will analyze your challenge at hand and present actionable recommendations that you can use.</p><p></p>','group','2017-09-20','2017-10-20',100,NULL,'<p>These MBA students average about 8 years of experience behind them and submit a <u><strong>6-page paper that apply the EI model, constructs, and practices</strong></u>. They follow that up with a <u><strong>10-minute online presentation of their recommendations</strong></u>.</p>',1,NULL,'2017-06-30 21:06:29','2017-06-30 21:15:25','<p>Are you wanting to <strong><u>integrate Emotional Intelligence into your business, strategically</u></strong>? For instance: </p><ul><li>Better bargaining during union negotations </li><li>Better stress management for your employees</li><li>Enhance decision making during a crisis </li><li>Develop interpersonal skills of your IT staff who are being groomed for leadership roles. </li></ul><p>Three groups of <strong><u>5 students each will analyze your challenge at hand and present 2-3 actionable recommendations</u></strong> that you can use. </p>',5,'4th Year ',0,NULL,'anywhere',NULL),(588,66,'published',' Competitive Advantages Through Diversity & Inclusivity ',NULL,'STNL 422','Leading Organizations',31,2016,'fall','<p>As new generations enter the workforce and disruption happening all around us, the diversity of your team will be a critical competitive advantage. Gain insights into how your organization can leverage a diversity strategy.</p>','group','2017-09-25','2017-11-15',50,NULL,'<p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to devise the project scope and prepare a detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome - Report and Presentation: Students will submit a detailed report on the outcomes of the project. Teams will also present this in the last class. Organization representative(s) are invited to attend these presentations.</p><ul><li>10-minute presentation followed by Q&amp;A </li><li>6-page comprehensive report on their analysis and recommendations </li></ul>',1,NULL,'2017-06-30 21:15:38','2017-08-04 21:43:42','<p>After thorough research and a collaborative analysis of your organization student consultants will provide insights and actionable recommendations towards a diversity strategy for your organization.<br/></p><p><strong>Project examples include, but are not limited to:</strong></p><ul><li>Enhancing collaboration and decision making of virtual teams who operate in multiple countries.</li><li>Creating unity in a multi-generational workplace (Baby Boomers, Generation X and Millennials).</li><li>Establishing gender parity in succession planning/ talent management.</li><li>Developing a diversity management training program for the leadership team.</li><li>Create a climate of inclusivity in a unionized workplace.</li><li>Integrating diversity-sensitive language and practices in HR functionalities, such as recruitment, selection, training, compensation, and performance management.</li></ul>',5,'3rd year ',0,NULL,'local',NULL),(589,237,'published','Strategic Management Analysis & Recommendations',NULL,'HFT4295','Hospitality Strategic Management And Leadership',45,2017,'fall','<p>Undergraduate student-consultants will develop a tailored strategic plan for your hospitality organization in order to achieve a specific goal you choose for the group.</p>','group','2017-08-29','2017-11-30',15,NULL,'<p><strong>Phase 1 </strong>–<strong> Project Plan</strong>: Students will meet with organization representative(s) to understand the project scope and prepare detailed plan for completion of the project.</p><p><strong>Phase 2</strong>  – <strong>Project Execution</strong>: Students will research deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p><strong>Phase 3</strong> - <strong>Outcome Report and Presentation</strong>: Students will submit detailed report on the outcomes of the project. Teams will also present this in the last class. Organization representative(s) are invited to attend these presentations.</p><ul><li>10 Page paper including executive summary and recommendations.</li><li>15 Minute presentation using slides and visuals to support recommendations.</li></ul>',2,NULL,'2017-07-03 20:02:51','2017-08-22 00:06:38','<p>Starting in September, a group of 4 Hospitality students will spend approximately 60 hours over the course of the semester assessing your hospitality organization and preparing a recommendation. Based on the co-alignment model of strategic management and leadership they will provide a strategy to achieve the goal you have chosen. </p><p></p><p><strong>Project Examples could include, but are not limited to: </strong></p><ul><li><strong>Environment Scanning:</strong> Students will research current trends impacting your industry. <strong>Examples include:</strong> Healthy/local food options, environment friendly practices, and new tech resources.</li><li><strong>Strategy Choice:</strong> Students will identify the best investments for building competitive advantage in your industry.                                                                                                                                <strong>Examples include</strong>: Developing restaurant brands or acquiring existing brands, and  developing products in house or outsourcing.</li><li><strong>Organization Structure:</strong> Once a strategy is selected, students will identify the employees/skills  necessary to execute the strategy.                                                                                                 <strong>Examples include</strong>: Hiring a Chief Technology Officer or Social Media Manager.</li><li><strong>Organization performance:</strong> Students will identify the metrics that drive investor decisions, and provide suggestions to improve financial performance of strategy, department, or company.  </li></ul><p></p>',4,'4th year',1,NULL,'regional',NULL),(590,NULL,'draft','Social Media Audit and Recommendations for Client',NULL,'MKTG 443','Digital Marketing and Social Media',44,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-07-04 00:27:40','2017-07-04 00:33:26',NULL,NULL,'I think Juniors or Seniors',0,NULL,NULL,NULL),(591,450,'review','Social Media Marketing Audit',NULL,'MKTG 443','Digital Marketing and Social Media',44,2017,'fall','<p>Starting this August, student-consultants will analyze your current social media strategy and provide recommendations on how it can be improved as well as an implementation plan.</p>','group','2017-08-21','2017-12-08',20,NULL,'<p>The final project deliverables for this project are:</p><ul><li>A written paper including social media recommendations</li><li>A 15-20 minute presentation</li><li>Creative deliverables bringing social media ideas to life</li></ul>',1,NULL,'2017-07-04 00:41:15','2017-07-20 17:55:51','<p>A group of 5 junior and senior-level students will spend approximately 100+ hours as a group analyzing the strengths and weaknesses of your organization’s social media marketing strategy.</p><p></p><p>Students will produce suggestions and recommendations surrounding your business’s key messaging, as well as a plan for implementing their ideas. A strong social media strategy can help your organization provide rich customer experiences, increase website traffic, and gain valuable customer insights.</p><p></p><p><strong>Project examples can include, but are not limited to:</strong></p><ul><li>leveraging and improving on existing social media campaigns,  contests, etc.</li><li>Identifying tools, tips and strategies for scaling your social communications</li><li>Developing/improving your social editorial calendar and posting schedule</li><li>Highlighting relevant trends that your social team can leverage</li></ul><p></p>',5,'3rd & 4th year',0,NULL,'regional',NULL),(592,124,'published','Digital Marketing Strategies to Grow Revenue',NULL,'4039','Digital Marketing Strategies ',76,2017,'fall','<p>Students develop an inbound marketing strategy for a B2B focused business and devise a strategy to increase lead generation and nurture leads into customers.</p>','group','2017-09-08','2017-12-15',40,NULL,'<p>The Inbound Digital Marketing report should outline the inbound strategy for the B2B focused business, including the following:</p><p></p><p><strong>Market Analysis &amp; Goals</strong></p><ul><li>Business Objectives</li><li>Market &amp; Competitive Analysis</li><li>Baseline Metrics - website and social media audits</li><li>SEO Audit</li><li>Digital Marketing Measurement Model (DMMM)</li><li>Google Analytics &amp; Google Tag Manager</li></ul><p><strong>Targeting &amp; Campaign</strong></p><ul><li>Target Audience &amp; Buyer Persona(s)</li><ul><li>Where do they live online and what are their pain points, problems &amp; questions</li></ul><li>Quality Lead Definition</li><li>Campaign Idea</li><li>Content Creation - eBook, whitepapers, case studies, webinars, events, etc.</li></ul><p><strong>Inbound Marketing Strategy</strong></p><ul><li>Explain each stage of the sales funnel - Awareness, Consideration and Decision</li><ul><li>What is the content strategy at each stage</li><li>What is the promotional strategy - SEO, blogs, social media, forums, groups, events, CTAs</li><li>Lead capture - landing pages, forms, thank you pages</li><li>Lead nurturing workflow - starting conditions, timeline, content shared, email examples, CTAs</li></ul><li>Explain what happens if people enter at various stages of the funnel or if people drop out of the funnel</li></ul>',5,NULL,'2017-07-04 03:12:43','2017-07-09 20:44:55','<p>Students develop an inbound digital marketing strategy to increase lead generation for a B2B focused organization. Within the project deliverables they complete audits on the current website, SEO and social media presence. They create a campaign idea and build out various components of a digital marketing strategy including:</p><ul><li>Google Analytics Optimization</li><li>SEO</li><li>Content Strategies</li><li>Social Media Strategies</li><li>Lead Generation Strategies</li><li>Landing Pages and Forms</li><li>Email Nurturing &amp; Workflows</li></ul>',4,'MBA / 4th Year',0,NULL,'anywhere',NULL),(593,326,'published','Masters\' Big Data Analysis',NULL,'INSY 5379','BA (Business Analytics) Capstone Project',5,2017,'fall','<p>Master&#x27;s-level student-consultants will develop a tailored strategy for your organization using data analytics and machine learning algorithms, designed to address a challenge or opportunity specific to your needs. </p>','individual','2017-08-28','2017-12-05',50,NULL,'<p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to devise the project scope and prepare detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Analysis &amp; Strategy: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome Report and Presentation: Students will submit detailed report on the outcomes of the project. Teams will also present this in the last class. Organization representative(s) are invited to attend these presentations. Report and presentation will include: </p><ul><li>     Clear statement of objectives</li><li>     Alternatives considered to fulfill business objectives</li><li>     Evaluation of alternatives</li><li>     What was the best solution</li><li>     Limitations and future directions</li><li>     Conclusions</li></ul>',1,NULL,'2017-07-04 22:35:39','2017-08-04 18:33:55','<p>Starting this August, master&#x27;s-level Business Analytics students will spend time analyzing applicable data sets which will help you make informed decisions, key to the success of your business. </p><p></p><p>Based on information on your organization provides and the goals that you&#x27;ve shared with the students, they will provide you with an analysis and recommendations that will help you gain insights into new opportunities or address a specific challenge your organization is facing.</p><p></p><p>The students are trained in a variety of technical and business skills, and have studied topics including market basket analysis, text analytics, machine learning, deep learning, Spark Analytics, and recommender systems. </p><p></p><p><strong>Examples of previous projects include the following: </strong></p><ul><li><strong>Sentiment analysis </strong>of social media content (positive, negative or neutral)</li><li><strong>Stock Market prediction</strong> based on time-series modelling</li><li><strong>Text analysis</strong> of product/business reviews and how they impact performance</li><li><strong>Predicting house prices</strong> based on historical data</li><li>Building a <strong>recommender system</strong> for movies</li><li><strong>Predicting customer churn</strong> and recommending solutions to avoid this</li><li><strong>Text analysis</strong> of blogs to identify common trends</li></ul><p>Projects are not limited to the above areas. The students have experience studying datasets to deal with a variety of problems, such as image classification, predicting the quality of wine, detecting credit card fraud, etc. </p>',1,'Master\'s',0,NULL,'anywhere',NULL),(594,387,'published','Organizational Consulting',NULL,'MSCI 211','Organizational Behaviour',240,2017,'fall','<p>Student teams consisting of 4-5 undergraduate student-consultants will develop an action plan that addresses a leadership or management challenge currently faced by your organization.</p>','group','2017-10-02','2017-12-04',50,NULL,'<p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to devise the project scope and prepare a  detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome - 10 page Report and Presentation: Students will submit a detailed report on the outcomes of the project. </p>',20,NULL,'2017-07-05 16:14:17','2017-08-29 18:07:11','<p>Over a six-week period, the students will diagnose the problem and develop a strategy to help you address it.</p><p></p><p>Based on information you provide, student-consultants will develop an action plan that addresses a leadership or management challenge currently faced by your organization. </p><p></p><p><strong>Project examples could include, but are not limited to:</strong></p><p></p><ul><li>Redesign an internal system or process including: hiring, socialization, compensation, motivation, team management, learning, training.</li><li>Develop a plan to re-imagine your mission, vision, and purpose and roll it out to employees.</li><li>Manage a significant organizational change or restructuring.</li><li>Integrate cultures in a merger or acquisition.</li><li>Reduce employee turnover or absenteeism or increase workplace safety.</li><li>Diagnose your organizational structure and its fit with your organization&#x27;s strategy.</li><li>Help you develop a plan to increase diversity and the positive effects of diversity in your organization.</li><li>Help you develop a plan for your organization to become self-sustaining in the long term (environmental sustainability plan.)</li></ul>',5,'2nd & 3rd years ',0,NULL,'anywhere',NULL),(595,124,'published','Social Media & Communications Audit',NULL,'MKTG 200','Public Speaking and Communications',30,NULL,'fall','<p>Students will review communication pieces used by your company, and provide ideas as to how to improve its communication methods, to better reach out to their target audience.</p>','group','2017-09-04','2017-12-12',50,NULL,'<p>At the end of the term, student teams will conduct a <strong><u>20-minute presentation</u></strong> of their findings to your company.</p>',3,NULL,'2017-07-05 17:34:38','2017-07-12 23:00:24','<p>In teams of 5, students will use in-class frameworks to review different communication pieces your company uses. Teams will provide ideas and recommendations as to how you can improve your communication methods, to better reach out to your existing or new target audience. </p><p></p><p>Project examples include:</p><ul><li><strong>Increasing engagement </strong>on your social media accounts, blogs, or other marketing materials</li><li><strong>Assessing</strong> <strong>effectiveness</strong> of your current channel(s) of communication</li><li>Identifying <strong>best practices</strong> to implement in communication to reach a new target audience</li><li><strong>Improving your online presence</strong> by recommending new tools, social channels, or communication pieces</li></ul>',4,'Undergraduate, 2nd Year',0,NULL,'anywhere',NULL),(596,454,'published','Operations Assessment',NULL,'BUSN-406','Operations Management Analysis',40,2017,'fall','<p>A group of five students will analyze your organization&#x27;s supply chain, operations, and financial information in order to make recommendations to improve your overall operations.</p>','group','2017-10-09','2017-10-27',30,NULL,'<p>The students&#x27; deliverables will include reporting on the following:</p><ul><li>10-page document on process and measures</li><li>Challenges found and potential solutions</li><li>Steps to provide potential solution(s)</li></ul>',5,NULL,'2017-07-05 17:40:34','2017-07-28 16:21:16','<p>A group of five 3rd and 4th year students will analyze your organization&#x27;s financial and operational metrics. This can include operating margins, inventory returns, financial ratios, etc. </p><p></p><p>They will be tasked with identifying areas of improvement for your organization, and recommend solutions. They will identify which areas are having a negative or inefficient impact and what actions can be taken to further increase positive returns.  </p><p></p><p>A final report and presentation will give your business a summary of their findings, providing valuable insight for your organization to improve your operations management. </p><p></p><p>Some examples include:</p><ul><li>Developing a demand forecast</li><li>Finding additional value in your various measures</li><li>Understanding how financial measures are impacting revenue streams</li><li>Determining appropriate staffing levels to support future needs</li><li>Addressing any quality related problems in the supply chain</li><li>Identifying supply chain management issues</li><li>Providing product design and reliability assurance</li><li>Investigating location optimization for a warehouse or other facility</li></ul><p></p>',5,'3rd & 4th year',0,NULL,'anywhere',NULL),(597,31,'draft','Master\'s Strategy Consulting',NULL,'OPRE 6367','Capstone Course',35,2016,'fall','<p>This assignment can benefit your company in obtaining unbiased assessments and recommendations regarding opportunities and challenges facing your business.  </p>','group','2017-08-01','2017-11-30',50,NULL,'<p>Final project deliverables include professional quality presentations of:</p><ul><li>Objective situational assessments</li><li>Identification and evaluation of alternatives</li><li>Development of performance measures</li><li>Recommended strategies and actions supported with financial analysis.  </li></ul><p>Your organization will receive:</p><ul><li>A 30-45 minute presentation on analysis, findings, and recommendations. </li><li>A hard copy of the final project report. (Length of document depends upon scope of the project.)</li><li>Employers gain direct interaction with UT Dallas students and future professionals for employment potential.</li></ul>',1,NULL,'2017-07-05 17:57:12','2017-07-05 17:57:12','<p>In individual groups of 5, Master&#x27;s level student-consultants will work 50+ hours to assist with unique challenges or opportunities facing your business.  </p><p></p><p>These graduate school students have diverse backgrounds including engineering, information systems, science, and business and can offer unbiased assessments and recommendations for your company in a wide variety of areas.  </p><p></p><p>Possible areas of focus could include, but are not limited to:</p><ul><li>market research</li><li>supply chain management/ process improvement</li><li>technology solutions</li><li>market entrance/expansion</li><li>data analytics </li><li>development and use of KPI/KLI&#x27;s </li><li>category management</li><li>commercialization of social media</li><li>sales and marketing strategy, etc.</li></ul>',5,'MBA, MS',0,NULL,NULL,NULL),(598,10,'published','Performance Management Audit ',NULL,'BUS 482','Performance Management',20,2016,'fall','<p>Students consultants will <strong>audit, analyze, research, and then provide actionable recommendations</strong> on an HR performance plan that you feel could use some upgrading.</p>','group','2017-09-06','2017-11-29',30,NULL,'<p>Each group of student-consultants will spend <strong><u>20-40 hours working on your company</u></strong> to provide actionable recommendations of the employment system of your choice. </p><p></p><p>If the recommendations include changes to strategy, policy, or practices, <strong><u>the +10 page document they submit will include how they will be implemented and maintained</u></strong>. </p>',5,NULL,'2017-07-05 18:04:12','2017-08-04 21:34:33','<p>A group of 4 student-consultants will <strong>audit, analyze, research, and then provide actionable recommendations</strong> on a business plan related to an aspect of performance management. Students will prepare recommendations for your company, and take careful consideration of implementation requirements.</p><p></p><p>Project examples include:</p><ul><li>Process to link business goals to individual performance expectations</li><li>Performance feedback and evaluation program</li><li>Employee training and development plan, and evaluating outcomes</li><li>Leadership development program</li><li>Management succession plan</li><li>Variable compensation plan<br/></li></ul>',4,'4th Year',0,NULL,'anywhere',NULL),(599,31,'published','Master\'s-Level Consulting',NULL,'MGBL 901','Master of International Business: Team-based Consulting Project course',110,2017,'winter/spring','<p>Graduate-level students from the Smith School of Business will act as consultants to tackle an opportunity or challenge your organization is facing and provide analysis and recommendations.</p>','group','2017-11-01','2018-06-01',80,NULL,'<p>Students will provide a final report (length dependent on the individual projects) detailing their findings and actionable recommendations. </p>',15,NULL,'2017-07-05 18:05:24','2017-08-15 08:33:23','<p>Starting this November, a group of 6-8 Master of International Business students from Queen&#x27;s University will devote 500+ hours to a business opportunity or challenge of your business is facing. </p><p></p><p>These international graduate school students have diverse backgrounds and career experience, and can offer unbiased assessments and recommendations for your company in a wide variety of areas. Students can offer a fresh outside perspective in addition to experienced insights.</p><p></p><p>Possible areas of focus could include, but are not limited to:</p><ul><li>Market research to identify new strategies and opportunities</li><li>Brand and messaging assessment</li><li>Supply chain management/ process improvement</li><li>Technology solutions</li><li>Market entrance/expansion</li><li>Data analytics</li><li>Development and use of KPI/KLI&#x27;s</li><li>Category management</li><li>Commercialization of social media</li><li>Sales and marketing strategy, etc.</li></ul><p></p>',6,'Master\'s',0,NULL,'anywhere',NULL),(600,452,'review','Social Media & Digital Marketing Audit',NULL,'','Ethos',12,NULL,'fall','<p>Students will review communication pieces used by your company, and provide ideas as to how to improve its communication methods, to better reach out to their target audience.</p>','individual','2017-09-04','2017-12-12',50,NULL,'<p>At the end of the program, the student will submit a report and conduct a presentation of their findings and recommendations for you</p>',12,NULL,'2017-07-05 18:19:07','2017-07-05 18:31:27','<p>An individual and dedicated student will work with you and use in-class frameworks and information used in class to review different the communication and marketing pieces used by your company. This student with work with you over 3 months and in the end provide ideas and recommendations as to how you can improve your communication methods, digital marketing material and social media  to better reach out to your existing or new target audience. </p><p></p><p>This can help you to:</p><ul><li><strong>Increase engagement </strong>on your social media accounts, blogs, or other marketing materials</li><li><strong>Assess effectiveness</strong> of your current digital channel(s) of communication</li><li>Identify <strong>best practices</strong> to implement in communication to reach a new or existing target audience</li><li><strong>Improve your online presence</strong> by recommending new tools, social channels, or communication pieces</li></ul>',4,'Post Grad',0,NULL,'local',NULL),(601,458,'published','Business Analytics',NULL,'MGMT 26000','Business Analytics and Technology',100,2016,'fall','<p>Groups of student-consultants, specialized in data-driven decision-making, will help your organization by designing and implementing analytical research to support your decision-making. </p>','group','2017-08-30','2017-12-15',15,NULL,'<ul><li>A 15-20 mins project presentation </li><li>An Excel workbook with their analysis and model</li></ul>',8,NULL,'2017-07-05 18:22:01','2017-07-14 21:44:46','<p>Undergraduate student consultants will work in teams to develop analytic models to support your decision-making in business operations over a course of one/two months.</p><p></p><p>Possible project examples include, but are not limited to:</p><ul><li>Sales Analysis</li><li>Customer Service Analysis</li><li>Employee Performance Analysis</li><li>Market Demand Analysis</li><li>Demand Forecasting</li></ul><p></p><p>In general, students will be able to work with the data to:</p><ul><li>Identify trends and patterns</li><li>Summarize and extract useful information</li><li>Provide data-based decision support</li></ul><p></p>',6,'Sophomore',0,NULL,'anywhere',NULL),(602,433,'published','Digital Marketing Strategy',NULL,'DMF','Digital Marketing Foundation',25,2017,'summer','<p>Students develop a digital marketing growth strategy for their Community Partner.</p>','group','2017-07-25','2017-09-15',40,NULL,'<p>The final report will provide analysis and recommendations for <strong>10 of the following 17 </strong>elements, including both required elements and least 1 from each of Paid, Owned, and Earned.</p><p></p><p><strong>Required</strong></p><ul><li>Digital Marketing Measurement Model</li><li>A sample Google Analytics Custom Report for one of the strategies below</li></ul><p></p><p><strong>Paid</strong></p><ul><li>Search Advertising Strategy</li><li>Social Advertising Strategy</li><li>Visual Advertising Strategy</li></ul><p></p><p><strong>Owned</strong></p><ul><li>Email Capture + Marketing Strategy</li><li>On-Page SEO Strategy</li><li>Landing Page Creation</li><li>Conversion Rate Optimization Audit</li><li>Google Analytics Dashboard</li><li>Google Analytics Audit (Filters, Goals, Events, etc)</li></ul><p></p><p><strong>Earned</strong></p><ul><li>Content Calendar</li><li>Community Management Guidelines/Brand Filter</li><li>A Social Media Campaign Strategy</li><li>Off-Page/Outreach SEO Strategy</li></ul><p></p><p><strong>Marketing Analysis</strong></p><ul><li>User Personas</li><li>Marketing Campaign Funnel Analysis</li></ul>',10,NULL,'2017-07-05 18:40:40','2017-07-25 21:12:22','<p>Students develop a digital marketing campaign and devise a strategy to achieve your company goals whether that be brand awareness, increase sales, website conversions etc.</p>',4,'1',1,NULL,'local',NULL),(603,456,'published','Marketing Strategy Analysis & Consulting',NULL,'MKT 390','Marketing Strategy',40,2017,'fall','<p>Senior student-consultants will develop a tailored marketing strategy for your organization to analyze and solve a challenge or capture an opportunity.</p>','group','2017-09-01','2017-12-08',20,NULL,'<p><strong>Phase 1 </strong>– Project Plan: Students will connect with organization representative(s) to devise the project scope and prepare a detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project objectives.</p><p></p><p><strong>Phase 3</strong> - Outcome - Report and Presentation: Students will submit a detailed report on the outcomes of the project. Teams will also present this in the last class. Organization representative(s) are invited to attend these presentations.</p>',2,NULL,'2017-07-05 18:41:14','2017-09-01 16:43:17','<p>In teams of 5, students will dedicate 100 hours to apply market strategy frameworks to analyze and solve a marketing challenge or capture an opportunity.</p><p></p><p><strong>Students will collaborate with your organization to:</strong></p><ul><li><strong>Conduct a thorough analysis</strong> of your current market strategy including in-depth analysis of your target market, value proposition, competitive analysis, and research using secondary data sources</li><li><strong>Develop recommendations</strong> for growing the business to solve particular marketing problem faced by your organization</li><li><strong>Provide additional insightful analysis and recommendations </strong>that your organization could use and benefit from</li></ul>',5,'4th year',1,NULL,'anywhere',NULL),(604,382,'published','Market Research Analysis & Recommendation Plan ',NULL,'MARK 30120','Marketing Research',45,2017,'fall','<p>Student-consultants will develop a tailored research report for your organization to help provide a solution for your managerial problem.</p>','group','2017-08-31','2017-12-05',25,NULL,'<p><strong>Phase 1 - </strong>Research proposal</p><p></p><p><strong>Phase 2 - </strong>Secondary Data Analysis</p><p></p><p><strong>Phase 3 - </strong>Qualitative Research Guide</p><p></p><p><strong>Phase 4 - </strong>Qualitative Research Findings</p><p></p><p><strong>Phase 5 - </strong>Draft of Survey</p><p></p><p><strong>Phase 6 - </strong>Presentation of Findings and Recommendations</p>',10,NULL,'2017-07-05 19:01:32','2017-08-09 06:31:26','<p>Starting in September, a group of 5 Marketing students will spend approximately 125 hours over the course of the semester designing, collecting, and analyzing data from both secondary and primary sources. </p><p></p><p><strong>The research process will include:</strong></p><ul><li>Secondary data (news outlets, research reports from Mintel, IBISWorld, etc.).</li><li>Qualitative information (focus groups or in-depth interviews) .</li><li>Quantitative information (survey).</li></ul><p>Based on this research the students will prepare a research report and presentation including the research performed, the groups&#x27; findings, and recommendations for the managerial opportunity or problem you proposed to the group.</p><p></p><p><strong>Previous Project example:</strong></p><p></p><p><strong>How to increase customer demand for a company or organization?</strong></p><p></p><p>Student consultants:</p><ul><li>Learned about  industry trends via secondary research.</li><li>Uncovered potential problems and opportunities with the company via focus groups and interviews with prospective and current customers.</li><li>Tested possible changes on a larger sample of the customer base via a survey (100 - 200  respondents) .</li></ul><p></p><p>There is no restriction on the type of project that could be conducted, provided that the students are able to meet the requirements of the assignment (i.e., conduct secondary data, a focus group/ interviews, and a survey).</p><p></p><p>Interested organizations should also consider if they are able to provide a means through which student groups are able to collect data from the population of interest within a timely fashion. If not, students would have to conduct the primary research portion on other college students at the school.</p>',5,'3rd year, 4th year',0,NULL,'anywhere',NULL),(605,363,'published','Advertising Strategy',NULL,'WWA 005 ','Advertising & Promotion',1,2016,'fall','<p>The student will create advertising elements for your organization that can be used in creative campaigns for television ads, billboards, magazine, or other mediums.</p>','individual','2017-09-15','2017-12-15',240,NULL,'<ul><li>The student will deliver a specific advertising element depending on the client&#x27;s goals and desired advertising medium. </li><li>He/she will also prepare a presentation to the stakeholders describing the rationale behind their creative strategy.</li><li>Project will be specifically targeted to the local Vancouver area.</li></ul>',1,NULL,'2017-07-05 21:12:31','2017-08-02 15:38:04','<p>Starting in September, a student will create <strong><u>advertising elements for your organization</u></strong>, that can be used in creative campaigns for television ads, billboards, magazine, or other mediums. </p><p></p><p><strong><u>Based on your stated advertising goals</u></strong> (eg. rebranding, increasing exposure, entering a new region, etc.), the student will employ creative strategy to plan, prepare, and place the messages of integrated brand promotion.</p><p></p><p>The student&#x27;s project scope will vary depending on the organization&#x27;s goals and budget, but could include any of the below elements:</p><ul><li>Creating a media plan</li><li><strong><u>Writing copy for creative print ads (and creating print ads)</u></strong></li><li>Creating graphics or copy for social media campaigns</li><li><strong><u>Creating video clips for use in a TV ad or YouTube spot</u></strong></li><li>Mocking up a billboard or other large-scale advertisement (creating out-of-home ads)</li><li>Creating a social media plan</li><li>Creating a finished TV spot</li><li>Creating a finished radio spot</li></ul><p> </p>',1,'4th years',0,NULL,'local',NULL),(606,363,'review','Investor Analysis and Proposal',NULL,'WWA 006','Accounting Internship',1,2017,'summer','<p>For 8-10 weeks, an individual student-consultant will review and <strong><u>analyze your financial statements</u></strong> and projections of revenue/expenses and make recommendations.</p>','individual','2017-07-15','2017-09-30',120,NULL,'<p>A report summarizing analysis and key findings based upon research done through the course of the project. </p><p>Project is local to the San Diego area.</p>',1,NULL,'2017-07-05 21:21:17','2017-07-11 23:35:48','<p>An individual student in the <strong><u>Finance program at UC San Diego</u></strong> will work on an applied accounting project of your choosing for your organization. Projects can vary based on your company&#x27;s needs. Examples may include but are not limited to the following:</p><ul><li>Analyze and raise potential questions before your company faces real investors.</li><li>Analyze and create financial projections on a forecast basis.</li><li>Develop a <strong><u>pitch for investors that is backed up by financial analysis</u></strong> based on your expressed investment goals.</li><li>Determine how financial statements (balance sheet, income statement, cash flow statement) reconcile with the business model and strategy.</li><li>Determine important economic resources of your business that do not appear on your financials.</li></ul>',1,'2nd year student',0,NULL,'local',NULL),(607,363,'published','Mechanical Engineering - Prototype and Design Implementation',NULL,'WWA 007','Advanced Design Project',1,2017,'fall','<p>Could your organization benefit from Mechanical Engineering <u><strong>student designing and prototyping equipment</strong></u> based on your business needs?</p>','individual','2017-10-15','2018-05-31',500,NULL,'<ul><li>Full-functioning prototype</li><li>30-minute presentation judged by local industry partner</li><li>Project is local to the Cleveland, OH area</li></ul><p></p><p></p>',1,NULL,'2017-07-05 21:28:31','2017-07-12 22:29:11','<p>An individual Master student in Mechanical Engineering at Case Western Reserve University will spend 500+ hours working with your organization to <strong><u>develop and create a prototype for a design idea of your choice.</u></strong> The project will include analysis of the <u>concept, design consulting, prototyping, prototype testing</u> and manufacturing of a functional model. </p><p></p><p>Examples of what the student has done include , but are not limited to:</p><ul><li>Circuit design, PCB schematic  design, communication system simulation, and single chip programming</li><li>Designed the PID controller, time-delay system, robust control system and asymmetric control system for industrial heating energy systems.</li><li>Designed new control strategies for a system with two interconnected micro-grids with multiple generators and a wind farm </li><li>Designing the keyless entry system for vehicle owners</li><li>Metro vehicle testing including braking distance, on-track dynamic testing, EMC and door qualification testing. </li></ul><p></p><p>The student participants are proficient in :</p><ul><li>Data Analysis</li><li>3D Printing</li><li>Machining</li><li>Testing and Calibration</li><li>Developing platforms and products that are related to bio-mechanics and automotive </li></ul><p></p>',3,'M. S., Mechanical Engineering',0,NULL,'local',NULL),(608,363,'published','Industrial Product Design',NULL,'WWA 008','Product Design Internship',1,2017,'fall','<p>For 8-12 weeks, an individual student-consultant will work with your team, based in Atlanta, to <strong><u>build a new product</u>,</strong> a concept for a product or work on an <strong><u>existing product</u></strong> with one of your teams. </p>','individual','2017-09-01','2018-03-01',360,NULL,'<p>Deliverables will be set and determined by the company.</p>',1,NULL,'2017-07-05 21:37:14','2017-08-11 21:48:26','<p>An individual student-consultant will work with an industrial design, product design or engineering team to create innovative design solutions for the companies market. <br/></p><p>Benefits from this project could include:</p><ul><li>Develop and design a new product</li><li>Assist the engineering or industrial design team with existing products. Designs could range from <u>small electronic devices</u> such as earphones to <u>large equipment like medical apparatus</u> and instruments</li><li>Student could provide <strong>Computer-aided industrial design work </strong>, Materials &amp; manufacturing process, 2-D / 3-D concept sketching and 3-D concept model making.</li></ul>',1,'Master\'s degree',0,NULL,'local',NULL),(609,382,'published','Consumer Behavior Insights',NULL,'MARK 30100 Section 01','Consumer and Industrial Buyer Behavior',40,2017,'fall','<p>An individual marketing major will conduct extensive research on your business with a focus on learning more about consumer attitudes, motivations, and behavior to aid in making strategic decisions. </p>','individual','2017-08-31','2017-12-05',15,NULL,'<p>At the end of the semester (December 7, 2017), the organization will receive a minimum of 5 10-page research reports from the students which will highlight their individual research findings and actionable recommendations. </p>',6,NULL,'2017-07-05 21:38:17','2017-08-16 17:39:52','<p>Starting this September, individual student-consultants will gather in-depth consumer insights for your organization through secondary market research (e.g., market research reports, white papers, academic publications, popular press, trade articles, government databases, etc.) in order to provide actionable recommendations for better decision-making. </p><p></p><p>While this assignment will be conducted individually, a minimum of 5 students will be assigned to the same project. This means that your organization will receive at least 5 different perspectives on the same topic.</p><p></p><p><strong>Project examples could include, but are not limited to:</strong></p><ul><li>Uncovering new market opportunities given industry shifts/trends.</li><li>Identifying factors that influence behaviour among a specific target market.</li><li>Understanding cultural differences between markets.</li><li>Analyzing why a certain product/service performed better than another.</li></ul><p></p><p></p><p></p>',1,'3rd year',0,NULL,'anywhere',NULL),(610,469,'published','Technology Access Centre in Bio-innovation',NULL,'TAC','Applied Research: Technology Access Centre',50,2017,'other','<p>La Cité students will work on an applied research project for your organization in the area of biotechnology or bio-innovation. Student work is overseen by faculty.</p>','individual','2017-09-01','2018-04-20',100,NULL,'<p>The final deliverable varies based on the project established between the students and company partner.</p>',5,NULL,'2017-07-05 21:53:43','2017-08-10 04:10:21','<p><strong>Note: Project start dates and lengths are variable. </strong></p><p></p><p>Since 2009, La Cité students have developed more than 85 industry and community applied research projects in the fields of red, green, and white biotechnology in Ontario and Western Quebec.</p><p></p><p>Your organization has the opportunity to provide students with a research topic of your choosing, and they will tackle this in the Technology Access Centre in Bio-Innovation (TAC-B) at La Cité. Students will have access to laboratory facilities and faculty supervision, but will be collaborating with your organization for input and updates throughout. </p><p></p><p>The Centre&#x27;s specialized equipment can help your research projects become a reality: https://research.collegelacite.ca/our-equipments/. </p><p></p><p>Faculty, researchers, and students have expertise in the following areas:</p><ul><li><strong>Cosmetics and biopharmaceutical produc</strong>ts - Development of drugs delivery mechanisms, extraction of medicinal compounds and support to the development of naturel product.</li><li><strong>Agro-food</strong> - Ingredient stability, food product optimization (animal and human food), nutritional characterization (proteins, lipids, amino-acids, sugars, vitamins, etc.)</li><li><strong>Bioprocess and environmen</strong>t - Optimization of bacterial system, yeast and bacteriophage (lytic and lysogens) production process, production and purification of recombinant protein, development of fertilizing products and biological control of harmful organisms.»</li><li><strong>Genetic engineering </strong>- Characterization and genotyping of cultivars, development of kits to detect DNA markers (human, animal and vegetable)</li><li><strong>Analytical services </strong>- Gene detection, small molecules detection (pesticides, mycotoxins, etc.) and aromatic profiling (terpenes, tannins, esters, etc.)</li></ul><p>Beyond forging applied research partnerships, TAC-B also offers technical support, analysis and process development, training, networking and technical staff supervision.</p><p></p><p>Check out our website to learn more about the program and the faculty behind it: https://research.collegelacite.ca/fields-of-research/bio-innovation/</p>',1,'Variable',0,NULL,'regional',NULL),(611,382,'published','Consumer Behavior Insights For Strategic Decision Making',NULL,'MARK 30100 Section 02','Consumer and Industrial Buyer Behavior',40,2017,'fall','<p>This individual research project would focus on answering/learning more about consumer attitudes, motivations, and behavior within a specific context in order to aid in making strategic decisions. </p>','individual','2017-08-31','2017-12-05',15,NULL,'<p>At the end of the semester (December 7, 2017), the organization will receive a minimum of 5, 10 page research reports from the students which would details their research findings and recommendations. </p>',6,NULL,'2017-07-06 18:40:59','2017-08-16 17:40:06','<p>The purpose of this assignment is to have the student engage in the practice of gaining consumer insight through conducting research using secondary research sources (e.g., market research reports, white papers, academic publications, popular press, trade articles, government databases, etc.) in order to better drive strategic decision making for an organization. </p><p></p><p>The organization would propose a research question related to consumer behavior that they want to know more about and the student will create a 10 page term research paper in which they layout their findings and strategic recommendations. The research question could be tailored according to the decision that the organization would like to make. For example, a proposed research question could be as broad as a project to better understand key factors in how Chinese consumers may differ in their reactions to a type of product compared to their American counterparts. Alternatively, a research question could be more narrow and propose a project which researches why a specific brand of paper towels is purchased more within a certain grocery store on Tuesday nights in July than during any time of year. </p><p></p><p>Though this is an assignment that would be conducted individually, a minimum of 5 students would be assigned to the same project. This means that the organization would receive at least 5 different, 10 page reports which research the same question. </p>',1,'Junior Marketing Majors ',0,NULL,'anywhere',NULL),(612,356,'review','MBA New Product & Service Design ',NULL,'MKTG 37201','MBA Lab in Developing New Products and Services',75,2018,'winter/spring','<p>MBA student consultants will use design thinking innovation principles to identify, develop, quantitatively test, and refine three new product or service concepts for your organization.</p>','group','2018-01-03','2018-03-16',100,NULL,'<p></p><p>During each of these phases students will develop a power point presentation and appendix covering the findings of each phase.</p><p></p><p><strong>Phase 1 </strong>– <strong>Opportunity Identification:</strong> Students will meet with your organizations representative(s) to identify a project scope and prepare a  detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  –<strong> Ideation &amp; Concept Development:</strong> Students will work on the deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks. At the end of this phase students will present the new product and service ideas as well as the pricing rationale for each concept. </p><p></p><p><strong>Phase 3</strong> -<strong> Concept Test and Final Presentation: </strong>Students will deliver a detailed presentation plus appendix summarizing the project and focusing on forecasting and next steps. Organization representative(s) are invited to attend these presentations.</p><p></p>',15,NULL,'2017-07-06 22:11:14','2017-07-21 23:10:23','<p>Starting in January a group of 5 MBA students will spend approximately 100 hours over the course of the semester implementing a 3-phased process to create and quantitatively test 3 new product or service concepts for your organization.</p><p></p><p>Based on information on your organization provides and the goals that you&#x27;ve shared with the students, you will define desired categories for:</p><ul><li>Innovation</li><li>Target consumer </li><li>&quot;Types&quot; of innovations that are in scope (e.g. product improvements, line extensions, new category entries, new-to-world, digital/mobile apps, new service experiences, etc.).</li></ul>',5,'MBA',0,NULL,'anywhere',NULL),(613,454,'published','Data Analysis',NULL,'BUSN - 205','Introduction to Business Analytics',50,2016,'fall','<p>Student-consultants will spot trends and relationships inside any large data sets your organization provides. Students will submit their recommendations and conclusions to help guide decision-making.</p>','individual','2017-10-09','2017-10-23',25,NULL,'<p>The final project will include (as part of a 5-10 page document):</p><ul><li>A brief summary of important and insightful information discovered from the available data</li><li>Tables and graphs of important statistics and relationships</li><li>A brief summary of conclusions and any recommendations based on the data and information obtained </li></ul>',1,NULL,'2017-07-07 15:31:52','2017-07-28 16:21:40','<p>Using real data from your organization, student-consultants will identify trends and relationships inside large data sets, create presentation-style graphs and tables, and submit their recommendations and conclusions to decision-makers of your company. </p><p></p><p>Student-consultants will use SAP software to conduct the data analysis. </p><p></p><p><strong>The data provided by your organization will be used to:</strong></p><ul><li>Analyze in order to spot trends and relationships among variables;</li><li>Create tables and graphs of summary statistics of key variables;</li><li>Provide a summary of conclusions to quickly and efficiently convey information the company may find interesting or important;</li><li>Test for different outcomes or preferences from various products and groups of individuals;</li><li>Indicate if alternate strategies could yield more successful results.</li></ul><p><strong>Possible project examples include, but are not limited to:</strong></p><ul><li>Analyzing sales data to determine the relationship between your products&#x27; or services&#x27; price and volume of sales;</li><li>Identifying patterns in sales or usage based on seasonality;</li><li>Creating a summary of key customer demographic statistics;</li><li>Summarizing results of a customer survey to identify which characteristics are associated with different preferences.</li></ul>',1,'2nd & 3rd year',0,NULL,'anywhere',NULL),(614,66,'published','Marketing Plan for Startup',NULL,'ENMN 330','Marketing',37,2016,'fall','<p>A class of BCom students will use an iterative, client-focused, discovery-driven process to research, analyze, prototype and test ideas, and then <u><strong>develop your workable marketing plan, specific to your goals,</strong></u> <u><strong>objectives,</strong></u> <u><strong>and budget. </strong></u> </p>','group','2017-09-11','2017-11-10',50,NULL,'<p>The group will submit a <strong>comprehensive written marketing plan report</strong>, accompanied by a <strong>15-minute online presentation of their recommendations.</strong></p>',1,NULL,'2017-07-07 17:31:55','2017-08-14 19:23:41','<p>A class of BCom students will use an iterative, client-focused, discovery-driven process to research, analyze, prototype and test ideas, and then <strong><u>develop your workable marketing plan, specific to your goals, objectives, and budget</u></strong>.   </p><p></p><p>You provide feedback and engage with the students over the semester while they develop your marketing plan, <u><strong>combining strategic decision making with the creativity of design thinking</strong></u>. In addition to more traditional competitive analyses and marketing mix strategies they will also develop customer empathy, map customer journeys and create customer personas to better focus your marketing plan.</p><p></p><p>As a startup you may not have the resources to fully develop your first marketing plan. Let these students, specialized in this area, do your first plan for you!  If you already have a basic one, let them push it to the next level! Project scopes can include, but are not limited to:</p><ul><li><strong>perform market segmentation analysis</strong></li><li><strong>create customer journey maps</strong></li><li><strong>identify potential customer profiles</strong></li><li><strong>develop promotional strategies</strong></li><li><strong>competitive analyses</strong></li><li><strong>researching potential partners and channels</strong></li><li><strong>pricing strategies, etc.</strong></li></ul><p>Having several teams work on your marketing opportunity will ensure you get diverse perspectives  and a wide range of marketing recommendations to take forward. </p><p></p><p>Preference is given to projects that are in the B2C context and where student teams will have access to existing and potential customers. Preference will also be given to projects that require innovation.</p>',5,'3rd year',0,NULL,'anywhere',NULL),(615,10,'published','Strategy Consulting',NULL,'BUS 478','Strategy',25,2017,'fall','<p>Undergraduate student-consultants will develop a tailored strategic plan addressing unique challenges or opportunities your organization is facing. </p>','group','2017-10-02','2017-12-08',20,NULL,'<p><strong>Project deliverables will include:</strong></p><ul><li>4-10 page comprehensive plan</li><li>Presentation with Q&amp;A and presentation slides</li></ul>',3,NULL,'2017-07-07 18:27:13','2017-08-24 21:20:37','<p>Starting this October, a small team of senior business student-consultants will spend roughly 20 hours each (approximately 60-100 hours in total) over the course of the semester performing a strategic analysis of an organization experiencing disruptive change. In doing so, they will develop actionable recommendations, as well as an implementation plan highlighting options for future direction. The strategic analysis could be on an organization being threatened by disruptive change or making use of a disruptive change to challenge established organizations.</p><p></p><p><strong>Projects could include, but are not limited to:</strong></p><ul><li>Marketing to an emerging customer segment</li><li>Gathering market intel on the external environment to stay ahead of the curve</li><li>Leveraging and implementing new technology</li><li>Repositioning a key function to leverage a shift in the business environment</li></ul><p></p><p></p>',5,'4th year',0,NULL,'anywhere',NULL),(616,370,'published','Agribusiness Marketing Plan',NULL,'AGBU4340','Agribusiness Marketing',30,2017,'fall','<p>Student-consultants will develop a tailored marketing plan for your agribusiness organization to provide you with actionable marketing strategies and insights.<br/> </p>','group','2017-08-23','2017-12-07',40,NULL,'<p>Students will provide the partner organizations with the following deliverables:</p><ul><li>5-page marketing plan</li><li>20-minute oral presentation of the plan</li></ul><p></p><p>The marketing plan covers the following aspects:</p><p></p><p>1. Executive Summary/Introduction</p><p>2. Market Analysis (Environmental/Situation Analysis)</p><p>3. Marketing Strategy</p><p>4. Marketing Goals and Objectives</p><p>5. Marketing Mix</p><p>6. Financial Evaluation</p><p>7. Marketing Implementation and Control</p>',2,NULL,'2017-07-07 22:00:33','2017-08-04 21:46:32','<p>Starting in late August, a group of five third- and fourth-year students will be matched with your agribusiness organization to produce a marketing plan for your exclusive use. </p><p></p><p>The students will dedicate 200+ hours to conduct market research and competitive analysis to learn about your industry and specific business, and conductive a thorough analysis to guide their marketing plan. They will provide you with a customized marketing plan which takes into account your goals and objectives.</p><p></p><p>Past projects have included:</p><ul><li>Cajun Eggspress</li><li>O-live Animal Feed</li></ul><p></p><p></p>',5,'3rd & 4th year',0,NULL,'anywhere',NULL),(617,124,'review','Business Process Management Plan',NULL,'BTM100','Business Technology Management',20,NULL,'fall','<p>Students will build a Recommendation plan for your business processes.</p>','individual','2017-09-05','2017-11-23',50,NULL,'<p>Proposal and 10-minute presentation.</p>',1,NULL,'2017-07-07 22:36:11','2017-07-07 22:47:43','<p>Students will build a Recommendation plan for your business processes.</p>',1,'4th Year',0,NULL,'anywhere',NULL),(618,90,'published','Electrical or Computer Engineering Design Capstone',NULL,'EECE 410','Capstone Design I & II - Senior Year Projects - Fall and Spring Semesters ',16,2017,'fall','<p>Student-consultants will address an electrical and/or computer engineering challenge of your choosing and develop an engineering tool to solve your challenge.</p>','group','2017-08-29','2018-05-04',100,NULL,'<ul><li>Analysis and simulations</li><li>Demonstration</li><li>Documentation following the related industrial standards</li><li>20 min presentation in December</li><li>20 min presentation in May</li></ul>',4,NULL,'2017-07-08 13:36:07','2017-08-14 18:54:36','<p>Over a full year, senior electrical and computer engineering students will complete a project that benefits your business, either individually or in teams.</p><p></p><p>As the industry partner, you select an issue, challenge, or idea that relates to the students&#x27; field, and they devote their capstone project to tackling that topic. Throughout the project, students will be under the direction of a faculty coordinator and mentor.</p><p></p><p>In the first semester students will: </p><ul><li>Identify the problem to be investigated.</li><li>Research the associated topics including relevant literature.</li><li>Develop the engineering tools (e.g., application software, HLLs) as needed or appropriate.</li><li>Develop a comprehensive plan for completion of the project.</li><li>Complete any necessary preliminary testing or feasibility studies.</li></ul><p>Examples include but are not limited to:</p><p></p><ul><li>Solar Powered Quadcopter : The use of commercial drones for surveillance, commercial, and consumer recording is increasing. The electronic quadcopter market currently faces a problem of maximizing flight time. Low-end consumer models can fly for approximately 20 minutes on average. The objective of this project is to construct a quadcopter drone with an intelligent power management system to increase flight time. Using a commercially available drone kit as a base, we build a solar cell array and integrate it into the drone power system. Optimization for energy production versus mass is conducted to optimize production versus weight. Fourth-year knowledge required for this project includes power systems, hardware architecture, control systems, power conversion, energy loss, and embedded software design. The advantage of this drone, aside from longer flight time, is an improvement in the commercial feasibility of drones.</li></ul><p></p><ul><li>Cryptography : Cryptography in embedded devices, especially small or mobile, is often lacklustre because the cost, time, and power usage often outweigh the risks of having little to no security. The objective of this project (Cryptonite) is to enable low power, high quality, easy-to-use cryptography in embedded devices. This is done by providing a hardware implementation of the &quot;Networking and Cryptography Library&quot;, supporting low-power symmetric encryption, asymmetric encryption, and hashing. The hardware implementation is prototyped and proven on a field programmable gate array</li></ul><p>The second semester will be devoted to the execution of the project, as scoped out by the students in partnership with the industry partner.</p><p></p><p>The plan must reflect those normally produced by professional engineers in similar assignments. The team members will meet frequently with the faculty mentor to discuss and evaluate progress. </p><p></p><p></p>',5,'4th year',0,NULL,'anywhere',NULL),(619,414,'review','Finance Consultancy',NULL,'Fi330','Finance Capstone',28,2018,'winter/spring','<p>Student-consultants will research your organization&#x27;s finance operations, identifying opportunities for efficiency and growth. </p>','group','2018-01-23','2018-04-27',100,NULL,'<p><strong>Your organization can expect:</strong></p><ul><li>A comprehensive written report outlining the project and its outcomes. </li></ul><p></p><ul><li>A 45-minute presentation to your organization, detailing the process and outcome of the project.</li></ul>',7,NULL,'2017-07-08 21:53:18','2017-08-21 14:50:53','<p>Beginning this January, a group of four finance students will spend 400 hours in their final semester working to positively impact your finance operations.</p><p></p><p>Based on information you provide and the goals communicated, student-consultants will provide you with a researched and well-developed portfolio of financial opportunities for your organization. During the project, students are lead by a professor with extensive experience in corporate finance and investment strategies. </p><p></p><p><strong>Example outcomes include, but are not limited to:</strong></p><ul><li>Develop a model investment portfolio;</li><li>Conduct investment research;</li><li>Make recommendations based on findings;</li><li>Evaluate various corporate M&amp;A opportunities;</li><li>Evaluate new products and business line opportunities;</li><li>Develop corporate budgets;</li><li>Generate cash-flow forecasting.</li></ul>',4,'4th year',0,NULL,'regional',NULL),(620,NULL,'review','Client Consulting Engagement',NULL,'ENT-419','Delivering Value - Entrepreneurship Capstone',20,2017,'fall','<p>The final client-determined, and student-driven project includes around business/marketing strategy, social media campaigns, market research, and opportunity identification and validation.</p>','group','2017-09-18','2017-12-06',40,NULL,'<p>Project deliverables include:</p><p>Proposal (Week 3)</p><p>Negotiated Deliverables (based on client/team negotiated project scope - throughout the semester)</p><p>Final Report/Presentations and Deliverables (plans, strategies, etc. - Week 14)</p>',5,NULL,'2017-07-09 19:09:59','2017-07-09 19:29:40','<p>1. Social media strategy and campaign(s).</p><p>2. Focus groups</p><p>3. Business/marketing plans</p><p>4. Validation of existing business opportunities</p><p>5. Identification and feasibility of new business opportunities</p><p></p>',4,'4th year (graduating seniors)',0,NULL,'regional',NULL),(621,124,'published','Mobile App Design and Clickable Prototype',NULL,'UXUIP-s17','UX/UI Design',30,2017,'fall','<p>Students will design a mobile application applying user experience and user interface techniques over 3 weeks. At the end of this 3 week sprint, a minimum viable product will be designed.</p>','group','2017-07-12','2017-09-21',100,NULL,'<p>A clickable prototype ready to be use for development by developers. </p><ul><li>Hand over deliverables include:</li><li>Research data</li><li>Clickable prototype</li><li>Wireframes</li><li>Visual designs (icons, branding etc.)</li><li>Information architecture</li></ul>',4,NULL,'2017-07-09 20:48:32','2017-08-14 14:52:54','<p><strong>User Experience</strong></p><ul><li>Research ( Organizational / domain / user / competitive comparative etc.)</li><li>Planning of design sprint (information architecture, data analysis, brainstorming etc.)</li><li>Design (wireframes, prototypes etc)</li><li>Testing (user testing, iterating)</li><li>Presentation ( final presentation to community partner on the work done throughout the 3 week sprint)</li></ul><p><strong>User Interface</strong></p><ul><li>Research Research ( Organizational / domain / user / competitive comparative etc.)</li><li>Design inceptions, moodboards, art direction</li><li>Design Hi-fidelity mockups from wireframes</li><li>User interface elements (icons, graphics, visual elements)</li><li>Brand Identity (logo, branding etc.)</li><li>Presentation ( final presentation to community partner on the work done throughout the 3 week sprint)</li></ul>',5,'Post-Grad',0,NULL,'anywhere',NULL),(622,NULL,'review','Promotion Plan',NULL,'MKTG 444','Integrated Marketing Communications',32,2017,'fall','<p><strong>Students will form teams of three to five to work on promotion campaigns/plans for your business.</strong> <strong>Senior-level Marketing students will apply IMC principles learned in the class to this semester-long project.</strong></p>','group','2017-08-24','2017-11-16',10,NULL,'<p>The final project deliverables are a complete IMC campaign/plan that includes environmental assessment, SWOT, target markets, objectives, strategies, promotional mix decisions, timeline and budget. The team may also provide rough drafts of created ads and social media spots.</p>',9,NULL,'2017-07-10 15:08:24','2017-08-09 15:07:52','<p>Each team will work on an IMC campaign or plan that includes these components (due 11/2):</p><p> </p><p>Background, Purpose, and Focus</p><p>Marketing Environment assessment</p><p>SWOT Analysis</p><p>Company Mission</p><p>Target Markets/ Market Opportunity Analysis…</p><p>Marketing Objectives</p><p>Marketing Strategy</p><p>Budget</p><p>Second half will be rest of plan --&gt; the promotional mix, implementation, timeline. This is due Thursday, November 16th.</p>',3,'Senior-level marketing majors',0,NULL,'regional',NULL),(623,204,'review','Relational Database Modeling',NULL,'DBA 130','Database Theory',30,2018,'winter/spring','<p>Students will research and design a relational database model for your organization that enhances your current data storage, retrieval, and analysis practices. </p>','group','2018-02-12','2018-03-09',15,NULL,'<p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to devise the project scope and prepare a detailed plan for completion of the database model.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will develop the database model. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome - Database Model Presentation: The team will present the model to your organization, including functionality, benefits, and opportunities of the model.</p>',5,NULL,'2017-07-10 17:09:59','2017-08-21 15:08:13','<p>Beginning this February a group of three IT students will spend 45 hours modeling an analytical database for any area of your organization. </p><p></p><p><strong>Based on the information and goal provided, Students will model a logical relational database design that:</strong></p><ul><li>Satisfies your organization&#x27;s requirements for information retrieval.</li><li>Ensures data integrity.</li><li>Supports business rules relevant to the organization.</li><li>Accommodates future growth.</li></ul><p></p>',3,'2nd year',0,NULL,'regional',NULL),(624,467,'published','Thermal Fluid Systems Modelling',NULL,'MENG 4313','Thermal/Fluid Systems Design',60,2017,'fall','<p>Student teams are expected to formulate basic thermal fluid system and component models, optimize system design selections with respect to cost, and perform design selection of appropriate components.</p><p> </p><p></p>','group','2017-09-12','2017-12-14',50,NULL,'<p>The project deliverables include:</p><ul><li>10-page Preliminary report including project expectations and Gantt chart</li><li>30-page final report that details the engineering work completed, present the energy and cost analysis of system, and provide any project recommendations </li><li>15 minute presentation including any relevant model simulation.</li></ul>',2,NULL,'2017-07-10 17:42:59','2017-07-24 21:25:32','<p>In groups of 5-6, senior students in Mechanical Engineering will spend 50+ hours working with your company to develop a model and design concept of interest. </p><p></p><p>The project will include analysis of the the project issues and objectives, computational modelling, design consulting, and overall energy and cost analysis.</p><p></p><p>They will review and understand the system, develop appropriate models, and evaluate the energy efficiency and cost-effectiveness of the components and system(s).  Additional system analysis and/or development of alternative design can be an additional aspect of the project as appropriate and needed.</p><p></p><p>Examples of what the teams have done include, but are not limited to:</p><ul><li>Analyzing laboratory-scale piping systems,</li><li>Analyzing and evaluating laboratory-scale heat exchangers</li><li>Analyzing and evaluating the performance of a HVAC system, and</li><li>Designing a simple sensor suite to estimate pressure drop across noncircular channels.</li></ul><p>The student teams are proficient in :</p><ul><li>Data Analysis</li><li>Thermal Fluid System Modeling</li><li>System Design</li></ul>',6,'3rd & 4th year',0,NULL,'local',NULL),(625,NULL,'draft','Case Study',NULL,'jour454','AAF',40,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-07-10 18:40:51','2017-07-10 18:40:51',NULL,NULL,'freshman - senior',0,NULL,NULL,NULL),(626,124,'draft','Big Data and Cloud Based Application Development',NULL,'ISM 6930','Big Data for Business Applications',50,2016,'fall','<p>Take your software to the next level with big data and cloud-based application development.</p>','group','2017-09-01','2017-12-01',10,NULL,'<ul><li>Youtube submission of project</li><li>Code uploaded to GitHub </li></ul>',1,NULL,'2017-07-10 18:46:50','2017-07-13 21:05:27','<p>In groups of 5-6, masters students will spend 80+ hours each dedicated to creating the infrastructure for your organization&#x27;s e-commerce website. When the back-end of your website is logically designed this promotes efficient workflow for your internal and external development team. It also positively trickles down to the general user experience of the site.  </p><p></p><p>Some example projects include, but are not limited to:</p><ul><li>Designing/constructing an optimized search tool to categorize information at large-scale</li><li>Creating an information system for cloud-based storage within an online retail store</li><li>Bringing a library catalogue online</li></ul><p>Topics for this project may vary greatly, but the students&#x27; capabilities include implementation of any of the following:</p><ul><li>Implement a system capable of storing huge data sets within any NoSQL database. Eg. in an e-commerce website, create a database with different products to be searched upon – an online store, or any other idea. </li><li>Implement search functionality using Lucene/ Elastic Search/ Solr search indexing over the DB. The search results can also be cached. </li><li>Implement web server in Node.js or any other server to handle request/response. </li><li>Design web page with a search box and Search button. Input search string and hit Search button. </li><li>Display results on the page. You can also try storing images and display in the search result. The system can also be implemented over AWS or Azure or IBM Bluemix Cloud platform.</li></ul>',5,'masters students',0,NULL,'anywhere',NULL),(627,71,'draft','Strategic Consulting',NULL,'STGY - 5900','Corporate & Business Strategy',NULL,2016,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-07-10 19:11:01','2017-07-10 19:11:01',NULL,NULL,'4th Year',0,NULL,NULL,NULL),(628,124,'draft','testing',NULL,'testing','Testing Assignment Saving Abilities',23,2017,'fall','<p>testing</p>','individual','2017-07-10','2017-07-11',20,NULL,'<p>testing</p>',1,NULL,'2017-07-10 20:31:29','2017-07-10 20:32:02','<p>testing</p>',1,'testing',0,NULL,NULL,'2017-07-10 20:32:56'),(629,NULL,'draft','Organizations in Action',NULL,'BUS 344-03','Management and Organizational Dynamics',30,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-07-10 20:57:07','2017-07-14 01:30:43',NULL,NULL,'Undergraduate Juniors and seniors',0,NULL,NULL,NULL),(630,124,'published','Hospitality Strategic Management Analysis/Recommendations',NULL,'RII123','Hospitality Strategic Management and Leadership',45,2017,'fall','<p>Apply strategic management skills to identify/evaluate environment, strategy choice, firm structure, or firm performance.  At conclusion of project, submit strategic analysis paper and presentation.</p>','group','2017-08-29','2017-11-30',15,NULL,'<p>Final project deliverables are&quot;:</p><ul><li>10 page paper including executive summary and recommendations</li><li>15 minute presentation using slides and visuals to support recommendations</li></ul>',1,NULL,'2017-07-10 21:14:50','2017-07-10 21:16:13','<p>A team of 4 graduating seniors will provide a hospitality organization an assessment or recommendations following the co-alignment model of strategic management and leadership:</p><ul><li>Environment scanning: researching current trends impacting the hospitality industry.  Examples include: healthy/local food options; environment friendly practices; new technology resources.</li><li>Strategy choice: investments to build competitive advantage in industry.  Examples include: developing restaurant brands or acquiring existing brands; develop in house or outsource.</li><li>Organization structure: once strategy is selected, make sure employees have skills needed to execute strategy.   Examples: Chief Technology Officers; Social Media Managers.</li><li>Organization performance: financial performance of the strategy, department, or company.  Metrics that drive investor decisions and direct capital expenditures.</li></ul><p></p>',4,'Graduating hospitality undergraduates completing a capstone course',0,NULL,'anywhere',NULL),(631,465,'published','Consulting Project',NULL,'MGT498','Strategy Implementation',35,2017,'fall','<p>Student-consultants will work on a challenge or opportunity your firm is facing and provide analysis and recommendations for moving forwards.</p>','group','2017-08-28','2017-11-30',20,NULL,'<p>The final project deliverables are:</p><ul><li>A 10 page report including analysis, recommendations, and impact</li><li>30 minute presentation + Q&amp;A</li></ul><p></p>',1,NULL,'2017-07-11 02:42:21','2017-08-24 00:31:53','<p>A group of senior BCom students will collectively devote 100+ hours to consulting for your business. Students will provide unbiased assessments, recommendations and strategy guidance regarding opportunities and challenges currently affecting your business.</p><p></p><p><strong>Possible areas of focus could include, but are not limited to:</strong></p><ul><li>Market research</li><li>Technology solutions</li><li>Market entrance/expansion</li><li>Development and use of KPIs/KLIs</li><li>Category management</li><li>Commercialization of social media</li><li>Sales and marketing strategy</li><li>Breaking down silos and leveraging multiple areas of expertise at professional service firms to provide innovative solutions</li><li>Address an issue of concern to the community in which your organization exists</li><li>How to collaborate with clients to turn ideas and needs into products and services</li><li>improving the workplace culture of your business</li></ul>',5,'4th year',0,NULL,'regional',NULL),(632,464,'published','Ergonomic & Human Factors Design',NULL,'IE/EOHS 441 ','Ergonomics and Human Factors',50,2017,'fall','<p>Student-consultants will redesign a workstation or process for your organization to improve workplace productivity and safety.  </p>','group','2017-08-28','2017-12-08',20,NULL,'<p>The final project deliverables will include:</p><ul><li>10-page final report </li><li>15-minute presentation in the final class of the semester</li></ul>',10,NULL,'2017-07-11 15:46:06','2017-08-29 17:45:39','<p>Starting this August, a group of students ranging from juniors through doctoral students will spend approximately 80 hours developing an improved design for employees&#x27; workstations in your organization.</p><p></p><p>Based on the information your organization provides, and your goals for the project, students will conduct an analysis of the workplace and specific processes to design more ergonomic workstations for employees, with the aim of increasing both safety and productivity.</p><p></p><p>The student design projects are intended to allow students to employ human factors engineering concepts to measure, analyze, and design manual work or workstations from any industry.</p><p></p><p>Ergonomic intervention can be done with any of these aims, and the group will take these goals into account: </p><ul><li>Cost reduction</li><li>Productivity improvement</li><li>Quality improvement</li><li>Employee engagement improvement</li><li>Strengthening the safety culture</li></ul><p>Some examples of these semester-long student term projects include, but are not limited to, redesign of any of the following:</p><ul><li>Metro bus driver seat</li><li>Office workstation</li><li>Airline cockpit</li><li>Manufacturing assembly line</li><li>Automobile steering column</li></ul>',4,'3rd year, 4th year, Master\'s, & PhD',1,NULL,'local',NULL),(633,429,'published','Advertising Plan and Strategy',NULL,'MKT 331','Principles of Advertising',25,2017,'fall','<p>Students will develop an original advertising strategy and campaign for your company.</p>','group','2017-09-01','2017-10-01',25,NULL,'<ul><li>Creative brief</li><li>Advertising plan </li><li>15-20 minute presentation to the client (with Q&amp;A)</li></ul>',5,NULL,'2017-07-11 16:42:33','2017-08-24 21:30:35','<p>Based on your stated advertising goals (eg. rebranding, increasing exposure, entering a new region), student groups will develop a creative strategy to plan, prepare, and place messages of integrated brand promotion in front of your best audience(s).</p><p></p><p>The student groups will also create advertising elements for your organization that can be used in creative campaigns for television ads, billboards, magazine, or other mediums.</p><p></p><p>The student&#x27;s project scope will vary depending on your organization&#x27;s goals and budget, but could include any of the below elements:</p><ul><li>Creating a media plan</li><li>Writing copy for creative print ads (and creating print ads)</li><li>Creating graphics or copy for social media campaigns</li><li>Creating video clips for use in a TV ad or YouTube spot</li><li>Mocking up a billboard or other large-scale advertisement (creating out-of-home ads)</li><li>Creating a social media plan</li><li>Creating a finished TV spot</li><li>Creating a finished radio spot</li></ul>',5,'First year advertising students, can range from Sophomore to Senior. ',1,NULL,'regional',NULL),(634,468,'published','Training & Development Report',NULL,'MGMT 4486','Training and Development',45,2017,'fall','<p>Undergraduate students will carry out and write up a training needs analysis, select the appropriate training method and design, and evaluate the effectiveness of the training. </p><p> </p>','group','2017-09-04','2017-11-24',20,NULL,'<p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to devise the project scope and prepare detailed plan for completion of the project.</p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p><strong>Phase 3</strong> - Outcome Report and Presentation: Students will submit detailed report on the outcomes of the project. Teams will also present this in the last class. Organization representative(s) are invited to attend these presentations.</p><ul><li>A 10 page training report document, that will include a training needs analysis, training design and methods, and an evaluation of the training intervention. </li><li>10 minute group presentation. </li></ul>',5,NULL,'2017-07-11 16:55:16','2017-08-04 15:20:13','<p>Starting in September, a group of 3 HR student-consultants will solve a training and development challenge currently facing your business over an intensive 3 week period.</p><p></p><p>Based on the information and goals you have shared with the students, the report they provide will help you improve your current training and development processes. </p><p></p><p><strong>Project examples could include, but are not limited to:</strong></p><ul><li>Orientation training for new employees. </li><li>Training to increase the work-related skills of employees.</li><li>Training that addresses undesired attitudes and/or beliefs in the workplace. </li></ul>',3,'4th year ',0,NULL,'anywhere',NULL),(635,415,'published','Survey Design and Data Visualization',NULL,'ECO 230','Business and Economics Research and Communication',25,2017,'fall','<p>A group of 4 student-consultants will apply survey design principles, to design a survey instrument aimed at producing relevant business information. Teams will also create a template with data visualizations to convey results. </p><p></p><p></p>','group','2017-11-01','2017-12-20',25,NULL,'<p><strong>Project deliverables include:</strong></p><ul><li>Qualtrics survey instrument</li><li>Data Visualizations template (Excel or Tableau)</li></ul><p><strong>Please note:</strong></p><p>Actual data will not be collected. Your organization may partner with students after the project if assistance with data collection and further analysis is desired. Organizations are not obligated to field surveys for project completion.</p>',6,NULL,'2017-07-11 17:05:41','2017-08-17 22:58:11','<p>Looking to collect new data or revise an existing survey? In teams of 4-5, creative 3rd year business student-consultants will design a survey instrument to capture information you are seeking. </p><p></p><p><strong>Project examples can include, but are not limited to, surveys of:</strong></p><ul><li>Demand for a new product or service</li><li>Customer satisfaction</li><li>Marketing effectiveness</li><li>Employee engagement</li></ul><p>Using Qualtrics, an industry-renowned software, teams will create a high quality survey instrument that you can administer using a method of your choosing. They will also provide a template using either Tableau or Excel (your choice) for visualizing survey results. </p><p></p><p>If desired, you may partner with students after the class project ends to collect the data, but there is no requirement to actually field the survey during the class project. No sharing of contact lists is expected or needed to fulfill class requirements.</p>',4,'3rd year',0,NULL,'anywhere',NULL),(636,429,'draft','--',NULL,'MKT 331','',25,2016,'fall','<p>The student will create advertising elements for your organization, that can be used in creative campaigns for television ads, billboards, magazine, or other mediums.</p>','individual','2017-08-14','2017-11-30',40,NULL,'<p>The student will deliver a specific advertising element depending on the client&#x27;s goals and desired advertising medium. He/she will also provide a 5+ page paper describing the rationale behind their creative strategy.</p><p></p>',1,NULL,'2017-07-11 17:17:02','2017-07-12 16:11:49','<p>The student will create advertising elements for your organization, that can be used in creative campaigns for television ads, billboards, magazine, or other mediums. </p><p></p><p>Based on your stated advertising goals (eg. rebranding, increasing exposure, entering a new region), the student will employ creative strategy to plan, prepare, and place the messages of integrated brand promotion.</p><p></p><p>The student&#x27;s project scope will vary depending on the organization&#x27;s goals and budget, but could include any of the below elements:</p><ul><li>Creating a media plan</li><li>Writing copy for creative print ads (and creating print ads)</li><li>Creating graphics or copy for social media campaigns</li><li>Creating video clips for use in a TV ad or YouTube spot</li><li>Mocking up a billboard or other large-scale advertisement (creating out-of-home ads)</li><li>Creating a social media plan</li><li>Creating a finished TV spot</li><li>Creating a finished radio spot</li></ul><p> </p>',1,'Juniors & Seniors ',0,NULL,NULL,'2017-07-12 16:12:35'),(637,341,'review','Strategic Consulting',NULL,'JDC West 2018','JDC West Case Competition Training',27,2018,'fall','<p>Groups of 3 selectively chosen student consultants will work with your organization to provide perspective and address a challenge, problem, or business opportunity identified by you.</p>','group','2017-08-31','2018-01-14',4,NULL,'<p><strong>Project Deliverables include:</strong></p><ul><li>A 20 minute power point presentation including, but not limited to; an analysis, recommendations, and implementation. (Including Q&amp;A period)</li><li>Company exposure on uniforms, social media and team events as well as other deliverables available through sponsorship opportunities.</li></ul><p></p><p></p><p> </p>',10,NULL,'2017-07-11 20:58:26','2017-07-24 22:59:49','<p>Starting at the end of August a group of three Student Consultants participating in JDC west  (the largest business competition in Western Canada). Will be given 3 hours to answer the business problem that your organization has presented them with. </p><p></p><p>Based on the information that your organization provides Students will analyze the problem and make holistic recommendations. These teams of motivated individuals offer valuable insights into the multi disciplinary world of business. </p>',3,'Under-Graduate ',0,NULL,'anywhere',NULL),(638,349,'draft','HDL based Digital System Design on FPGA',NULL,'CSE320','Design and Synthesis of Digital Hardware',60,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-07-11 22:30:13','2017-07-11 22:30:13',NULL,NULL,'3rd year',0,NULL,NULL,NULL),(639,363,'published','B2B Sales Management Plan',NULL,'WWA 009','Sales Management',1,2016,'summer','<p>A Sales Management student consultant will conduct an analysis and provide actionable recommendations for improving or scaling up your organization&#x27;s existing sales force plan.  </p>','individual','2017-08-15','2017-09-15',60,NULL,'<p>The student will work to develop a professional sales management plan (less than 10 pages) that could include a two<strong>-</strong>year sales plan, budgets, forecasts, recruiting plans, as well as their approach to co-coordinate with other departments such as marketing. The student will also present a 7 to 10-minute summary of their plan which will be followed by a Q&amp;A period.</p>',1,NULL,'2017-07-12 21:26:17','2017-08-11 21:49:48','<p> A Sales Management student consultant will conduct an analysis and provide actionable recommendations for improving or scaling up your organization&#x27;s existing sales force plan.  Potential project scopes can include, but are not limited to;</p><ul><li><strong>Audit of existing sales strategy</strong></li><li><strong>How to scale up to reach your sales targets</strong></li><li><strong>Workforce planning for your sales team</strong></li><li><strong>Researching and identifying the right sales tools</strong></li><li><strong>Developing competitive sales compensation packages, etc.</strong></li></ul>',4,'4th year student',1,NULL,'local',NULL),(640,216,'published','Strategic/Technical Consulting',NULL,'BUAD 693','Professional MBA Capstone Consulting Project',25,2018,'winter/spring','<p>  </p><p>Working in teams of 5-6 over a 5-month period, post-graduate student-consultants will address a significant challenge, problem, or business opportunity your organization is facing.  </p><p>  </p>','group','2017-10-02','2018-03-16',200,NULL,'<p>   </p><ul><li>10-12 page report and other deliverables as needed, e.g. electronic tools, process maps, training documents, marketing materials</li><li>1 hour presentation (including Q&amp;A)</li></ul><p></p>',4,NULL,'2017-07-13 17:03:07','2017-08-14 06:41:31','<p>  </p><p>4-5 student-consultants will work 200 hours to address a significant challenge that truly matters to your organization. In the past students have successfully completed process improvement projects; customer discovery and product-market fit assessments for evolving products/services; market/segment attractiveness evaluations for existing products/services; big data projects to identify &quot;so what&quot; insights and create actionable recommendations; and strategy projects that develop and evaluate one or more options according to short/long-term client criteria.</p><p></p><p>Here are a few examples of past projects:</p><ul><li>evaluating new markets for potential entry</li><li>analyzing invoicing delays, delinquent payers, and contract terms to identify opportunities to reduce working capital costs</li><li>applying design thinking principles to develop ideas to double same-store sales while reducing store size by half</li><li>developing actionable customer profiles and a multi-pronged marketing strategy including digital media</li><li>analyzing spend across plants to identify patterns, categories, and opportunities to reduce costs</li><li>creating processes and tools to support capacity analysis and effective workforce planning.</li></ul>',1,'Graduate (MBA) students with 5-6 years professional work experience',0,NULL,'regional',NULL),(641,102,'published','Brand Management Audit & Recommendations',NULL,'MKT 415','Brand Management',35,2017,'fall','<p>Students will work in collaboration with both your organization, as well as respective in-class industry mentors, to deliver a comprehensive Brand Audit, Brand Strategy Roadmap or Marketing Campaign.</p>','group','2017-09-14','2017-11-28',NULL,NULL,'<p>Deliverables could include any or all of the following, to be discussed prior to the commencement of the project.</p><ul><li>An oral (or video) presentation of the completed project</li><li>A report summarizing findings (including but not limited to SEO analytics and recommendations, customer insight reports, etc.)</li><li>Creative briefs and promotional materials</li><li>Other brand management or marketing-related insights generated by student teams, as a result of this project.</li></ul>',4,NULL,'2017-07-13 20:28:39','2017-08-31 16:24:34','<p>Teams of 4-5 students will work in collaboration with industry mentors (with brand management, social media, design, and market strategy backgrounds) to complete one of the following:</p><ul><li>A <u><strong>Brand Audit</strong></u> for your existing brand and provide recommendations for a specific segment and promotional channel(s).</li><li>A <u><strong>Brand Strategy Roadmap</strong></u> for new products based on secondary and primary market research, including but not limited to focus groups, interviews or surveys.</li><li>A <strong><u>Digital Campaign (Social media, web and mobile)</u></strong> to increase brand awareness or create a brand identity.</li></ul><p>You will get the added opportunity of being involved in regular workshops with the student teams and their industry mentors, both in-person or virtually. Active participation between your organization, the student team, and their respective industry mentor is encouraged, but not mandatory (i.e. participation can be done via digital mediums such as Google Drive, Hangouts or e-mail).</p>',5,'3rd & 4th years',0,NULL,'anywhere',NULL),(642,74,'published','Organization Project Plan','Business','BUS 5003','Project Management',50,2017,'fall','<p>A group of student-consultants will develop a thorough Project Management Plan for a project of your choosing. </p>','group','2017-09-12','2017-12-05',80,NULL,'<p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to understand the project scope and prepare a detailed plan for completion of the project.</p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p><strong>Phase 3</strong> - Outcome - Report and Presentation: Students will submit a written project plan. Teams will also formally present their plan in class, which you are invited to attend (virtually or in person).</p>',10,NULL,'2017-07-13 21:20:28','2017-07-28 18:22:00','<p>A group of student-consultants will devote a cumulative total of 480 hours to developing a tailored Project Management Plan for a project of your choosing. Using Project Management Theory, students will put together a thorough breakdown of a future project for your organization, including project requirements, costs, timelines, and responsibilities to help streamline your processes. </p><p></p><p><strong>Project examples could include, but are not limited to:</strong></p><ul><li>Development of a new website</li><li>Implementation of a new software or system</li><li>Business process change</li><li>Office relocation</li><li>Rebranding project or implementation of new logo</li><li>New product/service launch </li><li>Evaluation of new technology or suppliers</li></ul>',6,'Graduate certificate program',0,NULL,'anywhere',NULL),(643,NULL,'draft','Market Risk Analysis in Energy Sector',NULL,'ECON6345','Energy Economics and Finance',20,2018,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-07-14 07:37:41','2017-07-14 07:37:42',NULL,NULL,'MA in Applied Economics',0,NULL,NULL,NULL),(644,48,'published','Capital Structure Consultancy',NULL,'MBA 716','Finance ',12,2017,'fall','<p>MBA student-consultants will conduct an audit and provide recommendations regarding your firm&#x27;s  optimal capital structure. </p>','group','2017-08-26','2017-11-04',40,NULL,'<p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to devise the project scope and prepare a detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome - Report: Students will submit a detailed report containing  recommendations outlining the firm’s optimal capital structure for the next three years that will minimize the cost of capital and maintain or improve the company’s current credit rating. </p>',1,NULL,'2017-07-14 15:27:12','2017-08-29 16:25:14','<p>MBA students will work in groups of 4 to put together a historical analysis of your firm with a focus on capital structure and cost of capital. </p><p></p><p>The students will then analyze the competitive advantage of your firm in terms of its cost of capital, and assess whether it operates under an optimal capital structure.</p><ul><li>The analysis will include a historical perspective on the company&#x27;s earnings performance, capital structure and returns profile, and how these firm metrics will change in the future. Special attention will be given to the relationship between return on capital and cost of capital.</li><li>Based on the historical analysis, and grounded in the current strategies of the Company, the teams will identify the appropriate capital structure to minimize the cost of capital without jeopardizing the firm’s credit rating. </li><li>The assessments and recommendations will be delivered after considering the firm’s earnings growth and capital demands, and will also include benchmarking against select peers.</li></ul>',4,'Master\'s',1,NULL,'anywhere',NULL),(645,23,'published','Integrated Marketing Communications Plan',NULL,'TOUR 312','Tourism Marketing II',36,2017,'fall','<p>Student-consultants will work with your organization to review and recommend areas of improvement in your messaging and communications mix and recommend a B2C, promotional campaign for your small tourism operation.</p>','group','2017-09-18','2017-12-04',30,NULL,'<p>Students will create a themed promotional campaign to a specific target audience.  A media plan with completed research and recommendations will be provided.</p><p></p><p></p><p></p>',4,NULL,'2017-07-14 18:08:04','2017-08-09 19:44:37','<p>Groups of 4 student-consultants will work with your organization to review and recommend areas of improvement in your messaging and communications mix, targeted for your specific tourism operation.</p><p></p><p><strong>Project includes, but are not limited to:</strong></p><ul><li>Analysis and assessment of your current communication strategy</li><li>Determining a new, or more specific, target segment</li><li>Providing messaging strategies to enhance your product&#x27;s brand</li><li>Creating a promotional campaign</li></ul>',4,'3rd & 4th Year Undergraduates; Post-Graduate',0,NULL,'regional',NULL),(646,170,'published','Sales Strategy Consultancy',NULL,'MAR 3400','Professional Selling',21,2016,'fall','<p>A group of student-consultants will develop a unique sales strategy for your company, based on market research and product knowledge, that will improve your sales processes and results.</p>','group','2017-09-18','2017-11-30',25,NULL,'<ul><li>The group will submit a <strong><u>5-7 page Executive Summary</u></strong> with an action plan, supported by detailed appendices up to 10 pages.</li><li>The group will compose a <strong><u>15-20 minute presentation and Q&amp;A</u></strong> highlighting and applying research and findings for your company.</li></ul>',5,NULL,'2017-07-14 18:28:39','2017-08-24 00:28:57','<p> </p><p>Starting this September, a group of five Professional Sales students will spend approximately 125 man hours over the course of the semester developing a custom sales strategy for your company. </p><p></p><p>Through company research and market analysis, student-consultants will create an actionable outline to improve your sales process and make more sales. </p><p></p><p><strong>Areas of focus can include, but are not limited to: </strong></p><ul><li>Sales strategy planning</li><li>Defining a target market</li><li>Identifying top customer profiles</li><li>Stakeholder identification and research</li><li>Developing effective value propositions</li><li>Developing effective sales stories</li><li>Evaluating outreach strategies</li><li>Measuring and monitoring sales success</li><li>Goal setting</li></ul>',5,'3rd & 4th year',0,NULL,'anywhere',NULL),(647,404,'published','Strategy Consulting',NULL,'MAN 489','Strategic Management',45,2017,'fall','<p>4th year student-consultants will analyze a current aspect of your organization, and develop a tailored recommendation plan to solve a challenge or capture an opportunity. </p>','group','2017-10-01','2017-12-15',40,NULL,'<p>The final deliverables for the project will be determined by the project focus provided by your organization. Final deliverables can include:</p><ul><li>3-page project status report mid-way through the semester</li><li>12-page final report with details of research, analysis, findings, and recommendations</li><li>20-minute presentation followed by Q&amp;A (in-person or virtual)</li></ul>',4,NULL,'2017-07-16 14:06:33','2017-07-28 16:22:09','<p>Groups of four student-consultants will work with your organization to evaluate capabilities to execute a strategy change, develop an actionable plan to implement proposed changes. </p><p></p><p>Each team will dedicate 160 hours over the entire semester to assess the state of your organization and industry to identify opportunities you can take advantage of.</p><p></p><p><strong>Project examples could include, but are not limited to:</strong></p><ul><li>Evaluation of organization&#x27;s capabilities to execute a current/new strategy </li><li>SWOT analysis</li><li>Competitive analysis</li><li>Business strategy analysis</li><li>Product and/or market diversification </li><li>Country-based expansion analysis</li><li>Assessment of opportunities to open new markets or better serve an existing market</li><li>An implementation plan for any proposed recommendations</li></ul>',4,'4th Year ',0,NULL,'anywhere',NULL),(648,107,'draft','Finding relationships among variables',NULL,'BU 2240','Business Statistics',30,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-07-17 11:11:23','2017-07-18 16:15:46',NULL,NULL,'first or second year',0,NULL,NULL,NULL),(649,159,'review','International Marketing Analysis & Reporting',NULL,'MARK 3300','International Marketing',33,2017,'summer','<p>The project would provide the students with the experience of working on an international marketing project outside of the USA.  </p>','group','2017-05-22','2017-08-10',60,NULL,'<p>The clients will receive a complete marketing plan with recommendations. </p><p></p><p></p>',1,NULL,'2017-07-17 15:22:31','2017-07-17 15:22:38','<p>Before entering your organization into the international landscape it is important to have an understanding of how to successfully market your product/service. Higher level student-consultants in groups of 4 will spend 40+ hours conducting preliminary research and analysis to develop a marketing report detailing a plan for your organization to go global (beyond the USA). </p><p></p><p>Some areas that these students can help you to understand are:</p><ul><li>How to reach your target market in country of choice</li><li>Most effective marketing techniques for area of choice</li><li>Analysis of the effectiveness of entering market of choice. </li><li>Generate an approach for identifying and analyzing the key cultural and environmental characteristics of any nation or global region</li></ul><p>The expectation is that the students would execute all the required marketing functions (for example: market research, market analysis,  promotion, pricing and distribution). A global marketing strategy can help your organization improve product/service effectiveness, give a strong competitive edge, or heighten customer awareness. Take this opportunity to analyze how you could benefit from expanding internationally.</p>',4,'Senior',0,NULL,'anywhere','2017-07-19 15:34:50'),(650,66,'published',' International Business Operations Management',NULL,'MGM 569','International Business Operations & Supply Chain Management',50,2017,'fall','<p>A group of graduate-level international business students will work on providing recommendations for a specific operational issue of your choosing. Students will conduct analysis and provide you with actionable insights.</p>','group','2017-09-05','2017-11-17',100,NULL,'<p>Students will spend an entire semester working with your organization. At the end of which, they will <u><strong>present an 8-page document</strong></u> detailing the operational issue, the main root cause, and potential recommendations to solve it. The group will <u><strong>present this data to your organization in a</strong></u> <u><strong>30-minute</strong></u> <u><strong>presentation that includes Q&amp;A period for clarifications</strong></u>.</p>',1,NULL,'2017-07-17 17:42:28','2017-08-04 21:42:50','<p>A group of 5 graduate-level international business students will spend the semester working on a specific operational issue that you&#x27;ve been experiencing. </p><p></p><p>You provide the students with the area of focus and direct them on your goals. Then, students conduct a thorough analysis of the operation, identify any root issues and provide actionable recommendations.</p><p></p><p><strong>Past projects have included:     </strong></p><ul><li>Inventory control issues</li><li>Improving quality control and assurance</li><li>LEAN applications and improvements</li><li>Global sourcing or outsourcing issues or recommendations</li><li>Improving supply chain efficiency</li></ul>',5,'MBA ',0,NULL,'anywhere',NULL),(651,NULL,'draft','Strategic Management final team project',NULL,'MGMT4489','Strategic Management',45,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-07-18 03:04:44','2017-07-18 03:04:45',NULL,NULL,'4th year undergraduate students',0,NULL,NULL,NULL),(652,NULL,'draft','Marketing communications ',NULL,'Mktg 420','Marketing communications ',30,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-07-18 10:35:51','2017-07-18 10:35:52',NULL,NULL,'Junior/seniors ',0,NULL,NULL,NULL),(653,107,'published','Analyzing Trends and Relationships',NULL,'BU 2240','Business Statistics',30,2017,'fall','<p>Your organization will work with a group of student consultants to identify a problem that could be solved through deep analysis of your companies data. The students will work to identify trends and relationships to help you solve this problem.</p>','group','2017-09-22','2017-12-08',25,NULL,'<p>The final project will include (as part of a 5-10 page report):</p><ul><li>A brief summary of important trends and relationships discovered from the available data</li><li>Tables and graphs of important statistics and relationships</li><li>A brief summary of conclusions in a document that quickly and efficiently conveys information the company may find interesting or important  </li><li>Recommendations based on the data and information obtained </li></ul><p></p>',1,NULL,'2017-07-18 16:17:58','2017-08-20 19:42:58','<p>Starting in mid-September, your organization will with work with a group of 3 students who will dedicate approximately 25 hours to analyzing data from your organization. Using real data provided by you, students will identify trends and relationships inside large data sets, create presentation-style graphs and tables, and submit their recommendations and conclusions to the company representatives. The primary tool for data analysis will be the programming language R.</p><p></p><p><strong>Possible project examples include, but are not limited to:</strong></p><ul><li>Analysis of sales data to determine the relationship between your products&#x27; or services&#x27; price and volume of sales</li><li>Identifying patterns in sales or usage based on seasonality</li><li>Creating a summary of key customer demographic statistics</li><li>Summarizing results of a customer survey to identify which characteristics are associated with different preferences   </li><li>Drawing a conclusion to a comparative question, such as which of two car manufacturers users are  more likely to recommend to their friends</li><li>Estimating a parameter of a population, such as the proportion of individuals in a population who recommend Subaru cars</li></ul>',3,'2nd year',0,NULL,'anywhere',NULL),(654,463,'review','Data-Driven Consultancy',NULL,'BA 482','Managing Big Data (Capstone on Business Analytics)',12,2018,'winter/spring','<p>Student-consultants will analyze your organization&#x27;s data to discover new insights that will help improve your current processes and make data-driven decisions.</p><p></p>','group','2018-01-15','2018-05-07',150,NULL,'<p> </p><p><strong>Phase 1 </strong>– Project Scope Meeting: Students will meet with organization representative(s) to devise the project scope and prepare a detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. The team will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome - Report and Presentation: Students will submit a 20-page report with data analysis and recommendations. The team will also present this in the last class. Organization representative(s) are invited to attend these presentations. </p>',4,NULL,'2017-07-18 16:47:24','2017-08-18 16:36:23','<p>Beginning in January, a group of three student-consultants will implement analytical tools to solve an organizational challenge that you are currently facing. </p><p></p><p><strong>The data-driven solution that&#x27;s implemented will provide an operational advantage such as:</strong></p><ul><li>Identifying the most profitable customer</li><li>Predicting future outcomes</li><li>Visualizing data for business intelligence</li><li>Designing databases</li></ul><p></p><p>Analytical tools may include:</p><ul><li>SAS Enterprise Guide</li><li>SAS Enterprise Miner</li><li>KNIME Analytics Platform</li><li>Python, Tableau</li><li>SQL Server</li></ul><p></p><p></p>',3,'4th year',0,NULL,'anywhere',NULL),(655,59,'published','Customer Journey Mapping',NULL,'MARK 3215','Buyer Behaviour',35,2017,'fall','<p>Student-consultant will analyze existing data, gather research, and integrate behaviour theory to build a Customer Journey Map. This will visualize how consumers engage with the client, outlining key stages, touchpoints, behavior, and pain points. </p>','group','2017-09-05','2017-12-04',60,NULL,'<p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to devise the project scope and prepare a detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. Any questions from student teams will be gathered by the instructor, and sent to the client in a compiled format to be answered. Questions will be compiled and sent to the client three times during the semester.</p><p></p><p><strong>Phase 3</strong> - Outcome - Report: Students will submit a detailed summary on the outcomes of the project, which will include:</p><ul><li>One Customer Journey Map; a document that visualizes how consumers engage with the company</li><li>One accompanying short report that explains the Customer Journey Map and insights</li></ul>',1,NULL,'2017-07-18 17:21:33','2017-07-25 20:41:12','<p>Starting this September, teams of 2-3 students in this upper-level marketing course will act as consultants to create a Customer Journey Map (CJM). This is a visual document that outlines how consumers engage with your company. They will be tasked with: </p><ul><li>Identifying a key consumer segment to build their CJM around.</li><li>Conducting any additional research (primary or secondary) to analyze the customer journey.</li><li>Describing the key stages a customer will go through when engaging with your company.</li><li>Identifying the key touch-points your company has with the customer (e.g., search ad, website)</li><li>Identifying behavioural insights regarding learning, motivation, values, attitudes, influences, and/or decision making</li><li>Finding key pain points your consumers currently experience</li><li>Providing key insights and suggesting opportunities for you to consider</li></ul><p></p><p>These details will be mapped out visually, and will include an accompanying write-up explaining the map and insights. </p><p></p><p>This assignment would be appropriate for a client looking for a variety of perspectives, insights and analysis on their customers. </p><p></p>',2,'3rd year',0,NULL,'anywhere',NULL),(656,461,'published','Master\'s Business Valuation',NULL,'ACCT 522','Valuation I',75,2017,'fall','<p>Master&#x27;s students will work closely with your management team to create a basic valuation report. Reports will include a company analysis, a projection of future cash flows and investments, and a discounted cash flow analysis. </p>','group','2017-08-29','2017-12-11',25,NULL,'<ul><li>You will receive a basic valuation report (approximately 25 pages) using the income approach (i.e. discounted cash flow analysis), along with an analysis of future growth for your company.</li><li>Students will present their findings to you in a presentation format (approximately 15 minutes) including Q&amp;A.</li></ul>',4,NULL,'2017-07-18 17:39:42','2017-08-24 15:41:47','<p>Starting in August, a group of 3 Master&#x27;s students will spend approximately 75 hours combined over the course of the semester assessing and summarizing your business and competitive position within your industry, leading to an evaluation of your prospects for future growth. </p><p></p><p>Student groups will analyze and normalize your historical income statements and balance sheets to reflect &quot;market participant assumptions&quot;. With your assistance, student groups will project future income and investment needs, and determine appropriate short and long-term growth and discount rates. </p><p></p><p>Finally, students will use a suitable discounted cash flow model to derive an indication of value for your organization. </p>',3,'Master\'s Students',1,NULL,'anywhere',NULL),(657,NULL,'draft','Career Development',NULL,'ORGS4500/6500','Developing Managerial Skills',30,2018,'winter/spring',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-07-18 17:46:16','2017-07-18 17:46:16',NULL,NULL,'3 and 4 year undergrad, senior elective graduate',0,NULL,NULL,NULL),(658,35,'published','Supply Chain Optimization',NULL,'BU435','Supply Chain Management',36,2017,'fall','<p>Groups of business students will apply proven analytics methods to determine how your inventory management or transportation planning for specific products can be improved, also investigating partnerships with retailers for mutual advantage. </p>','group','2017-09-18','2017-11-22',10,NULL,'<p><strong>At the end of the project, your organization will be provided with:</strong></p><ul><li>A concise report (5-pages or less), summarizing findings and recommendations.</li><li>Supporting data for the report in Excel spreadsheets, containing statistical formulas and optimization models.</li></ul>',2,NULL,'2017-07-18 20:09:22','2017-08-21 17:18:12','<p>Beginning this September, two organizations will be served by nine groups of four business students, working 340 hours to analyze and improve your supply chain operations. </p><p></p><p>Using a toolkit of business analytics student groups will analyze selected elements of your supply chain to determine if inventory management or transportation planning can be made more effective. Based on their research and analysis, groups will recommend changes to improve performance. </p><p></p><p>Additionally, teams may identify and evaluate opportunities to partner with a retailer for mutual benefit and increased efficiencies, based on collaborative forecasting, planning, and/or replenishment.</p><p></p><p>The first organization to sign up is welcome to propose a second partner, whether an existing part of their supply chain or a prospective partner.</p><p></p><p><strong>Students will address the following core questions in their analysis:</strong></p><ul><li>Can inventory management or transportation planning for specific products be improved? </li><li>Can a manufacturer and a retailer jointly plan production and sales for mutual advantage, given seasonal variation in retail demand? </li></ul>',4,'4th year',0,NULL,'regional',NULL),(659,383,'published','Strategic Technology Consultancy ',NULL,'TECH 489','Field Experience in Technology',25,2017,'fall','<p>Senior student consultants will work with your organization to help you identify your goals for technology improvements, and provide direction and consulting on how to achieve these. </p>','group','2017-09-18','2017-12-21',60,NULL,'<p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to devise the project scope and prepare a  detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome - Report and Presentation: Students will submit a detailed report on the outcomes of the project. Teams will also present this in the last class. Organization representative(s) are invited to attend these presentations.</p>',5,NULL,'2017-07-18 23:21:49','2017-08-08 20:07:07','<p>Senior-level University College of Technology student teams will offer strategic tech consulting to your organization. Based on the information your organization provides about goals for tech improvements, the students will provide you with:</p><ul><li>Practical recommendations for improving your organization, including cost analyses and feasibility analyses</li><li>Insights into conducting strategic research for the future</li><li>An unbiased view of your organization, as well as helpful ideas and recommendations </li></ul><p><strong>Examples of potential projects include, but are not limited to: </strong></p><ul><li>Proposing solutions and recommendations for computer information systems, mobile apps, cyber defence, cloud technology, project management, networking, database design or implementation, CRM software, information assurance for large and small clients</li><li>Gathering requirements and developing specifications</li><li>Providing Gap Analyses</li><li>Documenting “As Is” and developing “To Be” solutions</li><li>Developing RFP (Request for Proposal)</li><li>Providing technical research for a proposed solution</li><li>Performing feasibility studies</li><li>Assisting in documenting new processes and procedures as needed</li><li>Facilitating testing (if applicable for software or hardware implementation)</li><li>Promoting user acceptance of new processes/systems</li><li>Developing training plans</li></ul>',5,'Seniors',0,NULL,'anywhere',NULL),(660,NULL,'review','Brand Management - Audit and Recommendations',NULL,'MKT 415','Brand Management',25,2017,'fall','<p>Students will work in collaboration with both your organization, as well as respective in-class industry mentors, to deliver a comprehensive Brand Audit, Brand Strategy Roadmap or Marketing Campaign.</p>','group','2017-08-29','2017-12-14',10,NULL,'<p>Deliverables could include any or all of the following, to be discussed prior to the commencement of the project.</p><ul><li>An oral (or video) presentation of the completed project</li><li>A report summarizing findings (including but not limited to SEO analytics and recommendations, customer insight reports, etc.)</li><li>Creative briefs and promotional materials</li><li>Other brand management or marketing-related insights generated by student teams, as a result of this project.</li></ul>',7,NULL,'2017-07-19 00:11:01','2017-07-19 00:27:40','<p>Teams of 4-5 students will work in collaboration with industry mentors (with brand management, social media, design, and market strategy backgrounds) to complete one of the following:</p><ul><li>A <u><strong>Brand Audit</strong></u> for your existing brand and provide recommendations for a specific segment of your organization&#x27;s choosing for promotional channels.</li><li>A <u><strong>Brand Strategy Roadmap</strong></u> for new products based on secondary and primary market research, including but not limited to focus groups, interviews or surveys.</li><li>A <strong><u>digital (Social media, web and mobile) campaign</u></strong> to increase brand awareness or <u>create a brand identity</u>, based on the parameters determined in collaboration with your organization.</li></ul><p>You will get the added opportunity of being involved in regular workshops with the student teams and their industry mentors, both in-person or virtually. Active participation between your organization, the student team, and their respective industry mentor is encouraged, but not mandatory (i.e. participation can be done via digital mediums such as Google Drive, Hangouts or e-mail).</p>',4,'Junior and Seniors',0,NULL,'anywhere',NULL),(661,383,'review','Consultancy: Feasibility Analysis',NULL,'BUSN 489','Field Experience in Business',15,NULL,'fall','<p>Student groups will act as consultants and conduct a feasibility analysis for a new business, product or proposed market expansion (domestic or international).</p>','group','2017-09-18','2017-12-14',60,NULL,'<ul><li>10 - 12 page document outlining research and recommendations</li><li>15-20 minute presentation of findings plus Q &amp; A</li></ul>',3,NULL,'2017-07-19 00:26:59','2017-07-19 21:08:26','<p>The feasibility analysis will include:</p><p></p><ul><li>Statement of purpose</li><li>Market Analysis - current state of industry and market, market trends, industry and market potential, competitor analysis, ease of market entry, potential customer segments, sales projections and other revenue sources</li><li>Technical and Logistical Analysis - how the business will deliver the product or service, location, materials, equipment and technology needed, labor, transportation</li><li>Organization and Structural Analysis - legal requirements such as incorporation, patents, trademarks etc, organizational chart and relevant personnel/founders background and experience</li><li>Financial Analysis - start-up capital, sources of finance, income statement &amp;  cash flow projections and potential returns on investment</li><li>Conclusions and Recommendations</li></ul>',5,'Senior Undergraduate',0,NULL,'anywhere','2017-07-24 23:03:29'),(662,421,'published','Mobile App Design MVP',NULL,'UXFT','UX/UI Design',16,2017,'fall','<p>Students will design a mobile application applying user experience and user interface techniques over 3 weeks. At the end of this 3 week sprint, a minimum viable product will be designed.</p>','group','2017-10-23','2017-11-10',100,NULL,'<p>A clickable prototype ready to be use for development by developers. </p><p>Hand over deliverables include:</p><p>Research data</p><p>Clickable prototype</p><p>Wireframes</p><p>Visual designs (icons, branding etc.)</p><p>Information architecture</p>',5,NULL,'2017-07-19 00:30:34','2017-07-19 01:05:36','<p><strong>User Experience</strong></p><ul><li>Research ( Organizational/domain/user/competitive comparative etc.)</li><li>Planning of design sprint (information architecture, data analysis, brainstorming etc.)</li><li>Design (wireframes, prototypes etc)</li><li>Testing (user testing, iterating)</li><li>Presentation ( final presentation to community partner on the work done throughout the 3 week sprint)</li></ul><p><strong>User Interface</strong></p><ul><li>Research Research ( Organizational/domain/user/competitive comparative etc.)</li><li>Design inceptions, moodboards, art direction</li><li>Design Hi-fidelity mockups from wireframes</li><li>User interface elements (icons, graphics, visual elements)</li><li>Brand Identity (logo, branding etc.)</li><li>Presentation ( final presentation to community partner on the work done throughout the 3 week sprint)</li></ul>',5,'post-grad',0,NULL,'local',NULL),(663,421,'published','eCommerce Digital Marketing Strategy',NULL,'DMP','Digital Marketing Professional ',10,2017,'fall','<p>Students develop a digital marketing campaign for an eCommerce based website and devise a strategy to drive more online sales.</p>','group','2017-10-30','2017-11-17',40,NULL,'<p>The Digital Marketing Strategy report should outline the campaign and digital strategy for the eCommerce organization, including the following:</p><p></p><p>Company Background</p><ul><li>Executive Summary</li><li>Purpose of website and context for brand</li><li>Website audit and social media audit</li><li>Website objectives and how to achieve them</li><li>Target audience and persona</li></ul><p>Analytics</p><ul><li>Digital Marketing Measurement Model (DMMM) for website and social media</li><li>Google Analytics implementation including goals, views and filters, and reports</li><li>Google Tag Manager implementation</li></ul><p>Search Engine Optimization</p><ul><li>Complete an SEO audit</li><li>Keyword research and justification</li><li>On-page, off-page and technical SEO </li></ul><p>Campaign</p><ul><li>Campaign idea and brief</li></ul><p>Content Marketing</p><ul><li>Create a brand filter</li><li>Develop a sample 1 month editorial calendar</li><li>Create a blogging strategy </li><li>Develop and email marketing strategy - recommend an A/B split test for email newsletter content and subject lines</li><li>Create an abandoned cart recovery email template</li><li>Create an influencer outreach strategy</li></ul><p>Social Media</p><ul><li>Audit current social media channels for growth and engagement</li><li>Provide recommendations to optimize and grow each channel</li><li>Assess the effectiveness of current social channels and provide recommendations on where to focus marketing efforts</li><li>Suggest Hootsuite search terms and streams to connect new readers and monitor conversations</li></ul><p>Advertising</p><ul><li>Determine current cost per acquisition for users for each platform</li><li>Develop social advertising campaign using relevant channels</li><li>Develop Google AdWords campaign</li><li>Create dynamic re-marketing campaigns using Google Display</li><li>Recommend an A/B split test to optimize landing pages for conversions</li></ul>',5,NULL,'2017-07-19 00:33:45','2017-07-19 01:05:16','<p>Students develop a digital marketing strategy to drive online sales and/or launch a new product for an eCommerce based business. Within the project deliverables they complete audits on the business&#x27; current website analytics, SEO and social media presence. They create a campaign idea and build out various components of a digital marketing strategy including:</p><ul><li>Google Analytics Optimization</li><li>SEO</li><li>Content </li><li>Email </li><li>Social Media </li><li>Social Advertising - Facebook, Instagram, Twitter, Linkedin</li><li>Google AdWords - Search, Display and Remarketing</li><li>Influencer and Guest Blogging</li></ul><p></p>',3,'1',0,NULL,'local',NULL),(664,421,'published','Digital Marketing Strategy',NULL,'DMF','Digital Marketing Foundation',25,2017,'fall','<p>Students develop a digital marketing growth strategy for their Community Partner.</p>','group','2017-10-24','2017-12-13',40,NULL,'<p>The final report will provide analysis and recommendations for <strong>10 of the following 17 </strong>elements, including both required elements and least 1 from each of Paid, Owned, and Earned.</p><p></p><p><strong>Required</strong></p><ul><li>Digital Marketing Measurement Model</li><li>A sample Google Analytics Custom Report for one of the strategies below</li></ul><p></p><p><strong>Paid</strong></p><ul><li>Search Advertising Strategy</li><li>Social Advertising Strategy</li><li>Visual Advertising Strategy</li></ul><p></p><p><strong>Owned</strong></p><ul><li>Email Capture + Marketing Strategy</li><li>On-Page SEO Strategy</li><li>Landing Page Creation</li><li>Conversion Rate Optimization Audit</li><li>Google Analytics Dashboard</li><li>Google Analytics Audit (Filters, Goals, Events, etc)</li></ul><p></p><p><strong>Earned</strong></p><ul><li>Content Calendar</li><li>Community Management Guidelines/Brand Filter</li><li>A Social Media Campaign Strategy</li><li>Off-Page/Outreach SEO Strategy</li></ul><p></p><p><strong>Marketing Analysis</strong></p><ul><li>User Personas</li><li>Marketing Campaign Funnel Analysis</li></ul>',10,NULL,'2017-07-19 00:37:36','2017-07-19 01:04:14','<p>Students develop a digital marketing campaign and devise a strategy to achieve your company goals whether that be brand awareness, increase sales, website conversions etc.</p>',4,'1',0,NULL,'local',NULL),(665,159,'published','Global Market Analysis',NULL,'MKT 220-A','International Marketing',30,2017,'fall','<p>Graduate student-consultants will work with your organization to prepare a new global marketing plan or analyze an existing foreign market. </p><p></p><p></p>','group','2017-09-01','2017-12-15',20,NULL,'<p>Each group does an <u><strong>oral presentation of  25-30 minutes</strong></u>, which is accompanied by a <u><strong>final report</strong></u> detailing their cultural analyses, strategic insights, and the actions recommended based on the implications of those insights.</p><ul><li>Final report and presentation</li><li>Strategic marketing insights as cultural analysis indicated</li><li>Recommended actions from the insights</li></ul>',1,NULL,'2017-07-19 13:57:35','2017-08-03 21:39:20','<p>Starting this September, graduate student-consultants will spend ~100 hours developing a marketing strategy for your organization to: </p><ul><li><strong><u>go global for the first time</u></strong>, </li><li>or <strong><u>expand into a new market</u></strong>, if already global </li><li>or <strong><u>restructure your global marketing strategies</u></strong> in a foreign market</li></ul><p></p><p></p><p></p><p></p><p><strong>Examples of what students can work on include, but are not limited to:</strong></p><ul><li>Examining the selected country&#x27;s environment (cultural, economic, technological, political and legal) and <em><strong>identifying the potential marketing challenges</strong></em> </li></ul><p></p><ul><li>For first-time entry, developing ways to <em><strong>localize or adapt your product/service, promotional strategies, price, and distribution</strong></em> due to the country&#x27;s cultural differences</li></ul><p></p><ul><li>For existing marketing strategies, <strong><em>predicting the responses from customers, competitors, and industry </em></strong>in your selected country and adjusting marketing strategies</li></ul>',5,'Graduate',0,NULL,'anywhere',NULL),(666,NULL,'review','Fletcher Russell',NULL,'Consequatur aut ex minima accusantium nesciunt corporis consequatur Quo voluptas','Testin this out',1,2020,'winter/spring','<p>test test</p>','individual','2017-07-01','2017-07-29',43,NULL,'',1,NULL,'2017-07-19 15:20:48','2017-07-19 15:22:26','<p>asdf</p>',1,'1986',0,NULL,'anywhere',NULL),(667,217,'draft','Web Design Campaign',NULL,'MMC 6936','Web Design Capstone',12,2017,'fall','<p>Give your organization a new look - students work to build you a responsive website and create branding material to use in marketing campaigns. </p>','group','2017-08-21','2017-12-04',50,NULL,'<p><strong>Student teams will develop research, branding and web tools for a client. Deliverables will include:</strong></p><p> </p><ul><li>Situation Analysis</li><li>Logo Design Proposal</li><li>Branding Guide</li><li>Communication Designs (ex. letterhead, business cards, etc.)</li><li>Fully Functioning Responsive Website</li><li>Campaign Book</li></ul><p></p><p>The student teams will pitch their campaign ideas to the client at the end of the semester. The client can then select a winner and opt to utilize that design work.</p>',1,NULL,'2017-07-19 15:25:41','2017-07-19 15:25:41','<p>In this project a class of (12) Master&#x27;s level students will work a combined total of 600 hours to provide a fully functioning responsive website for your organization. Through research and client feedback channels they will construct a new home for your organization online. </p><p></p><p>Students will also redesign an existing logo or create a new logo, develop branding materials and provide research to the client.</p><p> </p><p><strong>Project examples include, but are not limited to:</strong></p><ul><li>Nonprofit website</li><li>Website for startup companies</li><li>Website for service business</li><li>Website for hotels/restaurants with reservation </li></ul>',1,'Master\'s',0,NULL,NULL,NULL),(668,217,'review','Master\'s Content Marketing',NULL,'MMC 6936','Content Marketing',20,2018,'winter/spring','<p>MBA students will research and develop recommendations for improvement of your content marketing efforts, including extensive custom content examples for your use.</p>','group','2018-01-22','2018-04-13',25,NULL,'<p> </p><p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to confirm the project scope and prepare a detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will research your organization&#x27;s current marketing practices and create the deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome - Report and Content Examples: Students will submit a specific content marketing strategy report, including an editorial calendar. Teams will also submit the following content for use by your organization:</p><ul><li>8 blog posts</li><li>12 Tweets</li><li>6 Instagram posts</li><li>8 Facebook posts</li><li>2 LinkedIn posts</li><li>2 charts or graphic elements or one interactive element for your website</li><li>1 Plan for a hangout or live meetup<br/><br/></li></ul>',3,NULL,'2017-07-19 15:35:22','2017-08-21 14:29:13','<p>Beginning this January, a group of four MBA students will spend 100 hours researching and developing a content marketing strategy for your organization. </p><p></p><p>Students will evaluate your current marketing efforts, make suggestions for improvement, and provide custom content for your use. Content will include blogs, social media posts, website elements, and a live event plan. </p><p></p><p>The research-based strategy and example content will enable your organization to carry out effective content marketing campaigns long-term. </p><p></p><p></p>',4,'Master\'s',0,NULL,'anywhere',NULL),(669,175,'published','MBA Project Management Consulting ',NULL,'BUS 5743','Project Management for Executives',34,2017,'fall','<p>MBA students will act as project managers to: develop a plan of action to help your organization execute, or improve on, a specific project you are looking to launch within your organization. </p>','group','2017-08-29','2017-09-30',20,NULL,'<p> <strong>Final project deliverables include:</strong></p><ul><li>A 10-page final report</li><li>A 20-minute presentation including budget, analysis, and recommendations</li><li>Other relevant recommendations, including Social Media Recommendations etc., as outlined throughout working with your organization</li></ul>',7,NULL,'2017-07-20 03:11:04','2017-07-27 02:10:46','<p>In groups of 4, MBA students will act as project managers to help your organization develop a plan of action for a specific project you are looking to launch within your organization. </p><p></p><p>Using industry-recognized project management methodologies, students will work with you to overcome a particular challenge or identify how to capture a new opportunity.</p><p><br/><strong>Project topics covered can include, but are not limited to:</strong></p><ul><li>Work breakdown structures and Gantt Charts to build an initial plan of action</li><li>Analysis of current bottlenecks and constraints within your organization in a specific process (e.g. information systems, supply chain and logistics)</li><li>Recommendation plan</li><li>Network diagrams</li><li>Workaround plan</li><li>Critical path analysis to assess bottlenecks and</li><li>Critical chain scheduling</li><li>Cost estimation</li><li>Value analysis</li></ul>',4,'MBA',0,NULL,'anywhere',NULL),(670,466,'published','Digital Marketing Mobile App - User Acquisition Strategy',NULL,'DMP','Digital Marketing Professional ',10,2017,'fall','<p>Students develop a user acquisition strategy for a newly launched mobile application and devise a strategy to drive more downloads and retain users overtime.</p>','group','2017-11-20','2017-12-08',40,NULL,'<p>The User Acquisition Strategy report should outline the campaign and digital strategy for the mobile application, including the following:</p><p></p><p>Company Background</p><ul><li>Executive Summary</li><li>Purpose of website and context for brand</li><li>Website/landing page audit</li><li>Social media audit</li><li>App analytics audit</li><li>Website objectives and how to achieve them</li><li>Business Model Canvas</li><li>Market analysis (SWOT and/or Competitor Analysis)</li></ul><p>Analytics</p><ul><li>Digital Marketing Measurement Model (DMMM) for website and social media</li><li>Google Analytics implementation including goals, views and filters, and reports</li><li>Google Tag Manager implementation</li></ul><p>Search Engine Optimization</p><ul><li>Complete an SEO audit</li><li>Keyword research and justification</li><li>On-page, off-page and technical SEO </li></ul><p>Target Persona &amp; Campaign</p><ul><li>Target audience and persona, and brand filter</li><li>Value proposition</li><li>Campaign idea</li><li>Campaign marketing and communications plan</li></ul><p>User Acquisition Strategy - Owned, Paid and Earned</p><p> <strong>Owned Tactics</strong></p><ul><li>SEO audit and recommendations</li><li>ASO audit and recommendations</li><li>Content strategy (blog, video, social media, editorial calendar)</li><li>Email marketing strategy</li></ul><p><strong> Paid Tactics</strong></p><ul><li>Paid advertising - AdWords, GDN, Social advertising, YouTube</li></ul><p><strong> Earned Tactics</strong></p><ul><li>Influencer marketing</li><li>Guest blogging</li></ul><p> </p><p>User Retention Strategy</p><ul><li>Email marketing</li><li>Push notifications</li></ul><p>Monetization Strategy (Optional based on client)</p><ul><li>Paid app downloads</li><li>In-app purchases</li><li>In-app ads</li></ul><p>Projections</p><ul><li>Traffic</li><li>Conversions</li><li>Revenues </li></ul>',3,NULL,'2017-07-20 09:44:50','2017-07-24 11:15:25','<p>Students develop a user acquisition strategy to drive app downloads and increase user engagement for a newly launched mobile app. Within the project deliverables they complete audits on the app&#x27;s current website or landing page analytics, SEO, ASO and social media presence. They create a campaign idea and build out various components of a digital marketing strategy including:</p><ul><li>Google Analytics Optimization</li><li>SEO</li><li>ASO</li><li>Content </li><li>Email </li><li>Social Media </li><li>Social Advertising - Facebook, Instagram, Twitter, Linkedin</li><li>Google AdWords - Search, Display and Remarketing</li><li>Influencer and Guest Blogging</li><li>Push Notifications</li><li>Monetization Strategies</li></ul><p></p>',3,'1',0,NULL,'local',NULL),(671,466,'published','Digital Marketing: E-Commerce Project',NULL,'DMP','Digital Marketing Professional',10,2017,'fall','<p>This assignment involves the creation a marketing campaign and strategy for an e-commerce business. Students will address areas such as Google Analytics, SEO and content strategy.</p>','group','2017-10-30','2017-11-17',70,NULL,'<p> </p><ul><li>20 minute presentation on their findings and recommendations</li><li>40 page marketing strategy report</li><li>Social Media and content calendar</li></ul>',3,NULL,'2017-07-20 10:09:27','2017-07-24 11:17:37','<p>Professional students will be examining their clients past and present marketing strategies, identifying successes and failures and conduct data analysis to come up with effective solutions and suggestions to help achieve the primary business goal of the company. The students will:</p><ul><li>Analyze historic data to identify areas of improvement </li><li>Establish a social media strategy</li><li>Create a strategic marketing campaign </li></ul><p></p>',3,'Post Graduate',0,NULL,'local',NULL),(672,466,'published','Inbound Digital Marketing Strategy B2B',NULL,'DMP','Digital Marketing Professional ',10,2017,'fall','<p>Students develop an inbound marketing strategy for a B2B focused business and devise a strategy to increase lead generation and nurture leads into customers.</p>','group','2017-12-11','2017-12-21',40,NULL,'<p>The Inbound Digital Marketing report should outline the inbound strategy for the B2B focused business, including the following:</p><p></p><p>Market Analysis &amp; Goals</p><ul><li>Business Objectives</li><li>Market &amp; Competitive Analysis</li><li>Baseline Metrics - website and social media audits</li><li>SEO Audit</li><li>Digital Marketing Measurement Model (DMMM)</li><li>Google Analytics &amp; Google Tag Manager</li></ul><p>Targeting &amp; Campaign</p><ul><li>Target Audience &amp; Buyer Persona(s) </li><ul><li>Where do they live online and what are their pain points, problems &amp; questions</li></ul><li>Quality Lead Definition</li><li>Campaign Idea</li><li>Content Creation - eBook, whitepapers, case studies, webinars, events, etc.</li></ul><p>Inbound Marketing Strategy</p><ul><li>Explain each stage of the sales funnel - Awareness, Consideration and Decision</li><ul><li>What is the content strategy at each stage</li><li>What is the promotional strategy - SEO, blogs, social media, forums, groups, events, CTAs</li><li>Lead capture - landing pages, forms, thank you pages</li><li>Lead nurturing workflow - starting conditions, timeline, content shared, email examples, CTAs</li></ul><li>Explain what happens if people enter at various stages of the funnel or if people drop out of the funnel</li></ul>',3,NULL,'2017-07-20 10:22:16','2017-07-24 11:16:37','<p>Students develop an inbound digital marketing strategy to increase lead generation for a B2B focused organization. Within the project deliverables they complete audits on the current website, SEO and social media presence. They create a campaign idea and build out various components of a digital marketing strategy including:</p><ul><li>Google Analytics Optimization</li><li>SEO</li><li>Content Strategies</li><li>Social Media Strategies</li><li>Lead Generation Strategies</li><li>Landing Pages and Forms</li><li>Email Nurturing &amp; Workflows</li></ul><p></p><p></p>',3,'1',0,NULL,'local',NULL),(673,466,'published','UX Design: Capstone Project',NULL,'UXP-F17','UX Design Professional',10,2017,'fall','<p>This assignment involves the full User Experience Design process. Researching, wire framing, design, and testing, producing a mid to high fidelity prototype for a website or app. </p>','group','2017-12-04','2017-12-20',70,NULL,'<p> </p><ul><li>30 minute presentation on their findings and recommendations</li><li>Case study report</li><li>Mid to high fidelity prototype</li></ul>',3,NULL,'2017-07-20 10:48:39','2017-07-25 17:39:50','<p>Professional students will endeavour to understand the company&#x27;s business goals, conduct research and consumer surveying to best understand the needs of the target audience and from this create a website or app layout and design that achieves those goals. The students will:</p><ul><li>Conduct an in person kickoff meeting with the client</li><li>Interview users so we can design a specific solution for them</li><li>Conduct user testing </li><li>Apply design thinking practices and methodologies</li><li>Create a mid to high fidelity prototype </li></ul><p></p><ul><li>Optimizing a specific part of an existing product</li><li>Creating a project from scratch </li><li>Update and refresh an existing website or app </li><li>Content (Copy) needed prior to project kickoff</li></ul><p></p>',3,'Post Graduate',0,NULL,'local',NULL),(674,466,'published','Digital Marketing Strategy',NULL,'DMF','Digital Marketing Foundation',25,2017,'fall','<p>Students develop a digital marketing growth strategy for their Community Partner.</p>','group','2017-10-24','2017-12-13',40,NULL,'<p>The final report will provide analysis and recommendations for <strong>10 of the following 17 </strong>elements, including both required elements and least 1 from each of Paid, Owned, and Earned.</p><p></p><p><strong>Required</strong></p><ul><li>Digital Marketing Measurement Model</li><li>A sample Google Analytics Custom Report for one of the strategies below</li></ul><p></p><p><strong>Paid</strong></p><ul><li>Search Advertising Strategy</li><li>Social Advertising Strategy</li><li>Visual Advertising Strategy</li></ul><p></p><p><strong>Owned</strong></p><ul><li>Email Capture + Marketing Strategy</li><li>On-Page SEO Strategy</li><li>Landing Page Creation</li><li>Conversion Rate Optimization Audit</li><li>Google Analytics Dashboard</li><li>Google Analytics Audit (Filters, Goals, Events, etc)</li></ul><p></p><p><strong>Earned</strong></p><ul><li>Content Calendar</li><li>Community Management Guidelines/Brand Filter</li><li>A Social Media Campaign Strategy</li><li>Off-Page/Outreach SEO Strategy</li></ul><p></p><p><strong>Marketing Analysis</strong></p><ul><li>User Personas</li><li>Marketing Campaign Funnel Analysis</li></ul>',4,NULL,'2017-07-20 10:54:34','2017-07-21 18:57:12','<p>Students develop a digital marketing campaign and devise a strategy to achieve your company goals whether that be brand awareness, increase sales, website conversions etc.</p>',4,'1',0,NULL,'anywhere',NULL),(675,466,'published','Mobile App Design MVP',NULL,'UXFT','UX/UI Design',10,2017,'fall','<p>Students will design a mobile application applying user experience techniques over 3 weeks. At the end of this 3 week sprint, a minimum viable product will be designed.</p>','group','2017-10-23','2017-11-10',100,NULL,'<p>A clickable prototype ready to be use for development by developers. </p><p>Hand over deliverables include:</p><p>Research data</p><p>Clickable prototype</p><p>Wireframes</p><p>Information architecture</p>',2,NULL,'2017-07-20 10:59:10','2017-07-24 12:35:31','<p><strong>User Experience</strong></p><ul><li>Research ( Organizational/domain/user/competitive comparative etc.)</li><li>Planning of design sprint (information architecture, data analysis, brainstorming etc.)</li><li>Design (wireframes, prototypes etc)</li><li>Testing (user testing, iterating)</li><li>Presentation ( final presentation to community partner on the work done throughout the 3 week sprint)</li></ul><p></p>',5,'post-grad',0,NULL,'local',NULL),(676,382,'published','New Product Development & Launch Plan',NULL,'MARK43700','Product Innovation',30,2017,'fall','<p>Undergraduate student-consultants will develop (or refine) a new consumer product for your organization to address challenges or opportunities related to consumer research, concept testing, prototype development, and creating a launch plan.</p>','group','2017-08-21','2017-12-01',32,NULL,'<p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to devise the project scope and prepare a  detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome - Report and Presentation: Students will submit a detailed report on the outcomes of the project depending on the project, prototypes and drawings of the refined product. Teams will also present this in the form of a 20 minute video presentation in the last class. Organization representative(s) are invited to attend these presentations.</p>',6,NULL,'2017-07-20 16:15:55','2017-08-04 20:50:00','<p>Starting August, a group of 5 undergraduate students will spend approximately 160 hours over the course of the semester creating a new product and launch plan. </p><p></p><p>Based on information your organization provides and the goals that you&#x27;ve shared with the students, they will provide a deeper analysis needed to develop new consumer product ideas and bring your back-burner project to fruition. </p><p></p><p>The products can be goods such as the &quot;Swiffer&quot;, services like &quot;freaky fast delivery&quot;, or experiences, for example &quot;night golf&quot;, etc. </p><p></p><p><strong>Project examples could include, but are not limited to:</strong></p><ul><li>Consumer research</li><li>Concept testing</li><li>Prototype development</li><li>Creating a launch plan</li></ul>',5,'3rd & 4th years',0,NULL,'anywhere',NULL),(677,31,'published','Entrepreneurship & Innovation',NULL,'MEI 908','Master of Entrepreneurship and Innovation Capstone',35,2017,'other','<p>Graduate students specializing in corporate innovation &amp; start-ups will work in innovation at your organization, or with a start-up company.  A student will work with your company between Jan - Aug 2018, plus conduct research in the fall 2017.</p>','individual','2017-09-21','2018-08-24',0,NULL,'<p>The first deliverable will be the report on the students&#x27; findings at the end of February.</p><p></p><p>Over the work term, there may be various deliverables depending on the nature of the student&#x27;s work.</p>',45,NULL,'2017-07-20 16:36:41','2017-08-22 17:42:33','<p>Starting this October, a graduate student in the Master of Entrepreneurship &amp; Innovation program will be paired with your business to work alongside your team in an immersive internship.  </p><p></p><p>The students don’t need a specific project unless you have one readily available.  They are looking for work experience with your team. Over the fall 2017, in preparation for joining your team, they&#x27;ll conduct industry or project specific market research that includes macro- and microeconomics, competitive analysis, new start-up research, trends and future analysis, and provide you with a report on their findings and recommendations. </p><p></p><p>Between Jan and Aug 2018, the student will work as an intern for your business, conducting a minimum of 250 hours of work to assist your operations. The duration, number of hours (PT or FT) and type of relationship is all negotiable with the student.  A longer internship is our preference. This can be project specific or a typical job in your organization. The students will need to complete certain experience requirements to receive academic credit. </p><p></p><p>This is an opportunity to receive unique insights from a student specialized in managing innovation and start-ups with an entrepreneurial mindset, and receive hands-on assistance in areas your business can use support.</p><p></p><p>Students come from a range of undergraduate degrees: engineering, health, business, and a wide range of arts and sciences.</p><p></p><p>Examples from previous years:</p><ul><li>Innovation Hub pipeline management</li><li>Product Launch</li><li>Ideation and new opportunity exploration</li><li>Project management</li><li>Market research</li><li>Sales and marketing</li><li>Innovation consulting</li><li>Startup skills across all business needs</li></ul>',1,'Master\'s',0,NULL,'anywhere',NULL),(678,71,'published','MBA Strategic Consulting',NULL,'STGY - 5900','Corporate & Business Strategy',50,2016,'fall','<p>A group of student-consultants will provide you with an assessment of opportunities and threats as well as strategic alternatives/recommendations to ensure your organization maintains competitive advantage.</p>','group','2017-09-05','2017-12-15',50,NULL,'<ul><li>2-page executive summary </li><li>40-page comprehensive report outlining analysis and strategic alternatives/recommendations for your organization</li><li>30-minute presentation (if requested)</li></ul>',9,NULL,'2017-07-20 16:55:14','2017-08-23 20:39:52','<p>Starting in September, a group of student-consultants will spend approximately 100 working hours providing your organization with a thorough analysis of opportunities and threats in your organizations environment. They will also present an overview of strategic alternatives/recommendations to ensure your organization maintains competitive edge. </p><p></p><p>Based on information your organization provides and the goals you outline, students will analyze disruptive technologies, socio-cultural trends, economic trends, as well as clients, potential customers, competition, and suppliers. Students will also perform an internal analysis of the different divisions of your organization and, where possible, compare that to similar companies or direct competitors. </p><p></p><p><strong>Project examples could include, but are not limited to:</strong></p><ul><li>Developing a marketing strategy (international and domestic)</li><li>General strategy recommendations </li><li>Assisting a company launch a new product </li><li>New market entry strategy</li></ul><p></p>',5,'MBA',1,NULL,'anywhere',NULL),(679,382,'published','MBA New Product Development: Analysis & Strategy',NULL,'MARK70450','New Product Management',30,2017,'fall','<p>MBA student-consultants will analyze your new product plan, and design actionable recommendations to address a challenge or capture an opportunity.</p>','group','2017-10-08','2017-12-01',18,NULL,'<p><strong>Project deliverables can include:</strong></p><ul><li>20-page report summarizing key analyses</li><li>20-minute video presentation</li></ul>',6,NULL,'2017-07-20 16:56:12','2017-08-04 17:19:26','<p>Starting this October, a group of 5 MBA students will spend approximately 90 hours over the course of the semester analyzing your new product plan and designing actionable recommendations to improve your chances of success in the market.</p><p></p><p>The MBA team can address elements such as:</p><ul><li>Is the product viable? </li><li>Will consumers accept it?</li><li>Is the business case and forecast reasonable? </li><li>Are the design features optimized?</li></ul><p>On each element of your plan, you will receive recommendations regarding chances of success in the market and how to improve your chances. If elements are missing, you will receive a fresh analysis. This process can help you avoid the specific blind spots that your company and plans may have.</p><p></p><p><strong>Note</strong>: A Non-Disclosure Agreement (NDA) can be signed with the students to ensure information confidentiality.</p>',5,'MBA',0,NULL,'anywhere',NULL),(680,99,'published','Marketing Strategy',NULL,'IBM301','Principles of Marketing Management',130,2017,'fall','<p>Undergraduate student-consultants will develop a tailored marketing strategy for your organization to address your challenges/opportunities.</p>','group','2017-09-21','2017-12-07',20,NULL,'<p><strong>Phase 1</strong> – Project Plan: Students will collaborate with organization representative(s) to devise the project scope and prepare a detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong> – Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks and gain clarification.</p><p></p><p><strong>Phase 3</strong> - Outcome - Three Project Reports: Each team of students will submit an actionable 15-page report highlighting the outcomes of the project. This will also include a 2-page executive summary.</p>',8,NULL,'2017-07-20 22:03:13','2017-07-28 16:14:19','<p>Starting this September, three groups of five marketing students will spend approximately 300 hours over the course of the semester addressing your marketing challenge/opportunity (target marketing, positioning, product, promotion, distribution, etc.). </p><p></p><p><strong>Project topics covered can include, but are not limited to:</strong></p><ul><li>Analysis of your current target market, position in the competitive landscape, and marketing mix</li><li><strong>Situation analysis: </strong>Analysis of the internal and external factors affecting your organization, including a high-level assessment of your strengths, weaknesses, opportunities and threats (SWOT)</li><li><strong>Segment analysis: </strong>Identifying a few market segments and profiling target markets</li><li><strong>Competitor analysis: </strong>Analysis of your major competitors in various aspects, such as their target market and marketing mix</li><li>Recommendation plan, including an integrated marketing communication plan</li></ul><p>Each of the three teams will be competing against one another to provide you with the best possible set of recommendations. </p>',5,'3rd year',0,NULL,'anywhere',NULL),(681,124,'draft','Information System Analysis and Consulting Plan',NULL,'MIS 300','Management of Information Systems',50,NULL,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-07-20 22:44:37','2017-07-20 22:44:37',NULL,NULL,'4th Year',0,NULL,NULL,NULL),(682,124,'review','Preface title with “MBA” or “Master’s” if it’s higher-level students -Use & rather than “and” -Keep concise and not jargon-y',NULL,'PPC 101','Promo Page Creation',15,NULL,'summer','<p>Concise/explanatory, a value statement of benefit: (MBA/Undergraduate/etc) student-consultants will develop a tailored (project description) plan/strategy for your organization to: Address challenges/opportunities related to OR Gain insights into</p>','group','2017-07-21',NULL,NULL,NULL,'<p>Include this section if the instructor has not given specific components and it seems to make sense for the assignment:</p><p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to devise the project scope and prepare a  detailed plan for completion of the project.</p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p><strong>Phase 3</strong> - Outcome - Report and Presentation: Students will submit a detailed report on the outcomes of the project. Teams will also present this in the last class. Organization representative(s) are invited to attend these presentations.</p><p></p><p>Alternately, this section can be formatted more simply, as below:</p><ul><li>2-page executive summary and supporting research/data</li><li>10-page comprehensive report</li><li>15-minute presentation followed by Q&amp;A</li></ul>',1,NULL,'2017-07-20 23:09:25','2017-07-21 02:51:06','<h2>Examples:</h2><p><strong>[What]</strong> Starting this (Month), a group of X (Major) students will spend approximately (x hours) over the course of the semester developing/creating/researching/auditing/evaluating/producing …. </p><p><strong>[Why]</strong> Based on information on your organization provides and the goals that you&#x27;ve shared with the students, they will provide you with X that will (identify value ? e.g. help you streamline your hiring process)</p><p><strong>Project examples could include, but are not limited to:</strong></p><ul><li>Environmental scan to improved competitive positioning (where possible outline the what and how it provides value)</li></ul>',1,'Options should be: 1st year, 2nd year, 3rd year, 4th year, Master’s, PHD - If multiple years: 3rd & 4th years',0,NULL,'anywhere',NULL),(683,472,'published','Senior Capstone (Electronics & Electrical) Design Project ',NULL,'ELEC 4309','Senior Design',25,2017,'fall','<p>A group of 2-5 students in their final two semesters of Electrical Engineering will work over two semesters on a project proposed by your organization that addresses your design constraints.</p>','group','2017-08-28','2018-05-04',300,NULL,'<p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to devise the project scope and prepare a plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on the design. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome - Report and Presentation: Students will submit a detailed report on the outcomes of the project. Teams will also present this in the college design competition. Organization representative(s) are invited to attend these presentations. The students will also present the organization with a working version of the design. </p><p></p>',5,NULL,'2017-07-21 18:07:17','2017-07-27 17:12:06','<p>Starting at the end of August students work on a design project proposed by your organization. </p><p></p><p>Based on the project your organization provides and the goals you have shared with the students. The students will contribute the following skills to help you solve your design constraints problems. </p><p></p><ul><li>Microprocessor programming in C, Assembly and Arduino</li><li>Hardware/software interface</li><li>Analog circuit design, amplifiers, filters, power supplies, regulators</li><li>Digital circuit design</li><li>Signal processing and control theory</li><li>RF circuits and electromagnetic wave propagation</li><li>Power generation and energy storage including motors and drives</li></ul><p></p><p><strong>Previous projects include but are not limited to: </strong></p><p></p><p>A self driving suitcase with motors on its wheels that follows a user based on the strength of the blue tooth signal from the user&#x27;s cellphone.  The suitcase is self driving and allows the user to walk hands free in a busy airport. </p><p></p>',5,'4th year',0,NULL,'anywhere',NULL),(684,227,'published','Product Interaction based Software Development',NULL,'CMPT 433','Embedded Systems',47,2017,'fall','<p>Semester project to build an embedded Linux system on real hardware such as the BeagleBone Green. Students choose any topic (their own or from Riipen). Should include a significant amount of C/C++ code and some embedded systems hardware interaction.</p>','group','2017-09-13','2017-12-01',40,NULL,'<p>Students deliver:</p><ul><li>Demo full system during a 3 hour poster session at SFU Surrey</li><li>How-to-guide showing steps for something they figured out (see http://www.cs.sfu.ca/CourseCentral/433/bfraser/links.html )</li><li>Optional: Give project source code to organization if both students and organization agree. Students are free to do with their IP as they choose, so discussion of IP can be part of project selection for groups and organization.</li></ul>',2,NULL,'2017-07-21 19:38:51','2017-08-24 04:39:42','<p>Groups of 4, fourth year students could design and build an embedded system which could help a company solve a specific problem they are facing. Some examples of what students have done include:</p><ul><li>Remote video/audio/temperature capture and display.</li><li>Remote audio playback system with PC integration and playlists.</li><li>Automated beer brewing system to maintain brew temperature on a schedule.</li><li>LED strip light controls.</li><li>Simulated smart-home sensing of temperature and fan controls.</li></ul><p>See the project description web page (in process of being updated from last year):</p><p>http://www.cs.sfu.ca/CourseCentral/433/bfraser/project.html</p><p></p><p>Students will be able do programming for applications running on the embedded system (likely running Linux) and possibly on a server or mobile device. They will be able to interact with existing hardware such as off-the-shelf relays, sensors, or communication modules. For context, some things students are generally <em>unable</em> to do include: PCB circuit design, case design/modeling, electrical design, or heat/environmental simulation. </p><p></p><p>The products students deliver are expected to be at a proof-of-concept or early iteration level; they are not expected to be ready for immediate commercialization. Full commercialization would likely require at least extensive product testing and verification, hardware packaging/integration design, user support documentation, product certification (where necessary), and long-term product support for updates and bug-fixes.</p>',4,'4th Year',0,NULL,'anywhere',NULL),(685,124,'published','Master\'s Strategy Consultation',NULL,'OPRE 6367','Master\'s Strategy Consulting',23,2017,'fall','<p>Students will provide unbiased assessments and recommendations regarding opportunities and challenges currently affecting your business.</p>','individual','2017-08-01','2017-11-30',50,NULL,'<p>Final project deliverables include professional level presentations of:</p><ul><li>Objective situational assessments</li><li>Identification and evaluation of alternatives</li><li>Development of performance measures</li><li>Recommended strategies and actions supported with financial analysis</li></ul><p>Your organization will receive:</p><ul><li>A 30-45 minute presentation on analysis, findings, and recommendations</li><li>A hard copy of the final project report (length of document depends upon scope of the project)</li><li>Direct interaction with UT Dallas students/future professionals for employment opportunities</li></ul>',5,NULL,'2017-07-23 18:49:28','2017-08-18 16:23:04','<p>A group of five Master&#x27;s level student-consultants will work 50+ hours to provide business consulting and strategy guidance to your business.</p><p>These graduate students have diverse backgrounds including engineering, information systems, science and business, and can offer unbiased assessments and recommendations for your company in many areas.<br/></p><p>Possible areas of focus could include, but are not limited to:</p><ul><li>Market research</li><li>Supply chain management/process improvement</li><li>Technology solutions</li><li>Market entrance/expansion</li><li>Data analytics</li><li>Development and use of KPIs/KLIs</li><li>Category management</li><li>Commercialization of social media</li><li>Sales and marketing strategy</li></ul>',1,'MBA, MS',0,NULL,'anywhere',NULL),(686,439,'draft','Innovative Business Solutions',NULL,'BUS 280','Innovation & Design',10,2017,'fall','<p>Two teams of five each will use the Stanford d.school <strong>Human-Centered Design Process</strong> to redesign your product/service or fix a complex business problem based on a deep consumer insight.</p>','group','2017-07-07','2017-08-18',24,NULL,'<p>A presentation including: </p><ul><li>Innovative end product/process, including working prototype(s)   </li><li>Important discoveries in consumer insights</li></ul>',1,NULL,'2017-07-24 17:31:48','2017-07-24 17:31:57','<p>Students will work in teams with diverse experience and backgrounds to ensure innovative approaches and ideas. </p><p></p><p>Through this 5 step process: Empathize, Define, Ideate, Prototype, and Test, students will develop a deep-level understanding of your user/consumer insights and create innovative, prototype solutions that will address<strong> what your consumers want and align it with your goals</strong>.</p><p></p><p><strong>Project examples can include, but are not limited to:</strong></p><ul><li>Improving user experience throughout the consumer lifecycle (e.g. online interactions, buying experience, etc.)</li><li>Optimizing logistics to increase efficiency</li><li>Creative accessibility solutions for the end user</li></ul>',5,'2nd Year',0,NULL,NULL,'2017-07-24 17:33:59'),(687,2,'published','MBA Strategy Assessment ',NULL,'MGMT 6100','Strategy Field Study',480,2017,'other','<p>MBA students undertake a strategic study of the internal/external environment of a client company and develop strategy and action recommendations in reports/presentations. Eight months long starting in September, January or May.</p>','group','2017-09-09','2018-04-02',250,NULL,'<p>Final deliverables are:</p><ul><li>a 40 page business style report summarizing assessment, and presenting strategy and action recommendations</li><li>a 20 minute PowerPoint presentation arguing the value of the recommended strategy and action plans</li><li>Research Papers with up front 1  or 2 page summary of purpose/methodology and major findings</li></ul>',70,NULL,'2017-07-24 18:47:10','2017-08-24 21:30:25','<p>A group of 6-7 MBA students will undertake a comprehensive study of your company, including all the business&#x27;s functions, financial performance, industry, and business model. The students will identify strengths, weaknesses, future prospects and major issues.</p><p></p><p>Having performed this diagnostic, the groups consider alternatives and recommend strategic directions, actions, an implementation plan and financial implications.</p><p></p><p>These recommendations may include any of the below:</p><ul><li>New market entry</li><li>New product offerings </li><li>Sale of the company</li><li>Streamlining operations or channels</li><li>Changing organizational structure</li></ul>',6,'2nd year MBA (graduate studies)',0,NULL,'regional',NULL),(688,10,'published','Industry Project Request & Scoping Form',NULL,'','Industry Project Request & Scoping Form',NULL,NULL,'other','<p>Do you want to work with SFU Beedie students, but have a project scope that doesn&#x27;t fit into one the assignments currently open in this portal? Then please submit your project scope here and we will do our best to match it to a class ASAP.</p>','group','2017-06-04','2017-12-31',50,NULL,'<p>This is open and can be established once we connect you with an educator and student interested in working on your project scope. </p><p></p><p>Often the deliverables include; </p><p> - a report with findings and recommendations</p><p> - a presentation</p><p> - implementation plans</p>',0,NULL,'2017-07-24 19:18:31','2017-08-18 23:37:40','<p>Are you an organization with a project scope outside of what is currently available? Do you have an project idea that could benefit from the time, skills, and effort of commitment of students? </p><p></p><p>It doesn&#x27;t matter if it is a clear project scope or just an idea that needs to to be further explored, please submit it here. </p><p></p><p>Our team will review it, give you a call to gather more information (if necessary) and then try to match it with a class and educator that is appropriate, as soon as possible. </p>',4,'Unknown',0,NULL,'anywhere',NULL),(689,433,'published','Inbound Digital Marketing Strategy B2B',NULL,'DMP','Digital Marketing Professional ',14,2017,'fall','<p>Students develop an inbound marketing strategy for a B2B focused business and devise a strategy to increase lead generation and nurture leads into customers.</p>','group','2017-12-06','2017-12-21',40,NULL,'<p>The Inbound Digital Marketing report should outline the inbound strategy for the B2B focused business, including the following:</p><p></p><p>Market Analysis &amp; Goals</p><ul><li>Business Objectives</li><li>Market &amp; Competitive Analysis</li><li>Baseline Metrics - website and social media audits</li><li>SEO Audit</li><li>Digital Marketing Measurement Model (DMMM)</li><li>Google Analytics &amp; Google Tag Manager</li></ul><p>Targeting &amp; Campaign</p><ul><li>Target Audience &amp; Buyer Persona(s) </li><ul><li>Where do they live online and what are their pain points, problems &amp; questions</li></ul><li>Quality Lead Definition</li><li>Campaign Idea</li><li>Content Creation - eBook, whitepapers, case studies, webinars, events, etc.</li></ul><p>Inbound Marketing Strategy</p><ul><li>Explain each stage of the sales funnel - Awareness, Consideration and Decision</li><ul><li>What is the content strategy at each stage</li><li>What is the promotional strategy - SEO, blogs, social media, forums, groups, events, CTAs</li><li>Lead capture - landing pages, forms, thank you pages</li><li>Lead nurturing workflow - starting conditions, timeline, content shared, email examples, CTAs</li></ul><li>Explain what happens if people enter at various stages of the funnel or if people drop out of the funnel</li></ul>',5,NULL,'2017-07-24 19:30:18','2017-08-09 16:32:11','<p>Students develop an inbound digital marketing strategy to increase lead generation for a B2B focused organization. Within the project deliverables they complete audits on the current website, SEO and social media presence. They create a campaign idea and build out various components of a digital marketing strategy including:</p><ul><li>Google Analytics Optimization</li><li>SEO</li><li>Content Strategies</li><li>Social Media Strategies</li><li>Lead Generation Strategies</li><li>Landing Pages and Forms</li><li>Email Nurturing &amp; Workflows</li></ul><p></p><p></p>',3,'1',0,NULL,'anywhere',NULL),(690,421,'review','UX Design: Capstone Project',NULL,'UXP-f17','UX Design Professional',14,2017,'fall','<p>This assignment involves the full User Experience Design process. Researching, wire framing, design, and testing, producing a mid to high fidelity prototype for a website or app. </p>','group','2017-11-28','2017-12-14',70,NULL,'<p> </p><ul><li>30 minute presentation on their findings and recommendations</li><li>Case study report</li><li>Mid to high fidelity prototype</li></ul>',5,NULL,'2017-07-24 19:39:02','2017-07-24 19:39:50','<p>Professional students will endeavour to understand the company&#x27;s business goals, conduct research and consumer surveying to best understand the needs of the target audience and from this create a website or app layout and design that achieves those goals. The students will:</p><ul><li>Conduct an in person kickoff meeting with the client</li><li>Interview users so we can design a specific solution for them</li><li>Conduct user testing </li><li>Apply design thinking practices and methodologies</li><li>Create a mid to high fidelity prototype </li></ul><p></p><ul><li>Optimizing a specific part of an existing product</li><li>Creating a project from scratch </li><li>Update and refresh an existing website or app </li><li>Content (Copy) needed prior to project kickoff</li></ul><p></p>',3,'Post Graduate',0,NULL,'anywhere',NULL),(691,471,'published','Entrepreneurial Organization & Finance',NULL,'BADM 370','Entrepreneurial Organization and Finance',19,2017,'fall','<p>Four undergraduate student-consultants will examine the role of finance in the lifecycle of your entrepreneurial venture, specifically looking at financial projections of debt, equity, and performance analysis.</p><p></p><p></p>','group','2017-09-04','2017-12-15',20,NULL,'<p><strong>The final project deliverables will be presented in a report format that contains the following elements:</strong></p><ul><li>Spreadsheet projections scenarios</li><li>Comparison of the worst case, best case, and most likely financial outcomes</li><li>Business Valuation</li><li>Capital Budget</li></ul>',4,NULL,'2017-07-24 21:42:52','2017-08-15 22:16:10','<p>Starting in September, groups of 4 - 6 undergraduate business students will work to develop a report on the proposed financing of your entrepreneurial organization.  </p><p></p><p><strong>Students will be able to examine any of the following financial elements of your venture:</strong></p><ul><li>valuing of your business </li><li>analyzing your financial statements</li><li>developing financial projections</li><li>outlining performance analysis </li><li>analyzing your organization&#x27;s debt and equity funding</li></ul><p></p><p><strong>The final report will include:</strong></p><ul><li>Detailed financial projections (using a standard template) for 5 years with month-by-month forecast for the 1st year and annual forecasts for the next 4 years thereafter. The financial projections will include income, expenses, and cash flow. </li><li>A &quot;Sources and Uses of Funds Report,&quot; which contains a debt projections schedule, an equity financing projection, and a capital budget forecast.  </li><li>Students will use net present value tool to summarize the best case, worst case, and most likely scenarios for your venture.</li></ul><p><em>*Students can sign a NDA agreement </em></p>',4,'3rd & 4th years ',0,NULL,'anywhere',NULL),(692,383,'published','Consultancy: Feasibility Analysis',NULL,'BUSN 489','Field Experience in Business',15,2017,'fall','<p>Do you have an idea for a new business, product or service, or want to expand into new markets, but you&#x27;re not sure how viable it is? Senior business students can help you research and evaluate the feasibility of your idea.</p>','group','2017-09-18','2017-12-14',60,NULL,'<p><strong>The final project deliverables are:</strong></p><ul><li>A 10 - 12 page report outlining the research, analysis and recommendations</li><li>A 15-20 minute presentation of the findings, with a Q &amp; A</li></ul>',3,NULL,'2017-07-24 21:56:55','2017-08-01 20:41:34','<p>Groups of senior Davenport students will collectively devote 300+ hours to determining the viability of your potential business venture and provide recommendations for moving forward. The feasibility analysis will include:</p><ul><li>Market Analysis: the current state of industry and market, market trends, industry and market potential, competitor analysis, ease of market entry, potential customer segments, sales projections and other revenue sources</li><li>Technical and Logistical Analysis: how your business will deliver the product or service, location, materials, equipment and technology needed, labor, transportation</li><li>Organization and Structural Analysis: legal requirements such as incorporation, patents, trademarks etc, organizational chart and relevant personnel/founders background and experience</li><li>Financial Analysis: start-up capital, sources of finance, income statement &amp;  cash flow projections and potential returns on investment</li><li>Conclusions and Recommendations</li></ul><p>Project examples can include, but are not limited to:</p><ul><li>Expansion strategy</li><li>New market entry</li><li>Launching a new product or service</li><li>Reinventing an existing product or service</li></ul>',6,'Senior Undergraduate ',0,NULL,'anywhere',NULL),(693,86,'published','MBA Change Process Consultation',NULL,'MBA 770','Leading & Implementing Change',11,2016,'fall','<p>If you are about to embark on a change initiative within your organization, allow an external resource to act as a consultant for you and your team. </p>','group','2017-09-27','2017-12-06',100,NULL,'<ul><li>Final client presentation (10 minutes)</li><li>Executive summary, including a change analysis and recommendations.</li></ul><p>Each of the 5 groups will do <strong><u>3 months of work</u></strong> to help your firm best manage the change you&#x27;re going through - <strong><u>a total of 1000 hours of work</u></strong>. </p>',1,NULL,'2017-07-25 14:36:24','2017-08-28 19:30:05','<p>Groups of MBA students will work with your business on a major change upcoming for your organization. Acting as external consultants, they will analyze the impact of the change on your business, and devise a change management strategy. Note: This is <em>not </em>a marketing project. </p><p></p><p>Their perspective and expertise will allow you to consider new angles and different areas the change could impact.</p><p></p><p><strong>Some examples include:</strong></p><ul><li>a merger or acquisition</li><li>restructuring </li><li>leadership challenge</li><li>implementation of a new technology system</li><li>redesign of an internal system or process</li><li>re-imagine your mission, vision, and purpose</li><li>developing and using learning communities</li><li>developing a partnership with another organization</li><li>preparing your organization for a change in legislation</li></ul>',5,'MBA',0,NULL,'anywhere',NULL),(694,451,'draft','Consulting Plan',NULL,'CON101','Business Consulting',25,NULL,'fall','<p>This assignment focuses on consulting.</p>','group','2017-08-16','2017-10-20',50,NULL,'<p>Project deliverables include:</p><ul><li>10-page final report</li><li>15-minute presentation</li></ul>',1,NULL,'2017-07-25 17:46:37','2017-07-25 17:54:46','<p>In groups of 5, 2nd year business majors will complete a consulting plan.</p><p></p><p><strong>Project examples can include:</strong></p><ul><li>SWOT Analysis</li><li>Recommendation Plan</li></ul>',5,'2nd Year',0,NULL,'anywhere',NULL),(695,433,'review','Digital Marketing Strategy',NULL,'DMF','Digital Marketing Foundation',25,2017,'fall','<p>Students develop a digital marketing growth strategy for their Community Partner.</p>','group','2017-10-17','2017-12-14',40,NULL,'<p>The final report will provide analysis and recommendations for <strong>10 of the following 17 </strong>elements, including both required elements and least 1 from each of Paid, Owned, and Earned.</p><p></p><p><strong>Required</strong></p><ul><li>Digital Marketing Measurement Model</li><li>A sample Google Analytics Custom Report for one of the strategies below</li></ul><p></p><p><strong>Paid</strong></p><ul><li>Search Advertising Strategy</li><li>Social Advertising Strategy</li><li>Visual Advertising Strategy</li></ul><p></p><p><strong>Owned</strong></p><ul><li>Email Capture + Marketing Strategy</li><li>On-Page SEO Strategy</li><li>Landing Page Creation</li><li>Conversion Rate Optimization Audit</li><li>Google Analytics Dashboard</li><li>Google Analytics Audit (Filters, Goals, Events, etc)</li></ul><p></p><p><strong>Earned</strong></p><ul><li>Content Calendar</li><li>Community Management Guidelines/Brand Filter</li><li>A Social Media Campaign Strategy</li><li>Off-Page/Outreach SEO Strategy</li></ul><p></p><p><strong>Marketing Analysis</strong></p><ul><li>User Personas</li><li>Marketing Campaign Funnel Analysis</li></ul>',12,NULL,'2017-07-25 18:17:52','2017-07-25 18:19:09','<p>Students develop a digital marketing campaign and devise a strategy to achieve your company goals whether that be brand awareness, increase sales, website conversions etc.</p>',4,'1',0,NULL,'local',NULL),(696,433,'review','Digital Marketing Mobile App - User Acquisition Strategy',NULL,'DMP','Digital Marketing Professional ',14,2017,'fall','<p>Students develop a user acquisition strategy for a newly launched mobile application and devise a strategy to drive more downloads and retain users overtime.</p>','group','2017-11-15','2017-12-05',40,NULL,'<p>The User Acquisition Strategy report should outline the campaign and digital strategy for the mobile application, including the following:</p><p></p><p>Company Background</p><ul><li>Executive Summary</li><li>Purpose of website and context for brand</li><li>Website/landing page audit</li><li>Social media audit</li><li>App analytics audit</li><li>Website objectives and how to achieve them</li><li>Business Model Canvas</li><li>Market analysis (SWOT and/or Competitor Analysis)</li></ul><p>Analytics</p><ul><li>Digital Marketing Measurement Model (DMMM) for website and social media</li><li>Google Analytics implementation including goals, views and filters, and reports</li><li>Google Tag Manager implementation</li></ul><p>Search Engine Optimization</p><ul><li>Complete an SEO audit</li><li>Keyword research and justification</li><li>On-page, off-page and technical SEO </li></ul><p>Target Persona &amp; Campaign</p><ul><li>Target audience and persona, and brand filter</li><li>Value proposition</li><li>Campaign idea</li><li>Campaign marketing and communications plan</li></ul><p>User Acquisition Strategy - Owned, Paid and Earned</p><p> <strong>Owned Tactics</strong></p><ul><li>SEO audit and recommendations</li><li>ASO audit and recommendations</li><li>Content strategy (blog, video, social media, editorial calendar)</li><li>Email marketing strategy</li></ul><p><strong> Paid Tactics</strong></p><ul><li>Paid advertising - AdWords, GDN, Social advertising, YouTube</li></ul><p><strong> Earned Tactics</strong></p><ul><li>Influencer marketing</li><li>Guest blogging</li></ul><p> </p><p>User Retention Strategy</p><ul><li>Email marketing</li><li>Push notifications</li></ul><p>Monetization Strategy (Optional based on client)</p><ul><li>Paid app downloads</li><li>In-app purchases</li><li>In-app ads</li></ul><p>Projections</p><ul><li>Traffic</li><li>Conversions</li><li>Revenues </li></ul>',5,NULL,'2017-07-25 18:39:09','2017-07-25 18:39:56','<p>Students develop a user acquisition strategy to drive app downloads and increase user engagement for a newly launched mobile app. Within the project deliverables they complete audits on the app&#x27;s current website or landing page analytics, SEO, ASO and social media presence. They create a campaign idea and build out various components of a digital marketing strategy including:</p><ul><li>Google Analytics Optimization</li><li>SEO</li><li>ASO</li><li>Content </li><li>Email </li><li>Social Media </li><li>Social Advertising - Facebook, Instagram, Twitter, Linkedin</li><li>Google AdWords - Search, Display and Remarketing</li><li>Influencer and Guest Blogging</li><li>Push Notifications</li><li>Monetization Strategies</li></ul><p></p>',3,'1',0,NULL,'anywhere',NULL),(697,162,'review','Organization Control and Change',NULL,'MGMT 303-03','Survey of Management',50,2017,'fall','<p>This assignment focuses on the student&#x27;s ability to assess a manager&#x27;s change-management style and align <em>managers </em>with <em>intended</em>, <em>partially intended</em>, or <em>unintended </em>organizational change using the six-images roles and activities framework.</p>','group','2017-10-23','2017-10-30',10,NULL,'<p>The final project deliverables are:</p><ul><li>a change-management profile for each manager participant</li><li>a written report with the profile and recommendations of the types of change outcomes best suited for the manager&#x27;s change-management profile</li></ul><p></p>',5,NULL,'2017-07-26 00:21:19','2017-07-26 01:54:32','<p>In groups of 5, these management students will administer a questionnaire to identify the type of change and change outcomes for which a manager is best suited to manage. Using the questionnaire results and applying the six-images approach they will recommend a change-management profile of <em>controls </em>(roles and activities) and <em>shaping </em>(enhancing capabilities). For example:</p><ul><li>A <em>director </em>will <em>coach </em>for intended change outcomes.</li><li>A <em>navigator </em>will be an <em>interpreter </em>for partially-intended change outcomes.</li><li>A <em>caretaker </em>will be a <em>nurturer </em>in unintended change outcomes.</li></ul>',5,'Sophomore, Junior, Senior',0,NULL,'anywhere',NULL),(698,162,'published','Organization Control and Change Consultancy',NULL,'MGMT 303-09','Survey of Management',50,2017,'fall','<p>Undergraduate student-consultants will assess your organization&#x27;s change-management plan, and align managers with <em>intended</em>, <em>partially intended</em>, or <em>unintended </em>organizational change using the six-images roles and activities framework.</p>','group','2017-10-23','2017-10-30',10,NULL,'<p>The final project deliverables are:</p><ul><li>a change-management profile for each manager participant</li><li>a written report with the profile and recommendations of the types of change outcomes best suited for the manager&#x27;s change-management profile</li></ul><p></p>',1,NULL,'2017-07-26 01:49:19','2017-08-21 22:14:53','<p>Starting this October, groups of 5 student-consultants will administer a questionnaire to identify the type of change and change outcomes for which a manager is best suited to manage. Using the questionnaire results, students will recommend a change-management profile of how certain roles within the organization should interact, in order to achieve the best possible change outcome.</p><p></p><p><strong>Students are proficient in resolving issues like:</strong></p><ul><li>How should a manager conduct themselves to achieve an intended change outcome.</li><li>How should certain roles within the organization act when expecting unintended change outcomes.</li><li>What to do when the change outcome was only partially-intended.</li></ul>',5,'2nd Year, 3rd Year, 4th Year',0,NULL,'anywhere',NULL),(699,162,'review','Organization Control and Change',NULL,'MGMT 303-80','Survey of Management',10,2017,'fall','<p>This assignment focuses on the student&#x27;s ability to assess a manager&#x27;s change-management style and align <em>managers </em>with <em>intended</em>, <em>partially intended</em>, or <em>unintended </em>organizational change using the six-images roles and activities framework.</p>','group','2017-10-24','2017-10-31',10,NULL,'<p>The final project deliverables are:</p><ul><li>a change-management profile for each manager participant</li><li>a written report with the profile and recommendations of the types of change outcomes best suited for the manager&#x27;s change-management profile</li></ul><p></p>',2,NULL,'2017-07-26 01:50:52','2017-07-26 01:53:19','<p>In groups of 3, these management students will administer a questionnaire to identify the type of change and change outcomes for which a manager is best suited to manage. Using the questionnaire results and applying the six-images approach they will recommend a change-management profile of <em>controls </em>(roles and activities) and <em>shaping </em>(enhancing capabilities). For example:</p><ul><li>A <em>director </em>will <em>coach </em>for intended change outcomes.</li><li>A <em>navigator </em>will be an <em>interpreter </em>for partially-intended change outcomes.</li><li>A <em>caretaker </em>will be a <em>nurturer </em>in unintended change outcomes.</li></ul>',3,'Sophomore, Junior, Senior',0,NULL,'anywhere',NULL),(700,162,'published','Training Program for Organizational Change',NULL,'MGMT 443','Organization Design & Change',10,2017,'fall','<p>Undergraduate student-consultants will design a training program to assist your organization in managing an upcoming change.</p>','group','2017-11-28','2017-12-14',30,NULL,'<p> </p><p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to devise the project scope and prepare a detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome - Training Plan: Students will submit a comprehensive training program plan, using an industry-recognized design-thinking approach. Your organization will have the opportunity to submit feedback and students will revise the training plan accordingly, then resubmit for your use. </p><p></p>',2,NULL,'2017-07-26 02:01:37','2017-08-14 17:35:38','<p>Starting this November, a group of three student-consultants will spend approximately 90 hours over a 3-week period creating a training program for a proposed change in your organization. </p><p></p><p>Based on your organization&#x27;s existing change management plan, along with your goals and challenges, students will implement industry-trusted techniques of user focus, experimentation, visualization, and diversity to develop an effective design-thinking training plan. This training will assist your organization in efficiently and effectively managing the proposed change. </p><p></p><p><strong>Students will conduct the following tasks:</strong></p><ul><li>Current assessment of your organization&#x27;s change management plan</li><li>Reviewing your proposed plan</li><li>Formulating a training program plan</li><li>Submitting the plan for your review</li><li>Modifying per your feedback</li><li>Submitting the final version of the revised training program plan</li></ul>',3,'3rd Year, 4th Year',0,NULL,'anywhere',NULL),(701,NULL,'review','Payroll Internship',NULL,'PYRL 2017','Payroll Supervisor',10,2018,'summer','<p>This assignment focuses on a student&#x27;s ability to demonstrate basic payroll practices and procedures. In addition, students gain skills and experience in business correspondence, office procedures, and business supervisory skills.</p>','individual','2017-08-14','2017-09-15',160,NULL,'<p>The final project deliverables are :</p><ul><li>3-page document of 2 payroll cut-off analysis</li><li>20-minute presentation including budget</li><li>Social Media Recommendations</li></ul>',5,NULL,'2017-07-26 02:24:27','2017-07-26 02:37:40','<p>Each student will solve a business challenge currently facing your business over an intensive 4-week period! The challenge can be anything related to business, such as:</p><ul><li>Examine and verify time sheets</li><li>Process payroll per cut-off period</li><li>Interpret laws, ordinances, regulations, contract provisions, and procedures related to payroll process</li><li>Prepare reports and analyses of payroll expenditures</li></ul>',1,'Diploma program graduating students',0,NULL,'local',NULL),(702,162,'review','Crisis Management Board Game Development',NULL,'BADM 300-80','Communication in Business',15,2017,'fall','<p>This assignment focuses on the student&#x27;s ability to apply knowledge, critical thinking, and creativity foran instructional design (ID) approach in the development of a board game exploring the topic of crisis management communication planning.</p>','group','2017-09-19','2017-10-23',40,NULL,'<p>The final project deliverables are</p><ul><li>an online version of the prototype that can be reproduced by the client</li><li>game instructions</li><li>instructional design styled training guide</li></ul>',3,NULL,'2017-07-26 02:37:13','2017-07-26 16:08:36','<p>In groups of 3, over an intensive 4-week period, these student-consultants will create a <em>crisis management board game</em> for instructional design and training purposes in your organization to provide training on</p><ul><li>internal communication</li><li>external communication</li><li>public relation messages</li></ul>',3,'Sophomore, Junior, Senior',0,NULL,'anywhere',NULL),(703,124,'draft','ighdf',NULL,'foigfd','glkjf',65,NULL,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-07-27 18:02:17','2017-07-27 18:02:18',NULL,NULL,'lkfh',0,NULL,NULL,'2017-08-28 23:54:23'),(704,470,'published','Market Research',NULL,'MKT332A',' Advertising',5,2017,'fall','<p>Students will act as consultant to collect market research information relating to your business and industry. They will collect date, perform analysis, and provide recommendations to inform your marketing and business strategy.</p>','group','2017-10-04','2017-11-15',25,NULL,'<p>The final project deliverable is a report that will include:</p><p></p><p>1. Summary of the quantitative research, including key findings.</p><p>2. Recommendations on how and when to introduce your company&#x27;s product or service to the market.</p>',1,NULL,'2017-07-27 18:39:52','2017-08-09 16:33:22','<p>Your organization will be paired with a group of 5 students, who will work with your organization on a market research project tailored to your needs.</p><p></p><p>Based on your goals for the project, students will conduct research to learn more about your brand, your industry and customer base. They&#x27;ll analyze the available date and provide recommendations for market adoption of your product or service.</p><p></p><p>Project examples can include, but are not limited to:</p><ul><li>Identifying new prospective customer demographics to target your marketing</li><li>Competitive analysis across the industry to identify differentiating factors for your business</li><li>Analysis of consumer preferences in your industry</li><li>Review of your target market to recommend appropriate marketing strategies and channels</li></ul>',5,'3rd year',0,NULL,'anywhere',NULL),(705,450,'published','Integrated Marketing Communications Plan',NULL,'MKTG 420','Integrated Marketing Communications',30,2017,'fall','<p>Teams of 5 students will act as advertising consultants for your organization, to create an integrated marketing communications campaign to help solve a marketing challenge or capture an opportunity.</p>','group','2017-09-06','2017-12-15',30,NULL,'<p><strong>Project deliverables can include:</strong></p><ul><li>A 20-minute presentation hitting the highlights of the proposed marketing campaign, plus 10 minutes for Q&amp;A, messaging recommendations you are making to the client.</li><li>Full report, incorporating the integrated marketing plan and any recommendations</li></ul>',6,NULL,'2017-07-27 20:16:23','2017-08-23 15:47:31','<p>Starting this September, teams of 6 students with diverse business backgrounds, will act as advertising consultants to create an integrated marketing communications campaign for your organization. Through the development of a comprehensive marketing strategy, students will work your organization throughout the semester, to help you solve a marketing challenge or capture an opportunity.</p><p></p><p><strong>Project examples can include, but are not limited to:</strong></p><ul><li>A 3-year marketing and growth strategy that will fit within your marketing budget</li><li>Market research, including of your current competitive landscape</li><li>Consumer behaviour and analysis of your current target market(s)   </li><li>Creating buyer personas for current and new target markets</li><li>Developing measurable objectives and key performance indicators</li><li>Implementation timeline</li><li>Budget/cost analysis and recommendations</li></ul><p></p>',5,'3rd & 4th Year',0,NULL,'anywhere',NULL),(706,470,'published','Promotional Plan & Materials',NULL,'MKT 332A','Advertising Consultancy & Design',5,2017,'fall','<p>Student-consultants will create a tailored promotional plan for your organization, complete with samples of promotional materials across different print and digital media. </p>','group','2017-09-13','2017-11-15',50,NULL,'<p>The deliverables are submitted in three phases. The content of phase two and three will be determined and agreed upon in phase one.  </p><p></p><p><strong>Phase 1 -- </strong>Submission of research-based organizational background document including promotional plan objectives, creative themes, and key messaging.</p><p></p><p><strong>Phase 2 --</strong> Submission of interactive and sales promotion materials. (i.e. Broadcast script, print samples)</p><p></p><p><strong>Phase 3 -- </strong>Submission of Public Relations materials, experiential/event/sponsorship materials, and personal selling/direct response promotional materials.</p>',1,NULL,'2017-07-28 15:29:33','2017-08-31 23:09:36','<p>Starting this September, a group of five Business and Marketing students will spend approximately 250 hours over the course of the semester creating a promotional plan for your organization&#x27;s brand, products, or services. </p><p></p><p>Based on the details your organization provides, the student-consultants will tailor an effective and actionable promotional strategy focused around one of the following circumstances:</p><ul><li>New target market</li><li>New product</li><li>New sale</li><li>New geographic region</li></ul><p><strong>The strategic plan will include sample promotion material including, but not limited to: </strong></p><ul><li>Print advertisements.</li><li>PR scripts.</li><li>Sponsorship templates.</li><li>Social media posts.</li></ul><p></p>',5,'3rd year',1,NULL,'anywhere',NULL),(707,14,'published','Social Enterprise Plan',NULL,'COMM 485','Social Entrepreneurship Consultancy',30,2017,'fall','<p>Undergraduate student-consultants will develop focused recommendations and a tactical plan for your local social venture in order to help you take advantage of an opportunity or overcome a challenge that you&#x27;re facing. </p>','group','2017-09-11','2017-11-30',30,NULL,'<p><strong>Phase 1 </strong>– <u>Project Plan:</u> Students will connect with organization representative(s) to devise the project scope, present their team charter, and prepare a detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – <u>Project Execution:</u> Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 2.5 </strong>- <u>Presentation:</u> Students will present their insights, recommendations and plan to their classmates; attendance by representatives from project clients is welcome, but optional. </p><p></p><p><strong>Phase 3</strong> - <u>Outcome - Comprehensive Report:</u> Students will submit a detailed report on the outcomes of the project. Report will cover: definition of the problem or opportunity, supporting research and analysis, recommendations, implementation/action plans, monitors/controls, and limitations/risk analysis, accompanied by appendices containing all their research findings and references.</p>',5,NULL,'2017-07-28 18:26:43','2017-08-16 18:40:07','<p>Starting this September, a group of 4-5 Undergraduate Business students will spend approximately 150 hours working diligently over the course of the semester to produce a professional, clearly structured plan for a problem or opportunity your organization is facing. The final deliverable will include supporting research and analysis, recommendations, implementation/action plans, monitors/controls, and a limitations/risk analysis. An appendices will be included which will contain all their research findings and references.</p><p></p><p></p><p><strong>Areas of focus for this project can include, but are not limited to:</strong></p><ul><li>Creation of a complete business plan for product or service.</li><li>Development of a new market entry strategy.</li><li>Design of a marketing plan to reach a specific target audience.</li><li>Performing a detailed competitor and environmental analysis.</li><li>Conducting an operations management or value chain analysis.</li><li>Managing finances to achieve company goals. </li><li>Assessing and improving HR practices.</li><li>Evaluating the effectiveness of current IT systems.</li><li>Or better yet some combination of these. We welcome complex challenges!</li></ul>',5,'3rd & 4th years ',0,NULL,'local',NULL),(708,14,'published','MBA Social Entrepreneurship Strategy',NULL,'BAEN 546','Social Entrepreneurship',30,2017,'fall','<p>MBA student-consultants will develop a case study report that succinctly describes your social venture&#x27;s strategic context and outlines key, practical recommendations to succeed in the near and long-term future.  </p>','group','2017-11-01','2017-12-01',20,NULL,'<p><strong>Phase 1</strong> – <u>Project Plan:</u> Students will connect with organization representative(s) to devise the project scope, present their team charter, and prepare a detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong> – <u>Project Execution:</u> Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - O<u>utcome - Comprehensive Report:</u> Students will submit a detailed, 5-10 page, report outlining your strategic context and recommendations.</p>',5,NULL,'2017-07-28 19:05:01','2017-09-01 17:06:51','<p>Starting this November, a group of 4-5 MBA students will work diligently over the course of the semester to produce a comprehensive and focused report (5 pages + appendices) addressing your unique needs as a social venture.</p><p></p><p>To be an appropriate match for this assignment, your organization must be driven primarily by a social mission that can be clearly articulated and that is core to your organization&#x27;s structure, operations, and value creation and delivery.</p><p></p><p><strong>Areas of focus can include, but are not limited to:</strong></p><ul><li>Creation of a complete business plan for product or service.</li><li>Development of a new market entry strategy.</li><li>Design of a marketing plan to reach a specific target audience.</li><li>Performing a detailed competitor and environmental analysis.</li><li>Conducting an operations management or value chain analysis.</li><li>Managing finances to achieve company goals.</li><li>Assessing and improving HR practices.</li><li>Evaluating the effectiveness of current IT systems.</li><li>Or better yet some combination of these. We welcome complex challenges!</li></ul>',5,'Master’s',0,NULL,'regional',NULL),(709,361,'review','Hispanic-Focused Marketing Campaign Creation',NULL,'ADV5415','Hispanic Marketing ',25,2017,'fall','<p>Students will develop a unique, integrated marketing communication campaign (IMC) for your organization, focusing on a Hispanic market.</p>','group','2017-09-05','2017-11-30',25,NULL,'<p><strong>The final project deliverable is a comprehensive report based on your organization&#x27;s areas of focus. The report will include the following sections, or their equivalent:</strong></p><ul><li>Executive summary</li><li>Situation analysis</li><li>Positioning statement and rationale</li><li>Marketing and IMC objectives</li><li>Overall IMC plan</li><li>Media plan</li><li>Creative strategy</li><li>Sales promotion plan</li><li>Public relations plan</li><li>Ideas for implementation and evaluation </li></ul><p></p>',1,NULL,'2017-07-28 23:07:12','2017-08-07 18:22:35','<p>Beginning this September, a group of five Marketing Communications students will devote over 125 hours of research and analysis to create a tailored marketing communications campaign for your organization, targeting a Hispanic market. </p><p></p><p>Your organization will receive a research-based strategy plan tailored to the goals you&#x27;ve shared with students. The strategy plan will encompass creative advertising, internet marketing, media, sales promotion, and public relations. </p><p></p><p><strong>Areas of focus for this project include but are not limited to:</strong></p><ul><li>Marketing campaigns for customer segments.</li><li>Reaching an existing segment through a new channel (e.g online advertising).</li><li>Communicating differences between competitors (competitive analysis).</li><li>Identifying new channels and media outlets for improved communications.</li><li>Defining advertising objectives and strategies.</li><li>Creating marketing resources.</li></ul><p></p>',5,'3rd & 4th year',0,NULL,'anywhere',NULL),(710,361,'review','Strategic Advertising Plan',NULL,'ADV 5605','Account Planning',20,2017,'fall','<p>Students will create a comprehensive integrated marketing communications (IMC) campaign for your organization, which includes research, analysis, strategy, creative development, and media planning.</p>','group','2017-09-05','2017-12-07',50,NULL,'<p> </p><p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to devise the project scope and prepare a detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome - Report and Presentation: Students will submit a 12-20 page report covering the agreed upon objectives of the project. </p>',1,NULL,'2017-07-28 23:29:04','2017-08-07 18:01:15','<p>Starting this September, a group of five Advertising students will develop an integrated marketing communications plan for your organization. The campaign will focus on the functional areas of advertising, including research, media, creative design, and account management. Efforts will include:</p><ul><li><strong>Strategic research and analysis</strong> on your organizational history and brand perception, marketing mix, primary and secondary customer profiles, market position, primary and secondary competitors, potential markets and audience targets. Research and analysis will determine the strengths, weaknesses, opportunities, and threats facing your organization.</li><li><strong>Target market analysis</strong> of the geographic, demographic, and psychographic components of your primary and secondary target markets including customer perceptions/attitudes and  purchase behavior relative to the product or category.</li><li><strong>Recommendations</strong> for the integrated marketing communications and creative plans.</li></ul>',5,'4th year',0,NULL,'anywhere',NULL),(711,478,'published','Market Research & Recommendations',NULL,'MKTG 401','Market Research',14,2017,'fall','<p>Student researchers will provide a thoroughly researched action plan for your organization to effectively sell to an identified target market.</p>','group','2017-09-12','2017-12-14',30,NULL,'<p>The final project deliverable will be(1) a 20-minute presentation of the research process and findings and (2) a 10-page report including:</p><ul><li>Executive Summary.</li><li>Research process.</li><li>Findings.</li><li>Recommendations.</li><li>Appendix with data supporting the findings</li></ul><p>.</p>',3,NULL,'2017-07-29 21:48:16','2017-08-21 20:30:28','<p>Starting this September, a group of four Advertising students will spend approximately 120 hours over the course of the semester researching your organization&#x27;s target market and the most effective ways to reach and motivate them to take your desired action.</p><p></p><p>Based on your goals and challenges, Student-researchers will use secondary and primary research methods to create a recommended action plan for your organization. </p><p></p><p><strong>Action plans may include but are not limited to the following content:</strong></p><ul><li>New product appeal to current and potential markets</li><li>Viability of product line expansion</li><li>Brand message effectiveness and alternatives</li><li>Understanding buyer behaviors/intentions</li></ul>',4,'4th year',0,NULL,'anywhere',NULL),(712,92,'published','Master\'s Big Data Analysis',NULL,'BUSINESS F743','Big Data in Finance',25,2017,'fall','<p>Master&#x27;s students will implement data analytics to uncover insights into challenges or opportunities specific to your organization.</p>','group','2017-10-02','2017-12-08',30,NULL,'<p><strong>The final project deliverables are:</strong></p><ul><li>A written report outlining conclusions and recommendations.</li><li>Appendices supporting findings.</li><li>A team presentation to your organization explaining findings and recommendations.</li><li>Data files and models.</li></ul><p></p>',5,NULL,'2017-07-31 05:44:34','2017-08-18 05:48:05','<p>Beginning this October, a group of four Master&#x27;s students will devote 120+ hours to solving a data analytics challenge faced by your organization. Student work will include: </p><p></p><p>1) Framing the problem.</p><p>2) Acquiring and managing large data sets.</p><p>3) Applying modern statistics.</p><p>4) Identifying and implementing the necessary technology infrastructure.</p><p>5) Providing a sustainable management-level solution.</p><p></p><p><strong>Project examples include, but are not limited to:</strong></p><ul><li><strong>Predictive analytics in ecommerce &amp; retail:</strong>  Which products/categories to market to a customer, given the customer profile?</li><li><strong>Predictive analytics in investments &amp; trading:</strong>  Which stocks or securities to purchase following a sequence of events?</li><li><strong>Pricing for new technology products &amp; services:</strong>  How to price a new tech product, based on competitive, customer, and transactional data?</li><li><strong>Credit scores &amp; ratings:</strong>  How to assess the credit risk of a borrower, based on the borrower profile and meta data?</li><li><strong>Financial fraud likelihood:</strong>  What is the likelihood of fraud for a user attempting to access your personal finance solution?</li><li><strong>Customer segmentation &amp; targeting:</strong>  What value to assign to a customer based on the past purchase and/or transactional data and customer profile?</li></ul><p></p><p></p>',4,'Master\'s',0,NULL,'regional',NULL),(713,92,'published','MBA Financial Model Building',NULL,'BUSINESS F735','Financial Modelling',20,2017,'fall','<p>Master&#x27;s students create a purpose-built, scalable financial model for your organization, complete with usage and integration instructions.</p>','group','2017-10-02','2017-12-08',20,NULL,'<p>The final project deliverables are:</p><ul><li>A full spreadsheet model in <em>Microsoft Excel</em> format.</li><li>User documentation report supporting the model.</li></ul>',5,NULL,'2017-07-31 06:54:37','2017-08-24 00:07:01','<p>Beginning this October, teams of three to four MBA students will spend 60-80 hours designing and implementing a spreadsheet model designed to solve a significant organizational problem. All models are provided with the underlying spreadsheet files and detailed documentation for your organization&#x27;s reference.  </p><p></p><p><strong>Sample models include, but are not limited to:</strong></p><ul><li>Financial statement models</li><li>Time Series / Forecasting models</li><li>Real estate valuation models</li><li>Portfolio, risk, and trading models</li><li>Venture investment models</li><li>Big data and statistical models</li><li>Customer segmentation models</li></ul><p>Based on the needs and goals of your organization, the financial model may include the following technical features: </p><ul><li>Advanced spreadsheet functions.</li><li>Datatables/arrays/pivot tables.</li><li>Solver/optimization.</li><li>Statistical and scenario analysis tools.</li><li>VBA and automation.</li><li>User interfaces.</li><li>Integration with external databases.</li></ul><p></p><p></p>',3,'Master\'s',0,NULL,'regional',NULL),(714,NULL,'review','Software Design & Implementation',NULL,'SE 311','Software Design and Architecture',6,2017,'fall','<p>A group of five to six students will design and/or code a problem-solving software program for your organization that takes one or more files and performs a transformation, cleaning, or summarization process. </p>','group','2017-09-25','2017-12-08',5,NULL,'<p>Student Software Developers will provide your organization with:</p><ul><li>A proprietary software that efficiently solves an organizational problem.</li><li>An executive summary of the purpose and usage of the program.</li><li>A report describing in detail the functions of the program.</li><li>A presentation to your organization on the development and usage of the software.</li><li>All source code for the software.</li></ul><p></p>',1,NULL,'2017-07-31 16:22:26','2017-08-07 19:21:25','<p>  </p><p>Starting this September, a group of five to six Software Engineering students will spend approximately 25 - 30 hours over the course of the semester designing and creating a proprietary software on Linux or Windows, using C/C++.  </p><p></p><p>Based on information on your organization provides and the goals that you&#x27;ve shared with the students, they will provide you with a simple program that will streamline an organizational process through automation. </p><p></p><p>Do you have a repeated task that is time-consuming or prone to human error? Eliminate this strain on productivity with a tailored software solution. </p><p></p>',6,'3rd year',0,NULL,'regional',NULL),(715,89,'published','Market Insights for College-Aged Target',NULL,'BUS 418','Listening to the Customer',40,2017,'fall','<p>Student-researchers will develop insights into a college-aged market through scientific research methods, providing your company with unique, targeted marketing and sales intelligence. </p>','group','2017-09-18','2017-11-30',50,NULL,'<p><strong>Phase 1</strong> – Project Plan: Your organization will work directly with the instructor to finalize the project scope, prior to September 17th. Following that, the first meeting between the students and your organization will be arranged for late September.</p><p></p><p><strong>Phase 2</strong> – Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome - Report and Presentation: Students will submit a 10-page report on the insights and recommendations for your organization. The report will include an appendix of primary data up to 100 pages. The conclusions will be presented in the final class. Organization representative(s) are to participate in these presentations virtually and will be provided the slide deck. The report and presentation will include:</p><ul><li>Executive Summary</li><li>Research Brief</li><li>Methodology</li><li>Conclusions</li><li>Recommendations</li><li>Appendix &amp; Supporting Material</li></ul>',1,NULL,'2017-08-01 20:44:55','2017-08-24 19:12:55','<p>Starting this September, eight groups of business students will spend approximately 200 hours over the course of the semester researching the college-aged target market. </p><p> </p><p>The research, guided by your company goals, will provide you with actionable information on the interests, activities, and purchasing behavior of actual college-aged consumers.  Based on rigorous and systematic research and data analysis, the student-researchers will present their conclusions and recommendations for targeting this audience though sales and marketing. </p><p></p><p><strong>Research may include, but is not limited to:</strong></p><ul><li>Ethnography</li><li>Focus groups</li><li>Interviews</li><li>Surveys</li></ul>',5,'3rd year',0,NULL,'anywhere',NULL),(716,49,'published','MBA Integrated Marketing Communications Plan',NULL,'MBAC664','Advertising and Promotion Management',12,2017,'fall','<p>MBA students will develop an integrated marketing communications (IMC) campaign for your organization to help you define your brand, increase brand awareness, and grow your customer base. </p>','group','2017-08-28','2017-12-04',20,NULL,'<p>The project deliverables are:</p><ul><li>45-minute verbal presentation of the strategy and campaign;</li><li>An annotated set of presentation slides with back up materials (e.g., relevant research, creative, media plan, and budget)</li></ul>',1,NULL,'2017-08-01 21:57:04','2017-08-21 20:46:53','<p>Starting this August, groups of 3-4 MBA students will spend about 60-80 hours over the semester, working with your organization to prepare integrated marketing communications campaigns for your use. The structure will be competition-style, where your company selects the best of the three projects at the end of the semester.</p><p></p><p>The marketing campaign strategies they develop will include:</p><ul><li>Brand inspiration</li><li>Strategic positioning</li><li>Advertising: creative and media plans</li><li>Promotional strategy</li><li>Proposal for assessment of success</li></ul><p>The students&#x27; aim will be to ensure consistent brand communication across all channels and help you to refine your marketing strategy and grow your brand awareness.</p><p></p><p>Over the course of the project, you can expect students to complete the following stages:</p><ul><li>Analysis of the current communications strategy of your organization (or a specific product, service or program offered by your organization)</li><li>Industry analysis and assessment of the market and consumer behavior</li><li>Establish baseline goals and realistic communication objectives</li><li>Develop a creative positioning for your organization or product (complete with some representative creative executions)</li><li>Propose a media plan (subject to a budget), and develop a plan for assessing the success of the plan in reaching the proposed objectives.</li></ul><p></p>',3,'2nd year MBA',0,NULL,'regional',NULL),(717,71,'published','Strategic Marketing Plan',NULL,'BUSI 2208','Introduction to Marketing',150,2017,'fall','<p>Business students will address a marketing challenge or opportunity of your choosing, applying marketing concepts and principles to provide you with strategic recommendations.</p><p></p><p></p>','group','2017-09-08','2017-11-17',15,NULL,'<p>The final project deliverable is a formal marketing plan, which includes:</p><ul><li>An executive summary</li><li>A clear statement of the marketing issue (problem or opportunity)</li><li>A thorough environmental analysis, identifying organizational strengths and weaknesses along with opportunities and threats (SWOT analysis)</li><li>A segmentation analysis</li><li>3 alternative strategies to resolve the marketing issue</li><li>A recommended strategy, cost/benefit analysis and marketing mix</li><li>An implementation timeline</li></ul>',30,NULL,'2017-08-01 22:41:35','2017-08-22 18:45:41','<p>Starting this September, a group of 5-6 students will work with your small business or not-for-profit organization to assist your marketing strategy.</p><p></p><p>You provide students with a marketing issue, challenge or opportunity, and they work over the semester to research and provide solutions and recommendations. You&#x27;ll receive insights from the student demographic that take into account best practices of market segmentation and integrated marketing communications. </p><p></p><p>Project focus can include, but is not limited to:</p><ul><li>Researching new markets or new locations</li><li>Pricing strategies</li><li>New product introduction</li><li>Social media plans</li><li>Marketing communications plans</li></ul><p></p><p></p>',5,'2nd year',0,NULL,'regional',NULL),(718,124,'published','Marketing and communications plan',NULL,'MKT 300','Riipen Test ',50,2018,'fall','<p>a group of students will be creating a marketing plan for your organization</p>','group','2017-08-10','2017-08-19',500,NULL,'<p>the students will be presenting a 10 page marketing plan </p>',3,NULL,'2017-08-02 00:43:11','2017-08-03 23:18:38','<p>in groups of 4 students will create a marketing plan for your organization </p>',4,'master',1,NULL,'anywhere',NULL),(719,41,'published','Logo Design and Branding Guide',NULL,'GRAP-10158-03','Branding and Design',60,2017,'fall','<p>Students in the Graphic Design program will design a logo for your business and an accompanying branding specification guide for your use. You&#x27;ll receive multiple student projects to choose from.</p>','individual','2017-10-27','2017-11-17',20,NULL,'<p>The final project deliverables are:</p><ul><li>Multiple proofs with variations of your logos</li><li>Multi Page PDF Visual Branding Guide including chosen Logo </li><li>Completed sample business card/letterhead/pen/keychain</li></ul>',1,NULL,'2017-08-02 16:45:38','2017-08-21 14:32:05','<p>Working individually, all 2nd semester students will develop a logo for your business and branding specification guides to accompany it. You&#x27;ll be able to review and choose from up to ten student projects.</p><p></p><p>You&#x27;ll be able to use the logo exclusively for your business, and the accompanying guide will ensure your logo is represented constantly across your marketing materials and online presence.</p><p></p><p>Prior to the project kicking off, you&#x27;ll provide students with context on your organization, your goals, imagery/colour and any existing branding strategy to aid the students in developing your new logo and spec guide.</p><p></p><p>Students can work with any company, from an early stage startup without an existing logo, to an established business looking for fresh designs and insights.</p><p></p>',2,'2nd year',0,NULL,'regional',NULL),(720,480,'review','Organizational Communication Consultancy',NULL,'CMST 3200','Organizational Communication',30,2018,'winter/spring','<p>30 student-consultants will  work in teams to research a personnel-focused challenge or opportunity your organization is facing, and provide actionable recommendations. </p>','group','2018-01-16','2018-05-05',20,NULL,'<p><strong> At project completion, your organization will receive:</strong></p><ul><li>A 4 to 6-page report detailing your organization&#x27;s challenges/opportunities and recommendations on how to address them.</li><li>A 15 to 20-minute presentation on findings and recommendations, including Q &amp; A.</li><li>A case study/report for educational applications (shared only with your permission).</li></ul>',1,NULL,'2017-08-02 18:20:02','2017-08-18 16:10:43','<p>Beginning this January, six groups of student-consultants will work for 600+ hours to provide your organization advice and/or resolutions for organizational communication dilemmas. </p><p></p><p>Students will analyze the background of the problem and compile a presentation explaining the root causes of the issue. Based on tier findings, the six groups will each recommend multiple strategies to address the opportunity. </p><p></p><p><strong>The consulting engagement may focus on 1 to 6 of the following areas:</strong></p><ol><li>Diversity and Inclusion</li><li>Using Communication Technology</li><li>Organizational Entry (e.g., socialization, onboarding)</li><li>Decision Making</li><li>Conflict</li><li>Leadership</li><li>Work-Life Balance</li><li>Organizational Exit (e.g., firing, layoff, resignation)</li></ol>',5,'3rd year',0,NULL,'regional',NULL),(721,268,'published','Innovative Solutions w/ Design Thinking',NULL,'140','Innovation!',18,2017,'fall','<p><strong>4 teams</strong> of <strong>4 Student-Designers</strong> will analyze a new or existing product, service, or market, applying Design Thinking and Lean Entrepreneurship methods to resolve your unique challenge or explore a new opportunity.</p>','group','2017-11-06','2017-12-08',35,NULL,'<ul><li>Prototype of solution</li><li>7 to 12-page detailed design report: includes process, options/ideas considered, user-comments, proposed solution, and rationale</li><li>Optional business report: provides possible marketing designs and launch plan (based on customer and team research)</li></ul>',3,NULL,'2017-08-02 19:38:39','2017-08-30 00:17:34','<p>Beginning this November, 4 groups of 4 student-designers will cumulatively dedicate 560+ hours over the entire semester analyzing an existing or new business area within your organization. </p><p></p><p>Based on the information your organization provides, goals that you&#x27;ve shared, and through assessing user experience needs, the students will design, develop, and test a user-centric prototype. This model will resolve a current challenge or explore new business opportunities. </p><p></p><p>Teams may work in tandem on the same project or on 4 separate areas of focus.  </p><p></p><p><strong>Areas of focus may include, but are not limited to: </strong></p><ul><li>New marketing approach or market development</li><li>Product packaging, delivery, or positioning</li><li>New uses for an existing product</li><li>Product modifications or product extensions</li><li>New product or service offering</li></ul>',4,'2nd-4th year',0,NULL,'anywhere',NULL),(722,433,'published','Digital Marketing Strategy',NULL,'DMF','Digital Marketing Foundation',25,2017,'fall','<p>Students develop a digital marketing growth strategy for their Community Partner.</p>','group','2017-10-24','2017-12-13',40,NULL,'<p>The final report will provide analysis and recommendations for <strong>10 of the following 17 </strong>elements, including both required elements and least 1 from each of Paid, Owned, and Earned.</p><p></p><p><strong>Required</strong></p><ul><li>Digital Marketing Measurement Model</li><li>A sample Google Analytics Custom Report for one of the strategies below</li></ul><p></p><p><strong>Paid</strong></p><ul><li>Search Advertising Strategy</li><li>Social Advertising Strategy</li><li>Visual Advertising Strategy</li></ul><p></p><p><strong>Owned</strong></p><ul><li>Email Capture + Marketing Strategy</li><li>On-Page SEO Strategy</li><li>Landing Page Creation</li><li>Conversion Rate Optimization Audit</li><li>Google Analytics Dashboard</li><li>Google Analytics Audit (Filters, Goals, Events, etc)</li></ul><p></p><p><strong>Earned</strong></p><ul><li>Content Calendar</li><li>Community Management Guidelines/Brand Filter</li><li>A Social Media Campaign Strategy</li><li>Off-Page/Outreach SEO Strategy</li></ul><p></p><p><strong>Marketing Analysis</strong></p><ul><li>User Personas</li><li>Marketing Campaign Funnel Analysis</li></ul>',10,NULL,'2017-08-02 22:54:09','2017-08-10 23:51:40','<p>Students develop a digital marketing campaign and devise a strategy to achieve your company goals whether that be brand awareness, increase sales, website conversions etc.</p>',4,'Post-Graduate',0,NULL,'local',NULL),(723,268,'published','Operations Consultancy',NULL,'BUAD 340','Operations and Supply Chain Management',3,2017,'fall','<p>A team of <strong>4</strong> <strong>Senior Business Students</strong> will apply Operations/Supply Chain Management analytics to provide you with recommendations for optimization to address your organizational challenges.</p>','group','2017-11-02','2017-11-23',30,NULL,'<p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to devise the project scope and prepare a detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome - Report and Presentation: Students will submit a 5 to 7-page report on the process, research and findings of the study. Teams will also present this in the last class. Organization representative(s) are invited to attend these presentations .</p>',1,NULL,'2017-08-03 18:34:52','2017-08-30 00:11:31','<p>Starting this November, a group of three business students will dedicate 90+ hours over the entire semester researching an operational challenge of your organization through an on-site tour and interviews.  </p><p></p><p>Based on the information your organization provides, goals that you&#x27;ve shared, and research done by students, they will evaluate the data to provide you with recommendations to optimize your operations processes and overcome your unique organizational challenges.</p>',3,'4th year',0,NULL,'regional',NULL),(724,124,'draft','Master\'s Strategy Consultation',NULL,'OPRE 6367','Master\'s Strategy Consulting',23,2017,'fall','<p>Students will provide unbiased assessments and recommendations regarding opportunities and challenges currently affecting your business.</p>','individual','2017-08-01','2017-11-30',50,NULL,'<p>Final project deliverables include professional level presentations of:</p><ul><li>Objective situational assessments</li><li>Identification and evaluation of alternatives</li><li>Development of performance measures</li><li>Recommended strategies and actions supported with financial analysis</li></ul><p>Your organization will receive:</p><ul><li>A 30-45 minute presentation on analysis, findings, and recommendations</li><li>A hard copy of the final project report (length of document depends upon scope of the project)</li><li>Direct interaction with UT Dallas students/future professionals for employment opportunities</li></ul>',1,NULL,'2017-08-04 14:44:19','2017-08-04 14:44:19','<p>A group of five Master&#x27;s level student-consultants will work 50+ hours to provide business consulting and strategy guidance to your business.</p><p>These graduate students have diverse backgrounds including engineering, information systems, science and business, and can offer unbiased assessments and recommendations for your company in many areas.<br/></p><p>Possible areas of focus could include, but are not limited to:</p><ul><li>Market research</li><li>Supply chain management/process improvement</li><li>Technology solutions</li><li>Market entrance/expansion</li><li>Data analytics</li><li>Development and use of KPIs/KLIs</li><li>Category management</li><li>Commercialization of social media</li><li>Sales and marketing strategy</li></ul>',1,'MBA, MS',0,NULL,NULL,'2017-08-11 18:01:46'),(725,124,'draft','TITLE',NULL,'MK99','Data ',NULL,NULL,'fall','','group','2017-10-05','2017-11-17',NULL,NULL,NULL,1,NULL,'2017-08-04 17:23:09','2017-08-04 17:23:33','<p>test</p>',4,'',0,NULL,NULL,NULL),(726,481,'published','Market Research for Relevancy',NULL,'MRKT331','Customer Insights',20,2017,'fall','<p>Student-researchers will investigate your target customer to gain insights-- applying consumer and organizational behavior concepts, along with theoretical frameworks to address an acute organizational marketing issue.</p>','group','2017-09-18','2017-11-27',20,NULL,'<p><strong>Phase 1 </strong>– Project Plan: Students will meet with your organization&#x27;s representative(s) to devise the project scope and prepare a detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with your organization&#x27;s representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome - Report and Presentation: Students will submit a detailed report on the outcomes of the project. Teams will also present this in the last class. Organization representative(s) are required to attend these presentations on December 10th. </p>',1,NULL,'2017-08-05 17:23:39','2017-08-21 20:50:10','<p>Beginning in September, multiple groups of three Marketing students will collectively spend approximately 60 hours over the course of the semester researching your organization&#x27;s target audience. In groups of three, student-researchers will gather and analyze customers data to determine how your organization could be more relevant to the market. </p><p></p><p>Based on the information your organization provides, the research conducted, and the goals that your organization has shared with the students, multiple groups will provide you with detailed and actionable insights into your organization&#x27;s relevancy in the market and how you can better attract consumers&#x27; attention.</p><p></p>',3,'3rd & 4th year',0,NULL,'anywhere',NULL),(727,325,'draft','Strategic planning for Information systems',NULL,'MGMT 205','Information Systems',70,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-08-06 23:41:47','2017-08-06 23:41:47',NULL,NULL,'1st Year MBA',0,NULL,NULL,'2017-08-09 00:10:04'),(728,325,'draft','Strategic planning for Information systems',NULL,'MGMT 205','Information Systems',70,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-08-06 23:42:09','2017-08-06 23:42:10',NULL,NULL,'1st Year MBA',0,NULL,NULL,'2017-08-09 00:09:49'),(729,325,'draft','Strategic planning for Information systems',NULL,'MGMT 205','Information Systems',70,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-08-06 23:42:15','2017-08-06 23:42:15',NULL,NULL,'1st Year MBA',0,NULL,NULL,'2017-08-09 00:09:33'),(730,325,'draft','Strategic planning for Information systems',NULL,'MGMT 205','Information Systems',70,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-08-06 23:42:31','2017-08-06 23:42:32',NULL,NULL,'1st Year MBA',0,NULL,NULL,'2017-08-09 00:09:18'),(731,325,'draft','Strategic planning for Information systems',NULL,'MGMT 205','Information Systems',70,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-08-06 23:42:46','2017-08-06 23:42:47',NULL,NULL,'1st Year MBA',0,NULL,NULL,'2017-08-09 00:09:03'),(732,325,'draft','Strategic planning for Information systems',NULL,'MGMT 205','Information Systems',70,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-08-06 23:42:58','2017-08-06 23:42:59',NULL,NULL,'1st Year MBA',0,NULL,NULL,'2017-08-09 00:08:43'),(733,325,'review','Strategic planning for Information systems',NULL,'','',NULL,2017,'fall','<p>The purpose of this assignment is to provide a systematic process for developing a long range plan for information systems on the basis of organizations&#x27; overall strategic plan and its close links to organizations&#x27; objective. </p>','group','2017-10-16','2017-12-08',30,NULL,'',1,NULL,'2017-08-06 23:58:17','2017-08-08 23:07:54','<p>In a group of 5, these first year MBA student-consultant will develop a strategic plan for Information Systems for their organization of choosing. Students will conduct research on organizations core value, key performance indicators and strategic goals before developing a digital strategy for the organization. </p><p></p>',5,'',0,NULL,'anywhere','2017-08-09 00:06:15'),(734,325,'draft','Strategic planning for Information systems',NULL,'MGMT 205','Information Systems',70,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-08-06 23:58:24','2017-08-06 23:58:25',NULL,NULL,'1st Year MBA',0,NULL,NULL,'2017-08-09 00:08:13'),(735,325,'draft','Strategic planning for Information systems',NULL,'MGMT 205','Information Systems',70,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-08-06 23:58:26','2017-08-06 23:58:26',NULL,NULL,'1st Year MBA',0,NULL,NULL,'2017-08-09 00:07:55'),(736,325,'draft','Strategic planning for Information systems',NULL,'','',NULL,2017,'fall','<p>The purpose of this assignment is to provide a systematic process for developing a long range plan for information systems on the basis of organizations&#x27; overall strategic plan and its close links to organizations&#x27; objective. </p>','group','2017-10-16','2017-12-08',30,NULL,NULL,1,NULL,'2017-08-06 23:58:50','2017-08-08 23:07:20','<p>In a group of 5, these first year MBA student-consultant will develop a strategic plan for Information Systems for their organization of choosing. Students will conduct research on organizations core value, key performance indicators and strategic goals before developing a digital strategy for the organization. </p><p></p>',5,'',0,NULL,NULL,'2017-08-08 23:08:38'),(737,325,'draft','Strategic planning for Information systems',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-08-07 05:26:30','2017-08-07 05:26:30',NULL,NULL,NULL,0,NULL,NULL,'2017-08-09 00:07:37'),(738,325,'draft','Strategic planning for Information systems',NULL,'MGMT 205','Information Systems',70,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-08-07 05:26:38','2017-08-07 05:26:38',NULL,NULL,'1st Year MBA',0,NULL,NULL,'2017-08-09 00:07:18'),(739,325,'draft','Strategic planning for Information systems',NULL,'MGMT 205','Information Systems',70,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-08-07 05:26:42','2017-08-07 05:26:42',NULL,NULL,'1st Year MBA',0,NULL,NULL,'2017-08-09 00:07:01'),(740,325,'published','MBA: Strategic Planning Consultancy for IT',NULL,'MGMT 205','Information Systems',120,2017,'fall','<p>MBA Student-consultants will develop a research-based Information Systems plan that is complementary to an organization&#x27;s strategic plan and business objectives. </p>','group','2017-10-16','2017-12-08',30,NULL,'<p>The final project deliverables include:</p><ul><li>15-page report detailing a custom strategic Information Systems plan.</li><li>20-minute presentation summarizing the results and recommendations with Q&amp;A.</li></ul>',6,NULL,'2017-08-07 05:45:46','2017-08-29 15:43:52','<p>Beginning this October, MBA students in a group of 5, will spend approximately 150 hours developing a strategic Information Systems plan for an organization. Student-consultants will conduct research on the organization&#x27;s core values, key performance indicators, and strategic goals to develop a tailored digital strategy.  </p><p></p><p><strong>Student-consultants will determine:</strong></p><p></p><ul><li>The effectiveness of the existing Information Systems for the (cross)functional needs of the organization.</li><li>Possible strategic applications of existing Information Systems.</li><li>Long term digital strategy of the organization including top managements&#x27; commitments to competing with analytics.</li><li>A strategy to increase the visibility of IT within the organization.</li></ul><p></p><p></p>',5,'Master\'s',0,NULL,'anywhere',NULL),(741,325,'draft','Strategic planning for Information systems',NULL,'MGMT 205','Information Systems',70,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-08-07 05:45:56','2017-08-07 05:45:57',NULL,NULL,'1st Year MBA',0,NULL,NULL,'2017-08-09 00:05:18'),(742,325,'draft','Strategic planning for Information systems',NULL,NULL,NULL,NULL,NULL,NULL,'<p>The purpose of this assignment is to provide a systematic process for developing a long range plan for information systems on the basis of organizations&#x27; overall strategic plan and its close links to organizations&#x27; objective. </p>','group','2017-10-16','2017-12-08',30,NULL,NULL,1,NULL,'2017-08-07 05:46:51','2017-08-07 05:46:52','<p>In a group of 5, these first year MBA student-consultants will develop a strategic plan for Information Systems for their organization of choosing. Students will conduct research on organizations core value, key performance indicators and strategic goals before developing a digital strategy for the organization.  Students will develop a report documenting:</p><p></p><p>(1) How well the existing information systems fit the functional and cross-functional needs of the organization</p><p>(2) Areas where the organization should prioritize the best use of information systems while identifying strategic applications</p><p>(3) Long term digital strategy of the organization including top managements&#x27; commitments to completing with analytics.</p><p>(4) Strategy to increase visibility of IT in the organization</p>',5,NULL,0,NULL,NULL,'2017-08-08 23:09:48'),(743,325,'draft','Strategic planning for Information systems',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-08-07 05:47:01','2017-08-07 05:47:01',NULL,NULL,NULL,0,NULL,NULL,'2017-08-09 00:04:47'),(744,325,'draft','Strategic planning for Information systems',NULL,'MGMT 205','Information Systems',70,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-08-07 05:47:05','2017-08-07 05:47:05',NULL,NULL,'1st Year MBA',0,NULL,NULL,'2017-08-09 00:04:23'),(745,325,'draft','Strategic planning for Information systems',NULL,'','',NULL,2017,'fall','','individual',NULL,NULL,NULL,NULL,'<p>The final project deliverable:</p><p></p><p>(1) 15 page report detailing strategic </p><p>(2) </p><p></p>',1,NULL,'2017-08-07 05:52:44','2017-08-09 00:00:45','',2,'',0,NULL,NULL,'2017-08-09 00:03:55'),(746,325,'draft','Strategic planning for Information systems',NULL,'MGMT 205','Information Systems',70,2017,'fall','','individual',NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-08-07 05:52:48','2017-08-09 00:00:11','',2,'1st Year MBA',0,NULL,NULL,'2017-08-09 00:00:30'),(747,325,'draft','Strategic planning for Information systems',NULL,'MGMT 205','Information Systems',70,2017,'fall','','individual',NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-08-07 05:53:00','2017-08-08 23:59:40','',2,'1st Year MBA',0,NULL,NULL,'2017-08-08 23:59:56'),(748,325,'draft','Strategic planning for Information systems',NULL,'','',NULL,2017,'fall','','individual',NULL,NULL,NULL,NULL,'<p>The final project deliverable:</p><p></p><p>(1) 15 page report detailing strategic planning for the Information systems of the organization</p><p>(2)  Power-point presentation (20 min) summarizing the results.</p><p></p>',1,NULL,'2017-08-07 05:54:50','2017-08-08 23:59:05','',2,'',0,NULL,NULL,'2017-08-08 23:59:23'),(749,325,'draft','Strategic planning for Information systems',NULL,'MGMT 205','Information Systems',70,2017,'fall','','individual',NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-08-07 05:54:53','2017-08-08 23:58:26','',2,'1st Year MBA',0,NULL,NULL,'2017-08-08 23:58:42'),(750,325,'draft','Strategic planning for Information systems',NULL,'','',NULL,2017,'fall','','individual',NULL,NULL,NULL,NULL,NULL,6,NULL,'2017-08-07 05:56:21','2017-08-08 23:56:04','',2,'',0,NULL,'anywhere','2017-08-08 23:58:11'),(751,325,'draft','Strategic planning for Information systems',NULL,'MGMT 205','Information Systems',70,2017,'fall','','individual',NULL,NULL,NULL,NULL,'',1,NULL,'2017-08-07 05:56:26','2017-08-08 23:52:19','',2,'1st Year MBA',0,NULL,'anywhere','2017-08-08 23:52:41'),(752,325,'draft','Strategic planning for Information systems',NULL,'','',NULL,2017,'fall','','individual',NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-08-07 05:56:37','2017-08-08 23:55:23','',2,'',0,NULL,NULL,'2017-08-08 23:55:38'),(753,325,'draft','Strategic planning for Information systems',NULL,'','',NULL,2017,'fall','','individual',NULL,NULL,NULL,NULL,NULL,6,NULL,'2017-08-07 05:56:45','2017-08-08 23:54:42','',2,'',0,NULL,'anywhere','2017-08-08 23:55:08'),(754,325,'draft','Strategic planning for Information systems',NULL,'MGMT 205','Information Systems',70,2017,'fall','','individual',NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-08-07 05:56:49','2017-08-08 23:54:11','',2,'1st Year MBA',0,NULL,NULL,'2017-08-08 23:54:27'),(755,325,'draft','Strategic planning for Information systems',NULL,'MGMT 205','Information Systems',70,2017,'fall','','individual',NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-08-07 05:56:56','2017-08-08 23:53:40','',2,'1st Year MBA',0,NULL,NULL,'2017-08-08 23:53:55'),(756,325,'draft','Strategic planning for Information systems',NULL,NULL,NULL,NULL,NULL,NULL,'<p>The purpose of this assignment is to provide a systematic process for developing a long range plan for information systems on the basis of organizations&#x27; overall strategic plan and its close links to organizations&#x27; objective. </p>','group','2017-10-16','2017-12-08',30,NULL,NULL,1,NULL,'2017-08-07 05:57:12','2017-08-07 05:57:12','<p>In a group of 5, these first year MBA student-consultants will develop a strategic plan for Information Systems for their organization of choosing. Students will conduct research on organizations core value, key performance indicators and strategic goals before developing a digital strategy for the organization.  Students will develop a report documenting:</p><p></p><p>(1) How well the existing information systems fit the functional and cross-functional needs of the organization</p><p>(2) Areas where the organization should prioritize the best use of information systems while identifying strategic applications</p><p>(3) Long term digital strategy of the organization including top managements&#x27; commitments to completing with analytics.</p><p>(4) Strategy to increase visibility of IT in the organization</p>',5,NULL,0,NULL,NULL,'2017-08-09 00:10:46'),(757,325,'draft','Strategic planning for Information systems',NULL,'','',NULL,2017,'fall','','individual',NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-08-07 05:57:31','2017-08-08 23:53:03','',2,'',0,NULL,NULL,'2017-08-08 23:53:18'),(758,325,'draft','Strategic planning for Information systems',NULL,'MGMT 205','Information Systems',70,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-08-07 05:57:34','2017-08-07 05:57:35',NULL,NULL,'1st Year MBA',0,NULL,NULL,'2017-08-08 23:15:13'),(759,325,'draft','Strategic planning for Information systems',NULL,'','',NULL,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,'<p>The final project deliverable:</p><p></p><p>(1) 15 page report detailing strategic planning for the Information systems of the organization</p><p>(2)  Power-point presentation (20 min) summarizing the results.</p><p></p>',1,NULL,'2017-08-07 05:57:55','2017-08-08 23:13:38',NULL,NULL,'',0,NULL,NULL,'2017-08-08 23:13:58'),(760,325,'draft','Strategic planning for Information systems',NULL,'MGMT 205','Information Systems',70,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-08-07 05:58:02','2017-08-07 05:58:02',NULL,NULL,'1st Year MBA',0,NULL,NULL,'2017-08-08 23:11:21'),(761,325,'draft','Strategic planning for Information systems',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-08-07 05:58:21','2017-08-07 05:58:21',NULL,NULL,NULL,0,NULL,NULL,'2017-08-08 23:10:48'),(762,10,'published','Systems for Strategic IT Management',NULL,'BUS 468','Managing Information Technology for Business Value',70,2017,'fall','<p>Students will develop a custom IT system as a strategic solution for an organizational issue or objective. </p>','group','2017-09-05','2017-12-01',25,NULL,'<p>The final project deliverables include:</p><ul><li>A 30-page comprehensive report.</li><li>A 20-minute presentation, followed by Q&amp;A.</li></ul>',14,NULL,'2017-08-08 18:52:29','2017-08-18 22:35:05','<p> </p><p>Starting this September, a group of five IT students will spend approximately 125 hours over the course of the semester developing and/or implementing a custom IT system for your organization. </p><p></p><p>Based on information your organization provides and the goals that you&#x27;ve shared with the students, they will provide you with a strategic IT solution for an organizational issue or objective.  </p><p></p><p><strong>Project focuses may include, but are not limited to the following examples: </strong></p><p></p><ul><li><u>Strategic use of information technology:</u>  Facilitation the execution of your business strategy through creative and strategic deployment of an existing IT program. <br/></li><li><u>Using information technology as a strategic weapon:</u> Identifying and creating a sustainable competitive advantage through information technology.<br/></li><li><u>Managing security and risks:</u> Identifying what can go wrong in relation to your organization&#x27;s IT systems and how to prevent it.<br/></li><li><u>IT management analysis:</u> Identifying who determines the IT strategy in your organization and how effective your IT governance is with recommendations for improvement. <br/></li><li><u>Using IT to improve organizational effectiveness:</u> Identifying areas of opportunity for efficiency/ productivity and the most effective and comprehensive IT solutions.<br/></li><li><u>Managing competitive landscape changes:</u>  Rapid changes can make an unresponsive organization obsolete. Students bring your organization up to speed by identifying and implementing relevant IT systems in anticipation or in response to industry changes. </li></ul>',5,'4th year',0,NULL,'anywhere',NULL),(763,150,'review','Business Consulting',NULL,'OPRE 6367','Operations Research Analytics',35,23,'winter/spring','<p>Individual student consultants spend approximately up to 10 weeks working with your company in analyzing data sets using a variety of analysis methods according to your needs. The results can provide in-depth insights into the operations of your business, a detailed perspective of your customers, and solutions to complex problems. Students can leverage industry standards for analysis using various tools such as SQL, Excel, SAS, PPT, and Tableau.  Project content is flexible and meant to move your data problems forward.</p>','group','2018-01-02','2018-04-06',225,NULL,'<ul><li>Written project report of findings with supporting analytics and model.  </li><li>Management presentation either in person or web/video conferencing.</li></ul>',3,NULL,'2017-08-08 21:06:48','2017-08-08 21:09:41','<p>In groups of 5, student-consultants will work 45+ hours assisting your company by providing analytical research and recommendations tailored to one of your company’s data opportunities or challenges. They will employ analytic and statistical software such as Tableau, SAS, Micro-strategy, Power BI or other methods to inform their decision-making process.  </p><p></p><p>Some examples include, but are not limited to: </p><p></p><ul><li>Analyzing e-commerce data to understand buyers and buying habits across several selling platforms, </li><li>Understanding profitability, retention, referrals, and attrition rates for your customers</li><li>Creating comprehensive dashboards to enhance your data visualization for customers, teams, and executives, </li><li>Prescriptive analytics using customer segmentation</li><li>Customer relationship management (CRM), personalization </li><li>Online recommendation systems </li><li>Web mining</li><li>Product assortment, and designing lead scoring systems to understand opportunities worth pursuing and developing predictive sales model, etc.</li></ul><p></p><p>Students will complete the data analysis and present their findings in final a presentation (virtual or in-person.) They will clearly identify the challenges the organization is facing relevant to the data, uncover the root cause of the identified challenges, propose viable solution(s), and recommend the best course of action as well as justify the position through metrics. Students will also provide tangible copies of their work as it pertains to their individual project.</p>',5,'Senior and post grad MS/MBA',0,NULL,'anywhere',NULL),(764,150,'review','Master\'s Strategy Consulting',NULL,'OPRE 6367','Capstone Course',35,2016,'winter/spring','<p>Students will provide unbiased assessments and recommendations regarding opportunities and challenges currently affecting your business.</p>','group','2018-01-02','2018-04-05',50,NULL,'<p>Final project deliverables include professional level presentations of:</p><ul><li>Objective situational assessments</li><li>Identification and evaluation of alternatives</li><li>Development of performance measures</li><li>Recommended strategies and actions supported with financial analysis</li></ul><p>Your organization will receive:</p><ul><li>A 30-45 minute presentation on analysis, findings, and recommendations</li><li>A hard copy of the final project report (length of document depends upon scope of the project)</li><li>Direct interaction with UT Dallas students/future professionals for employment opportunities</li></ul>',3,NULL,'2017-08-08 21:11:02','2017-08-08 21:12:34','<p>A group of five Master&#x27;s level student-consultants will work 50+ hours to provide business consulting and strategy guidance to your business.</p><p></p><p>These graduate students have diverse backgrounds including engineering, information systems, science and business, and can offer unbiased assessments and recommendations for your company in many areas.<br/></p><p>Possible areas of focus could include, but are not limited to:</p><ul><li>Market research</li><li>Supply chain management/process improvement</li><li>Technology solutions</li><li>Market entrance/expansion</li><li>Data analytics</li><li>Development and use of KPIs/KLIs</li><li>Category management</li><li>Commercialization of social media</li><li>Sales and marketing strategy</li></ul>',5,'MBA, MS',0,NULL,'anywhere',NULL),(765,150,'review','Supply Chain, Logistics, and Channel Optimization',NULL,'OPRE 6367','Grad School Capstone',30,25,'winter/spring','<p>Your organization could benefit from optimizing your management strategies. Get help with market analysis, entrance, expansion, new products, channel optimization, price/revenue and more.</p>','group','2018-01-02','2018-04-05',300,NULL,'<p>At project completion, you’ll receive:</p><ul><li>Project report with findings supported by analytics</li><li>Management presentation (either in person or via web/video)</li></ul>',3,NULL,'2017-08-08 21:13:13','2017-08-08 21:15:41','<p>A group of Master of Science and MBA students will spent 300+ hours helping you with an unusual or challenging project that pertains to your goals. Projects can include a wide range of supply chain and sales channel optimization-related topics.</p><p></p><p>This capstone project provides an opportunity for students to hone the skills they have learned throughout their degree and apply them to unique issues currently affecting your organization.</p><p></p><p><strong>Project scope can include, but is not limited to:</strong></p><ul><li>Process improvement</li><li>Channel strategies</li><li>Customer data analytics/segmentation</li><li>New product/market introductions</li><li>Logistics and competitive positioning</li><li>Integration of e-commerce platforms</li></ul>',5,'Post Grad MS/MBA students',0,NULL,'anywhere',NULL),(766,177,'review','Master\'s Research of Music Industry Environment',NULL,'MUS 580','Music Industry Developments',40,2017,'fall','<p>Master&#x27;s level students will develop a research paper for your organization to gain insights into a specific area/circumstance of the current music industry environment. </p><p></p>','group','2017-03-17','2017-05-05',40,NULL,'<p>1. 20 Minute Group Presentation</p><p>2. 6-8 page research paper of 3,500-4,500 words</p>',8,NULL,'2017-08-09 02:28:20','2017-08-24 20:35:53','<p>Starting in late August, a group of Master of Arts and Music Industry Administration students will spend approximately 200 hours over the course of the semester developing a report that addresses a research question pertinent to your organization&#x27;s success in the music industry. </p><p></p><p>Based on a research question your organization provides and the goals that you&#x27;ve shared with the students, they will develop a report that draws from topical literature and relevant sources to help you gain insights into your business environment. </p><p></p><p><strong>Research topic examples could include, but are not limited to:</strong></p><p></p><ul><li>An examination of what promotional campaigns are the most successful for new independent record labels and artists that are not yet established in the industry</li><li>An examination of publishers&#x27; revenue stream from digital downloads and interactive streaming services</li><li>An assessment of the evolution of live performances and the proven industry tactics used to promote audience engagement and the image of artists</li><li>The secondary ticket market and live performance</li><li>The effects of technology on the role of the music supervisor</li><li>Artist productivity within the Hip Hop in the independent music industry and the role of the A&amp;R</li><li>Investigation of the effect of live-streamed performances on revenue streams of said live performances</li></ul><p></p>',5,'Master\'s',0,NULL,'local',NULL),(767,29,'review','Sustainability Consultancy',NULL,'COMMERCE 4SG3','Corporations & Society',45,2018,'winter/spring','<p>Student-consultants will research and evaluate your organization&#x27;s current sustainable practices, then make recommendations on sustainability-related certifications or sustainability reporting to improve your standing. </p>','group','2018-01-15','2018-04-09',20,NULL,'<p>The final deliverables include:</p><ul><li>A 1-page scope statement </li><li>A 10+ page research report with analysis and recommendations</li><li>A 15-minute final presentation </li></ul>',10,NULL,'2017-08-09 18:24:32','2017-08-18 15:51:55','<p>Beginning this January, an interdisciplinary team of 4 to 5 student-consultants will spend 80 to 100 hours working for your organization around a topic of your choice, related to either sustainability certifications or sustainability reporting. </p><p></p><p>Based on the information your organization provides and industry research, the group will identify opportunities for certifications and reports that will validate your organization&#x27;s sustainability practices. </p><p></p><p><strong>Project focus may include, but is not limited to the following:</strong></p><ul><li>Identify and analyze sustainability-related certifications relevant to a product, process or business function.</li><li>Analysis and recommendations regarding a firm&#x27;s sustainability report.</li><li>Identification and analysis of optional reporting avenues such as the carbon disclosure project.</li></ul>',4,'4th year',0,NULL,'anywhere',NULL),(768,479,'published','Hubspot Inbound Marketing: Project Brief',NULL,'MK 371-2','Inbound in the Integrated Marketing Framework',12,2017,'fall','<p>This brief is mapped to the Hubspot Practicum which is the second of two parts that leads to Hubspot Certification.</p>','group','2017-09-08','2017-12-08',100,NULL,'<p>Deliverables for each week as outlined in the course syllabus.</p>',1,NULL,'2017-08-09 20:26:37','2017-08-14 16:11:18','<p><strong>The Practicum: Inbound Team/Class Project</strong> </p><p><strong>Link to Practicum: </strong>http://academy.hubspot.com/practicum/2016-hubspot-certification-practicum</p><p></p><p>Please use the Practicum elements (link and below) as your guide as you and your teammates build out and run your Inbound Campaign on HubSpot in a live client implementation.</p><p></p><p>By following the submission guidelines and meeting the achievement criteria below, each team member will, when coupled with taking and passing the HubSpot Certification Course and test individually, earn formal HubSpot Software Certification.</p><p></p><p>Alignment of your campaigns with these elements will be essential to attaining certification.</p><p></p><p><strong>The Practicum building blocks are:</strong></p><p><strong>STEP 1: SUBMIT THE FOLLOWING TWO (2) ITEMS FOR REVIEW</strong></p><p></p><ol><li><strong>Blog: </strong>Publish or have scheduled to publish at least ten (10) Blog Posts to be live within a forty-five (45)-day period. You must specify in the Comments Section the Time-Period in which Posts were published. If you do not specify the Time-Period, your Blog will not be graded.</li></ol><p><strong>AND</strong></p><ol><li><strong>Landing Pages: </strong>Create at least three (3) Landing Pages that are live on your website. One (1) must have at least one-hundred (100) views and a twenty (20) % conversion rate.</li></ol><p><strong>PLUS…</strong></p><p><strong>STEP 2: SUBMIT EIGHT (8) THE FOLLOWING ITEMS FOR REVIEW (Assuming 1 &amp; 2 Above Are Completed)</strong></p><p></p><ol><li><strong>Goals</strong>: Input a custom Monthly Goal in your HubSpot Dashboard. </li><li><strong>Personas: </strong>Specify how many personas your business has and include a link to one of those complete persona profiles in the Persona Tool. That profile must have all fields filled out and at least five plus (5+) sentences in the &quot;Story&quot; Section.</li><li><strong>Content: </strong>Include links to three (3) Content Offers (NOT including Blog Posts or Website Pages). You must include links to these live Content Offers or the Landing Page in which they live.</li><li><strong>Keywords: </strong>Add at least three-hundred (300) Keywords to the Keywords Tool.</li><li><strong>Social Publishing: </strong>Using the HubSpot Social Publishing tool, post at least fifteen (15) Social Media Updates within a seven (7)-day period, or have them scheduled to post in HubSpot&#x27;s Social Publishing tool. Only posts published or scheduled via the HubSpot Tool will be assessed.</li><li><strong>Social Monitoring: </strong>Create at least three (3) separate Custom Streams. One (1) must be based off a Keyword (or Keywords) relevant to your business, and one must be based off a Contact List.</li><li><strong>Calls-To-Action: </strong>Create at least three (3) Calls-To-Action that are live on your website. At least one (1) of your CTAs must have a two (2) % or higher click-through rate for the last 120-days.</li><li><strong>Forms: </strong>Build at least three (3) different forms that are live on your website. One (1) of your Forms must have at least a twenty (20) % submission rate and at least one-hundred (100) views on that Form for the last one-hundred-twenty (120)-days.</li><li><strong>9.Thank You Pages:</strong> Create at least three (3) Thank You Pages that are live on your website and link to another offer. NOTE: You must provide the URLs of your Thank You Pages or your Thank You Pages will NOT be graded.</li></ol><p></p><ol><li><strong>Contacts: </strong>Create at least three (3) custom Contact Properties. You must include the label for all three (3) of these Contact Properties in the submission form.</li></ol><p></p><ol><li><strong>Lists: </strong>Create at least three (3) Smart Lists. One (1) list you submit must use the Contact Property Lifecycle Stage, and one (1) must use a Form Submission as the criteria. Include links to these three (3) lists in the submission form.</li><li><strong>Email: </strong>Send at least three (3) Segmented E-Mails. At least one (1) must have been delivered to at least thirty (30) recipients, have a twenty-five (25) % open rate and four (4) % click-through rate. </li><li><strong>Sources: </strong>Build and save three (3) Sources Reports, one (1) each for Visits, Contacts, and Customers.</li></ol><p><strong>DUE: </strong>Week #12</p><p></p><p><strong>NOTES:</strong></p><p>If the above Practicum achievements are met, ALL students who also pass the HubSpot Marketing Software Certification Course individually will be eligible to submit these achievement for formal HubSpot Software Certification, with all the benefits and privileges thereof.</p>',12,'3rd and/or 4th year',1,NULL,'anywhere',NULL),(769,58,'published','Strategic Consulting',NULL,'JDC','JDC West',50,2017,'fall','<p>A team of student consultants will be given 3 hours to answer the business problem that they have been presented with. They will identify the primary and secondary issues present within the situation, analyze the issue, and present a recommendation.</p>','individual','2017-10-04','2018-01-03',3,NULL,'<p>A live presentation from four different specialized teams.</p>',5,NULL,'2017-08-09 23:53:57','2017-08-14 21:43:23','<p>In this project, a group of 3 student consultants will be given 3 hours to answer the business problem that they have been presented with. In this time students will work to identify the primary and secondary issues present within the situation, analyze the issue, and present a recommendation on how to mitigate or utilize the specific situation. Issues such as implementation, risk mitigation and monetary, ethical, and social feasibility are also focused on.</p><p></p><p><strong>Project examples may include but are not limited to:</strong></p><ul><li>Market research to identify new strategies and opportunities</li><li>Commercialization of social media</li><li>Brand and messaging assessment</li><li>Technology solutions</li><li>Market entrance/expansion</li></ul><p></p><p><strong>NOTE: </strong>9 consulting teams each specialize in a different facet of business, which allows for specialization on more technical topics.</p><p></p><p>Teams: Accounting, Business Strategy, Business Technology Management, Entrepreneurship, Finance, Human Resources, International Business, Marketing, and Not For Profit.<br/></p>',2,'Varied',0,NULL,'regional',NULL),(770,475,'published','MBA Leadership Consultancy',NULL,'MGM 582-801','Organization Leadership',18,2017,'fall','<p>A group of MBA student-consultants will solve an organizational challenge of your choice through analyzing company culture and leadership, making data-based recommendations.</p>','group','2017-09-20','2017-11-30',30,NULL,'<p>Upon project completion, your organization will receive :</p><ul><li>10 to 15-page report on analysis and recommendations</li><li>In-class presentation on findings and recommendations (the organization is required to attend)</li></ul>',3,NULL,'2017-08-10 17:15:23','2017-08-30 23:43:42','<p>Beginning in September, a group of five MBA students will spend 150 hours working to solve an organizational leadership problem for your organization. </p><p></p><p>Based on information provided by you, research completed by student-consultants, and the three organizational perspectives, Students will analyse how your organization can leverage leadership to solve a problem. </p><p></p><p>The three facets of analysis include: </p><ul><li>Strategic lens- focus on organization design and fit. </li><li>Political lens- focus on power and politics in the organization. </li><li>Culture lens- focus on organizational culture .</li></ul>',6,'Master\'s',0,NULL,'anywhere',NULL),(771,486,'review','Algorithmic App Creation',NULL,'CS 383','Algorithm Design and Analysis',25,2017,'fall','<p>12 groups of two students will develop a custom Java application for your organization, based on sophisticated data structures and algorithms. </p>','group','2017-11-27','2017-12-11',20,NULL,'<p>The final deliverables include a fully-functioning Java program with JUnit tests and a 1-2 page document addressing the following questions:</p><ul><li>What are the running times of algorithms used in your project?</li><li>What are the strengths and weaknesses of your project?</li><li>What did you learn while working on this project?</li><li>What advice would you give to future students beginning their final projects?</li></ul>',2,NULL,'2017-08-10 17:45:14','2017-08-24 21:28:24','<p>Beginning this November, 25 Computer Science students will work in groups of two over approximately 20 hours to design and develop custom Java applications for your organization. </p><p></p><p>Applications will be based on algorithms associated with searching, sorting, trees, graphs, and strings. Examples I&#x27;ve given the students include sports tournament pairing/scoring, air traffic control simulation, genealogy, spell-checking with suggestion of &quot;nearby&quot; words, and gerrymandering.</p><p></p><p><strong>Note:</strong> App development is limited to stand-alone Java programs using java.util and the Princeton standard library.</p><p></p><p></p>',2,'3rd year',0,NULL,'anywhere',NULL),(772,464,'published','Technology Solution Designs & Implementations',NULL,'IDS 406','Information and Decision Sciences Capstone',30,2017,'fall','<p>The projects for this course focus on technology solution designs and implementations. The undergraduate students in IDS 406 are seniors who are nearing the completion of their studies and have had courses in databases and programming.<br/> </p><p></p>','individual','2017-08-28','2017-12-08',30,NULL,'<p>The final deliverables for this project will be determined in the initial set of meetings with the instructor. Based upon your organization&#x27;s needs, the deliverables will be set after the engagement has started. </p>',1,NULL,'2017-08-10 18:34:20','2017-08-16 16:25:53','<p>Over a 16 week period, a group of 4th year student-consultants will focus on technology solution designs and implementations for your organization. </p><p> </p><p>Initially, the course instructors meet with the sponsoring organization to develop high-level expectations for their project. The student teams are then responsible for finalizing the scope of work and a work plan for their projects in conjunction with their mentors. </p><p></p><p>The students also meet weekly in class with their instructor to report project status. The instructor closely interacts with the mentor to assess the progress made by the student teams and whether expectations are being met. </p><p></p><p>Examples of projects completed in the past are:</p><p></p><ul><li>Website design and implementation</li><li>Mobile app design and implementation</li><li>Software evaluation and selection</li><li>Designing and implementing database systems </li></ul><p></p>',2,'4th year',0,NULL,'anywhere',NULL),(773,485,'published','Promotion Plan',NULL,'MKTG 444','Integrated Marketing Communications',32,2017,'fall','<p>Undergraduate student-consultants will develop an integrated marketing campaign/plan for your organization to achieve your marketing goals. </p>','group','2017-08-24','2017-11-16',10,NULL,'<p><strong>Phase 1 </strong>– (Due November 2)</p><p>Background, Purpose, and Focus; Marketing Environment Assessment; SWOT Analysis; Company Mission; Target Markets/ Market Opportunity Analysis; Marketing Objectives; Marketing Strategy; Budget.</p><p><strong>Phase 2</strong>  – (Due November 16)</p><p>Promotional Mix; Implementation Plan; Timeline.</p><p></p><p><em>The team may also provide rough drafts of created ads and social media posts.</em></p>',1,NULL,'2017-08-10 20:18:35','2017-08-29 22:10:26','<p>Starting at the end of this August, a group of 3-5 Marketing students will spend approximately 40 hours over the course of the semester developing and integrated marketing campaign or plan for your organization.</p><p></p><p>Based on information your organization provides and the goals that you&#x27;ve shared with the students, they will provide you with a detailed plan, delivered in two phases, that will help you achieve your marketing goals.</p><p></p><p><strong>Project examples could include, but are not limited to:</strong></p><ul><li>Increasing brand awareness for a new product/service line.</li><li>Hitting revenue targets for an existing or new product/service.</li><li>Gaining market share for an existing product/service.</li></ul><p></p>',3,'4th year ',0,NULL,'anywhere',NULL),(774,484,'published','Marketing Campaign Development & Execution',NULL,'BUSMKT 1485','Projects in Marketing ',25,2018,'winter/spring','<p>20 high-performing students will work with your organization to develop, propose, implement, and evaluate a world-class marketing campaign.</p>','group','2018-01-03','2018-04-20',80,NULL,'<p>The final project deliverables are: </p><ul><li>A detailed pre- and post-campaign research report on your organization and your competitors.</li><li>A marketing campaign plan, designed and implemented based on your organization&#x27;s needs.</li><li>An evaluative report on the campaign&#x27;s success.</li><li>A presentation of the campaign&#x27;s process and evaluation.</li></ul><p></p>',1,NULL,'2017-08-10 20:42:33','2017-08-30 18:37:34','<p>Beginning this January, twenty students will spend over 1,600 hours creating and implementing a sophisticated marketing campaign for your organization. </p><p></p><p>Functioning as a marketing agency, students will conducting extensive pre-campaign and post-campaign research on the Generation Y population of local Pittsburgh college campuses to:</p><ul><li>Understand this target market.</li><li>Direct the formulation and implementation of your campaign.</li><li>Evaluate campaign effectiveness.</li></ul><p><strong>The student-lead campaign will increase awareness, familiarity, positive perceptions, and purchase consideration for your organization&#x27;s product or service through methods including but not limited to:</strong></p><ul><li>Campus events </li><li>Traditional and non-traditional advertising</li><li>Social media marketing</li><li>Public relations initiatives</li></ul><p>For project examples visit http://www.cba.pitt.edu/news/marketing-projects.php</p>',20,'4th year',0,NULL,'anywhere',NULL),(775,NULL,'draft','marketing communications plan',NULL,'mktg 420','marketing communications ',30,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-08-10 21:24:15','2017-08-10 21:47:03',NULL,NULL,'junior/senior',0,NULL,NULL,NULL),(776,464,'published','Tech Solution Designs & Data Analysis',NULL,'IDS 507','Master of Science in MIS Capstone',30,2017,'fall','<p>The projects for this course focus on technology solution designs and implementations as well as systems and data analysis. <br/> </p><p></p>','group','2017-08-28','2017-12-08',30,NULL,'<p>The final deliverables for this project will be determined based on your organization&#x27;s needs in the initial set of meetings with the instructor.</p><p></p><p>The group of student-consultants will spend approximately <strong>120 hours</strong> on your project.</p>',6,NULL,'2017-08-10 23:54:00','2017-08-18 01:51:10','<p>Over a 16 week period, a group of Master of Science in MIS students will focus on technology solution designs and implementations as well as systems and data analysis for your organization. </p><p> </p><p>Initially, the course instructors meet with the sponsoring organization to develop high-level expectations for their project. The student teams are then responsible for finalizing the scope of work and a work plan for their projects in conjunction with their mentors. </p><p></p><p>The students also meet weekly in class with their instructor to report project status. The instructor closely interacts with the mentor to assess the progress made by the student teams and whether expectations are being met. </p><p></p><p>Examples of projects completed in the past are:</p><ul><li>Website design and implementation</li><li>Mobile app design and implementation</li><li>Software evaluation and selection</li><li>Designing and implementing database systems</li></ul><p></p><p></p>',4,'Masters',0,NULL,'local',NULL),(777,464,'published','Business Analytics Consultation & Recommendations',NULL,'IDS 560','Master of Science in Business Analytics Capstone',30,2017,'fall','<p>Graduate students will focus on the application of business analytics tools and techniques to develop solutions for your organization&#x27;s information needs.<br/> </p><p></p>','group','2017-08-28','2017-12-08',30,NULL,'<p>The final deliverables for this project will be determined based on your organization&#x27;s needs in the initial set of meetings with the instructor.</p><p></p><p>The group of student-consultants will spend approximately <strong>120 hours</strong> on your project.</p>',6,NULL,'2017-08-11 00:07:21','2017-08-18 19:33:26','<p>Over a 16 week period, a group of students in the Master of Science in Business Analytics program will focus on developing solutions for your organization&#x27;s information needs. </p><p> </p><p>Initially, the course instructors meet with you to develop high-level expectations for their project. The student teams are then responsible for finalizing the scope of work and a work plan for their projects in conjunction with their mentors. </p><p></p><p>The students also meet weekly in class with their instructor to report project status. The instructor closely interacts with the mentor to assess the progress made by the student teams and whether expectations are being met. </p><p></p><p>Examples of projects completed in the past are:</p><p></p><ul><li>In-depth business analytic solutions</li><li>Big data analysis</li><li>Cognitive Computing</li></ul><p></p>',4,'Masters',0,NULL,'local',NULL),(778,464,'published','Management Consulting',NULL,'MBA 590','MBA Strategy, Planning, & Modeling ',30,2017,'fall','<p>A team of Graduate and MBA students will focus on addressing a business issue, and providing an actionable recommendation. <br/> </p><p></p>','group','2017-10-23','2017-12-08',30,NULL,'<p>The final deliverables for this project will be determined based on your organization&#x27;s needs in the initial set of meetings with the instructor.</p><p></p><p>The group of student-consultants will spend approximately <strong>120 hours</strong> on your project.</p>',1,NULL,'2017-08-11 00:20:16','2017-08-16 16:25:11','<p>Over a 8 week period, a group of students in the MBA and Masters students will focus on developing solutions for your organization&#x27;s needs. </p><p> </p><p>Initially, the course instructors meet with you to develop high-level expectations for their project. The student teams are then responsible for finalizing the scope of work and a work plan for their projects in conjunction with their mentors. </p><p></p><p>The students also meet weekly in class with their instructor to report project status. The instructor closely interacts with the mentor to assess the progress made by the student teams and whether expectations are being met. </p><p></p><p>Examples of projects completed in the past are:</p><ul><li>Strategy and modeling</li><li>process reviews</li><li>marketing program reviews and planning</li><li>financial analysis and planning</li></ul><p>These projects may involve technology components such as business intelligence, software evaluation/selection, and mobile enablement planning.</p><p></p><p></p>',4,'MBA and other graduate students',0,NULL,'anywhere',NULL),(779,464,'published','IT Strategy Consulting',NULL,'IDS 515','Masters in MIS - IT Consulting',30,2017,'fall','<p>A team of Graduate students will focus on leveraging IT and digital technologies to maximize your business performance<br/> </p><p></p>','group','2017-08-28','2017-12-08',30,NULL,'<p>The final deliverables for this project will be determined based on your organization&#x27;s needs in the initial set of meetings with the instructor.</p><p></p><p>The group of 3-4 student-consultants will spend approximately <strong>600-750 hours</strong> on your project.</p>',6,NULL,'2017-08-11 00:31:58','2017-08-16 16:25:36','<p>Over a 16 week period, a group of students in the Masters of MIS program will focus on leveraging IT and digital technologies to maximize business performance. This includes strategy formulation and implementation topics. </p><p> </p><p>Initially, the course instructors meet with you to develop high-level expectations for their project. The student teams are then responsible for finalizing the scope of work and a work plan for their projects in conjunction with their mentors. </p><p></p><p>The students also meet weekly in class with their instructor to report project status. The instructor closely interacts with the mentor to assess the progress made by the student teams and whether expectations are being met. </p><p></p><p>Examples of projects completed in the past are:</p><ul><li>Develop IT strategies</li><li>Evaluate the impact of new technology</li><li>Evaluate the market for a potential product or application they are considering. </li></ul><p></p><p></p><p></p>',4,'Masters in MIS Students',0,NULL,'anywhere',NULL),(780,488,'review','Hospitality Business Plan ',NULL,'HSPM 175','Entrepreneurship in Hospitality ',40,2017,'fall','<p>Hospitality students will create a traditional business plan for a start-up or generate creative business solutions for an established organization. </p>','group','2017-08-30','2017-11-15',20,NULL,'<p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to devise the project scope and prepare a detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. The team will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome - Report and Presentation: Students will submit a detailed business plan and present this in the last class. Organization representative(s) are invited to attend these presentations.</p>',8,NULL,'2017-08-11 01:26:44','2017-08-21 16:01:33','<p>Beginning this August, a group of five hospitality students will spend over 100 hours creating a business plan for your conceptual or established organization. </p><p></p><p>Through industry and organizational evaluation, students will provide insights and recommendations on unique opportunities for your organization around creating and managing hospitality programs and services. </p>',5,'3rd & 4th year',0,NULL,'regional',NULL),(781,NULL,'draft','Strategic Plan ',NULL,'BUS 140','Introduction to Entrepreneurship and Small Business Management',60,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-08-11 03:11:27','2017-08-11 03:11:27',NULL,NULL,'1st or 2nd year',0,NULL,NULL,NULL),(782,NULL,'review','Strategic plan ',NULL,'BUS 140 ','Introduction to Entrepreneurship and Small Business Management',60,2017,'fall','<p>Strategic plan </p><p>SWOT</p><p>Mission, vision, values</p><p>New pricing structure</p><p>Marketing Plan including advertisement </p><p>Presentation </p><p>Pitch Deck </p>','group','2017-09-18','2017-12-08',30,NULL,'<p>Strategic plan </p><p>SWOT</p><p>Mission, vision, values</p><p>New pricing structure</p><p>Marketing Plan including advertisement </p><p>Presentation </p><p>Pitch Deck</p>',1,NULL,'2017-08-11 03:14:33','2017-08-11 03:19:27','<p>Strategic plan </p><p>SWOT</p><p>Mission, vision, values</p><p>New pricing structure</p><p>Marketing Plan including advertisement </p><p>Presentation </p><p>Pitch Deck </p>',3,'1st and 2n year ',0,NULL,'anywhere',NULL),(783,23,'published','Online Course Creation',NULL,'BADM 335','Workplace Development',15,2017,'fall','<p>Students will apply experience in training principles and current educational technologies to design and create an interactive on-line learning session for your organization.</p>','group','2017-10-30','2017-12-08',20,NULL,'<p> <strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to devise the project scope. Students will then and prepare a detailed proposal and present to your organization.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the proposal. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome - Students will deliver an on-line learning tool for your organization along with suggestions for in person training and follow up as appropriate.</p><p>.</p><p></p>',1,NULL,'2017-08-11 14:12:13','2017-08-29 16:09:01','<p>Beginning in October, 5 groups of Workplace Development students will spend 300 hours designing and creating a customized online course for your organization. </p><p></p><p>Groups will either collaborate to create five sections of a longer training program, or compete to offer five options for one training session. Each session/section will be 1-3 hours. </p><p></p><p>Additional project scope may include:</p><ul><li>Planning  workshops</li><li>Produce training materials</li><li>Social media &amp; alternative tech implementation</li></ul><p></p>',3,'3rd year',0,NULL,'anywhere',NULL),(784,487,'published','Marketing Operations Consultancy',NULL,'MKTG 450','Marketing Research & Decision Making',19,2017,'fall','<p>Students will conduct primary and secondary research on your organization&#x27;s marketing operations. They will collect qualitative and quantitative data, analyze, and present an actionable report based on the findings.</p>','group','2017-10-03','2017-12-07',30,NULL,'<p> </p><p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to devise the project scope and prepare a detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome - Report &amp; Presentation: Students will submit a detailed report on the outcomes of the project. Teams will also present this in the last class. Organization representative(s) are invited to attend these presentations. </p><p></p><p><strong>The report will include:</strong></p><ul><li>Summary of the qualitative research, including key findings.</li><li>Summary of the quantitative research, including key findings.</li><li>Recommendations to improve marketing operations of your organization.</li><li>Presentation slides sharing the highlights of key findings and recommendations.</li></ul>',3,NULL,'2017-08-11 18:45:48','2017-08-29 15:50:34','<p>Beginning this September, students in groups of four will spend approximately 120 hours conducting research on your organization&#x27;s marketing operations and developing recommendations to improve effectiveness. </p><p></p><p><strong>The areas and methods of research will include but are not limited to the following:</strong></p><ul><li><u>Secondary Research</u><strong>: </strong>Data collection and analysis of your brand, product/service, and industry.</li></ul><p></p><ul><li><u>Primary Qualitative Research</u>: Conduct in-depth interviews/focus groups with consumers.</li></ul><p></p><ul><li><u>Primary Quantitative Research</u>: A digital survey will be designed and distributed to  100 consumers, users, and/or stakeholders (your email contact list will be used, if available). Data will be collected and analyzed for significance using STATA software.</li></ul><p>A final report with research results and applied recommendations for your organization to improve its marketing operations will be provided.</p>',4,'4th year',0,NULL,'regional',NULL),(785,487,'published','Marketing Communications Plan',NULL,'MKTG 420','Marketing Communications ',30,2017,'fall','<p>Students will develop an integrated marketing communication campaign for your organization.</p>','group','2017-11-07','2017-12-07',20,NULL,'<p> </p><p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to devise the project scope and prepare a detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome - Report and Presentation: Students will submit a detailed report on the outcomes of the project. Teams will also present this in the last class. Organization representative(s) are invited to attend these presentations. </p><p></p><p></p><p></p><p><strong>The organization will receive the presentation slides sharing the communications plan highlights and a 10-page report on the 6M&#x27;s below:</strong></p><p></p><ul><li><u>Mission</u>: Objective of campaign.</li><li><u>Market:</u> Who the campaign addresses.</li><li><u>Message</u>: The specific elements communicated.</li><li><u>Media</u>: The vehicles used in the campaign.</li><li><u>Money:</u> Amount spent on the campaign.</li><li><u>Measurement:</u> How the impact is assessed.</li></ul><p></p><p></p>',3,NULL,'2017-08-11 20:17:22','2017-08-29 15:48:38','<p>Beginning this November, two groups of five Marketing students will spend approximately 200 hours developing a tailored marketing communications plan for your organization. </p><p></p><p>Based on the information your organization provides and the goals shared with the students, they will provide you with a plan addressing a specific challenge or opportunity your organization is currently facing.  </p><p></p><p><strong>Areas of focus for this project include but are not limited to:</strong></p><p></p><ul><li>Marketing campaigns to new, or more specific customer segments.</li><li>Reaching an existing segment through a new channel.</li><li>Communicating the differences between competitors.</li><li>Identifying new channels and media outlets for improved communications.</li><li>Defining advertising objectives and strategies.</li></ul>',5,'3rd & 4th year',0,NULL,'local',NULL),(786,67,'published','Project Management ',NULL,'MGMT4035','Real World Project Management',40,2017,'fall','<p>A group of student-consultants will develop a thorough Project Management Plan for a project of your choosing.</p>','group','2018-01-08','2018-04-20',100,NULL,'<p><strong>Phase 1 </strong>- Project Plan: Students will meet with organization representative(s) to understand the project scope and prepare a detailed plan for completion of the project.</p><p><strong>Phase 2 - </strong>Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p><strong>Phase 3 - </strong>Report and Presentation: Students will submit a written project plan. Teams will also formally present their plan in class, which you are invited to attend (virtually or in person).</p>',6,NULL,'2017-08-11 21:53:04','2017-08-29 20:19:56','<p>A group of student-consultants will devote a cumulative total of 400 hours to developing a Project Management Plan for a project of your choosing. Using Project Management Theory, students will determine the breakdown of work of a future project for your organization, including project requirements, risks, costs, timelines, and responsibilities to drive the implementation process.</p><p></p><p><strong>Project examples could include, but are not limited to:</strong></p><ul><li>Development of a new website</li><li>Implementation of a new software or system</li><li>Business process change</li><li>A marketing initiative</li><li>New product/service launch</li><li>Evaluation of new technology</li><li>An event or workshop</li></ul>',4,'Graduate Certificate',0,NULL,'anywhere',NULL),(787,NULL,'draft','interactive',NULL,'cmgt587','audience analysis',25,2017,'fall',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,'2017-08-14 04:03:57','2017-08-14 04:03:58',NULL,NULL,'masters students',0,NULL,NULL,NULL),(788,190,'review','Prospective Market Analysis',NULL,'ECON 4900','Independent Study (Economics)',10,2017,'fall','<p>Ten student-consultants in economics help your organization predict short and long-term prospects in current or future markets. </p>','group','2017-10-02','2017-12-08',20,NULL,'<p>The final project deliverables are:</p><p></p><ul><li>30-minute presentation</li><li>10-page report</li><li>Optional Excel model</li></ul>',1,NULL,'2017-08-14 04:20:51','2017-08-21 18:10:29','<p>Beginning on October, 10 student-consultants in teams of 3-5 will spend 200 hours analyzing your current and prospective markets and the opportunities for your organization within them. </p><p></p><p>In applying economic market analysis, theoretical modelling, and empirical techniques, students will provide your organization with systematic insights into its competitive environment and resulting challenges and opportunities. </p><p></p><p><strong>Students will gather insights in the following ways:</strong></p><ul><li><u>Industry analysis</u>: Key economic features of your industry and implications for future profitability, entry or merger activity, and prices.</li></ul><p></p><ul><li><u>Macroeconomic outlook report</u>: Short and medium-term country and regional growth prospects,  volatility, and exchange rate risks for foreign countries</li></ul><p></p><ul><li><u>Social impact study:</u> Benefits and costs of a company or proposed project to the community.</li></ul><p></p><ul><li><u>Econometric modelling:</u> Regression to determine causal effects in organization-supplied data.</li></ul>',5,'Master\'s, 3rd & 4th year',0,NULL,'anywhere',NULL),(789,190,'review','Competitive Strategy & Pricing',NULL,'ECON 4900','Independent Study (Economics)',10,2017,'fall','<p>Graduate and upper-level undergraduate students will optimize your pricing options based on a game-theory model. </p>','group','2017-10-02','2017-12-08',20,NULL,'<p>The final project deliverables are:</p><p></p><p>- 30-minute presentation</p><p>- 10-page report</p><p>- Excel simulation (optional)</p>',1,NULL,'2017-08-14 05:21:28','2017-08-21 17:47:11','<p>Beginning in October, teams of 3 to 5 economic students will spend 200 hours analyzing how to optimize your pricing within constraints of your position, relative to key competitors and/or customer segments. </p><p></p><p>By applying game-theory, demand analysis, theoretical modeling, and empirical techniques students will provide your organization with systematic insights into the best competitive pricing options. </p><p></p><p><strong>Based on the information you provide, students may perform:</strong></p><ul><li><u>Game-theoretic modeling</u>: Strategic relationship with main competitors, and opportunities for preemptive moves.</li></ul><p></p><ul><li><u>Comparison of alternative pricing strategies</u>: Various pricing schemes and segmenting consumers groups for targeted discounts</li></ul><p></p><ul><li><u>Econometric analysis:</u> Regression to determine demand drivers in company-supplied data. </li></ul>',5,'3rd & 4th year, Master\'s',0,NULL,'anywhere',NULL),(790,190,'review','Compensation & Incentive Consultancy',NULL,'ECON 4900','Independent Study (Economics)',10,2017,'fall','<p>Economics students will help your organization optimize employee motivation and design fair and effective promotion systems.</p>','group','2017-10-02','2017-12-08',20,NULL,'<p>Your organization will receive from each group:</p><ul><li>30-minute presentation</li><li>10-page report</li><li>Excel simulation (optional)</li></ul>',1,NULL,'2017-08-14 05:45:38','2017-08-21 16:30:18','<p>Beginning this October, graduate and upper-level undergraduate student-consultants  in two teams of five will spend 200 hours developing consultant reports on compensation and incentives for your organization. </p><p></p><p>Based on the information your organization provides and applying their skills in economic analysis of incentives, theoretical modeling, and/or empirical techniques, students will provide your organization with systematic insights into effectively and fairly structuring compensation and promotion programs. </p><p></p><p><strong>Students may perform the following analysis:</strong></p><ul><li><u>Analysis of reward schemes</u>: Improving incentives through optimized bonus/promotion systems.</li><li><u>Econometric analysis</u>: Determining equitable representation of groups.<br/></li></ul>',5,'3rd & 4th year, Master\'s',0,NULL,'anywhere',NULL),(791,124,'draft','a class',NULL,'ME178','A Class',23,2017,'fall','<p>assignment character count</p>','individual','2017-08-14','2017-08-17',23,NULL,NULL,1,NULL,'2017-08-14 17:45:46','2017-08-14 17:46:25','<p>something</p>',2,'23 year',0,NULL,NULL,'2017-08-15 18:53:15'),(792,58,'published','Marketing Strategy Consultancy',NULL,'COM 351','Marketing Principles and Management',110,2017,'fall','<p>Student-consultants will research and analyse your organization&#x27;s current marketing practices, developing actionable recommendations on your target market, positioning, placement, and promotion to improve your marketing strategy&#x27;s effectiveness.    </p>','group','2017-10-16','2017-12-01',20,NULL,'<p>Each group will provide your organization:</p><ul><li>A 10 to 15-page report summarizing key findings and actionable recommendations. </li><li>A 20-minute presentation discussing their findings and recommendations. </li></ul><p></p>',10,NULL,'2017-08-14 17:53:44','2017-08-22 22:29:40','<p>110 students in groups of four will work with 10 organizations beginning this October. Student-consultant groups will each spend 80 hours researching your organization&#x27;s current marketing activities. Based on the data gathered through the following techniques, students will provide actionable recommendations on marketing strategy enhancements.</p><p></p><p><strong>Analyses may include, but are not limited to:</strong></p><ul><li>A comprehensive environmental analysis on macro-level factors including economic development and technological advancement and the implications for your organization.</li></ul><p></p><ul><li>Psychological analysis of potential customer decision making process through primary and secondary market research.</li></ul><p></p><ul><li>STP analyses to determine how to best develop your target market and brand positioning.</li></ul><p></p><ul><li>Analysis of how to design your marketing mix through key decisions on product, price, place, and promotion.</li></ul><p></p><ul><li>Analysis of how to manage long-term profitable customer relationships.</li></ul><p></p><p>Project outcomes may be published as business cases, with organization approval.</p>',4,'3rd year',0,NULL,'anywhere',NULL),(793,71,'review','Marketing Strategy Consulting',NULL,'MKTG 5200','Marketing Strategy',60,2018,'winter/spring','<p>Are you in need of a strategic marketing plan? Student consultants will work with a local industry partner to identify and define a significant strategic marketing problem or opportunity unique to each participating organization.</p>','group','2018-02-28','2018-04-25',NULL,NULL,'<p>After 3<u><strong> months of work on your strategic marketing roadmap</strong></u>, the group of student-consultants will submit:</p><ol><li><strong>5,000-word consulting report </strong></li><li><strong>Optional in-person presentation</strong> </li></ol>',1,NULL,'2017-08-16 16:16:52','2017-08-16 20:18:10','<p>Are you in need of a strategic marketing plan? Student consultants will work with a local industry partner to identify and define a significant strategic marketing problem or opportunity unique to each participating organization. The student teams will carry out extensive research to prepare analysis and recommendations for how the client should proceed. </p><p></p><p>Potential <strong>scopes for this project can include</strong> but are not limited to; </p><ul><li><strong>promoting a new product/service launch,</strong></li><li><strong>increasing revenue for an existing product/service,</strong></li><li><strong>increasing market share,</strong></li><li><strong>customer acquisition/retention,</strong></li><li><strong>increasing brand awareness, and</strong></li><li><strong>meeting the needs of a specific customer segment, etc.</strong> </li></ul>',4,'MBA',0,NULL,'local',NULL),(794,58,'published','International Marketing Plan',NULL,'IB 416','International Marketing',50,2017,'fall','<p>Student-consultants will develop an actionable marketing plan for your organization to expand into a new international market or improve marketing efforts within an existing international market.</p>','group','2017-10-16','2017-12-01',20,NULL,'<p> The final deliverables include:</p><ul><li>A 10-15 page report summarizing student&#x27;s key findings and actionable recommendations.</li><li>A 15-minute presentation for each group to share and discuss their findings. (Organizations are expected to attend in-person or remotely)</li></ul>',5,NULL,'2017-08-16 17:11:45','2017-08-21 18:29:50','<p>In groups of 5, marketing students will spend 100 hours developing an actionable and effective marketing plan for your organization&#x27;s new or established international markets. </p><p></p><p><strong>Groups will provide plans which meet the following minimal criteria: </strong></p><ul><li>Analyze which country/countries to enter based on market opportunity.</li></ul><p></p><ul><li>Develop a profile of potential customers in the new market, based on macro-level environmental analyses, consumer behavior analyses, and marketing research from secondary and primary data.</li></ul><p></p><ul><li>Create an STP strategy through detailed market segmentation profiles, targeting potential groups of customers with effective evaluation, and positioning your brand accordingly.</li></ul><p></p><ul><li>Develop an actionable Marketing Mix plan with recommended design, branding, pricing, placement, and promotion tactics.</li></ul><p></p><ul><li>Summarize major recommendations.</li></ul><p></p><p>Student work will be edited by the course instructor and potentially published as business case study (with your approval).</p>',5,'4th year',0,NULL,'anywhere',NULL),(795,461,'draft','Master\'s Business Valuation',NULL,'ACCT 522','Valuation I',75,2017,'fall','<p>Master&#x27;s students will work closely with your management team to create a basic valuation report. Reports will include a company analysis, a projection of future cash flows and investments, and a discounted cash flow analysis. </p>','group','2017-08-29','2017-12-11',25,NULL,'<ul><li>You will receive a basic valuation report (approximately 25 pages) using the income approach (i.e. discounted cash flow analysis), along with an analysis of future growth for your company.</li><li>Students will present their findings to you in a presentation format (approximately 15 minutes) including Q&amp;A.</li></ul>',1,NULL,'2017-08-16 18:06:22','2017-08-16 18:06:22','<p>Starting in August, a group of 3 Master&#x27;s students will spend approximately 75 hours combined over the course of the semester assessing and summarizing your business and competitive position within your industry, leading to an evaluation of your prospects for future growth. </p><p></p><p>Student groups will analyze and normalize your historical income statements and balance sheets to reflect &quot;market participant assumptions&quot;. With your assistance, student groups will project future income and investment needs, and determine appropriate short and long-term growth and discount rates. </p><p></p><p>Finally, students will use a suitable discounted cash flow model to derive an indication of value for your organization. </p>',3,'Master\'s Students',0,NULL,NULL,NULL),(796,NULL,'draft','Senior Capstone Project in <insert IT specialty>',NULL,'IT4990','Information Technology Capstone',24,2017,'winter/spring','<p>Test text, specific to specialization</p>','group','2018-01-08','2018-03-16',120,NULL,'<p>List of deliverables?</p>',6,NULL,'2017-08-16 20:17:49','2017-08-16 20:45:27','<p>Examples specific to the specialization area of learner.</p>',3,'4th year/graduating seniors',0,NULL,'anywhere',NULL),(797,11,'published','Small/Medium Business Consulting Project',NULL,'ENT 555','Entrepreneurship',30,2016,'fall','<p>A group of 5-7 student consultants will assist a local small business by addressing a real-life<u><strong> business problem of the owner&#x27;s choosing</strong></u>. </p>','group','2017-09-25','2017-12-15',NULL,NULL,'<p>The deliverable is a report and presentation with actionable recommendations, based on industry best practices. </p>',12,NULL,'2017-08-18 18:00:19','2017-08-24 19:30:09','<p>A group of 5-7 student consultants will assist a local small business by addressing a real-life<u><strong> business problem of the owner&#x27;s choosing</strong></u>.  Examples include, but are not limited to: </p><ul><li><strong>How to reach a specific target market </strong></li><li><strong>Increasing revenue for a product/service </strong></li><li><strong>Identifying potential partnerships         </strong></li><li><strong>Identifying and cutting unnecessary costs</strong></li><li><strong>Identifying technology to adopt</strong></li><li><strong>Reducing employee turnover </strong></li></ul>',5,'',0,NULL,'local',NULL),(798,326,'published','Strategic PR Consultancy',NULL,'PREL 4320','Public Relations Management',20,2017,'fall','<p>Students will create a strategic Public Relations Plan for your organization that achieves a marketing goal and/or solves a communication challenge.</p>','group','2017-10-05','2017-11-30',15,NULL,'<p><strong>Phase 1</strong> – Project Plan: Students will meet with organization representative(s) to devise the project scope and prepare a detailed plan for completion of the project.</p><p> </p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p> </p><p><strong>Phase 3</strong> - Outcome - Report and Presentation: Students will submit a detailed report on the outcomes of the project including:</p><ul><li>A strategic plan with recommendations (PowerPoint). </li><li>Supporting materials and accompanying recommendations.</li></ul>',1,NULL,'2017-08-18 20:45:09','2017-09-01 00:32:26','<p>Beginning this October, 5 groups of student-consultants will spend 300 hours researching and developing a Public Relations Plan for your organization.</p><p></p><p>Simulating an agency, students will execute a strategic planning process including:</p><ul><li>Situation analysis</li><li>Research and insights</li><li>Target audience identification</li><li>Strategy</li><li>Execution plan</li><li>Timeline and budgets</li></ul><p>Upon completion, your organization will have a full communication plan (not including advertising) that will assist in achieving a marketing goal and/or solve a communication challenge.</p><p><br/><strong>Examples of project scopes include, but are not limited to:</strong></p><ul><li>Strategic PR plan to launch a new product or promote an existing product/service.</li></ul><p></p><ul><li>Integrated plan to raise visibility and attract new members for a nonprofit organization.</li></ul><p></p><ul><li>Creative approach and plan for publicizing a business to consumers.</li></ul>',4,'4th year',1,NULL,'local',NULL),(799,59,'published','Industry Project Request & Scoping Form',NULL,'','Industry Project Request & Scoping Form',NULL,2017,'other','<p>Do you want to work with Douglas students, but have a project scope that doesn&#x27;t fit into one the assignments currently open in this portal? Then please submit your project scope here and we will do our best to match it to a class ASAP.</p>','group','2017-06-04','2017-12-31',50,NULL,'<p>This is open and can be established once we connect you with an educator and student/s interested in working on your project scope. </p><p></p><p>Often the deliverables include; </p><p> - a report with findings and recommendations</p><p> - a presentation</p><p> - implementation plans</p>',0,NULL,'2017-08-18 23:38:17','2017-08-18 23:41:10','<p>Are you an organization with a project scope outside of what is currently available? Do you have an project idea that could benefit from the time, skills, and effort of commitment of students? </p><p></p><p>It doesn&#x27;t matter if it is a clear project scope or just an idea that needs to to be further explored, please submit it here. </p><p></p><p>Our team will review it, give you a call to gather more information (if necessary) and then try to match it with a class and educator that is appropriate, as soon as possible. </p>',0,'Unknown',0,NULL,'anywhere',NULL),(800,128,'published','Analytics Modeling',NULL,'IS 485','Information Systems Project',20,2017,'fall','<p>A group of IT students will develop an analytical model for your organization&#x27;s data to identify patterns and insights that will assist decision-making.</p>','group','2017-09-13','2017-12-06',25,NULL,'<p>The final 5 to 10-page report will include:</p><ul><li>An executive summary highlighting the most salient insights.</li><li>Visualizations of important patterns and associations.</li><li>Analyses of business insights and recommendations.</li><li>Models used.</li></ul>',5,NULL,'2017-08-19 00:03:06','2017-08-25 19:51:43','<p>Beginning this September, a groups of 3-4 student-consultants will spend ~100 hours developing an analytical model for your operational data (e.g., sales, clickstream, etc.). </p><p></p><p>The custom model will be a tool that your organization can use to assist leadership with data-based decision making. </p><p></p><p>Selected organizations will initially meet with the class instructor, who is an IT executive with over 20 years of technology experience. The instructor and your organization will establish the project objectives, scope, and deliverables. </p><p></p><p>Students groups will work within your defined parameters to develop and execute a project plan, providing weekly progress updates.  </p>',4,'4th year',0,NULL,'anywhere',NULL),(801,128,'published','Custom IT Solution Consultancy',NULL,'IS 485','Information Systems Project',20,2017,'fall','<p>A group of IT students experienced in database design, programming, and web design will deliver a custom technology solution for your organization.</p>','group','2017-09-13','2017-12-06',25,NULL,'<p> </p><p><strong>Phase 1 </strong>– Project Plan: The instructor will meet with organization representative(s) to devise the project scope and deliverables. Students will prepare a detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome - Report and Presentation: Students will submit a detailed 5-10 page report on the outcomes of the project along with all other deliverables agreed upon in phase 1.</p><p></p>',4,NULL,'2017-08-19 22:06:37','2017-08-29 15:59:07','<p>Beginning this September, a group of 3-4 students will spend approximately 100 hours designing and developing a custom technology solution for your organization. </p><p></p><p><strong>Example projects include but are not limited to:</strong></p><ul><li>Website design</li><li>Software evaluation and selection</li><li>Technology assessment</li><li>Database design</li></ul><p>Selected organizations will initially meet with the class instructor, who is an IT executive with over 20 years of technology experience. The instructor and your organization will establish the project objectives, scope, and deliverables. Students groups will work within your defined parameters to develop and execute a project plan.</p><p></p>',4,'4th year',0,NULL,'anywhere',NULL),(802,489,'published','Project Management Consultancy',NULL,'PMGT 280','Project Management',29,2017,'fall','<p>A group of 3-5 Global Business students will prepare a Project Management Plan for a project of your choosing.  The plan will address a core business issue and include a business case, scope, schedule, budget, risk, and communication management.</p>','group','2017-10-06','2017-12-08',30,NULL,'<p>Student-consultants will provide:</p><ul><li>A Project Charter describing the project and the schedule of work</li><li>Weekly Status Reports</li><li>A Project Management Plan</li><li>Final Presentation</li></ul>',9,NULL,'2017-08-20 17:40:54','2017-08-29 16:25:27','<p>Beginning this October, a group of 3-5 Global Business students --experienced in business strategy, operations, and marketing-- will spend approximately 120 hours developing a thorough Project Management Plan for a project of your choosing.  </p><p></p><p><strong>Based on the information provided, the plan will describe:</strong></p><ul><li>Work breakdown structure</li><li>Budget estimates</li><li>Optimal schedule</li><li>Communication</li><li>Stakeholder management</li><li>Risk management</li></ul><p></p><p><strong>Examples of projects have included, but are not limited to:</strong></p><ul><li>Development of a new website</li><li>Implementation of a new software or system</li><li>Business process change</li><li>Office relocation</li><li>Re-branding or new logo implementation </li><li>New product/service launch </li><li>Evaluation of new technology or suppliers</li><li>An event or workshop (company picnic, corporate retreat, charitable fundraiser)</li><li>Small construction project</li></ul>',3,'3rd & 4th year',0,NULL,'anywhere',NULL),(803,490,'published','Database App Development',NULL,'IS443_543','Database Design and Implementation',30,2017,'fall','<p>This <strong>Fall</strong>, in teams of <strong>4</strong>, <strong>Upper-Level Student-Consultants</strong> will design and implement a new or refurbished database application for your organization. </p>','group','2017-09-19','2017-12-08',35,NULL,'<p> </p><p><strong>Phase 1 </strong>– Project Plan: Student-consultants will meet with organization representative(s) to devise the project scope and prepare a detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. The team will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 3</strong> - Outcome: The final project deliverables include:</p><ul><li>Entity Relational Diagram (database design)</li><li>Normalized relational schema (logical design)</li><li>A working prototype (functional database)</li></ul>',8,NULL,'2017-08-22 20:15:11','2017-08-29 21:54:16','<p>Beginning this September, student-consultants in a group of 4 will dedicate 140+ hours over the entire semester developing a custom database application for your organization.  </p><p></p><p>The students will conduct a conceptual database design (Entity Relationship Modeling), logical design (Normalization), and implementation using Oracle 12c.  </p><p></p><p><strong>Project scope may include:</strong></p><ul><li>Examine an organizational data requirement and propose a new database to support operations</li></ul><p>OR </p><ul><li>Examine an existing database that doesn&#x27;t meet organizational requirements and propose appropriate updates and improvements</li></ul><p></p><p><strong>AND</strong></p><ul><li>Create a custom database application solution that supports your organization&#x27;s operational needs</li></ul>',4,'3rd & 4th year',0,NULL,'anywhere',NULL),(804,435,'review','Urulu Network - Use Cases',NULL,'MMG C3 - Urulu','Cambridge College Consulting',5,2017,'summer','<p>Urulu Network is a website for workers to be matched with mentors &amp; coaches to improve their professional standing through career guidance and skill enhancement. Students, this semester, will develop the website architecture &amp; user-interface. </p>','group','2017-06-05','2017-10-13',10,NULL,'<p> Students will be delivering the following:<br/></p><ul><li>Website functionality and design document</li><li>Wireframes</li><li>Social media strategy and plan</li><li>Use cases</li></ul>',1,NULL,'2017-08-24 16:57:46','2017-08-24 18:06:54','<p>Students will be delivering the following:</p><p></p><ul><li>Website functionality and design</li><li>Wireframes</li><li>Social media strategy and plan</li><li>Use cases</li></ul>',4,'Graduate',0,NULL,'local',NULL),(805,124,'review','Training & Development Report',NULL,'MGMT 4486','Training and Development',45,2017,'fall','<p>Undergraduate students will carry out and write up a training needs analysis, select the appropriate training method and design, and evaluate the effectiveness of the training. </p><p> </p>','group','2017-09-04','2017-11-24',20,NULL,'<p><strong>Phase 1 </strong>– Project Plan: Students will meet with organization representative(s) to devise the project scope and prepare detailed plan for completion of the project.</p><p><strong>Phase 2</strong>  – Project Execution: Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p><strong>Phase 3</strong> - Outcome Report and Presentation: Students will submit detailed report on the outcomes of the project. Teams will also present this in the last class. Organization representative(s) are invited to attend these presentations.</p><ul><li>A 10 page training report document, that will include a training needs analysis, training design and methods, and an evaluation of the training intervention. </li><li>10 minute group presentation. </li></ul>',1,NULL,'2017-08-25 14:12:05','2017-08-25 14:13:48','<p>Starting in September, a group of 3 HR student-consultants will solve a training and development challenge currently facing your business over an intensive 3 week period.</p><p></p><p>Based on the information and goals you have shared with the students, the report they provide will help you improve your current training and development processes. </p><p></p><p><strong>Project examples could include, but are not limited to:</strong></p><ul><li>Orientation training for new employees. </li><li>Training to increase the work-related skills of employees.</li><li>Training that addresses undesired attitudes and/or beliefs in the workplace. </li></ul>',3,'4th year ',0,NULL,'anywhere','2017-08-25 15:20:52'),(806,406,'published','Recruiting & Selection Plan for New Hires',NULL,'MGT 4660','Employee Selection',22,2017,'fall','<p>Undergraduate student consultants will produce a recruiting/selection strategy tailored to a specific job/role to help your organization to make successful hiring decisions. </p>','group','2017-10-26','2017-12-05',25,NULL,'<ul><li>Written recruiting and hiring strategy with specific recommendations tailored to the needs of your company (approx. 15 pages)</li></ul>',2,NULL,'2017-08-25 18:50:28','2017-08-30 18:37:20','<p>Two groups of 5-6 management students will spend approximately 250 combined hours to develop a recruitment and selection strategy for a specific job in your organization. This project will being in October and continue through early December.</p><p></p><p>You can choose whether you would like the teams to focus on one role or have each team focus on a different role. You will provide information about your organization and the job(s) for which you will be hiring, including any existing challenges or goals you have for your staffing strategy. Student groups, with support from the instructor, will use this to provide tailored recommendations and a plan of action to help you effectively find, attract, and choose the best possible candidate for the position.</p><p></p>',5,'4th year',0,NULL,'anywhere',NULL),(807,23,'published','Social Enterprise Plan',NULL,'BADM 332','Social Entrepreneurship Consultancy',20,2017,'fall','<p>Undergraduate student-consultants will develop focused recommendations and a tactical plan for your local social venture in order to help you take advantage of an opportunity or overcome a challenge that you&#x27;re facing. </p>','group','2017-10-30','2017-12-05',30,NULL,'<p><strong>Phase 1 </strong>– <u>Project Plan:</u> Students will connect with organization representative(s) to devise the project scope, present their team charter, and prepare a detailed plan for completion of the project.</p><p></p><p><strong>Phase 2</strong>  – <u>Project Execution:</u> Students will work on deliverables outlined in the project plan. Teams will periodically communicate with organization representative(s) as needed to complete project tasks.</p><p></p><p><strong>Phase 2.5 </strong>- <u>Presentation:</u> Students will present their insights, recommendations and plan to their classmates; attendance by representatives from project clients is welcome, but optional. </p><p></p><p><strong>Phase 3</strong> - <u>Outcome - Comprehensive Report:</u> Students will submit a detailed report on the outcomes of the project. Report will cover: definition of the problem or opportunity, supporting research and analysis, recommendations, implementation/action plans, monitors/controls, and limitations/risk analysis, accompanied by appendices containing all their research findings and references.</p>',2,NULL,'2017-08-25 20:53:27','2017-08-29 16:07:54','<p>Starting this October, student teams of undergraduate business students will work diligently over the course of the semester to produce a professional, clearly structured plan for a problem or opportunity your organization is facing. Your organization will receive a few final deliverables, which will include research and analysis, recommendations, implementation/action plans, a risk analysis, and more. </p><p></p><p><strong>Areas of focus for this project can include, but are not limited to:</strong></p><ul><li>Creation of a complete business plan for product or service.</li><li>Development of a new market entry strategy.</li><li>Design of a marketing plan to reach a specific target audience.</li><li>Performing a detailed competitor and environmental analysis.</li><li>Assessing and improving HR practices.</li><li>Evaluating the effectiveness of current IT systems.</li></ul>',5,'3rd & 4th years ',0,NULL,'anywhere',NULL),(808,217,'review','Web Design Campaign',NULL,'MMC 6936','Web Design Capstone',12,2017,'winter/spring','<p>Give your organization a new look - students work to build you a responsive website and create branding material to use in marketing campaigns. </p>','group','2018-01-08','2018-04-23',50,NULL,'<p><strong>Student teams will develop research, branding and web tools for a client. Deliverables will include:</strong></p><p> </p><ul><li>Situation Analysis</li><li>Logo Design Proposal</li><li>Branding Guide</li><li>Communication Designs (ex. letterhead, business cards, etc.)</li><li>Fully Functioning Responsive Website</li><li>Campaign Book</li></ul><p></p><p>The student teams will pitch their campaign ideas to the client at the end of the semester. The client can then select a winner and opt to utilize that design work.</p>',1,NULL,'2017-08-29 13:17:51','2017-08-29 13:20:14','<p>In this project a class of (10-15) Master&#x27;s level students will work a combined total of 600 hours to provide a fully functioning responsive website for your organization. Through research and client feedback channels they will construct a new home for your organization online. </p><p></p><p>Students will also redesign an existing logo or create a new logo, develop branding materials and provide research to the client.</p><p> </p><p><strong>Project examples include, but are not limited to:</strong></p><ul><li>Nonprofit website</li><li>Website for startup companies</li><li>Website for service business</li><li>Website for hotels/restaurants with reservation </li></ul>',2,'Master\'s',0,NULL,'anywhere',NULL),(809,38,'review','Social Media Strategy Plan',NULL,'MARK 3150','Social Media Strategy',35,2017,'fall','<p>A team of 3-4 student-consultants will develop a goals-based social media strategy plan for your organization.</p>','group','2017-09-12','2017-11-28',20,NULL,'<p>Upon project completion, your organization will receive:</p><ul><li>15-minute presentation on recommendations with additional 5-minute Q&amp;A .</li><li>Presentation slides.</li><li>Relevant detail summaries including market research and/or competitive intelligence.</li></ul>',9,NULL,'2017-08-29 21:10:14','2017-09-01 16:44:13','<p>Beginning this September, a group of 3-4 marketing students will spend 80 hours researching and developing a goals-based social media strategy plan for your organization. </p><p></p><p>Based on organizational and market research, student-consultants will recommend the best opportunities for using social media to achieve your overarching marketing and business goals.</p><p></p><p><strong>Your Social Media Strategy Plan will define:</strong></p><ul><li>Business &amp; marketing goals.</li><li>Target audience.</li><li>Theme(s) and message(s) to be communicated .</li><li>Specific ideas for campaigns and ongoing activities.</li><li>Cross-platform content calendar.</li><li>How paid, owned, and earned media should be used together.</li><li>Strategy for encouraging target audience social interactions with other consumers to “spread the word”.</li><li>How performance will be measured and evaluated, i.e. ROI.</li></ul><p></p><p></p>',4,'3rd & 4th year',0,NULL,'regional',NULL),(810,14,'review','Human Resources Challenge: Live Case',NULL,'COMM203','Managing People at Work',500,2017,'fall','<p>Sauder business students will give insights and recommendations into a human resources challenge of your choosing, as a live case study. The best reports will be provided to your organization to integrate into your HR processes.</p>','individual','2017-10-02','2017-12-08',15,NULL,'<p>At the end of the project, you&#x27;ll receive strategic recommendations from up to 10 students who have been identified by faculty as having the strongest reports.</p>',1,NULL,'2017-08-30 21:26:32','2017-08-31 23:33:27','<p>Your organization can provide students with a human resources challenge or opportunity of your choosing, and receive insights from 500 Sauder business students.</p><p></p><p>Students will approach your challenge as a live case study, and apply academic theory and personal insights to develop strategic recommendations for your organization to implement. Only the top reports (as selected by faculty) will be sent to your organization to provide feedback on.</p><p></p><p>Possible challenges could include, but are not limited to:</p><ul><li>How to attract talent from the student demographic</li><li>What are the key factors that help retain under-30 employees?</li><li>What are the best tools and selection criteria to narrow down a large field of candidates?</li></ul>',2,'2nd year',0,NULL,'local',NULL),(811,124,'published','sdfsadfas',NULL,'sdfas','sdafasf dfs',32,2017,'fall','<p>xxzcsfd</p>','individual','2017-09-14','2017-12-13',34,NULL,'<p>fafas</p>',33,NULL,'2017-08-30 23:30:59','2017-08-30 23:50:25','<p>sdafasdfas</p>',2,'fdz',0,NULL,'anywhere','2017-08-31 00:24:10'),(812,492,'review','Elevator Pitch, Business Model Canvas & Lean Canvas',NULL,'BNTR 9704','Global Entrepreneurship',30,2017,'fall','<p> Familiarize yourself with KnowQuest and create 3 artifacts: Lean Canvas, Business Model Canvas, Elevator Pitch </p>','individual','2017-10-02','2017-12-08',3,NULL,'<p>Elevator Pitch</p><p>Lean Canvas</p><p>Business Model Canvas</p>',1,NULL,'2017-08-31 17:57:02','2017-09-01 12:40:00','<p>Familiarize yourself with KnowQuest and create 3 artifacts: Lean Canvas, Business Model Canvas, Elevator Pitch  What is KnowQuest? (You will hear about Knowquest during the semester from your instructor)In order for you to obtain your 2% bonus marks you will do the following:</p><ol><li>Go to Riipen (www.riipen.com), register and create a profile;</li><li>Locate BNTR 9704 course;</li><li>Find the link to KnowQuest (www.knowquest.net)</li><li>Read the project description;</li><li>Familiarize yourself with KnowQuest; (Your Instructor will also give you information about the platform throughout the course);</li></ol><p></p>',2,'4th year',0,NULL,'regional',NULL),(813,41,'published','Social Media Marketing Audit',NULL,'MCOM 10202','Media Creative Services 1/2',40,2017,'fall','<p>Students will analyze your social media strategy  and make recommendations on how it can be improved. This will be outlined by an implementation plan and presentation. If there is no strategy, students will devise one.</p>','group','2017-09-25','2017-11-30',20,NULL,'<p>The students will provide you with a report describing their strategy and recommendations. If you&#x27;re open to it, students can implement some of the changes they suggest, and can provide you with sample pieces of content.</p>',1,NULL,'2017-08-31 20:50:08','2017-08-31 21:25:27','<p>A group of 5 junior and senior level Broadcasting: Television and Communications Media students will spend 50+ hours analyzing the strengths and weaknesses of the industry partner’s social media communications strategy.</p><p></p><p>Students will produce suggestions and recommendations surrounding key messaging, as well as a plan for implementing their ideas. A strong social media strategy can help industry partners provide rich customer experiences, increase website traffic, and gain valuable customer insights.</p><p>The social media plan will outline how to either build on what the industry partner is currently doing or not doing, including suggestions like tools for social, frequency of posting, content types, hashtags, etc. for each social media platform, such as Twitter, Instagram, Snapchat and Facebook.</p>',5,'3rd year',0,NULL,'anywhere',NULL),(814,332,'published','Organizational Behaviour Consulting',NULL,'HRM 821 (C21)','Organizational Behaviour Consulting',60,2017,'winter/spring','<p>Student-consultants will develop an action plan that addresses a leadership or management challenge currently faced by your organization.  This will be an entire class, all divided into groups of 5. </p>','group','2017-12-11','2018-01-19',30,NULL,'<p>The final project deliverable is a 10-page written report detailing the problem, recommended solutions, and action plan.</p>',1,NULL,'2017-08-31 21:48:23','2017-08-31 21:57:28','<p>Based on information you share and provide, student-consultants will develop an action plan that addresses a leadership or management challenge currently faced by your organization.  Over a 5 week period, the students will diagnose the problem and develop a strategy to help you address it.</p><p></p><p><strong>Sample student projects include, but are not limited to:</strong></p><ul><li>Designing/redesigning an internal system or process related to socialization, motivation, team management, conflict resolution, leadership, change management, talent management, etc.</li><li>Developing a plan to re-imagine your mission, vision, and purpose and roll it out to employees</li><li>Strategy for integrating cultures in a merger or acquisition</li><li>Diagnosing your organizational structure and its fit with your organization’s strategy</li><li>Developing a plan to increase diversity and outlining the positive effects of diversity in your organization</li><li>Developing a plan to address employee turnover / improve employee retention</li></ul>',5,'Continuing Education',0,NULL,'anywhere',NULL),(815,NULL,'review','Compensation/Wage Research',NULL,'MGMT 442','Compensation & Benefits',11,2018,'winter/spring','<p>Students will research wage levels for specified jobs utilizing company job descriptions, organizational pay strategies, organization chart/job relationships, industry information and publicly available wage data. </p>','group','2018-02-28','2018-04-18',25,NULL,'<p>The organization will receive a comprehensive report on wage levels incorporating competitive wage data from publicly available sources for specified organizational jobs. The report may contain analysis of inflation and unemployment trends, reviews of job descriptions for clarity, wage policy recommendations or application, as appropriate, and other wage research concerns that may be within the scope of the timeline provided that is unique to the organization&#x27;s needs.</p>',1,NULL,'2017-08-31 22:12:24','2017-08-31 22:38:02','<p> Companies will receive recommended wage ranges for up to 15 distinct jobs. (this # is flexible) Each group of approximately 3 students will conduct research on 5 or 6 jobs. Jobs will be assigned in overlapping groups so that each job is researched by more than one group.</p><p></p><p>Final data will be compiled into a single report to the company. The report will contain wage recommendations and research sources.</p>',3,'4th year',0,NULL,'regional',NULL),(816,41,'published','Branding & Content Production',NULL,'ADVG 420','Agency Workshop & Production House',30,2017,'fall','<p>Students will act as an outside creative agency for your company, spending three months developing branding and content collateral for your advertising needs.</p>','group','2017-09-04','2017-11-30',80,NULL,'<p>The deliverable is dependent on what your organization&#x27;s needs are, and the expectations set in your initial meeting with students. At the conclusion of the project, they will provide <u><strong>actual branding and/or content collateral that you can use</strong></u>, immediately. </p>',1,NULL,'2017-09-01 17:13:32','2017-09-01 17:21:21','<p>Students will act as an outside creative agency for your company, spending three months developing branding and content collateral for your advertising needs. They will meet with you to learn about your company and advertising goals, then develop materials that you can use to promote your business.</p><p></p><p><strong>Project examples include, but are not limited to:</strong></p><ul><li>Branding strategy for a dance school</li><li>Writing and social media for an intern program for NYC High School students</li><li>Social media and sales materials for a non-profit</li><li>Search ad + search engine optimization for an online retailer</li></ul>',20,'4th year',0,NULL,'anywhere',NULL);
