  `updated_at` datetime DEFAULT NULL,
  `access_email_domain` varchar(255) DEFAULT NULL,
  `access_type` varchar(255) NOT NULL DEFAULT 'email_domain',
  `magic_token` varchar(255) DEFAULT NULL,
  `featured` tinyint(1) DEFAULT '0',
  `google_place_id` varchar(255) DEFAULT NULL,
  `location_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `portals_subdomain` (`slug`),
  UNIQUE KEY `portals_name` (`name`),
  UNIQUE KEY `portals_magic_token` (`magic_token`),
  KEY `portals_featured` (`featured`),
  FULLTEXT KEY `portals_name_slug_biography` (`name`,`slug`,`biography`)
) ENGINE=InnoDB AUTO_INCREMENT=493 DEFAULT CHARSET=latin1;
